import{_ as g,o as t,c as n,a as i,t as u,C as h,M as _,U as k,f as p,F as w,p as b,e as v,q as D}from"./chunks/framework.B1z0IdBH.js";const f={name:"PoemCard",props:{poem:{type:Object,required:!0}},methods:{handleImageError(a){a.target.src="/images/logo.svg"}}},B={class:"entry-container"},y={class:"entry"},A={class:"entry-image"},j=["src","alt"],C={class:"entry-content"},z={class:"entry-title"},E=["href"],S={class:"entry-description"};function x(a,e,s,m,o,r){return t(),n("div",B,[i("div",y,[i("div",A,[i("img",{src:s.poem.image_url,alt:s.poem.page_title,onError:e[0]||(e[0]=(...d)=>r.handleImageError&&r.handleImageError(...d))},null,40,j)]),i("div",C,[i("h2",z,[e[1]||(e[1]=i("span",{class:"title-icon"},null,-1)),i("a",{href:s.poem.page_url,target:"_blank"},u(s.poem.page_title),9,E)]),i("p",S,u(s.poem.context_page_description),1)])])])}const P=g(f,[["render",x],["__scopeId","data-v-fe31ac51"]]),M=JSON.parse(`[{"page_url":"https://uk.wikipedia.org/wiki/%D0%9B%D1%96%D0%BD%D0%B5%D1%86%D1%8C%D0%BA%D0%B8%D0%B9_%D0%9E%D0%BB%D0%B5%D0%BA%D1%81%D0%B0%D0%BD%D0%B4%D1%80_%D0%92%D0%B0%D1%81%D0%B8%D0%BB%D1%8C%D0%BE%D0%B2%D0%B8%D1%87","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c7/%D0%A5%D0%B0%D1%80%D0%BA%D1%96%D0%B2%2C_%D0%B2%D1%83%D0%BB._%D0%A1%D1%83%D0%BC%D1%81%D1%8C%D0%BA%D0%B0%2C_116.JPG","page_title":"Лінецький Олександр Васильович","context_page_description":"Лінецький Олександр Васильович — український архітектор.\\nНавчався у І-й казенній гімназії в Кам\\"янці-Подільському. Працював у Красноярську, Ачинську, Омську, Харкові, у Києві. У 1938—1947 роках викладав у Харківському інституті інженерів комунального будівництва."},{"page_url":"https://af.wikipedia.org/wiki/Kapsuulhotel","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6d/CapsuleHotel.jpg","page_title":"Kapsuulhotel","context_page_description":"'n Kapsuulhotel, ook bekend as 'n podhotel, is 'n tipe hotel wat in Japan ontwikkel is, en wat bestaan uit 'n groot aantal baie klein \\"kamers\\". Die hotel maak voorsiening vir goedkoop, basiese oornaghuisvesting vir gaste wat nie die dienste aangebied deur die meer konvensionele hotelle benodig nie."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%92%D1%8B%D1%80%D1%83_(%D0%B2%D0%BE%D0%BB%D0%BE%D1%81%D1%82%D1%8C,_2017)","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/76/P%C3%B5rguhaud.jpg","page_title":"Выру (волость, 2017)","context_page_description":"Вы́ру — волость в Эстонии в составе уезда Вырумаа."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%86%D1%87%D0%BD%D1%8F%D0%BD%D1%81%D1%8C%D0%BA%D0%B8%D0%B9_%D0%BD%D0%B0%D1%86%D1%96%D0%BE%D0%BD%D0%B0%D0%BB%D1%8C%D0%BD%D0%B8%D0%B9_%D0%BF%D1%80%D0%B8%D1%80%D0%BE%D0%B4%D0%BD%D0%B8%D0%B9_%D0%BF%D0%B0%D1%80%D0%BA","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d8/%D0%86%D1%87%D0%BD%D1%8F%D0%BD%D1%81%D1%8C%D0%BA%D0%B8%D0%B9_%D0%9D%D0%9F%D0%9F_%D0%BB%D1%83%D0%BA%D0%B8_img4.jpg","page_title":"Ічнянський національний природний парк","context_page_description":"Ічня́нський націона́льний парк — національний парк в Україні. Розташований неподалік від міста Ічня Чернігівської області, у верхів'ї річки Удай.\\nПарк створено з метою збереження, відтворення та раціонального використання характерних типових лісостепових природно-ландшафтних та історико-культурних комплексів."},{"page_url":"https://de.wikipedia.org/wiki/Glenn_Gould","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/42/Glenn_Gould_and_Alberto_Guerrero.jpg","page_title":"Glenn Gould","context_page_description":"Glenn Herbert Gould war ein kanadischer Pianist, Komponist, Organist und Musikautor. Er ist vor allem für seine Bach-Aufnahmen bekannt."},{"page_url":"https://sh.wikipedia.org/wiki/Tizian","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e9/Bacanal_de_los_andrios.jpg","page_title":"Tizian","context_page_description":"Tiziano Vecelli ili Tiziano Vecellio, bio je vođa škole venecijanske renesanse u 16. stoljeću. Tizian je bio jedan od najsvestranijih slikara, podjednako vješt u portretima kao u pejzažima, mitološkim i vjerskim temama. Najvažniji i najutjecajniji umjetnik na prijelazu iz Renesanse u Barok."},{"page_url":"https://zh.wikipedia.org/wiki/%E5%B7%B4%E6%B6%85_(%E7%93%A6%E8%90%8A%E5%B7%9E)","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5e/Cotterg.jpg","page_title":"巴涅 (瓦萊州)","context_page_description":"巴涅是瑞士的城镇，位于该国南部，由瓦莱州负责管辖，面积282.26平方公里，海拔高度820米，2011年人口7,807，八成人口信奉罗马天主教，人口密度每平方公里28人。"},{"page_url":"https://es.wikipedia.org/wiki/Kyabetsu_tar%C5%8D","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1f/Cabbage_taro_contents.jpg","page_title":"Kyabetsu tarō","context_page_description":"Kyabetsu Tarō es un bocadillo japonés hecho por la compañía Kado, originaria de la prefectura de Ibaraki. Su nombre significa \\"calabaza Tarō\\", en la que Tarō es un nombre japonés masculino. Consiste en bolas de maíz de 3 cm de diámetro con pequeños trozos de nori y salsa marrón japonesa. Es un bocadillo barato y consumido por los niños. Se vende en dos tamaños, en bolsas de 20 y 100 yen. El paquete del Kyabetsu Tarō muestra una rana vistiendo un sombrero de marino. A pesar del nombre, el bocadillo no posee calabazas como parte de sus ingredientes."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%90%D0%B2%D1%82%D0%BE%D0%BC%D0%BE%D0%B1%D1%96%D0%BB%D1%8C%D0%BD%D1%96_%D1%88%D0%BB%D1%8F%D1%85%D0%B8_%D0%A3%D0%BA%D1%80%D0%B0%D1%97%D0%BD%D0%B8","image_url":"http://upload.wikimedia.org/wikipedia/commons/b/b6/Ukraine_road_m08.jpg","page_title":"Автомобільні шляхи України","context_page_description":"Автомобі́льні шляхи́ загального користування в Украї́ні — мережа доріг на території України, що об'єднує між собою населені пункти та окремі об'єкти та призначена для руху транспортних засобів, перевезення пасажирів та вантажів.\\nДержавна політика у сфері дорожнього господарства та здійснення державного управління автомобільними дорогами загального користування реалізується Державним агентсвом автомобільних доріг України.\\nПротяжність автомобільних державних доріг в Україні становить 169,5 тис. км. Мережа основних маршрутів поширена по всій країні і з'єднує всі великі міста України, а також надає транскордонні маршрути із сусідніми країнами, з них з твердим покриттям — 165,8 тис. км. За стан цих доріг відповідає Державне агентство автомобільних доріг України.\\nЩе є 250 тис. км вулиць міст, за стан яких відповідають місцеві органи влади. Також є відомчі і внутрішньогосподарські дороги."},{"page_url":"https://simple.wikipedia.org/wiki/Conoidasida","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/50/Emaxima_oocysts_usda.jpg","page_title":"Conoidasida","context_page_description":"Conoidasida is a class of protists, It contains one order, Eucoccidiorida."},{"page_url":"https://hy.wikipedia.org/wiki/%D4%BB%D5%B7%D5%BF%D5%BE%D5%A1%D5%B6_%D4%B2%D5%AB%D5%A2%D5%B8","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b7/Bibo_Istvan_Budapest.jpg","page_title":"Իշտվան Բիբո","context_page_description":"Իշտվան Բիբո, հունգարական քաղաքական գործիչ ու իրավապաշտպան, իրավաբան, քաղաքագետ, քաղաքական տեսաբան, փիլիսոփա, պետական նախարար (նոյեմբեր 1956) Իմրե Նաձի կառավարությունում: Հունգարական կառավարությանը սանձելու նպատակով խորհրդային զորքերի Բուդապեշտ ներխուժման ժամանակ նա վերջին նախարարն է եղել, որ լքել է Հունգարիայի խորհրդարանի շենքը: Տարհանվելու փոխարեն նա մնացել է շենքում (նոյեմբերի 4-6) և որպես օրինական կառավարության ներկայացուցիչ գրել է հայտնի «Հանուն ազատության և ճշմարտության» հռչակագիրը և «Հունգարական հարցի կարգավորման փոխզիջումային առաջարկը» գրելուց հետո միայն դուրս է եկել խորհրդարանի շենքից:\\nԲիբոն ձերբակալվել է 1957 թվական մայիսի 23-ին և դատապարտվել է ցմահ ազատազրկման 1958 թվականի օգոստոսի 2-ին, սակայն ազատ է արձակվել 1963 թվականի համաներմամբ:"},{"page_url":"https://pl.wikipedia.org/wiki/Oleg_Znarok","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d7/Oleg_Znarok_May_4_2014.jpg","page_title":"Oleg Znarok","context_page_description":"Oleg Walerjewicz Znarok, ros. Олег Валерьевич Знарок, łot. Oļegs Znaroks – radziecki i łotewski hokeista. Reprezentant ZSRR i Łotwy. Trener hokejowy."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%9C%D0%BE%D1%80%D1%80%D0%B8%D1%81%D1%81%D0%B8,_%D0%94%D1%8D%D0%B2%D0%B8%D0%B4","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/73/David_Morrissey_%28Cropped%29.jpg","page_title":"Моррисси, Дэвид","context_page_description":"Дэвид Марк Моррисси — английский актёр и режиссёр. Моррисси дебютировал на телевидении в возрасте восемнадцати лет, в 1983 году получив роль в телесериале «Одно лето», которая принесла ему известность в Великобритании. После «Одного лета» он поступил в Королевскую академию драматического искусства и в течение четырёх лет выступал в шекспировском проекте Королевского национального театра.\\nНа протяжении 1990-х годов Моррисси играл небольшие приглашённые роли на телевидении, пока не появился в фильмах «Наши общие друзья» и «Хилари и Джеки» в 1998 году. Последовали более значительные роли в фильмах «Голоса» и «Выбор капитана Корелли», а в 2003 году Моррисси исполнил роли Стивена Коллинза в мини-сериале «Большая игра» и премьер-министра Великобритании Гордона Брауна в фильме «Сделка», которые были благоприятно оценены критиками. Первая принесла номинацию на премию Британской телевизионной академии как лучшему актёру, а вторая — победу в той же категории на вручении наград Королевского телевизионного сообщества. Среди крупных ролей последующих лет числятся главные роли в «Основном инстинкте 2» и «Жатве»."},{"page_url":"https://cs.wikipedia.org/wiki/Radlice","image_url":"http://upload.wikimedia.org/wikipedia/commons/8/83/Radlice_Metro_entry2%2C_Prague_Radlice.jpg","page_title":"Radlice","context_page_description":"Radlice jsou čtvrť Prahy, patřící k obvodu i městské části Praha 5."},{"page_url":"https://it.wikipedia.org/wiki/Vijaya_Lakshmi_Pandit","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f6/Vijaya_Lakshmi_Pandit.jpg","page_title":"Vijaya Lakshmi Pandit","context_page_description":"Vijaya Lakshmi Nehru Pandit è stata una politica e diplomatica indiana.\\nFu la prima donna divenuta Presidente dell'Assemblea Generale delle Nazioni Unite dal 1953 al 1954.\\nPrima dell'indipendenza dell'India, insieme al fratello Jawaharlal Nehru, fece parte e fu animatrice del movimento nazionalista.\\nFu quindi a capo della delegazione indiana alle Nazioni Unite dal 1946 al 1948 e una seconda volta dal 1950 al 1951.\\nFu quindi ambasciatrice per il suo paese in Unione Sovietica dal 1947 al 1949, negli Stati Uniti e Messico dal 1949 al 1951, in Irlanda dal 1955 al 1961 e in Spagna dal 1958 al 1961.\\nSempre per le Nazioni Unite fu Alto Commissario nel Regno Unito ed in Irlanda dal 1954 al 1961.\\nRicoprì anche diverse cariche politiche in patria, fino al suo ritiro a vita privata nel 1979."},{"page_url":"https://pl.wikipedia.org/wiki/Mikroregion_Afonso_Cl%C3%A1udio","image_url":"http://upload.wikimedia.org/wikipedia/commons/5/57/EspiritoSanto_Micro_AfonsoClaudio.svg","page_title":"Mikroregion Afonso Cláudio","context_page_description":"Mikroregion Afonso Cláudio – mikroregion w brazylijskim stanie Espírito Santo należący do mezoregionu Central Espírito-Santense. Ma powierzchnię 3.829,5 km²"},{"page_url":"https://es.wikipedia.org/wiki/Batalla_de_Camar%C3%B3n","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c4/Camerone_2006.jpg","page_title":"Batalla de Camarón","context_page_description":"La batalla de Camarón fue un conflicto que tuvo lugar el 30 de abril de 1863 entre la Legión Extranjera Francesa y el Ejército Mexicano cerca de la localidad de Camarón de Tejeda, Veracruz contra el ejército del Segundo Imperio francés.​"},{"page_url":"https://hy.wikipedia.org/wiki/%D4%B9%D5%B8%D6%84%D5%A1%D5%B4%D5%A6%D5%A1%D5%B5%D5%AB%D5%B6_%D5%A1%D6%80%D5%BF%D5%A1%D6%84%D5%AB%D6%80%D5%BF","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/88/%D4%B9%D5%B8%D6%84%D5%A1%D5%B4%D5%A6%D5%AB_%D5%AD%D5%B8%D5%BC%D5%B8%D5%B9%D5%B8%D6%82%D5%B4_%D5%B0%D5%A5%D5%B2%D5%B8%D6%82%D5%AF%D5%AB_%D5%AF%D5%B8%D6%82%D5%BF%D5%A1%D5%AF%D5%B8%D6%82%D5%B4.png","page_title":"Թոքամզային արտաքիրտ","context_page_description":"Թոքամզային արտաքիրտ, թոքամզի խոռոչում հեղուկի ախտաբանական կուտակումն է։ Արդյունքում առաջանում է հեղուկով լի տարածություն, որը շրջապատում է թոքերը։ Կուտակված հեղուկը կարող է խանգարել արտաքին շնչառությանը՝ սահմանափակելով թոքերի բնականոն ընդարձակումը։ Կախված հեղուկի բնույթից և թոքամզային խոռոչում դրա կուտակման պատճառից, տարբերում են թոքամզային արտաքիրտի հետևյալ տեսակները՝ հիդրոթորաքս, հեմոթորաքս, ուրինոթորաքս, խիլոթորաքս և պիոթորաքս, վերջինս հայտնի է որպես թոքամզի էմպիեմա։ Մեկ այլ երևույթ է պնևմոթորաքսը, որը թոքամզի խոռոչում օդի ախտաբանական կուտակումն է, այն կոչվում է նաև «կոլապսված թոք»։"},{"page_url":"https://en.wikipedia.org/wiki/Castel_San_Pietro_Terme","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/39/Castel_San_Pietro_Terme_%28BO%29.JPG","page_title":"Castel San Pietro Terme","context_page_description":"Castel San Pietro Terme is a small city and comune in the Metropolitan City of Bologna, Emilia-Romagna, Italy, with about 21,000 inhabitants. It is located along the Roman Via Emilia, at the foot of the Tuscan-Emilian Appennines."},{"page_url":"https://war.wikipedia.org/wiki/Festuca_subverticillata","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9c/Festuca_subverticillata_%28as_F._obtusa%29_HC-1950.png","page_title":"Festuca subverticillata","context_page_description":"An Festuca subverticillata in uska species han Liliopsida nga syahan ginhulagway ni Christiaan Hendrik Persoon, ngan ginhatag han pagkayana nga asya nga ngaran ni Evgenii Borisovich Alexeev. An Festuca subverticillata in nahilalakip ha genus nga Festuca, ngan familia nga Poaceae. Waray hini subspecies nga nakalista."},{"page_url":"https://id.wikipedia.org/wiki/Hujan","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e2/Deserts.png","page_title":"Hujan","context_page_description":"Hujan adalah sebuah presipitasi berwujud cairan, berbeda dengan presipitasi non-cair seperti salju, batu es dan slit. Hujan memerlukan keberadaan lapisan atmosfer tebal agar dapat menemui suhu di atas titik leleh es di dekat dan di atas permukaan Bumi. Di Bumi, hujan adalah proses kondensasi uap air di atmosfer menjadi butir air yang cukup berat untuk jatuh dan biasanya tiba di daratan. Dua proses yang mungkin terjadi bersamaan dapat mendorong udara semakin jenuh menjelang hujan, yaitu pendinginan udara atau penambahan uap air ke udara. Virga adalah presipitasi yang jatuh ke Bumi namun menguap sebelum mencapai daratan; inilah satu cara penjenuhan udara. Presipitasi terbentuk melalui tabrakan antara butir air atau kristal es dengan awan. Butir hujan memiliki ukuran yang beragam mulai dari pepat, mirip panekuk, hingga bola kecil.\\nKelembapan yang bergerak di sepanjang zona perbedaan suhu dan kelembapan tiga dimensi yang disebut front cuaca adalah metode utama dalam pembuatan hujan. Jika pada saat itu ada kelembapan dan gerakan ke atas yang cukup, hujan akan jatuh dari awan konvektif seperti kumulonimbus yang dapat terkumpul menjadi ikatan hujan sempit."},{"page_url":"https://ja.wikipedia.org/wiki/%E6%B7%80%E5%B7%9D%E6%B2%B3%E5%B7%9D%E5%85%AC%E5%9C%92","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/49/YodogawaSatanishi.JPG","page_title":"淀川河川公園","context_page_description":"淀川河川公園は、淀川の河川敷にある国営公園である。\\n運営は淀川河川公園管理グループ共同体が受託している。"},{"page_url":"https://eu.wikipedia.org/wiki/Lapo%C8%99","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d7/ROU_PH_Lapos_CoA.png","page_title":"Lapoș","context_page_description":"Lapoș Errumaniako udalerri bat da, Prahova konderrian. 1.229 biztanle ditu, 29,67 kilometro koadroko azaleran banatuta."},{"page_url":"https://fr.wikipedia.org/wiki/Canal_EDF","image_url":"http://upload.wikimedia.org/wikipedia/commons/1/1f/Meyrargues_20100918_05.jpg","page_title":"Canal EDF","context_page_description":"Le canal de l'EDF, ou canal usinier de la Durance, est un canal d’irrigation, d’adduction d’eau potable et de production électrique construit par Électricité de France pour dériver une partie des eaux de la Durance. Il est long de plusieurs centaines de kilomètres, dont 120 km environ dans les Bouches-du-Rhône, pour un dénivelé de plus de 655 m.\\nLa plus grande partie de la Durance coule dans le canal."},{"page_url":"https://sv.wikipedia.org/wiki/S%C3%B6der%C3%A5kra_kyrka","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/20/S%C3%B6der%C3%A5kra_kyrka06.JPG","page_title":"Söderåkra kyrka","context_page_description":"Söderåkra kyrka är en kyrkobyggnad i Växjö stift. Den har det alltjämt använda namnet Sophia Magdalena och är församlingskyrka i Söderåkra församling."},{"page_url":"https://de.wikipedia.org/wiki/Schwarzh%C3%A4upterhaus_(Riga)","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/79/Lv_mn_uhr.png","page_title":"Schwarzhäupterhaus (Riga)","context_page_description":"Das Schwarzhäupterhaus auf dem Rathausplatz der lettischen Hauptstadt Riga wurde 1334 als das „Neue Haus der Großen Gilde“ erstmals urkundlich erwähnt. Es diente sowohl den Kaufleuten als auch der vorwiegend deutschen Bürgerschaft Rigas für Zusammenkünfte. Es entspricht den in anderen Städten zur damaligen Zeit errichteten Artushöfen. Das im gotischen Stil errichtete Haus entsprach mit seinem steilen Giebeldach, dessen First die stattliche Höhe von 27 Metern erreichte, einem mittelalterlichen Wohnhaus. Die reich mit Skulpturen und Reliefs verzierte Giebelfassade des Gebäudes, das nach dem Vorbild holländisch-flämischer Zunfthäuser im manieristischen Stil umgestaltet wurde, ist nach ihrer originalgetreuen Rekonstruktion wieder Symbol und eine der Hauptsehenswürdigkeiten von Riga."},{"page_url":"https://pl.wikipedia.org/wiki/Prz%C4%99s%C5%82awek","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6c/Prz%C4%99s%C5%82awek_002.jpg","page_title":"Przęsławek","context_page_description":"Przęsławek – wieś w Polsce położona w województwie pomorskim, w powiecie kwidzyńskim, w gminie Gardeja; 1 km od drogi wojewódzkiej nr 523. Leży na wzniesieniu 100m n.p.m. w widłach rzeki Gardęgi i Kanału Klecewskiego, skąd roztacza się daleki widok na sąsiednie miejscowości Pawłowo, Wilkowo, Czarne Górne. Można stąd zobaczyć wieże pałacu w Klecewie i kościoła w Trumiejach, wiatraki w Łodygowie, maszt TV z Limży, a także pas dawnej granicy Polski i Prus Wschodnich.\\nW latach 1975–1998 miejscowość administracyjnie należała do województwa elbląskiego."},{"page_url":"https://zh.wikipedia.org/wiki/%E4%B8%AD%E8%8F%AF%E6%B0%91%E5%9C%8B%E8%88%87%E7%B4%90%E5%9F%83%E9%97%9C%E4%BF%82","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/58/Visa_requirements_for_New_Zealand_citizens.png","page_title":"中華民國與紐埃關係","context_page_description":"中華民國與紐埃關係是指中華民國與紐埃之間的關係。兩國無官方外交關係，目前也沒有在對方首都互設具大使館性質的代表機構。對紐埃的相關事務由駐紐西蘭臺北經濟文化辦事處兼轄。"},{"page_url":"https://sv.wikipedia.org/wiki/Pescatoria_cerina","image_url":"http://upload.wikimedia.org/wikipedia/commons/4/46/Pescatoria_cerina_Orchi_21.jpg","page_title":"Pescatoria cerina","context_page_description":"Pescatoria cerina är en orkidéart som först beskrevs av John Lindley och Joseph Paxton, och fick sitt nu gällande namn av Heinrich Gustav Reichenbach. Pescatoria cerina ingår i släktet Pescatoria och familjen orkidéer. Inga underarter finns listade i Catalogue of Life."},{"page_url":"https://en.wikipedia.org/wiki/Bernhard_Duhm","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c1/Berhard_Duhm.png","page_title":"Bernhard Duhm","context_page_description":"Bernhard Lauardus Duhm was a German Lutheran theologian, born in Bingum, today part of Leer, East Frisia. He was a member of the history of religions school."},{"page_url":"https://en.wikipedia.org/wiki/Yenya","image_url":"http://upload.wikimedia.org/wikipedia/commons/e/ec/Baka_bhairav_kathmandu.jpg","page_title":"Yenya","context_page_description":"Indra Jātrā, most commonly known as Yenyā is the biggest religious street festival in Kathmandu, Nepal. Ye means \\"Kathmandu\\" and Ya means \\"celebration\\", together it means \\"celebration inside Kathmandu\\" in Nepal Bhasa. The celebrations consist of two events, Indra Jātrā and Kumāri Jātrā. Indra Jātrā is marked by masked dances of deities and demons, displays of sacred images and tableaus in honor of the deity Indra, the king of heaven. Kumāri Jātrā is the chariot procession of the living goddess Kumari.\\nFamily members deceased in the past year are also remembered during the festival. The main venue of the festivities is Kathmandu Durbar Square. The celebrations last for eight days from the 12th day of the bright fortnight to the 4th day of the dark fortnight of Yanlā, the eleventh month in the lunar Nepal Era calendar.\\nIndra Jatra was started by King Gunakamadeva to commemorate the founding of the Kathmandu city in the 10th century. Kumari Jatra began in the mid-18th century. The celebrations are held according to the lunar calendar, so the dates are changeable. This year, the festival takes place from 30th August to 6th September, and the main day of attraction falling on 1st Sep."},{"page_url":"https://vi.wikipedia.org/wiki/Langeac","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/99/Langeac_Col1a_JPG.jpg","page_title":"Langeac","context_page_description":"Langeac là một xã thuộc tỉnh Haute-Loire trong vùng Auvergne-Rhône-Alpes ở nam trung bộ nước Pháp. Khu vực này có độ cao từ 488-951 mét trên mực nước biển. Theo điều tra dân số năm 2006 của INSEE có dân số 3943 người. Thị trấn có cự ly khoảng 30 km về phía tây Le Puy-en-Velay, và khoảng 100 km về phía tây nam Lyon.\\nCommunes of the Haute-Loire department"},{"page_url":"https://fi.wikipedia.org/wiki/Quietus","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/ff/Antoninianus-Quietus-RIC_0009.jpg","page_title":"Quietus","context_page_description":"Titus Fulvius Junius Quietus oli roomalainen usurpaattori eli vallananastaja. Hänen isänsä oli Fulvius Macrianus, joka oli yksi keisari Valerianuksen kenraaleista vuonna 260. Hänen veljensä oli Macrianus nuorempi. Quietuksen nuoruusvuosista ei ole juuri mitään tietoa. Epäluotettavan keisarien elämäkerran Historia Augustan mukaan Quietus toimi tribuunina Valerianuksen armeijassa, mutta asiasta ei ole varmaa tietoa, eikä se luultavasti ole totta.\\nKesällä 260 roomalaiset kärsivät Carrhaen lähistöllä persialaisia vastaan suuren tappion. Valerianus vangittiin, ja persialaiset hyökkäsivät Syyriaan ja Vähään-Aasiaan. Tilanne oli sekasortoinen, mutta Macrianus vanhemman ja Ballistan vastatoimet Kilikiassa pysäyttivät persialaisten hyökkäyksen. Persian kuningas Sapor I joutui perääntymään takaisin itään. Macrianus vanhempi ja Ballista ansaitsivat tästä hyvästä sotilaidensa kunnioituksen, ja sotilaat päättivätkin huutaa Macrianus vanhemman keisariksi, vaikka Valerianuksen poika ja laillinen keisari Gallienus oli yhä elossa ja hallitsi valtakunnan läntisiä provinsseja."},{"page_url":"https://fi.wikipedia.org/wiki/Lahden_kaupunginkirjasto","image_url":"http://upload.wikimedia.org/wikipedia/commons/8/85/Lahti-kaupunginkirjasto.jpg","page_title":"Lahden kaupunginkirjasto","context_page_description":"Lahden kaupunginkirjasto on Lahden kaupungin ylläpitämä julkinen kirjasto. Lahden kaupungin alueella pääkirjaston lisäksi asukkaita palvelevat Ahtialan, Jalkarannan, Kärpäsen, Launeen, Liipolan, Mukkulan, Renkomäen ja Nastolan lähikirjastot sekä kirjastoautot Pegasos ja Eepos, jonka reitti kulkee entisen Nastolan kunnan alueella.\\nLahden kaupunginkirjasto kuuluu yhdessä Päijät-Hämeen muiden kirjastojen kanssa Yhteinen verkkosivusto on palvellut kaikkia maakunnan kirjastonkäyttäjiä joulukuusta 2013 alkaen. Toukokuussa 2018 avattiin uusi, yhteinen aineistotietokanta Lastu-Finna."},{"page_url":"https://en.wikipedia.org/wiki/Ariel_6","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e9/Ariel-6.gif","page_title":"Ariel 6","context_page_description":"Ariel 6, known pre-launch as UK-6, was a British and American satellite launched in 1979 as part of the Ariel programme. It was operated by the Science Research Council, which became the Science and Engineering Research Council in 1981. Ariel 6 was used for astronomical research and provided data until February 1982. It was the last Ariel satellite to be launched."},{"page_url":"https://es.wikipedia.org/wiki/Eremopterix_australis","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a3/Eremopterix_australis_-Bushmanland%2C_South_Africa-8.jpg","page_title":"Eremopterix australis","context_page_description":"La terrera orejinegra ​ es una especie de ave paseriforme de la familia Alaudidae propia de África austral."},{"page_url":"https://es.wikipedia.org/wiki/Euphorbia_xanti","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8c/Euphorbia_xanti4_ies.jpg","page_title":"Euphorbia xanti","context_page_description":"Euphorbia xanti es una especie de planta suculenta de la familia de las euforbiáceas. Es originaria de América, donde se encuentra en México distribuida por Baja California, Sonora y Sinaloa."},{"page_url":"https://sv.wikipedia.org/wiki/Sofia_av_Nassau","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d7/Sofia_of_Sweden_%281857%29_1898.jpg","page_title":"Sofia av Nassau","context_page_description":"Sofia av Nassau, fullständigt namn Sofia Vilhelmina Mariana Henrietta, född 9 juli 1836 på slottet Biebrich i Biebrich i Wiesbaden i Hertigdömet Nassau, död 30 december 1913 i Stockholm, var drottning av Sverige och fram till 1905 drottning av Norge som gift med kung Oscar II. Hon var dotter till hertig Vilhelm I av Nassau och Pauline av Württemberg."},{"page_url":"https://sr.wikipedia.org/wiki/%D0%9E%D0%BA%D1%80%D1%83%D0%B3_%D0%93%D0%B0%D1%80%D0%B4%D0%BD_(%D0%9D%D0%B5%D0%B1%D1%80%D0%B0%D1%81%D0%BA%D0%B0)","image_url":"http://upload.wikimedia.org/wikipedia/commons/e/e7/Map_of_Nebraska_highlighting_Garden_County.svg","page_title":"Округ Гардн (Небраска)","context_page_description":"Гардн је округ у америчкој савезној држави Небраска."},{"page_url":"https://fr.wikipedia.org/wiki/Barrage_de_castors","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/93/Biberdamm_1_db.jpg","page_title":"Barrage de castors","context_page_description":"Un barrage de castors est un barrage naturel, construit en travers d'un petit cours d'eau par des castors. Il lui permet de conserver de l'eau en été et de protéger son gîte contre les prédateurs, et aussi de garantir un accès facile aux provisions de branches stockées sous l'eau comme réserve hivernale de nourriture.\\nCes structures, dont on peut trouver des traces fossiles, modifient depuis des millions d'années l'environnement naturel et comptent parmi les processus clés des écosystèmes alluviaux et forestiers de l'hémisphère nord. Le castor augmente ainsi le nombre, la proportion et la taille des zones humides, des eaux libres et du linéaire de berge. Il crée des zones de sédimentation et de puits de carbone. Il augmente la proportion des zones humides et d'eau libre dans le paysage forestier et alluvial. Il complexifie la forme des petits cours d'eau, la composition et la répartition de la faune des cours d'eau et de la végétation alluviale ainsi que les cycles biogéochimiques des éléments nutritifs. Il améliore la recharge des nappes, la qualité de l'eau. Il limite la fréquence, la gravité et la durée des incendies de forêt et des crues et ses barrages filtrent les sédiments."},{"page_url":"https://de.wikipedia.org/wiki/Alexander_Bogomazow","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d6/Bogomazov-tram-s-1914.jpg","page_title":"Alexander Bogomazow","context_page_description":"Alexander Bogomazow war ein ukrainischer Maler und Theoretiker der russischen Avantgarde."},{"page_url":"https://sh.wikipedia.org/wiki/Kraljevske_grobnice_dinastije_Joseon","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a2/Sejong_tomb_2.jpg","page_title":"Kraljevske grobnice dinastije Joseon","context_page_description":"Kraljevske grobnice dinastije Joseon je skupina 40 grobnica korejske kraljevske dinastije Joseon koje se nalaze na 18 lokaliteta u Južnoj Koreji, uglavnom 40-tak km od Seula. Sagradili su ih Joseon vladari Koreje u spomen na svoje pretke i njihova dostignuća, od 1408. do 1966. godine. Zbog toga su 2009. godine upisane na UNESCO-v popis mjesta svjetske baštine u Aziji kao \\"dovršetak 5.000 godina povijesti arhitekture kraljevskih grobnica na korejskom poluotoku\\"."},{"page_url":"https://pl.wikipedia.org/wiki/USS_Pennsylvania_(SSBN-735)","image_url":"http://upload.wikimedia.org/wikipedia/commons/1/19/USS_Pennsylvania_%28SSBN_735%29.jpg","page_title":"USS Pennsylvania (SSBN-735)","context_page_description":"USS Pennsylvania (SSBN-735) – amerykański okręt podwodny napędzany przez siłownię jądrową, przenoszący 24 pociski balistyczne SLBM typu Trident II D-5. Jest to szósty z 14 okrętów typu Trident / Ohio aktualnie pozostających w służbie US Navy w ramach amerykańskiego systemu strategicznego odstraszania nuklearnego. Jego bazą macierzystą pozostaje Naval Base Kitsap-Bangor w stanie Waszyngton.\\nOkręt ustanowił w pierwszym półroczu 2014 roku - po odbyciu 140 dniowego rejsu - rekord długości patrolu bojowego jednostek tego typu."},{"page_url":"https://cs.wikipedia.org/wiki/Seznam_kulturn%C3%ADch_pam%C3%A1tek_v_Hor%C5%A1ovsk%C3%A9m_T%C3%BDn%C4%9B","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/85/HorsovskyTynHausNr116.JPG","page_title":"Seznam kulturních památek v Horšovském Týně","context_page_description":"Tento seznam nemovitých kulturních památek ve městě Horšovský Týn v okrese Domažlice vychází z Ústředního seznamu kulturních památek ČR, který na základě zákona č. 20/1987 Sb., o státní památkové péči, vede Národní památkový ústav jako ústřední organizace státní památkové péče. Údaje jsou průběžně upřesňovány, přesto mohou obsahovat i řadu věcných a formálních chyb a nepřesností či být neaktuální.\\nPokud byly některé části dotčeného území vyčleněny do samostatných seznamů, měly by být odkazy na tyto dílčí seznamy uvedeny v úvodu tohoto seznamu nebo v úvodu příslušné sekce seznamu."},{"page_url":"https://en.wikipedia.org/wiki/Politics_of_North_Dakota","image_url":"http://upload.wikimedia.org/wikipedia/commons/d/de/NDAtlarge.gif","page_title":"Politics of North Dakota","context_page_description":"The Politics of North Dakota were shaped historically by early settlement by people from the Northern Tier, who carried their politics west ultimately from New England, upstate New York, and the Upper Midwest. The area and state also received numerous European immigrants and migrants, particularly during the era of opening up of former Native American lands for sale and settlement. Since the late 19th century, the Republican Party has been influential in the state.\\nThe political leanings of the state since its creation have been largely conservative. However, there has also been a vein of political progressivism within the state's history, particularly with populist efforts to gain better conditions for subsistence farmers. The left-wing Nonpartisan League was a strong political force during the first half of the 1900s. In the 1920s many NPL candidates were elected to government offices and the party enacted its largely center-left programs, including establishing state-owned banks, mills, and a railroad. Today, the major political parties in the state include the Republican Party and the North Dakota Democratic-NPL Party."},{"page_url":"https://zh.wikipedia.org/zh-cn/%E4%B8%9C%E5%8C%97%E8%99%8E","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/41/Siberischer_tiger_de_edit02.jpg","page_title":"东北虎","context_page_description":"东北虎，又称西伯利亚虎或阿穆尔虎，曾旧称“满洲虎”、“乌苏里虎”、“阿尔泰虎”等，朝鲜半岛称朝鲜虎。被认为是体型最大的老虎亚种，分布于俄罗斯东南部、朝鲜和中国东北等地，是中国国家一级保护动物。 2008年，东北虎被美国网站《生活科学》评为“全球十大最濒危稀有动物”物种之一。"},{"page_url":"https://zh.wikipedia.org/wiki/%E7%BE%8A%E5%9F%8E%E5%85%AB%E6%99%AF","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e3/Wuxian_Xiadong.jpg","page_title":"羊城八景","context_page_description":"羊城八景是指中国广东省广州市的八个名胜景点。"},{"page_url":"https://de.wikipedia.org/wiki/Debbie_Flood","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fb/Debbie_Flood_%285178772720%29.jpg","page_title":"Debbie Flood","context_page_description":"Deborah Kirsty „Debbie“ Flood ist eine britische Ruderin. Sie gewann bis 2011 drei Weltmeistertitel und zwei olympische Silbermedaillen."},{"page_url":"https://mr.wikipedia.org/wiki/%E0%A4%AA%E0%A4%B2%E0%A5%8D%E0%A4%B2%E0%A4%B5_%E0%A4%B5%E0%A4%82%E0%A4%B6","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/33/Elephant_mpuram.jpg","page_title":"पल्लव वंश","context_page_description":"इसवी सनाच्या चौथ्या शतकाच्या सुरूवातीला शिवस्कंदवर्मा या पल्लव राजाने कृष्णेपासून पेन्नार नदीपर्यंतचा प्रदेश जिंकून आपल्या अधिपत्याखाली आणला. त्याच्यानंतरच्या विष्णुगोप या कांचीच्या पल्लव राजाचा समुद्रगुप्ताने पराभव केला. पुढे दिडशे वर्षे या भागात अराजक माजले पण सिंहविष्णु अवनीसिंह या राजाने अराजकाचा नाश करून पल्लवांची सत्ता पुन्हा प्रस्थापित केली. त्याने चोळांचा पराभव करून तोंडमंडलम जिंकले. त्याने कलभ्र, पांड्य, चेर यांचा पराभव करून सिलोनच्या राजाचाही पराभव केला. याच्यामुळेच सार्वभौमत्वाच्या चढाओढीत पल्लवांचे पदार्पण झाले.\\nसिंहविष्णु अवनीसिंहानंतर गादीवर आलेला त्याचा मुलगा पहिला महेंद्रवर्मन याने दक्षिणेत तिरुचिरापल्लीपर्यंत आपली सत्ता वाढवली. याने चैत्यकारी, चित्रकारपुली, मत्तविलास, विचित्रचित्त या पदव्या धारण केलेल्या होत्या. याने आपल्या कालखंडात अनेक देवळे बांधली. महेंद्रवाडी हे गाव वसविले व तेथे महेंद्र तलाव बांधला. त्याच तलावाच्या काठावर एक विष्णुमंदिर बांधले. याच मंदिरावरील शिलालेखात हे विटाविरहित, लाकूडविरहित, धातूविरहित व चुनाविरहित मंदिर विचित्रचित्तराजाने खोदविले असा उल्लेख आहे. महाराष्ट्रातील चालुक्य राजांशी पहिल्या महेंद्रवर्मनाला अनेक वर्षे झगडावे लागले. चालुक्य राजा पुलकेशी दुसरा याने महेंद्रवर्मनाचा पराभव केला होता."},{"page_url":"https://ja.wikipedia.org/wiki/%E4%B8%8B%E9%A7%84%E3%82%B9%E3%82%B1%E3%83%BC%E3%83%88","image_url":"https://upload.wikimedia.org/wikipedia/ja/3/33/Geta_skate_birthplace_monument.jpg","page_title":"下駄スケート","context_page_description":"下駄スケートとは、下駄に刃を取り付けた日本独特のスケート靴である。現在の一般的な革製のスケート靴が広まる以前に日本国内で広く使用された。"},{"page_url":"https://ja.wikipedia.org/wiki/%E3%82%A2%E3%82%AB%E3%82%B4%E3%83%81%E7%A7%91","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/bf/Bembradium_roseum.jpg","page_title":"アカゴチ科","context_page_description":"アカゴチ科は、カサゴ目に所属する魚類の分類群の一つ。アカゴチなど、底生性の深海魚を中心に5属10種が記載される。"},{"page_url":"https://sl.wikipedia.org/wiki/Hi%C5%A1a_na_kolih","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4f/Inle-Yawnghwe.jpg","page_title":"Hiša na kolih","context_page_description":"Hiša na kolih je hiša, ki je postavljena na kole nad površino tal ali vodnih teles. Hiše na kolih so zgrajene predvsem kot zaščita pred poplavami, pa tudi pred škodljivci. Senčni prostor pod hišo se lahko uporablja za delo ali skladiščenje.\\nHiše, kjer je prisoten permafrost, na Arktiki, so zgrajene na kolih zato, da pod njimi vzdržujejo permafrost, ki lahko vsebuje do 70% vode. Medtem ko je zamrznjen, zagotavlja stabilno podlago. Če toplota, ki jo izžareva hiša, topi permafrost, se hiša začne pogrezati v tla. Na voljo so tudi druga sredstva za ohranjanje permafrosta pred taljenjem, vendar je dviganje domov od tal na kole eden najbolj učinkovitih načinov."},{"page_url":"https://bn.wikipedia.org/wiki/%E0%A6%A6%E0%A7%87%E0%A6%B6%E0%A7%87_%E0%A6%AC%E0%A6%BF%E0%A6%A6%E0%A7%87%E0%A6%B6%E0%A7%87","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/41/%E0%A6%A6%E0%A7%87%E0%A6%B6%E0%A7%87_%E0%A6%AC%E0%A6%BF%E0%A6%A6%E0%A7%87%E0%A6%B6%E0%A7%87.jpg","page_title":"দেশে বিদেশে","context_page_description":"দেশে বিদেশে হচ্ছে কথা-সাহিত্যিক সৈয়দ মুজতবা আলী রচিত একটি ভ্রমণ কাহিনি, যা ১৯২৭ থেকে ১৯২৯ সালের আফগানিস্তান ভ্রমণের উপর রচিত। এটি ১৯৪৮ সালের মার্চ মাস থেকে ধারাবাহিকভাবে ‘দেশ’ পত্রিকায় প্রকাশিত হয়েছিল। এই বইটিকে বাংলা সাহিত্যের প্রথম সার্থক ভ্রমণ কাহিনি হিসেবে গণ্য করা হয়; অন্য কোন ভ্রমণ কাহিনি আজ পর্যন্ত বাংলা সাহিত্যে এর মতো এতোটা জনপ্রিয়তা অর্জন করতে পারেনি। একটি ভ্রমণলিপি হওয়া সত্ত্বেও এটি আফগানিস্তানের লিখিত ইতিহাসের একটি অনবদ্য দলিল।"},{"page_url":"https://en.wikipedia.org/wiki/List_of_indoor_arenas_in_Spain","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/39/Antonio_Elorza_belodromoa.png","page_title":"List of indoor arenas in Spain","context_page_description":"The following is a list of indoor arenas in Spain, ordered by capacity.\\nThe venues are by their final capacity after construction for seating-only events. There is more capacity if standing room is included. All venues with at least 5,000 seats are listed."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%91%D0%B0%D1%80%D0%BE%D0%BD_%D0%92%D0%BE%D0%BA%D1%81_%D0%B8%D0%B7_%D0%A5%D0%B5%D1%80%D1%80%D0%BE%D1%83%D0%B4%D0%B5%D0%BD%D0%B0","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/90/William_Lord_Vaux_of_Harrowden.jpg","page_title":"Барон Вокс из Херроудена","context_page_description":"Барон Вокс из Херроудена — наследственный титул в системе Пэрства Англии."},{"page_url":"https://en.wikipedia.org/wiki/Golden_Globe_Award_for_Best_Actress_%E2%80%93_Television_Series_Musical_or_Comedy","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4a/Rachel_Bloom_at_37th_College_Television_Awards-adj.jpg","page_title":"Golden Globe Award for Best Actress – Television Series Musical or Comedy","context_page_description":"The Golden Globe Award for Best Actress – Television Series Musical or Comedy is an award presented annually by the Hollywood Foreign Press Association. It is given in honor of an actress who has delivered an outstanding performance in a leading role on a musical or comedy television series for the calendar year.\\nIt was first awarded at the 19th Golden Globe Awards on March 5, 1962, under the title Best TV Star - Female, grouping all genres of television series, to Pauline Fredericks. The nominees for the award announced annually starting in 1963. The award initially honored actresses in both comedy and drama genres until 1969, when the award was split into categories that honored comedic and dramatic performances separately. It was presented under the new title Best TV Actress – Musical or Comedy and in 1980 under its current title.\\nSince its inception, the award has been given to 42 actresses. Phoebe Waller-Bridge is the current recipient of the award for her role as the title character on Fleabag. Carol Burnett has won the most awards in this category with five wins and received the most nominations at 12."},{"page_url":"https://de.wikipedia.org/wiki/Sandakan-Massaker-Memorial","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5d/Sandakan_Sabah_SandakanMassacreMemorial-02.jpg","page_title":"Sandakan-Massaker-Memorial","context_page_description":"Das Sandakan Massacre Memorial ist ein Mahnmal, das an die aus Sandakans stammenden chinesischen Opfer des 27. Mai 1945 erinnert, bei der die japanischen Besatzer Sabahs im Zweiten Weltkrieg mehr als 30 Chinesen hinrichteten – Mitglieder der lokalen Führungsschicht, die nach Überzeugung der Besatzer mit der Untergrundbewegung in Verbindung standen oder diese unterstützten.\\nDie Gedenkstätte wurde an dem Platz errichtet, an dem das Massaker stattfand und wo die Opfer verscharrt wurden. Die Gedenkstätte befindet sich nahe dem chinesischen Friedhof auf einem Hügel oberhalb des alten Stadtzentrums von Sandakan."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Kulturdenkmale_im_Saale-Orla-Kreis","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d9/Mittelp%C3%B6llnitz_in_SOK.png","page_title":"Liste der Kulturdenkmale im Saale-Orla-Kreis","context_page_description":"Die Liste der Kulturdenkmale im Saale-Orla-Kreis listet die Kulturdenkmale im südostthüringischen Saale-Orla-Kreis, aufgelistet nach einzelnen Gemeinden. Die Angaben in den einzelnen Listen ersetzen nicht die rechtsverbindliche Auskunft der zuständigen Denkmalschutzbehörde."},{"page_url":"https://en.wikipedia.org/wiki/Rogers_Park,_Chicago","image_url":"http://upload.wikimedia.org/wikipedia/commons/a/a7/US-IL-Chicago-CA01.svg","page_title":"Rogers Park, Chicago","context_page_description":"Rogers Park is the first of Chicago's 77 community areas. Located 9 miles from the Loop, it is on the city's far north side on the shore of Lake Michigan. The neighborhood is commonly known for its cultural diversity, lush green public spaces, early 20th century architecture, live theater, unique bars/restaurants, beaches, and progressive mindset. It is bounded by the city of Evanston along Juneway Terrace and Howard Street to the north, Ridge Boulevard to the west, Devon Avenue and the Edgewater neighborhood to the south, and Lake Michigan to the east. The neighborhood just to the west, West Ridge, was part of Rogers Park until the 1890s and is still commonly referred to as West Rogers Park."},{"page_url":"https://he.wikipedia.org/wiki/%D7%9E%D7%93%D7%A8%D7%95%D7%9F_%D7%99%D7%A4%D7%95","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/be/Yaffo_air.jpg","page_title":"מדרון יפו","context_page_description":"מדרון יפו הוא שמו של פארק חופי המוקם לאורך חופי הים של שכונת עג'מי ביפו, והמשתרע בין נמל יפו בצפון וחוף גבעת עלייה מדרום. שטחו של הפארק הוא 200 דונם, אורכו מצפון לדרום הוא כקילומטר, ורוחבו ממזרח למערב מגיע ל-300 מטרים לכל היותר. גובהו המרבי של הפארק הוא 15 מטר מעל פני הים. ביצוע המיזם החל בחודש דצמבר 2005 ועיקר העבודות הסתיימו בשנת 2008. השלמת הפארק הייתה אמורה להסתיים בשנת 2009, אך שתילת דשא במקום התעכבו בשל הבצורת ובשל איסור מכוח החוק שנקבע בגינה בתקנות. משנמצא פתרון לבעיית ההשקיה חודשו העבודות במאי 2009, נשתל דשא והוצבו מתקני משחקים וספסלי תצפית. הפארק נחנך לבסוף ב-30 באפריל 2010. פרויקט הקמת פארק המדרון היה יוזמה של ראש העיר רון חולדאי, ותוכנן על ידי משרד \\"ברוידא-מעוז אדריכלות נוף\\". על הביצוע הופקד אגף שפ\\"ע באמצעות החברה העירונית \\"עזרה וביצרון\\", ועלותו הגיעה ל-60 מיליון ש\\"ח."},{"page_url":"https://en.wikipedia.org/wiki/One_Ok_Rock","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/84/One_Ok_Rock_-_Lucky_Strike_Live.jpg","page_title":"One Ok Rock","context_page_description":"One OK Rock, is a Japanese rock band, formed in Tokyo, Japan in 2005. The band currently consists of Takahiro Moriuchi, Toru Yamashita, Ryota Kohama, and Tomoya Kanki. They play many different styles of music, with songs ranging from alternative rock and emo to post-hardcore and pop rock.\\nThe band's name comes from \\"one o'clock\\", the time that the band used to practice their music on weekends. They chose to play at one o'clock in the morning because it was cheaper to use the rehearsal space during such hours. However, noticing that the Japanese language made no distinction between R's and L's, \\"O'CLOCK\\" transformed into \\"O'CROCK\\" or \\"O'KROCK\\", which later transformed into \\"OK ROCK\\". In addition, One OK Rock can be expressed as \\"10969\\". The band uses both Japanese and English lyrics in their songs.\\nOne OK Rock has won Classic Rock Roll of Honour Awards for Eastern Breakthrough Male Band in 2016, and Rock Sound Awards for Best International Band in 2017. The band was also nominated for two Alternative Press Music Awards – Best International Band in 2016 and Best Breakthrough Band in 2017."},{"page_url":"https://eo.wikipedia.org/wiki/Simeiza_observatorio","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0b/Simeiz_RT-22.jpg","page_title":"Simeiza observatorio","context_page_description":"La Simeiza observatorio estas astronomia observatorio en Krimeo, apud la loĝloko Simeizo. Antaŭ la mezo de la 1950-aj jaroj la observatorio estis memstara scienca institucio; nun ĝi apartenas al la Krimea astrofizika observatorio. Nuntempe en la observatorio oni plenumas la esploradon de la sputnikaj orbitoj per la uzado de laseroj.\\nOmaĝe al la Simeiza observatorio oni nomis la asteroidon 748 Simeisa, kiun malkovris G. N. Neujmin la 14-an de marto 1913."},{"page_url":"https://pl.wikipedia.org/wiki/Polska_Partia_Robotnicza","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d4/Nowotko.jpg","page_title":"Polska Partia Robotnicza","context_page_description":"Polska Partia Robotnicza – polska partia komunistyczna utworzona 5 stycznia 1942 roku w Warszawie w czasie okupacji niemieckiej przez przybyłych z ZSRR polskich komunistów z tzw. Grupy Inicjatywnej, poprzez połączenie organizacji Związek Walki Wyzwoleńczej z kilkoma istniejącymi wcześniej konspiracyjnymi grupami komunistycznymi, takimi jak: „Młot i Sierp”, Stowarzyszenie Przyjaciół ZSRR, Grupa Biuletynu Radiowego, Spartakus, Sztandar Wolności oraz grupa „Proletariusz”."},{"page_url":"https://en.wikipedia.org/wiki/2012_Open_Championship","image_url":"http://upload.wikimedia.org/wikipedia/commons/f/f8/2009_Women%27s_British_Open_-_Royal_Lytham_%26_St_Annes_Golf_Course_%2834%29.jpg","page_title":"2012 Open Championship","context_page_description":"The 2012 Open Championship was a men's major golf championship and the 141st Open Championship, held from 19−22 July at Royal Lytham & St Annes Golf Club in Lytham St Annes, Lancashire, England. Ernie Els won his second Claret Jug, one stroke ahead of runner-up Adam Scott. Tiger Woods and Brandt Snedeker finished tied for third, four strokes behind Els, who gained his fourth major title.\\nScott was the leader after 54 holes at 199, with Els six strokes back, tied for fifth. After a birdie at the 14th hole, Scott was four strokes ahead with four holes to play. Els, two groups ahead of Scott on the course, birdied the 18th hole for a score of 68 and the clubhouse lead at 273. When Scott agonizingly bogeyed each of the final four holes, he dropped to second and Els won the Championship by a single stroke.\\nEntering the final round, Graeme McDowell and Snedeker were tied for second at 203, four strokes behind Scott. McDowell shot a 75 and Snedeker a 74 to knock them out of contention; Woods had a triple bogey at the sixth hole and carded a 73 to tie for third with Snedeker."},{"page_url":"https://hy.wikipedia.org/wiki/%D5%84%D5%A1%D5%AF%D5%A5%D5%BF%D5%A1%D5%B5%D5%AB%D5%B6_%D5%BD%D5%A1%D5%AC%D5%AB%D5%AF","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0b/Beginning.jpg","page_title":"Մակետային սալիկ","context_page_description":"Մակետային սալիկ, ունիվերսալ տպատախտակ էլեկտրոնային սարքերի նախատիպերի հավաքման և մոդելավորման համար: Մակետային սալիկները բաժանվում են երկու տիպի՝ զոդման միջոցով մոնտաժ և առանց դրա:"},{"page_url":"https://ru.wikipedia.org/wiki/%D0%9A%D0%B0%D1%82%D0%B5%D1%80%D0%B2","image_url":"http://upload.wikimedia.org/wikipedia/commons/d/db/Sarcophagus.jpg","page_title":"Катерв","context_page_description":"Катерв — святой покровитель Толентино. День памяти — 17 октября.\\nСвятой Катерв принёс Христову веру в город Толентино, за что был умучен. Как известно, епископство в Толентино восходит к V веку.\\nВ соборе Святого Катерва в Толентино в оригинальном мраморном саркофаге IV века почивают мощи святого. На саркофаге изображены Добрый Пастырь и поклонение волхвов. Собор выглядит построенным на месте посвящённого святому мавзолея. На табличке приводится полное имя святого: Flavius Julius Catervus. Святой Катерв был из благородных, в ранге сенатора, повышенный до статуса префекта. Он скончался в возрасте 56 лет; его супруга Септимия Северина построила саркофаг для них обоих.\\nВ 1455 году саркофаг был вскрыт и честная глава святого была перенесена в реликварий для пущего почитания. Согласно записям, в 1567 году тело святого было обретено вместе с телами его супруги и сына Вассо. В саркофаге было найдено около двух тысяч монет."},{"page_url":"https://eo.wikipedia.org/wiki/Sistematiko_de_la_begonio","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9c/Begonia_fuchsioides_01.jpg","page_title":"Sistematiko de la begonio","context_page_description":"Tiu ĉi artikolo priskribas la sistematiko de la plantgenro Begonio. Tiu genro enhavas krom unu specio ĉiuj specioj de la familio de la Begoniacoj, ĉar la familio ankoraŭ nur havas unu plian genron: Hillebrandia OLIV. kun nur unu specio Hillebrandia sandwicensis OLIV.. Sinonimoj de Begonia estas: Begoniella OLIV., Casparya KLOTZSCH, Diploclinium LINDL., Gireoudia KLOTZSCH, Gurltia KLOTZSCH, Lepsia KLOTZSCH, Mezierea GAUDICH., Mitscherlichia KLOTZSCH, Pritzelia KLOTZSCH, Semibegoniella C. E. C. FISCH., Symbegonia WARB., Tittlebachia KLOTZSCH, Trendelenburgia KLOTZSCH, Wageneria KLOTZSCH."},{"page_url":"https://zh.wikipedia.org/zh-tw/%E8%92%99%E5%BE%97%E7%BB%B4%E7%9A%84%E4%BA%9A%E5%B8%82%E6%94%BF%E5%8E%85","image_url":"http://upload.wikimedia.org/wikipedia/commons/a/a6/Palacio_Municipal.jpg","page_title":"蒙得维的亚市政厅","context_page_description":"蒙得維的亞市政廳是烏拉圭蒙得維的亞地方政府機構所在地，位於該市中區，該市的主幹道七月十八日大道，它是由烏拉圭建築師Mauricio Cravotto設計。\\n目前的建築於1935年開始建設，1941年7月16日落成。不同於1929年Cravotto的原設計，由於財政原因從設計高度114米下降為78米，高度次於薩爾沃宮。\\n在正門的前面是令人印象深刻的大衛像青銅複製品。大樓的中庭舉辦藝術，工藝等展覽，而右側有薩莫特拉斯的勝利女神複製品。大樓的西翼設有藝術史博物館。"},{"page_url":"https://ja.wikipedia.org/wiki/%E3%83%9C%E3%83%BC%E3%83%95%E3%82%A9%E3%83%BC%E3%83%88%E5%85%AC%E7%88%B5","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/52/Beaufort3.JPG","page_title":"ボーフォート公爵","context_page_description":"ボーフォート公爵は、イングランド貴族の公爵位。\\n第3代サマセット公ヘンリー・ボーフォートの非嫡出子チャールズ・サマセットが1514年に叙されたウスター伯爵位を前身とする。5代ウスター伯ヘンリー・サマセットの代の1642年にウスター侯爵位を与えられ、3代ウスター侯ヘンリー・サマセットの代の1682年にボーフォート公爵位を与えられた。以来同公爵位はその子孫によって継承され、現在に至っている。2019年現在の当主は第12代ボーフォート公ヘンリー・サマセットである。"},{"page_url":"https://ru.wikipedia.org/wiki/%D0%90%D1%80%D1%88%D0%B8%D0%BD%D1%8C%D1%8F","image_url":"http://upload.wikimedia.org/wikipedia/commons/6/65/Fontstpierre.jpg","page_title":"Аршинья","context_page_description":"Аршинья́ — коммуна во Франции, находится в регионе Овернь. Департамент коммуны — Алье. Входит в состав кантона Юрьель. Округ коммуны — Монлюсон.\\nКод INSEE коммуны — 03005."},{"page_url":"https://de.wikipedia.org/wiki/Kerwan","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/bb/PIA19596-Ceres-DwarfPlanet-Dawn-2ndMappingOrbit-image28-20150625.jpg","page_title":"Kerwan","context_page_description":"Kerwan ist der größte Einschlagkrater auf dem Zwergplaneten Ceres. Er wurde am 19. Februar 2015 auf Aufnahmen der Raumsonde Dawn während deren Annäherung an Ceres entdeckt. Sein Durchmesser beträgt 280 Kilometer.\\nDer Name stammt von dem Geist des sprießenden Maises in der Mythologie der Hopi und wurde am 3. Juli 2015 durch die IAU offiziell bestätigt."},{"page_url":"https://cs.wikipedia.org/wiki/Kr%C3%A1snoporka_%C5%BEemli%C4%8Dka","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/cc/Albatrellus_confluens_I_Sumava.jpg","page_title":"Krásnoporka žemlička","context_page_description":"Krásnoporka žemlička je jedlá houba rostoucí v jehličnatých lesích. Klobouk má žemlově hnědé až světle červenohnědé barvy a póry ji nikdy nežloutnou. Několik plodnic bývá bývá srostlých v trsy, měřící v průměru až 400 mm. Jednotlivé plodnice mají klobouk široký 30-100 mm. Roste ve smrkových nebo v borových lesích od července do října a často ve větším množství.\\nV mládí je jedlá, ale tuhá a méně stravitelná. Zaměnit ji za jedovatou houbu nelze."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%9F%D1%80%D0%BE%D0%B2%D1%83%D0%BB%D0%BE%D0%BA_%D0%91%D1%83%D0%B4%D1%96%D0%B2%D0%B5%D0%BB%D1%8C%D0%BD%D0%B8%D0%BA%D1%96%D0%B2_(%D0%9A%D0%B8%D1%97%D0%B2,_%D0%94%D0%BD%D1%96%D0%BF%D1%80%D0%BE%D0%B2%D1%81%D1%8C%D0%BA%D0%B8%D0%B9_%D1%80%D0%B0%D0%B9%D0%BE%D0%BD)","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/41/%D0%92%D1%83%D0%BB%D0%B8%D1%86%D1%96_%D0%A1%D0%BE%D1%86%D0%BC%D1%96%D1%81%D1%82%D0%B0.jpg","page_title":"Провулок Будівельників (Київ, Дніпровський район)","context_page_description":"Прову́лок Будіве́льників — провулок у Дніпровському районі міста Києва, житловий масив Соцмісто. Пролягає від вулиці Попудренка до Червоноткацької вулиці."},{"page_url":"https://no.wikipedia.org/wiki/Den_store_b%C3%B8lgen_ved_Kanagawa","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0d/Great_Wave_off_Kanagawa2.jpg","page_title":"Den store bølgen ved Kanagawa","context_page_description":"Den store bølgen ved Kanagawa er et tresnitt som ble fremstilt av den japanske kunstneren Katsushika Hokusai.\\nVerket ble publisert i 1832 som det første i Hokusais serie Trettiseks utsyn mot Fuji-fjellet, er det mest kjente i serien, og også muligens det mest berømte japanske kunstverket overhodet. Bildet viser en enorm bølge som truer båter nær det japanske prefekturet Kanagawa. I likhet med alle de andre bildene i serien vises fjellet Fuji-san. Kopier av bildet henger i flere museer verden over, blant annet i Metropolitan Museum of Art i New York og i Claude Monets hus i Frankrike."},{"page_url":"https://en.wikipedia.org/wiki/List_of_international_cricket_centuries_by_Marcus_Trescothick","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7f/Marcus_trescothick.jpg","page_title":"List of international cricket centuries by Marcus Trescothick","context_page_description":"Marcus Trescothick is an English cricketer and former opening batsman for the England national cricket team. He has scored centuries on 14 occasions in Test cricket and 12 times in One Day International matches.\\nTrescothick's first Test century was scored against Sri Lanka at Galle International Stadium in 2001, when he made 122. He then continued to score at least one century every year until his retirement from international cricket in 2006. His highest score of 219 was made against South Africa in 2003 at The Oval, London—his only double century. He has made a century in both innings of a Test match on only one occasion, against the West Indies in 2004 at Edgbaston. Despite being the first batsman to achieve this feat at Edgbaston, Trescothick was not named Man of the Match, as Andrew Flintoff's first-innings of 167 earnt him the accolade instead. During the 2005 series against Bangladesh, Trescothick scored centuries in both Test matches against the touring side, helping earn him a Man of the Series award. His 14 Test centuries have been scored at 11 grounds; nine were scored in England and the remaining five were scored at different venues."},{"page_url":"https://he.wikipedia.org/wiki/%D7%94%D7%9E%D7%95%D7%96%D7%99%D7%90%D7%95%D7%9F_%D7%94%D7%9C%D7%90%D7%95%D7%9E%D7%99_%D7%A9%D7%9C_%D7%91%D7%A8%D7%96%D7%99%D7%9C","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a0/Bendeg%C3%B3_meteorite%2C_front%2C_National_Museum%2C_Rio_de_Janeiro.jpg","page_title":"המוזיאון הלאומי של ברזיל","context_page_description":"המוזיאון הלאומי של ברזיל הוא המוסד המדעי העתיק ביותר בברזיל, ואחד המוזיאונים הגדולים ביותר שעוסק בידיעת הטבע ואנתרופולוגיה ביבשת אמריקה. המוזיאון שוכן בריו דה ז'ניירו בתוך שטח הפארק קווינטה דה בואה ויסטה בתוך ארמון סאו כריסטובאו.\\nב-2 בספטמבר 2018, מבנה הארמון שבו שוכן המוזיאון נשרף. עדיין לא ידוע מהי מידת הנזק שנגרם לאוסף המוזיאון."},{"page_url":"https://fr.wikipedia.org/wiki/Amargasaurus","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8b/Amargasaurus_neck_vertebrae.jpg","page_title":"Amargasaurus","context_page_description":"Amargasaurus est un genre éteint de dinosaures sauropodes diplodocoïdes, de la famille des Dicraeosauridae. Sa taille est relativement modeste pour un sauropode. Il vivait au cours du Crétacé inférieur, il y environ 130 Ma, dans la province de Neuquén en Argentine, où il été découvert dans la formation géologique de la Amarga.\\nAmargasaurus cazaui, la seule espèce connue, est un herbivore quadrupède avec un crâne long et bas au bout d'un cou assez long. Ce dinosaure arbore deux rangées parallèles de grands processus vertébraux épineux, sur son cou, qui se prolongent, avec une taille moindre, jusqu'à la fin de son dos. Ces apophyses auraient pu supporter une voile. Elles donnent une forme caractéristique à l'animal."},{"page_url":"https://fr.wikipedia.org/wiki/Place_Canalejas_(Madrid)","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e0/Plaza_de_Canalejas_%28Madrid%29_10.jpg","page_title":"Place Canalejas (Madrid)","context_page_description":"La place Canalejas est une place publique de Madrid, en Espagne."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%AD%D1%82%D0%B0_%D0%9A%D0%B0%D1%81%D1%81%D0%B8%D0%BE%D0%BF%D0%B5%D0%B8","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/58/Eta_Cassiopeiae.jpg","page_title":"Эта Кассиопеи","context_page_description":"Эта Кассиопеи — двойная звезда в созвездии Кассиопея. Находится на расстоянии около 19,4 световых лет от Солнца. Данная звезда имеет собственное имя — Ахирд, а также китайское — 王良三. У Птолемея в «Альмагесте» — «звезда северная на поясе»."},{"page_url":"https://pl.wikipedia.org/wiki/Lista_postaci_przedstawionych_w_filmach_Marvel_Cinematic_Universe","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a4/Pom_Klementieff_-_Florida_Supercon_-_2017_%2836204242146%29_%28cropped%29.jpg","page_title":"Lista postaci przedstawionych w filmach Marvel Cinematic Universe","context_page_description":"Marvel Cinematic Universe, skrót. MCU – franczyza zrzeszająca filmy, seriale i krótkometrażówki „Marvel One-Shots” o superbohaterach produkcji Marvel Studios, które zaś oparte są na komiksach Marvel Comics. Pomiędzy produkcjami zrzeszonymi w Marvel Cinematic Universe stosowane są częste crossovery, a także wspólne wątki i członkowie obsady.\\nLista ta zawiera postaci przedstawione w filmach Marvel Cinematic Universe, które zagrały główną rolę w filmach lub wystąpiły w przynajmniej dwóch różnych produkcjach Uniwersum. W liście nie są uwzględnione postaci, które dopiero pojawią się w głównej obsadzie filmów lub nie pojawiły się jeszcze w minimum dwóch produkcjach."},{"page_url":"https://it.wikipedia.org/wiki/Bulbinella_rossii","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/16/Bulbinella_rossi_and_Australasian_pipit.jpg","page_title":"Bulbinella rossii","context_page_description":"Il giglio di Ross è una pianta della famiglia Asphodelaceae.\\nÈ una delle megaerbe neozelandesi."},{"page_url":"https://it.wikipedia.org/wiki/Sainte-Eulalie-en-Royans","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f2/Mairie_Sainte-Eulalie-en-Royans_2011-10-04-058.jpg","page_title":"Sainte-Eulalie-en-Royans","context_page_description":"Sainte-Eulalie-en-Royans è un comune francese di 544 abitanti situato nel dipartimento della Drôme della regione dell'Alvernia-Rodano-Alpi."},{"page_url":"https://da.wikipedia.org/wiki/Sporsammenfletning","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/29/Sechsschienengleis.JPG","page_title":"Sporsammenfletning","context_page_description":"Sporsammenfletning er et arrangement af togskinner, som løber parallelt på et enkelt skinnespor. Typisk anvendes fire parallelle togskinner, men andre antal togskinner er også set anvendt - fx tre, fem og seks.\\nUlempen ved sporsammenfletning er at de er overlappende sådan, at kun et par togskinner kan anvendes ad gangen.\\nFordelen er, at sporsammenfletningen kun kræver lidt større bredde, end et enkelt togspor - og det anvendes fx steder hvor veje, tunneler eller broer, vil være for dyre at udvide. Herudover kan sporsammenfletningen deles om perroner, køreledning, sveller og ballast. En anden væsentlig fordel er at sporskifter ikke er nødvendig, men det skal sikres at kun ét tog kan være på de sporsammenfletningen ad gangen."},{"page_url":"https://en.wikipedia.org/wiki/Almanzor","image_url":"http://upload.wikimedia.org/wikipedia/commons/6/63/Juan_Gimenez_Martin_-_In_the_Harem.jpg","page_title":"Almanzor","context_page_description":"Abu ʿĀmir Muḥammad ibn ʿAbdullāh ibn Abi ʿĀmir al-Maʿafiri, nicknamed al-Manṣūr, usually simply called Almanzor, was a military leader and statesman. As the chancellor of the Umayyad Caliphate of Córdoba and hajib for the weak Caliph Hisham II, Almanzor was the de facto ruler of Islamic Spain.\\nBorn in an alqueria on the outskirts of Torrox to a family of Yemeni Arab origin with some juridical ancestors, ibn Abi ʿĀmir left for Córdoba when still young to be trained as a Faqīh. After a few humble beginnings, he joined the court administration and soon gained the confidence of Subh, mother of the children of Caliph Al-Hakam II. Thanks to her patronage and his own efficiency, he quickly expanded his role.\\nDuring the caliphate of Al-Hakam II, he held several important administrative positions, including director of the mint, administrator for Subh and her children, and for intestate inheritances, and quartermaster for the army of General Ghalib ibn Abd al-Rahman."},{"page_url":"https://fa.wikipedia.org/wiki/%D9%BE%D8%B1%D9%81%D9%84%D9%88%D8%B1%D9%88%D8%A8%D9%88%D8%AA%D8%A7%D9%86","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/26/Perflubutane.png","page_title":"پرفلوروبوتان","context_page_description":"پرفلوروبوتان با فرمول شیمیایی C₄F₁₀ یک ترکیب شیمیایی با شناسه پاب‌کم ۲۴۶۱۷ است. که جرم مولی آن ۲۳۸٫۰۳ گرم بر مول می‌باشد."},{"page_url":"https://no.wikipedia.org/wiki/Sveitsergarden","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/08/Group_of_swiss_guards_inside_saint_peter_dome.jpg","page_title":"Sveitsergarden","context_page_description":"Sveitsergarden er i dag en styrke av sveitsiske leiesoldater som tjenestegjør som pavens livgarde og Vatikanets forsvar. Deres offisielle språk er tysk.\\nDet har vært flere «sveitsergarder» som har tjent forskjellige europeiske fyrstehus og makter, deriblant den sveitsiske Cent-Garde som tjenestegjorde ved det franske hoffet fra 1497 til 1830 og var den første sveitsergarden, og flere andre på 1700-tallet. Nå er det bare pavens sveitsergarde som fortsatt eksisterer."},{"page_url":"https://sv.wikipedia.org/wiki/Ekonomiska_och_monet%C3%A4ra_unionen","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5e/Miquelanlage_2.jpg","page_title":"Ekonomiska och monetära unionen","context_page_description":"Ekonomiska och monetära unionen är enligt fördraget om Europeiska unionens funktionssätt ett av Europeiska unionens befogenhetsområden. Politikområdet omfattar ekonomisk och monetär politik, och innefattar samtliga medlemsstater, även de som inte har euron som valuta. Vissa delar av EMU, särskilt den monetära politiken, omfattar dock endast de medlemsstater som har euron som valuta. EMU utgör ingen juridisk person, utan är en integrerad del av EU. I fördragen används ofta istället benämningen ”ekonomisk och monetär politik”.\\nIdén om en gemensam valuta har successivt vuxit fram i takt med att det europeiska samarbetet har blivit allt djupare. Genom fördraget om Europeiska unionen blev ett valutasamarbete formellt möjligt att genomföra, och den 1 januari 1999 infördes euron i euroområdet efter en längre tids förberedelser. Medlemsstaterna som använder euron som valuta har överfört sin beslutanderätt över monetära frågor till europeisk nivå, i synnerhet till Europeiska centralbanken. Förutom det monetära samarbetet, omfattar EMU också ekonomisk och finansiell samordning.\\nUnionen har exklusiv befogenhet i monetär politik för de medlemsstater som använder euron som valuta."},{"page_url":"https://it.wikipedia.org/wiki/Sperello_Sperelli","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/73/Sperello_Sperelli.jpg","page_title":"Sperello Sperelli","context_page_description":"Sperello Sperelli è stato un cardinale e vescovo cattolico italiano."},{"page_url":"https://fr.wikipedia.org/wiki/1_000_kilom%C3%A8tres_d%27Okayama_2009","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b7/Sora_Racing_Pescarolo_2009_1000km_of_Okayama_%28Race_2%29.jpg","page_title":"1 000 kilomètres d'Okayama 2009","context_page_description":"Les 1000 km d'Okayama 2009 ont inauguré le championnat Asian Le Mans Series créé par l'Automobile Club de l'Ouest. Cette course a lieu sur le circuit international d'Okayama et se dispute en deux manches de 500 km les 30 octobre 2009 et 1ᵉʳ novembre 2009. Lors de ce même week-end, se déroule aussi sur ce circuit une épreuve du WTCC 2009.\\nLes vainqueurs de chaque catégorie reçoivent une invitation automatique pour les 24 Heures du Mans 2010.\\nUne seconde épreuve était prévue sur le Circuit international de Shanghai les 7 et 8 novembre mais elle a été annulée pour des raisons économiques."},{"page_url":"https://cs.wikipedia.org/wiki/Slavonice","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f2/Z%C3%A1kladn%C3%AD_%C5%A1kola_ve_Slavonic%C3%ADch_%2804%29.jpg","page_title":"Slavonice","context_page_description":"Slavonice jsou malé historické město na jihozápadní Moravě v okrese Jindřichův Hradec. Leží zhruba jeden kilometr severně od hranice s Rakouskem, jedenáct kilometrů jihozápadně od Dačic, po obou stranách Slavonického potoka. Žije v nich přibližně 2 400 obyvatel. Díky zachovanému historickému jádru města se Slavonicím přezdívá „malá Telč“ nebo „perla západomoravské renesance“. Slavonice jsou nejzápadnějším městem Moravy a spolu s nedalekými Dačicemi jedinými dvěma moravskými městy na území Jihočeského kraje."},{"page_url":"https://en.wikipedia.org/wiki/Toshihira_Inoguchi","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/64/Inoguchi_i.jpg","page_title":"Toshihira Inoguchi","context_page_description":"Toshihira Inoguchi was a Japanese Vice-Admiral and served as the commander of the Yamato-Class Battleship Musashi during World War II until his death.\\nInoguchi held various commands within the Imperial Japanese Navy and had a reputation as its best gunnery theorist. During the Battle of Sibuyan Sea, Musashi was attacked by staggered waves of US Navy dive bombers and torpedo bombers and was sunk. Inoguchi was wounded, and chose to go down with the ship."},{"page_url":"https://fi.wikipedia.org/wiki/Saksan_markka","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/17/DEU-50m-rev.jpg","page_title":"Saksan markka","context_page_description":"Saksan markka eli D-markka, lyhenteenä DM, valuuttatunnuksena DEM, oli Saksan liittotasavallan rahayksikkö vuosina 1949–2001. Sen jälkeen Saksan rahayksikkönä on ollut euro. Saksan markan laskennallinen suhde euroon 1 € = 1,95583 DM asetettiin jo 31. joulukuuta 1998, ja euron käyttö tilivaluuttana alkoi 1. tammikuuta 1999.\\nMarkka rahayksikkönä jakautui 100 penniin."},{"page_url":"https://no.wikipedia.org/wiki/Via_ferrata","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/98/Via_Ferrata_og_utsikt_mot_Lodalen.JPG","page_title":"Via ferrata","context_page_description":"Via ferrata er et italiensk ord og er oversatt til engelsk med «Iron road» og til tysk med «Klettersteig». Til norsk kan det oversettes med «klatresti» eller «jernsti», men det omtales ofte som «klatresti med wire»."},{"page_url":"https://it.wikipedia.org/wiki/Sorisole","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/10/Portale_Lanfranchi.jpg","page_title":"Sorisole","context_page_description":"Sorisole è un comune italiano di 9 117 abitanti della provincia di Bergamo, in Lombardia. È situato a circa 7 chilometri a nord dal capoluogo orobico."},{"page_url":"https://ar.wikipedia.org/wiki/%D8%A5%D8%B3_%D8%A5%D8%AA%D8%B4-60_%D8%B3%D9%8A_%D9%87%D9%88%D9%83","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9b/SH-60J_landing_March_2007.jpg","page_title":"إس إتش-60 سي هوك","context_page_description":"سيكورسكي إس إتش-60 سي هوك ‏ هي مروحية بمحريكي عمود دوران توربيني متعددة المهام للبحرية الأمريكية مبنية على هيكل مروحية يو إتش-60 بلاك هوك وهي جزء من سلسلة مروحيات سيكورسكي إس-70.\\nSH-60/MH-60 سيكورسكي Seahawk هي المحرك التوربيني المزدوج، متعددة المهام طائرة هليكوبتر بحرية الولايات المتحدة تقوم على هيكل الطائرة للولايات المتحدة من طراز بلاك هوك يو اتش 60 في الجيش وعضو في سيكورسكي دإ 70 عائلة. التعديل الأكثر أهمية هو ذيل يتوقف للحد من تواجدها على متن السفن.\\nالبحرية الأمريكية تستخدم - 60 ه هيكل الطائرة تحت تسميات نموذج ش - 60B، ش، 60F، سمو - 60H، ام اتش 60R، و 60s. قادرة على الانتشار على متن الفرقاطة أي جو قادرة، المدمرة، طراد، سريع سفينة دعم القتال، وسفينة هجومية برمائية، أو حاملة طائرات، يمكن أن Seahawk التعامل مع الحرب ضد الغواصات، والحرب تحت البحر ومعاداة الحرب السطح، والحرب البحرية الخاصة الإدراج، والبحث والإنقاذ، والبحث والإنقاذ القتالية، والتجديد العمودي، والإجلاء الطبي. جميع حاء البحرية - 60s تحمل رافعة الإنقاذ للبعثات ريال سيزار"},{"page_url":"https://fr.wikipedia.org/wiki/Strojkovce","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/56/Muzej_tekstila_u_selu_Strojkovce.png","page_title":"Strojkovce","context_page_description":"Strojkovce est une localité de Serbie située sur le territoire de la Ville de Leskovac, district de Jablanica. Au recensement de 2011, elle comptait 1 225 habitants."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%91%D0%B5%D1%80%D0%B5%D0%BD%D0%B3%D0%B0%D1%80%D0%B8%D1%8F_(%D0%BB%D0%B0%D0%B9%D0%BD%D0%B5%D1%80)","image_url":"https://upload.wikimedia.org/wikipedia/ru/a/af/Ber_int_13.jpg","page_title":"Беренгария (лайнер)","context_page_description":"Беренгария — первый трансатлантический лайнер класса «Император», первоначально построенный для Hamburg-Amerikanische Packetfahrt-Actien-Gesellschaft как лайнер под именем «Император». На момент спуска в мае 1912 года он был самым большим пассажирским судном в мире, превзойдя погибший «Титаник». После службы в ВМФ США во время Первой мировой войны, «Император» был передан Кунард Лайн как часть военных репараций и ходил в качестве флагмана компании под именем «Беренгария» до конца своей карьеры."},{"page_url":"https://eu.wikipedia.org/wiki/NGC_6632","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/25/NGC6632_by_Goran_Nilsson_%26_The_Liverpool_Telescope.jpg","page_title":"NGC 6632","context_page_description":"NGC 6632 galaxia bat da, Hercules konstelazioan. Albert Marthek aurkitu zuen 1864ko ekainaren 24an."},{"page_url":"https://fr.wikipedia.org/wiki/Elizabeth_Mortimer","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/33/Harry_Hotspur_Percy.jpg","page_title":"Elizabeth Mortimer","context_page_description":"Elizabeth Mortimer est une femme de la haute noblesse anglaise, petite-fille du duc de Clarence Lionel d'Anvers et arrière-petite-fille du roi Édouard III. Son premier époux est Henry Percy, passé à la postérité sous le surnom de « Hotspur ». Elle épouse ensuite Thomas de Camoys. Elle figure parmi les personnages de deux des pièces de William Shakespeare, sous le nom de « Kate, Lady Percy » dans Henry IV et celui de « Veuve Percy » dans Henry IV."},{"page_url":"https://it.wikipedia.org/wiki/Monumenti_di_Firenze","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/be/Gilli_%28Florence%29_Piazza_della_Repubblica.jpg","page_title":"Monumenti di Firenze","context_page_description":"Firenze è una delle città mondiali a maggior densità di risorse culturali e monumenti che testimoniano la sua incredibile evoluzione storico artistica. Soltanto i musei sono più di 60, altrettante le chiese degne di nota. In questa pagina è presente una lista delle cose più significative da visitare in città."},{"page_url":"https://en.wikipedia.org/wiki/Yanni_discography","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/79/YanniPressPhoto.jpg","page_title":"Yanni discography","context_page_description":"The discography of the Greek contemporary instrumental musician Yanni consists of 14 studio albums and seven live albums. In 1987 he put together a small band which included John Tesh and Charlie Adams, and began touring to promote his earliest instrumental albums, Keys to Imagination, Out of Silence, and Chameleon Days.\\nDare to Dream was released in 1992. It was Yanni’s first Grammy-nominated album and featured \\"Aria\\", a song based on The Flower Duet and popularized by an award-winning British Airways commercial. A second Grammy-nominated album, In My Time, was released in 1993. His music has been used extensively in television and televised sporting events, including the Super Bowl, Wide World of Sports, U.S. Open, Tour de France, World Figure Skating Championships, The Olympics, and ABC News.\\nYanni's breakthrough commercial success came with the release of his album and video, Live at the Acropolis, filmed on September 25, 1993 at the 2,000-year-old Herod Atticus Theater in Athens, Greece, and released in 1994. This was Yanni’s first live album and utilized a full orchestra under the supervision of the Iranian conductor, Shahrdad Rohani, in addition to his core band."},{"page_url":"https://de.wikipedia.org/wiki/Gleichstrommaschine","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5f/Animation_einer_Gleichstrommaschine_%28Variante%29.gif","page_title":"Gleichstrommaschine","context_page_description":"Eine Gleichstrommaschine, auch Gleichstrommotor, Kommutatormotor oder Kommutatormaschine, ist eine rotierende elektrische Maschine, die mit Gleichstrom betrieben wird oder Gleichstrom erzeugt. Je nach Richtung des Leistungsflusses wird zwischen dem Gleichstrommotor und dem Gleichstromgenerator unterschieden. Gleichstrommaschinen können unter Belastung anlaufen, und ihre Drehzahl ist leicht zu verändern.\\nMerkmal der klassischen Gleichstrommaschinen ist ein als Kommutator oder Polwender bezeichneter mechanischer Wechselrichter. Mit dessen Hilfe wird im Motorbetrieb im Rotor ein drehzahlabhängiger Wechselstrom erzeugt. Im Generatorbetrieb wandelt er die vom Rotor gelieferte Wechselspannung in eine pulsierende Gleichspannung um.\\nEs gibt auch Anwendungsfälle, in denen dieselbe Gleichstrommaschine zeitweise als Motor und zeitweise als Generator benutzt wird.\\nEine Sonderform ist die Unipolarmaschine, mit der Gleichstrom ohne Verwendung eines Kommutators erzeugt werden kann."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%91%D0%B5%D1%82%D1%8C%D1%8E%D0%BD,_%D0%9D%D0%BE%D1%80%D0%BC%D0%B0%D0%BD","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/53/Norman_Bethune_operation_1933.jpg","page_title":"Бетьюн, Норман","context_page_description":"Генри Норман Бетьюн — канадский хирург, новатор в хирургии и в методах организации помощи раненым на поле боя. Убеждённый антифашист, он участвовал в качестве врача-добровольца в гражданской войне в Испании, создав для республиканцев мобильную систему гемотрансфузии. Затем он присоединился к китайским коммунистам в их войне против японских захватчиков, где и погиб. После смерти он стал одним из самых почитаемых иностранцев в Китае."},{"page_url":"https://he.wikipedia.org/wiki/%D7%A2%D7%95%D7%A0%D7%AA_2019/2020_%D7%91%D7%9C%D7%99%D7%92%D7%AA_%D7%94%D7%A2%D7%9C_%D7%94%D7%A8%D7%95%D7%A1%D7%99%D7%AA_%D7%91%D7%9B%D7%93%D7%95%D7%A8%D7%92%D7%9C","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/35/MordoviaArenaStadium.jpg","page_title":"עונת 2019/2020 בליגת העל הרוסית בכדורגל","context_page_description":"עונת 2019/2020 בליגת העל הרוסית היא העונה ה-28 של ליגת העל הרוסית בכדורגל מאז הקמתה ב-1992 והיא ליגת הכדורגל המקצועני הבכירה ביותר ברוסיה בעונת 2019/2020. העונה התחילה ביולי 2019 והוקפאה במרץ 2020, בעקבות התפרצות נגיף הקורונה ברוסיה, שהביאה לביטול ודחיית אירועים המוניים. במאי 2020 הוכרז על חידוש הליגה החל מ-21 ביוני, בהמשך פורסם שהליגה תחודש ב-19 ביוני, עם אפשרות הכנסת קהל עד 10% מתכולת האצטדיונים.\\nהעונה הייתה אחת המותחות בתולדות הליגה, כאשר במחזור 13, ארבע קבוצות צברו את אותו מספר נקודות: רוסטוב, לוקומוטיב, קרסנודאר וזניט. כמדי עונה, פתיחת העונה צוינה במשחק הסופר קאפ הרוסי בכדורגל שנערך ב-6 ביולי 2019. לראשונה התמודדו בליגה טמבוב וסוצ'י. בעונה זו נכנסה לשימוש לראשונה מערכת ה-VAR לכל משחקי הליגה, החל מפברואר 2020, כשקודם לכן הוכנסה המערכת לשימוש חלקי בלבד.\\nזניט זכתה באליפות הששית במספר והשנייה ברציפות."},{"page_url":"https://es.wikipedia.org/wiki/Castillo_de_Romanos","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/af/Romanos_%28Zaragoza%2C_Espagne%29%2C_muraille.jpg","page_title":"Castillo de Romanos","context_page_description":"El Castillo de Romanos es un castillo gótico mudéjar que se encuentra situado en la localidad Zaragozana de Romanos.​"},{"page_url":"https://la.wikipedia.org/wiki/Ci%C3%A9rvana","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/68/Zierbena_bandera.gif","page_title":"Ciérvana","context_page_description":"Ciérvana est commune Hispanicum in communitatis autonomae Vasconiae Provincia Biscaia situm, cui anno 2011 1440 incolarum sunt."},{"page_url":"https://en.wikipedia.org/wiki/Arcore_railway_station","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/68/Trenord_train_ticket_6630559.jpg","page_title":"Arcore railway station","context_page_description":"Arcore railway station is a railway station in Italy. Located on the Lecco–Milan railway, it serves the municipality of Arcore with trains from and to Monza-Milano or Lecco, and Bergamo.\\nA second station - of a different railway line, the Monza-Molteno-Lecco railway - is present in Arcore, located in Ca' Bianca-Buttafava area, with trains from and to Monza-Milano or Lecco, but running through a more long and slow way than the trains of the main Arcore station."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%9C%D0%BE%D0%B9%D0%BD%D0%B0%D0%BA%D0%B8_(%D0%B3%D1%80%D1%8F%D0%B7%D0%B5%D0%BB%D1%96%D0%BA%D0%B0%D1%80%D0%BD%D1%8F)","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/02/Lake_moynaki.jpg","page_title":"Мойнаки (грязелікарня)","context_page_description":"Грязелікарня «Мойнаки» — багатопрофільний лікувальний заклад в Євпаторії, заснований у 1886 році. Знаходиться на березі озера Мойнаки. У грязелікарні діють чотири грязьових відділення, а також ванне відділення на 80 ванн."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Stra%C3%9Fen_und_Pl%C3%A4tze_in_Berlin-Friedrichshain","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4b/Stra%C3%9Fmannstr_%282%29_Friedrichshain110228_AMA_fec.jpg","page_title":"Liste der Straßen und Plätze in Berlin-Friedrichshain","context_page_description":"Die Liste der Straßen und Plätze in Berlin-Friedrichshain beschreibt das Straßensystem im Berliner Ortsteil Friedrichshain mit den entsprechenden historischen Bezügen. Gleichzeitig ist diese Zusammenstellung ein Teil der Listen aller Berliner Straßen und Plätze."},{"page_url":"https://fr.wikipedia.org/wiki/Palais_du_Quirinal","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/dc/Quirinal_Giovanni_Piranesi.jpg","page_title":"Palais du Quirinal","context_page_description":"Le palais du Quirinal est un palais romain, qui se trouve sur la colline du Quirinal et qui fait face à la place éponyme, à Rome.\\nRésidence papale, elle est occupée, à partir de 1870, par le roi d'Italie et sa famille avant de devenir, enfin, la résidence officielle du président de la République italienne. Ce palais, l'un des plus vastes au monde, est l'un des symboles les plus éminents de l'État italien.\\nConstruit à partir de 1574 à l'initiative du pape Grégoire XIII, le palais du Quirinal est l'un des bâtiments les plus prestigieux de la capitale italienne, tant du point de vue artistique que du point de vue politique. Plusieurs artistes, parmi les plus grands d'Italie voire d'Europe, ont contribué à sa construction ou à ses aménagements, comme Pietro da Cortona, Domenico Fontana, Ferdinando Fuga et Carlo Maderno. Actuellement, le palais abrite le plus grand fragment d'une fresque de l'artiste Melozzo da Forlì.\\nPaul V est le premier pontife prenant vraiment place au Quirinal, qui sera la résidence romaine de trente papes, de Grégoire XIII à Pie IX."},{"page_url":"https://zh-min-nan.wikipedia.org/wiki/Cedar_Point_(North_Carolina)","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/86/NCMap-doton-CedarPoint.PNG","page_title":"Cedar Point (North Carolina)","context_page_description":"Cedar Point sī Bí-kok North Carolina chiu Carteret kūn ê chi̍t ê chng-thâu."},{"page_url":"https://pt.wikipedia.org/wiki/Matthias_Sindelar","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7d/Sindelar-aut.jpg","page_title":"Matthias Sindelar","context_page_description":"Matthias Sindelar, nascido como Matěj Šindelář, foi um futebolista austríaco de origem tcheca. Nascido na Morávia, região então parte do Império Austro-Húngaro e que hoje pertence à República Tcheca, sua família mudou-se para Viena quando ele possuía dois anos de idade. Tornar-se-ia o maior esportista austríaco do século XX, eleito assim de modo oficial em dezembro de 1998, sessenta anos após sua morte.\\nSeu desempenho como um centroavante goleador que também voltava para buscar jogo e puxar os marcadores para fora da área, tabelando com os meias, lhe deixou como um dos mais revolucionários jogadores europeus no início do século passado.Embora os registros em filme de suas atuações sejam ínfimos, a elegância e qualidade de seu futebol foram asseguradas pelos jornalistas que o viram em ação. O jogador, porém, ficaria ainda mais marcado como um herói de resistência ao nazismo, inspirando diversos mitos reforçados por sua misteriosa morte, embora estudos modernos tenham desfeito algumas versões romanceadas dessa história.\\nComo jogador, Sindelar conquistaria sobretudo duas Copas Mitropa, em 1933 e em 1936, tendo também conquistado um campeonato austríaco, o de 1926."},{"page_url":"https://en.wikipedia.org/wiki/Kalanjoor","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fa/Kochu_kuttalam_%28_Non_Sesonal_Time_%29.jpg","page_title":"Kalanjoor","context_page_description":"Kalanjoor is a village and a small Township in Pathanamthitta district state of Kerala, India. Also Kalanjoor is one of the panchayath in Pathanamthitta district as the part of Parakode block panchayath. This place has mixed with a population of Hindus, Muslims and Christians.The famous Hindu temple Thrikalanjoor Mahadeva shekthram situated in Kalanjoor Town close to Punalur Muvattupuzha state highway. This is the first and biggest temple on the way of Sabarimala from the southern side of Pathanamthitta and Sabarimala. So that this place is also known as the \\"Southern Gateway of Sabarimala\\". Many of the inhabitants of this village are settlers there due to the introduction of rubber plantations, mainly by the plantation. A number of people from Kalanjoor are employed in abroad, mainly in the Middle East and the US.\\nCollege of Applied Science, Kalanjoor is affiliated to Kerala University and is established in 2014 with regular courses of B.Com with Computer Applications and Bachelor of Business Administration.\\n."},{"page_url":"https://da.wikipedia.org/wiki/Le_Duc_Tho","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/02/LeDucTho1973.jpg","page_title":"Le Duc Tho","context_page_description":"Le Duc Tho var en vietnamesisk revolutionær, general, diplomat og politiker. Tho var en af de ledende fredsforhandlere for Nordvietnam under Vietnamkrigen og holdt hemmelige møder med USAs udenrigsminister Henry Kissinger fra februar 1970 og frem, hvilket resulterede i våbenhvilen og fredsaftalen, der blev indgået ved afslutningen af fredsforhandlingerne i Paris 27. januar 1973. For opnåelsen af dette resultat blev Kissinger og Tho tildelt Nobels fredspris samme år, men Tho afslog at modtage prisen, idet han påberåbte sig, at der ikke var fred i landet, og at Sydvietnam og USA ikke overholdt aftalen."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%90%D0%BC%D0%B0%D0%B4%D0%B5%D0%B9_III_(%D0%B3%D1%80%D0%B0%D1%84_%D0%A1%D0%B0%D0%B2%D0%BE%D0%B9%D1%81%D1%8C%D0%BA%D0%B8%D0%B9)","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/70/Amedeo_III_di_Savoia.jpg","page_title":"Амадей III (граф Савойський)","context_page_description":"Амаде́й III Хрестоносець — граф Савойський та Морієнський."},{"page_url":"https://en.wikipedia.org/wiki/JDS_Kashima","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/18/JS_Kashima_%28ship%2C_1994%29_TV3508%2C_Split%2C_2013-09-02.jpg","page_title":"JDS Kashima","context_page_description":"JDS Kashima is a training ship of the Japan Maritime Self-Defense Force. Built to a unique design during the mid-1990s, Kashima is flagship of the JMSDF Training Fleet. The name Kashima comes from the famous Shinto Kashima Shrine in Ibaraki prefecture, located to the northeast of Tokyo."},{"page_url":"https://fr.wikipedia.org/wiki/Corona_(satellite)","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c6/Kh-4b_corona.jpg","page_title":"Corona (satellite)","context_page_description":"Corona est le premier programme de satellites de reconnaissance des Américains qui est mis en œuvre entre juin 1959 et le 31 mai 1972. Il est développé au début de l'ère spatiale, en pleine guerre froide opposant les États-Unis à l’Union soviétique alors que ce pays met au point des missiles balistiques intercontinentaux dotés d'une tête nucléaire qui semblent sur le point de bouleverser l'équilibre militaire entre les deux pays. Le programme Corona permet d'évaluer à la baisse la menace des missiles soviétiques en permettant de dénombrer le nombre de sites de lancement réel. Les satellites du programme Corona utilisent des techniques mises au point dans le cadre de la photographie aérienne. Les satellites Corona disposent d'une ou deux capsules récupérables contenant le film photographique. Celle-ci est larguée par le satellite une fois la mission de reconnaissance accomplie et récupéré en vol par des avions équipés de dispositifs de récupération. Le programme géré par la CIA est longtemps resté secret. Il est déclassifié en 1995."},{"page_url":"https://ca.wikipedia.org/wiki/Geologia_de_Mercuri","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d9/Mercury_Caloris_detailed.jpg","page_title":"Geologia de Mercuri","context_page_description":"La geologia de Mercuri és la menys coneguda dels planetes interiors del sistema solar. Les raons d'això inclouen tant la proximitat de Mercuri al Sol com pel fet que la durada del cicle dia-nit a Mercuri és de 58 dies terrestres. Això darrer va fer que l'única sonda espacial que el visités tres vegades només pogués observar el costat il·luminat pel Sol en cada visita. Es preveu que la sonda MESSENGER augmenti bastant el nostre coneixement sobre aquest planeta quan es posi en òrbita al seu voltant el març de 2011."},{"page_url":"https://sco.wikipedia.org/wiki/Willie_Collum","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/55/Willie_Collum_2017.jpg","page_title":"Willie Collum","context_page_description":"William \\"Willie\\" Collum is a Scots fitbaw referee."},{"page_url":"https://es.wikipedia.org/wiki/Cabrales","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/24/La_Molina_-_panoramio.jpg","page_title":"Cabrales","context_page_description":"Cabrales es un concejo español de la comunidad autónoma del Principado de Asturias. Limita al norte con Llanes, al sur con las provincias de Cantabria y León, al este con Peñamellera Alta y al oeste con Onís.\\nLa capital municipal es Carreña, y el concejo alberga una población de 2008 habitantes, con una extensión de 238,29 kilómetros cuadrados. Es cruzado por diferentes carreteras, la AS-114, cruza su municipio, la AS-345 va hacia Peñamellera Alta, y la AS-264 que va hacia Puente Poncebos.\\nEs un concejo eminentemente ganadero, por la orografía y sus pastizales, teniendo merecida fama su leche, con la que se elabora el queso de Cabrales, de fama internacional."},{"page_url":"https://fr.wikipedia.org/wiki/Coll%C3%A9giale_Saint-Aubin_de_Gu%C3%A9rande","image_url":"http://upload.wikimedia.org/wikipedia/commons/9/9e/Collegiale-01.jpg","page_title":"Collégiale Saint-Aubin de Guérande","context_page_description":"La collégiale Saint-Aubin est une église catholique située à Guérande dans le département français de la Loire-Atlantique, en France."},{"page_url":"https://en.wikipedia.org/wiki/Snowy_Mountains_Scheme","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c4/Lakeeucumbenefrom_sky.JPG","page_title":"Snowy Mountains Scheme","context_page_description":"The Snowy Mountains scheme or Snowy scheme is a hydroelectricity and irrigation complex in south-east Australia. The Scheme consists of sixteen major dams; nine power stations; one pumping station; and 225 kilometres of tunnels, pipelines and aqueducts that were constructed between 1949 and 1974. The Scheme was completed under the supervision of Chief Engineer, Sir William Hudson. It is the largest engineering project undertaken in Australia.\\nThe water of the Snowy River and some of its tributaries, much of which formerly flowed southeast onto the river flats of East Gippsland, and into Bass Strait of the Tasman sea, is captured at high elevations and diverted inland to the Murray and Murrumbidgee Rivers irrigation areas. The Scheme includes two major tunnel systems constructed through the continental divide of the Snowy Mountains, known in Australia as the Great Dividing Range. The water falls 800 metres and travels through large hydro-electric power stations which generate peak-load power for the Australian Capital Territory, New South Wales and Victoria."},{"page_url":"https://he.wikipedia.org/wiki/%D7%A9%D7%99%D7%99%D7%98%D7%AA_13","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/76/IzziRahav1949.jpg","page_title":"שייטת 13","context_page_description":"שייטת 13 היא יחידת הקומנדו הימי של חיל הים הישראלי. בסיס הקבע של היחידה הוא בסיס עתלית, והיא כפופה ישירות למפקד חיל הים. מפקד השייטת הוא קצין ים בדרגת אלוף-משנה.\\nנוסף על סוגי הלוחמה האופייניים לקומנדו ימי, בפרט פעולות המצריכות נחיתה מהים, פעולות חבלה בכלי שיט והשתלטות על כלי שיט, מאומנים לוחמי היחידה בפאסט-רופ ובכל צורות לוחמת היבשה ובצניחה מבצעית. השייטת מפעילה צלפים ומשתתפת בלחימה יבשתית טיפוסית ללוחמי חיל רגלים. בעשורים האחרונים המוניטין של שייטת 13 עלה באופן ניכר וכיום היא נחשבת לאחת מיחידות הקומנדו הטובות ביותר בצה\\"ל, ולאחת מיחידות הכוחות המיוחדים הטובות בעולם. נכון ל-2019 זכתה היחידה ב-6 ציונים לשבח מטעם הרמטכ\\"ל.\\nהיחידה משתתפת באימונים משותפים עם יחידות מקבילות מצבאות זרים, כמו אריות הים של צי ארצות הברית וה-SBS הבריטית.\\nמוטו היחידה: \\"כעטלף המגיח בעלטה, כלהב המבתר בדומיה, כרימון המנפץ ברעם\\" חובר בידי פסיכולוג השייטת, ד\\"ר בני שליט."},{"page_url":"https://it.wikipedia.org/wiki/Inshushinak","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7a/Bull-man_protecting_palmtree_Louvre_14390-91.jpg","page_title":"Inshushinak","context_page_description":"Inshushinak era uno dei maggior dei degli Elamiti e protettore della città di Susa nello stato di Elam. Il ziggurat di Choqa zanbil è dedicato a lui."},{"page_url":"https://vi.wikipedia.org/wiki/Phalacra","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d0/Phalacra_strigata_insulicola.jpg","page_title":"Phalacra","context_page_description":"Phalacra là một chi bướm đêm thuộc phân họ Drepaninae."},{"page_url":"https://lt.wikipedia.org/wiki/COVID-19","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e5/SARS-CoV-2_%28CDC-23312%29.png","page_title":"COVID-19","context_page_description":"Koronaviruso liga 2019, COVID-19 – infekcinė liga, kurią sukelia koronavirusas SARS-CoV-2. Daugiausia kvėpavimo takus paveikianti infekcija pirmą kartą aprašyta 2019 m. pabaigoje Uhane, Kinijoje. 2020 m. sausio mėn. Kinijoje kilo šios ligos epidemija, vėliau liga išplito į kitas pasaulio šalis ir tapo pandemija.\\nInfekcija kaip taisyklė plinta oro lašeliniu būdu. Tam tikromis aplinkybės liga gali būti perduodama ir per aerozolius. Ligos eiga yra nespecifinė, pasireiškia įvairiai ir stipriai varijuoja. Sergantiesiems gali pasireikšti į gripą panašūs simptomai, kaip antai karščiavimas, sausas kosulys, nuovargis, dusulys.\\nRečiau skauda gerklę, kamuoja sloga, čiaudulys. Šalia besimptominių ligos atvejų daugeliu atvejų pasireiškia lengvi ar vidutinio sunkumo simptomai, tačiau kai kada liga gali progresuoti iki abipusio plaučių uždegimo ar daugelio organų funkcijos nepakankamumo ir sukelti mirtį. Be plaučių pažeidimo yra pastebėta, kad liga pakenkia kepenims, centrinei nervų sistemai, inkstams, kraujagyslėms ir širdžiai. Pasveikimas priklauso nuo žmogaus imuninės sistemos būklės."},{"page_url":"https://de.wikipedia.org/wiki/Goldschopfpinguin","image_url":"http://upload.wikimedia.org/wikipedia/commons/2/28/Eudyptes_chrysolophus4_%28South_Georgia%29.jpg","page_title":"Goldschopfpinguin","context_page_description":"Der Goldschopfpinguin ist eine Pinguinart aus der Gattung der Schopfpinguine. Er ist weltweit die häufigste Pinguinart und kommt auf vielen subantarktischen Inseln sowie im äußersten Süden Südamerikas vor. Trotz der großen Population schätzt die IUCN den Goldschopfpinguin als gefährdet ein, weil seit mindestens drei Generationen die Populationszahlen stark zurückgehen. Es werden keine Unterarten unterschieden.\\nDer sehr ähnliche Haubenpinguin, der fast ausschließlich auf den Macquarie-Insel brütete, galt lange als Unterart des Goldschopfpinguins, wird aber heute fast durchgängig als eigenständige Art eingeordnet."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%9F%D0%BE%D1%80%D1%82-%D0%9C%D0%B0%D0%B9%D0%BE_(%D1%81%D1%82%D0%B0%D0%BD%D1%86%D1%96%D1%8F_%D0%BC%D0%B5%D1%82%D1%80%D0%BE)","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/ac/Centre_de_d%C3%A9pannage_des_trains_de_la_ligne_1_du_m%C3%A9tro_de_Paris_-_JEP_2013_-_Photo_n%C2%B0_29.JPG","page_title":"Порт-Майо (станція метро)","context_page_description":"Порт Майо — станція лінії 1 Паризького метрополітену, розташована на межі XVI і XVII округів Парижа. Назву отримала від однойменної площі на кордоні Парижа, що утворилася в результаті ліквідації воріт Майо після демонтажу Тьєрського муру. На станції заставлено тактильне покриття. На станції встановлені автоматичні платформні ворота."},{"page_url":"https://zh.wikipedia.org/zh-tw/%E9%98%BF%E5%8A%A0%E9%9B%B7%E6%96%AF","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4b/Agares_Seal.jpg","page_title":"阿加雷斯","context_page_description":"阿加雷斯，是所羅門七十二柱魔神中排第2位的魔神。名為Agreas或者Agares。聽命於力天使，他位居東部統治者的麾下。為21位地獄公爵中的頭領者。 根據魔鬼學說，他是一名公爵，統領地獄的東區，率領31個軍團。一般認為其有找尋失蹤者、教導世上存在任何語言與管樂，及有著引發大地震的能力，且樂於教導不道德的情緒表達。同時，他還有能力摧毀他人的尊嚴。以前是力天使的領導者。墮落後他以公爵的身份指揮地獄的31個軍團，稱為變幻公爵。據說他有能預見未來的能力，能道破世間的所有謎題，但是說出來的話卻真假半摻，不能輕易相信。他的力量足以摧毀任何要人，無論是神聖者還是世俗者。\\n他被描繪為一位騎在鱷魚上的老賢者，說起話來相當有力，並有一隻鷹站在他的拳上。"},{"page_url":"https://sv.wikipedia.org/wiki/Sankt_Olofs_kyrka,_Helsingborg","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f6/Sankt_Olofs_kyrka%2C_Helsingborg.jpg","page_title":"Sankt Olofs kyrka, Helsingborg","context_page_description":"Sankt Olofs kyrka, även Sankt Olofskyrkan, är en kyrkobyggnad i Helsingborg. Den är församlingskyrka i Gustav Adolfs församling i Lunds stift. Kyrkan är belägen vid Jönköpingsgatan i stadsdelen Husensjö nära stadsdelarna Rosengården och Wilson Park. Den är namngiven efter Nidaros helgon, Sankt Olof."},{"page_url":"https://ja.wikipedia.org/wiki/%E4%BA%AC%E6%88%90%E6%9B%B3%E8%88%9F%E9%A7%85","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8d/Keisei-Hikfune-Sta-E.JPG","page_title":"京成曳舟駅","context_page_description":"京成曳舟駅は、東京都墨田区京島一丁目にある、京成電鉄押上線の駅である。駅番号はKS46。\\n京成線の自動放送が開始してからは「つぎは京成曳舟」と案内している。 駅名標の表記もかつては「曳舟」であったが、高架化後は「京成曳舟」と表記された新デザインのものに移行している。また、新しい路線図になってからは、「京成曳舟」と表示している。"},{"page_url":"https://mk.wikipedia.org/wiki/%D0%94%D0%BE%D0%BB%D0%BE%D0%BC%D0%B8%D1%82%D0%B8","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d9/Dolomiti_di_Brenta_-_Sfulmini_e_Campanile_Basso.jpg","page_title":"Доломити","context_page_description":"Доломити — планински венец во североисточна Италија. Сочинуваат дел од Јужните Варовнички Алпи и се протегаат од реката Адиџе на запад до долината на Пијава на исток. Северната и јужната граница ја образуваат Пустерската и Суганската Долина. Венецот е речиси подеднакво распределен во покраините Белуно, Јужен Тирол и Трентино.\\nНа исток, преку реката Пијава се протегаат планински групи со сличен геолошки состав, наречени Прекупијавски Доломити; во далечината, преку реката Адиџе на запад е Брентската група. Постои и помала група наречена Мали Доломити, сместена меѓу покраините Трентино, Верона и Виченца.\\nВенецот има еден национален парк и поголем број регионални паркови. Во август 2009 г. Доломитите се прогласени за светско наследство на УНЕСКО."},{"page_url":"https://de.wikipedia.org/wiki/Swetlana_Wiktorowna_Babanina","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/35/Svetlana_Babanina_1966.jpg","page_title":"Swetlana Wiktorowna Babanina","context_page_description":"Swetlana Wiktorowna Babanina ist eine russische Schwimmerin, die für die Sowjetunion startete."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%9C%D0%B0%D0%BC%D0%BC%D0%B5%D1%80%D0%BD","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1f/KircheMammern.JPG","page_title":"Маммерн","context_page_description":"Маммерн — коммуна в Швейцарии, в кантоне Тургау.\\nВходит в состав округа Штекборн. Население составляет 585 человек. Официальный код — 4826."},{"page_url":"https://it.wikipedia.org/wiki/Kisn%C3%A1na","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/39/HUN_Kisn%C3%A1na_COA.jpg","page_title":"Kisnána","context_page_description":"Kisnána è un comune dell'Ungheria di 1.114 abitanti. È situato nella provincia di Heves."},{"page_url":"https://hr.wikipedia.org/wiki/Nitriansky_kraj","image_url":"http://upload.wikimedia.org/wikipedia/commons/7/7a/Nitra_okresy.png","page_title":"Nitriansky kraj","context_page_description":"Nitriansky kraj jedna od administrativnih regija Slovačke. Pokrajina se sastoji od sedam okruga, a središte regije je grad Nitra."},{"page_url":"https://ko.wikipedia.org/wiki/%EB%8B%A4%EB%8B%88%EC%97%98_%ED%94%BC%EC%85%80","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d4/Danielle_Fishel_photo_%28cropped%29.jpg","page_title":"다니엘 피셀","context_page_description":"다니엘 피셀는 미국의 텔레비전 배우, 영화배우이다.\\n메사에서 태어났다."},{"page_url":"https://eo.wikipedia.org/wiki/Frekvenco","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/31/Spectrum.png","page_title":"Frekvenco","context_page_description":"Frekvenco estas la mezuro de la nombro da fojoj ke ripetata evento okazas en tempa unuo. Por kalkuli la frekvencon oni fiksas tempan intervalon, nombras la nombron de okazoj de la evento ene de tiu intervalo, kaj tiam oni dividas tiun nombron per la longo de la tempa intervalo.\\nEn unuoj de la Sistemo Internacia, la rezulto estas mezurata en hercoj laŭ germana fizikisto Heinrich Rudolf Hertz. 1 Hz signifas, ke evento ripetiĝas unu fojon en ĉiu sekundo. Aliaj unuoj uzataj por mezuri frekvencon estas cikloj en sekundo, RPM. Kora pulso estas mezurata en pulseroj en minuto."},{"page_url":"https://en.wikipedia.org/wiki/Sallust","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5c/Houghton_MS_Richardson_17_-_Sallust_manuscript%2C_ca._1490%2C_f51.jpg","page_title":"Sallust","context_page_description":"Gaius Sallustius Crispus, usually anglicised as Sallust, was a Roman historian and politician from an Italian plebeian family. Sallust was born at Amiternum in the country of the Sabines and was a popularis, an opponent of the old Roman aristocracy, throughout his career, and later a partisan of Julius Caesar. Sallust is the earliest known Roman historian with surviving works to his name, of which Catiline's War, The Jugurthine War, and the Histories are still extant. Sallust was primarily influenced by the Greek historian Thucydides and amassed great wealth from his governorship of Africa."},{"page_url":"https://ja.wikipedia.org/wiki/%E3%83%8D%E3%83%91%E3%83%BC%E3%83%AB","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/99/Prithvi_Narayan_Shah.jpg","page_title":"ネパール","context_page_description":"ネパール連邦民主共和国、通称ネパールは、南アジアの連邦共和制国家。\\n東、西、南の三方をインドに、北方を中華人民共和国チベット自治区に接する西北から東南方向に細長い内陸国である。国土は世界最高地点エベレストを含むヒマラヤ山脈および中央部丘陵地帯と、南部のタライ平原から成る。ヒマラヤ登山の玄関口としての役割を果たしている。面積は約14.7万km。多民族・多言語国家であり、民族とカーストが複雑に関係し合っている。また、宗教もヒンドゥー教、仏教、アニミズム等とその習合が混在する。\\n農業を主たる産業とし、ヒマラヤ観光などの観光業も盛んである。後発開発途上国であると分類されている。世界で唯一矩形でない国旗を持つ国である。\\n2008年に王制を廃止、2015年9月公布の憲法により、7州による連邦制国家となった。マオバディは2001年、ネパールの全土に9自治区を設置する構想を発表、実効支配領域内において、2004年初頭までに、首都圏のカトマンズ盆地を領域とするネワール族のための「ネワ自治区」を除く8自治区の「人民政府」を発足させている。"},{"page_url":"https://nl.wikipedia.org/wiki/La_Ciotat","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/39/Map_commune_FR_insee_code_13028.png","page_title":"La Ciotat","context_page_description":"La Ciotat is een badplaats in het Franse departement Bouches-du-Rhône en telt 34.271 inwoners. De plaats maakt deel uit van het arrondissement Marseille. De plaats wordt gekenmerkt door industriële activiteit in de vorm van een grote scheepswerf. Deze werf werd gesloten op 31 juli 1988, maar is sinds 31 juli 1994 weer operationeel. Naast de scheepswerf is toerisme de grootste bron van inkomsten. La Ciotat geniet bekendheid door de vele calanques die er in de omgeving te vinden zijn, waarvan de calanque \\"Bec d'Aigle\\" de meest indrukwekkende is."},{"page_url":"https://nl.wikipedia.org/wiki/Broksele","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/38/BrokseleRaadhuis.jpg","page_title":"Broksele","context_page_description":"Broksele is een gemeente in het Franse Noorderdepartement. Het ligt dicht bij de bronnen van de IJzer."},{"page_url":"https://es.wikipedia.org/wiki/Coslada","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7f/R-3Spain.png","page_title":"Coslada","context_page_description":"Coslada es un municipio de España perteneciente a la Comunidad de Madrid. Ubicado en el Corredor del Henares, con una extensión de 12,03 km² y 81 860 habitantes. Limita al este con San Fernando de Henares y con Madrid, y limita también con Madrid al norte, al sur y al oeste. Salvo su límite con San Fernando, se encuentra rodeado por el término municipal de Madrid.\\nCoslada se sitúa en el Valle del Henares en su nexo con la Cuenca del Jarama. Conforma una sucesión urbana con San Fernando de Henares, en un cruce de caminos a la salida noreste de Madrid, entre las autopistas A-2, M-40 y M-45. Localizado a escasa distancia del aeropuerto internacional Adolfo Suárez Madrid-Barajas, con accesos por ferrocarril y por la línea 7 del Metro de Madrid. Sus límites han ido variando históricamente y lindaba con poblaciones algunas de ellas hoy desaparecidas y otras absorbidas por el municipio de Madrid. Hoy limita con los municipios de Madrid y San Fernando de Henares.\\nSu proximidad a Madrid hace que se encuadre en el área de influencia de la capital. No obstante, Coslada siempre se ha configurado como una ciudad independiente."},{"page_url":"https://is.wikipedia.org/wiki/Gler%C3%A1rkirkja","image_url":"http://upload.wikimedia.org/wikipedia/commons/7/7b/Ferming_gler.jpg","page_title":"Glerárkirkja","context_page_description":"Glerárkirkja er kirkja Glerárprestakalls, sem var stofnað árið 1981 þegar Akureyrarprestakalli var skipt í tvennt. Glerárprestakall er í Eyjafjarðarprófastsdæmi. Í dag tilheyra íbúar sem eru skráðir í þjóðkirkjuna og búa í póstnúmeri 603 Akureyri yngra prestakallinu. Glerárkirkja var vígð 6. desember 2002 en hluti byggingarinnar hafði þá verið nýttur til messuhalds í nokkurn tíma."},{"page_url":"https://zh-min-nan.wikipedia.org/wiki/Kansky_Ko%C4%81n","image_url":"http://upload.wikimedia.org/wikipedia/commons/4/4e/Flag_of_Kansky_rayon_%28Krasnoyarsk_krai%29.png","page_title":"Kansky Koān","context_page_description":"Kansky Koān sī Lō͘-se-a Liân-pang Krasnoyarsk Pian-kiong-khu ê chi̍t ê koān."},{"page_url":"https://da.wikipedia.org/wiki/Werner_von_Fritsch","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6e/Bundesarchiv_Bild_183-R16862%2C_Werner_von_Fritsch.jpg","page_title":"Werner von Fritsch","context_page_description":"Werner von Fritsch var en tysk friherre og generaloberst."},{"page_url":"https://lt.wikipedia.org/wiki/%C5%A0nipi%C5%A1k%C4%97s","image_url":"http://upload.wikimedia.org/wikipedia/commons/a/af/Church_of_the_St_Raphael_the_Archangel_in_Vilnius12.jpg","page_title":"Šnipiškės","context_page_description":"Šnipiškės – Vilniaus miesto dalis, išsidėsčiusi dešiniajame Neries krante priešais Naujamiesčio seniūniją. Šnipiškių seniūnija.\\nYra Vilniaus Šv. arkangelo Rapolo bažnyčia, Europos aikštė, Vilniaus miesto savivaldybės būstinė, Nacionalinė galerija, universitetinė Žalgirio ligoninė."},{"page_url":"https://de.wikipedia.org/wiki/Handball-Au%C3%9Fenspieler","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/27/5-1-Deckung.svg","page_title":"Handball-Außenspieler","context_page_description":"Ein Außenspieler ist eine Spielposition beziehungsweise ein Spieler im Handball. In Österreich ist die Bezeichnung hierfür Flügelspieler, in der Schweiz wird der Außenspieler nur Flügel genannt. In einem Handballspiel gibt es bei jeder Mannschaft zwei Außenspieler auf dem Spielfeld: einen Linksaußen und einen Rechtsaußen. Die Außenspieler nehmen im Angriff, vom eigenen Torwart aus betrachtet, die linke beziehungsweise die rechte Spielposition ein. Sie sind meistens sprungkräftige und schnelle Spieler."},{"page_url":"https://zh.wikipedia.org/zh-tw/%E6%96%AF%E6%B4%9B%E4%BC%90%E5%85%8B%E5%85%B1%E5%92%8C%E5%9B%BD%E6%96%87%E5%8C%96%E9%83%A8","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/31/Bratislava_2007-3-28-15.jpg","page_title":"斯洛伐克共和国文化部","context_page_description":"斯洛伐克共和國文化部，斯洛伐克政府部門之一，辦公地位於首都布拉迪斯拉發。現任文化部長馬雷克·馬賈里奇，2012年4月4日上任。"},{"page_url":"https://en.wikipedia.org/wiki/Stephensville,_Wisconsin","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d5/StevensvilleWIsconsinChurchWIS76.jpg","page_title":"Stephensville, Wisconsin","context_page_description":"Stephensville is a small unincorporated community located entirely within the town of Ellington in west-central Outagamie County, Wisconsin, United States. Stephensville is classified as a Class U6 Community by the USGS, being a populated place located wholly or substantially outside the boundaries of any incorporated place or CDP with a recognized authoritative common name.\\nStephensville is located 4 miles northeast of Hortonville, 7 miles northwest of Greenville, 5 miles south of Shiocton and 15 miles northwest of Appleton.\\nBear Creek passes through the community just east of its mouth with the Wolf River.\\nMail is delivered by the Hortonville post office."},{"page_url":"https://arz.wikipedia.org/wiki/%D9%8A%D9%88%D9%87%D8%A7%D9%86_%D8%B1%D8%A7%D9%8A%D9%86%D9%87%D9%88%D9%84%D8%AF_%D9%81%D9%88%D8%B1%D8%B3%D8%AA%D8%B1","image_url":"http://upload.wikimedia.org/wikipedia/commons/b/bf/Forster.jpg","page_title":"يوهان راينهولد فورستر","context_page_description":"يوهان راينهولد فورستر كان عالم نباتات من بروسيا الملكيه."},{"page_url":"https://cs.wikipedia.org/wiki/Star%C3%A1_radnice_(Kyn%C5%A1perk_nad_Oh%C5%99%C3%AD)","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9f/Kyn%C5%A1perk_Star%C3%A1_radnice_%281%29.jpg","page_title":"Stará radnice (Kynšperk nad Ohří)","context_page_description":"Stará radnice je budova v historické zástavbě v Kynšperku nad Ohří v okrese Sokolov. Byla postaven jako městská radnice a spolu s nedalekou Městskou bránou je nejstarším dochovaným zděným domem města. Po určitou dobu sloužila jako panské sídlo a správní budova panství majitelům města, kterými byli od roku 1621 Metternichové. Proto se objekt často uvádí i jako Panský dům.\\nObjekt je chráněn jako kulturní památka České republiky."},{"page_url":"https://es.wikipedia.org/wiki/Cruzada_de_Livonia","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/ba/OeselLivTrty1241.jpg","page_title":"Cruzada de Livonia","context_page_description":"La cruzada de Livonia​​ o cruzada contra los livonios se refiere a la conquista del territorio que constituyen las actuales Estonia y Letonia durante las Cruzadas bálticas. Fueron sancionadas por el Papa y protagonizadas mayoritariamente por alemanes del Sacro Imperio Romano Germánico y daneses. Acabó con la creación de la Terra Mariana y del ducado de Estonia. Estas tierras en la orilla oriental del mar Báltico fueron los últimos confines de Europa en ser cristianizados.\\nEl 2 de febrero de 1207​ se estableció un estado eclesiástico llamado Terra Mariana en los territorios conquistados, como principado del Sacro Imperio Romano, proclamado por el papa Inocencio III en 1215 como dependiente de la Santa Sede​​​ Después del éxito de la Cruzada, los territorios ocupados, alemán y danés, fueron divididos en seis principados feudales por Guillermo de Módena."},{"page_url":"https://fr.wikipedia.org/wiki/Juan_Guti%C3%A9rrez_(baseball)","image_url":"http://upload.wikimedia.org/wikipedia/commons/c/c1/Gutierezwin1.jpg","page_title":"Juan Gutiérrez (baseball)","context_page_description":"Juan Carlos Gutiérrez est un lanceur de relève droitier des Ligues majeures de baseball. Il est présentement sous contrat avec les Nationals de Washington."},{"page_url":"https://hu.wikipedia.org/wiki/Earth_Crisis","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/34/Earth_Crisis_at_The_Point_in_Little_Five_Points%2C_Atlanta%2C_GA_in_1998_%284848078010%29.jpg","page_title":"Earth Crisis","context_page_description":"Az Earth Crisis amerikai hardcore punk/metalcore együttes."},{"page_url":"https://cs.wikipedia.org/wiki/Gustav_Meretta","image_url":"http://upload.wikimedia.org/wikipedia/commons/8/87/Justi%C4%8Dn%C3%AD_%C5%A1kola.jpg","page_title":"Gustav Meretta","context_page_description":"Gustav Meretta byl přední rakouský architekt a restaurátor sakrálních staveb působící především na Moravě a ve Slezsku."},{"page_url":"https://no.wikipedia.org/wiki/Strandpromenaden_(Tjuvholmen)","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/59/Strandpromenaden_med_bebyggelse_Tjuvholmen.JPG","page_title":"Strandpromenaden (Tjuvholmen)","context_page_description":"Strandpromenaden er en gate på Tjuvholmen i Oslo.\\nGaten går fra plassen der gatene Lille Stranden og Bolette brygge og en gangbro over til Aker Brygge møtes i nord, til kanalen mellom Odden, den nordligste delen av Tjuvholmen, der gaten ligger, og Skjæret. Mellom Strandpromenaden og sjøen ligger parken Strandhagen. Fra gaten er det fritt utsyn til Pipervika og Akershus festning.\\nNavnet ble vedtatt av bydelsutvalget i Bydel Frogner i 2005."},{"page_url":"https://de.wikipedia.org/wiki/Stuhlinger-Piedmont-Gletscher","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/62/C70195s1_Ant.Map_Ob%27_Bay.jpg","page_title":"Stuhlinger-Piedmont-Gletscher","context_page_description":"Der Stuhlinger-Piedmont-Gletscher ist ein etwa 225 Quadratkilometer großer Vorlandgletscher an der Oates-Küste des ostantarktischen Viktorialands. Nördlich der Bowers Mountains liegt er zwischen den unteren Abschnitten des Gannutz- und des Barber-Gletschers.\\nDas Gebiet wurde vom United States Geological Survey und mithilfe von Luftaufnahmen der United States Navy von 1960 bis 1962 kartografisch erfasst. Das Advisory Committee on Antarctic Names benannte den Gletscher 1970 nach Ernst Stuhlinger, deutsch-US-amerikanischer Raketeningenieur bei der NASA, der dem Beratungsgremium der National Science Foundation für das wissenschaftliche Untersuchungsprogramm in der Antarktis angehörte."},{"page_url":"https://fr.wikipedia.org/wiki/Claudette_Colbert","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/89/Claudette-colbert-plays-tennis.jpg","page_title":"Claudette Colbert","context_page_description":"Claudette Colbert est une actrice américaine d'origine française, née Émilie Claudette Chauchoin le 13 septembre 1903 à Saint-Mandé, et morte le 30 juillet 1996 à Speightstown à la Barbade. L’American Film Institute a classé Claudette Colbert douzième actrice de légende."},{"page_url":"https://it.wikipedia.org/wiki/Iris_(divinit%C3%A0)","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/40/Luca_Giordano_012.jpg","page_title":"Iris (divinità)","context_page_description":"Iris, conosciuta anche come Iride, Iri, Taumantia e Taumantiade, è un personaggio della mitologia greca.\\nDea minore dell'Olimpo, messaggera degli dei e personificazione dell'arcobaleno."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%93%D0%B0%D1%83%D0%B7%D0%B5%D0%BD_(%D0%92%D1%96%D0%B4)","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/ce/Hausen_wied.jpg","page_title":"Гаузен (Від)","context_page_description":"Гаузен — громада в Німеччині, розташована в землі Рейнланд-Пфальц. Входить до складу району Нойвід. Складова частина об'єднання громад Вальдбрайтбах.\\nПлоща — 7,69 км². Населення становить 1878 ос."},{"page_url":"https://en.wikipedia.org/wiki/Star,_Pembrokeshire","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/43/Star_-_geograph.org.uk_-_191739.jpg","page_title":"Star, Pembrokeshire","context_page_description":"Star is a small village in the parish and community of Clydau in Pembrokeshire, Wales.\\nIt lies south of Bwlchygroes on a crossroads in the valley of the Afon Cneifa where the river is bridged."},{"page_url":"https://fa.wikipedia.org/wiki/%D9%BE%D9%88%D9%87%D9%88%D8%B1%D9%84%DB%8C%D8%AA%D8%B3%D9%87_(%D9%86%D8%A7%D8%AD%DB%8C%D9%87_%D8%A8%D8%B1%D9%86%D9%88-%D8%AA%D8%B3%D9%88%D9%88%D9%86%D8%AA%D8%B1%DB%8C)","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/71/Pohorelice_namesti_Svobody.jpg","page_title":"پوهورلیتسه (ناحیه برنو-تسوونتری)","context_page_description":"پوهورلیتسه یک منطقهٔ مسکونی و شهرستان دارای شهرک سابقاً روستا در جمهوری چک است که در ناحیه برنو-تسوونتری واقع شده‌است. پوهورلیتسه ۴٬۶۴۰ نفر جمعیت دارد."},{"page_url":"https://it.wikipedia.org/wiki/Actinidia_arguta","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/13/Weiki01.jpg","page_title":"Actinidia arguta","context_page_description":"Actinidia arguta è una pianta appartenente alla famiglia delle Actinidiaceae. Produce dei piccoli frutti che assomigliano ai frutti della pianta del Kiwi. Si trova in taluni supermercati con il nome di \\"Nergi\\"."},{"page_url":"https://el.wikipedia.org/wiki/%CE%9A%CF%8C%CE%BA%CE%BA%CE%B9%CE%BD%CE%B7_%CE%93%CE%AD%CF%86%CF%85%CF%81%CE%B1_(%CF%83%CF%85%CE%BD%CE%BF%CF%81%CE%B9%CE%B1%CE%BA%CE%AE)","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c2/The_Red_Bridge.jpg","page_title":"Κόκκινη Γέφυρα (συνοριακή)","context_page_description":"Η Κόκκινη Γέφυρα είναι μία διασυνοριακή οδική γέφυρα μεταξύ των χωρών Γεωργία και Αζερμπαϊτζάν, που συνδέει την Τιφλίδα με την Γκαντζά. Η τοξωτή γέφυρα που διασχίζει τον ποταμό Χράμι είναι κατασκευασμένη από κόκκινα τούβλα, βρίσκεται στην περιοχή της ουδέτερης ζώνης μεταξύ των συνοριακών φυλακίων και αποτελεί σημείο διέλευσης των συνόρων. Χτίστηκε ως επί το πλείστον κατά τον 17ο αιώνα. Η Κόκκινη γέφυρα χρησιμοποιούταν καθημερινά μέχρι το 1998, που περατώθηκε η κατασκευή μιας νέας και αρκετά μεγαλύτερης γέφυρας στο πλαίσιο των έργων του TRACECA."},{"page_url":"https://en.wikipedia.org/wiki/Etosha_National_Park","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fa/2012_Lion_Gemsbokvlakte.jpg","page_title":"Etosha National Park","context_page_description":"Etosha National Park is a national park in northwestern Namibia. It was proclaimed a game reserve in March 1907 in Ordinance 88 by the Governor of German South West Africa, Dr. Friedrich von Lindequist. It was designated as Wildschutzgebiet in 1958, and was elevated to the status of a national park in 1967 by an act of parliament of the Republic of South Africa. It spans an area of 22,270 km² and gets its name from the large Etosha pan which is almost entirely within the park. The Etosha pan covers 23% of the total area of the National Park. The park is home to hundreds of species of mammals, birds and reptiles, including several threatened and endangered species such as the black rhinoceros.\\nThe park is located in the Kunene region and shares boundaries with the regions of Oshana, Oshikoto and Otjozondjupa."},{"page_url":"https://pl.wikipedia.org/wiki/Aram_Chaos","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/23/Aram_Chaos.jpg","page_title":"Aram Chaos","context_page_description":"Aram Chaos – obszar na powierzchni Marsa, który jest pozostałością po zerodowanym kraterze uderzeniowym. Jego centrum znajduje się na 2,55° szerokości geograficznej północnej oraz 22,39° długości geograficznej zachodniej. Obszar ten ma 283,81 km średnicy.\\nAram Chaos leży prawie dokładnie na marsjańskim równiku. Region ten pokrywają znaczne ilości siarczanów oraz tlenków żelaza czyli rdzy. W ciemnych osadach tego obszaru tlenku żelaza jest czterokrotnie więcej niż na większości powierzchni planety. Lżejsze siarczany zostały usunięte przez wiatr odkrywając osady rdzy. Oznacza to, że tlenki metali zostały odsłonięte przez procesy erozyjne zanim osunęły się do podstaw występujących w tej okolicy klifów. Tlenki żelaza występują również w okolicznych wydmach.\\nPodobne osady tlenków żelaza znaleziono również na obszarach Meridiani Planum i Valles Marineris. Oznacza to, że podobne osady mogą znajdować również w innych miejscach na powierzchni Marsa ukryte pod warstwą powierzchniowego pyłu. Pełny zasięg oraz natura procesów akumulacji siarczanów i tlenków żelaza pozostaje obecnie nieznana."},{"page_url":"https://sv.wikipedia.org/wiki/Brent_Johnson","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/31/Olaf_Kolzig_2.jpg","page_title":"Brent Johnson","context_page_description":"Brent Johnson, född 12 mars 1977 i Farmington, Michigan, USA, är en amerikansk före detta professionell ishockeymålvakt som avslutade sin karriär i Pittsburgh Penguins i NHL. Han är sonson till den legendariske och trefaldiga Stanley Cup-vinnaren Sid Abel.\\nColorado Avalanche draftade Johnson som nummer 129 i 1995 års NHL Entry Draft men Johnson representerade aldrig Avalanche utan debuten kom hos St. Louis Blues 1999. Där blev han kvar till slutet av säsongen 2003-04 där han blev tradad till Phoenix Coyotes, men där blev det bara åtta matcher innan lockouten drog igång.\\nInför säsongen 2005-06 skrev han på för Vancouver Canucks men blev uppsatt på Waiver-listan på nästan direkten och Washington Capitals plockade honom.\\n21 juli 2009 skrev han på ett ett-års kontrakt värt $ 525 000 med Pittsburgh Penguins som free agent för att agera backup till Marc-André Fleury."},{"page_url":"https://en.wikipedia.org/wiki/Henry_Buttelmann","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/07/Henry_Buttelmann.jpg","page_title":"Henry Buttelmann","context_page_description":"Henry \\"Hank\\" Buttelmann was a fighter pilot of the United States Air Force in the Korean War and Vietnam War. He achieved seven victories over enemy aircraft in Korea, making him a flying ace. He gained his fifth kill on June 30, 1953, just after his 24th birthday, which made him the youngest ace of the war.\\nButtelmann was born in Corona, Queens, New York City, and attended the University of Bridgeport for two years. He was sent to Korea in December 1952, flying as a wingman in the F-86 Sabre jet against MiG-15s in \\"MiG Alley\\", the area around the border between North Korea and China. He shot down his first plane on June 19 of the next year, and he scored his fifth victory eleven days later. He added two more in July, days before the end of hostilities. He served two tours during the Vietnam War, flying the F-105 Thunderchief and F-100 Super Sabre. He retired from the Air Force in 1979 after a career total of 286 combat missions."},{"page_url":"https://ta.wikipedia.org/wiki/%E0%AE%95%E0%AF%8B%E0%AE%B2%E0%AE%BF%E0%AE%AF%E0%AE%BE%E0%AE%A4%E0%AF%8D","image_url":"http://upload.wikimedia.org/wikipedia/commons/e/ef/David-goliath28.jpg","page_title":"கோலியாத்","context_page_description":"கோலியாத் Goliath யூதர்களின் விவிலியத்தில் சாமுவேல் நூல் குறிப்பிடும் பிலிஸ்தினிய உடல் வலிமை மிக்க பெரும் போர் வீரன் ஆவார். ஒரு முறை பிலிஸ்தியர்களுடன் நடைபெற்ற போரில் இஸ்ரவேலர்களின் அரசன் சவுலுடன் அவரது மகன்களும் கொல்லப்பட்டனர்.\\nமற்றொரு முறை கோலியாத் தன் படைகளுடன் இஸ்ரவேலர்கள் மீது போரை தொடுக்க வருகையில், சிறுவனாக இருந்த தாவீது கவட்டைக் கல் கொண்டு, கோலியாத்தின் நெற்றி மீது அடித்துக் கொன்றான் என யூத வேத நூலான விவிலியத்தின் சாமுவேல் நூல் குறிப்பிடுகிறது. எனவே பெரும் வலிமைப் படைத்த பிலிஸ்திய வீரனைக் கொன்ற தாவீதை, இஸ்ரவேலர்களின் அரசனாக தேர்ந்தெடுக்கப்பட்டார் என யூத வேத நூலான விவிலியத்தின் சாமுவேல் நூல் குறிப்பிடுகிறது."},{"page_url":"https://pt.wikipedia.org/wiki/Igreja_Cat%C3%B3lica_na_Rep%C3%BAblica_Centro-Africana","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/68/Cath%C3%A9drale_Saint_Pierre_Claver_Bangassou.JPG","page_title":"Igreja Católica na República Centro-Africana","context_page_description":"A Igreja Católica na República Centro-Africana é parte da Igreja Católica universal, em comunhão com a liderança espiritual do Papa, em Roma, e da Santa Sé. Os católicos representam o maior grupo cristão do país. Não apenas a Igreja Católica, mas todos os cristãos de forma geral vêm sofrendo com o fundamentalismo islâmico."},{"page_url":"https://cs.wikipedia.org/wiki/Mauricijsk%C3%A9_ta%C5%BEen%C3%AD","image_url":"http://upload.wikimedia.org/wikipedia/commons/a/a1/Venus_vs_Ceylon.jpg","page_title":"Mauricijské tažení","context_page_description":"Mauricijské tažení byla série obojživelných i námořních operací Velké Británie s cílem vytlačit pozice napoleonského Francouzského císařství z ostrovů Île de France a Île Bonaparte, náležících k francouzskému indooceánskému teritoriu v období napoleonských válek v letech 1809–1811. Tažení začalo na jaře roku 1809 a trvalo do jara 1811 a obě strany, Britské královské námořnictvo i Francouzské námořnictvo, nasadily početné eskadry fregat kvůli ochraně, Francouzi naopak kvůli přerušení obchodních námořních tras do Britské Indie. Ve válce, v níž britské námořnictvo téměř ovládlo světová moře, je mauricijské tažení významné naopak díky převaze francouzského loďstva v oblasti, korunované vítězstvím nad britskými silami v bitvě u Grand Port na podzim roku 1810 – nejvýznamnější porážkou britského námořnictva v celé válce s napoleonskou Francií."},{"page_url":"https://de.wikipedia.org/wiki/St._Oswald_(Bozen)","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/61/Die_St.-Oswaldkirche_bei_Bozen_um_1912.JPG","page_title":"St. Oswald (Bozen)","context_page_description":"St. Oswald war eine Kirche am Oswaldweg in Bozen, die dem hl. Oswald von Northumbria geweiht war. Die spätromanische Ostturmkirche wird 1288 zum ersten Mal erwähnt, nach Beschädigungen durch Bergstürze 1323 und 1405 neu geweiht und 1412 als „sant Oswalt pey Poczen“ bezeichnet. Bei der Bombardierung Bozens im Zweiten Weltkrieg wurde sie am 2. Dezember 1943 durch eine amerikanische Fliegerbombe vernichtet. Erhalten sind nur noch die Grundmauern. Seit 1951 stehen diese unter Denkmalschutz.\\nAus den Jahren 1481 bis 1800 sind über 60 Rechnungsbücher von St. Oswald im Stadtarchiv Bozen überliefert, die von den jeweiligen Kirchpröpsten geführt wurden.\\nBozens Oswaldpromenade trägt ihren Namen nach der Kirche; ihr stadtseitiger Zubringer nimmt annähernd vom ehemaligen Kirchplatz seinen Ausgang, die höhere gelegene Verzweigung nach St. Magdalena entlang des Berghanges wurde hingegen 1937 aus Stiftungsmitteln des Wohltäters Karl von Müller errichtet."},{"page_url":"https://bg.wikipedia.org/wiki/%D0%A1%D0%B8%D1%80%D0%BC%D0%B8%D1%83%D0%BC","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c8/Prefecture_of_Illyricum_map.png","page_title":"Сирмиум","context_page_description":"Сирмиум е римски град в римската провинция Панония. Служи като резиденция на император Галерий през Тетрархията. Значението му през късната античност е толкова голямо, че Амиан Марцелин го нарича „преславна майка на градовете“. Днес на неговото място се намира Сремска Митровица. От Сирмиум води името си историческата област Срем.\\nСирмиум е център на преторианска префектура Илирик.\\nПреди завладяването на територията около Сирмиум от римляните в началото на 1 век, Сирмиум е илирийско селище. През епохата на Принципата градът е опорен пункт и изходна база за римски военни атаки срещу даките и германските племена в региона. Често в Сирмиум пребивава Марк Аврелий.\\nРодом, починали или свързани с града и околността са императорите Херений Етруск, Хостилиан, Деций, Клавдий II, Квинтил, Аврелиан, Проб, Максимиан, Констанций II и Грациан.\\nПрез 375 император Валентиниан I, пренася резиденцията си в Сирмиум.\\nТеодосий Велики е обявен за император в Сирмиум. В периода 4 - 6 век в града се провеждат пет църковни събора. Тук се подвизават Ириней Сремски и великомъченица Анастасия.\\nСлед падането на Западната Римска империя в Сирмиум секат свои монети гепидските крале."},{"page_url":"https://es.wikipedia.org/wiki/Transposici%C3%B3n_de_Demjanov","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/27/Demjanov_Fattori-exo.png","page_title":"Transposición de Demjanov","context_page_description":"La transposición de Demjanov es la reacción química de aminas primarias con ácido nitroso para dar alcoholes con el esqueleto transpuesto. Implica la sustitución por un grupo hidroxilo con una posible expansión del anillo. Lleva el nombre del químico ruso Nikolai Jakovlevich Demjanov."},{"page_url":"https://fr.wikipedia.org/wiki/Salon_du_cheval_de_Paris","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0b/Jielbeaumadier_juments_arabo_frison_scva_paris_2012.jpeg","page_title":"Salon du cheval de Paris","context_page_description":"Le Salon du Cheval de Paris est une manifestation annuelle consacrée au cheval, à l'âne et à l'équitation. Créé en 1972, à la Bastille, sur une idée de Philippe Cart-Tanneur, et longtemps organisé à la porte de Versailles, il se tient désormais au Parc des expositions de Paris-Nord Villepinte.\\nIl propose des ventes d'équipements pour le cheval et le cavalier, le Longines Masters de Paris, plusieurs internationaux, des carrières d’animations, de spectacles et compétitions, un village destiné aux enfants, et bien sûr de nombreux chevaux sont visibles sur place. Le salon accueille les acteurs du monde équestre : marchands d'équipements venus de nombreux pays, éleveurs, écoles d'équitation, haras, sociétés de spectacle, organismes de formation, du tourisme équestre, et des institutions comme la Garde Républicaine, les Haras nationaux, la Brigade équestre de la Préfecture de Police de Paris et la Fédération française d'équitation. De nombreuses démonstrations équestres sont organisées ainsi que des conférences. Les jeunes ont la possibilité de faire des baptêmes."},{"page_url":"https://ka.wikipedia.org/wiki/%E1%83%9B%E1%83%90%E1%83%A0%E1%83%92%E1%83%90%E1%83%A0%E1%83%94%E1%83%A2_%E1%83%9E%E1%83%90%E1%83%A0%E1%83%9B%E1%83%94%E1%83%9A%E1%83%98","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2f/MSK_Th%C3%A9odore_Canneel_Keizer_Karel_met_zijn_minnares_Johanna_Van_der_Geynst_bij_de_wieg_van_hun_dochter_Margaretha_van_Parma_17-03-2009_11-56-11_17-03-2009_11-56-11.JPG","page_title":"მარგარეტ პარმელი","context_page_description":"მარგარეტ პარმელი — ჰაბსბურგთა დინასტიის წარმომადგენელი. საღვთო რომის იმპერატორ კარლ V-ისა და მისი საყვარლის, იოჰანა მარია ვან დერ გჰეინისტის უკანონო ქალიშვილი. ნიდერლანდების შტატჰალტერი 1559-1567 წლებში, ფლორენციის ჰერცოგინია 1536-37 წლებში როგორც ალესანდრო მედიჩის, ხოლო პარმისა და პიაჩენცას ჰერცოგინია 1547-1586 წლებში როცორც ოტავიო ფარნეზეს მეუღლე."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%A1%D0%B5%D0%B2%D0%B0%D1%81%D1%82%D0%BE%D0%BF%D0%BE%D0%BB%D1%8C","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a1/%D0%90%D0%A2%D0%94_%D0%A1%D0%B5%D0%B2%D0%B0%D1%81%D1%82%D0%BE%D0%BF%D0%BE%D0%BB%D1%8F.png","page_title":"Севастополь","context_page_description":"Севасто́поль — город на юго-западе Крымского полуострова, на побережье Чёрного моря. Незамерзающий морской торговый и рыбный порт, промышленный, научно-технический, рекреационный и культурно-исторический центр. Носит звание «Город-Герой». В Севастополе расположена главная военно-морская база Черноморского флота Российской Федерации. Город Севастополь входит в перечень исторических поселений федерального значения России и в список исторических населённых мест Украины.\\nГосударственная принадлежность территории Севастополя является предметом разногласий между Россией и Украиной. Согласно административному делению Украины, территорией которой он признаётся большинством государств — членов ООН, Севастополь является регионом Украины — городом со специальным статусом. Фактически, Севастополь является субъектом Российской Федерации — городом федерального значения."},{"page_url":"https://de.wikipedia.org/wiki/S%C5%BDD-Baureihe_%D0%92%D0%9B15","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2e/%D0%AD%D0%BB%D0%B5%D0%BA%D1%82%D1%80%D0%BE%D0%B2%D0%BE%D0%B7_%D0%92%D0%9B15-030.jpg","page_title":"SŽD-Baureihe ВЛ15","context_page_description":"Die Lokomotiven der Baureihe ВЛ15 der Sowjetischen Eisenbahnen sind breitspurige Elektrolokomotiven."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%9E%D0%BB%D1%8C%D1%85%D0%BE%D0%B2%D0%B5%D1%86_(%D0%9D%D0%BE%D0%B2%D0%BE%D1%83%D1%88%D0%B8%D1%86%D0%BA%D0%B8%D0%B9_%D1%80%D0%B0%D0%B9%D0%BE%D0%BD)","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/62/Flag_of_Vilkhovets%2C_Nova_Ushytsia_Raion.png","page_title":"Ольховец (Новоушицкий район)","context_page_description":"Ольховец — село в Новоушицком районе Хмельницкой области Украины.\\nНаселение по переписи 2001 года составляло 1485 человек. Почтовый индекс — 32660. Телефонный код — 3847. Занимает площадь 4,408 км². Код КОАТУУ — 6823386501."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%98%D0%B7%D1%80%D0%B0%D0%B8%D0%BB%D1%8C%D1%81%D0%BA%D0%B8%D0%B9_%D1%84%D0%B8%D0%BB%D0%B0%D1%80%D0%BC%D0%BE%D0%BD%D0%B8%D1%87%D0%B5%D1%81%D0%BA%D0%B8%D0%B9_%D0%BE%D1%80%D0%BA%D0%B5%D1%81%D1%82%D1%80","image_url":"http://upload.wikimedia.org/wikipedia/commons/2/2d/IPO_70th.jpg","page_title":"Израильский филармонический оркестр","context_page_description":"Израильский филармонический оркестр — ведущий и известнейший симфонический оркестр государства Израиль. Оркестр возник в 1936 году по инициативе скрипача-виртуоза Бронислава Губермана, призвавшего ряд европейских музыкантов принять участие в создании первого крупного постоянно действующего оркестра в Палестине. Первоначальным названием коллектива было Палестинский симфонический оркестр. Первым концертом, состоявшимся 26 декабря 1936 года в Тель-Авиве, дирижировал выдающийся итальянский дирижёр Артуро Тосканини.\\nС 1938 по 1945 генеральным менеджером оркестра был Лео Кестенберг. На ранней стадии существования оркестр испытывал значительные трудности, в том числе финансовые, несмотря на то, что к организационной работе по его формированию подключился такой известный специалист как Лео Балынский. Во время Второй мировой войны оркестр дал 140 концертов для солдат стран антигитлеровской колиции, в том числе и в Египте. После победы оркестр выступил в рамках праздничных концертов в Бельгии. В 1946 году оркестр получил название Палестинского филармонического, а после образования государства Израиль в 1948 году был переименован в Израильский филармонический оркестр."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%9C%D0%B5%D1%80%D1%81%D0%B5%D0%BD-%D0%B5-%D0%92%D0%BE","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b3/Mercin-et-Vaux_%28Aisne%29_mairie.JPG","page_title":"Мерсен-е-Во","context_page_description":"Мерсе́н-е-Во — муніципалітет у Франції, у регіоні О-де-Франс, департамент Ена. Населення — 943 осіб.\\nМуніципалітет розташований на відстані близько 90 км на північний схід від Парижа, 95 км на південний схід від Ам'єна, 33 км на південний захід від Лана."},{"page_url":"https://et.wikipedia.org/wiki/Johann_Wolfgang_von_Goethe","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b6/Goethe_Ginkgo_Biloba.jpg","page_title":"Johann Wolfgang von Goethe","context_page_description":"Johann Wolfgang von Goethe oli saksa kirjanik, loodusteadlane ja polühistor. Ta on üks tähtsamaid saksa kirjanikke ja luuletajaid."},{"page_url":"https://en.wikipedia.org/wiki/Political_positions_of_Joe_Biden","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/36/Senator_Joe_Biden_speaks_to_SEIU_2.jpg","page_title":"Political positions of Joe Biden","context_page_description":"Joe Biden served as Vice President of the United States from 2009 to 2017 and in the United States Senate from 1973 until 2009. A member of the Democratic Party, he made his second run for President of the United States in the 2008 presidential election, later being announced as Democratic presidential nominee Barack Obama's running mate in 2008. He was elected Vice President in 2008 and reelected in 2012. In April 2019, Biden announced his 2020 presidential campaign. He became the presumptive Democratic nominee in April 2020 and will face Republican incumbent Donald Trump in the November 2020 election.\\nOver his career, Biden has generally been regarded as belonging to the mainstream of the Democratic Party. Biden has been described as center-left and has described himself as such. His policies emphasize the needs of middle-class and working-class Americans and have drawn political support from those groups. Various commentators and observers have likened Biden's views and proposals to the populism of Ted Kennedy, whom Biden cites as a mentor, and to the Christian democracy of continental Europe."},{"page_url":"https://nl.wikipedia.org/wiki/Giuseppe_Biava","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/ab/Giuseppe_Biava_01.JPG","page_title":"Giuseppe Biava","context_page_description":"Giuseppe Biava is een Italiaans voormalig betaald voetballer die bij doorgaans als centrale verdediger speelde. Tussen 1995 en 2015 was hij actief namens Albinese, UC AlbinoLeffe, AS Biellese, US Palermo, Genoa CFC, SS Lazio en Atalanta Bergamo."},{"page_url":"https://ja.wikipedia.org/wiki/%E3%82%AB%E3%82%B9%E3%83%86%E3%82%A3%E3%83%AA%E3%82%A7%E3%83%9B%E3%83%BB%E3%83%87%E3%83%BB%E3%83%AD%E3%83%96%E3%83%AC%E3%83%89","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/ff/Espa%C3%B1aLoc.svg","page_title":"カスティリェホ・デ・ロブレド","context_page_description":"カスティリェホ・デ・ロブレドは、スペイン・カスティーリャ・イ・レオン州ソリア県のムニシピオ。"},{"page_url":"https://ast.wikipedia.org/wiki/Monocotyledoneae","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b5/Nutgrass_Cyperus_rotundus_stem_cross_section_and_flower_head.jpg","page_title":"Monocotyledoneae","context_page_description":"Les monocotiledónees son un grupu d'anxospermes que tien un namái cotiledón nel so embrión en llugar del númberu ancestral de 2 como foi reteníu nes dicotiledónees, calter qu'adquirió la monocotiledónea ancestral y que-y da nome al grupu. Denominar Monocotyledoneae en clasificaciones como la de Engler, y monocots nes clasificaciones más modernes APG y la so socesora APG II, formalizando a Monocotyledoneae en llatín en APG III. L'únicu cotiledón foi namái unu de los calteres d'un tresformamientu evolutivu importante que redefinió'l plan corporal de la monocotiledónea ancestral y que la so ventaya adaptativa nes condiciones d'esi momentu entá son pocu conocíes, quiciabes rellacionaes cola adautación al hábitat acuáticu; depués de lo cual radiaron adaptativamente a tolos hábitats del planeta constituyendo les alredor de 56.000 especies que tienen na actualidá, el 22% de toles anxospermes."},{"page_url":"https://el.wikipedia.org/wiki/%CE%95%CF%83%CF%83%CE%B1%CE%AF%CE%BF%CE%B9","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/30/Palestine_2_001._Qumran.jpg","page_title":"Εσσαίοι","context_page_description":"Οι Εσσαίοι αποτελούσαν μία από τις τρεις κύριες θρησκευτικές ομάδες ή φιλοσοφικές αιρέσεις των Ιουδαίων, εκτός των Φαρισαίων και των Σαδδουκαίων. Η ετυμολογία του ονόματος αυτών παραμένει σκοτεινή, καθώς καμία απ΄ όσες απόψεις έχουν προταθεί δεν έχει γίνει αποδεκτή με βεβαιότητα, αποτελώντας απλές υποθέσεις. Τα πρώτα πολύτιμα χειρόγραφα των Εσσαίων βρέθηκαν μόλις το 1947: πρόκειται για τα Χειρόγραφα της Νεκράς Θάλασσας.\\nΟι Εσσαίοι υπολογίζεται πως εμφανίσθηκαν προς το τέλος της ελληνιστικής περιόδου στη Παλαιστίνη και μάλιστα από τα μέσα του 2ου π.Χ. αιώνα, ενώ φέρονται να διαλύθηκαν από τα ρωμαϊκά στρατεύματα γύρω στο 70 μ.Χ. με την άλωση της Ιερουσαλήμ από τον Τίτο, κατά την τότε Ιουδαϊκή εξέγερση.\\nΟ Ιουδαϊσμός, με κέντρο τα Ιεροσόλυμα και με ουσιώδες συστατικό στοιχείο για την ενότητά του τον Μωσαϊκό Νόμο, είχε εσωτερικές κοινωνικές και θρησκευτικές διαφορές, που συχνά κατέληγαν σε αλληλοσυγκρουόμενες ομάδες, διεκδικώντας η κάθε μία την επιβολή και την κυριαρχία της επάνω στην άλλη. Οι κυριότερες από τις ομάδες αυτές ήταν εκείνες των Φαρισαίων, των Σαδδουκαίων καθώς επίσης και άλλες μικρότερης σημασίας, όπως των Ηρωδιανών και των Ζηλωτών."},{"page_url":"https://en.wikipedia.org/wiki/Braas_Monier_Building_Group","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/80/Wind_tunnel_Heusenstamm.jpg","page_title":"Braas Monier Building Group","context_page_description":"Braas Monier Building Group, also known as BMI Group and Braas Monier, is a manufacturer of building materials for pitched roofs and roofing accessories in Europe, some Asian markets, and South Africa. The company's produces concrete and clay roof tiles, roofing accessories, ceramic and steel chimneys, and energy systems. Braas Monier is headquartered in Luxembourg. Since June 2017, Braas Monier Building Group has operated as BMI Group.\\nBy its own account, Braas Monier has operations in 36 countries with 121 production facilities. In 2016, the Group generated revenues of 1,235.8 million euros. As of 31 December 2016 Braas Monier had 7,922 employees. Since 25 June 2014 Braas Monier is listed on the Prime Standard at the Frankfurt Stock Exchange and was listed on the SDAX from 22 September 2014 until 2 February 2017. Since April 2017 Braas Monier Building Group is part of the US company Standard Industries."},{"page_url":"https://hu.wikipedia.org/wiki/Szajk%C3%B3","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6d/Garrulus_glandarius_1_Luc_Viatour.jpg","page_title":"Szajkó","context_page_description":"A szajkó, más néven európai szajkó a madarak osztályának verébalakúak rendjébe és a varjúfélék családjába tartozó faj. Közismert népies neve: mátyásmadár vagy mátyásszajkó, egyes vidékeken mátyás, illetve matyimadár."},{"page_url":"https://en.wikipedia.org/wiki/Joseph_Chinard","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d8/Verninac_Chinard_Louvre_RF3655.jpg","page_title":"Joseph Chinard","context_page_description":"Joseph Chinard was a French sculptor who worked in a Neoclassical style that was infused with naturalism and sentiment."},{"page_url":"https://da.wikipedia.org/wiki/Lundy","image_url":"http://upload.wikimedia.org/wikipedia/commons/b/bc/The_Jetty%2C_Lundy.jpg","page_title":"Lundy","context_page_description":"Lundy er en ø ved England og den største i Bristolkanalen. Øen ligger 19 km ud for kysten af Devon. Øen er 5 km lang og 1 km bred. Et havvarslingsområde i Storbritannien er opkaldt efter øen.\\nI 2007 var der 28 fastboende på øen. Blandt dem en opsynsmand, en øbestyrer og bønder, samt ansatte ved en pub. De fleste bor i og omkring landsbyen Marisco syd på øen. De fleste besøgende er på dagsture på øen.\\nI en læserundersøgelse i Radio Times i 2005 blev Lundy kåret til det tiende mest fantastiske underværk i Storbritannien. Hele øen har status som Site of Special Scientific Interest, og blev det første marine naturreservat i England samt den første marine beskyttelseszone, noget som kom af det unikke dyre- og planteliv på øen. Øen er styret af Landmark Trust på vegne af National Trust."},{"page_url":"https://en.wikipedia.org/wiki/National_Register_of_Historic_Places_listings_in_Hudson_County,_New_Jersey","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/88/PaulusHook.JPG","page_title":"National Register of Historic Places listings in Hudson County, New Jersey","context_page_description":"List of the National Register of Historic Places listings in Hudson County, New Jersey\\nThis is intended to be a complete list of properties and districts listed on the National Register of Historic Places in Hudson County, New Jersey. The locations of National Register properties and districts may be seen in an online map by clicking on \\"Map of all coordinates\\". The steam yacht Kestrel, originally listed in Hudson, has subsequently been moved to Upstate New York, while the ferry Yankee, originally listed in New York City was moored in Hoboken for a time; it is now moored in Brooklyn.\\nThis National Park Service list is complete through NPS recent listings posted July 31, 2020."},{"page_url":"https://cs.wikipedia.org/wiki/M%C3%A1ta_roln%C3%AD","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/07/Mentha_arvensis-076.JPG","page_title":"Máta rolní","context_page_description":"Máta rolní je nižší, vytrvalá plevelná bylina vyrůstající na vlhkých místech, druh obsahující množství aromatických silic které např. po rozemnutí natě unikají z jejích buněk."},{"page_url":"https://en.wikipedia.org/wiki/Paul_Ryan_(hurler)","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/98/Paul_Ryan_%28hurler%29.jpg","page_title":"Paul Ryan (hurler)","context_page_description":"Paul Ryan is an Irish hurler who plays as a full-forward for the Dublin senior team.\\nBorn in Dublin, Ryan first played competitive hurling with the combined Dublin Colleges team, winning an All-Ireland medal in 2006. He simultaneously came to prominence at juvenile and underage levels with the Ballyboden St. Enda's club, winning a minor championship medal in 2006. Ryan subsequently joined the Ballyboden St. Enda's senior team and has since won six county senior championship medals.\\nRyan made his debut on the inter-county scene at the age of seventeen when he was selected for the Dublin minor team. He enjoyed one unsuccessful championship season with the minor team. He subsequently joined the Dublin under-21 team. Ryan made his senior debut during the 2008 league and has since become a regular member of the team, winning Leinster and National League medals."},{"page_url":"https://en.wikipedia.org/wiki/Alfredian_Park","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d2/Cropped_image_of_Alfredian_Park_in_1983_Geograph-4569908-by-Steve-Daniels.jpg","page_title":"Alfredian Park","context_page_description":"Alfredian Park is a football ground in Wantage, Oxfordshire, England, and the home of Wantage Town Football Club. With a capacity of about 1,500."},{"page_url":"https://pl.wikipedia.org/wiki/Bia%C5%82%C4%99%C5%BCyce","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d9/Palace_in_Bia%C5%82%C4%99%C5%BCyce.JPG","page_title":"Białężyce","context_page_description":"Białężyce – wieś w Polsce położona w województwie wielkopolskim, w powiecie wrzesińskim, w gminie Września.\\nPrzez miejscowość przebiega droga wojewódzka nr 432.\\nW latach 1975–1998 miejscowość administracyjnie należała do województwa poznańskiego.\\nW Białężycach znajduje się zabytkowy dwór.\\nW 2016 otwarto w miejscowości fabrykę samochodów marki Volkswagen Crafter."},{"page_url":"https://en.wikipedia.org/wiki/Germain_Racing","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/ab/The_Germain_Race_Shop_in_Mooresville%2C_North_Carolina.jpg","page_title":"Germain Racing","context_page_description":"Germain Racing is an American professional stock car racing team that currently competes in the NASCAR Cup Series. It is owned by Bob Germain, whose family owns many car dealerships across the United States as Germain Motor Company. The team currently fields the No. 13 Chevrolet Camaro ZL1 1LE full-time for Ty Dillon. The team previously fielded the No. 03, No. 9, No. 30, No. 62 and No. 77 Toyota Tundras in the Camping World Truck Series and the No. 7 and No. 15 Toyota Camry in the NASCAR Xfinity Series. Previously, the team had been affiliated with Arnold Motorsports, a former Cup Series team, until the 2005 season as Germain-Arnold Racing.\\nAfter fielding Toyotas for most of its history, the team fielded Ford Fusions in 2012 and 2013. Then in 2014, the team switched to Chevrolet, ending a two-year partnership with Ford, and formed a technical alliance with Richard Childress Racing."},{"page_url":"https://en.wikipedia.org/wiki/Japan_National_Route_462","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ea/R462_1.JPG","page_title":"Japan National Route 462","context_page_description":"National Route 462 is a national highway of Japan connecting Saku, Nagano and Isesaki, Gunma in Japan, with a total length of 114.6 km."},{"page_url":"https://vi.wikipedia.org/wiki/Castillo_de_Bayuela","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9f/Picota_o_rollo%2C_ayuntamiento%2C_Castillo_de_Bayuela.jpg","page_title":"Castillo de Bayuela","context_page_description":"Castillo de Bayuela là một đô thị trong tỉnh Toledo, Castile-La Mancha, Tây Ban Nha. Theo điều tra dân số 2006, đô thị này có dân số là 1054 người."},{"page_url":"https://ja.wikipedia.org/wiki/%E3%82%A2%E3%82%B9%E3%83%88%E3%82%A5%E3%83%AA%E3%82%A2%E3%82%B9%E4%BA%BA","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9c/Fernando_Alonso_2006_Malaysia.jpg","page_title":"アストゥリアス人","context_page_description":"アストゥリアス人 はイベリア半島北西部に居住するエスニック集団で、以下の定義を持つ。\\nアストゥリアス民族に帰属すると考えている人。\\nアストゥリアス語を母語とする人。"},{"page_url":"https://ru.wikipedia.org/wiki/%D0%A1%D0%B0%D0%BD%D0%B4%D0%B0%D1%80%D0%BC%D0%BE%D1%85","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/17/%D0%A1%D0%B0%D0%BD%D0%B4%D0%BE%D1%80%D0%BC%D0%BE%D1%8521.jpg","page_title":"Сандармох","context_page_description":"Сандармо́х — лесное урочище, место массовых расстрелов и захоронений во время сталинского Большого террора 1937—1938 годов. Оно находится в 19 километрах от Медвежьегорска по дороге на Повенец, в Медвежьегорском районе Республики Карелия. После открытия в 1997 году Сандармох был обустроен как мемориальное кладбище. В 2000 году ему присвоен статус объекта культурного наследия России.\\nСандармох является одним из самых больших и известных захоронений жертв сталинских репрессий. Всего в нём обнаружено 236 расстрельных ям, в которых палачами НКВД было тайно убито и захоронено 6241 человек. На настоящий момент благодаря изысканиям историков известно имя каждой жертвы. Здесь были убиты спецпоселенцы и жители Карельской АССР, заключённые Беломорско-Балтийского лагеря, а также самый многочисленный «первый этап» Соловецкого лагеря. Благодаря последнему факту Сандармох приобрёл международное значение, поскольку в Соловецком лагере узниками были многие известные люди: деятели культуры, учёные, лидеры политических, национальных и религиозных движений."},{"page_url":"https://he.wikipedia.org/wiki/%D7%A6%D7%99%D7%A4%D7%95%D7%A8_(%D7%A1%D7%99%D7%A8%D7%94)","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5d/ZipporimRamatcalFlag.jpg","page_title":"ציפור (סירה)","context_page_description":"ציפור היא סירה מהירה במקורה שימשה את הצי המלכותי האיטלקי כטרפדת. ואילו את שייטת 13 של חיל הים הישראלי שימשה לפיקוד קדמי, איסוף לוחמים, ותובלת פושטים. סירות מדגם ציפור שירתו מאז מלחמת העצמאות ועד מלחמת ששת הימים. עד שהוחלפו בסנוניות במהלך מלחמת ההתשה."},{"page_url":"https://it.wikipedia.org/wiki/Circondario_di_Cagliari","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/dc/Circondario_di_Cagliari.png","page_title":"Circondario di Cagliari","context_page_description":"Il circondario di Cagliari era uno dei circondari in cui era suddivisa l'omonima provincia."},{"page_url":"https://de.wikipedia.org/wiki/S%C3%BCdfriedhof_(D%C3%BCsseldorf)","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/98/D-suedfriedhof01.jpg","page_title":"Südfriedhof (Düsseldorf)","context_page_description":"Der Südfriedhof der Stadt Düsseldorf liegt im alten Süden der Stadt, in der Nähe der heutigen Stadtmitte zwischen den Stadtteilen Bilk und Volmerswerth.\\nEr wird begrenzt durch die Auffahrt vom Südring zur Kardinal-Frings-Brücke, die Wohngebiete in der Umgebung der Volmerswerther Straße und die Felder der Bauern sowie das Trinkwassergewinnungsgebiet der Stadtwerke.\\nDer Südfriedhof hat eine Größe von 46,1 ha."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%9F%D0%BD%D0%B5%D0%B2%D0%BC%D0%BE%D0%BA%D0%BB%D0%B0%D1%81%D0%B8%D1%84%D1%96%D0%BA%D0%B0%D1%82%D0%BE%D1%80_%C2%AB%D0%97%D0%B8%D0%B3-%D0%97%D0%B0%D0%B3%C2%BB","image_url":"https://upload.wikimedia.org/wikipedia/uk/6/6c/%D0%A1%D1%85%D0%B5%D0%BC%D0%B0_%D0%BF%D0%BD%D0%B5%D0%B2%D0%BC%D0%BE%D0%BA%D0%BB%D0%B0%D1%81%D0%B8%D1%84%D1%96%D0%BA%D0%B0%D1%82%D0%BE%D1%80%D0%B0_%C2%AB%D0%97%D0%B8%D0%B3-%D0%97%D0%B0%D0%B3%C2%BB..jpg","page_title":"Пневмокласифікатор «Зиг-Заг»","context_page_description":"Пневмокласифікатор «Зиг-Заг» являє собою систему каналів прямокутного перетину. Канали нахилені під кутом 60º до горизонту і змінюють напрям у кожному ступені. Пил видаляється при пересипанні матеріалу з полички на поличку. Ефективність пиловідділення становить 60—70 %.\\nПневмокласифікатор «Зиг-Заг» використовують також при збагаченні слюдяної руди. Плоскі частинки слюди значно легші, ніж пуста порода, тому регулюванням потоку повітря створюються умови для виносу частинок слюди вгору і опускання частинок породи вниз.\\nПневмокласифікатор «Зиг-Заг» використовують також при збагаченні торфу."},{"page_url":"https://de.wikipedia.org/wiki/Schildausbau","image_url":"http://upload.wikimedia.org/wikipedia/commons/3/3b/Schildausbau.JPG","page_title":"Schildausbau","context_page_description":"Als Schildausbau wird ein hydraulisches System zum Strebausbau im untertägigen Steinkohlenbergbau bezeichnet. Der Schildausbau stützt im Strebbau die Abbaustelle gegen den Druck des andernfalls einbrechenden Hangenden und bewegt einen integrierten Kettenförderer mit einem darauf arbeitenden Kohlenhobel oder Walzenschrämlader im schreitenden Abbau durch geeignete Kohlenflöze."},{"page_url":"https://zh.wikipedia.org/wiki/%E9%87%91%E6%B3%AB%E9%9B%85","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e7/4Minute_-_Hyuna%27s_Signature.png","page_title":"金泫雅","context_page_description":"金泫雅出生于韩国首尔，中文艺名为泫雅，韩国女歌手、舞者。现男友为金晓钟。\\n现为P NATION旗下艺人，曾为JYP娱乐旗下女子组合Wonder Girls和Cube娱乐旗下女子组合4minute成员，均担任主Rapper、主领舞。\\n粉丝后援会名称为“Aing”，“A”是代表泫雅，而“ing”在英文文法中代表着现在进行式，即粉丝们每瞬间都跟泫雅在一起。"},{"page_url":"https://ar.wikipedia.org/wiki/%D8%B9%D9%84%D9%85_%D8%A7%D9%84%D8%A3%D9%86%D8%B3%D8%A7%D8%A8","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5b/LIneage_Tree_tablet_in_Yu_Baba_Gongbei%2C_Linxia.jpg","page_title":"علم الأنساب","context_page_description":"علم الأنساب أو جينيالوجيا هو علم مهتم بأنساب القبائل والعشائر والأسر المحلية. ويُسمى عالم الأنساب نسابة."},{"page_url":"https://fr.wikipedia.org/wiki/Escargot","image_url":"http://upload.wikimedia.org/wikipedia/commons/f/f3/Kadina-snails-climb-fence-0716.jpg","page_title":"Escargot","context_page_description":"Le terme escargot est un nom vernaculaire qui en français désigne des gastéropodes à coquille, généralement terrestres et appelés aussi des limaçons, ou colimaçons par opposition aux limaces. Ce sont tous des mollusques, quelle que soit leur taille ou leur forme. 40 % des mollusques étant des escargots terrestres, certains escargots toutefois sont des espèces aquatiques, plutôt d'eau douce : Basommatophora tels les limnées ou les planorbes, souvent appelés « escargots nettoyeurs » par les amateurs d'aquariophilie. La plupart des escargots sont phytophages, quoique quelques espèces soient omnivores, zoophages ou détritivores.\\nIl en existe de nombreuses espèces, les plus discrètes restant très mal connues et beaucoup sans doute encore inconnues. En 2004, près de 80 000 avaient été décrites, sur les 200 000 mollusques répertoriés, dont 500 en France. Rien qu'en Slovaquie, les spécialistes ont identifié 53 espèces aquatiques et 175 terrestres, soit 228 au total. C'est beaucoup plus qu’aux Pays-Bas, où 169 espèces ont quand même été identifiées.\\nIl est fréquent de trouver des espèces endémiques sur les îles ou dans des milieux très isolés depuis longtemps."},{"page_url":"https://en.wikipedia.org/wiki/Regular_icosahedron","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/44/Icosahedron_fnormal.png","page_title":"Regular icosahedron","context_page_description":"In geometry, a regular icosahedron is a convex polyhedron with 20 faces, 30 edges and 12 vertices. It is one of the five Platonic solids, and the one with the most sides.\\nIt has five equilateral triangular faces meeting at each vertex. It is represented by its Schläfli symbol {3,5}, or sometimes by its vertex figure as 3.3.3.3.3 or 3⁵. It is the dual of the dodecahedron, which is represented by {5,3}, having three pentagonal faces around each vertex.\\nA regular icosahedron is a strictly convex deltahedron and a gyroelongated pentagonal bipyramid and a biaugmented pentagonal antiprism in any of six orientations.\\nThe name comes from Greek εἴκοσι, meaning 'twenty', and ἕδρα, meaning 'seat'. The plural can be either \\"icosahedrons\\" or \\"icosahedra\\"."},{"page_url":"https://nl.wikipedia.org/wiki/C%C3%A1ndido_M%C3%A9ndez_Rodr%C3%ADguez","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/74/C%C3%A1ndido_M%C3%A9ndez_en_la_clausura_del_38_Congreso_del_PSOE.jpg","page_title":"Cándido Méndez Rodríguez","context_page_description":"Cándido Méndez Rodríguez is de huidige algemeen secretaris van de Unión General de Trabajadores en een voormalige voorzitter van het Europees Verbond van Vakverenigingen. Daarnaast zetelde hij in het Congreso de los Diputados en in het Parlamento de Andalucía voor de Partido Socialista Obrero Español."},{"page_url":"https://de.wikipedia.org/wiki/Nahle","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/35/Nahleberg-KWL.jpg","page_title":"Nahle","context_page_description":"Die Nahle ist ein 2,7 Kilometer langer Nebenarm der Weißen Elster in Leipzig, Sachsen, und mündet in die Neue Luppe. Sie ist Teil des Elster-Luppe-Systems im nördlichen Leipziger Auenwald."},{"page_url":"https://sv.wikipedia.org/wiki/Opuntia_sulphurea","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/af/Opuntia_sulphurea_BlKakteenT136.jpg","page_title":"Opuntia sulphurea","context_page_description":"Opuntia sulphurea är en kaktusväxtart som beskrevs av George Don jr och John Claudius Loudon. Opuntia sulphurea ingår i släktet fikonkaktusar, och familjen kaktusväxter. Inga underarter finns listade i Catalogue of Life."},{"page_url":"https://pl.wikipedia.org/wiki/Massimiliano_Papis","image_url":"http://upload.wikimedia.org/wikipedia/commons/4/43/Max_Papis.jpg","page_title":"Massimiliano Papis","context_page_description":"Massimiliano „Max” Papis – włoski kierowca wyścigowy."},{"page_url":"https://af.wikipedia.org/wiki/Erling_Drangsholt","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/35/Erling_Drangsholt.jpg","page_title":"Erling Drangsholt","context_page_description":"Erling Drangsholt was 'n Noorse akteur. Hy was bekend vir sy rolle in die rolprente Den glade enke i Trangvik, Madame besøker Oslo, Sangen til livet, en Two Lives."},{"page_url":"https://fr.wikipedia.org/wiki/Cuisine_portugaise","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/31/Vinho_verde_branco_%26_tinto.jpg","page_title":"Cuisine portugaise","context_page_description":"La cuisine portugaise est la cuisine traditionnelle du Portugal.\\nCurnonsky, le prince de la gastronomie, a décrit la cuisine des régions françaises en 325 recettes, mais dans son livre, Cozinha Tradicional Portuguesa, Maria de Lourdes Modesto, citée comme la Portugal's Julia Child par le New York Times, en 1987, nous en présente environ 800 qu'elle a mis deux décennies à recueillir.\\nL'influence de l'océan Atlantique, la tradition méditerranéenne et les saveurs rapportées des anciennes colonies, viennent enrichir les plats à base de viandes et de légumes.\\nLe climat et la géographie variée permettent l'acclimatation de nombreux végétaux venus de tous les continents."},{"page_url":"https://ja.wikipedia.org/wiki/%E5%8F%A4%E5%B7%9D_(%E3%81%A4%E3%81%8F%E3%81%B0%E3%81%BF%E3%82%89%E3%81%84%E5%B8%82)","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/bc/Flag_of_Tsukubamirai_Ibaraki.JPG","page_title":"古川 (つくばみらい市)","context_page_description":"古川は、茨城県つくばみらい市の地名。郵便番号は300-2422。人口は477人。"},{"page_url":"https://de.wikipedia.org/wiki/Club_Libertad","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f3/Libertad_1910.jpg","page_title":"Club Libertad","context_page_description":"Der Club Libertad ist ein Sportverein aus Asunción, der Hauptstadt Paraguays. Der am 30. Juli 1905 gegründete Verein war 1906 eines der Gründungsmitglieder des Paraguayischen Fußballverbandes. Seit dem ersten Titelgewinn 1910 konnte der Verein zahlreiche weitere Meisterschaften gewinnen und gilt dieser Tage als dritte Kraft hinter den Spitzenvereinen Olimpia und Cerro Porteño."},{"page_url":"https://simple.wikipedia.org/wiki/Carter_Lake,_Iowa","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/db/Carter-lake-map.png","page_title":"Carter Lake, Iowa","context_page_description":"Carter Lake is a city in Pottawattamie County, Iowa, United States. It is a suburb of Omaha, Nebraska. In 2010, 3,785 people lived there."},{"page_url":"https://uk.wikipedia.org/wiki/Volkswagen_K%C3%A4fer","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fb/Bundesarchiv_Bild_183-2005-1017-525%2C_Dr._Ferdinand_Porsche.jpg","page_title":"Volkswagen Käfer","context_page_description":"Volkswagen Käfer — легковий автомобіль, що випускався німецькою компанією Volkswagen AG з 1938 року по 2003 рік. Вважається наймасовішим автомобілем в історії, що вироблявся без перегляду базової конструкції. Всього було виготовлено 21 529 464 автомобілі.\\nНа його базі випускали військовий VW Typ 82."},{"page_url":"https://en.wikipedia.org/wiki/Fenerbah%C3%A7e_S.K._(football)","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/71/Old_shirts.JPG","page_title":"Fenerbahçe S.K. (football)","context_page_description":"Fenerbahçe S.K., commonly known as Fenerbahçe, is a Turkish professional football club based in Istanbul, Turkey. The club's name comes from Fenerbahçe neighbourhood of Istanbul. The professional football department are the most notable one of Fenerbahçe SK, a major multi-sport club who compete in football, basketball, volleyball, athletics, swimming, sailing, rowing, boxing, and table tennis, among others, with many major honours won in each department. Fenerbahçe are one of the most successful and best supported football teams in Turkey, having never been relegated to lower divisions, and currently compete in the Turkish Super League and the Turkish Cup. They are nicknamed Sarı Kanaryalar and the team play their home games at Şükrü Saracoğlu Stadium, their own traditional home ground in Kadıköy, Istanbul.\\nFenerbahçe have won 19 Turkish Super League titles, 6 Turkish Cups and 9 Turkish Super Cups, among others. With 28 Turkish championships in total Fenerbahçe hold the record for most national championship titles won. The club are also leading the all-time table of the Turkish Super League."},{"page_url":"https://ar.wikipedia.org/wiki/%D8%A7%D9%84%D9%85%D8%AA%D9%8A%D8%A7%D9%87%D8%A9","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/20/%D8%A7%D9%84%D9%85%D8%AA%D9%8A%D8%A7%D9%87%D8%A9_%D8%A7%D9%84%D8%AC%D9%86%D9%88%D8%A8%D9%8A%D8%A9.jpg","page_title":"المتياهة","context_page_description":"{{يتيمة|تاريخ=نوفمبر 2016"},{"page_url":"https://ml.wikipedia.org/wiki/%E0%B4%9A%E0%B4%95%E0%B5%8D%E0%B4%95","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/14/Baby_jackfruit_opening_up_from_its_leaf_cover._from_Kerala%2C_India.jpg","page_title":"ചക്ക","context_page_description":"ഇന്ത്യ, ബംഗ്ലാദേശ്, ഫിലിപ്പൈൻസ്, ശ്രീലങ്ക എന്നിവിടങ്ങളിലും മലായ് പെനിൻസുലക്കു കിഴക്കുവശങ്ങളിലുമായി കാണപ്പെടുന്ന മൾബറി കുടുംബത്തിൽ ഉൾപ്പെടുന്ന പ്ലാവ് എന്ന വൃക്ഷം നൽകുന്ന ഒരു കായ്ഫലം ആണ്‌ ചക്ക. ശാസ്ത്രീയനാമം: Artocarpus heterophyllus. പനസം എന്നും പേരുണ്ട്കേരളം, തമിഴ്‌നാട് എന്നീ സംസ്ഥാനങ്ങളുടെ ഔദ്യോഗിക ഫലമാണ് ചക്ക. സമതല പ്രദേശങ്ങളിൽ ആണ്‌ ഇതു സാധാരണ കാണപ്പെടുന്നത്. ഏറ്റവും വലിയ കായ്ഫലം ചക്കയാണ്‌. പ്ലാവ് മിക്കവാറും വലിയ തായ്ത്തടിയും ചെറിയ ശാഖകളുമുള്ള വൃക്ഷമാണ്. ചക്കകൾ കൂടുതലും പ്ലാവിന്റെ തായ്‌തടിയിൽ തന്നെയാണ്‌ ഉണ്ടാവുക. അപൂർവ്വമായി വേരിലും ചക്ക കായ്ക്കാറുണ്ട്.\\nപഴങ്ങളിൽ നിന്നും വേർതിരിച്ചു എടുക്കുന്ന രാസപദാർത്ഥമായ പെക്ടിൻറ്റെ സമൃദ്ധ സ്രോതസ്സാണ് ചക്ക.പച്ചച്ചക്ക പുഴുക്ക് രൂപത്തിലോ നാടൻ വിഭവങ്ങളിൽ ചേർത്ത് കഴിക്കുന്നതോ പ്രമേഹം കുറയ്ക്കുമെന്ന് ചില ഗവേഷണ ഫലങ്ങളിൽ കണ്ടെത്താൻ കഴിഞ്ഞിട്ടുണ്ട്. കേരളത്തിന്റെ ഔദ്യോഗിക ഫലമായി ചക്കയെ പ്രഖ്യാപിച്ചത് 2018 മാർച്ചിലാണ്.കേരളത്തിൽ ഒരു വർഷം 30 കോടി മുതൽ 60 കോടി വരെ ചക്ക ഉൽപാദിപ്പിക്കുന്നുണ്ട്.എന്നാൽ ഇതിൽ മലയാളികൾ 2% മാത്രമാണ് ഉപയോഗിക്കുന്നത്."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%A1%D0%BF%D0%B8%D1%81%D0%BE%D0%BA_%D0%BF%D1%82%D0%B0%D1%85%D1%96%D0%B2_%D0%93%D1%80%D0%B5%D0%BD%D0%B0%D0%B4%D0%B8","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f0/Roseate_terns_Palometas.jpg","page_title":"Список птахів Гренади","context_page_description":"Цей список є списком видів птахів, спостережених на території Гренади. Він включає 177 видів, з них 1 вид є ендеміком, 5 інтродукованих людьми, 106 є рідкісними або випадковими залітними та 1 вимерлий."},{"page_url":"https://de.wikipedia.org/wiki/Reithalle","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6a/Uje%C5%BCd%C5%BCalnia_z_zewn%C4%85trz.jpg","page_title":"Reithalle","context_page_description":"Eine Reithalle bezeichnet ein Gebäude, das speziell für den Reitsport konzipiert ist."},{"page_url":"https://sr.wikipedia.org/wiki/%D0%9E%D1%81%D1%82%D0%B5%D1%80%D0%BA%D0%B0%D0%BF%D0%B5%D0%BB%D0%BD","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/aa/Ostercappeln_-_Krebsburg_-BT-_01.jpg","page_title":"Остеркапелн","context_page_description":"Остеркапелн општина је у њемачкој савезној држави Доња Саксонија. Једно је од 34 општинска средишта округа Оснабрик. Према процјени из 2010. у општини је живјело 9.531 становника. Посједује регионалну шифру 3459029."},{"page_url":"https://ca.wikipedia.org/wiki/Monticello_(Missouri)","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/86/Lewis_County_MO_Courthouse_20141022_A.jpg","page_title":"Monticello (Missouri)","context_page_description":"Monticello és una població dels Estats Units a l'estat de Missouri. Segons el cens del 2000 tenia una població de 126 habitants."},{"page_url":"https://en.wikipedia.org/wiki/Feliciano_Chiclana","image_url":"http://upload.wikimedia.org/wikipedia/commons/6/6b/FelicianoChiclana.jpg","page_title":"Feliciano Chiclana","context_page_description":"Feliciano Antonio Chiclana was an Argentine lawyer, soldier, and judge."},{"page_url":"https://es.wikipedia.org/wiki/R%C3%ADo_Big_Sandy_(r%C3%ADo_Ohio)","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3e/Bigsandyrivermap.png","page_title":"Río Big Sandy (río Ohio)","context_page_description":"El río Big Sandy es un río de los Estados Unidos, afluente del río Ohio, de 47 km de longitud, que forma en todo su curso el límite entre los estados de Virginia Occidental, al este, y Kentucky, al oeste. A través del río Ohio, forma parte de la cuenca del río Misisipi.\\nNace entre Louisa y Fort Gay, en la confluencia de los ríos Tug Fork y Levisa Fork. Fluye generalmente en dirección norte en un curso con muchos meandros, entre los condados de Lawrence y Boyd en Kentucky y el condado de Wayne en Virginia Occidental. Se une al río Ohio entre Catlettsburg y la ciudad de Kenova, Virginia Occidental, 13 km al oeste de Huntington, en la frontera común entre Virginia Occidental, Kentucky y Ohio.\\nEs un río navegable y se utiliza para transporte comercial, en especial carbón extraído en la misma región."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%A7%D0%B5%D1%80%D0%B5%D0%BF%D0%BD%D0%B8%D0%BD,_%D0%9D%D0%B8%D0%BA%D0%BE%D0%BB%D0%B0%D0%B9_%D0%9D%D0%B8%D0%BA%D0%BE%D0%BB%D0%B0%D0%B5%D0%B2%D0%B8%D1%87","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c4/Nikolai-Tcherepnin.jpg","page_title":"Черепнин, Николай Николаевич","context_page_description":"Никола́й Никола́евич Черепни́н — русский композитор, дирижёр и педагог, отец композитора Александра Черепнина.\\nН. Н. Черепнин стал первым композитором, к которому обратился Сергей Дягилев в самом начале своего проекта «Русских сезонов». Обладая ярким композиторским талантом, вращаясь в среде художников и музыкантов, изменивших лицо искусства XX века, Черепнин создал произведения, перевернувшие представление о современном балетном спектакле — «Павильон Армиды», «Нарцисс и Эхо». Сергей Дягилев оценивал композитора как одного из «самых знаменитых деятелей музыки, живописи, хореографии». Ю. Шапорин, занимавшийся у Черепнина по чтению партитур, так описывает своего учителя: «Из всех профессоров консерватории он был, пожалуй, наиболее передовым по своим художественным устремлениям». В. Логинова отмечала, что композитор «обладал самостоятельным и неповторимым обликом в контексте художественной культуры начала XX века и сказал собственное слово, внёс заметный творческий вклад в мировое музыкально-художественное наследие»."},{"page_url":"https://zh.wikipedia.org/wiki/%E7%A7%91%E6%9E%97%E6%96%AF_(%E5%8F%A4%E5%B8%8C%E8%85%8A)","image_url":"http://upload.wikimedia.org/wikipedia/commons/4/49/CorintoScaviTempioApollo.jpg","page_title":"科林斯 (古希腊)","context_page_description":"科林斯，为古希腊城邦之一，地处今科林斯地峡地区。\\n基督教中，科林斯因新约圣经中的《哥林多前书》和《哥林多后书》而得名。"},{"page_url":"https://fa.wikipedia.org/wiki/%D8%B1%D9%86%D9%81%D9%87_%D8%A7%D9%88%D9%BE%D8%B1%D8%A7%D8%AF%D9%88%D8%B1%D8%A7","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c5/RENFE_592_-_Valencia-Sant_Isidre_-_2014-08-13.jpg","page_title":"رنفه اوپرادورا","context_page_description":"رنفه اوپرادورا یک شرکت راه‌آهن دولتی در کشور اسپانیا است.\\nاین شرکت که در سال ۱۹۴۱ تأسیس شده مدیریت در حدود ۱۲۰۰۰ کیلومتر راه‌آهن ملی اسپانیا که ۷۰۰۰ کیلومتر آن برقی می‌باشد را بر عهده دارد."},{"page_url":"https://ja.wikipedia.org/wiki/%E5%B9%B3%E7%AD%89%E9%99%A2","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/54/Byodoin_bosatsu_5.jpg","page_title":"平等院","context_page_description":"平等院は、日本の近畿地方の、京都府宇治市宇治蓮華に所在する、藤原氏ゆかりの仏教寺院。山号は朝日山。開基は藤原頼通、開山は明尊。本尊は阿弥陀如来坐像。\\n宗派は17世紀以来天台宗と浄土宗を兼ね、現在は特定の宗派に属さない単立寺院となっていて、最勝院と浄土院が年交代制で共同管理している。\\n鳳凰堂で世界に広く知られている。平安時代後期にあたる11世紀以来保持されてきた数々の建造物を中心とする寺宝と文化財は、往時の思想・文化を今に伝える。平等院と周辺地域は琵琶湖国定公園指定区域の一つである「宇治川沿岸地区」の中核をなす。1994年に登録されたユネスコ世界遺産「古都京都の文化財」の構成物件の一つでもある。"},{"page_url":"https://pt.wikipedia.org/wiki/M%C3%BAsica_sertaneja","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f3/Zez%C3%A9_Di_Camargo_%26_Luciano.jpg","page_title":"Música sertaneja","context_page_description":"Música sertaneja é um gênero musical do Brasil produzido a partir da década de 1929 por compositores urbanos, rurais e outros chamada genericamente de modas e emboladas cujo som da viola é predominante. O sertanejo é atualmente o mais popular estilo musical no Brasil, superando inclusive o samba, na maioria dos estados do país.\\nO gênero musical sertanejo mais famoso é o sertanejo caipira, ou música caipira, esse gênero musical historicamente teve início com o Bandeirismo, um movimento de desbravamento no interior do Brasil pelos bandeirantes paulistas, no século XVI. Antonio Candido definiu como Paulistânia todo o eixo de expansão e difusão da cultura bandeirante. Região esta onde se fixou o que entendemos por cultura caipira. Os estados de São Paulo, Goiás, Mato Grosso do Sul, metade Norte do Paraná, parte de Tocantins, parte do Mato Grosso e regiões como Sul de Minas, Sul do Rio de Janeiro e Triângulo Mineiro, são os locais onde se ambientaram esses valores."},{"page_url":"https://zh-min-nan.wikipedia.org/wiki/Lampaul-Plouarzel","image_url":"http://upload.wikimedia.org/wikipedia/commons/a/ad/Map_commune_FR_insee_code_29098.png","page_title":"Lampaul-Plouarzel","context_page_description":"Lampaul-Plouarzel sī ūi-tī Hoat-kok Bretagne tōa-khu Finistère séng ê chi̍t ê commune."},{"page_url":"https://es.wikipedia.org/wiki/Municipio_de_Ogre","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0e/Ogres_novads_COA.png","page_title":"Municipio de Ogre","context_page_description":"El municipio de Ogre es uno de los ciento diez municipios de Letonia, se encuentra localizado en el sur-oeste de dicho país báltico. Fue creado durante el año 2002 después de una reorganización territorial. La capital es la villa de Ogre, donde viven dos terceras partes de la población del municipio."},{"page_url":"https://en.wikipedia.org/wiki/Kryoman","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d9/Kryoman_DJ_.jpg","page_title":"Kryoman","context_page_description":"Andrew Moore, is a Miami-based electronic dance music DJ from London, England. He is best known for the development and use of ten-foot-tall robot suits equipped with high powered lights, smoke guns, Hi-Definition LED mapping, and pyrotechnic special FX systems. Kryoman appears worldwide, touring and performing with other EDM artists such as Steve Aoki, Fedde le Grand, DJ Tiësto, Afrojack, The Black Eyed Peas, and Nicki Minaj. Kryoman operates out of Los Angeles, New York City, Miami, and Ibiza, and has several other Kryoman groups stationed worldwide. In March 2016, Kryoman released a record entitled \\"my squads lit\\" with Shaquille O'Neal. Kryoman has musical release on Darklight Recordings, Uprise Music, and Nervous Records."},{"page_url":"https://cs.wikipedia.org/wiki/Seznam_kulturn%C3%ADch_pam%C3%A1tek_v_%C3%9Adlic%C3%ADch","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b5/%C3%9Adlice_-_Socha_svat%C3%A9ho_Jana_Nepomuck%C3%A9ho.jpg","page_title":"Seznam kulturních památek v Údlicích","context_page_description":"Tento seznam nemovitých kulturních památek v obci Údlice v okrese Chomutov vychází z Ústředního seznamu kulturních památek ČR, který na základě zákona č. 20/1987 Sb., o státní památkové péči, vede Národní památkový ústav jako ústřední organizace státní památkové péče. Údaje jsou průběžně upřesňovány, přesto mohou obsahovat i řadu věcných a formálních chyb a nepřesností či být neaktuální.\\nPokud byly některé části dotčeného území vyčleněny do samostatných seznamů, měly by být odkazy na tyto dílčí seznamy uvedeny v úvodu tohoto seznamu nebo v úvodu příslušné sekce seznamu."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Kulturdenkm%C3%A4ler_in_Neukirchen_(Kn%C3%BCll)","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/87/Marktplatz_4%2C_1%2C_Neukirchen_%28Kn%C3%BCll%29%2C_Schwalm-Eder-Kreis.jpg","page_title":"Liste der Kulturdenkmäler in Neukirchen (Knüll)","context_page_description":"Aufgrund ihrer Größe ist die Liste der Kulturdenkmäler in Neukirchen (Knüll) nach Ortsteilen aufgeteilt:\\nListe der Kulturdenkmäler in Asterode\\nListe der Kulturdenkmäler in Christerode\\nListe der Kulturdenkmäler in Hauptschwenda\\nListe der Kulturdenkmäler in Nausis\\nListe der Kulturdenkmäler in Riebelsdorf\\nListe der Kulturdenkmäler in Rückershausen\\nListe der Kulturdenkmäler in Seigertshausen\\nDie Liste der Kulturdenkmäler in Wincherode ist leer."},{"page_url":"https://nl.wikipedia.org/wiki/NGC_6220","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/66/NGC6220_-_SDSS_DR14.jpg","page_title":"NGC 6220","context_page_description":"NGC 6220 is een spiraalvormig sterrenstelsel in het sterrenbeeld Slangendrager. Het hemelobject werd op 19 juni 1887 ontdekt door de Amerikaanse astronoom Lewis A. Swift."},{"page_url":"https://pl.wikipedia.org/wiki/%C3%81gnes_Sz%C3%A1vay","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/98/Agnes_Szavay_Roland_Garros_2007.jpg","page_title":"Ágnes Szávay","context_page_description":"Ágnes Szávay – węgierska tenisistka, zwyciężczyni turniejów z cyklu WTA Tour w grze pojedynczej i podwójnej, mistrzyni trzech wielkoszlemowych imprez juniorskich – French Open 2005 w singlu i deblu oraz Wimbledon 2005 w deblu, reprezentantka kraju w Pucharze Federacji."},{"page_url":"https://lt.wikipedia.org/wiki/Pilypi%C5%A1k%C4%97s","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/17/Pilypi%C5%A1k%C4%97s%2C_Lithuania_-_panoramio_%281%29.jpg","page_title":"Pilypiškės","context_page_description":"Pilypiškės – gyvenvietė Elektrėnų savivaldybės rytuose. Seniūnaitijos centras."},{"page_url":"https://fa.wikipedia.org/wiki/%D8%A8%D8%B1%D9%88%DA%A9%D8%8C_%D9%86%DB%8C%D9%88_%D8%B3%D8%A7%D9%88%D8%AA_%D9%88%D9%84%D8%B2","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/77/43_Broke_Hunter_Valley.jpg","page_title":"بروک، نیو ساوت ولز","context_page_description":"بروک یک شهرک در استرالیا است که در نیو ساوت ولز واقع شده‌است."},{"page_url":"https://de.wikipedia.org/wiki/Gene_Gotti","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/78/Genegotti2.jpg","page_title":"Gene Gotti","context_page_description":"Gene Gotti ist ein US-amerikanischer Mafioso und Mitglied des als Gambino-Familie klassifizierten Clans der La Cosa Nostra in New York City."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Monuments_historiques_in_Sessenheim","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b7/Sessenheim_Nativit%C3%A9Marie_20-17.JPG","page_title":"Liste der Monuments historiques in Sessenheim","context_page_description":"Die Liste der Monuments historiques in Sessenheim führt die Monuments historiques in der französischen Gemeinde Sessenheim auf."},{"page_url":"https://en.wikipedia.org/wiki/Huvafen_Fushi","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/76/HuvafenFushi.jpg","page_title":"Huvafen Fushi","context_page_description":"Huvafen Fushi is a private resort island in the North Malé atoll, Kaafu, Maldives Indian Ocean.\\nSituated near the capital Malé and 30 minutes by speedboat from Malé International Airport, it opened in July 2004 and consists of a single island with 43 bungalows. Targeting the luxury accommodation niche, its facilities include the world's first underwater spa."},{"page_url":"https://it.wikipedia.org/wiki/Gerardo_Bianchi","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b6/Battistero_di_Parma_20081206-89.jpg","page_title":"Gerardo Bianchi","context_page_description":"Gerardo Bianchi, citato anche come Gerardus Blancus, è stato un cardinale e vescovo cattolico italiano."},{"page_url":"https://nl.wikipedia.org/wiki/Egyh%C3%A1zaskoz%C3%A1r","image_url":"http://upload.wikimedia.org/wikipedia/commons/9/93/HUN_Egyh%C3%A1zaskoz%C3%A1r_COA.jpg","page_title":"Egyházaskozár","context_page_description":"Egyházaskozár is een plaats en gemeente in het Hongaarse comitaat Baranya. Egyházaskozár telt 878 inwoners."},{"page_url":"https://no.wikipedia.org/wiki/Villa_Jovis","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/db/Tiberius_Capri_Louvre_Ma1248.jpg","page_title":"Villa Jovis","context_page_description":"Villa Jovis er et romersk palass på Capri, i det sørlige Italia, bygget av keiser Tiberius og fullført år 27 e.Kr. Tiberius regjerte hovedsakelig herfra til sin død i år 37 e.Kr.\\nVilla Jovis er den største av de tolv tiberiske villaer på Capri som ble omtalt av historikeren Tacitus. Hele komplekset spenner over flere terrasser med en høydeforskjell på omtrent 40 meter og dekker om lag 7 000;m². Mens de gjenværende åtte vegger og trapper gir et hint om bygningens storhet. Som nye rekonstruksjoner viser, er villaen et bemerkelsesverdig vitnesbyrd om det første århundres romerske arkitektur."},{"page_url":"https://nl.wikipedia.org/wiki/Lijst_van_kerken_in_Brugge","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/91/Sint-Janskerk_Brugge_-_Belgium.jpg","page_title":"Lijst van kerken in Brugge","context_page_description":"Deze lijst van kerken in Brugge geeft per deelgemeente de belangrijkste kerken en kapellen in de stad Brugge, zowel nog bestaand als reeds verdwenen. Tenzij anders vermeld zijn ze alle rooms-katholiek. De kerken in de lijst zijn zowel parochiekerken, als kerken van kloosters of abdijen, zo niet zelfstandige kapellen.\\nVoor wat de kerken vermeld onder Brugge betreft, zijn volgende meldingen te maken:\\nVier van die navolgende kerken zijn verdwenen en gesloopt: de Augustijnenkerk, de Sint-Christoffelkerk, de Sint-Donaaskathedraal, de Sint-Janskerk.\\nDe volgende nog bestaande kerkgebouwen zijn onttrokken aan de eredienst: de Remptoristinnenkerk, de Schipperskapel, de Heilige Familiekerk, de Heilig Hartkerk, de Sint-Brunokapel, de Speelmanskapel, de Theresianenkerk, de Bogaerdenkapel, de kerk van de zaligsprekingen.\\nDe volgende kerken, gewijd aan de eredienst, bevinden zich buiten de historische stad: De Christus-Koningkerk, de Sint-Pieterskerk, de Sint-Pauluskerk, de Sint-Jozefskerk."},{"page_url":"https://en.wikipedia.org/wiki/Sparrow_and_the_Workshop","image_url":"http://upload.wikimedia.org/wikipedia/commons/2/24/Sparrow_pip_hires_2011025_025.jpg","page_title":"Sparrow and the Workshop","context_page_description":"Sparrow and the Workshop were an indie three-piece based in Glasgow, consisting of the Belfast-born, Chicago-raised Jill O'Sullivan, Welshman Nick Packer and Scotsman Gregor Donaldson. The band's debut album Crystals Fall was released by Distiller Records in 2010 to critical acclaim, with the likes of Drowned in Sound and Clash Magazine awarding the album 9/10. The band was notable for their use of harmonies and bastardized instruments/FX pedals and they have been compared to bands as varied as Jefferson Airplane, Talking Heads and Black Sabbath."},{"page_url":"https://en.wikipedia.org/wiki/Thick-billed_grasswren","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e3/Amytornis_textilis.jpg","page_title":"Thick-billed grasswren","context_page_description":"The thick-billed grasswren is a species of bird in the family Maluridae. It is endemic to Australia. Its natural habitat is Mediterranean-type shrubby vegetation."},{"page_url":"https://pl.wikipedia.org/wiki/Polichromia","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/33/2014_Nysa%2C_Dom_Wagi_Miejskiej_13.JPG","page_title":"Polichromia","context_page_description":"Polichromia – wielobarwna ozdoba malarska ścian, sufitów, podniebienia sklepień, rzeźb stosowana do dekoracji wewnętrznych i zewnętrznych. Polichromie wykonywano nie tylko na materiałach kamiennych i tynkach, ale także na drewnie, wewnątrz i na zewnątrz pomieszczeń w budownictwie sakralnym i świeckim.\\nStosowana jest w architekturze od czasów starożytnych – np. na belkowaniu świątyń greckich. Często stosowana we wnętrzach świątyń wczesnochrześcijańskich oraz średniowiecznych. Od okresu renesansu jest najczęściej stosowaną metodą zdobienia reprezentacyjnych wnętrz budowli świeckich i sakralnych.\\nZe względu na przedstawiony temat polichromie dzieli się na:\\narchitektoniczne – imitują formy architektoniczne takie jak kolumny, okna, filary, gzymsy itp.\\nfiguralne – przedstawiają świętych oraz sceny sakralne\\nornamentalne – pełnią funkcję estetyczną wielokrotnie powtarzając ten sam ornament.\\nSzczególnym rodzajem polichromii jest tak zwana polichromia patronowa. Powstaje ona dzięki wykorzystaniu szablonów zwanych patronami."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%97%D0%B0%D0%BF%D0%B0%D0%B4%D0%BD%D0%BE-%D0%9F%D0%BE%D0%BC%D0%BE%D1%80%D1%81%D0%BA%D0%BE%D0%B5_%D0%B2%D0%BE%D0%B5%D0%B2%D0%BE%D0%B4%D1%81%D1%82%D0%B2%D0%BE","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/ab/0904_Rynek_StrMiasta_Police_ZPL.JPG","page_title":"Западно-Поморское воеводство","context_page_description":"Западно-Поморское воеводство — воеводство, расположенное на северо-западе Польши. Центром и крупнейшим городом является город Щецин. Образовано на территории бывших Щецинского и Кошалинского воеводств.\\nНаселение — 1 705 533 чел."},{"page_url":"https://fa.wikipedia.org/wiki/%D8%B4%D9%88%D8%B1%D9%84%D8%AA_%D8%A7%D9%84_%DA%A9%D8%A7%D9%85%DB%8C%D9%86%D9%88","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/05/Chevrolet_Cameo_1956_Pickup_LRear_Lake_Mirror_Cassic_16Oct2010_%2814874856814%29.jpg","page_title":"شورلت ال کامینو","context_page_description":"شورلت ال کامینو یک خودروی ساخت شرکت خودروسازی شورلت است. طراحی آن موتور جلو-محور عقب بوده‌است."},{"page_url":"https://es.wikipedia.org/wiki/Monasterio_de_La_R%C3%A1bida","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/76/La_R%C3%A1bida%2C_cristo.jpg","page_title":"Monasterio de La Rábida","context_page_description":"El Monasterio de Santa María de La Rábida, comúnmente denominado Monasterio de La Rábida, pertenece a los franciscanos. Se encuentra en el término municipal de Palos de la Frontera, en la provincia andaluza de Huelva.\\nFue erigido entre los siglos XIV-XV. Destacan, por su interés artístico, la iglesia gótico-mudéjar, las estancias decoradas con frescos de Daniel Vázquez Díaz, el claustro y el museo, donde se conservan numerosos objetos conmemorativos del Descubrimiento de América. En la iglesia se encuentra la imagen de la Virgen de los Milagros. Se trata de una escultura de estilo gótico, del siglo XIII aproximadamente, realizada en alabastro.\\nEl monasterio tiene 2137 m² de extensión y es de planta irregular. A lo largo de sus más de quinientos años de historia ha sufrido modificaciones, sobre todo a raíz del terremoto de Lisboa de 1755. En él se hospedó Cristóbal Colón años antes de partir hacia el Nuevo Mundo, cuando aún se encontraba preparando su proyecto. En este monasterio se encuentra enterrado Martín Alonso Pinzón, que falleció a los pocos días del regreso del primer viaje colombino."},{"page_url":"https://fa.wikipedia.org/wiki/%DB%8C%D8%A7%D9%86%DA%AF_%D8%A2%D9%85%D8%B1%DB%8C%DA%A9%D8%A7%D8%8C_%D8%A7%DB%8C%D9%86%D8%AF%DB%8C%D8%A7%D9%86%D8%A7","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b1/Young_America_west_from_S150E.jpg","page_title":"یانگ آمریکا، ایندیانا","context_page_description":"یانگ آمریکا یک منطقهٔ مسکونی در ایالات متحده آمریکا است که در شهرستان کاس، ایندیانا واقع شده‌است. یانگ آمریکا ۱٫۱ کیلومتر مربع مساحت و ۱۱۵ نفر جمعیت دارد و ۲۳۲٫۸۷ متر بالاتر از سطح دریا واقع شده‌است."},{"page_url":"https://it.wikipedia.org/wiki/Comunit%C3%A0_di_San_Giovanni_(istituto_religioso)","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/20/Semur_en_Brionnais-Prieur%C3%A9_Saint_Hugues-20110212-Cour.jpg","page_title":"Comunità di San Giovanni (istituto religioso)","context_page_description":"La Comunità di San Giovanni è un istituto religioso fondato dal padre domenicano Marie-Dominique Philippe nel 1975.\\nI fratelli della comunità sono detti les petits gris dal loro abito grigio che si compone di una tunica grigia e di uno scapolare con cappuccio con, alla vita, un rosario. Le suore contemplative portano in più un velo bianco e quelle apostoliche uno grigio."},{"page_url":"https://azb.wikipedia.org/wiki/%D9%82%D8%A7%DB%8C%D8%AA%D8%A7%D8%B1%D9%85%D8%A7","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fa/Potentilla_reptans_beauvais-carriere-bracheux_60_20062008_1.jpg","page_title":"قایتارما","context_page_description":"قایتارما بیر نؤع بیتکی."},{"page_url":"https://simple.wikipedia.org/wiki/List_of_British_Rail_diesel_multiple_unit_classes","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/de/158952_at_Newport.jpg","page_title":"List of British Rail diesel multiple unit classes","context_page_description":"This is a list of British Rail diesel multiple unit classes."},{"page_url":"https://fr.wikipedia.org/wiki/Arrondissement_de_Stallup%C3%B6nen","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/10/Trakehner1.jpg","page_title":"Arrondissement de Stallupönen","context_page_description":"L' arrondissement de Stallupönen, renommé après 1938 Kreis Ebenrode, puis en 1939 Landkreis Ebenrode, est une entité territoriale de l'ancienne province de Prusse-Orientale qui faisait partie de l'Allemagne. Cet arrondissement appartenait au district de Gumbinnen."},{"page_url":"https://hu.wikipedia.org/wiki/Schwarzenberg/Erzgeb.","image_url":"http://upload.wikimedia.org/wikipedia/commons/5/57/Schwarzenberg_Schloss_von_Ottenstein.JPG","page_title":"Schwarzenberg/Erzgeb.","context_page_description":"Schwarzenberg/Erzgeb. település Németországban, a Nyugati-Érchegységben, azon belül Szászország tartományban. A 12. században a kereskedelmi útvonal védelmére szolgáló erődítményként épült kis hegyvidéki város. Az NDK végéig a város Kelet-Európa legfontosabb mosógépgyártó helyszínévé fejlődött. Lakosainak száma 16 723 fő. +/-"},{"page_url":"https://en.wikipedia.org/wiki/Muntz_Jet","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d1/Muntz_vehicles_04.jpg","page_title":"Muntz Jet","context_page_description":"The Muntz Jet is a two-door hardtop convertible built by the Muntz Car Company in the United States between approximately 1949 and 1954. It is sometimes credited as the first personal luxury car. Developed from the Kurtis Sport Car that was designed by Frank Kurtis, it was produced and marketed by Earl \\"Madman\\" Muntz. The car was powered by one of two V8 engines, either a 160 hp Cadillac engine or a 160 hp Lincoln engine, and it was equipped with either a General Motors Hydramatic automatic transmission or a three-speed Borg-Warner manual transmission. The Jet was streamlined, featured numerous luxury appointments, and was equipped with safety features that were not standard on most cars of its day, including a padded dashboard and seat belts.\\nProduction of the Muntz Jet occurred in Glendale, California; Evanston, Illinois; and Chicago before ceasing in 1954. The car sold for $5,500 in 1953, but cost $6,500 to produce. In total, Muntz lost approximately $400,000 on the venture. Only 198 Jets were built, an estimated 50 to 130 of which are still in existence. By 2016, fully restored cars had sold for over $100,000 at auction."},{"page_url":"https://vi.wikipedia.org/wiki/Mammillaria_schwarzii","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7e/Mammillaria_schwarzii.jpg","page_title":"Mammillaria schwarzii","context_page_description":"Mammillaria schwarzii là một loài thực vật có hoa trong họ Cactaceae. Loài này được Shurly mô tả khoa học đầu tiên năm 1949."},{"page_url":"https://cs.wikipedia.org/wiki/Ronovec","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a5/Ronovec.JPG","page_title":"Ronovec","context_page_description":"Ronovec je hrad, který se nachází na odbočce ze žluté turistické značky mezi Chotěboří a Havlíčkovým Brodem poblíž obce Břevnice. Od roku 1963 je chráněn jako kulturní památka."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%9E%D1%80%D0%B4%D0%B5%D0%BD_%D0%92%D0%B5%D0%BB%D0%B8%D0%BA%D0%BE%D0%B3%D0%BE_%D0%BA%D0%BD%D1%8F%D0%B7%D1%8F_%D0%9B%D0%B8%D1%82%D0%BE%D0%B2%D1%81%D0%BA%D0%BE%D0%B3%D0%BE_%D0%93%D1%8F%D0%B4%D0%B8%D0%BC%D0%B8%D0%BD%D0%B0%D1%81%D0%B0","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/19/Gedimino_riterio_kryzius.png","page_title":"Орден Великого князя Литовского Гядиминаса","context_page_description":"Орден Великого князя Литовского Гедими́наса — государственная награда Литовской Республики.\\nОрден был учреждён в 1928 году для награждения литовских и иностранных граждан за усердный и честный труд на государственной службе или в общественной деятельности.\\nОрден Великого князя Литовского Гядиминаса имеет пять степеней и медаль ордена."},{"page_url":"https://hr.wikipedia.org/wiki/Matilda_Francuska","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/84/Mathilde_de_France.jpg","page_title":"Matilda Francuska","context_page_description":"Matilda Francuska bila je kraljica Burgundije kao supruga kralja Konrada Miroljubivog."},{"page_url":"https://es.wikipedia.org/wiki/Uhldingen-M%C3%BChlhofen","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/62/Birnau_Schloss_Maurach.jpg","page_title":"Uhldingen-Mühlhofen","context_page_description":"Uhldingen-Mühlhofen es un municipio alemán situado en el distrito del lago de Constanza, Baden-Wurtemberg. Consiste de Unteruhldingen, Oberuhldingen y Mühlhofen. Está ubicado en la orilla norte del lago de Constanza.​"},{"page_url":"https://no.wikipedia.org/wiki/Caribbean_Airlines","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d2/Caribbean_Airlines_Boeing_737-800_9Y-TAB_%288504733249%29.jpg","page_title":"Caribbean Airlines","context_page_description":"Caribbean Airlines er et flyselskap på Trinidad og Tobago som flyr til destinasjoner i Karibia, USA og Canada. Flyselskapet tok i 2010 også over flyselskapet Air Jamaica."},{"page_url":"https://zh.wikipedia.org/wiki/SIG_MG_710-3%E9%80%9A%E7%94%A8%E6%A9%9F%E6%A7%8D","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/ce/SIG_MG_710-3.jpg","page_title":"SIG MG 710-3通用機槍","context_page_description":"SIG MG 710-3是一款由瑞士工業公司所研製和生產的通用機槍，發射7.62×51公釐北約口徑步槍子彈。\\n由於瑞士軍隊已經採用由聯邦武器工廠生產的7.5公釐口徑MG 51通用機槍，該武器的原型槍經修改以後作為商業投資而研發並主要用於出口。"},{"page_url":"https://en.wikipedia.org/wiki/Middleport,_Pennsylvania","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d5/Borough_Sign%2C_Middleport_PA.JPG","page_title":"Middleport, Pennsylvania","context_page_description":"Middleport is a borough in Schuylkill County, Pennsylvania, United States. The population was 405 at the 2010 census. The town was named for being mid-point of 16-mile distance between Pottsville and Tamaqua."},{"page_url":"https://eu.wikipedia.org/wiki/Inkisizioa","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7c/Torture_Inquisition.jpg","page_title":"Inkisizioa","context_page_description":"Inkisizioa Eliza Katolikoaren barnean heresia ezabatzen jarduten zuten hainbat erakunde izendatzeko erabiltzen da. Heretikoak aurkitu eta zigortzeko sortutako eliz auzitegi iraunkorra zen. Zuzenbide kanonikoaren kontrako aginpideak ere zigortzen zituzten.\\nErdi Aroko inkisizioa, beste guztien oinarria, 1184an sortu zen Languedocen albitar eta kataroen heresiari aurka egiteko. 1249an ere Aragoiko Erresuman ere ezarri zen eta Aro Modernoan, Espainiar Inkisizioaren izenarekin Aragoi eta Gaztelaren elkarketarekin hedatu zen. Espainiaren kontrolpean egonik, Amerikaren eremuetara zabaldu ziren. Jarraian sortu ziren Portugaldar Inkisizioa eta Erromatar Inkisizioa.\\nInkisidoreak polizia-indar bat ziren, jendearen salaketen bidez heretiko ustekoak atxilotu eta epaitzen zituztenak. XIII. mendetik, aitorpenak lortzeko, torturatu egiten zuten eta errudunei zigor arin bat edota gogor bat aplikatzen zitzaien.\\n1834an desagertu zen behin betiko Inkisizioa eta Pio X.ak 1908an Fedearen Doktrinarako Kongregazioa sortu zuen haren ordez."},{"page_url":"https://en.wikipedia.org/wiki/Stokke","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/13/Stokke_stasjon_TRS_070725_002.jpg","page_title":"Stokke","context_page_description":"Stokke is a town in Sandefjord municipality in Vestfold County, Norway. It lies in-between Sandefjord and Tønsberg, two of Vestfold’s largest cities. It was a municipality from 1838 to 2016. The administrative centre of the municipality was the village of Stokke, while minor villages were Vear, Melsomvik, Storevar, and Valberg.\\nOn 1 January 2017, the municipality, along with Andebu, became a part of Sandefjord municipality. The village of Vear was transferred from Stokke to neighboring Tønsberg on the same day. The town of Stokke was home to 3,391 inhabitants as of 2016. The decision to merge into Sandefjord was part of a nationwide municipal reform by the Solberg Cabinet. 77.8 percent of Stokke residents voted to merge into Sandefjord during the September 2015 elections."},{"page_url":"https://it.wikipedia.org/wiki/Cidaroida","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/13/Reef0228.jpg","page_title":"Cidaroida","context_page_description":"Cidaroida Claus, 1880 è un ordine di Echinodermata, l'unico ordine della sottoclasse Cidaroidea."},{"page_url":"https://arz.wikipedia.org/wiki/%D8%AA%D9%8A%D9%85_%D8%A8%D8%B1%D8%A7%D9%88%D9%86_(%D9%84%D8%A7%D8%B9%D8%A8_%D9%83%D9%88%D8%B1%D8%A9_%D9%82%D8%AF%D9%85)","image_url":"http://upload.wikimedia.org/wikipedia/commons/9/95/Tim_Brown_%28footballer%29.jpg","page_title":"تيم براون (لاعب كورة قدم)","context_page_description":"الصفحه دى يتيمه, حاول تضيفلها لينك فى صفحات تانيه متعلقه بيها.\\nتيم براون لاعب كورة قدم من نيوزيلاندا."},{"page_url":"https://cy.wikipedia.org/wiki/Afon_Shannon","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/01/Limerick_-_Shannon_River_cropped.jpg","page_title":"Afon Shannon","context_page_description":"Afon Shannon yw afon fwyaf Iwerddon. Yn cynnwys yr aber, mae'n 386 km o hyd. Mae'n debyg mai'r afon yma yw Afon Llinon y cyfeirir ati yn chwedl Branwen ferch Llŷr ym Mhedair Cainc y Mabinogi.\\nMae'r afon yn rhannu gorllewin a dwyrain yr ynys; dim ond mewn llai nag ugain man y gellir ei chroesi rhwng Carrick on Shannon yn y gogledd a'i haber ger Limerick, lle mae'n ymuno a Môr Iwerydd.\\nYn draddodiadol, ceir tarddle'r afon yn y Shannon Pot, pwill bychan ar lechweddau Mynydd Cuilcagh yn Swydd Cavan. Mae'n llifo trwy 13 o siroedd Iwerddon, a thrwy nifer o lynnoedd, yn cynnwys Lough Allen, Lough Ree a Lough Derg."},{"page_url":"https://de.wikipedia.org/wiki/Bahnstrecke_Bever%E2%80%93Scuol-Tarasp","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e2/Bahnhof_Zuoz_GR.jpg","page_title":"Bahnstrecke Bever–Scuol-Tarasp","context_page_description":"Die Bahnstrecke Bever–Scuol-Tarasp, auch Engadinerbahn, Engadinerlinie, Unterengadinerbahn oder Unterengadinerlinie genannt, ist eine meterspurige Schweizer Schmalspurbahn. Sie wird von der Rhätischen Bahn betrieben und verbindet das Unterengadin mit der Albulabahn. Oft wird auch die Pontresinerlinie der hier behandelten Strecke zugerechnet. Beide Strecken sind betrieblich eng miteinander verbunden. Die Bahnstrecke Bever–Scuol-Tarasp gehört zum RhB-Stammnetz, die Kilometrierung hat deshalb ihren Nullpunkt in Landquart."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%9F%D0%B0%D0%BC%27%D1%8F%D1%82%D0%BA%D0%B8_%D0%B0%D1%80%D1%85%D1%96%D1%82%D0%B5%D0%BA%D1%82%D1%83%D1%80%D0%B8_%D0%86%D0%B2%D0%B0%D0%BD%D0%BE-%D0%A4%D1%80%D0%B0%D0%BD%D0%BA%D1%96%D0%B2%D1%81%D1%8C%D0%BA%D0%B0","image_url":"https://upload.wikimedia.org/wikipedia/uk/f/f0/%D0%9A%D0%BE%D0%BF%D0%B5%D1%80%D0%BD%D1%96%D0%BA%D0%B0_14.JPG","page_title":"Пам'ятки архітектури Івано-Франківська","context_page_description":"В Івано-Франківську нараховується 5 пам'яток архітектури національного значення, та 529 місцевого значення, що внесені до Державного реєстру нерухомих пам'яток України.\\n№\\nНайменування пам'ятки\\nСвітлина\\nДатування\\nМісцезнаходження\\nНомерКороткі відомості"},{"page_url":"https://nl.wikipedia.org/wiki/Lijst_van_gemeentelijke_monumenten_in_Pijnacker-Nootdorp","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4d/Noordeindseweg_76%2C_Delfgauw.jpg","page_title":"Lijst van gemeentelijke monumenten in Pijnacker-Nootdorp","context_page_description":"De gemeente Pijnacker-Nootdorp telt 85 gemeentelijke monumenten. Zie ook de rijksmonumenten in Pijnacker-Nootdorp."},{"page_url":"https://es.wikipedia.org/wiki/Pierre_Puget","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/03/Vieille_Charit%C3%A9.jpg","page_title":"Pierre Puget","context_page_description":"Pierre Puget, fue un escultor, dibujante, pintor y ocasional arquitecto francés, uno de los introductores del arte barroco en el país. Fue celebrado por muchos autores en los siglo XVIII y XIX como «el Miguel Ángel de Francia», uno de los representantes del espíritu clásico francés del Grand siècle en la escultura, como lo fue Nicolas Poussin para la pintura. A la vez artista y artesano, puede ser considerado como un ejemplo de un creador completo, cuyo talento trasciende las técnicas.​\\nAl inicio de su carrera se desplazó desde su ciudad natal hasta Roma, donde tuvo a Pietro da Cortona como maestro entre 1640 y 1643. Desarrolló su carrera entre Marsella y Toulon. Entre sus primeros trabajos dignos de mención se encuentra la decoración escultórica del ayuntamiento de Toulon. Tras una segunda estancia en Italia trabajó en Toulon en los astilleros de la ciudad donde se ocupó de la decoración de barcos, mientras como arquitecto diseñaba edificios en Aix-en-Provence y en Marsella.\\nComo escultor sus obras más conocidas son el Milón de Crotona y El encuentro de Alejandro con Diógenes, dos de las pocas obras aceptadas por la Corte de Paris, para la decoración de las residencias reales."},{"page_url":"https://zh.wikipedia.org/wiki/%E6%B5%B7%E5%9B%A0%E9%87%8C%E5%B8%8C%C2%B7%E5%B8%8C%E5%A7%86%E8%8E%B1","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4b/Bundesarchiv_Bild_102-02134%2C_Bad_Harzburg%2C_Gr%C3%BCndung_der_Harzburger_Front.jpg","page_title":"海因里希·希姆莱","context_page_description":"海因里希·魯伊特伯德·希姆萊是納粹德國的一名重要政治頭目，曾為內政部長、親衛隊首領，被認為對歐洲600萬名猶太人、同性戀者、共產黨人和20萬至50萬名羅姆人的大屠殺以及許多武裝親衛隊的戰爭罪行負有主要責任。二次大戰末期企圖與盟軍單獨談和失敗，德國二戰投降後，被盟軍拘留，服毒自殺。德國《明鏡》週刊中對希姆萊的評價是「有史以來最大的劊子手」。"},{"page_url":"https://nl.wikipedia.org/wiki/Blindsee","image_url":"http://upload.wikimedia.org/wikipedia/commons/6/63/Blindsee_Ansicht.jpg","page_title":"Blindsee","context_page_description":"De Blindsee is een meer in Oostenrijk in de buurt van Biberwier.\\nHet meer is gelegen in de buurt van het hoogste punt van de Fernpass. Het meer ligt ongeveer 3 kilometer van de plaats Biberwier. De Fernpassstraße bevindt zich ten zuiden van het meer. Zestien kilometer van het meer bevindt zich het hoogste punt van Duitsland, de Zugspitze. Door het heldere water wordt in het meer aan duiksport gedaan."},{"page_url":"https://sv.wikipedia.org/wiki/Takamatsu_(stad)","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/57/150504_Takamatsu_Station_Takamatsu_Kagawa_pref_Japan02s3.jpg","page_title":"Takamatsu (stad)","context_page_description":"Takamatsu är residensstad i Kagawa prefektur på ön Shikoku i Japan. Staden fick stadsrättigheter 1890 och har sedan 1999\\nstatus som kärnstad enligt lagen om lokalt självstyre."},{"page_url":"https://hu.wikipedia.org/wiki/Textilanyagok_sz%C3%ADntart%C3%B3s%C3%A1ga","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7f/Sz%C3%BCrke_sk%C3%A1la.jpg","page_title":"Textilanyagok színtartósága","context_page_description":"A textilanyagok színtartóságán a színes textilanyag színének viselkedését kell érteni a különböző vegyi és mechanikai hatásokkal, továbbá a napfénnyel szemben. A színtartóságot alapvetően két szempont szerint lehet megítélni: egyrészt aszerint, hogy az anyag eredeti színe hogyan, milyen mértékben változik meg, másrészt abból a szempontból, hogy milyen mértékben színez el egy másik anyagot. Nyilvánvalóan az az előnyös, ha az anyag színe nem változik meg észrevehetően, és ha mosás vagy más kezelés során róla a színezék nem kerül át a vele érintkező másik anyagra.\\nA színes textiltermékek minőségét alapvetően befolyásolja azok színtartósága. Ez az egyik legfontosabb olyan tulajdonságuk, amelynek alapján a felhasználó megítéli a termék használhatóságát."},{"page_url":"https://pl.wikipedia.org/wiki/Styl_neorosyjski","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1f/Alexander-Newski-Kathedrale_full_pc.jpg","page_title":"Styl neorosyjski","context_page_description":"Styl neorosyjski – początkowo głównie styl architektoniczny w sztuce rosyjskiej, powstały na przestrzeni lat 20. i 30. XIX wieku i rozwijany do 1918 roku oraz ponownie od 1991 roku do dziś. Od połowy XIX do początku XX wieku styl uległ zróżnicowaniu na szereg nurtów odwołujących się do różnych okresów w przedbarokowej architekturze rosyjskiej. Wykształcenie się stylu neorosyjskiego wynikało z prób poszukiwań rosyjskiego stylu narodowego zapoczątkowanych w okresie romantyzmu. W XIX wieku styl neorosyjski był obok stylów klasycystycznego i neobizantyjskiego podnoszony do rangi oficjalnego stylu Cesarstwa Rosyjskiego. Z czasem styl znalazł swoje odzwierciedlenie również w pozostałych dziedzinach sztuki i rzemiosła, m.in. rzeźbiarstwie, malarstwie, grafice, meblarstwie, złotnictwie, ceramice."},{"page_url":"https://pt.wikipedia.org/wiki/Santu%C3%A1rio_de_F%C3%A1tima","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c8/Fatima_0210_%2819477169598%29_%28cropped%29.jpg","page_title":"Santuário de Fátima","context_page_description":"O Santuário de Fátima, formalmente intitulado pela Igreja Católica como Santuário de Nossa Senhora do Rosário de Fátima, é um santuário mariano dedicado a Nossa Senhora de Fátima, localizado no lugar da Cova da Iria, na cidade de Fátima, concelho de Ourém, em Portugal.\\nO Santuário de Fátima é, por excelência, um local de peregrinação cristã e devoção católica, preservando a memória dos acontecimentos que levaram à sua fundação, nomeadamente as aparições de Nossa Senhora aos três pastorinhos – Lúcia dos Santos, Francisco e Jacinta Marto – em 1917. A sua magnitude e relevância do ponto de vista religioso é de há muito consensualmente reconhecida, nacional e internacionalmente. Por vontade expressa da Santa Sé Apostólica, este é um Santuário Nacional. É também um dos mais importantes santuários marianos do mundo pertencentes à Igreja Católica e de maior destino internacional de turismo religioso, recebendo cerca de seis milhões de visitantes por ano. Foi distinguido com três rosas de ouro papais e visitado pelos Papas Paulo VI, João Paulo II, Bento XVI e Francisco."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%9F%D0%BE%D0%B9%D0%BD%D1%82-%D0%9F%D0%BB%D0%B5%D0%B7%D0%B0%D0%BD%D1%82_(%D0%9D%D1%8C%D1%8E-%D0%94%D0%B6%D0%B5%D1%80%D1%81%D0%B8)","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b7/Line1373_-_Flickr_-_NOAA_Photo_Library.jpg","page_title":"Пойнт-Плезант (Нью-Джерси)","context_page_description":"Пойнт-Плезант — боро в округе Оушен, штат Нью-Джерси, США. В 2010 году в боро проживало 18 392 человек."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%9D%D0%B0%D1%80%D0%BE%D0%B4%D0%BD%D0%B0%D1%8F_%D0%B0%D1%80%D0%BC%D0%B8%D1%8F","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/52/%D0%9F%D0%BE%D0%B4%D0%BF%D0%BE%D0%BB%D0%BA%D0%BE%D0%B2%D0%BD%D0%B8%D0%BA_%D0%9D%D0%B0%D1%80%D0%BE%D0%B4%D0%BD%D0%BE%D0%B9_%D0%B0%D1%80%D0%BC%D0%B8%D0%B8.png","page_title":"Народная армия","context_page_description":"Наро́дная а́рмия — вооружённое формирование КОМУЧа, одно из первых формирований белых войск на Востоке России во время Гражданской войны. Объединив отдельные небольшие антисоветские отряды Поволжья, Народная армия позволила установить контроль над обширной территорией Поволжья и Прикамья и совместно с командованием Чехословацкого корпуса создать общий антисоветский фронт в Поволжье.\\nПервоначально строилась на добровольческой основе с 3-месячным сроком службы, но уже 30 июня была проведена мобилизация мужчин 1897—1898 гг. рождения, что позволило увеличить численность армии с 10 до 30 тыс. чел. В конце июня были развернуты 8 пехотных полков. В середине августа была объявлена мобилизация офицеров. По мере расширения контролируемых территорий в армию переходили многие офицеры, проживавшие в этих местах или служившие в красных учреждениях. Так, в Симбирске после взятия города 22 июля из местных офицеров был сформирован батальон, в тот же день выступивший на позиции. Сразу же после взятия Казани в начале августа здесь были сформированы две офицерские роты общей численностью 600—700 чел., в том числе за счёт слушателей находившейся в городе Академии Генерального штаба."},{"page_url":"https://pt.wikipedia.org/wiki/Grupo_Divulga%C3%A7%C3%A3o","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/54/Giran%C3%A7a.jpg","page_title":"Grupo Divulgação","context_page_description":"O Centro de Estudos Teatrais - Grupo Divulgação, chamado de \\"Grupo Divulgação\\" ou apenas \\"GD\\" é um núcleo de ensino, pesquisa e extensão em artes cênicas, que se iniciou como um grupo de teatro universitário, nascido na antiga Faculdade de Filosofia e Letras, em Juiz de Fora, Minas Gerais, no ano de 1966. Está em atividade ininterrupta desde a sua fundação e, a partir de 1971, passou a exercer as suas atividades no Forum da Cultura. Ao longo de sua trajetória, o Grupo Divulgação produziu mais de 200 peças teatrais, dentre clássicos da dramaturgia universal, de autores como Federico Garcia Lorca, Górki, Anton Tchekhov, Shakespeare, Molière e Pirandello até textos da dramaturgia nacional, como obras de Nelson Rodrigues e Oswald de Andrade. O grupo também produziu um número considerável de peças originais, escritas por seu fundador e diretor José Luiz Ribeiro, dentre as quais destacam-se as premiadas Girança, de 1985/86, e A Escada de Jacó, encenada em 1995/96."},{"page_url":"https://pl.wikipedia.org/wiki/Dittersdorf_(Turyngia)","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/29/Dittersdorf_in_SOK.png","page_title":"Dittersdorf (Turyngia)","context_page_description":"Dittersdorf – miejscowość i gmina w Niemczech, w kraju związkowym Turyngia, w powiecie Saale-Orla, wchodzi w skład wspólnoty administracyjnej Seenplatte.\\n31 grudnia 2013 do gminy przyłączono gminę Chursdorf, która stała się jej dzielnicą."},{"page_url":"https://nds.wikipedia.org/wiki/Guido_Westerwelle","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/66/Westerwelle_Bundesparteitag.jpg","page_title":"Guido Westerwelle","context_page_description":"Guido Westerwelle weer en düütsch Politiker. He weer vun 1994 bit 2001 Generalsekretär un vun 2001 bit Mai 2011 Bundsvörsitter vun de FDP. In de Johren vun 2009 bit 2013 weer he Butenminister vun Düütschland un bit Mai 2011 togliek ok Viezkanzler. 2014 hett he sik ut de aktive Politik torüchtagen, as bekannt worrn is, dat he akut an Leukämie lieden de. 2016 is he an de Krankheit doodbleven."},{"page_url":"https://de.wikipedia.org/wiki/Nelson-Nasenb%C3%A4r","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5c/Cozumel_Raccoon_area.png","page_title":"Nelson-Nasenbär","context_page_description":"Der Nelson-Nasenbär, auch als Insel- oder Cozumel-Nasenbär bezeichnet ist eine Raubtierart aus der Familie der Kleinbären. Nelson-Nasenbären sind auf der Insel Cozumel, die der mexikanischen Halbinsel Yucatán vorgelagert ist, endemisch."},{"page_url":"https://eu.wikipedia.org/wiki/Zuasti","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1a/E3d_txikia.png","page_title":"Zuasti","context_page_description":"Zuasti Nafarroa Garaiko herria da, Itza udalerrikoa. Gulibarrekin batu baino lehen, Itza zendeako herria zen. 217 biztanle zituen 2007an."},{"page_url":"https://en.wikipedia.org/wiki/List_of_Olympic_venues_in_short_track_speed_skating","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/aa/Hamar_Olympic_Amfi_2006.JPG","page_title":"List of Olympic venues in short track speed skating","context_page_description":"For the Winter Olympics, there are eight venues that have been or will be used for short track speed skating. The 1988 events were held at the same venue with the curling events though both were demonstration events. Since then, the short track speed skating events have been held with the figure skating events."},{"page_url":"https://az.wikipedia.org/wiki/Qaray%C3%BCzl%C9%99r","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d6/Black-hundred1907.jpg","page_title":"Qarayüzlər","context_page_description":"Qarayüzler, 20-ci əsrin əvvəllərində Rusiya İmperiyasında fəaliyyət göstərmiş çar rejimi tərəfdarı və inkişaf etməkdə olan sosialist inqilabçı hərəkətə qarşı təşkilatlanmış bir hərəkət idi. Xüsusilə inqilabçılar qarşı tətbiq etdiyi şiddət, həddindən artıq milliyyətçilik və Yəhudi əleyhdarlığıyla önə çıxmış, çox sayda talan reallaşdırmışdır."},{"page_url":"https://et.wikipedia.org/wiki/Mustj%C3%B5e_raudteepeatus","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6f/Mustj%C3%B5e_raudteepeatuse_vanad_perroonid%2C_6._august_2011.jpg","page_title":"Mustjõe raudteepeatus","context_page_description":"Mustjõe raudteepeatus on raudteepeatus Anija vallas Mustjõe külas, Tallinnast 48 km kaugusel.\\nPeatus kanti esmakordselt topograafilisele kaardile aastast 1935. Toona jäi see Lehtse valda. Peatus avati taas aastal 1978 seoses elektriraudtee laiendamisega Aegviiduni, mil see jäi Aegviidu külanõukogu territooriumile.\\nMustjõel on kaks 30-meetrist perrooni. Sisenemine ja väljumine toimub rongi C-ala kaudu.\\nSeoses üleminekuga madalatele rongidele rajati Mustjõele uued perroonid.\\nRong sõidab Balti jaamast Mustjõele umbes 43 minutit. Mustjõel peatuvad vaid Tallinna–Aegviidu tavaliini elektrirongid, kokku peatub Mustjõel umbes 17 reisirongi päevas. Piletihinnalt kuulub peatus IV tsooni.\\nKüla ja raudteepeatus on nime saanud küla läheduses voolava Jägala jõe lisajõe Mustjõe järgi. Peatuse juures on säilinud hapnikuvabriku hooned."},{"page_url":"https://de.wikipedia.org/wiki/Obergaden","image_url":"http://upload.wikimedia.org/wikipedia/commons/2/2b/Marienkirche_L%C3%BCbeck_Mittelschiff_1.jpg","page_title":"Obergaden","context_page_description":"Der Obergaden, auch als Lichtgaden oder Fenstergaden bezeichnet, ist die obere Wandfläche des Mittelschiffs einer Basilika.\\nDer Obergaden befindet sich über den Dächern der Seitenschiffe und ist mit Fenstern durchbrochen. Ähnlich einer Dachlaterne ermöglicht der Obergaden als von Fenstern durchbrochene Wand von Hochschiff und Hochchor eine direkte Belichtung des Mittelschiffes. Die Fenster an den Außenwänden der Seitenschiffe werden in Gegenüberstellung zum Obergaden auch als Untergaden bezeichnet.\\nIm Gegensatz zur Basilika ist das Mittelschiff einer Hallenkirche ohne Obergaden und wird von den Fenstern der Seitenschiffe belichtet. Ist der Obergaden deutlich ausgebildet aber fensterlos, spricht man von einer Pseudobasilika. Bei Staffelhallen ragt das Mittelschiff zwar auch höher als die Seitenschiffe, aber es gibt keine oder kaum Wände über den Arkaden."},{"page_url":"https://zh.wikipedia.org/wiki/%E8%A7%92%E5%9B%9E","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/21/Slide4HAN.JPG","page_title":"角回","context_page_description":"角回为大脑顶叶的一个区域，位于颞叶上缘及缘上回正后方。角回与语言、空间感、记忆提取、专注力，以及心智理论有关。角回在布氏皮质分区中对应于第39区。"},{"page_url":"https://he.wikipedia.org/wiki/%D7%9B%D7%A8%D7%99%D7%A1%D7%98%D7%99%D7%90%D7%9F_%D7%A4%D7%99%D7%93%D7%9C%D7%A8","image_url":"http://upload.wikimedia.org/wikipedia/commons/b/b9/Christian_Fiedler.jpg","page_title":"כריסטיאן פידלר","context_page_description":"כריסטיאן פידלר הוא כדורגלן עבר גרמני ששיחק בעמדת השוער בהרטה ברלין, ומאמן שוערים בהווה בקבוצת גרויטר פירט."},{"page_url":"https://ur.wikipedia.org/wiki/%D8%AF%D9%88%D8%AF%DA%BE","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0e/Milk_glass.jpg","page_title":"دودھ","context_page_description":"دودھ يا شير عام طور پر ایک سفید مائع ہوتا ہے جو ممالیہ کے تھن سے نکلتا ہے جیسے کہ گائے کا دودھ یا انسانی دودھ۔ یہ مائع ممالیہ غدودوں میں پیدا ہوتا ہے جسے مادہ ممالیہ کے پستان، تھن وغیرہ کہا جاتا ہے۔ چونکہ نومولود ممالیہ بچوں کے دانت پیدائش کے وقت موجود نہیں ہوتے اس لیے ان کودودھ کی ضرورت ہوتی ہے اور یہ ضرورت اس وقت تک باقی رہتی ہے جب تک کہ ان کے مکمل دانت ٹھوس خوراک کھانے کے قابل نہیں ہو جاتے۔ دودھ میں موجود غذائی اجزاء ممالیہ مچوں کی افزائش اور نشو و نما میں بھی مددگار ثابت ہوتا ہے۔"},{"page_url":"https://fr.wikipedia.org/wiki/Frederick_Ingersoll","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6d/LunaParkPostcarHeartOfConeyIsland.jpg","page_title":"Frederick Ingersoll","context_page_description":"Frederick Ingersoll, né en 1876, est un inventeur, concepteur et constructeur qui a créé la première chaîne mondiale de parcs d'attractions et dont l'entreprise de fabrication d'attractions comptabilise 277 montagnes russes qui ont alimenté les trolley parks dans le premier tiers du XXᵉ siècle. Certains de ces parcs et certaines montagnes russes sont toujours opérationnels aujourd'hui."},{"page_url":"https://la.wikipedia.org/wiki/Iurie_Leanc%C4%83","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4b/Iurie_Leanc%C4%83_Senate_of_Poland.JPG","page_title":"Iurie Leancă","context_page_description":"Iurie Leancă est politicus Moldaviae et ab anno 2013 ad 2015 primus minister.\\nIurie Leancă alumnus est Instituti Nationalis Coniunctionum Internationalium Moscuensis. E quo absolutus iuxta ministerium rerum externarum Sovieticum operam dedit, Bucarestae apud legationem Sovieticam anno 1989 degens. Ab anno 1993 se ad ministerium rerum externarum Moldavicum iunxit et Vasingtoniae usque ad annum 1997 minister consiliarius meruit. In rectione Moldaviae annis 1998-2001 minister vicarius rerum externarum fuit atque a die 27 Iulii ad 4 Septembris 2001 locum tenuit pro ministro futuro. Ab anno 2009 sodalis est factionis liberalis democraticae. Minister rerum externarum et pro integratione Europaea die 25 Septembris 2009 factus est, primo ministro Vlad Filat. Id officium usque ad 30 Maii 2013 tenuit, quo die, successor eodem Filat, primus minister electus est. Consilio ministrorum ab eo proposito a legatis parlamenti reiecto, officium primi ministri die 14 Februarii 2015 reliquit, successore Cyrillo Gaburici. Die 9 Ianuarii 2018 primus minister vicarius ab integratione Europaea factus est, primo ministro Paulo Filip."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Kirchen_im_Bistum_M%C3%BCnster","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/22/Herz-Jesu-Kirche_1_%28M%C3%BCnster%29.JPG","page_title":"Liste der Kirchen im Bistum Münster","context_page_description":"Diese Liste der Kirchen im Bistum Münster listet die römisch-katholischen Kirchen und Kapellen im Bistum Münster auf."},{"page_url":"https://en.wikipedia.org/wiki/Tourist_Drives_in_Western_Australia","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/48/Kings_park_gnangarra_23.jpg","page_title":"Tourist Drives in Western Australia","context_page_description":"Tourist Drives in Western Australia are routes through areas of scenic or historic significance, designated by route markers with white numbers on a brown shield. Tourist Drives were introduced into Western Australia while Eric Charlton was the state government Minister for Transport in the 1990s. The 28 numbered routes collectively traverse more than 2,000 kilometres across the state. In addition to the Tourist Drives, there are unnumbered routes such as the Golden Pipeline Heritage Trail, and local governments may designate and maintain local scenic drives, generally unnamed and unnumbered."},{"page_url":"https://en.wikipedia.org/wiki/Lin%C4%91o","image_url":"http://upload.wikimedia.org/wikipedia/commons/6/68/Lindjo.jpg","page_title":"Linđo","context_page_description":"Linđo is a popular dance of Dubrovnik and the Dubrovnik region of Croatia. It is danced to the accompaniment of lijerica, which came from the Eastern Mediterranean in the late 18th century and spread on the Adriatic coast in the 19th century.\\nIt is now extensively performed in the Dubrovnik's coastal region, in Konavle area, in Dubrovačko Primorje on the Pelješac Peninsula and on the islands of Mljet and Lastovo as well as parts of Herzegovina. In the past, it was performed exclusively to the accompaniment of the bellows. The dance master plays sitting, with lijerica on his left knee, while stamping with his right foot, thus dictating rhythm to the dancers. They move in a circle around the dance master, who gives commands. He also decides who will dance with whom and dictates the change of dance figures, along with encouraging the dancers to compete in improvisations.\\nThe tradition of Lindjo is kept alive by Dubrovnik's The Folklore Ensemble Lindjo."},{"page_url":"https://pt.wikipedia.org/wiki/Scotophilus","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/49/Yellow_bat_Scotophilus.jpg","page_title":"Scotophilus","context_page_description":"Scotophilus é um gênero de morcegos da família Vespertilionidae, encontrado na África e Ásia."},{"page_url":"https://pl.wikipedia.org/wiki/Ouro_Branco_(Minas_Gerais)","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/53/Ourobranco-santoantonio.jpg","page_title":"Ouro Branco (Minas Gerais)","context_page_description":"Ouro Branco – miasto i gmina w Brazylii, w stanie Minas Gerais. Znajduje się w mezoregionie Metropolitana de Belo Horizonte i mikroregionie Conselheiro Lafaiete."},{"page_url":"https://de.wikipedia.org/wiki/Klaas-Jan_Huntelaar","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5f/Salto_portero_%283464142486%29.jpg","page_title":"Klaas-Jan Huntelaar","context_page_description":"Klaas-Jan Huntelaar ist ein niederländischer Fußballspieler. Der Stürmer, dessen Spitzname The Hunter ist, steht seit 2017 bei Ajax Amsterdam unter Vertrag und absolvierte 74 A-Länderspiele für die Niederlande."},{"page_url":"https://pl.wikipedia.org/wiki/Jerzy_Kolecki","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3e/POL_Rabka-Zdr%C3%B3j_COA.svg","page_title":"Jerzy Kolecki","context_page_description":"Jerzy Kolecki – polski nauczyciel, malarz, współzałożyciel i wieloletni dyrektor Teatru Lalek Rabcio i twórca herbu Rabki-Zdroju."},{"page_url":"https://ur.wikipedia.org/wiki/%DA%A9%D9%88%D9%84%D9%85%D8%A7%D8%8C_%DA%A9%DB%8C%D9%84%DB%8C%D9%81%D9%88%D8%B1%D9%86%DB%8C%D8%A7","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/42/Seal_of_Colma%2C_California.png","page_title":"کولما، کیلیفورنیا","context_page_description":"کولما، کیلیفورنیا ریاستہائے متحدہ امریکا کا ایک شہر جو سان ماتیو کاؤنٹی، کیلیفورنیا میں واقع ہے۔"},{"page_url":"https://ja.wikipedia.org/wiki/%E6%9C%A8%E6%9A%AE%E6%AD%A6%E5%A4%AA%E5%A4%AB_(1860%E5%B9%B4%E7%94%9F%E3%81%AE%E6%94%BF%E6%B2%BB%E5%AE%B6)","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/82/Budayu_Kogure_%281860_birth%29.png","page_title":"木暮武太夫 (1860年生の政治家)","context_page_description":"木暮 武太夫は、明治期の政治家・衆議院議員、群馬県会議員、実業家。伊香保電気軌道社長。高崎水力電気、伊香保鉱泉場組合各取締役。族籍は群馬県平民。"},{"page_url":"https://it.wikipedia.org/wiki/Minami_Iwo_Jima","image_url":"http://upload.wikimedia.org/wikipedia/commons/6/62/Minami-ioto.jpg","page_title":"Minami Iwo Jima","context_page_description":"Minami Iwo Jima è la più meridionale delle Isole Vulcano, arcipelago di isole appartenente al raggruppamento più vasto delle Isole Ogasawara.\\nL'isola sorge a 1 300 km a sud di Tokyo."},{"page_url":"https://de.wikipedia.org/wiki/Poppekerke","image_url":"http://upload.wikimedia.org/wikipedia/commons/8/8e/Ruin_church_tower_poppekerke_1851.jpg","page_title":"Poppekerke","context_page_description":"Poppekerke war ein Dorf in der heutigen Gemeinde Veere in der niederländischen Provinz Zeeland. Es befand sich östlich von Westkapelle auf Walcheren.\\nPoppekerke wurde erstmals erwähnt, als der Ort als selbstständige Parochie 1271 von St. Willibrord in Westkapelle abgepfarrt wurde. Im Zuge des Achtzigjährigen Krieges wurde die dem heiligen Petrus geweihte gotische Pfarrkirche von Popperkerke um 1574 verwüstet. 1577/78 nutzte man Material der Kirche, um St. Johannes in Domburg wieder herzurichten. Die Ruine der Kirche wurde schließlich 1851 abgerissen. Im Zuge des 19. Jahrhunderts wurde auch der Vliedberg von Poppekerke abgetragen. 1816 ging die Gemeinde Westkapelle-Buiten en Sirpoppekerke in Westkapelle auf.\\nHeute erinnert an den Ort nur noch eine Straßenbezeichnung.\\nAuch ein Ortseingangs- und Ausgangsschild sind dort aufgestellt."},{"page_url":"https://es.wikipedia.org/wiki/Tlalnepantla_de_Baz","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/65/Bodegas_tlalnepantla.jpg","page_title":"Tlalnepantla de Baz","context_page_description":"Tlalnepantla de Baz es una Ciudad y uno de los 125 municipios del Estado de México. Se ubica al norte de la Ciudad de México. Es uno de los más industrializados y con una gran actividad económica en servicios y comercios a nivel nacional.\\nSu territorio está dividido desde 1899 en dos partes por una porción territorial del Distrito Federal, dando como resultado una zona poniente —donde se ubica la cabecera— y un exclave en zona oriente llamado San Juan Ixhuatepec que colinda con el municipio de Ecatepec de Morelos y la delegación Gustavo A. Madero.\\nMientras que en la parte poniente se limita al norte con el municipio de Tultitlán de Mariano Escobedo, al sur con la Alcaldía Azcapotzalco, al poniente con el municipio de Atizapán de Zaragoza, al oriente con Alcaldía Gustavo A. Madero así como al suroriente con la alcaldía mencionada, al nororiente limita con Tultitlán de Mariano Escobedo, al surponiente con el municipio de Naucalpan de Juárez y al norponiente con el Municipio de Cuautitlán Izcalli."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%94%D0%BE%D0%BB%D0%B8%D0%BD%D0%B0_%D0%BD%D0%B0%D1%80%D1%86%D0%B8%D1%81%D1%96%D0%B2","image_url":"http://upload.wikimedia.org/wikipedia/commons/9/97/0705_Zakarpatie-237.jpg","page_title":"Долина нарцисів","context_page_description":"«Доли́на нарци́сів» — заповідний масив, що розташований в урочищі Кіреші, за 4 км на схід від міста Хуст Закарпатської області. З 1992 року — у складі Карпатського біосферного заповідника, що входить до міжнародної мережі біосферних резерватів ЮНЕСКО.\\nПлоща масиву — 256,5 га. Статус — з 1992 року. Керівна організація — Карпатський біосферний заповідник."},{"page_url":"https://bn.wikipedia.org/wiki/%E0%A6%89%E0%A6%87%E0%A6%9F%E0%A6%BF%E0%A6%97_%E0%A6%AC%E0%A6%BF%E0%A6%95%E0%A7%8D%E0%A6%B0%E0%A6%BF%E0%A6%AF%E0%A6%BC%E0%A6%BE","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/aa/C%28PPh3%292.png","page_title":"উইটিগ বিক্রিয়া","context_page_description":"উইটিগ বিক্রিয়া বা উইটিগ অলিফিনেশন হল আ্যলডিহাইড বা কিটোনের সাথে ট্রাইফিনাইল ফসফোনিয়াম ইলাইডের একটি রাসায়নিক বিক্রিয়া যা আ্যলকিন এবং ট্রাইফিনাইলফসফিন অক্সাইড উৎপন্ন করে।\\nউইটিগ বিক্রিয়াটি ১৯৫৪ সালে জর্জ উইটিগ আবিষ্কার করেন, যার জন্য তিনি ১৯৭৯ সালে রসায়নে নোবেল পুরস্কার পান। বিক্রিয়াটি জৈব সংশ্লেষনে আ্যলকিন প্রস্তুতিতে ব্যাবহার করা হয়। এটি উইটিগ পুনর্বিন্যাস থেকে আলাদা।\\nউইটিগ বিক্রিয়াটি সবচেয়ে বেশি ব্যবহৃত হয় আ্যলডিহাইড এবং কিটোনকে মনোপ্রতিস্থাপিত ট্রাইফিনাইলফসফোনিয়াম ইলাইড এর সাথে যুক্ত করতে। আ্যলডিহাইড এর সাথে বিক্রিয়ায়, দ্বিবন্ধনের জ্যামিতি সহজেই বলা যেতে পারে ইলাইডের প্রকৃতির উপর ভিত্তি করে। অস্থায়ী ইলাইড গুলি-আ্যলকিন উৎপন্ন করে উচ্চ নির্বাচনশীলতার সাথে। স্থায়ী ইলাইড গুলি-আ্যলকিন উৎপন্ন করে উচ্চ নির্বাচনশীলতার সাথে। E/Z নির্বাচনশীলতা খুবই কম সেমিস্থিতিশীল ইলাইড গুলির ক্ষেত্রে।\\nঅস্থায়ী ইলাইডের ক্ষেত্রে-আ্যলকিন পেতে, উইটিগ বিক্রিয়ার স্লোসের পরিবর্তন ব্যবহার করা যেতে পারে । অথবা জুলিয়া অলিফিনেশন এবং এর মতো বিক্রিয়াগুলি-আ্যলকিন উৎপন্ন করে। সচরাচর, হর্নের-ওয়াসওয়ার্থ-ইমন্স বিক্রিয়া-এনোএট উৎপন্ন করে, যেমন উইটিগ বিক্রিয়া করে।-এনোএট পেতে হলে, হর্নের-ওয়াসওয়ার্থ-ইমন্স বিক্রিয়ার স্টিল-গেনারী সংশোধন ব্যবহার করা হয়।"},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Eintr%C3%A4ge_im_National_Register_of_Historic_Places_im_Cook_County_(Illinois)/au%C3%9Ferhalb_von_Chicago","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/93/Oak_Park_Il_Conservatory1.jpg","page_title":"Liste der Einträge im National Register of Historic Places im Cook County (Illinois)/außerhalb von Chicago","context_page_description":"Die Liste der Einträge im National Register of Historic Places im Cook County in Illinois führt alle Bauwerke und historischen Stätten im Cook County auf, die in das National Register of Historic Places aufgenommen wurden.\\nDie Liste gliedert sich in fünf Teile:\\nListe der Einträge im National Register of Historic Places in Chicago-Zentrum\\nListe der Einträge im National Register of Historic Places in Chicago-Nord\\nListe der Einträge im National Register of Historic Places in Chicago-West\\nListe der Einträge im National Register of Historic Places in Chicago-Süd\\nListe der Einträge im National Register of Historic Places im Cook County außerhalb von Chicago"},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Baudenkm%C3%A4ler_in_B%C3%BCderich","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/db/PastorWolfStra%C3%9Fe46.JPG","page_title":"Liste der Baudenkmäler in Büderich","context_page_description":"Die Liste der Baudenkmäler in Büderich enthält die denkmalgeschützten Bauwerke auf dem Gebiet des Weseler Stadtteils Büderich in Nordrhein-Westfalen. Diese Baudenkmäler sind in Teil A der Denkmalliste der Stadt Wesel eingetragen; Grundlage für die Aufnahme ist das nordrhein-westfälische Denkmalschutzgesetz.\\nDarüber hinaus gibt es besonders erhaltenswerte Gebäude, die hier ebenfalls in einer weiteren Tabelle aufgeführt werden."},{"page_url":"https://hu.wikipedia.org/wiki/Henrik_angol_kir%C3%A1lyi_herceg","image_url":"http://upload.wikimedia.org/wikipedia/commons/0/06/Gisant_d%27Henri_le_Jeune2.JPG","page_title":"Henrik angol királyi herceg","context_page_description":"Henrik angol társuralkodó, II. Henrik angol király és Aquitániai Eleonóra angol királyné fia.\\nÉdesanyjának II. Henrik már a második férje volt, ugyanis első férjétől, VII. Lajos francia királytól elvált 1152. március 18-án, 15 évnyi házasság után, mivel nem tudott trónörököst adni hitvesének, csak két lányuk született: Mária és Alíz.\\nHét testvére volt:\\nVilmos, Richárd, Gottfried, János, Matilda, Eleonóra és Johanna.\\n1170 júniusában, 15 évesen, még apja életében sor került Henrik koronázására, habár úgy tűnt, a most már hivatalosan is megkoronázott trónörököst nem igen érdekelték Anglia mindennapos, hétköznapi ügyes-bajos dolgai, egyszóval az ország kormányzása, de azért mégis csak fontos politikai szerep jutott neki apja élete vége felé, melynek első momentumaként, 1160. november 2-án hivatalos eljegyzésre került sor Franciaországi Margit hercegnő, VII. Lajos francia király és annak második felesége, Kasztíliai Konstancia leánya között. II. Henrik különösen fontosnak tartotta fia menyegzőjét a francia királylánnyal, mivel családi öröksége, azaz szülei, Plantagenet Gottfried gróf és Angliai Matilda hercegnő igényt formált a Franciaország területén fekvő Normandiára."},{"page_url":"https://en.wikipedia.org/wiki/Aspergillus_croceus","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e0/Aspergillus_croceus_meaox.png","page_title":"Aspergillus croceus","context_page_description":"Aspergillus croceus is a species of fungus in the genus Aspergillus. It is from the Nidulantes section. The species was first described in 2016. It has been isolated from cave sediment in Spain. It has been reported to produce kotanins, norsolorinic acid, orlandin, siderin, sterigmatocystin, and versicolorins."},{"page_url":"https://ca.wikipedia.org/wiki/Ratpenat_de_les_flors_de_Sezekorn","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2a/Erophylla_sezekorni_planifrons.jpg","page_title":"Ratpenat de les flors de Sezekorn","context_page_description":"El ratpenat de les flors de Sezekorn és una espècie de ratpenat de la família dels fil·lostòmids que viu les Bahames, les illes Caiman, Cuba i Jamaica."},{"page_url":"https://en.wikipedia.org/wiki/List_of_equipment_of_the_Hellenic_Army","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f6/Two_AH-64DHAs_put_on_a_very_spirited_display_for_the_crowd.jpg","page_title":"List of equipment of the Hellenic Army","context_page_description":"The heavy equipment and weaponry of the Hellenic Army is of mostly foreign manufacture, from American, British, French, German and other suppliers. Exception are the Kentaurus and the Leonidas armored fighting vehicles which are built in Greece by the Hellenic Vehicle Industry.\\nEquipment runs the gamut from state-of-the-art to obsolescent Cold War inventories; the latter are gradually being retired as no funds are available for upgrade. Russian made equipment was received or purchased after the collapse of the Warsaw Pact and second hand US and German equipment was transferred or purchased.\\nRecent defense spending cuts have had a big impact in operating costs. As 80% of the budget is spent on salaries and administrative costs the Hellenic Army faces the challenge of reorganizing its structure. This may lead to closing down some of the 500 military bases scattered across the country and reducing the size of the Army, transforming the Hellenic Army into a smaller but largely professional force.\\nUnder the Force Structure 2005-2020 plan large-scale changes in the Army will be implemented. Only two categories of units will exist: active and mobilized."},{"page_url":"https://en.wikipedia.org/wiki/Burgee","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/55/RCorkYC.png","page_title":"Burgee","context_page_description":"A burgee is a distinguishing flag, regardless of its shape, of a recreational boating organization. In most cases, they have the shape of a pennant."},{"page_url":"https://de.wikipedia.org/wiki/Bucy-l%C3%A8s-Cerny","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c9/Bucy-l%C3%A8s-Cerny_%28Aisne%29_%C3%A9glise_%2801%29.JPG","page_title":"Bucy-lès-Cerny","context_page_description":"Bucy-lès-Cerny ist eine französische Gemeinde mit 210 Einwohnern im Département Aisne in der Region Hauts-de-France. Sie gehört zum Arrondissement Laon, zum Kanton Laon-1 und zum Gemeindeverband Pays de Laon.\\nDie Gemeinde ist nicht zu verwechseln mit der Nachbargemeinde Cerny-lès-Bucy."},{"page_url":"https://no.wikipedia.org/wiki/Anke_K%C3%BChne","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/01/AKuehn.JPG","page_title":"Anke Kühne","context_page_description":"Anke Kühne er en tysk landhockeyspiller.\\nHun representerte Tyskland under Sommer-OL 2008 i Beijing, hvor hun ble nummer 4.\\nHun tok gull under Sommer-OL 2004."},{"page_url":"https://es.wikipedia.org/wiki/Sitta_europaea","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/21/Sitta_caesia_1810.jpg","page_title":"Sitta europaea","context_page_description":"El trepador azul ​ es una especie de ave paseriforme de la familia Sittidae. Se trata de un ave de tamaño medio que mide 14 cm de longitud. Al igual que otros trepadores, es un pájaro robusto, con cola corta y largo pico. Las partes superiores son de color gris azulado, los colores de las partes inferiores varían según su ubicación geográfica del rojo puro al blanco o amarillento, con o sin un área clara en la mejilla.\\nEl ave también tiene una línea ocular negra y presenta dimorfismo sexual: el color del macho es más pronunciado que el de la hembra. Es un pájaro ruidoso y en su variado repertorio emite diferentes tipos de cantos, como vuih, vuih, vuih, vuih, …, y, en caso de excitación o alarma, una larga serie de fuertes sonidos continuos, tuit, en rápidas repeticiones. Como otros de su especie, es muy ágil al trepar por los troncos de los árboles; al descender, a veces, lo hace cabeza abajo.\\nLa especie se alimenta principalmente de insectos, ante todo orugas y escarabajos que encuentra en los troncos y ramas de los árboles. En otoño e invierno, su dieta se complementa con frutas y semillas secas, como las del cedro."},{"page_url":"https://de.wikipedia.org/wiki/Ludwigsturm_(Donnersberg)","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/37/Ludwigsturm-SenderDonnersberg.jpg","page_title":"Ludwigsturm (Donnersberg)","context_page_description":"Der Ludwigsturm nahe Dannenfels im rheinland-pfälzischen Donnersbergkreis ist ein 27 m hoher und als Kulturdenkmal ausgewiesener Aussichtsturm auf dem Donnersberg."},{"page_url":"https://ca.wikipedia.org/wiki/Cant%C3%B3_de_Rib%C3%A9court-Dreslincourt","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6c/Cnt_de_Rib%C3%A9court-Dreslincourt.png","page_title":"Cantó de Ribécourt-Dreslincourt","context_page_description":"El Cantó de Ribécourt-Dreslincourt és un cantó francès del departament de l'Oise, situat al districte de Compiègne. Té 17 municipis i el cap és Ribécourt-Dreslincourt."},{"page_url":"https://ar.wikipedia.org/wiki/%D8%A7%D9%84%D9%8A%D8%B3%D9%8A%D8%AF%D8%A7","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f2/Archivo-Imagen_photomontage.jpg","page_title":"اليسيدا","context_page_description":"بلدية اليسيدا، هي بلدية تقع في مقاطعة قصرش والتي تقع في منطقة إكستريمادورا، غرب إسبانيا.\\nيبلغ عدد سكانها 2.101 نسمة وفقاً لإحصائية سنة."},{"page_url":"https://sh.wikipedia.org/wiki/OR51V1","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d2/PBB_GE_OR51V1_gnf1h10912_at_tn.png","page_title":"OR51V1","context_page_description":"Olfaktorni receptor 51V1 je protein koji je kod ljudi kodiran OR51V1 genom.\\nOlfaktorni receptori formiraju interakcije sa molekulima mirisa u nosu, čime se inicira neuronski respons koji izaziva percepciju mirisa. Oni su odgovorni za prepoznavanje i G proteinima posredovanu transdukciju mirisnih signala. Proteini olfaktornih receptora su članovi velike familije G protein spregnutih receptora. Poput mnogih receptora za neurotransmitere i hormone, olfaktorni receptori imaju strukturu 7-transmembranskog domena. Oni su kodirani genima sa jednim eksonom. Geni olfaktornih receptora su najveća familija genoma. Nomenklatura gena i proteina olfaktornih receptora je nezavisna od drugih organizama."},{"page_url":"https://sr.wikipedia.org/wiki/%D0%98%D0%B7%D0%B1%D0%BE%D1%80%D0%B8_%D0%B7%D0%B0_%D1%81%D1%80%D0%BF%D1%81%D0%BA%D0%BE%D0%B3_%D1%87%D0%BB%D0%B0%D0%BD%D0%B0_%D0%9F%D1%80%D0%B5%D0%B4%D1%81%D1%98%D0%B5%D0%B4%D0%BD%D0%B8%D1%88%D1%82%D0%B2%D0%B0_%D0%91%D0%BE%D1%81%D0%BD%D0%B5_%D0%B8_%D0%A5%D0%B5%D1%80%D1%86%D0%B5%D0%B3%D0%BE%D0%B2%D0%B8%D0%BD%D0%B5_2006.","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0a/Mladen_Bosic-mc.rs.jpg","page_title":"Избори за српског члана Предсједништва Босне и Херцеговине 2006.","context_page_description":"Избори за српског члана Предсједништва Босне и Херцеговине 2006. одржани су 1. октобра као дио општих избора у БиХ. Побиједио је Небојша Радмановић. Број важећих гласова био је 540.173, а неважећих 52.269. Од укупног броја важећих гласова, на редовним бирачким мјестима било их је 521.331, поштом 11.549, у одсуству 5.393, те на потврђеним гласачким листићима 1.900."},{"page_url":"https://en.wikipedia.org/wiki/%C3%89douard_Chavannes","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f6/Edouard_Chavannes.png","page_title":"Édouard Chavannes","context_page_description":"Émmanuel-Édouard Chavannes was a French Sinologist and expert on Chinese history and religion, and is best known for his translations of major segments of Sima Qian's Records of the Grand Historian, the work's first ever translation into a Western language.\\nChavannes was a prolific and influential scholar, and was one of the most accomplished Sinologists of the modern era notwithstanding his relatively early death at age 52 in 1918. A successor of 19th century French sinologists Jean-Pierre Abel-Rémusat and Stanislas Julien, Chavannes was largely responsible for the development of Sinology and Chinese scholarship into a respected field in the realm of French science."},{"page_url":"https://zh.wikipedia.org/wiki/1955%E5%B9%B4%E5%A4%AA%E5%B9%B3%E6%B4%8B%E9%A2%B1%E9%A2%A8%E5%AD%A3","image_url":"http://upload.wikimedia.org/wikipedia/commons/6/6e/1955_Pacific_typhoon_season_summary_map.png","page_title":"1955年太平洋颱風季","context_page_description":"1955年太平洋颱風季泛指在1955年全年內的任何時間，於赤道以北及國際換日線以西的太平洋水域，以及南中國海所產生的熱帶氣旋。雖然有關方面並沒有設下本颱風季的指定期限，但大部份於西北太平洋的熱帶氣旋通常都會於五月至十二月期間形成。\\n本條目的範圍僅侷限於赤道以北及國際換日線以西的太平洋及南海的水域。於赤道以北及國際換日線以東的太平洋水域產生的風暴則被稱為颶風，並被列入 1955年太平洋颶風季。在西太平洋產生的熱帶風暴是由聯合颱風警報中心命名，國際編號為55xx。而凡進入或產生於菲律賓風暴責任範圍以內的熱帶性低氣壓，菲律賓大氣地理天文部門 都會為它們訂立一個菲律賓名稱，作當地警報用途；因此同一個風暴有時候會有兩個不同的名稱。\\n以下各熱帶氣旋資訊以熱帶氣旋存在期間的最強形態為準。"},{"page_url":"https://it.wikipedia.org/wiki/Castello_di_Vezio","image_url":"http://upload.wikimedia.org/wikipedia/commons/9/9e/Castello_di_Vezio.jpg","page_title":"Castello di Vezio","context_page_description":"Il castello di Vezio si erge su un promontorio sul fondo della Val d'Esino e sovrasta il paese di Varenna. Il castello si trova quasi completamente nel territorio di Varenna, e per una piccola porzione sul territorio di Perledo. La frazione di Vezio appartiene a Perledo in provincia di Lecco."},{"page_url":"https://ja.wikipedia.org/wiki/%E3%82%AA%E3%83%AA%E3%82%A8%E3%83%B3%E3%83%88%E6%80%A5%E8%A1%8C%E6%AE%BA%E4%BA%BA%E4%BA%8B%E4%BB%B6_(2015%E5%B9%B4%E3%81%AE%E3%83%86%E3%83%AC%E3%83%93%E3%83%89%E3%83%A9%E3%83%9E)","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/cb/Kyu-Taisha_station06s4592.jpg","page_title":"オリエント急行殺人事件 (2015年のテレビドラマ)","context_page_description":"『オリエント急行殺人事件』は、フジテレビ開局55周年特別企画として2015年1月11日・1月12日の2夜連続で放送されたテレビドラマである。主演は野村萬斎。\\nアガサ・クリスティーの『オリエント急行の殺人』を原作とし、三谷幸喜の脚本により昭和初期の日本を舞台とした作品として制作された。第1夜は原作に則して描き、第2夜は犯人の視点から犯行の流れを描いたオリジナル構成となる。視聴率は第1夜が16.1%、第2夜が15.9%。放送時のタイトルロゴには「WHODUNIT?」が併記されていた。\\n東京ドラマアウォード2015の単発ドラマ部門でグランプリを受賞した。"},{"page_url":"https://en.wikipedia.org/wiki/Mijnsheerenland","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fd/Plus_Mijnsheerenland.jpg","page_title":"Mijnsheerenland","context_page_description":"Mijnsheerenland is a village and a former municipality on the Hoeksche Waard island in the Dutch province of South Holland with 4,435 inhabitants. It is located on the shores of the Binnenbedijkte Maas, about 14 km south of the city of Rotterdam, in the municipality of Hoeksche Waard. It was the only village in the former municipality Binnenmaas not built next to a dyke.\\nThe main street of Mijnsheerenland is the Raadhuislaan. This street used to be dominated by farmhouses, but in recent years many of them were demolished and replaced by modern homes as Mijnsheerenland became preferred by upmarket house buyers."},{"page_url":"https://de.wikipedia.org/wiki/Kernschie%C3%9Fsimulation","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3b/Kernschiesssimulation.jpg","page_title":"Kernschießsimulation","context_page_description":"Die Kernschießsimulation wird in der Gießtechnik eingesetzt, um die Fertigung von Sandkernen zu optimieren. Sandkerne kommen in Gussformen zum Einsatz, um Gussteile mit Hohlräumen oder geometrischen Strukturen zu fertigen. Die beim Gießen durch die Kerne entstehenden Aussparungen dienen der Gewichtsersparnis oder realisieren funktionelle Eigenschaften.\\nÜberwiegend werden Sandkerne durch ein maschinelles Verfahren hergestellt, dem Kernschießen. Dabei wird ein Gemisch von Sand und Bindemitteln mit einem definierten Druck in die Kernform „geschossen“. Der Prozess des Kernschießens hat einen erheblichen Einfluss auf die Gesamtfertigungskosten und die resultierende Qualität des Gussteils. Mängel des Kerns schlagen sich direkt in Gussfehlern und ungewünschten Gussteileigenschaften nieder. Da die Geometrien von Gussteilen immer komplexer werden, steigen auch die technischen und wirtschaftlichen Anforderungen an die Kernherstellung.\\nBei der Kernsimulation wird von einer Software der Prozess des Kernschießens virtuell vorhergesagt und durch eine Animation im Zeitverlauf abgebildet."},{"page_url":"https://ms.wikipedia.org/wiki/Agnez_Mo","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b3/Agnes_Monica_in_2009_Asia_Song_Festival.jpg","page_title":"Agnez Mo","context_page_description":"Agnes Monica Muljoto atau lebih dikenali sebagai Agnez Mo ialah seorang penyanyi pop dan R&B, pelakon, penari Indonesia. Beliau dikenali menerusi drama bersiri Pernikahan Dini yang ditayangkan di RCTI, di mana beliau berlakon sebagai seorang gadis remaja yang masih duduk di bangku SMU dan hamil di luar nikah. Selain itu beliau sendiri yang menyanyikan lagu tema sinetron dengan judul sama. Beliau kini merupakan selebriti terkaya di Indonesia dengan nilai pendapatan kasar sebanyak AS$ 16 juta.\\nDengan kejayaannya ini, Agnes berjaya menjadi salah seorang artis yang ternama dan telah memenangi pelbagai penghargaan hasil bakat lakonannya. Dengan kejayaannya dalam drama bersiri, Agnes yang juga penyanyi cilik ini juga sering mengisi runut bunyi drama bersirinya, dan akhirnya menghasilkan album dewasa pertamanya \\"..And The Story Goes.....\\". Albumnya berjaya dan melambungkan namanya dalam kancah industri hiburan Indonesia. Pada 10 Disember 2005, Agnes melancarkan album keduanya Whaddup A.. '?!. Single pertama berjudul \\"Bukan Milikmu Lagi\\"."},{"page_url":"https://da.wikipedia.org/wiki/Bernts_Have","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8e/Bernts_have_landskab.jpg","page_title":"Bernts Have","context_page_description":"Bernts Have er et kvarter i Holbæks sydvestlige udkant, udviklet i perioden 1993-2009. Kvarteret har samlet 600 boliger, fordelt på såvel etageboliger som rækkehuse og på både almene boliger, andels- og ejerboliger.\\nMasterplanen for området er tegnet af Henning Larsen, og omfatter to lange karreer, en række punkthuse og seks mindre \\"landsbyer\\". De fem landsbyområder er beboelse med forskellige beboertyper, mens den sjette huser en integreret institution.\\nOmrådet er opkaldt efter den første forstander på den nærliggende Holbæk Naturskole."},{"page_url":"https://sl.wikipedia.org/wiki/Lilongwe","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/99/Lilongwe_Area_2.jpg","page_title":"Lilongwe","context_page_description":"Lilongwe je glavno mesto Malavija in s približno 675.000 prebivalci največje mesto te južnoafriške države. Sestavljata ga dva jasno ločena dela, staro trgovsko središče iz začetka 20. stoletja in administrativni del, ki je bil zgrajen na novo do leta 1975, ko je Lilongwe postal prestolnica. Zgodovinsko je mesto znano predvsem kot središče pridelave tobaka, v novejšem času pa tudi kot center epidemije Aidsa v Afriki, okužen naj bi bil vsak peti prebivalec. Malavi je ena od desetih najrevnejših držav sveta, kar se odraža tudi v Lilongweju, kjer skoraj 80 % prebivalstva živi v barakarskih naseljih, število pa se s priseljevanjem s podeželja hitro veča."},{"page_url":"https://fr.wikipedia.org/wiki/Winesburg-en-Ohio","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/44/Usstamp-edgar_lee_masters.jpg","page_title":"Winesburg-en-Ohio","context_page_description":"Winesburg-en-Ohio est un recueil de nouvelles publié en 1919 par l'écrivain américain Sherwood Anderson. L'œuvre est centrée sur le protagoniste, George Willard, que le lecteur suit de son enfance à sa jeune maturité, alors qu'il est prêt à quitter Winesburg pour Cleveland.\\nWinesburg est un lieu imaginaire — sans rapport avec la ville du même nom, elle aussi située dans l'Ohio — mais en partie fondé sur les souvenirs d'enfance qu'Anderson a gardés de Clyde. Écrits principalement de la fin de 1915 au début de 1916, les récits, dont certains ont été terminés peu avant leur publication, sont complémentaires à la fois les uns des autres et solidaires d'un tout, tous concernant la même communauté.\\nLe recueil comprend vingt-deux nouvelles, la première, Le Livre du grotesque, servant d'introduction. Presque toutes se focalisent sur un personnage dont la vie n'est qu'une longue lutte pour échapper à sa solitude et à l'isolement qui pèse sur la ville. Winesburg-en-Ohio se préoccupe plus des arcanes psychologiques que de l'intrigue — quasi inexistante — et est écrit en une prose neutre, proche du parler de tous les jours."},{"page_url":"https://en.wikipedia.org/wiki/National_Register_of_Historic_Places_listings_in_Hardy_County,_West_Virginia","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9d/MOOREFIELD_HISTORIC_DISTRICT.jpg","page_title":"National Register of Historic Places listings in Hardy County, West Virginia","context_page_description":"This is a list of the National Register of Historic Places listings in Hardy County, West Virginia.\\nThis is intended to be a complete list of the properties and districts on the National Register of Historic Places in Hardy County, West Virginia, United States. The locations of National Register properties and districts for which the latitude and longitude coordinates are included below, may be seen in a Google map.\\nThere are 25 properties and districts listed on the National Register in the county.\\nThis National Park Service list is complete through NPS recent listings posted March 15, 2019."},{"page_url":"https://fi.wikipedia.org/wiki/Messier_7","image_url":"http://upload.wikimedia.org/wikipedia/commons/e/eb/Open-cluster-Messier-7.jpeg","page_title":"Messier 7","context_page_description":"Messier 7 on avoin tähtijoukko Skorpionin tähdistössä. Ptolemaios tunsi sen jo vuonna 130. Charles Messier lisäsi sen luetteloonsa 23. toukokuuta 1764.\\nM7 on suuri ja kirkas joukko, joka on helppo havaita paljainkin silmin. M7 on Messierin luettelon eteläisin kohde, eikä näy Suomessa."},{"page_url":"https://en.wikipedia.org/wiki/List_of_third_party_and_independent_United_States_state_governors","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f4/Augustus_Williamson_Bradford_-_photo_portrait_standing.jpg","page_title":"List of third party and independent United States state governors","context_page_description":"This is a list of third party and independent United States state governors, that is, governors that have not been members of the Democratic, Republican, Whig, National Republican, Democratic-Republican, or Federalist parties.\\nSince its founding, the United States has been a two-party system, and it is rare for independents or members of third parties to be elected to high offices such as the governorship. However, it has happened on several occasions, which are documented below. The most recent-serving independent governor is Bill Walker of Alaska, who served 2014–2018. The most recent member of a third party elected to a governorship is Jesse Ventura, a member of the Independence Party of Minnesota who was elected Governor of Minnesota in 1998.\\nWhile there have been few third parties that have gained traction at the national level, several states have been three-party systems at one point or another."},{"page_url":"https://de.wikipedia.org/wiki/Moser_und_Sch%C3%BCrch","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/43/Bahnhof_Biel_gross.jpg","page_title":"Moser und Schürch","context_page_description":"Moser und Schürch war ein Architekturbüro in Biel, das von 1910 bis etwa 1929 bestand. Büropartner waren die Architekten Friedrich Moser und Wilhelm Schürch, die beide vorher bereits gemeinsam Wettbewerbe absolviert hatten. Das Büro, dessen Werke in Biel, im Kanton Bern und teilweise darüber hinaus zu finden sind, vollzog im Laufe seines Bestehens den Wandel vom Heimatstil hin zu einer gemässigten Moderne. Nach der Trennung führten beide Partner eigene Büros weiter.\\nDas Büro, das Moser, damals beim Stadtbauamt Biel angestellt, bereits um 1908 gegründet hatte, begann mit Spitalbauten: Die Erweiterung des Seeländischen Krankenasyls Gottesgnad in Mett von 1911 und später des Altersasyls desselben Trägers in Langnau sowie des Kindersanatoriums Maison Blanche in Leubringen.\\nEbenfalls vor dem Ersten Weltkrieg entstand die Wohnkolonie der Eisenbahner-Baugenossenschaft in Nidau, eine Kleinsiedlung aus Ein- und Zweifamilienreihenhäusern. An der Schweizerischen Landesausstellung 1914 entwarfen sie die Pavillons der Milchwirtschaft.\\nNeben öffentlichen Bauten traten bald Fabriken und Bauten für die Industrie, etwa die Maschinenfabrik Güdel in Biel und der Fabrikanlagen Landis & Gyr in Zug."},{"page_url":"https://el.wikipedia.org/wiki/%CE%92%CE%B1%CF%83%CE%B9%CE%BB%CE%B9%CE%BA%CE%AE_%CF%84%CE%B7%CF%82_%CE%A3%CE%B1%CE%BA%CF%81%CE%AD-%CE%9A%CE%B5%CF%81_%CF%84%CE%B7%CF%82_%CE%9C%CE%BF%CE%BD%CE%BC%CE%AC%CF%81%CF%84%CF%81%CE%B7%CF%82","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2f/Louis-%C3%89mile_Durandelle%2C_Construction_du_Sacr%C3%A9-C%C5%93ur%2C_1882.jpg","page_title":"Βασιλική της Σακρέ-Κερ της Μονμάρτρης","context_page_description":"Η Βασιλική της Σακρέ-Κερ της Μονμάρτρης, αναφέρεται και ως Βασιλική της Ιερής Καρδιάς και συχνά απλά Σακρέ-Κερ, είναι Ρωμαιοκαθολική εκκλησία αφιερωμένη στην Ιερή Καρδιά του Ιησού. Βρίσκεται στο 18ο διαμέρισμα του Παρισιού στη Γαλλία, στην κορυφή του λόφου της Μονμάρτρης και αποτελεί ένα από τα ορόσημα της πόλης.\\nΗ κατασκευή της βασιλικής, που είναι μνημείο θρησκευτικό, πολιτικό και πολιτιστικό, ακολούθησε την μεταπολεμική περίοδο του 1870. Κατασκευάστηκε στα πλαίσια της νέας συντηρητικής «ηθικής τάξης» που κυριάρχησε στη Γαλλία μετά τη γαλλική ήττα στον Γαλλοπρωσικό πόλεμο του 1870 και τα γεγονότα της Παρισινής Κομμούνας, στην οποία η Μονμάρτρη πρωτοστάτησε.\\nΟ ναός αφιερώθηκε στην Ιερή Καρδιά του Ιησού, αναγόμενη στα οράματα της Αγίας της Ρωμαιοκαθολικής Εκκλησίας Μαργαρίτας-Μαρίας Αλακόκ στο Παραί-λε-Μονιάλ.\\nΗ θέση της σε υψόμετρο 130 μέτρων σε ένα από τα υψηλότερα σημεία του Παρισιού και ο τρούλος της που ανέρχεται στα 83 μέτρα, την καθιστούν ορατή από μακριά. Με σχεδόν έντεκα εκατομμύρια προσκυνητές και επισκέπτες ετησίως, είναι το δεύτερο πιο δημοφιλές θρησκευτικό μνημείο στο Παρίσι μετά τον καθεδρικό ναό της Παναγίας των Παρισίων."},{"page_url":"https://sk.wikipedia.org/wiki/Roquetoire","image_url":"http://upload.wikimedia.org/wikipedia/commons/7/75/Map_commune_FR_insee_code_62721.png","page_title":"Roquetoire","context_page_description":"Roquetoire je francúzska obec, ktorá sa nachádza v departemente Pas-de-Calais, v regióne Nord-Pas-de-Calais."},{"page_url":"https://no.wikipedia.org/wiki/Asa_Eldridge","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/26/USM_steamship_Pacific_%281849%29.jpg","page_title":"Asa Eldridge","context_page_description":"Asa Eldridge var en sjøkaptein fra Yarmouth i Massachusetts. I 1854 førte kaptein Eldridge klipperskuten SS «Red Jacket» fra New York til Liverpool på 13 dager, 1 time og 25 minutter, «dock to dock», og satte med dete fartsrekord for den raskeste trans-Atlantiske kryssing med et kommersielt seilfartøy. Rekorden er ikke slått siden den gang. I 1856 var Eldridge kaptein på dampskipet SS «Pacific» som forsvant på havet underveis fra Liverpool til New York.\\nEldridge er også kjent for å ha ført Cornelius Vanderbilts egen private yacht, North-Star, da forretningsmannen i 1853 tok en liten gruppe av familie og venner på en sommer-lang cruise rundt i Europa. Dette var før Eldridge fikk kommandoen på lasteskipet «Roscius» i E. K. Collins' Dramatic Line."},{"page_url":"https://zh.wikipedia.org/zh-sg/%E6%AD%A3%E5%9D%90","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b1/Panling_lanshan.jpg","page_title":"正坐","context_page_description":"正坐是席地坐姿的一种，又称“跨鹤坐”，通称“跪坐”。古汉语中，臀部接触脚跟为“坐”，特指正坐；挺直上身而不着脚跟为“跪”；跪而耸身挺腰为“跽”。正坐时，双膝应并拢着地，臀部压足，双手放在腿上。\\n正坐是宋代以前的中国人正式的坐姿，其起源至少可追溯至商代，后来传到朝鲜、日本、越南、琉球等地。北宋以后，椅子在民间普及，中国人彻底改变了席地正坐的习惯。而日本、朝鲜的正坐传统则保存至今。"},{"page_url":"https://bg.wikipedia.org/wiki/Petrogale_godmani","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/49/Godman%27s_Rock_Wallaby_area.png","page_title":"Petrogale godmani","context_page_description":"Petrogale godmani е вид бозайник от семейство Кенгурови."},{"page_url":"https://hy.wikipedia.org/wiki/%D5%84%D5%AB%D6%80%D5%B8%D5%BD%D5%AC%D5%A1%D5%BE_%D4%BC%D5%A1%D5%B5%D5%B9%D5%A1%D5%AF","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2d/M-Lajcak.jpg","page_title":"Միրոսլավ Լայչակ","context_page_description":"Միրոսլավ Լայչակ, սլովակ քաղաքական գործիչ և դիվանագետ: Սլովակիայի փոխվարչապետն ու արտաքին գործերի նախարարը 2012 թվականի ապրիլի 4-ից:"},{"page_url":"https://fa.wikipedia.org/wiki/%D8%AF%D9%85%DB%8C_%D9%85%D9%88%D8%B1","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e2/Demi_Moore_2010_Time_100_Shankbone.jpg","page_title":"دمی مور","context_page_description":"دِمی گاینس کوچر که با نام حرفه‌ای دِمی مور شناخته می‌شود، هنرپیشه آمریکایی است."},{"page_url":"https://en.wikipedia.org/wiki/2nd_Texas_Infantry_Regiment","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/cd/VicksburgMay22.png","page_title":"2nd Texas Infantry Regiment","context_page_description":"The 2nd Regiment, Texas Infantry was an infantry regiment from Texas that served with Confederate States Army in the American Civil War. The regiment was organized by the then Captain John Creed Moore who would become the regiment's 1st Colonel. Many of the men were from Houston and Galveston.\\nNotable battles that the regiment has been involved in include the Battle of Shiloh, the Second Battle of Corinth, and the Siege of Vicksburg."},{"page_url":"https://he.wikipedia.org/wiki/%D7%A4%D7%A8%D7%94-%D7%93%D7%A8%D7%93%D7%A0%D7%95%D7%98","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/05/HMS_Caesar.jpg","page_title":"פרה-דרדנוט","context_page_description":"פְּרֶה-דְרֶדְנוֹט הוא כינוי לשלב בהתפתחותן של אוניות מערכה, בעיקר בין השנים 1890 עד 1905. אוניות המערכה פרה-דרדנוט התפתחו מאוניות מחופות שריון שנבנו בעשורים שלפני כן; הן נבנו מפלדה, והיו מוגנות במעטה שריון. חימושן כלל תותחים ימיים כבדים בצריחים, יחד עם סוללות של תותחים משניים ואף שלישוניים. הן הונעו במנועי קיטור מונעים בפחם.\\nתקופת אוניית המערכה פרה-דרדנוט התאפיינה גם במעבר לתכנון מסודר על פי הגיון ברור, שהיה משותף לרוב הציים בעולם המערבי. זאת, בניגוד לתקופה הקודמת, שבה נבנו עשרות טיפוסי אוניות מערכה עטויות שריון, כל אחת עם הגיון שונה מחברתה. בתקופת אוניות הפרה-דרדנוט התקבל עקרון תכנון מסוים שבעקבותיו נבנו תריסרי אוניות. תקופה זו התאפיינה גם בכניסתם של כוחות ימיים חדשים לזירה, כמו גרמניה, יפן, וארצות הברית, בצד התעצמותם של הכוחות הימיים המסורתיים, שהעיקריים שבהם היו בריטניה, צרפת, ורוסיה. הקרב הימי העיקרי בתקופת הפרה-דרדנוט היה קרב צושימה, בין הצי היפני לצי הרוסי, שהתרחש ב-27 במאי 1905.\\nב-1906 השיקה בריטניה אוניית מערכה מהפכנית בשם אה\\"מ דרדנוט. אונייה זו הייתה שונה בתצורת החימוש העיקרי שלה ובמערכת ההנעה שלה, ולמעשה הפכה את כל אוניות המערכה שהיו קיימות עד אז למיושנות."},{"page_url":"https://de.wikipedia.org/wiki/Pioneer_P-3","image_url":"http://upload.wikimedia.org/wikipedia/commons/b/b1/Atlas-D_Able_-_Pioneer_P-3.jpg","page_title":"Pioneer P-3","context_page_description":"Pioneer P-3 war ein weiterer gescheiterter Versuch der US-amerikanischen Weltraumorganisation NASA im Rahmen des Pioneer-Programms einen Mondsatelliten zu lancieren. Die Raumsonde sollte in einen hohen Orbit um den Mond einschwenken und Aufnahmen der Oberfläche machen sowie weitere Experimente durchführen. Nur 45 Sekunden nach dem Start löste sich die Nutzlastverkleidung, was zu einer instabilen Flugbahn der Rakete und schließlich zum Totalverlust führte. Um die zahlreichen Fehlschläge zu kaschieren, verzichtete die NASA auf die Vergabe einer ordentlichen Missionsnummer und nannte das Gerät „P-3“. Analog verfuhr man bereits beim Versuch „P-1“ und bei den nachfolgenden gescheiterten Raumsonden „P-30“ und „P-31“."},{"page_url":"https://hr.wikipedia.org/wiki/%C4%8Cokolada_(2000.)","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/62/Jbinoche.jpg","page_title":"Čokolada (2000.)","context_page_description":"Čokolada je romantični film iz 2000. godine temeljen na istoimenom romanu autorice Joanne Harris kojeg je režirao Lasse Hallström. Adaptaciju scenarija potpisuje Robert Nelson Jacobs, a priča se vrti oko mlade majke koja dolazi u izmišljeno, malo francusko selo Lansquenet-sous-Tannes sa svojom šestogodišnjom kćerkom i otvara malu čokoladarnicu imena La Chocolaterie Maya. Njezina čokolada uskoro započne mijenjati živote lokalnog stanovništva.\\nFilm je snimljen u selu Flavigny-sur-Ozerain u Burgundyju te na Rue De L'ancienne Poste u Beynac-et-Cazenac na rijeci Dordogne u Dordogneu. Scene čija se radnja odvija na rijeci snimljene su na jezeru Fonthill u Wilthireu, a scene interijera snimljene su u studijima Shepperton u Surreyju.\\nFilm je nominiran u pet kategorija za prestižnu nagradu Oscar, uključujući i onu za najbolji film godine. Također je nominiran i u osam kategorija za britansku nagradu BAFTA te u četiri kategorije za nagradu Zlatni globus."},{"page_url":"https://fi.wikipedia.org/wiki/Kalevi_Falkin_orkesteri","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/17/Kalevi_Falk_original_band.jpg","page_title":"Kalevi Falkin orkesteri","context_page_description":"Kalevi Falkin orkesteri on suomalainen yhtye joka teki yhden pitkäsoiton Blue Master -levymerkille vuonna 1971. Kalevi Falk oli kuvitteellinen henkilö, jonka nimistä henkilöä yhtyeessä ei koskaan ollut.\\nYhtye säesti eri solisteja kuten Katri Helenaa ja Koivistolaisia. Yhtyeen laulusolistina toimi myös Aatos Bollström. Erityisen paljon yhtye soitti Carolan kanssa."},{"page_url":"https://da.wikipedia.org/wiki/Skivholme_Kirke","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7b/Skivholme_Kirke-pr%C3%A6stetavle.jpg","page_title":"Skivholme Kirke","context_page_description":"Skivholme Kirke ligger på bakken mellem Herskind og Skivholme. Kirken der er opført af kamp og frådsten mellem 1050-1250, består af et romansk kor og skib, hvortil der i senmiddelalderen er føjet et våbenhus i munkesten i syd og et tårn i vest samt i 1899 en apsis til erstatning for den romanske, som blev nedrevet 1801. Korets nuværende skikkelse skyldes en senromansk ombygning, der også må have omfattet den oprindelige apsis. Kirkeklokken er fra 1613. tårn er opført inden 1503, idet kalkmalerierne fra dette år også dækker den runde tårnarkade. Det tre stokværk høje tårn er rejst af røde munkesten og rå kamp indvendig i tårnrummet. Syd- og vestfacaderne er skalmuret 1896. Syd- og vestfacaderne er skalmuret 1896. 2006 blev kirken skifertag erstattet med et blytag.\\nDet er ukendt, hvem der omkring 1050 har bygget kirken, men stod indtil 1582 under Århus Domkapitel og Århus Domkirke, som har haft indflydelse på dens udbygning og indretning, men ved et mageskifte i 1582 kom den under kronen med lensmanden på Skanderborg Slot som tilsynsførende."},{"page_url":"https://it.wikipedia.org/wiki/Le_B%C3%A9mont","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/33/Karte_Gemeinde_Le_B%C3%A9mont_2009.png","page_title":"Le Bémont","context_page_description":"Le Bémont è un comune svizzero di 314 abitanti del Canton Giura, nel distretto delle Franches-Montagnes."},{"page_url":"https://en.wikipedia.org/wiki/1944_United_States_Senate_special_election_in_New_Jersey","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b3/ElmerHWene_%28cropped%29.jpg","page_title":"1944 United States Senate special election in New Jersey","context_page_description":"The United States Senate election of 1944 in New Jersey was held on November 7, 1944.\\nThe election was held to fill the unexpired term of William Warren Barbour, who died in November 1943. H. Alexander Smith, who had been elected in a 1944 special election following the death of William Warren Barbour, was elected to the open seat over Democratic U.S. Representative Elmer H. Wene.\\nThe incumbent Democratic appointee, Arthur Walsh, did not run."},{"page_url":"https://en.wikipedia.org/wiki/Field_marshal_(Thailand)","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fb/King_prajadhipok.jpg","page_title":"Field marshal (Thailand)","context_page_description":"Chom Phon or Field Marshal is the most senior rank of the Royal Thai Army, considered the equivalent to a Field Marshal or General of the Army. Today it is ceremonially held by members of the Thai Royal family and exists only on paper in the Thai military. It has not been awarded to a regular commissioned officer since 1973. The Royal Thai Navy equivalent is known as Chom Phon Ruea and Chom Phon Akat for the Royal Thai Air Force.\\nThe King of Thailand as head of the armed forces is automatically made a Chom Phon upon accession. The rank was formally created in 1888, together with all other ranks of the military by King Chulalongkorn, who wanted to modernize his armed forces along Western lines. Apart from the monarchs, there have been 13 appointments to this rank."},{"page_url":"https://en.wikipedia.org/wiki/Avenida_Escalada","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a4/Avenida_Escalada_Mapa.jpg","page_title":"Avenida Escalada","context_page_description":"Avenida Escalada is one of the longest avenues in Buenos Aires, crossing the southern barrios of Villa Luro, Mataderos, Parque Avellaneda, Villa Lugano, Villa Soldati and Villa Riachuelo. It runs northwest-southeast from Avenida Rivadavia to Riachuelo River.\\nIt crosses the Parque Polideportivo Roca, Golf Club José Jurado, Buenos Aires Automotive Racetrack, City Park, Parque Indoamericano and the Buenos Aires Regional Faculty of the National Technological University.\\nThe Escalada station of the Premetro is located on this avenue, and the Villa Luro Station of the Sarmiento Line is a few meters away from the northern extreme of the avenue."},{"page_url":"https://en.wikipedia.org/wiki/Saturation_diving","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/72/UWL_Helgoland_im_Nautineum_D%C3%A4nholm%2C_Stralsund%2C_Ansicht_%282008-05-10%29.JPG","page_title":"Saturation diving","context_page_description":"Saturation diving is diving for periods long enough to bring all tissues into equilibrium with the partial pressures of the inert components of the breathing gas. It is a diving technique that allows divers to reduce the risk of decompression sickness when they work at great depths for long periods of time because once saturated, decompression time does not increase with further exposure. Saturation divers typically breathe a helium–oxygen mixture to prevent nitrogen narcosis, but at shallow depths saturation diving has been done on nitrox mixtures.\\nIn saturation diving, the divers live in a pressurized environment, which can be a saturation system on the surface, or an ambient pressure underwater habitat when not in the water. Transfer to and from the pressurised surface living quarters to the equivalent depth is done in a closed, pressurised diving bell. This may be maintained for up to several weeks, and they are decompressed to surface pressure only once, at the end of their tour of duty. By limiting the number of decompressions in this way, the risk of decompression sickness is significantly reduced, and the time spent decompressing is minimised."},{"page_url":"https://pl.wikipedia.org/wiki/Rejon_wielkoberezie%C5%84ski","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/48/Blank_map_of_Zakarpattia_region4_by_Helgi.png","page_title":"Rejon wielkoberezieński","context_page_description":"Rejon wielkoberezieński – jednostka administracyjna w składzie obwodu zakarpackiego Ukrainy.\\nUtworzony w 1953. Ma powierzchnię 809 km². Siedzibą władz rejonu jest Wielkie Berezne.\\nNa terenie rejonu znajduje się 1 osiedlowa rada i 19 silskich rad, obejmujących w sumie 31 miejscowości."},{"page_url":"https://zh.wikipedia.org/wiki/%E9%81%93%E7%BE%85%E9%BD%92%E9%BE%8D%E5%B1%AC","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7a/Dollodon.jpg","page_title":"道羅齒龍屬","context_page_description":"道罗齿龙属意为“道罗的牙齿”，是种鸟脚亚目恐龙，生存于白垩纪早期的欧洲，年代为巴列姆阶，也可能是阿普第阶。道罗齿龙的化石发现于比利时贝尼萨特，可能还有德国、比利时。道罗齿龙是种轻型禽龙类，身长约6米，是种草食性恐龙。\\n道罗齿龙目前只有唯一种，D. bampingi。其正模标本原本归类于曼氏禽龙。曼氏禽龙后来独立为曼特尔龙。在2008年，葛瑞格利·保罗将其中的编号IRSNB 1551化石独立为新属，道罗齿龙。属名是以首次叙述这些化石的路易斯·道罗为名，种名则是以D. Bamping为名。"},{"page_url":"https://az.wikipedia.org/wiki/%22FHN_orqanlar%C4%B1nda_q%C3%BCsursuz_xidm%C9%99t%C9%99_g%C3%B6r%C9%99%22_medal%C4%B1","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ed/Fhoqx1m.jpg","page_title":"\\"FHN orqanlarında qüsursuz xidmətə görə\\" medalı","context_page_description":"“Fövqəladə hallar orqanlarında qüsursuz xidmətə görə” 1-ci dərəcəli Azərbaycan Respublikası medalının təsviri\\n“Fövqəladə hallar orqanlarında qüsursuz xidmətə görə” 1-ci dərəcəli Azərbaycan Respublikasının medalı milli ornamentli ensiz lövhə ilə birgə bürüncdən tökülmüş və qızıl suyuna çəkilmiş, dairəvi formalı, diametri 35 mm olan lövhədən ibarətdir.\\nMedalın ön tərəfinin səthi relyeflidir. Medalın mərkəzində relyefli şüaların fonunda, kəsişən qılıncların üzərində Fövqəladə Hallar Nazirliyinin emblemindən ibarət kompozisiya təsvir olunmuşdur. Bu kompozisiyadan yuxarıda qövs boyunca lentin üzərində “QÜSURSUZ XİDMƏTƏ GÖRƏ” sözləri yazılmış, aşağı hissədə isə palıd yarpaqlarından çələng təsviri verilmişdir. Kəsişən qılıncların üzərində Fövqəladə Hallar Nazirliyinin emblemindən ibarət kompozisiya, lent, palıd yarpaqlarından çələng, lövhənin fonu və sözlər relyefli və qızılı rəngdədir.\\nMedalın arxa tərəfi hamar səthlidir, ortasında Fövqəladə Hallar Nazirliyinin emblemi həkk olunmuşdur. Emblemdən yuxarıda qövs boyunca “AZƏRBAYCAN RESPUBLİKASI”, aşağıda isə “FÖVQƏLADƏ HALLAR NAZİRLİYİ” sözləri yazılmışdır. Sözlərin arasında iki ədəd səkkizguşəli ulduz yerləşdirilmişdir."},{"page_url":"https://cs.wikipedia.org/wiki/Churg%C5%AFv%E2%80%93Straussov%C3%A9_syndrom","image_url":"http://upload.wikimedia.org/wikipedia/commons/3/34/Churg-Strauss_syndrome_-_high_mag.jpg","page_title":"Churgův–Straussové syndrom","context_page_description":"Churgův–Straussové syndrom, syn. alergická granulomatózní angiitida je systémová eosinofilní autoimunitní vaskulitida, vedoucí k nekróze. Ta se týká především krevních cév v plicích, trávicí soustavy a periferních nervů, postihuje ale též srdce, kůži a ledviny. Jedná se o vzácné nedědičné a nepřenosné onemocnění. V minulosti byl kvůli podobné morfologii považován za druh polyarteritis nodosa.\\nSyndrom byl poprvé popsán doktory Jákobem Churgem a Lotte Straussovou v nemocnici Mount Sinai Hospital v New Yorku v roce 1951.\\nNeléčený syndrom končí smrtí. Léčba zahrnuje vysoké dávky kortikosteroidů nebo kombinovanou imunosupresivní léčbu."},{"page_url":"https://pt.wikipedia.org/wiki/Torre_de_Vilanova_dos_Infantes","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/37/Vilanova_dos_Infantes_Celanova_torre.jpg","page_title":"Torre de Vilanova dos Infantes","context_page_description":"A Torre de Vilanova dos Infantes, também conhecida como Torre de Celanova, localiza-se no centro da povoação medieval de Vilanova dos Infantes, município de Celanova, na província de Ourense, comunidade autónoma da Galiza, na Espanha."},{"page_url":"https://da.wikipedia.org/wiki/Borgmester_Jensens_All%C3%A9","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/df/Borgmester_Jensens_All%C3%A9_03.JPG","page_title":"Borgmester Jensens Allé","context_page_description":"Borgmester Jensens Allé er en ca. 700 meter lang vej på Østerbro i København. Alleen begynder ved Jagtvej nær krydset Jagtvej/Østerbrogade og fortsætter til Serridslevvej ved Fælledparken. Indtil 2009 fortsatte den en stykke ind i Fælledparken, men blev afkortet til fordel for nogle fodboldbaner med kunstgræs.\\nDen lille trekantede plads ved Jagtvej, som består af græsbeklædte beskyttelsesrum, træer og en bænk, fik i 2009 navnet Lilly Helveg Petersens Plads efter den markante sporvejsborgmester, Lilly Helveg Petersen.\\nAlleen har navn efter borgmester Jens Jensen. Det er et præcist valg af navn, for den gamle finansborgmester var primusmotor i anlæggelsen af Fælledparken i begyndelsen af 1900-tallet. Han spillede også en betydningsfuld rolle i projekteringen af den nærliggende Idrætspark. Jens Jensen var formand for De Samvirkende Fagforbund og uddannet malersvend. Han blev valgt som Københavns første socialdemokratiske borgmester i 1903, og i 1924 blev han overpræsident i København. Da han døde i 1928, blev den da navnløse promenadevej gennem Fælledparken opkaldt efter ham."},{"page_url":"https://nl.wikipedia.org/wiki/Sint-Joriskerk_(Venlo)","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f8/Grafsteen_Joriskerk.jpg","page_title":"Sint-Joriskerk (Venlo)","context_page_description":"De Joriskerk is een protestantse kerk in Venlo en staat gedeeltelijk op de plaats waar vroeger het Sint Jorisgasthuis stond.\\nHet laat-gotische koor van de voormalige Gasthuiskapel vormt het oudste deel van de kerk. Het oude kerkje werd in 1632 aan de protestantse gemeente afgestaan, ging in 1637 voor de Hervormden verloren, maar kwam in 1702, bij de bezetting van Venlo door de Staatsen, definitief in hun bezit.\\nIn het begin van de achttiende eeuw gaven de Staten-Generaal van de Nederlanden bevel tot uitbreiding van de kerk. Reden daarvoor was dat de protestantse gemeenschap inmiddels flink was gegroeid door de komst van Hollandse en Zwitserse troepen. In 1718 werd de Sint-Joriskerk in zijn huidige vorm gebouwd. Bouwmeester was de Dordtenaar Pleun van Bolnes.\\nIn 1896 bezocht de rondtrekkende evangelist Heimerick Dekker Venlo om daar een gereformeerde gemeenschap van de grond te tillen. In 1910 kochten de gereformeerden een stuk grond aan de noordzijde van de Venlose binnenstad, om daar in 1910-1911 een kerkje met pastorie te bouwen. In 1967 werd dit kerkje afgebroken.\\nOp 19 juli 1911 werd Dekker door de Venlose kerk tot dominee beroepen."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%9F%D1%80%D0%BE%D0%B3%D0%BE","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4e/Kali_progo.jpg","page_title":"Прого","context_page_description":"Прого — река в южной части центральной Явы, Индонезия. Река проходит через две провинции — Центральная Ява и особый округ Джокьякарта. Исток реки находится на северном склоне вулкана Сундоро на высоте 2500 метров над уровнем моря. Длина реки — 138 км площадь бассейна — 2380 км². Средний расход воды — 30,3 м³/с."},{"page_url":"https://sr.wikipedia.org/wiki/%D0%9E%D0%BF%D1%88%D1%82%D0%B8%D0%BD%D0%B0_%D0%92%D0%BB%D0%B0%D1%81%D0%BE%D1%82%D0%B8%D0%BD%D1%86%D0%B5","image_url":"http://upload.wikimedia.org/wikipedia/commons/a/a5/Paraglajder_vlasotince.jpg","page_title":"Општина Власотинце","context_page_description":"Општина Власотинце се налази у југоисточној Србији и део је Јабланичког округа чије седиште је Лесковац."},{"page_url":"https://zh.wikipedia.org/zh-hk/%E9%A3%9E%E9%B1%BC%E6%B9%BE","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e7/Christmas_Island-CIA_WFB_Map.png","page_title":"飞鱼湾","context_page_description":"飛魚灣是澳大利亞海外領地聖誕島的首府以及主要居民點，位於該島東北部。當地於1888年創立，並是英國移民在聖誕島上的第一個聚居地。縱使飛魚灣本身是以英國測量船「陛下之艦飛魚號」命名，但是現時很多地圖基本只把當地簡單標示為「定居點」。\\n聖誕島當中約三分之一的人口在飛魚灣定居，而當地除了擁有一個能夠接待乘坐遊艇或帆船到來的各地遊客之小型港灣以外，也設有一個可以進行休閒潛水活動的沙灘。"},{"page_url":"https://en.wikipedia.org/wiki/Antenna_types","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/ae/Butterfly_television_antenna.jpg","page_title":"Antenna types","context_page_description":"In radio systems, many different antenna types are used with specialized properties for particular applications. Antennas can be classified in various ways. The list below groups together antennas under common operating principles, following the way antennas are classified in many engineering textbooks.\\nThe dipole, monopole, array and large loop antenna types below typically function as resonant antennas; waves of current and voltage bounce back and forth between the ends, creating standing waves along the elements. Aperture antennas can be resonant or not. Traveling wave antennas are nonresonant types, the current and voltage waves travel in one direction along the antenna elements."},{"page_url":"https://vi.wikipedia.org/wiki/Albrecht_von_Roon","image_url":"http://upload.wikimedia.org/wikipedia/commons/a/a3/Albrecht_Graf_von_Roon_by_Gustav_Gr%C3%A4f.jpg","page_title":"Albrecht von Roon","context_page_description":"Albrecht Theodor Emil Graf von Roon là một chính khách và quân nhân Phổ, đã trở thành Thống chế của quân đội Phổ. Với tư cách là Bộ trưởng Bộ Chiến tranh Phổ từ năm 1859 cho đến năm 1873, Roon, cùng với Thủ tướng Otto von Bismarck và Tổng tham mưu trưởng Helmuth von Moltke Lớn, là một nhân vật chủ chốt trong nền quân sự-chính trị nước Phổ vào thập kỷ 1860 – một giai đoạn quan trọng trong lịch sử Phổ, khi mà hàng loạt cuộc chiến tranh thắng lợi với Đan Mạch, Áo và Pháp đã dẫn đến sự thống nhất nước Đức dưới sự lãnh đạo của Phổ.\\nSau cuộc tổng động viên tồi tệ của quân đội Phổ vào năm 1859, Roon được Nhiếp chính vương Wilhelm chỉ định làm lãnh đạo một hội đồng xem xét việc cải tổ các lực lượng vũ trang Phổ. Chẳng bấy lâu sau đó, ông được nhậm chức Bộ trưởng Chiến tranh thay thế Eduard von Bonin – một người có khuynh hướng tự do hơn ông – vào cuối tháng 12. Được mệnh danh là một \\"người bảo thủ sáng suốt\\", ông nhận thấy vai trò trung tâm của lực lượng quân đội Phổ và những giá trị của nó trong việc khơi dậy tinh thần dân tộc của người Phổ, và đã tiến hành hàng loạt cải cách."},{"page_url":"https://pt.wikipedia.org/wiki/Aclive_Capitolino","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f1/Plan_capitole.png","page_title":"Aclive Capitolino","context_page_description":"Aclive Capitolino, também chamada de Clivo Capitolino, é a principal estrada antiga que leva ao Capitólio. Partindo do Fórum Romano do lado Arco de Tibério, era uma continuação da Via Sacra. Ela contorna o Templo de Saturno e vira para o sul bem na frente do Pórtico dos Deuses Harmoniosos, onde começa a subida do monte Capitolino até o Templo de Júpiter Capitolino no cume. Este era, tradicionalmente, o último trecho de todos os triunfos romanos.\\nA estrada é importante por ser uma das mais antigas estradas em Roma e também por sua localização central à volta dos templos e edifícios civis, levando até o maior e mais importante dos templos republicanos. Diz-se que Júlio César subiu o aclive de joelhos para contrabalançar um mau presságio durante seu triunfo.\\nA mais antiga história sobre a rua e sobre a própria colina não são muito claras, pois muitos dos mais antigos registros romanos foram destruídos num dos saques de Roma. A estada pode ter sido parte da rota original até a vila dos sabinos, alterada quando o Templo de Saturno foi construído."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%9A%D1%96%D1%81%D1%82%D0%BA%D0%BE%D0%B2%D1%96_%D1%80%D0%B8%D0%B1%D0%B8","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/22/Black_bullhead_flipped.jpeg","page_title":"Кісткові риби","context_page_description":"Кісткові риби — за застарілою класифікацією клас риб, що поділявся на підкласи лопатеперих і променеперих риб. За сучасною класифікацією представники цієї групи разом із чотириногими складають кладу Euteleostomi.\\nГрупа охоплює близько 18 тис. видів. У хребті переважає кісткова тканина, тільки у найпримітивніших видів — хрящовий скелет на вапняковій основі. Представники мають парні кінцівки. Рот цих риб утворено хапаючими щелепами із зубами, зябра розташовані на зябрових дугах з внутрішньою скелетною опорою, ніздрі парні."},{"page_url":"https://ja.wikipedia.org/wiki/%E5%9B%BD%E9%89%84%E3%82%AD%E3%83%8F45%E7%B3%BB%E6%B0%97%E5%8B%95%E8%BB%8A","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/04/JR_West_Kiha_23_507_Higashi_Hagi.jpg","page_title":"国鉄キハ45系気動車","context_page_description":"キハ45系気動車は、日本国有鉄道が1966年から1969年にかけて179両を製造し、JR各社に引き継がれたのち2003年まで運用、2009年まで在籍した気動車である。キハ23系気動車と呼ばれることもある。\\n都市近郊の通勤輸送と中長距離輸送の機能を併せ持つ気動車として構想され、従来の一般形気動車よりも出入口幅、通路幅が広くとられた近郊形と位置付けられる。エンジン、変速機、台車などは当時の標準的なものを採用している。\\nキハ45系の呼称は、正式の系列呼称ではなく、同一の設計思想によって製造されたキハ23・キハ24・キハ45・キハ46・キハ53の各形式を総称したものである。"},{"page_url":"https://en.wikipedia.org/wiki/Laxey_Wheel","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4c/Laxey_Wheel%2C_September_2015.jpg","page_title":"Laxey Wheel","context_page_description":"The Laxey Wheel is built into the hillside above the village of Laxey in the Isle of Man. It is the largest working waterwheel in the world. Designed by Robert Casement, the wheel has a 72-foot-6-inch diameter, is 6 feet wide and revolves at approximately three revolutions per minute."},{"page_url":"https://te.wikipedia.org/wiki/%E0%B0%AE%E0%B0%AF%E0%B1%8A%E0%B0%9F%E0%B1%8D%E0%B0%9F%E0%B1%86","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f9/2019-03-08-Mayotte_Bathymetry-EW-profile.png","page_title":"మయొట్టె","context_page_description":"ఫ్రెంచ్ ప్రాంతంలో మాయొట్టి అధికారిక నామం మాయొట్టి డిపార్టమెంట్ డి మౌరిటనియే.\\nఇందులో ఒక ప్రధాన ద్వీపం గ్రాండే-టెర్రె, ఒక చిన్న ద్వీపం పెటిటే-టెర్రె ఉన్నాయి. ఈ రెండు ద్వీపాల చుట్టూ అనేక ద్వీపాలు ఇందులో భాగంగా ఉన్నాయి. ద్వీపసమూహం వాయువ్య మడగాస్కరు ఈశాన్య మొజాంబిక్ మధ్య ఆగ్నేయ ఆఫ్రికా తీరంలో హిందూ మహాసముద్రంలో ఉత్తర మొజాంబిక్ చానలులో ఉంది. ఫ్రాంసు ప్రాంతాలలో \\" డిపార్టుమెంట్ ఆఫ్ మయొట్టె \\" పేద ప్రాంతంగా భావించబడుతున్నప్పటికీ మొజాంబిక్ చానెల్‌లో ఉన్న దేశాలలో ఇది సుసంపన్న దేశంగా భావించబడుతుంది. ఫలితంగా మాయొట్టి అక్రమ వలసలకు ఒక ప్రధాన గమ్యంగా ఉంది.\\nమాయొట్టి ప్రాంతం 374 చ.కి.మీ ఒక 2017 గణాంకాలు ఆధారంగా జనసంఖ్య 256,518. జనసాంధ్రత చ.కి.మీ. 686. గ్రాండే-టెర్రె ద్వీపంలోని మమౌడ్జౌ అతిపెద్ద నగరం, ప్రిఫెక్చరుగా ఉంది. అయినప్పటికీ డ్జయోడ్జి- పమండ్జి అంతర్జాతీయ విమానాశ్రయం పొరుగున ఉన్న పెటిటే-టెర్రె ద్వీపంలో ఉంది. భూభాగం భౌగోళికంగా కొమొరో దీవులలో భాగంగా ఉంది. భూభాగం ముఖ్యంగా కొమొరోస్ యూనియనులో దీనిని దాని ప్రధాన ద్వీపం పేరుతో మయోరి అంటారు.\\nమాయోట్టే ఒక ప్రత్యేక విభాగంగా ఉన్నప్పటికీ ప్రస్తుతం ఫ్రాన్సులో అంతర్భాగంగా ఉన్నప్పటికీ ప్రజలలో చాలామందికి మొదటి భాషగా ఫ్రెంచి వాడుకభాషగా ఉంది. అయినప్పటికీ పాతనివేదికలో 14 సంవత్సరాలకు మించిన వారు తాము ఫ్రెంచి మాట్లాడగలగలమని గణాంకాలలో పేర్కొన్నారని వివరించబడింది."},{"page_url":"https://zh.wikipedia.org/zh-tw/%E7%BE%85%E5%AE%89%E9%81%94%E9%90%B5%E8%B7%AF","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a1/Malange_Estacao-CfL_2011-08_IMG1487.jpg","page_title":"羅安達鐵路","context_page_description":"羅安達鐵路，是安哥拉三條鐵路幹線之一，西始於大西洋北部沿岸的首都羅安達，經恩達拉坦多，東抵馬蘭熱。全長424公里，採用1067mm窄軌。\\n1909年啟用。安哥拉內戰時期受破壞，至1992年停運。\\n內戰結束後花費40億美元並得到中國協助，中鐵建五院勘察設計，中鐵建二十局承建。在2011年1月13日重建完成通車。牽引定數700噸。 另羅安達邦戈至巴亞的36km按照城際鐵路標準修建，雙線路基，單線鋪軌，設車站12個，四川國際經濟技術合作有限公司承建。"},{"page_url":"https://de.wikipedia.org/wiki/Schloss_Schwarzenberg_(Sachsen)","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d3/Schw.b._Schmiedearbeit.jpg","page_title":"Schloss Schwarzenberg (Sachsen)","context_page_description":"Das Schloss Schwarzenberg ist aus einer mittelalterlichen Wehranlage hervorgegangen und prägt neben der St.-Georgen-Kirche das Bild der Großen Kreisstadt Schwarzenberg im sächsischen Erzgebirgskreis."},{"page_url":"https://bg.wikipedia.org/wiki/%D0%A5%D1%80%D0%B0%D0%BC%D0%BE%D0%B2%D0%B5_%D0%B2_%D0%9F%D0%BB%D0%BE%D0%B2%D0%B4%D0%B8%D0%B2","image_url":"http://upload.wikimedia.org/wikipedia/commons/b/bf/Cathedral_Plovdiv.jpg","page_title":"Храмове в Пловдив","context_page_description":"Храмове в Пловдив имат всички религии. В града преобладава християнското население от всички клонове на християнската религия – православни, католици, арменско-апостолическо изповедание, протестанти. В града има мюсюлманска и еврейска общности."},{"page_url":"https://zh.wikipedia.org/zh-tw/%E5%86%85%E8%92%99%E5%8F%A4%E5%85%A8%E5%9B%BD%E9%87%8D%E7%82%B9%E6%96%87%E7%89%A9%E4%BF%9D%E6%8A%A4%E5%8D%95%E4%BD%8D%E5%88%97%E8%A1%A8","image_url":"http://upload.wikimedia.org/wikipedia/commons/d/d4/Dazhao_%28Wuliang%29_Temple_of_Hohhot2.JPG","page_title":"内蒙古全国重点文物保护单位列表","context_page_description":"本列表是中國全國重點文物保護單位的子列表，列舉在內蒙古自治區境內的全國重點文物保護單位。"},{"page_url":"https://uk.wikipedia.org/wiki/%D0%94%D0%B6%D1%83%D0%B7%D0%B5%D0%BF%D0%BF%D0%B5_%D0%92%D1%96%D1%87%D1%96%D0%BD%D0%BE","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/ba/Giuseppevicinox.png","page_title":"Джузеппе Вічіно","context_page_description":"Джузеппе Вічіно — італійський веслувальник, бронзовий призер Олімпійських ігор 2016 року, дворазовий чемпіон світу."},{"page_url":"https://es.wikipedia.org/wiki/Casa_natal_de_Alejandro_VI","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/32/X%C3%A0tiva._Casa_d%27Alexandre_VI._Placa.jpg","page_title":"Casa natal de Alejandro VI","context_page_description":"La Casa natal de Alejandro VI está situada en Játiva. Se trata de una casa urbana, en donde nació y residió en el Reino de Valencia el Papa Alejandro VI. Según narra la tradición, en el número 5 de la antigua plaza d’Aldomar se encontraba la casa natal de Rodrigo de Borja, actualmente Plaza de Alejandro VI.\\nDe la casa original donde nació el Papa Alejandro VI, tan sólo se conserva la puerta de amplio dovelaje."},{"page_url":"https://bn.wikipedia.org/wiki/%E0%A6%AE%E0%A7%81%E0%A6%B8%E0%A7%8C%E0%A6%B0%E0%A7%80","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4a/Massourie-cloudy-morning.jpg","page_title":"মুসৌরী","context_page_description":"মুসৌরী হলো ভারতের উত্তরাংশে অবস্থিত উত্তরাখণ্ড রাজ্যের দেরাদুন জেলার একটি শৈলশহর ও পৌরবোর্ড। শহরটি রাজ্যসদর দেরাদুন থেকে ৩৫ কিলোমিটার উত্তরে এবং রাজধানী দিল্লি থেকে ২৯০ কিমি উত্তরপূর্বে অবস্থিত। শৈলশহরটি হিমালয় পর্বতমালার গাড়োয়াল বিভাগের পর্বত পাদদেশে রয়েছে। পার্শ্ববর্তী ল্যান্ডর সেনানিবাস এবং তৎসংলগ্ন বার্লোগঞ্জ ঐ ঝড়িপানি শহরাঞ্চলগুলিকে 'বৃৃৃৃহত্তর মুসৌরী'র অংশ বলে গণ্য করা হয়ে থাকে। মুসৌরীর ডাক সূচক সংখ্যা হলো ২৪৮১৭৯।\\nমুসৌরী শৈলশহরটি সমুদ্রতল থেকে মোটামুটিভাবে ১, ৮৮০ মিটার উচ্চতায় অবস্থিত। এর উত্তর-পূর্ব দিক বরাবর রয়েছে হিমালয় তুষার শৃৃৃঙ্গ, দক্ষিণে রয়েছে দুন উপত্যকা এবং শিবালিক পর্বতশ্রেণি। পার্শ্ববর্তী অঞ্চলে অবস্থিত উচ্চতম চূড়াগুলির মধ্যে ল্যান্ডরের লাল টিব্বা, যার উচ্চতা প্রায় ২, ২৭৫ মিটার । জনপ্রিয়তা ও মনোরম দৃৃশ্যের জন্য মুসৌরীকে \\"পর্বতের রাণী\\" আখ্যায়িত করা হয়ে থাকে।"},{"page_url":"https://hu.wikipedia.org/wiki/Imperia_megye","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7f/Imperia_mappa.png","page_title":"Imperia megye","context_page_description":"Imperia megye a Liguria régió egyik megyéje. Lakosainak száma 222 273. Északon Piemonttal, keleten Savona megyével, nyugaton Franciaországgal, délen a Ligur-tengerrel határos.\\nSzékhelye Imperia Trapani és Caltanissetta megyék mellett a harmadik olyan olasz megye, ahol a székhely nem a legnépesebb város. Imperiát lakosságszám tekintetében a megyében Sanremo előzi meg."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%A5%D0%B0%D1%80%D1%87%D0%B5%D0%BD%D0%BA%D0%BE_%D0%9A%D0%B0%D1%82%D0%B5%D1%80%D0%B8%D0%BD%D0%B0_%D0%86%D0%B2%D0%B0%D0%BD%D1%96%D0%B2%D0%BD%D0%B0","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/ce/%D0%A5%D0%B0%D1%80%D1%87%D0%B5%D0%BD%D0%BA%D0%BE_%D0%9A%D0%B0%D1%82%D0%B5%D1%80%D0%B8%D0%BD%D0%B0_%D0%86%D0%B2%D0%B0%D0%BD%D1%96%D0%B2%D0%BD%D0%B0_%D0%B0%D0%B2%D1%82%D0%BE%D0%B3%D1%80%D0%B0%D1%84_1945.png","page_title":"Харченко Катерина Іванівна","context_page_description":"Катери́на Іва́нівна Ха́рченко — український політичний і господарський діяч. Депутат, член Мандатної комісії Верховної Ради УРСР 1-го скликання. Член ЦК КПУ."},{"page_url":"https://ca.wikipedia.org/wiki/Monserrate","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a2/Cerro_Monserrate_-_Bogot%C3%A1.JPG","page_title":"Monserrate","context_page_description":"El turó de Monserrate juntament amb el Turó de Guadalupe constitueixen els anomenats turons tutelars de Bogotà. Monserrate té una altitud de 3152 msnm i s'ubica sobre la Serralada Oriental. Els turons de Bogotà, d'origen metamòrfic, tenen més de 10.000 anys d'antiguitat, pel que fa a l'aspecte geològic.\\nEl turó de Monserrate ha estat lloc de peregrinació religiosa des de l'època colonial i és un atractiu natural, religiós, gastronòmic i mirador de la ciutat. L'accés pot realitzar-se a peu per un sender per a vianants, telefèric o funicular."},{"page_url":"https://el.wikipedia.org/wiki/%CE%A4%CE%B1%CE%BF%CF%81%CE%BC%CE%AF%CE%BD%CE%B1","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ed/Etna_vanaf_het_Griekse_theater_in_Taormina.JPG","page_title":"Ταορμίνα","context_page_description":"Η Ταορμίνα είναι κωμόπολη στην Μητροπολιτική πόλη της Μεσσίνας της βορειοανατολικής Σικελίας στην Ιταλία. Έχει πληθυσμό περίπου 11.000 κατοίκων και εκτείνεται σε 13 τετραγωνικά χιλιόμετρα. Ιδρύθηκε από τους αποίκους της Νάξου Σικελίας ως Ταυρομένιο και αποτέλεσε σημαντική πόλη των αποικιών της Μεγάλης Ελλάδας στην κάτω Ιταλία, και μετέπειτα σημαντικό εμπορικό κόμβο κατά την ρωμαϊκή/βυζαντινή περίοδο. Κατόπιν αποτέλεσε διαδοχική κτήση διάφορων κατακτητών από Άραβες και Νορμανδούς κατά τον Μεσαίωνα, έως τα διάφορα ιταλικά κρατίδια και ισπανικές και γαλλικές ηγεμονίες κατά την ύστερη Αναγέννηση και Διαφωτισμό. Μετά την ενοποίηση της Ιταλίας και κατασκευή σιδηροδρόμου τον 19ο αιώνα, η πόλη αναπτύχθηκε ξανά και αποτέλεσε δημοφιλή τουριστικό προορισμό αποκτώντας κοσμοπολίτικο χαρακτήρα, εξακολουθώντας να έχει υψηλό αριθμό επισκεπτών έως σήμερα."},{"page_url":"https://be-tarask.wikipedia.org/wiki/%D0%9D%D0%B0%D1%86%D1%8B%D1%8F%D0%BD%D0%B0%D0%BB%D1%8C%D0%BD%D0%B0%D1%8F_%D0%B3%D0%B0%D0%BB%D0%B5%D1%80%D1%8D%D1%8F_%D0%92%D1%96%D0%BA%D1%82%D0%BE%D1%80%D1%8B%D1%96","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/14/National_Gallery_of_Victoria_from_Eurkea_Tower.jpg","page_title":"Нацыянальная галерэя Вікторыі","context_page_description":"Нацыянальная галерэя Вікторыі — мастацкая галерэя, якая знаходзіцца ў Мэльбурне, Аўстралія. Гэта старэйшая, а таксама найвялікшая мастацкая галерэя ў Аўстраліі.\\nАдкрыцьцё музэю супала з залатой ліхаманкай у Вікторыі, Мэльбурн стаў найбуйнейшым горадам, а штат Вікторыя найбагацейшым штатам Аўстраліі.\\nУ галерэі прадстаўлены работы Антоніса Ван Дэйка, Паолё Ўчэльлё, Пітэра Паўля Рубэнса, Рэмбранта, Джаваньні Батыста Т'епалё, Паолё Вэранэзэ, Клёда Манэ, Паблё Пікаса і іншых вядомых мастакоў. Акрамя карцінаў, у галерэі прадстаўлены артэфакты старажытнага Эгіпту, грэцкія вазы, гістарычная эўрапейская кераміка і мноства іншых экспанатаў, якія прадстаўляюць гістарычную і культурную каштоўнасьць. Усяго ў галерэі прадстаўлена больш за 65 тыс. экспанатаў.\\nПры галерэі з 1867 году працавала школа мастацтваў, якая да 1910 году зьяўлялася вядучай школай мастацтваў у Аўстраліі."},{"page_url":"https://it.wikipedia.org/wiki/Castello_della_Cecchignola","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8c/Castello_della_Cecchignola_ingresso_est.jpg","page_title":"Castello della Cecchignola","context_page_description":"Il castello della Cecchignola è un complesso di diverse epoche, sede di alcune fondazioni culturali, di una biblioteca specializzata nell'arte e materiali lapidei, e dell'Università dei marmorari, situato a Roma nel quartiere Giuliano-Dalmata.\\nLa torre maggiore, parte principale del complesso, è conservata per due terzi dell'altezza originaria e, oltre alla base romana, presenta ancora segni riconoscibili di tecniche architettoniche del XIII, del XVIII e del XIX secolo."},{"page_url":"https://it.wikipedia.org/wiki/Desco_da_parto","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/17/Masaccio_-_Desco_da_parto.jpg","page_title":"Desco da parto","context_page_description":"Un desco da parto è un tondo dipinto su entrambi i lati che durante il Rinascimento veniva offerto come dono cerimoniale alle donne delle famiglie più abbienti che avevano appena partorito. Veniva usato come vassoio per portare le vivande alla nuova madre, finché si riposava a letto."},{"page_url":"https://zh.wikipedia.org/wiki/%E9%AD%85%E6%83%91%E8%A7%92%E9%BE%8D%E5%B1%AC","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/33/Mojoceratops.jpg","page_title":"魅惑角龍屬","context_page_description":"魅惑角龙属是角龙科开角龙亚科恐龙的一属，生存于白垩纪晚期的北美洲。\\n正模标本是一个部分头颅骨，包含顶骨在内。副模标本是两个部分顶骨。除此之外，还有五个标本被归类于魅惑角龙。这些标本都发现于加拿大的亚伯达省与萨克其万省，属于贝利河群的恐龙公园组，地质年代约7650万到7500万年前，相当于晚白垩纪的晚坎潘阶。在过去历史里，这些化石都被归类于开角龙。在2010年，加拿大古生物学家尼可拉斯·郎里奇将这些化石建立为新属，模式种是魅惑角龙。"},{"page_url":"https://simple.wikipedia.org/wiki/Pitchfork","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/83/CompostBinTube_wb.jpg","page_title":"Pitchfork","context_page_description":"A pitchfork is a tool used in farming. It is similar to a garden fork, made of metal or another hard material, with three or more pointed ends. Its long handle, made of wood or hard plastic, is for use while standing. It is usually about the same size as a shovel. It is used to move hay and other materials."},{"page_url":"https://en.wikipedia.org/wiki/List_of_foreign_recipients_of_the_Knight%27s_Cross_of_the_Iron_Cross","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fa/J%C3%A1ny_Guszt%C3%A1v.jpg","page_title":"List of foreign recipients of the Knight's Cross of the Iron Cross","context_page_description":"In total, 43 individuals in the military of allies of Nazi Germany were awarded the Knight's Cross of the Iron Cross, the highest award in the military of Nazi Germany during World War II. Eight of these men were also honoured with the next higher grade, the Oak Leaves to the Knight's Cross, and one senior naval officer, Fleet Admiral Isoroku Yamamoto, was additionally awarded the Swords to the Knight's Cross with Oak Leaves. Among the recipients were eighteen Romanians, nine Italians, eight Hungarians, two Slovaks, two Japanese, two Spaniards, two Finns, one Dutch man, and one Belgian.\\nColonel General Dezső László of Hungary became the last foreign recipient of the award on 3 March 1945. The last surviving foreign recipient of the award was Belgian politician Léon Degrelle, who died on 31 March 1994, fifty years after receiving the medal from Hitler's hands."},{"page_url":"https://en.wikipedia.org/wiki/Amarna_art","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/bd/Head_of_a_daughter_of_Akhenaten._18th_Dynasty%2C_c._1345_BC._State_Museum_of_Egyptian_Art%2C_Munich.jpg","page_title":"Amarna art","context_page_description":"Amarna art, or the Amarna style, is a style adopted in the Amarna Period during and just after the reign of Akhenaten in the late Eighteenth Dynasty, during the New Kingdom. Whereas Ancient Egyptian art was famously slow to alter, the Amarna style was a significant and sudden break from its predecessor, which was restored after Akhenaten's death. It is characterized by a sense of movement and activity in images, with figures having raised heads, many figures overlapping and many scenes busy and crowded. The human body is portrayed differently; figures, always shown in profile on reliefs, are slender, swaying, with exaggerated extremities. In particular, depictions of Akhenaten give him distinctly feminine qualities such as large hips, prominent breasts, and a larger stomach and thighs. Other pieces, such as the most famous of all Amarna works, the Nefertiti Bust in Berlin, show much less pronounced features of the style.\\nAmenhotep IV was one of the first to practice monotheism, the belief in just one god. Shortly after claiming the throne, he declared the god Aten, represented by the sun, was the only true god."},{"page_url":"https://tl.wikipedia.org/wiki/Pasas","image_url":"http://upload.wikimedia.org/wikipedia/commons/0/0b/Single_raisin.jpg","page_title":"Pasas","context_page_description":"Ang pasas ay ang tawag sa tinuyo o panat na ubas. Kalimitan itong inilalagay sa mga tinapay, mamon, o keyk."},{"page_url":"https://sv.wikipedia.org/wiki/%C3%85s%C3%B6_vuxengymnasium","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/52/%C3%85s%C3%B6_gymnasium_2014a.jpg","page_title":"Åsö vuxengymnasium","context_page_description":"Åsö vuxengymnasium är en kommunal gymnasieskola belägen på Södermalm i Stockholm, inriktad på vuxenutbildning, komvux, och är som sådan en av Stockholms största med cirka 6 000 studerande årligen. Vuxengymnasiet har även ingång belägen vid Götgatan.\\nSkolbyggnaden uppfördes 1964-1968 efter ritningar av arkitekten Paul Hedqvist och invigdes 29 april 1968 som Åsö gymnasium.\\nÅsö vuxengymnasium har förutom ordinarie vuxenutbildning specialpedagogiska kurser som vänder sig till vuxna som tidigare har gått i svensk grundskola men som ändå upplever sig sakna tillräckliga kunskaper för att komma vidare i studier eller arbete."},{"page_url":"https://ja.wikipedia.org/wiki/%E3%82%A6%E3%83%8B%E3%82%AF%E3%82%B9%E9%AB%98%E5%B4%8E","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/55/UNICUS-Takasaki_001.JPG","page_title":"ウニクス高崎","context_page_description":"ウニクス高崎は、群馬県高崎市に所在するネイバーフッド型ショッピングセンターである。運営は株式会社ウニクス。\\nスーパーマーケットのヤオコーを核テナントとして2008年11月27日、高崎木材市場跡地にオープンした。"},{"page_url":"https://ro.wikipedia.org/wiki/Lista_consor%C8%9Bilor_regali_englezi","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/19/ElizabethWoodville.JPG","page_title":"Lista consorților regali englezi","context_page_description":"Consorții regali englezi au fost soțiile/soții monarhilor regatului Angliei. Cei mai mulți dintre consorți au fost femei și au deținut titul de regină consort. Regatul Angliei s-a unit cu cel al Scoției în 1707 și s-a numit Regatul Marii Britanii. Astfel, de la aceea dată nu au mai existat consorți englezi.\\nPentru consorții britanici vezi Lista consorților regali britanici"},{"page_url":"https://pl.wikipedia.org/wiki/Michai%C5%82_Bondarienko_(major)","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1b/%D0%9C%D0%B8%D1%85%D0%B0%D0%B8%D0%BB_%D0%97%D0%B0%D1%85%D0%B0%D1%80%D0%BE%D0%B2%D0%B8%D1%87_%D0%91%D0%BE%D0%BD%D0%B4%D0%B0%D1%80%D0%B5%D0%BD%D0%BA%D0%BE_1943.jpg","page_title":"Michaił Bondarienko (major)","context_page_description":"Michaił Zacharowicz Bondarienko, Mychajło Zacharowycz Bondarenko – radziecki lotnik wojskowy, dwukrotny Bohater Związku Radzieckiego."},{"page_url":"https://ca.wikipedia.org/wiki/Retaule_de_Vallmoll","image_url":"http://upload.wikimedia.org/wikipedia/commons/c/c9/Huguet_MareDeu_Vallmoll-detall.jpg","page_title":"Retaule de Vallmoll","context_page_description":"El Retaule de Vallmoll va ser creat cap al 1450 per a l'església de Santa Maria de Vallmoll i és obra de Jaume Huguet. És una de les primeres obres de l'autor i va ser realitzat seguint la tècnica de tremp d'ou amb relleus d'estuc i daurat amb pa d'or sobre taula.\\nDe l'estructura del retaule només es conserven tres taules: la taula central del retaule al Museu Nacional d'Art de Catalunya, l'Anunciació al Museu Diocesà de Tarragona i la predel·la amb un Plany sobre el cos de Crist al Louvre.\\nEn aquesta obra s'evidencia la influència de l'escola dels primitius flamencs adquirida pel contacte amb Lluís Dalmau, un pintor format al taller de Jan van Eyck."},{"page_url":"https://zh-yue.wikipedia.org/wiki/%E6%A4%B0%E5%AD%90","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/66/Heliconia_flower_in_front_of_juvenile_coconut_palm_%28Amboli_jungle%29.jpg","page_title":"椰子","context_page_description":"椰子（粵拼：je⁴ zi²；學名：Cocos nucifera），又叫椰樹（je⁴ syu⁶）或椰子樹（je⁴ zi² syu⁶），係棕櫚科椰屬嘅常綠喬木。佢係一種熱帶植物，喺熱帶地方嘅海邊可以搵到。"},{"page_url":"https://en.wikipedia.org/wiki/Great_Women_Masters_of_Art","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e7/Leonor_Fini.jpg","page_title":"Great Women Masters of Art","context_page_description":"Great Women Masters of Art is a 2003 reference work assembled and edited by the art historian Jordi Vigué, on women painters through the ages.\\nThe preface of the book declares its motivation to fill the \\"lagoons of oblivion and contradicting opinions\\" regarding women's art. It confesses immediately the difficulties of handling such a broad subject, but after a short overview of women painters through the ages, it settles on the following list of women, where each entry includes a few illustrations:"},{"page_url":"https://eu.wikipedia.org/wiki/Kemi","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5b/Selk%C3%A4lokki.jpg","page_title":"Kemi","context_page_description":"Kemi Botniako golkoaren ertzean eta Kemi ibaiaren itsasadarrean dagoen Lappi eskualdeko hiria da. Oulurekin batera, Finlandia iparraldeko industria-hiri ezagunena da eta Kemi-Tornio Ardatza izeneko eskualde ekonomikoan dago, alegia, Lappiren motore ekonomikoa den eskualdean. Azaleraren zati nagusia itsas eremua da eta 95,27 km²-ko lur-azalera baino ez dauka; ondorioz, Lappi osoko hiri txikiena da. Hiriaren azpiegitura nagusia portua da eta bertako itsas merkataritza bideei esker batik bat, Ardatza Finlandiako BPG per capita handiena duen bosgarren azpieskualdea da. Kemiko parke nazional bakarra ere Botniako badian dago, Perämeri Parke Nazionala. Bertan, itsas fauna basatia industriaguneko kutsaduratik babesturik dago eta bisitariek hiria osatzen duten ehunka uharteak bisitatzeko aukera dute. Eskualdeko lau itsas udalerritako bat izateaz gain, biztanle gehien dauzkan Lappiko hirugarren hiria ere bada, guztira, 22.500 bat lagun."},{"page_url":"https://ja.wikipedia.org/wiki/%E8%BB%8D%E6%9C%8D_(%E4%B8%AD%E3%83%BB%E6%9D%B1%E6%AC%A7)","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/20/Romeo_Popescu_impreuna_cu_prietenul_sau_Vasile_Ionescu_%28mijloc%29%2C_viitor_comandant_al_Scolii_militare_de_la_Tecuci.jpg","page_title":"軍服 (中・東欧)","context_page_description":"中・東欧の軍服は、19世紀以降の中央ヨーロッパ・東ヨーロッパ諸国における軍服の変遷について述べる。\\n本項目で対象とする諸国は以下の通りである。\\nポーランド\\nウクライナ\\nチェコスロバキア\\nハンガリー\\nスイス\\nルーマニア\\nブルガリア\\nユーゴスラビア\\nアルバニア\\nギリシャ\\nオランダ\\nベルギー\\nバルト三国\\nなお、ベラルーシの軍服については軍服_で扱う。"},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_denkmalgesch%C3%BCtzten_Objekte_in_Wien/Penzing","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/64/Wagnervillwien1.jpg","page_title":"Liste der denkmalgeschützten Objekte in Wien/Penzing","context_page_description":"Die Liste der denkmalgeschützten Objekte in Wien-Penzing enthält die 119 denkmalgeschützten, unbeweglichen Objekte des 14. Wiener Gemeindebezirks Penzing."},{"page_url":"https://en.wikipedia.org/wiki/Peggy_Schwarz","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e0/Peggy_Schwarz.jpg","page_title":"Peggy Schwarz","context_page_description":"Peggy Schwarz is a German figure pair skater. She first gained prominence skating with Alexander König. The duo captured a bronze medal at the 1988 European Figure Skating Championships and then won gold at the German Figure Skating Championships in 1992. They also competed in the Winter Olympics three times, finishing 7th in 1988, 1992, and again in 1994.\\nSchwarz took a break from skating and gave birth to a son, Michel, in 1995. The following year, she joined forces with Mirko Müller. The pair went on to win three gold medals at the German nationals from 1998 to 2000. After competing in the 1998 Winter Olympics, they captured the bronze medal at the World Figure Skating Championships that year. Schwarz retired from skating in 2000."},{"page_url":"https://sr.wikipedia.org/wiki/%D0%A6%D0%B8%D1%81%D1%82%D0%B5%D1%80%D0%BD%D0%B0_%D0%91%D0%B0%D0%B7%D0%B8%D0%BB%D0%B8%D0%BA%D0%B0","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/97/Rinaldo1715.jpg","page_title":"Цистерна Базилика","context_page_description":"Цистерна Базилика или Потопљена палата, како је називају Турци је античка подземна цистерна која се налази између Хиподрома и Свете Софије у Истанбулу. Снабдевала је водом центар византијског Цариграда и позната је по својим мермерним стубовима носачима. Цистерна Базилика је највећа од неколико стотина таквих подземних цистерни у Истанбулу.\\nОва подземна цистерна је добила име Цистерна Базилика по великој базилици која се налазила тачно изнад ње, на првом од седам константинопољских брежуљака."},{"page_url":"https://sv.wikipedia.org/wiki/Shaw_Clifton","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1c/Shaw_Clifton_30_juni_2007.jpg","page_title":"Shaw Clifton","context_page_description":"Shaw Clifton, född den 21 september 1945, är en brittisk fräsningsofficer och Frälsningsarméns 18:e general från och med den 1 april 2006 till den 2 april 2011.\\nClifton blev frälsningsofficer 5 juli 1973 och kom då från kåren Edmonton, Storbritannien. Han var gift med Helen Ashman sedan 15 juli 1967 fram till hennes död 14 juni 2011 och är sedan 2013 gift med den danska frälsningsofficren Birgitte Brekke. Hans första uppdrag som officer var som kårledare varefter han 1973–1974 hade uppdrag vid internationella högkvarteret i London. Åren 1975–1979 var paret stationerade i Rhodesia varpå de återvände till det Brittiska territoriet där de hade olika uppdrag som kårledare, divisionschef m.m. I juni 1995 blev han divisionschef i USA:s östra territorium.\\nHan har varit ledare för Frälsningsarmén i Pakistan från augusti 1997, i Nya Zeeland, Fiji och Tonga från mars 2002 och juni 2004 - 31 mars 2006 i Storbritannien och republiken Irland.\\n28 januari 2006 blev han av Frälsningsarméns höga råd utsedd att från och med den 1 april 2006 överta uppdraget som general då John Larsson pensionerades."},{"page_url":"https://kn.wikipedia.org/wiki/%E0%B2%AA%E0%B2%BE%E0%B2%A6%E0%B2%AF%E0%B2%BE%E0%B2%A4%E0%B3%8D%E0%B2%B0%E0%B3%86_%E0%B2%AE%E0%B2%BE%E0%B2%A1%E0%B3%81%E0%B2%B5%E0%B2%BF%E0%B2%95%E0%B3%86","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4f/Trek.JPG","page_title":"ಪಾದಯಾತ್ರೆ ಮಾಡುವಿಕೆ","context_page_description":"ಪಾದಯಾತ್ರೆ ಮಾಡುವಿಕೆ ಎಂಬುದು ಒಂದು ಹೊರಾಂಗಣ ಚಟುವಟಿಕೆಯಾಗಿದ್ದು ಸ್ವಾಭಾವಿಕ ಪರಿಸರಗಳಲ್ಲಿನ ನಡಿಗೆಯನ್ನು ಇದು ಒಳಗೊಂಡಿರುತ್ತದೆ ಮತ್ತು ಇದು ಅನೇಕವೇಳೆ ಪರ್ವತಮಯ ಪ್ರದೇಶಗಳಲ್ಲಿನ ಪಾದಯಾತ್ರೆಯ ಕಾಲುದಾರಿಗಳಲ್ಲಿ ನಡೆಯುವ ಪಾದಯಾತ್ರೆಯಾಗಿರುತ್ತದೆ. ಇದೆಂಥಾ ಜನಪ್ರಿಯ ಚಟುವಟಿಕೆಯೆಂದರೆ, ವಿಶ್ವಾದ್ಯಂತ ಹಲವಾರು ಪಾದಯಾತ್ರೆಯ ಸಂಘಟನೆಗಳು ಅಸ್ತಿತ್ವದಲ್ಲಿರುವುದನ್ನು ನಾವು ಕಾಣಬಹುದು. ವಿಭಿನ್ನ ಬಗೆಯ ಪಾದಯಾತ್ರೆಗಳಿಂದ ದೊರೆಯುವ ಆರೋಗ್ಯದ ಪ್ರಯೋಜನಗಳು ಅಧ್ಯಯನಗಳಲ್ಲಿ ದೃಢೀಕರಿಸಲ್ಪಟ್ಟಿವೆ. ಪಾದಯಾತ್ರೆ ಮಾಡುವಿಕೆ ಎಂಬ ಪರಿಭಾಷೆಯನ್ನು ಇಂಗ್ಲಿಷ್‌-ಮಾತನಾಡುವ ದೇಶಗಳೆಲ್ಲೆಡೆ ಅರ್ಥೈಸಿಕೊಳ್ಳಲಾಗುತ್ತದೆಯಾದರೂ, ಬಳಕೆಯಲ್ಲಿ ಒಂದಷ್ಟು ವ್ಯತ್ಯಾಸಗಳಿರುವುದನ್ನು ನಾವು ಕಾಣಬಹುದು."},{"page_url":"https://en.wikipedia.org/wiki/European_Fishery_MLS","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5f/Tapes_decussatus2.jpg","page_title":"European Fishery MLS","context_page_description":"In European Union member states, there exists a standard set of minimum landing sizes for all major species of finfish and shellfish. These MLS are set under EU Council Regulation 850/98."},{"page_url":"https://de.wikipedia.org/wiki/Thutmosis_III.","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6a/Rechmire-Tributszene.jpg","page_title":"Thutmosis III.","context_page_description":"Thutmosis III. war der sechste altägyptische König der 18. Dynastie. Er bestieg am 4. Schemu I 1479 v. Chr. den Thron und regierte bis zum 30. Peret III 1425 v. Chr.\\nThutmosis III. stammte aus der Ehe des Königs Thutmosis II. mit einer Nebenfrau namens Isis. Hauptgemahlin des Thutmosis II. war Hatschepsut. Da Thutmosis III. bei der Thronbesteigung offensichtlich noch ein Kind war, führte seine Stiefmutter Hatschepsut, die gleichzeitig seine Tante war, die Regierungsgeschäfte. Vermutlich übernahm Hatschepsut zwischen dem 2. und 7. Jahr der gemeinsamen Regierung den Thron, indem sie sich zur Alleinherrscherin machte. Zeitpunkt und Ausmaß der Zurückdrängung Thutmosis III. sind in der Forschung umstritten. Verschieden datierte Texte weisen darauf hin, dass die Herrschaft der Hatschepsut spätestens im 22. Regierungsjahr endete und Thutmosis III. danach die Alleinherrschaft übernahm.\\nDas 22. Regierungsjahr Thutmosis III. leitete auch den Auftakt für fast jährlich stattfindende Feldzüge nach Vorderasien ein. Der erste Feldzug war die sogenannte Schlacht bei Megiddo gegen eine Koalition syrischer Fürsten unter der Führung des Fürsten von Kadesch."},{"page_url":"https://it.wikipedia.org/wiki/Isola_di_Sant%27Andrea_(Venezia)","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a6/Fort_San_Andrea_Isola_di_Sant%27Andrea.jpg","page_title":"Isola di Sant'Andrea (Venezia)","context_page_description":"L'isola di Sant'Andrea è una piccolissima isola della Laguna di Venezia conosciuta per il Forte di Sant'Andrea, importante fortezza costruita nel XVI secolo a difesa della città di Venezia. Si presenta come un prolungamento, affacciato verso il porto di San Nicolò al Lido, dell'isola delle Vignole, localizzata tra Venezia e l'isola di Sant'Erasmo. Dalle Vignole la separa solo uno stretto canale.\\nEra luogo di manifestazioni collegate allo sposalizio del mare, celebrato nel giorno della festa della Sensa.\\nTra il 1887 e il 1901 fu realizzato e utilizzato un bacino di prova del silurificio della Berliner Maschinenbau realizzato presso l'Orto botanico della chiesa di San Giobbe.\\nDurante la prima guerra mondiale era sede di una stazione idrovolanti della Regia Marina dove operavano dal 2 giugno 1915 il CAM di Venezia fino al giugno 1917 ed alla fine del 1916 la 1ª Squadriglia sui Macchi L.1 e la 2ª Squadriglia con gli FBA Type H.\\nDall'aprile 1917 ci sono la 251ª Squadriglia e la 252ª Squadriglia, dal giugno 1917 la 259ª Squadriglia che al 15 settembre dispongono di 20 Macchi L.3, 9 FBA, 1 Macchi M.5 e 4 Sopwith Baby."},{"page_url":"https://en.wikipedia.org/wiki/Battle_of_Porlampi","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/60/%D0%93%D0%B0%D1%83%D0%B1%D0%B8%D1%86%D1%8B-%D0%BF%D1%83%D1%88%D0%BA%D0%B8_%D0%9C%D0%9B-20_152_%D0%BC%D0%BC.jpg","page_title":"Battle of Porlampi","context_page_description":"The Battle of Porlampi, also known as the Battle of Porlammi, was a military engagement fought between the Finnish Army and Red Army from 30 August to 1 September 1941 on the Karelian Isthmus. The battle was fought near the town of Porlampi during the second month of the Continuation War. The battle was a Finnish victory and effectively ended the reconquest of Karelia."},{"page_url":"https://br.wikipedia.org/wiki/Aozadur_Todt","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e6/Base_ssmarin_stnazaire.jpg","page_title":"Aozadur Todt","context_page_description":"An Aozadur Todt a oa un aozadur alaman e servij an Trede Reich. Gant an aozadur-se e voe kaset labourioù bras da benn, koulz en Alamagn a-raok an Eil Brezel-bed hag er broioù eus Europa aloubet gant an Nazied e-pad ar brezel. Implijet e voe prizonidi da ober al labourioù-se alies.\\nE Breizh hag a-hed arvor Bro-C'hall e lakae labourerien da sevel Moger ar Meurvor Atlantel. Gantañ e oa bet savet Porzh Listri-spluj Sant-Nazer\\nDaou zen dreist-holl zo bet e penn an aozadur:\\nFritz Todt\\nAlbert Speer"},{"page_url":"https://tr.wikipedia.org/wiki/Corona_Civica","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/38/Corona_civica.png","page_title":"Corona Civica","context_page_description":"Corona civica, Genellikle Meşe yapraklarından yapılan ve başa giyilen bir tür antik Roma tacı. Roma Cumhuriyeti ve ardından gelen Principate döneminde bir yurttaş tarafından istenebilecek en yüksek ikinci askeri nişan olarak addelirdi. Bu nişan yoldaşı olan askerlerin hayatını kurtaran erkeklere ve çarpışmalarda yararlılık gösteren askerlere tahsis edilmişti. Sulla'nın anayasal reformlarından sonra Corona civica verilmiş olan yurttaşlar doğrundan senatoya kabul edildiler. Dahası, bu tacı alanlar onu halk toplantılarında takmakla kanunen yükümlüydü ve ayrıca kendinden daha üst mevkilerdeki yurttaşlar tarafından da alkışlanırdı. Zaman içinde \\"Corona civica\\" takmak imparatorlara özgü bir ayrıcalık haline geldi. Bu tacı takan ünlü şahsiyetler arasında Julius Caesar ve Caesar Augustus'da bulunur."},{"page_url":"https://tr.wikipedia.org/wiki/II._Bayezid","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/ab/I._Bayezid_heykeli_Yavuz_G%C3%B6rey.JPG","page_title":"II. Bayezid","context_page_description":"II. Bâyezîd veya II. Beyazıt, ayrıca bilinen adıyla Sultân Bayezid-î Velî; Osmanlı İmparatorluğu'nun sekizinci padişahı. Babası Fatih Sultan Mehmed, annesi Sitti Mükrime Hatun ya da Emîne Gül-Bahar Vâlide Hatûn'dur. Yavuz Sultan Selim'in de babasıdır. Tahta geçtiğinde 511.000 km²'si Asya'da, 1.703.000 km²'si Avrupa'da olmak üzere toplam 2.214.000 km² olan imparatorluk toprakları, ölümünde yaklaşık 2.375.000 km²'ydi."},{"page_url":"https://fr.wikipedia.org/wiki/Liste_des_esp%C3%A8ces_du_genre_Boletus","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/18/Boletus_dupainii.jpg","page_title":"Liste des espèces du genre Boletus","context_page_description":"Cet article contient une liste des espèces de champignon du genre Boletus."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%9C%D0%B0%D1%80%D0%BE%D0%BA%D0%BA%D0%BE","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7f/Atlas_Blue_CN-RNA_B734.jpg","page_title":"Марокко","context_page_description":"Маро́кко, полное официальное название — Короле́вство Маро́кко — государство в Северо-Западной Африке.\\nМарокко — страна, которая вступила в Африканский союз в 1963 году, но с 1984 по 2017 год не являлась его членом из-за притязаний на Западную Сахару. Входит в Лигу Арабских государств, Союз арабского Магриба, Франкофонию, Организацию исламского сотрудничества, группу Средиземноморского диалога, группу 77."},{"page_url":"https://it.wikipedia.org/wiki/Dimetilamilammina","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/81/Geranamine-3D-balls.png","page_title":"Dimetilamilammina","context_page_description":"La dimetilamilammina, nota impropriamente come Geranamina, è una sostanza simile all'anfetamina che, prima del ban ufficiale da parte della FDA e della WADA, era impiegata negli integratori alimentari e nei prodotti destinati agli sportivi in qualità di \\"fat burner\\", inibitore dell'appetito o stimolante. Può pure essere contenuta nelle pasticche da discoteca.\\nLa sostanza agisce sul sistema nervoso centrale, causando una notevole stimolazione dello stesso, del senso di benessere ed euforia e della resistenza fisica; agisce a livello sistemico anche come potente induttore della lipolisi e del dispendio energetico; come reazioni avverse può causare un aumento significativo della pressione arteriosa, insufficienza respiratoria, tachicardia o addirittura un infarto cardiaco. Non autorizzata in Italia, la DMAA figura nell'elenco delle sostanze dopanti della WADA. La DMAA, nota anche come 1,3-dimetilamilammina, metilessaneammina, 1,3-dimetilpentilammina, è un prodotto di sintesi, anche se molto spesso viene menzionata sotto il nome di «Geranium root extract» o «Geranium oil extract», perché è presente naturalmente nelle radici della pianta del geranio."},{"page_url":"https://de.wikipedia.org/wiki/Loiching","image_url":"http://upload.wikimedia.org/wikipedia/commons/e/e8/Loiching_in_DGF.png","page_title":"Loiching","context_page_description":"Loiching ist eine Gemeinde im niederbayerischen Landkreis Dingolfing-Landau."},{"page_url":"https://vi.wikipedia.org/wiki/%E1%BA%A8m_th%E1%BB%B1c_Ph%E1%BA%A7n_Lan","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d6/Poronk%C3%A4ristys.jpg","page_title":"Ẩm thực Phần Lan","context_page_description":"Ẩm thực Phần Lan nổi bật với việc kết hợp các thực phẩn truyền thống của quốc gia và ẩm thực haute với cách nấu ăn đương đại của lục địa này. Cá và thịt đóng một vai trò nổi bật trong các món ăn Phần Lan trong một vài vùng của quốc gia này, trong khi một số món truyền thống ở những nơi khác lại bao gồm các loại rau và nấm. Người tị nạn từ Karelia tạo nên các món ăn ở các phần còn lại ở Phần Lan.\\nMón ăn Phần Lan thường sở dụng các sản phẩm ngũ cốc nguyên cám và quả mọng. Sữa và các sản phẩm từ nó như sữa bơ thường được sử dụng làm thức ăn, đồ uống trong các công thức khác nhau. Các loại cải củ turnip từng phổ biến trong cách nấu ăn truyền thống, nhưng được thay thế bởi khoai tây trong thế kỷ 18."},{"page_url":"https://ca.wikipedia.org/wiki/Llista_de_rellotges_de_sol_de_l%27Alt_Pened%C3%A8s","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/80/Rellotge_de_Sol_del_Mol%C3%AD_de_l%27Abadal%2C_Santa_Margarida_i_els_Monjos.jpg","page_title":"Llista de rellotges de sol de l'Alt Penedès","context_page_description":"Llista de rellotges de sol instal·lats de forma permanent en espais públics de la comarca de l'Alt Penedès."},{"page_url":"https://en.wikipedia.org/wiki/Pennsylvania_in_the_American_Civil_War","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/00/GeorgeMcClellan-cropped.jpeg","page_title":"Pennsylvania in the American Civil War","context_page_description":"During the American Civil War, the Commonwealth of Pennsylvania played a critical role in the Union, providing a huge supply of military manpower, equipment, and leadership to the Federal government. The state raised over 360,000 soldiers for the Federal armies, and served as a major source of artillery guns, small arms, ammunition, armor for the new revolutionary style of ironclad types of gunboats for the rapidly expanding United States Navy, and food supplies. The Phoenixville Iron Company by itself produced well over 1,000 cannons, and the Frankford Arsenal was a major supply depot.\\nPennsylvania was the site of the bloodiest battle of the war, the Battle of Gettysburg,\\nwhich became widely known as the one of the turning points of the Civil War. Numerous smaller engagements and skirmishes were also fought in Pennsylvania during the 1863 Gettysburg Campaign, as well as the following year during a Confederate cavalry raid that culminated in the burning of much of Chambersburg, Pennsylvania. The industrial town of York, Pennsylvania, was the largest city in the North to be occupied by the Confederate States Army during the war."},{"page_url":"https://tt.wikipedia.org/wiki/%D0%A0%D1%83%D0%BD%D1%82%D1%81%D0%B5%D0%BD%D0%B0%D0%B9%D0%BC","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/67/Rountzenheim_SteCroix_01.jpg","page_title":"Рунтсенайм","context_page_description":"Рунтсенайм — Франциянең Түбән Рейн департаментына караган коммуна."},{"page_url":"https://vo.wikipedia.org/wiki/Porza","image_url":"http://upload.wikimedia.org/wikipedia/commons/6/6a/Karte_Gemeinde_Porza_2012.png","page_title":"Porza","context_page_description":"Porza binon zif in kanton: Tessin, in Jveizän. Porza topon videtü 46°1’ N e lunetü 8°57’ L.\\nSürfat ela Porza binon mö 1,6 km².\\nPorza labon belödanis 1 471.\\nCommons: Porza – Kobädikos labon ragivis/magodis tefü"},{"page_url":"https://fr.wikipedia.org/wiki/Sanakht","image_url":"http://upload.wikimedia.org/wikipedia/commons/a/a3/Abydos_KL_03-01_n15.jpg","page_title":"Sanakht","context_page_description":"Sanakht est un roi de la IIIᵉ dynastie de l'Ancien Empire. Sa position chronologique est incertaine. De nombreux égyptologues associent Sanakht au nom de cartouche Nebka, même s'il n'y a pas de consensus."},{"page_url":"https://es.wikipedia.org/wiki/Museo_de_la_Electricidad_de_Lisboa","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/99/Museu_Electricidad_Sala_de_Experimentar.JPG","page_title":"Museo de la Electricidad de Lisboa","context_page_description":"El Museo de la Electricidad es un centro de cultura donde se combina la monumentalidad del edificio, un museo de Ciencia viva, un museo de Arqueología Industrial, y un espacio dedicado a la realización de exposiciones temporales y otros eventos.\\nEstá situado en una de las zonas más monumentales de Lisboa, el Barrio de Belém, cerca del Monasterio de los Jerónimos, la Torre de Belém, el Monumento a los Descubrimientos, el Centro Cultural de Belém o el Museo de los Carruajes, en el interior de un edificio protegido llamado Central Tejo, la antigua central termoeléctrica que iluminó la ciudad.\\nSu abertura como museo se produjo en 1990, si bien en 2006 reabrió sus puertas tras una gran restauración y un cambio en el discurso museológico. Hoy, por su aspecto cultural y multidisclipinar, el visitante puede observar una gran cantidad de eventos; desde la exposición permanente, donde se conserva la mayor parte de la maquinaria original de la antigua Central Tejo, hasta exposiciones temporales de gran diversidad: fotografía, ciencia, pintura…, pasando por una sala de diversión con juegos, muestras de energía solar en el exterior, teatro, conciertos, etc."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%A1%D0%B0%D1%80%D0%B0%D1%94%D0%B2%D0%BE","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3c/Sarajevo_for_Visa_%2834%29_%285589553321%29.jpg","page_title":"Сараєво","context_page_description":"Сара́єво — найбільше місто і столиця Боснії і Герцеґовини та її складової частини Федерація Боснія і Герцеговина, адміністративний центр Сараєвського кантону. За даними перепису 2013 року, численність населення становить 291 422 особи."},{"page_url":"https://de.wikipedia.org/wiki/Pante%C3%B3n_Rococ%C3%B3","image_url":"http://upload.wikimedia.org/wikipedia/commons/5/5d/Panteon_Rococo_Felipe_Bustamante_2008_01.jpg","page_title":"Panteón Rococó","context_page_description":"Panteón Rococó ist der Name einer mexikanischen Latin Ska/Mestizo-Band, die 1995 in Mexiko-Stadt gegründet wurde.\\nRegelmäßig gehen sie auch in Europa auf Tournee, bevorzugt in Deutschland, wo sie auf diversen Festivals auftreten. Im Sommer 2008 haben sie die Rockband Die Ärzte auf einigen Konzerten als Vorband begleitet.\\nIn Europa wird die Band von dem Hannoverschen Label Übersee-Records vertreten."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%91%D0%BE%D0%B8_%D0%B2_%D1%80%D0%B0%D0%B9%D0%BE%D0%BD%D0%B5_%D0%9C%D0%B0%D1%82%D0%B0%D0%BD%D0%B8%D0%BA%D0%B0%D1%83","image_url":"http://upload.wikimedia.org/wikipedia/commons/f/f9/PullerGuadalcanal.jpg","page_title":"Бои в районе Матаникау","context_page_description":"Бои в районе Матаникау в сентябре и октябре 1942 года, в некоторых источниках называемая Вторая и третья битвы у Матаникау — два самостоятельных боя, рассматривающихся как серия, между морскими и сухопутными силами США и Императорской Японии у реки Матаникау на острове Гуадалканал во время Гуадалканальской кампании. Эти боевые столкновения, первое из которых имело место с 23 по 27 сентября, а второе с 6 по 9 октября, были двумя крупнейшими и наиболее значительными боевыми действиями в районе реки Матаникау.\\nРайон реки Матаникау на Гуадалканале включает полуостров, носящий название мыс Крус, деревню Кокумбона и ряд хребтов и ущелий, уходящих вглубь острова от берега. Японские войска использовали эту местность для перегруппировки и наступательных действий против американских сил на острове, для организации будущих наступлений на оборонительные линии США, которые защищали аэродром, расположенный у мыса Лунга на Гуадалканале, как базу для защиты от атак союзников японских войск на стоянках между мысом Крус и мысом Эсперанс на западе Гуадалканала, а также для визуального наблюдения и сбора разведданных об активности союзников в районе Хендерсон-Филд."},{"page_url":"https://arz.wikipedia.org/wiki/%D8%A7%D9%86%D8%AA%D9%88%D9%8A%D9%86_%D8%A7%D9%88%D8%AC%D9%8A%D9%86_%DA%86%D9%88%D8%A7%D9%86%D9%88%D9%86","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3a/Eug%C3%A8ne_Joannon_Crozier.jpg","page_title":"انتوين اوجين چوانون","context_page_description":"الصفحه دى يتيمه, حاول تضيفلها لينك فى صفحات تانيه متعلقه بيها.\\nانتوين اوجين چوانون كان مهندس من فرنسا."},{"page_url":"https://vi.wikipedia.org/wiki/Scaevola_taccada","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/89/Fihalhohi_ocean_view.jpg","page_title":"Scaevola taccada","context_page_description":"Scaevola taccada, còn gọi là cây Hếp, hay cây bão táp, là một cây thực vật có hoa trong họ Hếp, có mặt tại các vùng ven biển nhiệt đới khu vực Ấn Độ Dương-tây Thái Bình Dương. Đây là một loại cây bụi mọc phổ biến ở vùng Biển Ả Rập, vùng nhiệt đới Ấn Độ Dương và các đảo Thái Bình Dương."},{"page_url":"https://es.wikipedia.org/wiki/Francisco_Izquierdo","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/66/Francisco_Izquierdo_Rios_1.jpg","page_title":"Francisco Izquierdo","context_page_description":"Francisco Izquierdo Ríos fue un escritor y maestro docente peruano."},{"page_url":"https://en.wikipedia.org/wiki/Ugni","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/ce/Ugni_candollei%2C_fruit_%288651636451%29.jpg","page_title":"Ugni","context_page_description":"Ugni is a genus of plants in the myrtle family Myrtaceae, described as a genus in 1848. It is native to western Latin America from the Valdivian temperate rain forests of southern Chile and adjacent regions of southern Argentina, north to southern Mexico.\\nThey are shrubs with evergreen foliage, reaching 1–5 m tall. The leaves are opposite, oval, 1–4 cm long and 0.2-2.5 cm broad, entire, glossy dark green, with a spicy scent if crushed. The flowers are drooping, 1–2 cm diameter with four or five white or pale pink petals and numerous short stamens; the fruit is a small red or purple berry 1 cm diameter."},{"page_url":"https://en.wikipedia.org/wiki/D%C4%85browa_Basin","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7f/Zeglambia.jpg","page_title":"Dąbrowa Basin","context_page_description":"The Dąbrowa Basin or Zagłębie Dąbrowskie is a geographical and historical region in southern Poland. It forms western part of Lesser Poland, though it shares some cultural and historical features with the neighbouring Upper Silesia. The region is sometimes referred to in English as Zaglembie or Zaglembia, especially in Jewish publications written in the English language."},{"page_url":"https://lt.wikipedia.org/wiki/Raneboutas","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c8/Orient_Runabout_1907_-_1.JPG","page_title":"Raneboutas","context_page_description":"Raneboutas – XX a. pradžioje populiarus automobilių kėbulų tipas. Raneboutai buvo maži, pigūs atviri automobiliai. Daugelis raneboutų turėjo tik vieną eilę sėdynių. Dalis raneboutų gale turėdavo porą papildomų sėdimų vietų. 1919-1930 m. apie pusė gaminamų automobilių buvo vadinami raneboutais."},{"page_url":"https://af.wikipedia.org/wiki/Sch%C3%B6neberg","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/97/Dennewitzstra%C3%9Fe_Berlin_1905.jpg","page_title":"Schöneberg","context_page_description":"Schöneberg is 'n stadsdeel in die Berlynse distrik Tempelhof-Schöneberg. Tot en met 31 Desember 2000 het Schöneberg 'n selfstandige distrik gevorm wat naas die naamgewende stadsdeel ook Friedenau ingesluit het. Die distrik Schöneberg is as gevolg van 'n administratiewe hervorming op 1 Januarie 2001 met die destydse distrik Tempelhof saamgesmelt.\\nBekende besienswaardighede in Schöneberg sluit die Rathaus Schöneberg, die grootste afdelingswinkel op die vasteland van Europa Kaufhaus des Westens en die historiese werkersbuurt Rote Insel in."},{"page_url":"https://he.wikipedia.org/wiki/%D7%94%D7%96%D7%99%D7%A8%D7%94_%D7%94%D7%99%D7%9E%D7%99%D7%AA_%D7%91%D7%9E%D7%91%D7%A6%D7%A2_%D7%A9%D7%9C%D7%95%D7%9D_%D7%94%D7%92%D7%9C%D7%99%D7%9C","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/cf/ZINSBatsheva.jpg","page_title":"הזירה הימית במבצע שלום הגליל","context_page_description":"הזירה הימית במבצע שלום הגליל התרכזה בעיקר בסיוע לכוחות היבשה, ובמרכזה עמדה הנחתת כוחות מהים בחופי לבנון. הנחתת הכוחות נועדה לאגף את בסיסי המחבלים, והתבצעה על ידי שייטת הנחתות של חיל הים הישראלי. מבצע הנחיתה אובטח על ידי צוללות, דבורים וספינות טילים. ספינות חיל הים סייעו לכוחות היבשה גם באש מן הים, סיוע שהיה מהיר ומדויק יחסית. כל מבצעי חיל הים עברו ללא נפגעים."},{"page_url":"https://fr.wikipedia.org/wiki/Townsend_Harris","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9c/TownsendHarris1855JamesBogle.jpg","page_title":"Townsend Harris","context_page_description":"Townsend Harris, 3 octobre 1804 - 25 février 1878, est un marchand de New York qui occupe également des fonctions politiques. Il est ainsi le premier consul général américain au Japon où il participe aux négociations en faveur du Traité Harris signé en 1856 entre les États-Unis et son pays d'accueil. Il a ainsi la réputation d'être le premier diplomate à être parvenu à ouvrir le Japon à une culture et à un commerce étrangers. Il est aujourd'hui encore une figure emblématique au Japon.\\nEn 1846, Harris parvient à la tête du New York City Board of Education qu'il préside jusqu'en 1848. C'est pendant cette période qu'il crée le City College of New York."},{"page_url":"https://my.wikipedia.org/wiki/%E1%80%99%E1%80%BC%E1%80%90%E1%80%BA%E1%80%96%E1%80%AF%E1%80%9B%E1%80%AC%E1%80%B8%E1%80%80%E2%80%8B%E1%80%9C%E1%80%B1%E1%80%B8","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a0/Myat_Phaya_Galay_and_Ko_Ko_Naing.jpg","page_title":"မြတ်ဖုရားက​လေး","context_page_description":"မြတ်ဖုရားက​လေး သည် မြန်မာတော်ဝင်မင်းသမီး ဖြစ်သည်။ အရှင်ထိပ်စုမြတ်ဖုရားလေး ဟုလည်း ခေါ်ကြသည်။ ကုန်းဘောင်မင်းဆက် ဆက်တွင် နောက်ဆုံး ဖြစ်သော မြန်မာဘုရင် သီပေါမင်းနှင့် မိဖုရားခေါင် စုဖုရားလတ်တို့၏ စတုတ္ထသမီးတော် ဖြစ်သည်။"},{"page_url":"https://uk.wikipedia.org/wiki/%D0%9A%D0%B0%D1%82%D0%BE%D0%BB%D0%B8%D1%86%D1%8C%D0%BA%D0%B8%D0%B9_%D1%87%D0%B5%D1%80%D0%BD%D0%B5%D1%86%D1%8C_(%D0%A8%D0%B5%D0%B2%D1%87%D0%B5%D0%BD%D0%BA%D0%BE)","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7d/Taras_Shevchenko_painting_0031.jpg","page_title":"Католицький чернець (Шевченко)","context_page_description":"Католицький чернець — ілюстрація Тараса Шевченка до твору М. І. Надєждіна «Сила воли. Воспоминания путешественника». Гравюра на сталі. Санкт-Петербург. 1841 рік.\\nМісцезнаходження оригінального рисунка, з якого було виконано гравюру, не встановлено. Датується часом видачі цензурою дозволу на друкування збірника «Сто русских литераторов».\\nІлюстрацію до стор. 421—423 тексту «Сила воли» опубліковано в збірнику «Сто русских литераторов», т. II, изд. А. Смирдина, СПб., 1841, між стор. 398—399. Про приналежність роботи Шевченкові зазначено в переліку ілюстрацій цього ж видання.\\nК. Широцький називає цю ілюстрацію «Капуцинський монах».\\nГравюра на сталі з оригінального рисунка Шевченка для цього видання виконана в Англії; розмір її — 11,8 × 8,8.\\nРепродукується за гравюрою."},{"page_url":"https://kk.wikipedia.org/wiki/%D0%91%D0%BE%D0%BA%D1%81%D1%82%D0%B0%D0%BD_%D0%B0%D0%B1%D1%81%D0%BE%D0%BB%D1%8E%D1%82%D1%82%D1%96_%D3%99%D0%BB%D0%B5%D0%BC_%D1%87%D0%B5%D0%BC%D0%BF%D0%B8%D0%BE%D0%BD%D0%B4%D0%B0%D1%80_%D1%82%D1%96%D0%B7%D1%96%D0%BC%D1%96","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f2/Lenox_Lewis_2010.jpg","page_title":"Бокстан абсолютті әлем чемпиондар тізімі","context_page_description":"Бокстан абсолютті әлем чемпиондар тізімі — абсолютті әлем чемпионы болып барлық тиісті ұйымдардың бокс нұсқасы бойынша әлем чемпионы атағына ие боксшы атанады."},{"page_url":"https://zh.wikipedia.org/zh-cn/%E4%BC%8A%E6%8B%89%E5%85%8B%E7%89%B9%E7%A8%AE%E4%BD%9C%E6%88%B0%E9%83%A8%E9%9A%8A","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/57/ISOF_soldiers_captured_in_Mosul%2C_Northern_Iraq%2C_Western_Asia._16_November%2C_2016.jpg","page_title":"伊拉克特種作戰部隊","context_page_description":"伊拉克特种作战部队是伊拉克的特种部队，于伊拉克战争期间由美国为首的多国部队协助成立。该部队受到伊拉克反恐局直接指挥，并包含着伊拉克反恐指挥部所属的三个旅团。而伊拉克反恐局本身也受到伊拉克国防部资助。"},{"page_url":"https://en.wikipedia.org/wiki/Stop_%26_Shop","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/73/Stop_%26_Shop.JPG","page_title":"Stop & Shop","context_page_description":"The Stop & Shop Supermarket Company, known as Stop & Shop, is a chain of supermarkets located in the northeastern United States. From its beginnings in 1892 as a small grocery store, it has grown to include 415 stores chain-wide.\\nStop & Shop has been a wholly owned subsidiary of the Dutch supermarket operator Ahold since 1995 and was part of the Stop & Shop/Giant-Landover division with sister chain Giant-Landover between 2004 and 2011. Ahold announced on June 24, 2015, that it would merge with Brussels-based Delhaize Group, a Belgian grocery store conglomerate whose U.S. grocery operations included Hannaford of Scarborough, Maine and Food Lion of Salisbury, North Carolina. The merger was completed on July 24, 2016, with the new holding company being named Ahold Delhaize."},{"page_url":"https://hy.wikipedia.org/wiki/%D4%BF%D5%A1%D5%AD%D5%B8%D5%BE%D5%AF%D5%A1_(%D6%84%D5%A1%D5%B2%D5%A1%D6%84,_%D5%88%D6%82%D5%AF%D6%80%D5%A1%D5%AB%D5%B6%D5%A1)","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/22/Kahovka_city_fl.png","page_title":"Կախովկա (քաղաք, Ուկրաինա)","context_page_description":"Կախովկա, քաղաք Ուկրաինայի Խերսոնի մարզի Կախովսկի շրջանում, շրջանային ենթակայության քաղաք։ Բնակավայրը նախկինում նաև անվանվել է Իսլամ-Կերմեն։ Հիմնադրվել է 1791 թվականին։\\n2012 թվականի տվյալներով Կախովկա քաղաքում բնակվում էր 37 357 մարդ։ Բնակավայրը զբաղեցնում է 16,24 կմ²։"},{"page_url":"https://sv.wikipedia.org/wiki/Vattentorn","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/03/Vodotoranj%2C_Vukovar%2C_Z-4194.jpg","page_title":"Vattentorn","context_page_description":"Ett vattentorn är en anläggning vars syfte är att åstadkomma rätt vattentryck i vattenledningssystemet genom att det sammanhänger med vatten som lagras på hög höjd. Moderna svenska vattentorn är ofta svampformade efter \\"Svampen\\" i Örebro från 1958.\\nVattentorn, eller högreservoarer, har till syfte att utjämna skillnaden mellan pumpad vattenmängd och vattenförbrukning, att tjäna som reserv vid större rörbrott och för eldsläckning samt att hålla konstant tryck inom förbrukningsorten. Högreservoarerna är, beroende på reservoarplatsens höjdläge i förhållande till förbrukningsorten, helt eller delvis nedsänkta i marken, placerade direkt på marken, upplyfta på pelare eller, vid mycket flack terräng, förlagda i torn. Vattentornen byggdes förr av murverk med cisterner av gjutjärn eller smidesjärn. Senare utfördes vanligen tornen av murverk i kombination med ett skelett av armerad betong, uteslutande av betong eller murverk, eller också användes ett gallerverk av smidesjärn. Cisternerna var vanligen av smidesjärn eller armerad betong.\\nHögreservoarer kan i viss mån ersättas av ståndrör, men då måste pumpningen nära följa förbrukningen, vilket medför behov av större antal pumpar."},{"page_url":"https://fa.wikipedia.org/wiki/%D9%BE%D8%A7%D8%B1%DA%A9_%D9%87%D8%A7%DA%AF%D9%84%DB%8C","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/88/HagleyParkAerialPhoto.jpg","page_title":"پارک هاگلی","context_page_description":"پارک هاگلی یک پارک عمومی بزرگ در شهر کرایست چرچ در نیوزیلند است که در سال ۱۸۵۵ افتتاح شد. وسعت این پارک بیش از ۱۶۰ هکتار است."},{"page_url":"https://ro.wikipedia.org/wiki/Podenzana","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/67/Podenzana-municipio1.jpg","page_title":"Podenzana","context_page_description":"Podenzana este o comună în Provincia Massa-Carrara, Toscana din centrul Italiei. În 2011 avea o populație de 2.148 de locuitori."},{"page_url":"https://de.wikipedia.org/wiki/Sima_Yi","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/41/China_5.jpg","page_title":"Sima Yi","context_page_description":"Sīmǎ Yì war ein General, Militärstratege, Politiker und Regent des Kaiserreiches Wei im antiken China zur Zeit der Drei Reiche. Durch seine erfolgreichen Feldzüge, besonders in der Abwehr der Nördlichen Expeditionen des südlichen Rivalen Zhuge Liang, Regent der Shu Han, und der Eroberung der Liaodong-Kommandantur ebnete er den Weg für seine steile Karriere bei Hofe. Kurz vor seinem Lebensende hatte er die Opposition bei Hofe ausgeschaltet und die Machtposition seiner Familie zementiert. Von 249 bis zu seinem Tode war er Regent für den Kaiser Cao Fang. Von seinem Enkel Sima Yan wurde er 14 Jahre später, als dieser den letzten Wei-Kaiser abgesetzt und sich zum die Kaiser der Jin-Dynastie ausgerufen hatte, postum zum Kaiser Xuan von Jin erhoben und dem Tempelnamen Gaozu geehrt."},{"page_url":"https://pl.wikipedia.org/wiki/Terminal_Promowy_Westerplatte","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9c/Gdansk_Westerplatte_Deutschland_2.jpg","page_title":"Terminal Promowy Westerplatte","context_page_description":"Terminal Promowy Westerplatte – terminal promowy przy Nabrzeżu Obrońców Westerplatte w porcie morskim Gdańsk.\\nPowstał w 2002 roku na potrzeby obsługiwanego przez duńską firmę DFDS Seaways połączenia promowego Gdańsk – Trelleborg – Kopenhaga. Inauguracja tej linii nastąpiła w październiku 2002. Była ona obsługiwana promem MF Duke of Scandinavia. Ostatnie odejście promu na tej linii miało miejsce 22 listopada 2003, po czym połączenie zostało zawieszone i ostatecznie zlikwidowane 6 lutego 2004 roku. 27 września 2004 DFDS uruchomiło serwis ro-ro o nazwie \\"PolBridge\\" na trasie Gdańsk – Kopenhaga – Goeteborg, początkowo obsługiwane jednostką \\"Tor Belgia\\" armatora DFDS Tor Line, a od 5 listopada 2004 statkiem \\"Tango\\". W 2005 roku działało połączenie pasażersko-towarowe Gdańsk – Karlshamn z zawinięciem do Kłajpedy, obsługiwane statkiem MV \\"Kaunas\\"."},{"page_url":"https://de.wikipedia.org/wiki/Taxi_Taxi","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/86/Peugeot_406_Taxi.jpg","page_title":"Taxi Taxi","context_page_description":"Taxi Taxi ist eine Actionkomödie aus dem Jahr 2000 vom Regisseur Gérard Krawczyk nach einem Drehbuch von Luc Besson. Der Film ist die Fortsetzung von Taxi aus dem Jahr 1998."},{"page_url":"https://en.wikipedia.org/wiki/Massachusetts_Route_183","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/af/MA_183_at_MA_102.jpg","page_title":"Massachusetts Route 183","context_page_description":"Massachusetts Route 183 is a 31.94-mile-long north–south state highway in Berkshire County, Massachusetts. The entire route travels from a continuation of Connecticut Route 183 by Colebrook, Connecticut to U.S. Route 7 and US 20 in Lenox."},{"page_url":"https://ja.wikipedia.org/wiki/6,7-%E3%83%A1%E3%83%81%E3%83%AC%E3%83%B3%E3%82%B8%E3%82%AA%E3%82%AD%E3%82%B7-N-%E3%83%A1%E3%83%81%E3%83%AB-2-%E3%82%A2%E3%83%9F%E3%83%8E%E3%83%86%E3%83%88%E3%83%A9%E3%83%AA%E3%83%B3","image_url":"http://upload.wikimedia.org/wikipedia/commons/8/80/MDMAT-structure.png","page_title":"6,7-メチレンジオキシ-N-メチル-2-アミノテトラリン","context_page_description":"6,7-メチレンジオキシ-N-メチル-2-アミノテトラリンまたはMDMATは、非神経毒性の選択的セロトニン放出薬で、エンタクトゲンをもたらすと考えられている薬剤である。6,7-メチレンジオキシ-2-アミノテトラリンのN-メチル化誘導体であり、メチレンジオキシメタンフェタミンの3,4-メチレンジオキシアンフェタミンに対する関係、または5,6-メチレンジオキシ-N-メチル-2-アミノインダンの5,6-メチレンジオキシ-2-アミノインダンに対する関係と類似している。2010年以降、オンラインで研究用試薬として販売されている。"},{"page_url":"https://gl.wikipedia.org/wiki/Te%C3%B3filo_Cubillas","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4d/Te%C3%B3filo_Cubillas.JPG","page_title":"Teófilo Cubillas","context_page_description":"Teófilo Juan Cubillas Arizaga, alcumado El Nene, nado o 8 de marzo de 1949 en Lima, é un ex-futbolista profesional peruano. Foi escollido como o mellor xogador da historia do Perú nunha enquisa da IFFHS, a cal o incluíu entre os mellores 50 do mundo. Ademais, en 2004, Pelé escolleuno como un dos FIFA 100, unha lista cos 125 mellores futbolistas. Cubillas axudou á selección do Perú a conseguir a súa segunda Copa América en 1975 e a chegar aos cuartos de final do Mundial de 1970, onde foi nomeado mellor xogador promesa."},{"page_url":"https://vi.wikipedia.org/wiki/Periploca_sepium","image_url":"http://upload.wikimedia.org/wikipedia/commons/c/ce/Periploca-sepium-foliage.jpg","page_title":"Periploca sepium","context_page_description":"Periploca sepium là một loài thực vật có hoa trong họ La bố ma. Loài này được Bunge mô tả khoa học đầu tiên năm 1835."},{"page_url":"https://en.wikipedia.org/wiki/List_of_Texas_Tech_Red_Raiders_head_football_coaches","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4b/EYFreeland.jpg","page_title":"List of Texas Tech Red Raiders head football coaches","context_page_description":"The Texas Tech Red Raiders football program is a college football team that represents Texas Tech University in the Big 12 Conference in the National Collegiate Athletic Association Division I Football Bowl Subdivision. The program has had 15 head coaches, and two interim head coach, since it began play during the 1925 season.\\nTexas Tech was known as the \\"Matadors\\" from 1925 to 1936, a name suggested by the wife of Ewing Y. Freeland, the first football coach, to reflect the influence of the Spanish Renaissance architecture on campus. In 1932, Texas Tech joined the Border Intercollegiate Athletic Association. The school's short-lived Matadors moniker was replaced officially in 1937 with \\"Red Raiders\\", the nickname the team has had ever since. The same year, Pete Cawthon, Texas Tech's third head coach, led the team to their first conference championship and bowl game berth, a 7–6 loss to the West Virginia Mountaineers in the Sun Bowl. Texas Tech suffered four more bowl losses, under two head coaches, before their first postseason win in the 1952 Sun Bowl, under first-year head coach DeWitt Weaver."},{"page_url":"https://azb.wikipedia.org/wiki/%D8%A8%D9%87%D9%85%D9%86%DB%8C_%D8%B3%D9%88%D9%84%D8%B7%D8%A7%D9%86%D9%84%DB%8C%D8%BA%DB%8C","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d5/Ahmed_Shah_Al_Wali_Bahamani.jpg","page_title":"بهمنی سولطانلیغی","context_page_description":"بهمنی سولطانلیغی آسیادا بیر اسکی دؤولت. و فارس دیلی رسمی دیلیدی. بهمنی سولطانلیغی 1347 میلادی ایلینده قۇرولدو و 1527 میلادی ایلینده داغیلدی."},{"page_url":"https://en.wikipedia.org/wiki/Research_Institute_of_Brewing_and_Malting","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7e/V%C3%BDzkumn%C3%BD_%C3%BAstav_pivovarsk%C3%BD_a_slada%C5%99sk%C3%BD_50.0753575N%2C_14.4238242E.jpg","page_title":"Research Institute of Brewing and Malting","context_page_description":"The Research Institute of Brewing and Malting in Czech - was founded in 1887 and since 1994 It has been a joint-stock company. It is one of the oldest scientific research institutes in the Central European region."},{"page_url":"https://hu.wikipedia.org/wiki/Corinthia_Hotel","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ea/Corinthia_Hotel_Budapest_.jpg","page_title":"Corinthia Hotel","context_page_description":"A Corinthia Hotel budapesti ötcsillagos szálloda."},{"page_url":"https://es.wikipedia.org/wiki/Villach","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/76/Villach_%28view_towards_the_south%29.jpeg","page_title":"Villach","context_page_description":"Villach es una ciudad austriaca situada en el sur del país, que se encuentra a escasos kilómetros de la frontera con Italia y Eslovenia. Debido a su localización es un importante nudo de comunicaciones en la zona. Tiene una población de 57.925 personas, lo que la convierte en la séptima ciudad austriaca más habitada."},{"page_url":"https://es.wikipedia.org/wiki/Apulia","image_url":"http://upload.wikimedia.org/wikipedia/commons/4/48/Torre_Sant%27Andrea_%28Lecce%29.jpg","page_title":"Apulia","context_page_description":"Apulia o Pulla es una de las veinte regiones que conforman la república italiana. Su capital y ciudad más poblada es Bari. Está ubicada en Italia meridional, limitando al norte y este con el mar Adriático, al sur con el golfo de Tarento, al oeste con los montes Apeninos que la separan de Basilicata y Campania, y al noroeste con Molise. Con 209 hab./km², es la sexta región más densamente poblada del país, por detrás de Véneto, Campania, Lombardía, Lacio y Liguria.​\\nCorresponde al «tacón» de la forma de «bota» que tiene la península Itálica, es decir, se halla en el extremo sureste de la misma; la Punta Palascìa, cerca de Otranto, queda a alrededor de 80 km de la costa de Albania. Comprende la Ciudad metropolitana de Bari y las provincias de Barletta-Andria-Trani, Brindisi, Foggia, Lecce y Tarento.​"},{"page_url":"https://zh.wikipedia.org/wiki/%E7%99%BD%E8%9F%BB","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/64/Termite_mound_on_runway_at_Khorixas_%282018%29.jpg","page_title":"白蟻","context_page_description":"白蟻亦稱螱，古稱蚍蜉坊間俗稱大水蟻，為真社會性昆蟲，為蜚蠊目等翅下目昆蟲的總稱。白蟻雖然名為「白蟻」，但它們並非「白色的螞蟻」。\\n白蟻舊時分類位階為等翅目，但近期系統發生學證據顯示白蟻為蜚蠊目，姊妹群為隱尾蠊屬，現降級為蜚蠊目等翅下目或白蟻上科 。共有超過3000個物種，可見於熱帶及亞熱帶地區，可分為12個科，其中3個科已滅絕。以前研究認為白蟻起源於侏羅紀或三疊紀，但近期研究認為其起源於白堊紀，最早的白蟻化石年代為白堊紀中期。\\n白蟻為不完全變態，生活史包括卵、若蟲、幼蟲，可分為多個階級，有不具生殖能力的工蟻和兵蟻，和具有生殖能力的蟻王蟻后。大部分白蟻取食死亡的植物組織，和含有纖維素的木材、落葉、土壤或動物糞便。白蟻的群體大小因物種而異，個體數量少至百隻內，多至數百萬。蟻后的壽命乃昆蟲之最，有紀錄顯示蟻后能活30至50年。\\n除了南極洲以外，白蟻的足跡遍布全球，熱帶與亞熱帶地區的白蟻豐富度和多樣性最高，白蟻能分解木材和植物組織，是生態系中不可或缺的一員。\\n白蟻在某些文化中是美食，也被用於傳統療法。數百種白蟻是經濟害蟲，會危害建築、作物和森林，有些物種是世界廣布的入侵種，如西印度乾木白蟻。"},{"page_url":"https://en.wikipedia.org/wiki/Territorial_evolution_of_the_United_States","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ec/United_States_Central_change_1863-11-02.png","page_title":"Territorial evolution of the United States","context_page_description":"The United States of America was created on July 4, 1776, with the Declaration of Independence of thirteen British colonies in North America. In the Lee Resolution of July 2, 1776, the colonies resolved that they were free and independent states. Their independence was recognized by Great Britain in the Treaty of Paris of 1783, which concluded the American Revolutionary War. This effectively doubled the size of the colonies, now able to stretch west past the Proclamation Line to the Mississippi River. This land was organized into territories and then states, though there remained some conflict with the sea-to-sea grants claimed by some of the original colonies. In time, these grants were ceded to the federal government.\\nThe first great expansion of the country came with the Louisiana Purchase of 1803, which doubled the country's territory, although the southeastern border with Spanish Florida was the subject of much dispute until it and Spanish claims to the Oregon Country were ceded to the US in 1821. The Oregon Country gave the United States access to the Pacific Ocean, though it was shared for a time with the United Kingdom."},{"page_url":"https://ja.wikipedia.org/wiki/%E3%82%AA%E3%83%BC%E3%82%B9%E3%83%88%E3%83%A9%E3%83%AA%E3%82%A2%E6%96%99%E7%90%86","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/67/Pavlova_dessert.JPG","page_title":"オーストラリア料理","context_page_description":"オーストラリア料理は、オーストラリアで食べられている料理の総称。この項目ではオーストラリアの食文化および料理について述べる。"},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Kulturdenkm%C3%A4ler_in_Allendorf/Lahn","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7b/Gie%C3%9Fen-Allendorf_%28DerHexer%29_WLMMH_61838_2011-09-22_04.jpg","page_title":"Liste der Kulturdenkmäler in Allendorf/Lahn","context_page_description":"Die folgende Liste enthält die in der Denkmaltopographie ausgewiesenen Kulturdenkmäler auf dem Gebiet des Ortsteils Allendorf der Stadt Gießen, Landkreis Gießen, Hessen.\\nHinweis: Die Reihenfolge der Denkmäler in dieser Liste orientiert sich an der Anschrift, alternativ ist sie auch nach der Bezeichnung, der vom Landesamt für Denkmalpflege vergebenen Nummer oder der Bauzeit sortierbar.\\nGrundlage ist die Veröffentlichung der hessischen Denkmalliste, die auf Basis des Denkmalschutzgesetzes vom 5. September 1986 erstmals erstellt und seither laufend ergänzt wurde."},{"page_url":"https://fr.wikipedia.org/wiki/Style_n%C3%A9ogothique","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/26/Gassonsummer.jpg","page_title":"Style néogothique","context_page_description":"Le style néogothique est un style architectural né au milieu du XVIIIᵉ siècle en Angleterre. Au XIXᵉ siècle, des styles néogothiques de plus en plus rigoureux et documentés visent à faire revivre des formes médiévales qui contrastent avec les styles classiques dominants de l'époque. Le mouvement néogothique a eu une influence importante en Europe et en Amérique du Nord et il y a peut-être eu davantage d'architecture gothique construite aux XIXᵉ et XXᵉ siècles qu'à la fin du Moyen Âge et au début de la Renaissance.\\nTrois phases sont distinguables : le néogothique de Christopher Wren en Angleterre, appliqué aux universités comme Oxford, la deuxième phase en Grande-Bretagne est parallèle au développement du roman gothique en littérature, puis la maturité dans les années 1840 grâce aux progrès de la science historique."},{"page_url":"https://sk.wikipedia.org/wiki/Zoznam_kult%C3%BArnych_pamiatok_v_obci_Ve%C4%BEk%C3%A1_Lomnica","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/07/Studeny_potok.JPG","page_title":"Zoznam kultúrnych pamiatok v obci Veľká Lomnica","context_page_description":"Toto je zoznam kultúrnych pamiatok v obci Veľká Lomnica v okrese Kežmarok.\\nZoznam bol vytvorený na základe zoznamu, ktorý bol zverejnený na webe Pamiatkového úradu Slovenskej republiky.\\nV súčasnosti je na webovej stránke PÚSR dostupné vyhľadávanie podľa jednotlivých obcí."},{"page_url":"https://nl.wikipedia.org/wiki/Leucauge_venusta","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/bd/Leucauge_venusta_Kaldari_01.jpg","page_title":"Leucauge venusta","context_page_description":"Leucauge venusta is een spinnensoort in de taxonomische indeling van de strekspinnen.\\nHet dier behoort tot het geslacht Leucauge. De wetenschappelijke naam van de soort werd voor het eerst geldig gepubliceerd in 1842 door Walckenaer."},{"page_url":"https://es.wikipedia.org/wiki/Puente_de_la_Constituci%C3%B3n_de_1812","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/47/Comparativapuentecadiz.svg","page_title":"Puente de la Constitución de 1812","context_page_description":"El puente de la Constitución de 1812​ es un puente atirantado que cruza la bahía de Cádiz, dando acceso a Cádiz desde el continente, siendo el tercer acceso a la ciudad, después del enlace por el istmo de San Fernando y del puente Carranza. El puente es la continuación de la autopista del Sur, formando parte integrante de la autovía de Acceso a Cádiz, siendo responsable de ésta el Ministerio de Fomento del gobierno estatal. El tablero se reparte entre la autovía de doble calzada y otra calzada reservada para el transporte público.\\nEl puente se empezó a construir en 2008 y fue abierto el 24 de septiembre de 2015.​ Una vez inaugurado se convirtió en el puente de mayor luz de España con 540 metros. Considerando los puentes atirantados sería el tercero de mayor luz de Europa, después del puente de Normandía y el de Rio-Antirio. La obra total se compone del puente sobre la bahía, con una longitud total de 3092m, 1440 de los cuales sobre el agua, más el Viaducto Río San Pedro de 796m. Con los accesos a los puentes, la obra se extiende a lo largo de 5 km.\\nEl proyecto fue redactado por el ingeniero Javier Manterola y ha sido ejecutado por la empresa española Dragados."},{"page_url":"https://sr.wikipedia.org/wiki/Pinnipedimorpha","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/07/Puijila_BW.jpg","page_title":"Pinnipedimorpha","context_page_description":"Pinnipedimorpha, или перајолики сисари, је кладус псоликих звијери унутар инфрареда Arctoidea. Овај кладус сисара обухвата кладус Pinnipediformes, изумрлу породицу Semantoridae, изумрлу полифилетску породицу Enaliarctidae и изумрле родове Kolponomos и Pinnarctidion. Чланови кладуса Pinnipedimorpha се формално називају пинипедиморфима, а кладуса Pinnipediformes се називају пинипедиформима. Чланови кладуса Pinnipedimorpha и Pinnipediformes су такође знани и под називом праперајари."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%94%D0%B6%D0%B5%D0%B9%D0%BC%D1%81_%D0%92%D1%96%D1%81%D1%82%D0%BB%D0%B5%D1%80","image_url":"https://upload.wikimedia.org/wikipedia/uk/6/6b/345%D0%92%D1%96%D1%81%D1%82%D0%BB%D0%B5%D1%80._%D0%92%D0%B5%D1%80%D1%84_%D0%A7%D0%BE%D1%80%D0%BD%D0%B8%D0%B9_%D0%BB%D0%B5%D0%B2._%D0%A1%D0%B5%D1%80%D1%96%D1%8F_%D0%BE%D1%84%D0%BE%D1%80%D1%82%D1%96%D0%B2_%D0%A2%D0%B5%D0%BC%D0%B7%D0%B0._%D0%A8%D1%96%D1%81%D1%82%D0%BD%D0%B0%D0%B4%D1%86%D1%8F%D1%82%D1%8C_%D0%BA%D1%80%D0%B0%D1%94%D0%B2%D0%B4%D0%BE%D0%B2_%D0%A2%D0%B5%D0%BC%D0%B7%D0%B8_1859.jpg","page_title":"Джеймс Вістлер","context_page_description":"Джеймс Вістлер, повне ім'я Джеймс Ебботт Мак-Нейл Вістлер — англо-американський художник 2-ї половини 19 століття. Малював портрети, пейзажі, працював графіком, творив офорти і літографії."},{"page_url":"https://zh.wikipedia.org/wiki/%E8%8D%89%E5%9C%BA%E5%B9%BF%E5%9C%BA%E7%AB%99","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/69/EnghavePlA.jpg","page_title":"草场广场站","context_page_description":"草场广场站是哥本哈根地铁的一个地下车站。位于丹麦首都哥本哈根西关厢区草场广场地下，因所在区域曾是草场而得名。由且仅由哥本哈根地铁3号线使用。属于哥本哈根地铁第1收费区。 附近的地标包括：草场广场、草场公园、音乐聚会场所—— Vega、美食一条街——伊德施泰特街。2019年9月29日，随哥本哈根地铁3号线其余16座车站一同启用。 本站的内部装修大量采用红砖元素，与地面广场上的建筑红砖外墙相呼应。"},{"page_url":"https://en.wikipedia.org/wiki/List_of_monastic_houses_in_Ireland","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/71/Inch_Abbey_%28geograph_183149%29.jpg","page_title":"List of monastic houses in Ireland","context_page_description":"This is a list of the abbeys, priories, friaries and other monastic religious houses in Ireland."},{"page_url":"https://bn.wikipedia.org/wiki/%E0%A6%A6%E0%A7%8D%E0%A6%AC%E0%A6%BF%E0%A6%AC%E0%A7%80%E0%A6%9C%E0%A6%AA%E0%A6%A4%E0%A7%8D%E0%A6%B0%E0%A7%80_%E0%A6%89%E0%A6%A6%E0%A7%8D%E0%A6%AD%E0%A6%BF%E0%A6%A6","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e6/Lamium_album_%281%29.JPG","page_title":"দ্বিবীজপত্রী উদ্ভিদ","context_page_description":"দ্বিবীজপত্রী উদ্ভিদ দুটি গোষ্ঠীর মধ্যে একটি যাতে সমস্ত সপুষ্পক উদ্ভিদ বিভক্ত ছিল। নামটি দ্বারা গোষ্ঠীটির আদর্শ বৈশিষ্ট্য - বীজের দুটি ভ্রুণপত্র বা বীজপত্র রয়েছে- বোঝায়। প্রায় ২০০, ০০০ টি প্রজাতি এই গোষ্ঠীর অন্তর্ভুক্ত। অন্য গ্রুপের সপুষ্পক উদ্ভিদগুলোকে একবীজপত্রী বলা হয়, সাধারণত একটি বীজপত্র থাকে। ঐতিহাসিকভাবে, এই দুটি গ্রুপ সপুষ্পক উদ্ভিদের দুটি বিভাগ গঠন করেছিল।\\n১৯৯০ এর দশকের পর থেকে আণবিক উদ্ভিদতাত্ত্বিক গবেষণা নিশ্চিত করেছে যে দ্বিবীজপত্রী উদ্ভিদগুলো একটি সাধারণ পূর্বপুরুষের সমস্ত বংশধর দ্বারা গঠিত নয় । বরং ম্যাগনোলিডস এবং গোষ্ঠীগুলোর মতো বেশ কয়েকটি বংশ এখন সম্মিলিতভাবে মৌলিক অ্যাঞ্জিওস্পর্ম হিসাবে পরিচিত গোষ্ঠীগুলো একবীজপত্রীদের আগে বিভক্ত হয়েছিল; অন্য কথায় একবীজপত্রীগুলো ঐতিহ্যগতভাবে সংজ্ঞায়িত হিসাবে দ্বিবীজপত্রীগুলোর মধ্যে থেকেই বিকশিত হয়েছিল। ঐতিহ্যবাহী দ্বিবীজপত্রীগুলো এভাবে একটি প্যারাফাইলেটিক গ্রুপ। সুবীজপত্রী হল দ্বিবীজপত্রীদের মধ্যে বৃহত্তম গোষ্ঠী । এগুলো তাদের পরাগের কাঠামোর কারণে অন্যান্য সমস্ত সপুষ্পক উদ্ভিদ থেকে আলাদা। অন্যান্য দ্বিবীজপত্রী এবং একবীজপত্রীতে মনসুলকেট বা এটি থেকে প্রাপ্ত গঠনের পরাগ থাকে; যেখানে সুদ্বিবীজপত্রীগুলোতে ট্রাইকোলপেট পরাগ বা প্রাপ্ত গঠন রয়েছে, পরাগটি তিন বা ততোধিক ছিদ্রযুক্ত কলপী নামে পরিচিত ফরাতে থাকে।"},{"page_url":"https://fa.wikipedia.org/wiki/%D9%85%D8%A7%D8%AA%DB%8C%D9%88_%D8%A8%D9%88%D8%AF%D8%B1%D9%84%DB%8C%DA%AF","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e4/Mathieu_Bauderlique_Rio2016.jpg","page_title":"ماتیو بودرلیگ","context_page_description":"ماتیو بودرلیگ بوکسور اهل فرانسه است."},{"page_url":"https://bs.wikipedia.org/wiki/Projekt_10412","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5f/Patrol_boat_Triglav_side.jpg","page_title":"Projekt 10412","context_page_description":"Projekt 10412 je izvozna verzija ruskih patrolnih brodova iz klase Svetljak. Ova plovila su dizajnirana za obavljanje različitih zadataka, od patrolnih misija do sprečavanja kršenja pomorskih državnih granica kao i zaštita domaćih plovila i objekata od neprijateljskih zračnih i zemaljskih napada. Među zadaće Projekta 10412 ubrajaju se i nadgledanje ekskluzivnih ekonomskih zona kako bi se zaštitila područja bogata prirodnim resursima te obalne linije komunikacije."},{"page_url":"https://en.wikipedia.org/wiki/List_of_Grade_I_listed_buildings_in_Wiltshire","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/24/St._Andrews_church%2C_Great_Durnford_-_geograph.org.uk_-_147508.jpg","page_title":"List of Grade I listed buildings in Wiltshire","context_page_description":"This is a list of Grade I listed buildings in Wiltshire, England, in the United Kingdom.\\nThese buildings are protected for their historic significance. There is a parallel system for ancient monuments, known as 'scheduling', which means that there is not a consistent approach to sites like castles, abbeys and henges, which may be listed, scheduled or both. In England, the listing is administered by Historic England, an agency of the government's Department for Culture, Media & Sport.\\nBuildings of outstanding architectural or historic interest are listed at Grade I, and of the approximately 372,905 listed buildings in England, over 9,000 are Grade I. Estimates to the numbers of buildings do, however, vary given that separate listings apply to structurally separate buildings: therefore a street of houses can be listed as one building, but a church wall can be listed separately from the church. Some buildings are listed for their group value.\\nThis list covers the nearly 300 Grade I listed buildings in the ceremonial county of Wiltshire, grouped by former district."},{"page_url":"https://nl.wikipedia.org/wiki/Phormia_regina","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/03/Another_phormia.jpg","page_title":"Phormia regina","context_page_description":"Phormia regina is een vliegensoort uit de familie van de bromvliegen. De wetenschappelijke naam van de soort is voor het eerst geldig gepubliceerd in 1826 door Meigen."},{"page_url":"https://cs.wikipedia.org/wiki/Courtney_Love","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/63/Courtney_Love_Spin_party_SXSW_2010.jpg","page_title":"Courtney Love","context_page_description":"Courtney Love, rodným jménem Courtney Michelle Harrison, je americká rocková muzikantka a herečka. Známá je jako vůdčí zpěvačka, kytaristka a textařka zaniklé grungeové skupiny Hole a jako vdova po frontmanovi skupiny Nirvana Kurtu Cobainovi. Časopis Rolling Stone ji nazval „nejkontroverznější ženou v historii rocku“."},{"page_url":"https://ms.wikipedia.org/wiki/Kemeja","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/73/Shirt-types.svg","page_title":"Kemeja","context_page_description":"Kemeja adalah sejenis baju potongan Barat yang berlengan panjang atau pendek yang biasanya dipakai oleh orang lelaki. Kemeja boleh dipakai untuk majlis rasmi mahupun tidak."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%A0%D1%83%D0%BC%D1%8B%D0%BD%D0%B8%D1%8F_%D0%B2%D0%BE_%D0%92%D1%82%D0%BE%D1%80%D0%BE%D0%B9_%D0%BC%D0%B8%D1%80%D0%BE%D0%B2%D0%BE%D0%B9_%D0%B2%D0%BE%D0%B9%D0%BD%D0%B5","image_url":"http://upload.wikimedia.org/wikipedia/commons/5/51/Petru_Groza_joben.jpg","page_title":"Румыния во Второй мировой войне","context_page_description":"Королевство Румыния вступило во Вторую мировую войну на стороне стран Оси 22 июня 1941 года, одновременно с нападением Третьего рейха на Советский Союз.\\nРумынские войска принимали участие в боях на восточном фронте вместе с германскими. 7 декабря 1941 г. Румыния объявила войну Великобритании, а 12 декабря — США. В 1944 году театр военных действий переместился в Румынию, после чего в стране произошёл государственный переворот. Ион Антонеску и его сторонники были арестованы, к власти пришёл молодой король Михай I. С этого момента Румыния встала на сторону антигитлеровской коалиции. После окончания войны, 30 декабря 1947 король Михай I отрёкся от трона, была провозглашена Народная Республика Румыния."},{"page_url":"https://en.wikipedia.org/wiki/Irene_(costume_designer)","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/36/A_Tailor-Made_Man_%281922%29_-_2.jpg","page_title":"Irene (costume designer)","context_page_description":"Irene Maud Lentz, also known mononymously and professionally as Irene, was an American fashion designer and costume designer. Her work as a clothing designer in Los Angeles led to her career as a costume designer for films in the 1930s. Lentz also worked under the name Irene Gibbons."},{"page_url":"https://be.wikipedia.org/wiki/%D0%A1%D0%B0%D0%BA%D0%B0%D1%80%D1%81%D0%BA%D1%96_%D1%81%D0%BF%D1%96%D1%81_%D1%86%D0%B0%D1%80%D0%BE%D1%9E","image_url":"http://upload.wikimedia.org/wikipedia/commons/a/a8/SaqqaraKingList.png","page_title":"Сакарскі спіс цароў","context_page_description":"Сакарскі спіс цароў — пералік егіпецкіх цароў, выбіты на камені ў часы Рамсеса II. Цяпер захоўваецца ў Егіпецкім музеі.\\nСпіс быў знойдзен у 1861 годзе ў Егіпце ў Сакары, у грабніцы Тунры, чыноўніка фараона Рамсеса II.\\nУ надпісе пералічваюцца 58 цароў, ад Анеджыба і Каа да Рамсеса II, у адваротным храналагічным парадку, за выключэннем «правіцеляў Другога пераходнага перыяду, гіксосаў, і тых правіцеляў… якія былі блізкія да ерэтычнага Эхнатона».\\nІмёны, з якіх толькі 47 захавалася, вельмі пашкоджаныя. У спісе вялікая колькасць недакладнасцей, напрыклад, там упамінаюцца толькі чатыры цары III дынастыі. Храналогія правільная толькі для цароў XII дынастыі. Адзіны вядомы фотаздымак спіса быў апублікован у 1865 годзе."},{"page_url":"https://es.wikipedia.org/wiki/Paisaje_nil%C3%B3tico","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/53/Tomb_of_Nakht_%288%29.jpg","page_title":"Paisaje nilótico","context_page_description":"El paisaje nilótico es cualquier representación de paisajes que imita o se inspira en el río Nilo de Egipto. El término surgió para designar principalmente aquellos paisajes creados fuera de Egipto, especialmente en el mar Egeo, a pesar de que se usa a veces para referirse a escenas de cacería y pesca del arte egipcio. Un paisaje nilótico es una escena fluvial con muchas y abundantes plantas y vida animal, especialmente nativas de Egipto. Hay elementos iconográficos típicos, como por ejemplo papiros, palmeras, peces y pájaros acuáticos, y en algunos casos felinos, monos, y cocodrilos.\\nLas pruebas arqueológicas dan fe de representaciones del Nilo en tumbas egipcias en épocas tan tempranas como en el periodo predinástico. Las escenas nilóticas siguieron siendo populares durante el periodo tardío y el Imperio Medio, y florecieron durante el Imperio Nuevo. Fueron particularmente relevantes las pinturas de paisajes en tumbas de la dinastía XVIII. Los paisajes nilóticos fueron adaptados por primera vez fuera de Egipto en el Egeo, especialmente en el arte de la civilización minoica."},{"page_url":"https://sh.wikipedia.org/wiki/H%C3%BCven","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3c/H%C3%BCven_in_EL.svg","page_title":"Hüven","context_page_description":"Hiven je opština u njemačkoj saveznoj državi Donja Saksonija. Jedno je od 60 opštinskih središta okruga Emsland. Prema procjeni iz 2010. u opštini je živjelo 556 stanovnika. Posjeduje regionalnu šifru 3454023."},{"page_url":"https://it.wikipedia.org/wiki/Armoriale_delle_famiglie_italiane_(Gio-Giz)","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/35/Coa_fam_ITA_giogo.jpg","page_title":"Armoriale delle famiglie italiane (Gio-Giz)","context_page_description":"Questo è l'armoriale delle famiglie italiane il cui cognome inizia con le lettere che vanno da Gio a Giz."},{"page_url":"https://zh.wikipedia.org/wiki/%E5%A4%A7%E9%9B%AA%E5%B1%B1%E5%9C%8B%E7%AB%8B%E5%85%AC%E5%9C%92","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b0/140724_Asahi-dake_Hokkaido_Japan01s3.jpg","page_title":"大雪山國立公園","context_page_description":"大雪山國立公園為日本北海道中部的國立公園，成立於1934年12月4日。面積2,267.64平方千米，比東京都的面積還大，為全日本最大的國立公園，其中98％為國有地，加上北海道道有地則達到99％。\\n公園以旭岳、北鎮岳、白雲岳、黑岳、赤岳，以及大雪山系的十勝岳、富村牛山、ニペソツ山、石狩岳等高度約2000公尺左右的群山所組成。區域內有多種動物和高山植物。"},{"page_url":"https://it.wikipedia.org/wiki/Chiesa_di_San_Leopoldo_(Abetone)","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a0/Abetone%2C_san_leopoldo.jpg","page_title":"Chiesa di San Leopoldo (Abetone)","context_page_description":"La chiesa di San Leopoldo si trova nel comune dell'Abetone, frazione del comune sparso di Abetone Cutigliano, in provincia e diocesi di Pistoia."},{"page_url":"https://hi.wikipedia.org/wiki/%E0%A4%B0%E0%A4%BE%E0%A4%AE%E0%A4%AD%E0%A4%A6%E0%A5%8D%E0%A4%B0%E0%A4%BE%E0%A4%9A%E0%A4%BE%E0%A4%B0%E0%A5%8D%E0%A4%AF","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1b/JRHU_-_Chancellor_with_students.jpg","page_title":"रामभद्राचार्य","context_page_description":"जगद्गुरु रामभद्राचार्य, पूर्वाश्रम नाम गिरिधर मिश्र चित्रकूट में रहने वाले एक प्रख्यात विद्वान्, शिक्षाविद्, बहुभाषाविद्, रचनाकार, प्रवचनकार, दार्शनिक और हिन्दू धर्मगुरु हैं। वे रामानन्द सम्प्रदाय के वर्तमान चार जगद्गुरु रामानन्दाचार्यों में से एक हैं और इस पद पर १९८८ ई से प्रतिष्ठित हैं। वे चित्रकूट में स्थित संत तुलसीदास के नाम पर स्थापित तुलसी पीठ नामक धार्मिक और सामाजिक सेवा संस्थान के संस्थापक और अध्यक्ष हैं। वे चित्रकूट स्थित जगद्गुरु रामभद्राचार्य विकलांग विश्वविद्यालय के संस्थापक और आजीवन कुलाधिपति हैं। यह विश्वविद्यालय केवल चतुर्विध विकलांग विद्यार्थियों को स्नातक तथा स्नातकोत्तर पाठ्यक्रम और डिग्री प्रदान करता है। जगद्गुरु रामभद्राचार्य दो मास की आयु में नेत्र की ज्योति से रहित हो गए थे और तभी से प्रज्ञाचक्षु हैं।\\nअध्ययन या रचना के लिए उन्होंने कभी भी ब्रेल लिपि का प्रयोग नहीं किया है। वे बहुभाषाविद् हैं और २२ भाषाएँ बोलते हैं। वे संस्कृत, हिन्दी, अवधी, मैथिली सहित कई भाषाओं में आशुकवि और रचनाकार हैं। उन्होंने ८० से अधिक पुस्तकों और ग्रंथों की रचना की है, जिनमें चार महाकाव्य, रामचरितमानस पर हिन्दी टीका, अष्टाध्यायी पर काव्यात्मक संस्कृत टीका और प्रस्थानत्रयी पर संस्कृत भाष्य सम्मिलित हैं।"},{"page_url":"https://en.wikipedia.org/wiki/Mercer_University","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/70/Mercer_University_Mercer_Lofts.jpg","page_title":"Mercer University","context_page_description":"Mercer University is a private research university with its main campus in Macon, Georgia. Founded in 1833 as Mercer Institute and gaining university status in 1837, it is the oldest private university in Georgia and enrolls more than 8,600 students in 12 colleges and schools: liberal arts, business, engineering, education, music, college of professional advancement, law, theology, medicine, pharmacy, nursing, and health professions. Mercer is a member of the Georgia Research Alliance and has a chapter of Phi Beta Kappa, the nation's oldest collegiate honors society. Mercer University alumni include 24 United States Representatives, 12 Governors, four United States Senators, and two Pulitzer Prize winners.\\nMercer has three major campuses: the historic campus in Macon, a graduate and professional education campus in Atlanta, and a four-year campus of the School of Medicine in Savannah."},{"page_url":"https://es.wikipedia.org/wiki/Prenilaci%C3%B3n","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/19/Prenyl_group.svg","page_title":"Prenilación","context_page_description":"Prenilación, isoprenilación o lipidación es la adición de moléculas hidrofóbicas a una proteína. Los grupos prenilo facilitan la unión a las membranas celulares, similar a los anclajes lipídicos como el anclaje GPI, aunque falta evidencia en este sentido. Los grupos prenilo han resultado ser importantes para la unión proteína-proteína."},{"page_url":"https://en.wikipedia.org/wiki/Paddyfield_pipit","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/72/Paddyfield_Pipit.JPG","page_title":"Paddyfield pipit","context_page_description":"The paddyfield pipit or Oriental pipit is a small passerine bird in the pipit and wagtail family. It is a resident breeder in open scrub, grassland and cultivation in southern Asia east to the Philippines. Although among the few breeding pipits in the Asian region, identification becomes difficult in winter when several other species migrate into the region. The taxonomy of the species is complex and has undergone considerable changes."},{"page_url":"https://sv.wikipedia.org/wiki/Slaget_vid_Storkyro","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f7/Golitsyn_M_M_1675-1730.jpg","page_title":"Slaget vid Storkyro","context_page_description":"Slaget vid Storkyro i Finland under stora nordiska kriget ägde rum den 19 februari 1714. Den svenske befälhavaren Armfeldt hade retirerat till byn Storkyro och inväntade ryssarna. Trots den finska vinterns hårda förhållanden fortsatte ryssarna sin offensiv."},{"page_url":"https://en.wikipedia.org/wiki/Milton,_Georgia","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/47/Fulton_County_Georgia_Municipalities_Map_Milton_Highlighted.svg","page_title":"Milton, Georgia","context_page_description":"Milton is an affluent rural-suburban city in Fulton County, Georgia, United States. It is a suburb of Atlanta. Incorporated on December 1, 2006, it was created out of the unincorporated northernmost part of northern Fulton County. As of the 2010 census, Milton's population was 32,661, with an estimated population of 39,587 in 2019.\\nMilton is named in honor of the former Milton County, which was named after Revolutionary War hero John Milton. The portion of north Fulton County generally north of the Chattahoochee River comprises most of the territory of the former Milton County."},{"page_url":"https://en.wikipedia.org/wiki/Vendays-Montalivet","image_url":"http://upload.wikimedia.org/wikipedia/commons/1/1e/Mairie_Montalivet-2.JPG","page_title":"Vendays-Montalivet","context_page_description":"Vendays-Montalivet is a commune in the Gironde department in Nouvelle-Aquitaine in southwestern France."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%9F%D0%BE%D1%80%D1%82_(%D1%80%D0%B0%D0%B9%D0%BE%D0%BD_%D0%A2%D1%83%D1%80%D0%BA%D1%83)","image_url":"http://upload.wikimedia.org/wikipedia/commons/6/63/Turku%2C_Satama.png","page_title":"Порт (район Турку)","context_page_description":"Порт (район Турку) — один из районов города Турку, входящий в Центральный территориальный округ."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Kulturdenkm%C3%A4ler_in_Frankfurt-H%C3%B6chst","image_url":"http://upload.wikimedia.org/wikipedia/commons/6/6e/Frankfurt_Am_Main-Leverkuser_Strasse_4_6_von_Nordwesten-20100524.jpg","page_title":"Liste der Kulturdenkmäler in Frankfurt-Höchst","context_page_description":"In der Liste der Kulturdenkmäler in Frankfurt-Höchst sind alle Kulturdenkmäler im Sinne des Hessischen Denkmalschutzgesetzes von Frankfurt-Höchst, Stadtteil von Frankfurt am Main aufgelistet. Die gut erhaltene Höchster Altstadt enthält den Großteil der Kulturdenkmäler und steht seit 1972 unter Denkmalschutz. Die meisten Fachwerkhäuser auf mittelalterlichem Stadtgrundriss stammen aus der Zeit nach dem großen Stadtbrand von 1586.\\nGrundlage ist die Denkmaltopographie aus dem Jahre 1994, die zuletzt 2000 durch einen Nachtragsband ergänzt wurde. Zusätzlich wird auf die 2008 erschienene Ausgabe des Handbuchs der Deutschen Kunstdenkmäler für den Regierungsbezirk Darmstadt sowie das 1979 erschienene Werk Fachwerk in Frankfurt am Main zurückgegriffen, sofern dort aktuellere oder zusätzliche Informationen vorhanden sind. In der Denkmaltopographie überwiegend abgekürzte Namen von Architekten, Baumeistern und Künstlern sind, soweit möglich, nach der unter dem Abschnitt Werke zu Architekten und Künstlern genannten Literatur aufgelöst."},{"page_url":"https://de.wikipedia.org/wiki/Museum_Mensch_und_Natur","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e1/JJ1_%28Bruno%29_im_Museum_Mensch_und_Natur_002.jpg","page_title":"Museum Mensch und Natur","context_page_description":"Das Museum Mensch und Natur ist ein Naturkundemuseum im Nordteil von Schloss Nymphenburg in München. Es ist ein Museum der Staatlichen Naturwissenschaftlichen Sammlungen Bayerns. Auf 2500 Quadratmetern werden die Entstehung des Sonnensystems, die Geschichte der Erde und die Entwicklung des Lebens, aber auch die Anatomie und Biologie des Menschen, Ernährung und Umweltprobleme sowie das Verhältnis des Menschen zur Natur dargestellt. Speziell für Kinder gibt es die Abteilung „Spielerische Naturkunde“.\\nIn dem Museum wird seit Anfang April 2008 auch der präparierte Braunbär JJ1 ausgestellt, wie bereits sein Vorgänger, der vor 170 Jahren erlegte letzte Braunbär Bayerns."},{"page_url":"https://sl.wikipedia.org/wiki/Ferdo_Gradi%C5%A1nik","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9d/Ferdo_Gradi%C5%A1nik.jpg","page_title":"Ferdo Gradišnik","context_page_description":"Ferdo Gradišnik, slovenski častnik in vojaški pilot, * 16. avgust 1899, Veliki Lešnov, Istra, † 8. april 1941, Kačanička klisura.\\nLeta 1922 je vstopil v vojno letalstvo Kraljevine SHS. 1923 je v Novem Sadu končal letalsko izvidniško šolo, naslednje leto pa še pilotsko šolo, še naslednje leto pa šolo za pilota-lovca.\\nZaradi nadarjenosti za letenje je večkrat zastopal Jugoslavijo na mednarodnih tekmah.\\nZačetek aprilske vojne je pričakal kot poveljnik 1. bombniškega polka v Bijeljini. 8. aprila 1941 je njegovo letalo strmoglavilo, ko je v tesni soteski odvrgel bombe na napredujoče Nemce in so drobci bomb zadeli tudi njegovo letalo."},{"page_url":"https://ro.wikipedia.org/wiki/Scheletul_p%C4%83s%C4%83rilor","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1c/Dove_skeleton_ro.jpg","page_title":"Scheletul păsărilor","context_page_description":"Ca să zboare, păsările au făcut multe adaptări: a fost redusă masa oaselor și numărul lor.A aparut carena, ce asigură o mișcare mai bună a aripilor. În urma adaptării, scheletul păsării a devenit atât de ușor, încât nu cântărește mai mult de 5% din corpul oricărei păsări. Acest schelet este destul de elastic, păsările putând să-și întoarcă capul la un unghi de până la 180 de grade."},{"page_url":"https://mk.wikipedia.org/wiki/%D0%97%D0%B0%D1%84%D1%80%D0%B0","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0c/Palacio_de_los_Feria%2C_Zafra.jpg","page_title":"Зафра","context_page_description":"Зафра — град сместен во покраината Бадахос, и главниот град на округот, Зафра - Рио Бодион. Градот има населени од 16.677, според пописот од 2011 година.\\nЗафра е родниот град на Реј Лопез де Сегура, автор на едно од првите европски записи за шахот, и хуманистот Педро де Валенсија."},{"page_url":"https://zh.wikipedia.org/zh-my/%E9%82%B5%E7%BE%8E%E7%90%AA","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/bd/Maggie_Shiu.JPG","page_title":"邵美琪","context_page_description":"邵美琪，香港女演员，前无线电视部头合约艺人，亦是无线1980年代末至1990年代中的当家花旦。曾与刘德华、郭富城、张曼玉等多位演员合作。现时主要接拍电影及TVB剧集。"},{"page_url":"https://fr.wikipedia.org/wiki/Atomium","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a1/Staircase_Atomium_Brussels.jpg","page_title":"Atomium","context_page_description":"L’Atomium est un monument de Bruxelles, en Belgique, construit à l'occasion de l'Exposition universelle de 1958 et représentant la maille conventionnelle du cristal de fer agrandie 165 milliards de fois. Il est situé à Laeken sur le plateau du Heysel où eut lieu cette exposition."},{"page_url":"https://fr.wikipedia.org/wiki/Henri_Courtenay_(1er_marquis_d%27Exeter)","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/55/Coat_of_arms_of_Henry_Courtenay%2C_marquess_of_Exeter.svg","page_title":"Henri Courtenay (1er marquis d'Exeter)","context_page_description":"Henri Courtenay, 1ᵉʳ comte de Devon puis 1ᵉʳ marquis d'Exeter, chevalier de la Jarretière, est un aristocrate et courtisan anglais."},{"page_url":"https://ba.wikipedia.org/wiki/%D0%9C%D3%99%D0%BD%D3%99%D0%B9%D0%B5%D1%80","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d4/Road_to_village_Aryshparovo.jpg","page_title":"Мәнәйер","context_page_description":"Мәнәйер — Рәсәй йылғаһы. Башҡортостандың Белорет районы Арышпар ауылының биләмәләрендә аға. Йылға Инйәр йылғаһының һул ярына тамағынан 149 км өҫтәрәк ҡушыла. Йылға оҙонлоғо 20 км. Һыу объекты системаһы: Инйәр → Эҫем → Ағиҙел → Кама → Волга → Каспий диңгеҙе"},{"page_url":"https://en.wikipedia.org/wiki/Prince-Bishopric_of_W%C3%BCrzburg","image_url":"http://upload.wikimedia.org/wikipedia/commons/0/05/Johann_Philipp_Erzbischof_von_Mainz.jpg","page_title":"Prince-Bishopric of Würzburg","context_page_description":"The Prince-Bishopric of Würzburg was an ecclesiastical principality of the Holy Roman Empire located in Lower Franconia west of the Prince-Bishopric of Bamberg. Würzburg had been a diocese since 743. As definitely established by the Concordat of 1448, bishops in Germany were chosen by the canons of the cathedral chapter and their election was later confirmed by the pope. Following a common practice in Germany, the prince-bishops of Würzburg were frequently elected to other ecclesiastical principalities as well. The last few prince-bishops resided at the Würzburg Residence, which is one of the grandest baroque palaces in Europe.\\nAs a consequence of the 1801 Treaty of Lunéville, Würzburg, along with the other ecclesiastical states of Germany, was secularized in 1803 and absorbed into the Electorate of Bavaria. In the same year Ferdinand III, former Grand Duke of Tuscany, was compensated with the Electorate of Salzburg. In the 1805 Peace of Pressburg, Ferdinand lost Salzburg to the Austrian Empire, but was compensated with the new Grand Duchy of Würzburg, Bavaria having relinquished the territory in return for the Tyrol."},{"page_url":"https://ar.wikipedia.org/wiki/%D9%82%D8%A7%D8%A6%D9%85%D8%A9_%D8%A7%D9%84%D9%85%D8%B3%D9%8A%D8%AD%D9%8A%D9%8A%D9%86_%D8%A7%D9%84%D8%AD%D8%A7%D8%B5%D9%84%D9%8A%D9%86_%D8%B9%D9%84%D9%89_%D8%AC%D8%A7%D8%A6%D8%B2%D8%A9_%D9%86%D9%88%D8%A8%D9%84","image_url":"http://upload.wikimedia.org/wikipedia/commons/c/c3/Dag_Hammarskj%C3%B6ld.jpg","page_title":"قائمة المسيحيين الحاصلين على جائزة نوبل","context_page_description":"وفقًا لكتاب ذكرى 100 عام لجائزة نوبل ينتمي حوالي 65.4% من الحاصلين على جائزة نوبل إلى الديانة المسيحية بطوائفها المتعددة. أي حصل المسيحيين على 427 جائزة من أصل 654 بين السنوات 1901-2000.\\nحصل المسيحيون بين السنوات 1901-2000 على 78.3% من جوائز نوبل للسلام، وعلى 72.5% من جوائز نوبل في الكيمياء، وكان 65.3% من جوائز نوبل في الفيزياء، و62% من جوائز نوبل في الطب، و53.5% من جوائز نوبل في الاقتصاد و49.5% من جوائز نوبل في الأدب من نصيب المسيحيين.\\nعلى المستوى المذهبي كانت نصيب البروتستانت بين السنوات 1901-2000 حوالي 32% من جوائز نوبل، في حين كانت نصيب المسيحيين الذين لم تحدد طائفتهم ب20.3%، أمّا نصيب الكاثوليك فكان 11.6%، في حين كان نصيب أتباع الكنيسة الأرثوذكسية الشرقية 1.6% من مجمل جوائز نوبل. يُذكر أن البروتستانت والمسيحيين الذين لم تحدد طائفتهم يتركز حضورهم في تصنيفات جوائز نوبل في الكيمياء والفيزياء والطب في حين أن الكاثوليك يتركز تمثليهم في جوائز نوبل للأدب والسلام والطب، أمّا الأرثوذكس الشرقيين لديهم تمثيل عالي في تصنيفات نوبل للفيزياء والإقتصاد والأدب.\\nجدير بالذكر أنّ الفرد نوبل المهندس ومخترع الديناميت والكيميائي السويدي، والذي سميَّت جائزة نوبل بإسمه؛ كان مسيحيًا ملتزمًا وعضوًا في الكنيسة اللوثرية السويديَّة."},{"page_url":"https://uz.wikipedia.org/wiki/Germaniya","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/da/Deutschland_topo.jpg","page_title":"Germaniya","context_page_description":"Germaniya, Germaniya Federativ Respublikasi — Markaziy Yevropadagi davlat. Shimoliy Boltiq dengizlari sohilida joylashadi. Maydoni 357 ming km². Aholisi 83,149,300 kishi. Poytaxti — Berlin shahri. Maʼmuriy jihatdan 16 yer ga, yerlar okruglarga, okruglar tumanlarga, tumanlar jamoalarga boʻlinadi."},{"page_url":"https://en.wikipedia.org/wiki/Stairs","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1c/Kasyno_Szlacheckie_we_Lwowie1.jpg","page_title":"Stairs","context_page_description":"A stairway, staircase, stairwell, flight of stairs, or simply stairs, is a construction designed to bridge a large vertical distance by dividing it into smaller vertical distances, called steps. Stairs may be straight, round, or may consist of two or more straight pieces connected at angles.\\nSpecial types of stairs include escalators and ladders. Some alternatives to stairs are elevators, stairlifts and inclined moving walkways."},{"page_url":"https://en.wikipedia.org/wiki/Fairey_Gannet_AEW.3","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7d/Fairey_Gannet_AEW3_3_side_drawing.PNG","page_title":"Fairey Gannet AEW.3","context_page_description":"The Fairey Gannet AEW.3 is a variant of the Fairey Gannet anti-submarine warfare aircraft intended to be used in the airborne early warning role on aircraft carriers of the Royal Navy. It was introduced to service in 1959 to replace the obsolete Douglas Skyraider, and was intended as an interim solution until the planned introduction of a new, purpose built AEW platform for use on the planned CVA-01 aircraft carriers. Neither the new aircraft carriers nor the new AEW aircraft were proceeded with, and the Gannet AEW.3 remained in service until the last aircraft carrier that could operate it was retired in 1978."},{"page_url":"https://ceb.wikipedia.org/wiki/Sciades","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/41/Sciades_herzbergii_%28Bloch%2C_1794%29_02.jpg","page_title":"Sciades","context_page_description":"Henero sa mga isda ang Sciades. Ang Sciades sakop sa kabanay nga Ariidae.\\nMao ni ang iyang kladogram matod sa Catalogue of Life:"},{"page_url":"https://en.wikipedia.org/wiki/MacAdam_Shield_Shovel","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/80/Sam_Hughes_holding_the_McAdam_shovel.jpg","page_title":"MacAdam Shield Shovel","context_page_description":"The MacAdam Shield-Shovel, also known as the Hughes Shovel, was an item of Canadian infantry equipment during the First World War. It was designed and patented by Sam Hughes, the Canadian minister for the Department of Militia and Defence in 1913, combining function as a spade/shovel and as a shield. Ena MacAdam, Hughes' personal secretary, had first suggested the idea of a shield shovel to Hughes after she witnessed Swiss soldiers making field entrenchments during field exercises."},{"page_url":"https://be-tarask.wikipedia.org/wiki/%D0%9C%D1%8F%D0%B4%D0%B7%D0%B5%D0%BB","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3d/Miadzie%C5%82%2C_Tatarski._%D0%9C%D1%8F%D0%B4%D0%B7%D0%B5%D0%BB%2C_%D0%A2%D0%B0%D1%82%D0%B0%D1%80%D1%81%D0%BA%D1%96_%281932%29.jpg","page_title":"Мядзел","context_page_description":"Мя́дзел — места ў Беларусі, паміж азёрамі Мястрам і Баторынам. Адміністрацыйны цэнтар Мядзельскага раёну Менскай вобласьці. Насельніцтва на 2018 год — 6911 чалавек. Знаходзіцца за 160 км на паўночны захад ад Менску, за 35 км ад чыгуначнай станцыі Княгінін; на аўтамабільнай дарозе Менск — Нарач.\\nМядзел — даўняе магдэбурскае мястэчка гістарычнай Ашмяншчыны, старажытны замак Вялікага Княства Літоўскага. Да нашага часу тут захаваўся збудаваны ў стылі барока комплекс кляштару кармэлітаў з касьцёлам Маці Божай Шкаплернай, помнік архітэктуры XVIII ст., а таксама мясцовая Кальварыя."},{"page_url":"https://ceb.wikipedia.org/wiki/Waiblingen_(kapital_sa_distrito)","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1d/Waiblingen_Rathaus.jpg","page_title":"Waiblingen (kapital sa distrito)","context_page_description":"Kapital sa distrito ang Waiblingen sa Alemanya. Nahimutang ni sa distrito nga gobyerno sa Regierungsbezirk Stuttgart ug estado pederal sa Baden-Württemberg Region, sa habagatang bahin sa nasod, 500 km sa habagatan-kasadpan sa Berlin ang ulohan sa nasod. 233 metros ibabaw sa dagat kahaboga ang nahimutangan sa Waiblingen, ug adunay 52,945 ka molupyo.\\nAng yuta palibot sa Waiblingen kay patag sa amihang-kasadpan, apan sa habagatang-sidlakan nga kini mao ang kabungtoran. Waiblingen nahimutang sa usa ka walog. Ang kinahabogang dapit sa palibot dunay gihabogon nga 294 ka metro ug 1.1 km sa amihanan-sidlakan sa Waiblingen. Dunay mga 790 ka tawo kada kilometro kwadrado sa palibot sa Waiblingen nga hilabihan populasyon. Ang kinadul-ang mas dakong lungsod mao ang Stuttgart, 11.6 km sa habagatan-kasadpan sa Waiblingen. Sa rehiyon palibot sa Waiblingen, mga lasang, ug mga bungtod talagsaon komon.\\nHapit nalukop sa lasang nga sagolsagol ang palibot sa Waiblingen. Ang klima baybayon. Ang kasarangang giiniton 10 °C. Ang kinainitan nga bulan Hulyo, sa 22 °C, ug ang kinabugnawan Disyembre, sa -4 °C. Ang kasarangang pag-ulan 1,117 milimetro matag tuig."},{"page_url":"https://he.wikipedia.org/wiki/%D7%9E%D7%96%D7%9B%D7%99%D7%A8_%D7%94%D7%A2%D7%91%D7%95%D7%93%D7%94_%D7%A9%D7%9C_%D7%90%D7%A8%D7%A6%D7%95%D7%AA_%D7%94%D7%91%D7%A8%D7%99%D7%AA","image_url":"http://upload.wikimedia.org/wikipedia/commons/2/23/Jtdunlop.jpg","page_title":"מזכיר העבודה של ארצות הברית","context_page_description":"מזכיר העבודה של ארצות הברית הוא ראש מחלקת העבודה של ארצות הברית וחבר הקבינט של ארצות הברית.\\nמזכיר העבודה הוא נושא המשרה ה־11 בסדר ההחלפה של נשיא ארצות הברית במקרה שכהונת הנשיא נקטעת.\\nמזכיר העבודה הנוכחי הוא יוג'ין סקאליה, שהושבע לתפקידו ב-30 בספטמבר 2019."},{"page_url":"https://kn.wikipedia.org/wiki/%E0%B2%AC%E0%B3%8D%E0%B2%AF%E0%B2%BE%E0%B2%AA%E0%B3%8D%E0%B2%9F%E0%B2%BF%E0%B2%B8%E0%B2%AE%E0%B3%8D(%E0%B2%A6%E0%B3%80%E0%B2%95%E0%B3%8D%E0%B2%B7%E0%B2%BE%E0%B2%B8%E0%B3%8D%E0%B2%A8%E0%B2%BE%E0%B2%A8,_%E0%B2%9C%E0%B3%8D%E0%B2%9E%E0%B2%BE%E0%B2%A8%E0%B2%B8%E0%B3%8D%E0%B2%A8%E0%B2%BE%E0%B2%A8)","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/69/Baptism_-_Marcellinus_and_Peter.jpg","page_title":"ಬ್ಯಾಪ್ಟಿಸಮ್(ದೀಕ್ಷಾಸ್ನಾನ, ಜ್ಞಾನಸ್ನಾನ)","context_page_description":"ಕ್ರೈಸ್ತಧರ್ಮದಲ್ಲಿ, ಬ್ಯಾಪ್ಟಿಸಮ್ ಎಂಬುದು ಒಂದು ಧಾರ್ಮಿಕ ವಿಧಿಯ ಆಚರಣೆಯಾಗಿದ್ದು, ಇದರಲ್ಲಿ ನೀರನ್ನು ಬಳಸುವುದರ ಮೂಲಕ ವ್ಯಕ್ತಿಯೊಬ್ಬನಿಗೆ ಚರ್ಚ್ನ ಸದಸ್ಯತ್ವವನ್ನು ನೀಡಲಾಗುವುದು.\\nಯೇಸುವು ಸ್ವತಃ ತಾನು ಬ್ಯಾಪ್ಟೈಜ್ ಆಗಿದ್ದರು. ಅರಂಭದ ಕ್ರಿಶ್ಚಿಯನ್ನರಲ್ಲಿ ಸಾಮಾನ್ಯವಾಗಿ ಆಚರಣೆಯಲ್ಲಿದ್ದ ಬ್ಯಾಪ್ಟಿಸಮ್‌ನ ವಿಧಾನವು ಅಭ್ಯರ್ಥಿಯನ್ನು ಸಂಪೂರ್ಣವಾಗಿ ಇಲ್ಲವೇ ಪಾರ್ಶ್ವಿಕವಾಗಿ ಅದ್ದುವುದನ್ನು ಒಳಗೊಂಡಿದ್ದಿತು. ಜಾನ್ ದ ಬ್ಯಾಪ್ಟಿಸ್ಟ್ನು ತನ್ನ ಬ್ಯಾಪ್ಟಿಸಮ್‌ನಲ್ಲಿ ಆಳವಾದ ನದಿಯನ್ನು ಬಳಸಿದ್ದುದು ಅದ್ದುವಿಕೆಯನ್ನು ಸೂಚಿಸುತ್ತದಾದರೂ, 3ನೇ ಶತಮಾನ ಮತ್ತು ನಂತರದ ಕ್ರಿಶ್ಚಿಯನ್ ಬ್ಯಾಪ್ಟಿಸಮ್‌ನ ಚಿತ್ರಗಳು ಹಾಗೂ ಉತ್ಖನನದ ಸಾಕ್ಷಿಗಳು\\nಅಗಿನ ಸಾಮಾನ್ಯ ಆಚರಣೆಯ ಪ್ರಕಾರ ಅಭ್ಯರ್ಥಿಯು ನೀರಿನಲ್ಲಿ ನಿಂತುಕೊಂಡಿದ್ದಾಗ ಆತನ ದೇಹದ ಮೇಲ್ಭಾಗದ ಮೇಲೆ ನೀರನ್ನು ಸುರಿಯಲಾಗುತ್ತಿತ್ತೆಂಬುದನ್ನು ಸೂಚಿಸುತ್ತವೆ. ಈಗ ಬಳಕೆಯಲ್ಲಿರುವ ಬ್ಯಾಪ್ಟಿಸಮ್‌ನ ಇತರ ಸಾಮಾನ್ಯ ಆಚರಣೆಗಳು ಹಣೆಯ ಮೇಲೆ ಮೂರು ಬಾರಿ ನೀರನ್ನು ಸುರಿಯುವುದನ್ನು ಒಳಗೊಂಡಿವೆ.\\nಹದಿನಾರನೇ ಶತಮಾನದಲ್ಲಿ ಹಲ್ಡ್‌ರಿಚ್ ಜ್ವಿಂಗ್ಲಿ ಎಂಬವರು ಅದರ ಅವಶ್ಯಕತೆಯನ್ನು ನಿರಾಕರಿಸುವವರೆಗೂ ಬ್ಯಾಪ್ಟಿಸಮ್ ಅನ್ನು ಹಲವು ರೀತಿಗಳಲ್ಲಿ ಮೋಕ್ಷ ಪಡೆಯಲು ಅವಶ್ಯಕವೆಂದು ಕಾಣಲಾಗುತ್ತಿದ್ದಿತು. ಹುತಾತ್ಮತೆಯನ್ನು ಚರ್ಚಿನ ಇತಿಹಾಸದಲ್ಲಿ \\"ರಕ್ತದ ಮೂಲಕ ಬ್ಯಾಪ್ಟಿಸಮ್\\" ಎಂದು ಉಲ್ಲೇಖಿಸುವುದರ ಮೂಲಕ ನೀರಿನಿಂದ ಬ್ಯಾಪ್ಟೈಜ್ ಆಗಿರದ ಹುತಾತ್ಮರನ್ನು ಕಾಪಾಡುವ ವ್ಯವಸ್ಥೆ ಮಾಡಲಾಯಿತು."},{"page_url":"https://simple.wikipedia.org/wiki/Le_Veurdre","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/64/Le_Veurdre_Eglise_%281%29.jpg","page_title":"Le Veurdre","context_page_description":"Le Veurdre is a commune. It is found in the Allier department in the center of France."},{"page_url":"https://fr.wikipedia.org/wiki/Hossein_Ala%27","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ef/HosseinAlaPM1334.jpg","page_title":"Hossein Ala'","context_page_description":"Hossein Alaʾ, né le 13 décembre 1882 à Téhéran et mort le 13 juillet 1964 dans la même ville, est un homme politique iranien. Il a étudié à Londres et a commencé la politique après un poste au ministère des Affaires étrangères iranien. Il est ensuite devenu député au Majles et faisait partie de ceux qui s'opposaient à la chute de la dynastie des Qajar à l'époque où Reza Shah Pahlavi a pris le pouvoir en 1925.\\nDe 1934 à 1936, il est ambassadeur d'Iran au Royaume-Uni. Il sera ambassadeur d'Iran aux États-Unis entre 1946 et 1950.\\nIl est nommé Premier ministre en 1951, et ne reste qu'un mois au pouvoir avant d'être remplacé par Mohammad Mossadegh. Il est de nouveau Premier ministre entre le 7 avril 1955 et le 3 avril 1957. Après son poste de Premier ministre, il est nommé ministre de la Cour par le Shah, jusqu'en 1963, où il devient sénateur, un poste qu'il occupera jusqu'à sa mort en 1964."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%A1%D0%B5%D1%80%D0%B0%D0%BF%D0%B5%D1%83%D0%BC","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5a/Empuries_Serapieion.jpg","page_title":"Серапеум","context_page_description":"Серапеум — храм чи інша релігійна споруда, присвячена елліністичному богу Серапісу в Єгипті, що поєднував у собі риси Осіріса й Апіса в образі людини, який був більш звичним для греків. Існувало кілька таких релігійних центрів, кожен з яких мав назву Серапеум."},{"page_url":"https://th.wikipedia.org/wiki/%E0%B8%A3%E0%B8%96%E0%B9%84%E0%B8%9F%E0%B9%83%E0%B8%95%E0%B9%89%E0%B8%94%E0%B8%B4%E0%B8%99%E0%B8%9A%E0%B8%AD%E0%B8%AA%E0%B8%95%E0%B8%B1%E0%B8%99_%E0%B8%AA%E0%B8%B2%E0%B8%A2%E0%B8%AA%E0%B8%B5%E0%B9%80%E0%B8%82%E0%B8%B5%E0%B8%A2%E0%B8%A7","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f5/Haymarket_Green_westbound.jpg","page_title":"รถไฟใต้ดินบอสตัน สายสีเขียว","context_page_description":"รถไฟใต้ดินบอสตัน สายสีเขียว เป็นเส้นทางรถไฟฟ้ารางเบาในระบบการคมนาคมอ่าวแมสซาชูเซตส์ นครบอสตัน รัฐแมสซาชูเซตส์ สหรัฐอเมริกา เป็นเส้นทางที่เก่าแก่ที่สุด รู้จักกันในชื่อ \\"เดอะที\\" ทางวิ่งส่วนใหญ่เป็นทางใต้ดินและเสมอระดับ ผู้โดยสาร 221,900 คนต่อวัน ได้ใช้สีเขียวประจำเส้นทางในปี ค.ศ. 1967 และมีสายย่อยอีก 4 สาย ได้แก่ สายย่อย B, C, D และ E"},{"page_url":"https://da.wikipedia.org/wiki/Johann_Gottfried_Rosenberg","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/37/Bar._Dehnsche_Palais_..._Bar._Bernsdorfsche_Palais.png","page_title":"Johann Gottfried Rosenberg","context_page_description":"Johann Gottfried Rosenberg var en dansk-tysk arkitekt i rokokotiden.\\nFødselsdato kendes ikke, men han blev døbt den 20. oktober 1709 i Woldegk i Mecklenburg-Strelitz. Rosenberg var meget aktiv i Plön, Slesvig og Danmark i 1740'erne og 50'erne og satte et tydeligt præg for eftertiden – specielt i Bredgade i København.\\nHan samarbejdede ofte med hofbygmester Nicolai Eigtved, der blev kendt som dansk rokokos mester. De to arbejdede bl.a. sammen om Dehns Palæ, Bernstorffs Palæ og det Berckentinske Palæ. Af andre bygninger han har været med til at opføre/ombygge kan nævnes Margård og Frederiksdal.\\nJ.G. Rosenberg blev i 1760 udnævnt til landbygmester i hertugdømmet Slesvig-Holsten og stod bl.a. for genopbygningen af Gråsten Slot efter branden i 1757 ligesom man mener, at Augustenborg Slot er opført efter hans tegninger i perioden 1770-1776.\\nGift 28. november 1738 i Kiel med Catharina Dorothea Kühnel, døbt 24. december 1719 i Kiel, død 14. april 1796 i København, datter af Jürgen Kühnel og Catharina Margaretha NN.\\nHan søn Georg Erdman Rosenberg var også arkitekt, og slægten har siden fostret mange kendte danskere inden for kulturlivet."},{"page_url":"https://zh-min-nan.wikipedia.org/wiki/Dilworth_(Minnesota)","image_url":"http://upload.wikimedia.org/wikipedia/commons/9/9f/Star_Lite_Motel_in_Dilworth%2C_Minnesota%2C_USA._Winter_view.jpg","page_title":"Dilworth (Minnesota)","context_page_description":"Dilworth sī Bí-kok Minnesota chiu Clay kūn ê chi̍t ê chng-thâu."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Kulturdenkmale_in_Berlin-Friedrichshain","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/41/MainzerStra%C3%9FeOsten.jpg","page_title":"Liste der Kulturdenkmale in Berlin-Friedrichshain","context_page_description":"In der Liste der Kulturdenkmale von Friedrichshain sind die Kulturdenkmale des Berliner Ortsteils Friedrichshain im Bezirk Friedrichshain-Kreuzberg aufgeführt."},{"page_url":"https://zh.wikipedia.org/wiki/%E4%BC%8A%E5%88%A9%E8%AB%BE%E5%B7%9E%E5%90%8C%E6%80%A7%E5%A9%9A%E5%A7%BB","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f2/Same-sex_marriage_in_the_United_States.svg","page_title":"伊利諾州同性婚姻","context_page_description":"同性婚姻在伊利诺伊州自2014年6月1日开始合法化。2013年11月20日州长帕特·奎因签署了同性婚姻法案，在2014年6月1日后生效。\\n此前，2011年1月31日奎因签署法案使得民事结合在伊利诺伊州自2011年6月1日开始合法化。该法案还允许异性恋伴侣注册民事结合关系，并承认在其他司法管辖区签订的大致类似的法律关系，包括同性婚姻和民事结合。\\n2007年至2013年间同性婚姻法案在伊利诺伊州曾多次被提出。2013年1月法案提交到两院，2月参议院以34-21表决通过。2013年2月26日，伊利诺伊州众议院执行委员会以6-5表决批准该法案。代表Greg Harris预计表决将不会通过，因而并没有要求在立法机关5月31日休会前进行表决，而是延长了最后期限直到8月31日立法会特别会议审批。这一期限进一步延长至2013年10月和11月的伊利诺伊州众议院和参议院的否决权会议上。\\n2013年11月5日众议院以61-54投票通过了一项同性婚姻合法化法案，达到所需的60票门槛。州参议院随即以32-21批准了修订后的法案，州长帕特·奎因11月20日签署了该法案使之成为法律。该法案于2014年6月1日生效，从而使同性伴侣在2014年6月2日可以获得结婚证书。"},{"page_url":"https://bg.wikipedia.org/wiki/%D0%92%D0%B0%D1%80%D0%BD%D0%B5%D0%BD%D1%81%D0%BA%D0%B8_%D0%B7%D0%B0%D0%BB%D0%B8%D0%B2","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/19/BASA-711K-1-12-1-Varna.jpg","page_title":"Варненски залив","context_page_description":"Варненският залив е разположен в северната част на Българското Черноморие. Той е заключен между носовете Св. Константин и Иланджик. Най-голямата му широчина между тях е 3,5 морски мили. След Бургаския залив той е най-големият в Българското черноморско крайбрежие. Плажната ивица е покрита с пясък, а централната част с тинести утайки. Заливът има равно дъно, което е наклонено на изток. Максималната му дълбочина е 18,5 м. В западната си част той се свързва изкуствено с Варненското езеро, което оказва голямо влияние върху биологичното разнообразие и на двата басейна. По протежение на залива е разположен третият по-големина град в България – Варна."},{"page_url":"https://hu.wikipedia.org/wiki/Narva-J%C3%B5esuu","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/08/EU-EE-IV-Narva-J%C3%B5esuu-Narva-J%C3%B5esuu_beach.JPG","page_title":"Narva-Jõesuu","context_page_description":"Narva-Jõesuu város Észtországban, a Finn-öböl partján."},{"page_url":"https://ja.wikipedia.org/wiki/%E3%82%B0%E3%83%90%E7%9C%8C","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f4/Gechresh_Azerbaijan_02.jpg","page_title":"グバ県","context_page_description":"グバ県はアゼルバイジャン北東部のグバ＝ハチマズ経済地区の県。\\n県都のグバはクヂャル川に面する。\\n林檎と絨毯が特産品。\\n2014年の人口は約16.1万人。\\n北から時計回りに\\nグサル県\\nハチマズ県\\nシャブラン県\\nシャマフ県\\nイスマイル県\\nガバラ県\\nに接する。"},{"page_url":"https://nl.wikipedia.org/wiki/T%C5%8D","image_url":"http://upload.wikimedia.org/wikipedia/commons/f/f4/Saiganji_taigan.JPG","page_title":"Tō","context_page_description":"Tō is een Japanse pagode. Pagoden worden tō, soms buttō, tōba, sotōba of tasōtō genoemd. Sotōba is het van stūpa afgeleide Japanse woord voor \\"pagode\\". Tō betekent zowel pagode als toren, wat samenhangt met de smalle en hoge vorm van veel typen pagodes.\\nOorspronkelijk is de stoepa of pagode afkomstig uit India. Een stoepa is een plaats voor het bewaren van de as van de Shaka, oorspronkelijk in een eenvoudige aarden heuvel. Tijdens de verspreiding van het boeddhisme in Centraal-Azië werd de terp kleiner, en bovenop voorzien van een pinakel. Daarbij werd de stoepa hoger in verhouding tot de basis. Nadat het boeddhisme China bereikte, werd de invloed van de Chinese wachttoren gecombineerd met de Centraal-Aziatische stoepa om een hoge, gelaagde structuur met verdiepingen te vormen. Vanuit China verspreidde het zich naar Korea en daar vandaan naar Japan. De Japanse pagodes zijn historisch afgeleid van de Chinese pagode, die zelf weer afgeleid zijn van de Indiase stoepa. Met de introductie van esoterische boeddhistische sekten werd de tahōtō, een 2 etages tellende pagode, populair terwijl de pagode als berging voor de as of relikwieën van de Boeddha geleidelijk aan belang verloor."},{"page_url":"https://en.wikipedia.org/wiki/Lotus_Cars","image_url":"http://upload.wikimedia.org/wikipedia/commons/3/39/Dodge_Circuit_EV--DC.jpg","page_title":"Lotus Cars","context_page_description":"Lotus Cars Limited is a British automotive company headquartered in Hethel, Norfolk that manufactures sports cars and racing cars noted for their light weight and fine handling characteristics.\\nLotus was previously involved in Formula One racing, via Team Lotus, winning the Formula One World Championship seven times.\\nLotus Cars was founded and owned for many years by Colin Chapman. After his death and a period of financial instability, it was bought by General Motors, then Romano Artioli and DRB-HICOM through its subsidiary Proton. It is currently owned by Chinese multinational Geely.\\nThe engineering consultancy firm Lotus Engineering, an offshoot of Lotus Cars, has facilities in the United Kingdom, United States, China, and Malaysia."},{"page_url":"https://no.wikipedia.org/wiki/D%C3%B8ende_gud","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/99/Orpheus_%26_Euridice.jpg","page_title":"Døende gud","context_page_description":"Døende gud, også referert til som «død og oppstandelse» eller «gjenoppstandelseguddom», er en gud som dør og er gjenoppstandet eller gjenfødt, enten i bokstavelig forstand eller i symbolsk mening. Eksempler på mannlige guddommer i oldtidens Midtøsten er Baal, Melqart, Eshmun, Dumuzi, antikke greske guddommer Adonis, Attis Asklepios, Zalmoxis, Orfeus, Dionysos, og egyptiske Ra, Osiris, indiske Krishna, kristne Jesus, og norrøne Odin.\\nEksempler på kvinnelige guddommer er sumeriske Inanna, også kjent som Ishtar, hvis religiøse kulter går tilbake til rundt 4000 f.Kr. og greske Persefone, en sentral guddom innenfor de eleusinske mysterier, hvis kult kan gå tilbake til rundt 1700 f.Kr. som en navnløs gudinne dyrket på minoiske Kreta."},{"page_url":"https://fr.wikipedia.org/wiki/Morla%C3%A0s","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/da/Idelis_Ligne_P6_Serres-Castet_Stade.jpg","page_title":"Morlaàs","context_page_description":"Morlaàs est une commune française située dans le département des Pyrénées-Atlantiques, en région Nouvelle-Aquitaine.\\nLe gentilé est Morlanais."},{"page_url":"https://it.wikipedia.org/wiki/Storia_di_Milano","image_url":"https://upload.wikimedia.org/wikipedia/it/7/7b/Portici_meridionali_piazza_Duomo_Milano_in_costruzione.jpg","page_title":"Storia di Milano","context_page_description":"La storia di Milano inizia durante l'epoca celtica, durante la quale una tribù di questa popolazione, facente parte del gruppo degli Insubri e appartenente alla cultura di Golasecca, fonda in Pianura Padana, intorno al 590 a.C, un piccolo villaggio a cui diede il nome di Medhelan.\\nIl primigenio insediamento celtico che diede origine a Milano fu in seguito, da un punto di vista topografico, sovrapposto e sostituito da quello romano. Medhelan, che fu conquistata dai Romani nel 222 a.C., venne successivamente ridenominata da questi ultimi, come è attestato da Tito Livio, Mediolanum. La città romana fu poi a sua volta gradualmente sovrapposta e rimpiazzata da quella medievale. Il centro urbano di Milano è quindi costantemente cresciuto a macchia d'olio, fino ai tempi moderni, attorno al primo nucleo celtico. Con il passare dei secoli Mediolanum accrebbe la sua importanza sino a divenire capitale dell'Impero romano d'Occidente. In questo periodo storico fu promulgato l'editto di Milano, che concesse a tutti i cittadini, quindi anche ai cristiani, la libertà di onorare le proprie divinità."},{"page_url":"https://en.wikipedia.org/wiki/Giacomo_Battiato","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d3/Urbinelli_Giacomo_Battiato.jpg","page_title":"Giacomo Battiato","context_page_description":"Giacomo Battiato is an Italian film director and writer. One guide to Italian cinema says he:\\n...is one of the most erudite and flexible directors of his generation. A cultural organizer, he has also written novels interesting for both their calibre and writing style. He got his start as an excellent television director, an experience that allowed him to develop his talents though his varied experiences before he made his debut as a film director.... Battiato is skilled at genre films and ably exploiting the technical aspects of filmmaking. Magic, visual wonderment and mythology are important elements in his films. His characters' psychological profiles were convincing even within the context of his epic and action films....\\nBorn in Verona and married to Anna Zaneva since 1999, he began his career in 1973 on Italian RAI TV and ten years later started in cinema with I paladini. His first book, Fuori dal cielo, won the Prize Domenico Rea. He directed two non-fiction films about Pope John Paul II: Karol: A Man Who Became Pope in 2005 and Karol: The Pope, The Man in 2006."},{"page_url":"https://pl.wikipedia.org/wiki/Lista_zabytk%C3%B3w_w_Birkirkarze","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/40/Nicca_ta%27_San_Guzepp.jpg","page_title":"Lista zabytków w Birkirkarze","context_page_description":"To jest lista zabytków w miejscowości Birkirkara na Malcie, które są umieszczone na liście National Inventory of the Cultural Property of the Maltese Islands."},{"page_url":"https://en.wikipedia.org/wiki/List_of_heads_of_federal_subjects_of_Russia","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/89/Kazbek_Kokov_%282018-09-26%29.jpg","page_title":"List of heads of federal subjects of Russia","context_page_description":"The following is a list of heads of the federal subjects of the Russian Federation."},{"page_url":"https://hu.wikipedia.org/wiki/V%C3%B6r%C3%B6sh%C3%A1t%C3%BA_halci%C3%B3n","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/22/Todiramphus_pyrrhopygia_%28female%29.jpg","page_title":"Vöröshátú halción","context_page_description":"A vöröshátú halción a madarak osztályának szalakótaalakúak rendjébe, ezen belül a jégmadárfélék családjába tartozó faj.\\nMagyar neve forrással nincs megerősítve."},{"page_url":"https://lv.wikipedia.org/wiki/Skanste_(R%C4%ABgas_apkaime)","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f0/Sporta_rezidence_office_LNK_Properties_Skanste.jpg","page_title":"Skanste (Rīgas apkaime)","context_page_description":"Skanste ir apkaime Rīgā, tā atrodas Rīgas centrā, Daugavas labā krasta dzelzceļa loka Z daļā. Tā robežojas ar Sarkandaugavas, Brasas, Centra un Pētersalas-Andrejsalas apkaimēm, ir viens no nesenāk apgūtajiem Rīgas rajoniem, kas atrodas kādreizējo pilsētas ganību vietā.\\nApkaimes centrālā satiksmes artērija ir Skanstes iela, bet apkaimes robežas iezīmē Pulkveža Brieža, Hanzas, Vesetas un Duntes ielas, kā arī Ganību dambis un dzelzceļš.\\nVietā, kur vēl salīdzinoši nesen dominēja mazdārziņi, tagad slejas biroju ēkas, nacionālas nozīmes sporta infrastruktūras objekti un dzīvojamie nami. Līdzās pilsētas vēsturiskajam un klusajam centram Skanstē veidojas jauna apbūve. Skanstes rajons šobrīd turpina attīstīties, un ir vairākas ieceres, kuras tiks īstenotas turpmāko gadu laikā.\\nSkanstes rajona platība ir 215 hektāri un, mērot pa perimetru, apkaimes robežas garums ir vairāk nekā seši kilometri. Patlaban Skanstē ir vairāk nekā 12 tūkstoši iedzīvotāju un darbinieku, bet, īstenojot apkaimes attīstības plānus, potenciālo iedzīvotāju un darbinieku skaits augs līdz pat vairāk nekā 42 tūkstošiem."},{"page_url":"https://zh-yue.wikipedia.org/wiki/%E5%A4%A7%E6%B2%99%E6%9D%B1%E7%AB%99","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/04/Dashadong_Station_Word.JPG","page_title":"大沙東站","context_page_description":"大沙東站（粵拼：daai⁶ saa¹ dung¹ zaam⁶，英文：Dashadong Station），規劃時期嗌過大沙地站（daai⁶ saa¹ dei⁶ zaam⁶；Dashadi Station）；係廣州地鐵5號綫嘅車站，2009年12月28號開始營運，位置喺黃埔區大沙地東嘅鎮東路口東邊隔籬。"},{"page_url":"https://simple.wikipedia.org/wiki/Twillingate,_Newfoundland_and_Labrador","image_url":"http://upload.wikimedia.org/wikipedia/commons/5/55/Twillingate.jpg","page_title":"Twillingate, Newfoundland and Labrador","context_page_description":"Twillingate is a town that can be found on the Twillingate Islands off the coast of Newfoundland. About 2500 people live in the town. It is known for its scenic landscape and friendly hospitality. Twillingate is about an hour and a half north of Gander and an hour north of Lewisporte.\\nTwillingate's economy is based around the fishery."},{"page_url":"https://ceb.wikipedia.org/wiki/Apium_nodiflorum","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b8/Helosciadium_nodiflorum_herbier.jpg","page_title":"Apium nodiflorum","context_page_description":"Espesye sa tanom nga kinsay ang Apium nodiflorum. Una ning gihulagway ni Heinrich Gustav Reichenbach. Ang Apium nodiflorum sakop sa kahenera nga Apium sa kabanay nga Apiaceae. Pagka karon wala pay siak nga nalista ubos niini niya."},{"page_url":"https://hy.wikipedia.org/wiki/%D4%BF%D5%A1%D6%80%D5%AC%D5%BD%D6%80%D5%B8%D6%82%D5%A5%D5%AB_%D5%AF%D5%A5%D5%B6%D5%A4%D5%A1%D5%B6%D5%A1%D5%A2%D5%A1%D5%B6%D5%A1%D5%AF%D5%A1%D5%B6_%D5%A1%D5%B5%D5%A3%D5%AB","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fd/Zoo_de_Karlsruhe_-_Entr%C3%A9e.jpg","page_title":"Կարլսրուեի կենդանաբանական այգի","context_page_description":"Կարլսրուեի կենդանաբանական այգի, Եվրոպայի ամենամեծ և ամենահին կենդանաբանական այգիներից մեկն է: Գտնվում է Բադեն-Վյուրթեմբերգ երկրամասի Իննենշտադտ քաղաքային շրջանում: Այս այգին հիմնադրվել է 1865 թվականին: Կենդանաբանական այգին ներառում է 150 տեսակի շուրջ 800 կենդանիներ:"},{"page_url":"https://pt.wikipedia.org/wiki/Pas%C5%82%C4%99k","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3c/SM_Pas%C5%82%C4%99k_Ratusz_%283%29_ID_645083.jpg","page_title":"Pasłęk","context_page_description":"Pasłęk é um município da Polônia, na voivodia da Vármia-Masúria e no condado de Elbląg. Estende-se por uma área de 10,63 km², com 12 298 habitantes, segundo os censos de 2017, com uma densidade de 1156,9 hab/km²."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Stationen_der_M%C3%A9tro_Paris","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3b/Nation_9_%28m%C3%A9tro_Paris%29_MF67_%C3%A0_quai_par_Cramos.JPG","page_title":"Liste der Stationen der Métro Paris","context_page_description":"Die Liste der Stationen der Métro Paris ist eine vollständige Übersicht über die bestehenden sowie diverse geschlossene oder in Bau befindliche Stationen der Pariser Métro. Die 1900 eröffnete Métro gehört zu den ältesten und größten Netzen weltweit. Sie erschließt die 20 Pariser Arrondissements sowie diverse Städte und Gemeinden in den umliegenden Départements der Île-de-France.\\nDas Netz der Métro umfasst insgesamt bestehende 303 Bahnhöfe beziehungsweise 383 Einzelhaltepunkte. Die unterschiedlichen Werte ergeben sich aus der Zählweise der Umsteigepunkte. Hinzu kommen zwölf geschlossene sowie 48 Einzelhaltepunkte, die sich aktuell im Bau befinden und in den kommenden Jahren eröffnet werden sollen.\\nAuf die zurzeit 16 Linien der Métro verteilen sich die Stationen folgendermaßen:"},{"page_url":"https://fy.wikipedia.org/wiki/List_fan_bylden_yn_Ljouwert","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f4/PieterJellesTroelstra_HildoKrop_Leeuwarden.JPG","page_title":"List fan bylden yn Ljouwert","context_page_description":"Dit is in gronologyske list fan bylden yn Ljouwert. Under in byld wurdt hjir ferstien elk trijediminsjonaal fisueel keunstwurk yn de iepenbiere romte fan de gemeente Ljouwert, wêrby't byld brûkt wurdt as sammelbegryp foar skulptueren, stânbylden, ynstallaasjes en oare byldhouwurken.\\nIt stânbyld fan Willem Loadewyk fan Nassau-Dillenburg, bynamme Us Heit, is it âldste fan Ljouwert. It byld waard oan de stêd oanbean troch it Frysk Genoatskip en de Feriening foar frjemdlingenferkear. In 1906 waard it troch keninginne Wilhelmina, neisiet fan Willem Loadewyk, ûnthulle. It bekendste byld is sûnder mis dat fan Us Mem, in mear as libbensgrutte ferbylding fan in Fryske stamboekko.\\nYn de stêd stean meardere bylden fan âld-Ljouwerters as Mata Hari, Pieter Jelles Troelstra, J. Slauerhoff en Piet Paaltjens. De gemeente stimde yn 2003 net yn mei pleatsing fan in byld fan skriuwer Havank. Der waard al in brûnzen tinkplaat oanbrocht op syn bertehûs oan de Wurdumerdyk."},{"page_url":"https://sv.wikipedia.org/wiki/Sellia,_Kalabrien","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/90/Sellia2.jpg","page_title":"Sellia, Kalabrien","context_page_description":"Sellia är en ort och kommun i provinsen Catanzaro i regionen Kalabrien i Italien. Kommunen hade 529 invånare."},{"page_url":"https://en.wikipedia.org/wiki/Flying_roller_coaster","image_url":"http://upload.wikimedia.org/wikipedia/commons/8/8b/Superman-_Ultimate_Flight.jpg","page_title":"Flying roller coaster","context_page_description":"A flying roller coaster is a type of roller coaster meant to simulate the sensations of flight by harnessing riders in a prone position during the duration of the ride. The roller coaster cars are suspended below the track, with riders secured such that their backs are parallel to the track."},{"page_url":"https://fr.wikipedia.org/wiki/Rue_Molitor","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/79/P1240191_Paris_XVI_rue_Molitor_N18_entree_villa_Boileau_rwk.jpg","page_title":"Rue Molitor","context_page_description":"La rue Molitor est une voie du 16ᵉ arrondissement de Paris, en France."},{"page_url":"https://pt.wikipedia.org/wiki/Rossano","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0b/Rossano_Patire1.jpg","page_title":"Rossano","context_page_description":"Rossano é uma comuna italiana da região da Calábria, província de Cosenza, com cerca de 34.906 habitantes. Estende-se por uma área de 149 km², tendo uma densidade populacional de 234 hab/km². Faz fronteira com Calopezzati, Corigliano Calabro, Cropalati, Crosia, Longobucco e Paludi."},{"page_url":"https://en.wikipedia.org/wiki/Cebu_City","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e0/Cebu.jpg","page_title":"Cebu City","context_page_description":"Cebu City, officially the City of Cebu, is a 1st class highly urbanized city of the island of Cebu in the Central Visayas Region, Philippines.\\nAccording to the 2015 census, it has a population of 922,611 people, making it the fifth-most populated city in the nation and the most populous in Visayas.\\nIt is the regional center of Central Visayas and is the seat of government for the province of Cebu, but is governed separately from it. The city is a significant center of commerce, trade and education in Visayas. It is the Philippines' main domestic shipping port and is home to about 80% of the country's domestic shipping companies.\\nLocated in the middle of the eastern side of Cebu Island, it is the center of Metro Cebu, the second largest metropolitan area in the Philippines by population, economy and land area, which includes the cities of Carcar, Danao, Lapu-Lapu, Mandaue, Naga and Talisay and the municipalities of Compostela, Consolacion, Cordova, Liloan, Minglanilla and San Fernando. Metro Cebu had a total population of 2,849,213 as of 2015, making it the second-most populous metropolitan area of the nation, after Metro Manila in Luzon."},{"page_url":"https://en.wikipedia.org/wiki/Angie_Dickinson","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8f/Howard_Hawks%27Rio_Bravo_trailer_%2827%29.jpg","page_title":"Angie Dickinson","context_page_description":"Angeline Dickinson is an American actress. She began her career on television, appearing in many anthology series during the 1950s, before landing her breakthrough role in Gun the Man Down with James Arness and the Western film Rio Bravo, for which she received the Golden Globe Award for New Star of the Year.\\nIn her six decade career, Dickinson has appeared in more than 50 films, including China Gate, Ocean's 11, The Sins of Rachel Cade, Jessica, Captain Newman, M.D., The Killers, The Art of Love, The Chase, Point Blank, Pretty Maids All in a Row, The Outside Man and Big Bad Mama.\\nFrom 1974 to 1978, Dickinson starred as Sergeant Leann \\"Pepper\\" Anderson in the NBC crime series Police Woman, for which she received the Golden Globe Award for Best Actress – Television Series Drama and three Primetime Emmy Award for Outstanding Lead Actress in a Drama Series nominations. As lead actress, she starred in Brian De Palma's erotic crime thriller Dressed to Kill, for which she received a Saturn Award for Best Actress."},{"page_url":"https://de.wikipedia.org/wiki/Verwaltungsakademie_Bordesholm","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7e/Verwaltungsakademie_Bordesholm_in_der_Seitenansicht.jpg","page_title":"Verwaltungsakademie Bordesholm","context_page_description":"Die Verwaltungsakademie Bordesholm ist eine rechtsfähige Anstalt des öffentlichen Rechts mit Sitz in Bordesholm."},{"page_url":"https://eo.wikipedia.org/wiki/Ornamplanto","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ef/Nordstern_rosen.jpg","page_title":"Ornamplanto","context_page_description":"Ornamplantoj estas kulturplantoj, kiujn la homo kultivas por ornami sian ĉirkaŭon. La homoj jam ornamas sian vivmedion ekde la ŝtonepoko per diversaj floroj kaj plantoj. La ornamplantojn kultivas ĝardenistoj aŭ hortikulturistoj de la fakbranĉo ornamkulturo"},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Kirchen_in_Malta","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f6/Sudika_Qala_church.jpg","page_title":"Liste der Kirchen in Malta","context_page_description":"Die Liste der Kirchen in Malta enthält die Sakralbauten der Republik Malta aus allen Ortschaften einschließlich der Hauptstadt Valletta. Die Übersicht ist alphabetisch nach den Städten und/oder Gemeinden entsprechend den maltesischen Ortsnamen vorsortiert. Die Kirchen sind mit ihren englischen Namen angegeben, in der gleichen Spalte befinden sich, falls bekannt, die maltesischen Namen. Weitere Details samt einem Foto des Bauwerks komplettieren die Tabelle."},{"page_url":"https://hu.wikipedia.org/wiki/Csergez%C3%A1n_P%C3%A1l-kil%C3%A1t%C3%B3","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ec/View_of_Nagy-H%C3%A1rs_Hill_from_the_P%C3%A1l_Csergez%C3%A1n_view_tower%2C_Nagy-Kopasz.jpg","page_title":"Csergezán Pál-kilátó","context_page_description":"A Csergezán Pál-kilátó egy kilátó Pest megyében, a Budai-hegység legmagasabb pontjának számító Nagy-Kopasz csúcsán, Páty, Nagykovácsi és Telki hármas határán. Neve Csergezán Pál természetfestő emlékét őrzi."},{"page_url":"https://es.wikipedia.org/wiki/Estado_La_Guaira","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b4/Fuerte_San_Carlos_La_Guaira.jpg","page_title":"Estado La Guaira","context_page_description":"El estado La Guaira —anteriormente estado Vargas—, ​​​​ es uno de los veintitrés estados que, junto con el Distrito Capital y las Dependencias Federales, forman Venezuela. Su capital es La Guaira. Está ubicado en el centro-norte del país, en la región Capital. Limita al norte con el mar Caribe, al sur con Miranda y Distrito Capital, al suroeste con Aragua. Con 1497 km² es el segundo estado menos extenso —por delante de Nueva Esparta—, con 352 087 habitantes en 2011, el cuarto menos poblado —por delante de Cojedes, Delta Amacuro y Amazonas, el menos poblado— y con 236 hab/km², el cuarto más densamente poblado, por detrás de Carabobo, Nueva Esparta y Miranda.​\\nEn 1999 el centro geográfico del estado de La Guaira sufrió graves inundaciones y deslaves, hecho conocido como la Tragedia de Vargas, causando movimientos de población y el despoblamiento del estado. Más de 30 naciones ayudaron y donaron víveres y recursos entre otras cosas en esta catástrofe.​\\nCuenta con el municipio Vargas, un único municipio autónomo y 11 parroquias civiles. Sus principales ciudades son: La Guaira, Caraballeda, Catia La Mar, Macuto y Maiquetía."},{"page_url":"https://sh.wikipedia.org/wiki/Ku%C4%87ibreg","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/44/Hi%C5%A1a_z_%22bala%28n%29durjem%2C_Ku%C4%87ibreg_1950.jpg","page_title":"Kućibreg","context_page_description":"*\\nKućibreg - Cucciani, naselje u sjeverozapadnoj Istri na 404 m n/v, istočno od Buja u čijem je sastavu Grada, Istarska županija."},{"page_url":"https://fr.wikipedia.org/wiki/Atomic_Cyborg","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f0/Arcosanti_western_half.jpg","page_title":"Atomic Cyborg","context_page_description":"Atomic Cyborg est un film italien réalisé en 1985 par Sergio Martino sous le pseudonyme de Martin Dolman et sorti en salles en 1986."},{"page_url":"https://zh.wikipedia.org/zh-cn/%E9%87%91%E5%B1%AC%E7%BE%B0%E5%9F%BA%E9%85%8D%E5%90%88%E7%89%A9","image_url":"http://upload.wikimedia.org/wikipedia/commons/2/2c/Carbon-monoxide-LUMO-phase-3D-balls.png","page_title":"金屬羰基配合物","context_page_description":"金属羰基配合物是过渡金属和一氧化碳配基形成的配合物。配合物可以是均配物，也就是所有的配基都相同，如四羰基镍，不过大部分的金属羰基配合物中，会出现其他的配基，如Re(CO)₃Cl。在许多有机化合物的合成反应中，一氧化碳是重要的原料之一，而金属羰基配合物常常作为这些反应中的催化剂。\\n金属羰基配合物为有毒的化合物，因为这类配合物会和血红蛋白反应形成碳氧血红蛋白，使血红蛋白无法输送氧气。"},{"page_url":"https://en.wikipedia.org/wiki/Hugo_Haas","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/15/Hugo_Haas_in_Pickup_trailer.jpg","page_title":"Hugo Haas","context_page_description":"Hugo Haas was a Czech film actor, director and writer. He appeared in more than 60 films between 1926 and 1962, as well as directing 20 films between 1933 and 1962."},{"page_url":"https://oc.wikipedia.org/wiki/Gu%C3%A8rra_de_l%27Independ%C3%A9ncia_Argentina","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/39/Paraguay_campa%C3%B1a_05.jpg","page_title":"Guèrra de l'Independéncia Argentina","context_page_description":"S'apèra Guèrra de l'Independéncia Argentina o de detlas Províncias Jonhudas del Riu de l'Argent al conjonch de combats e campanhas militèsses arribats en lo marc de detlas guèrras d'independéncia hispanoamericanas dins de divèrses païses d'America del sud, que participèron en el de fòrças militèsses de detlas Províncias Jonhudas del Riu de l'Argent, l'estat que succediguèt a lo Virreinato del Riu de l'Argent e que antecedió a la Republica Argentina.\\nLos partits afrontats sòlen èsser identificats pels istorians e de cronicaires latinoamericanos coma patriotas e realistas, doncas que se tractèt d'un afrontament entre qui defendián l'independéncia de la siá patria e la creacion dels nòus estats americanes, e aqueles que defendián la contunhitat d'aquestas províncias dins la monarquia espanhòla del rei Fernando VII\\nSonque una part mendre d'aquestes afrontaments aguèt luòc en lo territòri de l'actuala Argentina. La majoritat arribèt en los territòris de l'ancian Virreinato del Riu de l'Argent qu'al finalizar la guèrra demorèron fòra de las Províncias Jonhudas, o en d'autras regions d'America del Sud qu'apertenguèron jamai a aqueste virreinato, tales coma Chile, Peró e Eqüator."},{"page_url":"https://hu.wikipedia.org/wiki/III._Zsigmond_tornya_(Wawel)","image_url":"http://upload.wikimedia.org/wikipedia/commons/f/f7/Krakow_Wawel_20070804_0930.jpg","page_title":"III. Zsigmond tornya (Wawel)","context_page_description":"A Zsigmond-torony a waweli királyi palota négy lakótornyának egyike, a palota északkeleti oldalán. III. Zsigmond lengyel király parancsára Giovanni Trevano építész építette barokk stílusban, miután 1595-ben tűzvész miatt megsemmisült a palota egy része. A Civitates orbis terrarum hatkötetes atlasz egyik képe szerint 1617-ben a tornyon magas sisak volt. 1912-1914 és 1917-1920 között felújítási munkákat végeztek rajta.\\nA toronyban őrzik Sobienski János koronázási jelvényeit. A torony része a királyi palota múzeumának."},{"page_url":"https://de.wikipedia.org/wiki/Adolf_Wolfert","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/15/2009-Dirmstein-Sibley.jpg","page_title":"Adolf Wolfert","context_page_description":"Adolf Wolfert war im Deutschen Reich während der Zeit des Nationalsozialismus ein Funktionär der NSDAP. Er wurde dadurch bekannt, dass er im Februar 1945, kurz vor dem Ende des Zweiten Weltkriegs, gemeinsam mit einem zweiten Täter Cyril William Sibley ermordete, einen über Dirmstein abgeschossenen Angehörigen der Royal Air Force. 1946 wurden Wolfert und sein Mittäter wegen Mordes verurteilt und durch den Strang hingerichtet.\\nWährend des Zweiten Weltkriegs gab es – teilweise gefördert durch entsprechende Befehle – hunderte solcher Fliegermorde; über 150 Deutsche wurden dafür nach dem Krieg verurteilt und hingerichtet.\\nSeit dem 27. März 2009 liegt in der Ortsmitte von Dirmstein neben dem Alten Rathaus für das Mordopfer ein Stolperstein. Die gleichzeitig veröffentlichte Dokumentation nennt die Namen der Dirmsteiner Opfer des Nationalsozialismus und – soweit bekannt – die Namen der Täter."},{"page_url":"https://kn.wikipedia.org/wiki/%E0%B2%95%E0%B3%8D%E0%B2%B0%E0%B2%BF%E0%B2%AF%E0%B2%BE%E0%B2%B6%E0%B3%80%E0%B2%B2_%E0%B2%B5%E0%B2%BF%E0%B2%AD%E0%B2%B5(%E0%B2%B6%E0%B2%95%E0%B3%8D%E0%B2%A4%E0%B2%BF%E0%B2%AE%E0%B3%82%E0%B2%B2)","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3e/Neurons_big1.jpg","page_title":"ಕ್ರಿಯಾಶೀಲ ವಿಭವ(ಶಕ್ತಿಮೂಲ)","context_page_description":"ಶರೀರ ವಿಜ್ಞಾನದಲ್ಲಿ ಕ್ರಿಯಾಶೀಲ ವಿಭವ ವು ಒಂದು ಅಲ್ಪಕಾಲವಿರುವ ಕ್ರಿಯೆಯಾಗಿದೆ, ಇದರಲ್ಲಿ ಜೀವಕೋಶದ ವಿದ್ಯುತ್ತಿನಂಥ ಪೊರೆಯ ವಿಭವವು ರೂಢಮಾದರಿಯ ವಿಕ್ಷೇಪ ಪಥವನ್ನು ಅನುಸರಿಸಿ ಶೀಘ್ರವಾಗಿ ಏರುತ್ತದೆ ಮತ್ತು ಇಳಿಯುತ್ತದೆ. ಕ್ರಿಯಾಶೀಲ ವಿಭವವು ಅನೇಕ ರೀತಿಯ ಪ್ರಾಣಿ ಜೀವಕೋಶಗಳಲ್ಲಿ ಕಂಡುಬರುತ್ತದೆ, ಅವನ್ನು ಉದ್ದೀಪನಗೊಳ್ಳುವ ಜೀವಕೋಶಗಳೆಂದು ಕರೆಯುತ್ತಾರೆ, ಅವುಗಳೆಂದರೆ ನರಕೋಶಗಳು, ಸ್ನಾಯು ಜೀವಕೋಶಗಳು ಮತ್ತು ನಿರ್ನಾಳಗ್ರಂಥಿ ಜೀವಕೋಶಗಳು. ನರಕೋಶಗಳಲ್ಲಿ, ಅದು ಜೀವಕೋಶ-ದಿಂದ-ಜೀವಕೋಶದ ಸಂವಹನದಲ್ಲಿ ಪ್ರಮುಖ ಪಾತ್ರವಹಿಸುತ್ತದೆ. ಇತರ ಪ್ರಕಾರದ ಜೀವಕೋಶಗಳಲ್ಲಿ, ಅದರ ಮುಖ್ಯ ಕ್ರಿಯೆಯೆಂದರೆ ಜೀವಕೋಶಗಳ ಒಳಗಿನ ಕ್ರಿಯೆಗಳನ್ನು ಸಕ್ರಿಯಗೊಳಿಸುವುದಾಗಿದೆ. ಸ್ನಾಯು ಜೀವಕೋಶಗಳಲ್ಲಿ, ಉದಾಹರಣೆಗಾಗಿ, ಕ್ರಿಯಾಶೀಲ ವಿಭವವು ಅನೇಕ ಕ್ರಿಯೆಗಳ ಸರಪಣಿಯಲ್ಲಿ ಮೊದಲಹಂತವಾಗಿದ್ದು, ಈ ಸಂದರ್ಭದಲ್ಲಿ ಕುಗ್ಗುವಿಕೆಯನ್ನುಂಟುಮಾಡುತ್ತದೆ. ಮೇದೋಜೀರಕದ ಬೀಟಾ ಜೀವಕೋಶಗಳಲ್ಲಿ, ಅದು ಇನ್ಸುಲಿನ್‌ನ ಬಿಡುಗಡೆಯನ್ನು ಪ್ರೇರೇಪಿಸುತ್ತದೆ. ನರಕೋಶಗಳಲ್ಲಿನ ಕ್ರಿಯಾಶೀಲ ವಿಭವವನ್ನು \\"ನರದ ಉದ್ರೇಕ\\" ಅಥವಾ \\"ಏರಿಳಿತ\\" ಎಂದು ಕರೆಯುತ್ತಾರೆ. ಒಂದು ನರಕೋಶದಿಂದ ಉಂಟಾಗುವ ಕ್ರಿಯಾಶೀಲ ವಿಭವಗಳ ಅಲ್ಪಕಾಲಿಕ ಸರಣಿಯನ್ನು \\"ಏರಿಳಿತಗಳ ಶ್ರೇಣಿ\\"ಯೆಂದು ಕರೆಯಲಾಗುತ್ತದೆ. ಕ್ರಿಯಾಶೀಲ ವಿಭವವನ್ನು ಉಂಟುಮಾಡುವ ನರಕೋಶವನ್ನು ಹೆಚ್ಚಾಗಿ \\"ಫೈರ್\\" ಎನ್ನುತ್ತಾರೆ.\\nಕ್ರಿಯಾಶೀಲ ವಿಭವವು ಜೀವಕೋಶದ ಪ್ಲಾಸ್ಮಾ ಪೊರೆಯಲ್ಲಿರುವ ವಿಶೇಷ ರೀತಿಯ ವೋಲ್ಟೇಜ್-ಗೇಟೆಡ್ ಅಯಾನು ವಾಹಕಗಳಿಂದ ಹುಟ್ಟಿಕೊಳ್ಳುತ್ತದೆ. ಈ ವಾಹಕಗಳು ಪೊರೆಯ ವಿಭವವು ಜೀವಕೋಶದ ತಟಸ್ಥ ವಿಭವಕ್ಕೆ ಹತ್ತಿರವಾಗಿರುವಾಗ ಮುಚ್ಚಿಕೊಳ್ಳುತ್ತವೆ."},{"page_url":"https://de.wikipedia.org/wiki/Steinberg-D%C3%B6rfl","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ec/Aufnahmeblatt_5057-1_Unterrabnitz_G%C3%BCns_Lockenhaus.jpg","page_title":"Steinberg-Dörfl","context_page_description":"Steinberg-Dörfl ist eine Marktgemeinde im Burgenland im Bezirk Oberpullendorf in Österreich mit 1285 Einwohnern."},{"page_url":"https://zh.wikipedia.org/zh-my/%E8%90%8A%E8%BE%9B%E9%A0%93%E5%A4%A7%E9%81%93%EF%BC%8F59%E8%A1%97%E8%BB%8A%E7%AB%99","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a7/NYC_Lexington_Ave_and_59th_station.jpg","page_title":"萊辛頓大道／59街車站","context_page_description":"莱辛顿大道/59街车站是纽约地铁一个车站复合，由IRT莱辛顿大道线和BMT百老汇线共用，位于曼哈顿中城和上东城的边界介乎59街和60街的莱辛顿大道交界。这个车站复合是纽约地铁第八繁忙的车站，2013年共有21,282,767人次进出。\\n这站亦设有免费使用MetroCard的出闸转乘63街线，只需离开车站步行至莱辛顿大道-63街车站。设有以下列车服务：\\n4号线、6号线、N线列车\\nW线列车\\n5号线、R线列车\\n6号线列车"},{"page_url":"https://ja.wikipedia.org/wiki/%E3%82%B3%E3%83%B3%E3%82%B3%E3%83%AB%E3%83%89","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/ac/BAC_Concorde_102_G-BOAB_British_Airways_%2810446819256%29.jpg","page_title":"コンコルド","context_page_description":"コンコルドは、イギリスのBACやフランスのシュド・アビアシオンなどが共同で開発した超音速旅客機。コンコルドという名前は「調和」「協調」等を意味する。1969年3月1日に試験飛行として初飛行後、1970年11月にマッハ2を超す速度を記録し、1975年に就航、1976年1月21日に運用開始となった。"},{"page_url":"https://es.wikipedia.org/wiki/Spiculaea","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/01/A_Sketch_of_the_Vegetation_of_the_Swan_River_Colony_-_Figure_4.png","page_title":"Spiculaea","context_page_description":"Spiculaea es un género monotípico de orquídeas perteneciente a la subfamilia Orchidoideae. Su única especie: Spiculaea ciliata Lindl., Sketch Veg. Swan R.: 56, es originaria del sudoeste de Australia.​"},{"page_url":"https://he.wikipedia.org/wiki/%D7%91%D7%99%D7%AA_%D7%9C%D7%95%D7%99%D7%A0%D7%A1%D7%95%D7%9F","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/63/%D7%91%D7%99%D7%AA_%D7%9C%D7%95%D7%99%D7%A0%D7%A1%D7%95%D7%9F%2C_%D7%9E%D7%91%D7%98_%D7%9B%D7%9C%D7%9C%D7%99.JPG","page_title":"בית לוינסון","context_page_description":"בית לוינסון הוא בית לשימור בגדרה."},{"page_url":"https://fr.wikipedia.org/wiki/Magnus_Stifter","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/07/Magnus_Stifter_by_Ludwig_Grillich.jpg","page_title":"Magnus Stifter","context_page_description":"Magnus Stifter est un acteur et réalisateur autrichien."},{"page_url":"https://ro.wikipedia.org/wiki/Karben","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b0/Rosenhang_Karben.JPG","page_title":"Karben","context_page_description":"Karben este un oraș în districtul Wetteraukreis, landul Hessa, Germania. Karben se află 15 km nord de Frankfurt pe Main și 12 km sud de Friedberg. Prin orașul curge râul Nidda."},{"page_url":"https://ceb.wikipedia.org/wiki/Nassarius_mendicus","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5c/Nassarius_mendicus_001.jpg","page_title":"Nassarius mendicus","context_page_description":"Espesye sa hilahila nga una nga gihulagway ni Gould ni adtong 1850 ang Nassarius mendicus. Ang Nassarius mendicus sakop sa kahenera nga Nassarius sa kabanay nga Nassariidae. Usa ka matang nga nahiubos niini atong makita N. m. mendicus."},{"page_url":"https://en.wikipedia.org/wiki/List_of_University_of_Glasgow_people","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6a/Katherine_Grainger_Parade.jpg","page_title":"List of University of Glasgow people","context_page_description":"The following list of University of Glasgow people provides a selection of the well-known people who have studied or taught at the University of Glasgow since its inception in 1451. Historical lists of Chancellors, Rectors and Principals of the University are contained in those offices' respective articles."},{"page_url":"https://ja.wikipedia.org/wiki/%E8%87%AA%E7%94%B1%E6%B0%91%E4%B8%BB%E5%85%9A%E7%B7%8F%E8%A3%81","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/48/Zenko_Suzuki_cropped_2_Zenko_Suzuki_19800717.jpg","page_title":"自由民主党総裁","context_page_description":"自由民主党総裁は、日本の政党である自由民主党の党首。\\n自由民主党の国会議員および党員、党友などによる自由民主党総裁選挙によって選出される。「総裁」の役職名は、前身の立憲政友会、立憲民政党から引き継いだもの。"},{"page_url":"https://nl.wikipedia.org/wiki/Lijst_van_personen_overleden_in_1917","image_url":"http://upload.wikimedia.org/wikipedia/commons/3/3e/Groot_Begijnhof_Sint-Amandsberg_-_Sint-Amandstraat_1.jpg","page_title":"Lijst van personen overleden in 1917","context_page_description":"Dit is een lijst van personen die overleden zijn in 1917.\\nDe inhoud van deze pagina is gebaseerd op gegevens in Wikidata. Als er onvolkomenheden in deze lijst zitten, gelieve dan aldaar de gegevens aan te passen. Achter iedere persoon is hiervoor een link aanwezig met de aanduiding bewerken.\\nWijzigingen in Wikidata worden met enige regelmatigheid geautomatiseerd overgenomen naar deze pagina."},{"page_url":"https://es.wikipedia.org/wiki/Nokdim","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4f/Nokdim.jpg","page_title":"Nokdim","context_page_description":"Nokdim es un poblado israelí organizado como un asentamiento comunitario en Judea y Samaria. Está situado al sur de Belén, en el norte de los montes de Judea, y pertenece a la jurisdicción del Concejo Regional Gush Etzion. En 2016 Nokdim tenía una población de 2.052 habitantes. La comunidad internacional considera que los asentamientos israelíes en Cisjordania son ilegales en virtud del derecho internacional, pero el gobierno israelí no está de acuerdo con esta opinión. Nokdim es una comunidad mixta de judíos religiosos y seculares, tanto israelíes nativos como inmigrantes. Nokdim es el hogar de la Academia religiosa pre-militar Maguen Shaul, que fue establecida en 1996. Nokdim fue fundada el 5 de Julio de 1982 por los residentes del asentamiento israelí de Tekoa."},{"page_url":"https://en.wikipedia.org/wiki/Gary_Glitter","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e1/Gary_Glitter_arrives_home_after_spending_the_day_being_questioned_by_detectives_%2812888246573%29.jpg","page_title":"Gary Glitter","context_page_description":"Paul Francis Gadd, known professionally as Gary Glitter, is an English former glam rock singer who achieved success in the 1970s and 1980s, known for his extreme glam image of glitter suits, make-up and platform boots, and his energetic live performances. He sold over 20 million records, had 26 hit singles which spent a total of 180 weeks in the UK Singles Chart; twelve reaching the Top 10, with three charting at number-one. He is listed in the Top 100 UK most successful chart acts. He was imprisoned for downloading child pornography in 1999, and child sexual abuse and attempted rape in 2006 and 2015. Formerly one of the best-loved entertainers in British music history, in 2015 Glitter was described by Alexis Petridis of The Guardian as a \\"public hate figure\\". His performances on the BBC's Top of the Pops are not repeated.\\nAfter performing under the name Paul Raven in the 1960s, he changed his stage name to Gary Glitter in the glam rock era of the early 1970s, with a sustained solo UK chart run of hits including \\"Rock and Roll, Parts 1 and 2\\", \\"Do You Wanna Touch Me\\", \\"I Love You Love Me Love\\", \\"I'm the Leader of the Gang\\", and \\"Hello, Hello, I'm Back Again\\"."},{"page_url":"https://en.wikipedia.org/wiki/Rosa_pimpinellifolia","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/bd/Rosa_pimpinellifolia_young_stem.jpg","page_title":"Rosa pimpinellifolia","context_page_description":"Rosa pimpinellifolia, the burnet rose, is a species of rose native to western, central and southern Europe and northwest Africa. It is generally restricted to sand dunes or limestone pavements and typically has a coastal distribution when not on limestone. In emblematic terms it is particularly associated with Scotland, where it is traditionally referenced in poetry and song, and is a symbolic native plant second only to the thistle.\\nIt is a rather low erect deciduous plant usually from 20–140 cm high but sometimes up to 2 metres. It spreads by basal shoots and can cover large areas. The stems have very numerous stiff bristles and many straight prickles. The young stems and prickles and the mature leaves tend to be very red with young growth a bright scarlet and older growth a deep maroon.\\nThe flowers are cream-white although rarely also pale pink. They are 2–4 cm diameter with five petals, which produce a distinctive globular dark purple to black hips.\\nSimilar plants native further east in Asia, sometimes treated as Rosa pimpinellifolia var. subalpina, are now regarded as a separate species Rosa oxyacantha; it differs in having pink flowers and red hips."},{"page_url":"https://fa.wikipedia.org/wiki/%D9%87%DB%8C%D8%B1%D9%88%D8%B4%DB%8C%DA%AF%D9%87","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/42/Hiroshige_nuit_de_neige_%C3%A0_Kambara.JPG","page_title":"هیروشیگه","context_page_description":"اوتاگاوا هیروشیگه Utagawa Hiroshige هنرمند ژاپنی نقاشی‌های چاپی اوکی‌یوئه و یکی از آخرین هنرمندان بزرگ این سبک بود. او را با نام هنری اندو هیروشیگه نیز می‌شناسند.\\nسبک کار او به ویژه برای انتخاب نظرگاه‌های مناسب، اشاره‌های فصلی و رنگ‌های چشم‌گیر شناخته شده‌است."},{"page_url":"https://de.wikipedia.org/wiki/Passfeder","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ee/Nut-Feder-Passfeder.jpg","page_title":"Passfeder","context_page_description":"Eine Passfeder ist ein Maschinenelement aus dem Maschinenbau und wird zur Realisierung einer Welle-Nabe-Verbindung benutzt. Die Verbindung ist formschlüssig und dient zur Übertragung von Drehmomenten."},{"page_url":"https://zh.wikipedia.org/zh-tw/%E7%93%A6%E4%BC%8A%E5%87%B1%E5%B8%83%E6%B4%9B%E7%B4%9A%E5%B7%A1%E9%82%8F%E8%89%A6","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8c/Arbv_GC23.jpg","page_title":"瓦伊凱布洛級巡邏艦","context_page_description":"瓦伊凱布洛級護衛艦為委內瑞拉向西班牙購入的艦艇，是以西班牙海軍現役Serviola級巡邏艦改良，並融入匿蹤科技。"},{"page_url":"https://de.wikipedia.org/wiki/Seilwinde","image_url":"http://upload.wikimedia.org/wikipedia/commons/4/44/Fotothek_df_tg_0003662_Mechanik_%5E_Wasserf%C3%B6rderung_%5E_Sch%C3%B6pfwerk_%5E_Winde_%5E_Seil.jpg","page_title":"Seilwinde","context_page_description":"Eine Seilwinde ist eine Vorrichtung, mit der man mit Hilfe eines Seils etwas ziehen kann. Dabei wird das Seil durch Muskelkraft, später durch einen Motor gezogen, indem es z. B. auf einer sich drehenden zylindrischen Trommel aufgewickelt wird.\\nDie Windenseile können aus Naturfasern gefertigt sein; bei schweren Lasten wird meist Stahlseil und seit jüngerer Zeit auch Plaste- bzw. Kunstfaser-Seil, beispielsweise aus langkettigem, texturiertem Polyethylen, verwendet. Die Zugkraft lässt sich durch Einsatz eines Flaschenzuges steigern."},{"page_url":"https://fa.wikipedia.org/wiki/%D9%81%D9%87%D8%B1%D8%B3%D8%AA_%D8%B4%D9%87%D8%B1%D9%87%D8%A7%DB%8C_%D8%A7%D9%88%D8%B1%DA%AF%D9%86","image_url":"http://upload.wikimedia.org/wikipedia/commons/8/8f/Gateway_Mall_Springfield_Oregon.JPG","page_title":"فهرست شهرهای اورگن","context_page_description":"این فهرست شهرها و شهرک‌های ایالت اورگن در ایالات متحده آمریکا است."},{"page_url":"https://es.wikipedia.org/wiki/%C3%93rdenes,_condecoraciones_y_medallas_de_la_Uni%C3%B3n_Sovi%C3%A9tica","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d2/Orden_Drugby_narodov.jpg","page_title":"Órdenes, condecoraciones y medallas de la Unión Soviética","context_page_description":"Las órdenes, condecoraciones y medallas de la Unión Soviética son recompensas de la antigua Unión Soviética que reconocían los esfuerzos y logros, tanto militares como civiles. Algunas de las órdenes, condecoraciones y medallas dejaron de ser concedidas a partir del colapso de la Unión Soviética, mientras otras continúan siendo entregadas por la Federación Rusa. Muchas de ellas fueron heredadas y rediseñadas por la Federación Rusa, tal como sucedió con la transición de Héroe de la Unión Soviética a Héroe de la Federación Rusa. Una amplia variedad de premios y condecoraciones cubren el extenso y diverso periodo de la historia que va desde 1917 a 1991."},{"page_url":"https://de.wikipedia.org/wiki/Till_Backhaus","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0b/18-05-2017-Till_Backhaus-JonasR.jpg","page_title":"Till Backhaus","context_page_description":"Till Backhaus ist ein deutscher Politiker. Backhaus ist seit November 1998 Landwirtschaftsminister des Landes Mecklenburg-Vorpommern. Mit derzeit 21 Jahren Regierungszugehörigkeit ist er aktuell dienstältester Landesminister in Deutschland."},{"page_url":"https://en.wikipedia.org/wiki/Pasiphila_muscosata","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/50/Pasiphila_muscosata_female.jpg","page_title":"Pasiphila muscosata","context_page_description":"Pasiphila muscosata, the emerald pug moth, is a moth in the family Geometridae. It is endemic to New Zealand."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%A1%D0%B5%D0%BD%D0%B4%D0%B7%D1%96%D1%88%D0%BE%D0%B2%D0%B0_(%D0%9D%D0%B8%D0%B6%D0%BD%D1%8C%D0%BE%D1%81%D1%96%D0%BB%D0%B5%D0%B7%D1%8C%D0%BA%D0%B5_%D0%B2%D0%BE%D1%94%D0%B2%D0%BE%D0%B4%D1%81%D1%82%D0%B2%D0%BE)","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b0/S%C4%99dziszowa_%28wojew%C3%B3dztwo_dolno%C5%9Bl%C4%85skie%29_%28004%29.jpg","page_title":"Сендзішова (Нижньосілезьке воєводство)","context_page_description":"Сендзішова — село в Польщі, у гміні Свежава Злоторийського повіту Нижньосілезького воєводства.\\nНаселення — 502 особи.\\nУ 1975-1998 роках село належало до Єленьоґурського воєводства."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_technischen_Denkmale_im_Landkreis_Leipzig","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a0/Grimma_Oberer_Bahnhof-01.jpg","page_title":"Liste der technischen Denkmale im Landkreis Leipzig","context_page_description":"Die Liste der technischen Denkmale im Landkreis Leipzig enthält die Technischen Denkmale im Landkreis Leipzig.\\nDiese Liste ist eine Teilliste der Liste der Kulturdenkmale in Sachsen."},{"page_url":"https://en.wikipedia.org/wiki/Chickamauga_Cherokee","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/55/Major_ridge.jpg","page_title":"Chickamauga Cherokee","context_page_description":"The Chickamauga Cherokee were a group that separated from the greater body of the Cherokee tribes during the American Revolutionary War. The majority of the Cherokee people wished to make peace with the Americans near the end of 1776 following several military setbacks and the reprisals that followed. The Chickamauga followers of headman Dragging Canoe moved with him down the Tennessee River away from their historic Overhill Cherokee towns in the winter of 1776–77. Relocated in a more isolated area, they established 11 new towns in order to gain distance from colonists' encroachments. The frontier Americans associated Dragging Canoe and his band with their new town on the Chickamauga Creek and began to refer to them as the Chickamaugas. Five years later, the Chickamaugas moved further west and southwest into present-day Alabama, establishing five larger settlements. They were then more commonly known as the Lower Cherokee. This term was closely associated with the people of these \\"Five Lower Towns\\"."},{"page_url":"https://nl.wikipedia.org/wiki/German_(Bulgarije)","image_url":"http://upload.wikimedia.org/wikipedia/commons/d/d7/GermanskiManastir2.jpg","page_title":"German (Bulgarije)","context_page_description":"German is een dorp in de buurt van de Bulgaarse hoofdstad Sofia. Het dorp maakt administratief deel uit van het district Pantsjarevo."},{"page_url":"https://es.wikipedia.org/wiki/Matem%C3%A1ticos_franceses_con_premios_internacionales","image_url":"http://upload.wikimedia.org/wikipedia/commons/1/12/Wendelin_Werner.jpg","page_title":"Matemáticos franceses con premios internacionales","context_page_description":"Los premios internacionales de matemáticas son distinciones concedidas por varias fundaciones, asociaciones e instituciones, a los matemáticos por sus aportaciones a la disciplina. El presente artículo incluye una relación de matemáticos francófonos ganadores de alguno de estos principales galardones internacionales."},{"page_url":"https://pl.wikipedia.org/wiki/Yampa","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/19/Yampa%2C_Colorado.JPG","page_title":"Yampa","context_page_description":"Yampa – miasto w Stanach Zjednoczonych, w stanie Kolorado, w hrabstwie Routt."},{"page_url":"https://zh-min-nan.wikipedia.org/wiki/Purbalingga_Ko%C4%81n","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/af/Lambang_Kabupaten_Purbalingga.png","page_title":"Purbalingga Koān","context_page_description":"Purbalingga sī Ìn-tō͘-nî-se-a Jawa Tiong Jawa ê chi̍t ê koān.\\nPang-bô͘:Tiong Jawa"},{"page_url":"https://pl.wikipedia.org/wiki/Ko%C5%9B%C4%87_ramienna","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d6/Humerus_animation2.gif","page_title":"Kość ramienna","context_page_description":"Kość ramienna – jedna z kości kończyny górnej, należy do kości długich. Wyróżnia się w niej koniec bliższy, trzon i koniec dalszy.\\nNa końcu bliższym znajduje się głowa kości ramiennej. Głowę ogranicza szyjka anatomiczna kości ramiennej. Bocznie od szyjki leżą dwa guzki oddzielone od siebie bruzdą międzyguzkową ku tyłowi od niej leży guzek większy, ku przodowi – guzek mniejszy. Od guzków w kierunku trzonu ciągną się grzebienie guzków większego i mniejszego. Poniżej guzków znajduje się tzw. szyjka chirurgiczna – nazwana tak, gdyż jest to miejsce częstych złamań.\\nTrzon kości ramiennej, na tylnej powierzchni ma skośnie przebiegającą płytką bruzdę nerwu promieniowego. Nierówność na bocznej powierzchni trzonu jest miejscem przyczepu mięśnia naramiennego i jest to tzw. guzowatość naramienna.\\nPo obu stronach końca dalszego znajdują się wyniosłości, zwane nadkłykciami, z których przyśrodkowy jest dłuższy niż boczny. Pod nadkłykciem przyśrodkowym leży bruzda nerwu łokciowego. Między nadkłykciami i nieco poniżej nich leży kłykieć kości ramiennej, na którym znajdują się powierzchnie stawowe dla połączenia z kośćmi przedramienia."},{"page_url":"https://es.wikipedia.org/wiki/LAG_40","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0e/LAG-40_I.M.-2.JPG","page_title":"LAG 40","context_page_description":"El LAG 40 es un lanzagranadas automático de 40 mm alimentado mediante cinta, ​ desarrollado y producido en España por Santa Bárbara Sistemas."},{"page_url":"https://it.wikipedia.org/wiki/Le_Dauphin%C3%A9_lib%C3%A9r%C3%A9","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/03/Nouveau_dauphine.jpg","page_title":"Le Dauphiné libéré","context_page_description":"Le Dauphiné libéré è un quotidiano francese."},{"page_url":"https://ms.wikipedia.org/wiki/Bahasa-bahasa_Altaik","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b3/2006-07_altaj_belucha.jpg","page_title":"Bahasa-bahasa Altaik","context_page_description":"Bahasa-bahasa Altaik merupakan sebuah keluarga bahasa cadangan yang mengandungi 66 buah bahasa dituturkan oleh kira-kira 348 juta orang, kebanyakannya di atau sekitar Asia Tengah dan Asia Timur Laut.\\nKaluarga ini sering dianggap mengandungi kumpulan bahasa Turkik, bahasa Mongolik, dan bahasa Tungusik. Sesetengah pihak juga memasukkan Bahasa Korea dan/atau keluarga Bahasa Japonik. Beberapa orang pakar bahasa menambah Bahasa Ainu.\\nKadangkala hipotesis yang mengandungi hanya Turkik, Mongolik, dan Tungusik dikenali sebagai \\"Micro-Altaik\\" dan yang mengandungi bahasa-bahasa yang lain dikenali sebagai \\"Macro-Altaik\\".\\nPerhubungan antara bahasa-bahasa ini menjadi bahan perbahasan antara para pakar bahasa. Sesetengah cendekiawan menganggap persamaan antara bahasa-bahasa ini menunjukkan hubungan genetik. Yang lain mencadangkan bahawa bahasa-bahasa ini bukan sebuah kelaurga yang sepunca tetapi satu Sprachbund, sekumpulan bahasa yang menjadi mirip dalam sesetengah segi atas peminjaman menggiat kerana hubungan bahasa.\\nKeluarga bahasa ini sendiri sebahagian daripada hipotesis bahasa-bahasa Eurasiatik dan bahasa-bahasa Nostratik yang kedua-duanya lebih banyak dipersoalkan."},{"page_url":"https://bn.wikipedia.org/wiki/%E0%A6%B8%E0%A6%82%E0%A6%AF%E0%A7%81%E0%A6%95%E0%A7%8D%E0%A6%A4_%E0%A6%86%E0%A6%B0%E0%A6%AC_%E0%A6%86%E0%A6%AE%E0%A6%BF%E0%A6%B0%E0%A6%BE%E0%A6%A4%E0%A7%87%E0%A6%B0_%E0%A6%A6%E0%A6%BF%E0%A6%B0%E0%A6%B9%E0%A6%BE%E0%A6%AE","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/96/UAE_50_Fil_Coin_%28Back%29.jpg","page_title":"সংযুক্ত আরব আমিরাতের দিরহাম","context_page_description":"সংযুক্ত আরব আমিরাত দিরহাম হল সংযুক্ত আরব আমিরাতের মুদ্রা। এটি আমিরাতি দিরহাম নামেও পরিচিত। দিরহাম শব্দের অফিসিয়াল সংক্ষিপ্ত রূপ হল \\"AED\\"। তবে অনানুষ্ঠানিকভাবে \\"DH\\" বা \\"Dhs.\\" সংক্ষিপ্ত রূপও ব্যবহৃত হয়। দিরহাম ১০০ ফিলস এ বিভক্ত ।"},{"page_url":"https://de.wikipedia.org/wiki/G%C3%B6rzig_(Gro%C3%9Fenhain)","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/95/Kirche_G%C3%B6rzig.JPG","page_title":"Görzig (Großenhain)","context_page_description":"Görzig ist ein Ortsteil der sächsischen Stadt Großenhain im Norden des Landkreises Meißen."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%90%D0%BB%D0%B0%D1%80%D0%B8%D1%85_II","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e6/Alaric_II_484_507_gold_1470mg_reverse.jpg","page_title":"Аларих II","context_page_description":"Аларих II — король вестготов в 484—507 годах."},{"page_url":"https://th.wikipedia.org/wiki/%E0%B8%A1%E0%B8%B5%E0%B9%81%E0%B8%8A%E0%B8%A5_%E0%B9%81%E0%B8%99","image_url":"http://upload.wikimedia.org/wikipedia/commons/5/5e/Battle_of_Borodino_by_Langlois.jpg","page_title":"มีแชล แน","context_page_description":"มีแชล แน เป็นทหารและผู้บัญชาการทหารระหว่างสงครามปฏิวัติฝรั่งเศสและสงครามนโปเลียน เขาเป็นหนึ่งใน 18 จอมพลฝรั่งเศสดั้งเดิมที่นโปเลียนทรงสถาปนา ได้รับสมญานามว่า จอมสุรโยธิน เขาเป็นจอมพลแห่งฝรั่งเศสเพียงคนเดียวที่ถูกตัดสินประหารชีวิตในข้อหาทรราชหลังการฟื้นฟูราชาธิปไตยในฝรั่งเศสครั้งที่สอง ท่ามกลางเสียงคัดค้านของชาวฝรั่งเศสทั่วไป"},{"page_url":"https://en.wikipedia.org/wiki/Thomas_of_Bosnia","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8e/Jerusalem-kreuz.svg","page_title":"Thomas of Bosnia","context_page_description":"Stephen Thomas, a member of the House of Kotromanić, reigned from 1443 until his death as the penultimate King of Bosnia.\\nAn illegitimate son of King Ostoja, Thomas succeeded King Tvrtko II, but his accession was not recognized by the leading magnate of the Kingdom of Bosnia, Stjepan Vukčić Kosača. The two engaged in a civil war which ended when the King repudiated his wife, Vojača, and married the insubordinate nobleman's daughter, Catherine. Thomas and his second wife, both raised in the Bosnian Church tradition, converted to Roman Catholicism and sponsored construction of churches and monasteries throughout the kingdom.\\nThroughout his reign, Thomas waged a war with the Serbian Despotate over the lucrative mining town of Srebrenica and its surroundings, in addition to multiple conflicts with his father-in-law. Moreover, he had a tense relationship with the menacing Ottoman Empire. After years of skirmishes and raids, Thomas appeared willing to lead the Christian coalition against the Turks, but received no assistance from fellow Christian rulers."},{"page_url":"https://pl.wikipedia.org/wiki/Kop%C5%99ivnice","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/15/NesseldorfAlteKarte.png","page_title":"Kopřivnice","context_page_description":"Kopřivnice – miasto w Czechach, w kraju morawsko-śląskim. Według danych z 2006 roku powierzchnia miasta wynosiła 2748 ha, a liczba jego mieszkańców 23 642 osób.\\nW mieście znajdują się korty tenisowe, basen kryty i baseny odkryte."},{"page_url":"https://it.wikipedia.org/wiki/Leonello_d%27Este","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b0/09_Corpus_Domini_Ferrara_-_Sala_del_Coro_o_sala_delle_Clarisse_-_Tombe_estensi.jpg","page_title":"Leonello d'Este","context_page_description":"Leonello d'Este, o anche Lionello, fu marchese di Ferrara a partire dal 1441, inoltre signore di Modena, Reggio, Polesine e Garfagnana."},{"page_url":"https://zh-yue.wikipedia.org/wiki/%E5%9C%9F%E8%80%B3%E5%85%B6","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/cf/Pamukkale00.JPG","page_title":"土耳其","context_page_description":"土耳其（土耳其文：Türkiye Cumhuriyeti），正式國家名土耳其共和國，係一個橫跨歐洲同亞洲嘅國家，大部份國土喺細亞細亞半島，即係安那托利亞半島以及巴爾幹半島嘅東色雷斯地區。北邊係黑海，南邊係地中海，海岸線長3518公里。東南同敘利亞、伊拉克接壤，西邊就有愛琴海、希臘同埋保加利亞接壤，東邊同格魯吉亞、亞美尼亞、阿塞拜疆、伊朗接壤。而喺安那托利亞半島同埋東色雷斯地區之間，又有博斯普魯斯海峽、馬爾馬拉海同埋達達尼爾海峽。土耳其嘅首都係位處安那托利亞高原正中間嘅安卡拉。\\n根據1995年人口統計，土耳其總人口有 6160萬，其中土耳其人佔80%以上，庫爾德人佔15%，其他民族佔5%。99%國民信伊斯蘭教，其中遜尼派佔85%，其他都係什葉派嘅阿拉維派教徒，重有少數人係信基督教同猶太教。官方語言係土耳其話。 土耳其而家正申請緊加入歐盟。"},{"page_url":"https://ar.wikipedia.org/wiki/%D9%82%D8%B3%D9%85_%D8%B7%D8%A8_%D8%A7%D9%84%D8%A3%D8%B7%D9%81%D8%A7%D9%84-_%D9%83%D9%84%D9%8A%D8%A9_%D8%A7%D9%84%D8%B7%D8%A8-_%D8%AC%D8%A7%D9%85%D8%B9%D8%A9_%D8%B9%D9%8A%D9%86_%D8%B4%D9%85%D8%B3","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9a/Professor_Salah_Awaad_Pediatrics_1973-1979.jpg","page_title":"قسم طب الأطفال- كلية الطب- جامعة عين شمس","context_page_description":"بدأ تأسيس هذا القسم العريق سنة 1947 م بمبنى مستشفى الأطفال الذي بنته جمعية رعاية الأطفال المصرية. كلية الطب بجامعة عين شمسكلية الطب بجامعة عين شمس"},{"page_url":"https://en.wikipedia.org/wiki/Poovattoor","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0f/Poovattor_Pongala.jpg","page_title":"Poovattoor","context_page_description":"Poovattoor is a village located in Kottarakara taluk in the northern part of the Kollam District, Kerala state, India. It is best known as the site of an ancient Bhagavathy temple, Poovattoor Devi Temple, sister of Pattazhy Devi Temple and Mannadi Devi Temple.\\n."},{"page_url":"https://azb.wikipedia.org/wiki/%D8%A2%D9%86%DB%8C_%D9%85%D9%88%D9%86%D8%AA%D8%A7%D9%82_%D8%A7%D9%84%DA%A9%D8%B3%D8%A7%D9%86%D8%AF%D8%B1","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4d/Annie_Montague_Alexander.jpg","page_title":"آنی مونتاق الکساندر","context_page_description":"آنی مونتاق الکساندر بیلیم اینسان. ۲۹ دسامبر ۱۸۶۷ تاریخینده دۆنیایا گؤز آچیب. ۸۲ ایل عومر ائله‌ییب و ۱۰ دسامبر ۱۹۵۰ میلادی تاریخینده وفات ائدیب."},{"page_url":"https://en.wikipedia.org/wiki/Chemical_lace","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f5/Chemical_lace.jpg","page_title":"Chemical lace","context_page_description":"Chemical lace is a form of machine-made lace. This method of lace-making is done by embroidering a pattern on a sacrificial fabric that has been chemically treated so as to disintegrate after the pattern has been created. Schiffli machines came into use in the late 19th century. Before that, embroidery machines called Swiss hand machine were used to make chemical lace as well as embroideries.\\nThis embroidery is nowadays typically done on a multi-head or multi-needle Schiffli machine or loom that has a very large, continuous and overlapping embroidery field. The lace pattern is designed such that the embroidery thread creates an interlocking series of threads that will, in essence, become a \\"stand-alone\\" piece of lace.\\nAfter the embroidery is completed the embroidered fabric is immersed in a solution that will not harm the embroidery thread but completely dissolves the sacrificial fabric leaving just the lace.\\nUtilizing these large machines and this technique, a single piece of lace could be, using today's state-of-the-art machines, over 60 inches wide by 15 yards long. In practice, this system is used to produce many smaller items with one setup."},{"page_url":"https://eo.wikipedia.org/wiki/Ar%C3%A2ches-la-Frasse","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/45/Ar%C3%A2ches-la-Frasse_-_Vue_sur_la_commune.JPG","page_title":"Arâches-la-Frasse","context_page_description":"Arâches-la-Frasse estas komunumo de Francio. Ĝi situas en la departemento alta Savojo, en la regiono Aŭvernjo-Rodano-Alpoj. Fine de 2017 en la komunumo vivis 1 910 loĝantoj."},{"page_url":"https://hu.wikipedia.org/wiki/Teddy_Sheringham","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8a/Teddy_Sheringham_2012.jpg","page_title":"Teddy Sheringham","context_page_description":"Edward Paul 'Teddy' Sheringham MBE visszavonult profi angol labdarúgó, a szintén focista Charlie Sheringham édesapja. Utolsó klubja a másodosztályú Colchester United volt. Sheringham csatárként játszott, sikeres pályafutása alatt szinte minden jelentősebb kupát megnyert. Ötvenegy mérkőzésen lépett pályára az angol válogatottban. Visszavonulását 2008. március 1-jén jelentette be. A 2007–08-as szezon végén, 42 évesen vonult vissza.\\n2007 júniusában megkapta a Brit Birodalmi Rend Tagja érdemrendet."},{"page_url":"https://cs.wikipedia.org/wiki/Vedlej%C5%A1%C3%AD_m%C3%ADsta_v_Percym_Jacksonovi","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2f/Mt._Tam_coastline.jpg","page_title":"Vedlejší místa v Percym Jacksonovi","context_page_description":"Seznam míst\\nTábor Polokrevných\\nNahrávací studia DOA\\nOlymp\\nPrincezna Andromeda"},{"page_url":"https://fr.wikipedia.org/wiki/Jean-Baptiste_de_la_Conception","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0e/Alcal%C3%A1_de_Henares-Colegio_Trinitarios.jpg","page_title":"Jean-Baptiste de la Conception","context_page_description":"Saint Jean-Baptiste de la Conception est un religieux trinitaire espagnol. Réformateur de sa famille religieuse dans le contexte de la Contre-Réforme, il a créé la branche des trinitaires déchaussés, dont est issu l'ordre actuel de la Sainte Trinité. Il est également l'auteur de nombreux ouvrages ascétiques, dans lesquels il témoigne de son expérience spirituelle."},{"page_url":"https://ar.wikipedia.org/wiki/%D8%B4%D9%88%D9%86_%D8%A3%D9%88%D9%85%D8%A7%D9%84%D9%8A","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f5/Shawn_O%27Malley_on_May_26%2C_2015.jpg","page_title":"شون أومالي","context_page_description":"شون أومالي ‏ هو لاعب كرة قاعدة أمريكي، ولد في 28 ديسمبر 1987 في ريتشلاند في الولايات المتحدة."},{"page_url":"https://nl.wikipedia.org/wiki/Pinarejo","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0c/Pinarejo.jpg","page_title":"Pinarejo","context_page_description":"Pinarejo is een gemeente in de Spaanse provincie Cuenca in de regio Castilië-La Mancha met een oppervlakte van 62 km². Pinarejo telt 238 inwoners."},{"page_url":"https://ar.wikipedia.org/wiki/%D9%82%D8%A7%D8%A6%D9%85%D8%A9_%D8%A3%D8%B3%D9%85%D8%A7%D8%A1_%D9%85%D8%AF%D9%86_%D9%88%D9%84%D8%A7%D9%8A%D8%A9_%D8%AA%D9%88%D8%B1%D9%8A%D9%86%D8%BA%D9%86","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/17/Rathaus_B%C3%BCrgel.JPG","page_title":"قائمة أسماء مدن ولاية تورينغن","context_page_description":"هذه قائمة أسماء مدن و لاية تورينغن."},{"page_url":"https://pt.wikipedia.org/wiki/Shmuel_Agmon","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/da/Shmuel_Agmon.jpeg","page_title":"Shmuel Agmon","context_page_description":"Shmuel Agmon é um matemático israelense.\\nConhecido por seus trabalhos em análise matemática e equações diferenciais parciais."},{"page_url":"https://be.wikipedia.org/wiki/%D0%A1%D1%82%D0%B0%D0%BD%D1%96%D1%81%D0%BB%D0%B0%D1%9E_%D0%A1%D1%96%D0%BB%D1%8C%D0%B2%D0%B5%D1%81%D1%82%D1%80%D0%B0%D0%B2%D1%96%D1%87_%D0%93%D0%B0%D0%B9%D0%B4%D1%83%D0%BA%D0%B5%D0%B2%D1%96%D1%87","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e3/%D0%A1%D1%82%D0%B0%D0%BD%D1%96%D1%81%D0%BB%D0%B0%D1%9E_%D0%93%D0%B0%D0%B9%D0%B4%D1%83%D0%BA%D0%B5%D0%B2%D1%96%D1%87.jpg","page_title":"Станіслаў Сільвестравіч Гайдукевіч","context_page_description":"Станіслаў Сільвестравіч Гайдуке́віч — беларускі архітэктар."},{"page_url":"https://zh.wikipedia.org/wiki/%E8%9D%B4%E8%9D%B6%E5%BB%A3%E5%A0%B4","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/99/Butterfly_Market_renovation_section_and_Temporary_Butterfly_Market.jpg","page_title":"蝴蝶廣場","context_page_description":"蝴蝶廣場，前稱蝴蝶邨商場，是一個位於香港新界屯門蝴蝶邨的購物商場，於1984年落成。商場位於在蝴蝶邨內，主要為邨內居民提供日常需要，因而得名。除店舖及食肆外，商場於地下亦設有街市，名為「蝴蝶街市」。\\n該商場原來由香港房屋委員會管理，後來在2005年交由領展房地產投資信託基金管理，於2008年至2010年進行商場翻新工程，並引入不少商店、食肆和各種生活所需服務，並改名為「蝴蝶廣場」。商場另設313個車位，方便駕車人士，亦鄰近熟食檔和鮮活街市。"},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Kirchengeb%C3%A4ude_im_Erzgebirgskreis","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5c/Adventgemeinde_Ehrenfriedersdorf_%282%29.jpg","page_title":"Liste der Kirchengebäude im Erzgebirgskreis","context_page_description":"Die meisten der etwa 300 Kirchengebäude im Erzgebirgskreis unterstehen der Evangelisch-Lutherischen Landeskirche Sachsens. Die ältesten Gotteshäuser des Erzgebirgskreises entstanden in der Zeit der Erstbesiedlung des Erzgebirges um 1200. Von herausragender baugeschichtlicher Bedeutung sind die drei spätgotischen Hallenkirchen St. Annen in Annaberg-Buchholz, St. Wolfgang in Schneeberg und St. Marien in Marienberg, die Wehrkirche in Großrückerswalde und die Trinitatiskirche in Carlsfeld, die als frühe Form des sächsischen Zentralbaus Vorläuferin der Frauenkirche in Dresden ist. Die Kirchengebäude der Freikirchen, der katholischen Gemeinden und der religiösen Sondergemeinschaften stammen zumeist aus dem 20. Jahrhundert."},{"page_url":"https://en.wikipedia.org/wiki/Vrhnika_pri_Lo%C5%BEu","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a2/Vrhnika_pri_Lozu_Slovenia_-_church.jpg","page_title":"Vrhnika pri Ložu","context_page_description":"Vrhnika pri Ložu is a village southeast of Stari Trg in the Municipality of Loška Dolina in the Inner Carniola region of Slovenia."},{"page_url":"https://ja.wikipedia.org/wiki/%E5%8C%97%E4%B9%9D%E5%B7%9E%E5%B8%82%E3%83%AB%E3%83%8D%E3%83%83%E3%82%B5%E3%83%B3%E3%82%B9%E6%A7%8B%E6%83%B3","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/76/A_distant_view_of_Space_World.jpg","page_title":"北九州市ルネッサンス構想","context_page_description":"北九州市ルネッサンス構想は、福岡県北九州市が市制施行および政令指定都市移行25周年を迎えた1988年に策定した都市政策。1987年に3代目市長に就任した末吉興一が中心となり、翌年12月に策定。2006年を最終目標とした。「水辺と緑とふれあいの“国際テクノロジー都市”へ」を基調テーマとした都市再生計画である。\\n磯村英一東京都立大学教授の「多核都市論」に基き、旧5市の均衡発展を目指してきた従前の政策から、当構想により小倉駅を中心とした小倉都心と、黒崎駅を中心とした黒崎副都心の両極を中心とした「集中型都市」へと大規模に政策転換したことで知られる。"},{"page_url":"https://en.wikipedia.org/wiki/Sunart","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/ab/Sunart-Beinn-Resipol-at-sunset.jpg","page_title":"Sunart","context_page_description":"Sunart is a rural district and community in the south west of Lochaber in Highland, Scotland, on the shores of Loch Sunart, and part of the civil parish of Ardnamurchan. The main village is Strontian, at the head of the loch, which is the location of Ardnamurchan High School, the local fire station, police station and other facilities.\\nThe district is bounded to the south by the eastern half of Loch Sunart and by part of Morvern, to the west by the Ardnamurchan peninsula, to the north by Loch Shiel, and to the east and north east by the district of Ardgour, from which it is divided by a range of high hills. Main access to the area today is via Glen Tarbert, from the Corran Ferry, although there is also a road coming in from Lochailort, via Moidart, to the north. Although the area may seem isolated now, in the past the main mode of transport in the West Highlands was boat, and the district was well-integrated into the west coast economy and culture.\\nNearly all of the population live in a narrow ribbon of small settlements along the northern shore of Loch Sunart, with a southerly aspect."},{"page_url":"https://en.wikipedia.org/wiki/William_Archibald_(playwright)","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/da/Portrait_of_William_Archibald_LCCN2004662520.jpg","page_title":"William Archibald (playwright)","context_page_description":"William Archibald was a Trinidadian-born playwright, dancer, choreographer and director, whose stage adaptation of Henry James' The Turn of the Screw was made into the 1961 British horror film The Innocents."},{"page_url":"https://ca.wikipedia.org/wiki/Llista_de_monuments_del_Maresme","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/30/Torre_de_Ca_l%27Umbert_Montgat.jpg","page_title":"Llista de monuments del Maresme","context_page_description":"Llista de monuments del Maresme inclosos en l'Inventari del Patrimoni Arquitectònic Català per la comarca del Maresme. Inclou els inscrits en el Registre de Béns Culturals d'Interès Nacional amb la classificació de monuments històrics, els Béns Culturals d'Interès Local de caràcter immoble i la resta de béns arquitectònics integrants del patrimoni cultural català."},{"page_url":"https://cs.wikipedia.org/wiki/Hrobka_Pern%C5%A1tejn%C5%AF_(Doubravn%C3%ADk)","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2f/Doubravn%C3%ADk%2C_portal_of_church_-_cz.jpg","page_title":"Hrobka Pernštejnů (Doubravník)","context_page_description":"Hrobka Pernštejnů v Doubravníku se nachází v kostele Povýšení svatého Kříže, v areálu zaniklého doubravnického kláštera.\\nCelý chrám byl vystavěn ve druhé třetině 16. století jako rodové pohřebiště, což dokládá i nápis nad vstupním portálem kostela. Samotná pernštejnská hrobka se nachází pod kněžištěm, kam vede třináct kamenných schodů. Zde se nacházely cínové a stříbrné rakve, které si však v roce 1645 švédská armáda vzala jako válečnou kořist a kosti nechala vysypané na zemi. Po obvodu presbytáře je ve zdech umístěno celkem šest náhrobních kamenů. Zleva se jedná o kámen Kateřiny z Pernštejna, náhrobník Johanky z Liblic a dále kameny Jana IV. Bohatého, Viléma II. z Pernštejna, Vratislava I. z Pernštejna a Jana II. z Pernštejna. Další dva kameny se nacházejí přímo v dlažbě chrámu."},{"page_url":"https://es.wikipedia.org/wiki/Brecha_digital_de_g%C3%A9nero","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5d/IBM_Electronic_Data_Processing_Machine_%289467782802%29.jpg","page_title":"Brecha digital de género","context_page_description":"La brecha digital de género es una de las variables más relevantes relacionadas con el retraso de las mujeres en la incorporación al mundo de las nuevas tecnologías y al uso de Internet. Las diferencias de acceso entre hombres y mujeres se dan en todas las sociedades actuales, tanto en contextos de economías avanzadas como de economías en desarrollo.​\\nLas mujeres aprovechan cada vez más las tecnologías de la información y la comunicación en todas las esferas de la vida. Pero al mismo tiempo se produce una brecha de género manifiesta no sólo en el menor número de mujeres usuarias de las TIC, sino también en la persistencia de desigualdades estructurales específicas de género que constituyen barreras para su acceso y su uso. Al inicio de la aparición de las TIC, se partía de la idea de que no existía la brecha digital, sino que el retraso de algunos sectores, colectivos y países, era un estadio que se superaría con el tiempo y con el crecimiento económico. Hoy se constata, sin embargo, que hay diversos tipos de brecha digital y que ésta persiste y adquiere nuevas formas."},{"page_url":"https://pt.wikipedia.org/wiki/Hist%C3%B3ria_da_Am%C3%A9rica_Latina","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8c/Orteliusamerica.jpg","page_title":"História da América Latina","context_page_description":"A História da América Latina é o campo de estudos acerca da América Latina sob a perspectiva da história. Do 32º de latitude norte ao 54° de latitude sul, a América Latina cobre 21.173.000 km², ou seja 15,9% das terras emersas. É dessa maneira que se costuma designar a imensa fração do continente americano descoberta, povoada e colonizada pelos ibéricos: os espanhóis e portugueses.\\nFalar da América Latina é afirmar a unidade desse mundo, em oposição à América Anglo-Saxônica, e dos duzentos e quinze milhões de seres humanos que na sua maioria esmagadora falam as línguas castelhana e portuguesa. Seria possível escrever as histórias das Américas Latinas, mas é a história da América Latina que queremos escrever, porque é necessário optar e porque entendemos também que a unidade acaba por levar a melhor sobre a diversidade.\\nA América Latina participa do prodigioso isolamento do novo continente entre as duas massas líquidas do Atlântico e do Pacífico."},{"page_url":"https://bg.wikipedia.org/wiki/%D0%90%D0%B1%D1%83%D0%BA%D0%B8%D1%80%D1%81%D0%BA%D0%B8_%D0%B7%D0%B0%D0%BB%D0%B8%D0%B2","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0c/AbuQirBay.png","page_title":"Абукирски залив","context_page_description":"Абукирски залив е залив на Средиземно море, разположен на брега на Египет, между град Абу Кир на запад и Розета и западния ръкав на Делтата на Нил на изток.\\nВ Античността заливът е блатиста област с разположени в нея острови и днес на неговото дъно се намират останките на древните градове Канопос, Хераклейон и Менутис. Той е известен и с три сражения по време на Революционните войни през 1798, 1799, и 1801 година."},{"page_url":"https://es.wikipedia.org/wiki/Som_Energia","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/63/Escuela-septiembre_2016.jpg","page_title":"Som Energia","context_page_description":"Som Energia es una cooperativa de producción y consumo de energías renovables española, con especial implantación en Cataluña​ y sede en el Parque Científico y Tecnológico de la Universidad de Gerona​. La organización, sin ánimo de lucro, nació oficialmente el 11 de diciembre de 2010 en Gerona, convirtiéndose así en la primera de este tipo fundada en España.​​​​ El proyecto de creación de la cooperativa se inició en noviembre de 2009 por un grupo de antiguos alumnos y profesores de la Universidad de Gerona y otros colaboradores, con la intención de seguir los pasos de iniciativas como Ecopower, Enercoop y Greenpeace Energy.​\\nLos principales objetivos de esta cooperativa son ofrecer a sus socios la posibilidad de consumir energía 100% renovable a un precio similar al de la electricidad convencional"},{"page_url":"https://fr.wikipedia.org/wiki/Prochaines_%C3%A9lections_l%C3%A9gislatives_moldaves","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/70/Maia_Sandu_%282019%29.jpg","page_title":"Prochaines élections législatives moldaves","context_page_description":"Les prochaines élections législatives moldaves doivent avoir lieu d'ici 2023 afin de renouveler les 101 députés du Parlement moldave.\\nEn raison de la crise constitutionnelle moldave de 2019, des élections anticipées sont un temps annoncées pour le 6 septembre 2019, avant d'être annulées suite à la confirmation dans ses fonctions du gouvernement Sandu. La chute de ce dernier le 12 novembre 2019 et son rapide remplacement par le gouvernement Chicu relance la possibilité d'un avancement du scrutin."},{"page_url":"https://zh.wikipedia.org/zh-cn/%E5%85%89%E5%BE%A9%E4%B8%8A%E6%B0%B4_(2019%E5%B9%B4)","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fc/Police_run_to_arrest_people_in_San_Wan_Road_20190713.jpg","page_title":"光復上水 (2019年)","context_page_description":"光复上水行动，是2019年7月13日在香港北区上水举行的一场反对水货客游行活动。游行起点为北区运动场，终点为上水公园第一号，途经新功街、符兴街、新发街。光复行动发起人北区水货客关注组发言人梁金成指有3万人参与游行，警方指最高峰有4千人参加。示威活动结束后立即爆发激烈的警民冲突，一名示威者逃避白衣警员追捕时爬出天桥栏杆，险些堕桥，最终被数名警员和无线新闻摄影师拉住。行动最少造成10名警员送院，14名男伤者送往北区医院，多名记者受伤。"},{"page_url":"https://ast.wikipedia.org/wiki/Democracia_cristiana","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/20/Pio_IX_Frosinone.jpg","page_title":"Democracia cristiana","context_page_description":"Democracia cristiana ye una corriente política que tien oríxenes nes enseñances de Jacques Maritain, Emmanuel Mounier y los pronunciamientos de la Doctrina social de la Ilesia, bien distintos del socialismu cristiano que ye socialista, anque los dos doctrines dicen tar influyíes poles enseñances de Xesucristo. Esta corriente surdió nel sieglu XIX n'Europa, y sigue teniendo una fuerte influencia n'Europa y Llatinoamérica.\\nLos movimientos demócrata-cristianos nun son círculos puros de pensamientu y de doctrina, sinón grupos d'aición cola aspiración de llevar a la democracia les consecuencies derivaes de los principios filosóficos cristianos, ente ellos la concepción de la historia con un raigañu espiritual, non materialista; la primacía de lo moral; La dignidá de la persona humana; La primacía del bien común y la xusticia social."},{"page_url":"https://ja.wikipedia.org/wiki/%E4%BA%AC%E6%80%A5700%E5%BD%A2%E9%9B%BB%E8%BB%8A_(2%E4%BB%A3)","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3c/Keikyu_724_2050103.jpg","page_title":"京急700形電車 (2代)","context_page_description":"京急700形電車はかつて京浜急行電鉄に在籍した通勤形電車である。京急で初めて片側4扉の車体を採用し、1967年から1971年にかけて4両21編成、84両が製造された。制御電動車2両と付随車1両の3両単位で普通列車として運用される様構想されたが、様々な事情から1970年代の一時期を除いて付随車を1両追加した4両単位で運用された。4両編成では起動加速度が低いことから本線の普通列車としての運用に難があり、1978年以降は大師線やラッシュ時の優等列車に運用の中心を移している。1980年から1988年にかけて冷房装置を搭載する改造がほどこされたのち、1998年から2005年にかけて廃車され、高松琴平電鉄に22両が譲渡されたほかは解体処分された。\\n本項では、京急本線上で南側を「浦賀方」または「浦賀寄り」、北側を「品川方」または「品川寄り」、東側を「海側」、西側を「山側」と呼ぶ。編成番号は浦賀方先頭車の車両番号で代表する。「1000形」は1959年登場の1000形、「800形」は1978年登場の800形を、「400形」は1966年の改番以降の400形を指す。"},{"page_url":"https://en.wikipedia.org/wiki/Psilocybe_weilii","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d6/Psilocybe_weilii_stemandgills.jpg","page_title":"Psilocybe weilii","context_page_description":"Psilocybe weilii is a psilocybin mushroom having psilocybin and/or psilocin as main active compounds. Originally mistaken for Psilocybe caerulescens var. caerulescens, it is named after Andrew Weil, the integrative medicine physician."},{"page_url":"https://ca.wikipedia.org/wiki/Venthon","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/67/Centrale_de_Venthon.jpg","page_title":"Venthon","context_page_description":"Venthon és un municipi francès al departament de Savoia. L'any 2007 tenia 619 habitants."},{"page_url":"https://zh-yue.wikipedia.org/wiki/%E4%B8%89%E5%85%83%E9%87%8C%E7%AB%99","image_url":"http://upload.wikimedia.org/wikipedia/commons/7/7d/SaamJyunLeiZaam_WORD.jpg","page_title":"三元里站","context_page_description":"三元里站（粵拼：saam¹ jyun⁴ lei5*2 zaam⁶；英文：Sanyuanli Station）係廣州地鐵2號綫嘅車站，2002年12月29號開始營運，位置喺白雲區三元里大道（附近冇幾遠就係三元里村）嘅地底。\\n從2002年12月29號開通咗2號綫首通段到2010年9月21號為止，係2號綫北邊總站。"},{"page_url":"https://it.wikipedia.org/wiki/Juan_Antonio_Flecha","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/23/JuanAntonioFlecha.jpg","page_title":"Juan Antonio Flecha","context_page_description":"Juan Antonio Flecha Giannoni è un ex ciclista su strada argentino naturalizzato spagnolo, professionista dal 2000 al 2013. Specialista delle classiche, con caratteristiche da passista, in carriera ha vinto una tappa al Tour de France 2003, il Campionato di Zurigo 2004 e l'Omloop Het Nieuwsblad 2010."},{"page_url":"https://hr.wikipedia.org/wiki/Glavni_kolodvor_u_Umeu","image_url":"http://upload.wikimedia.org/wikipedia/commons/8/81/Ume%C3%A5_Central_Station_tracks.jpg","page_title":"Glavni kolodvor u Umeu","context_page_description":"Glavni kolodvor u Umeu, željeznički kolodvor u Umeu u Švedskoj.\\nKolodvor je projektirao arhitekt Folke Zettervall, a izgrađen je 1895./1896. Godine 2001. proglašen je byggnadsminneom. Ponovni razvoj područja počeo je u srpnju 2010. Kolodvor je bio zatvoren od 7. kolovoza 2010 do 1. lipnja 2011., a u međuvremenu se putnički prijevoz premjestio na novi Istočni kolodvor u Umeu. Obnova kolodvora završena je u jesen 2012. godine."},{"page_url":"https://da.wikipedia.org/wiki/Amandaprisen_2016","image_url":"http://upload.wikimedia.org/wikipedia/commons/9/9b/Anders_Baasmo_Christiansen.JPG","page_title":"Amandaprisen 2016","context_page_description":"Den 32. uddeling af Amandaprisen fandt sted den 26. august 2016 i Scandic Maritim Hall i Haugesund. Under prisuddelingen blev Amandaprisen i 20 forskellige kategorier delt ud. Prisuddelingen blev udsendt på TV2 og var produceret af Rubicon TV. Jakob Oftebro var programleder for første gang.\\nPrisuddelingen markerede afslutningen på den norske filmfestival.\\nBølgen vandt prisen for bedste film mens Louder than Bombs vandt flest priser. Liv Bernhoft Osa vandt bedste kvindelige skuespiller for hendes rolle i Pyromanen mens Anders Baasmo Christiansen vandt bedst mandlige skuespiller for hans rolle i Welcome to Norway. Amandakomiteens Ærespris gik til Anne Marit Jacobsen.\\nPrisuddelingen blev set af 322.000 personer i Norge."},{"page_url":"https://azb.wikipedia.org/wiki/%D9%85%D8%AF%DB%8C%D9%86%D8%A7_%D8%AF_%D9%BE%D9%85%D8%A7%D8%B1","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/07/Parque_Villacobos.jpeg","page_title":"مدینا د پمار","context_page_description":"مدینا د پمار ایسپانیادا بیر یاشاییش منطقه‌سی‌دیر بۇ شهرین مساحتی ۲۱۴ کیلومتر موربّع دیر. ۵۸۳ متر دنیز سویه‌سیندن اۇجالیقی وار. سوْن نۆفوس تخمین‌لرینه گؤره ۶۳۲۱ نفر دیر."},{"page_url":"https://zh.wikipedia.org/wiki/%E6%97%A5%E6%9C%AC%E5%93%BA%E4%B9%B3%E5%8B%95%E7%89%A9%E5%88%97%E8%A1%A8","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/32/Tsushima_Cat_001.jpg","page_title":"日本哺乳動物列表","context_page_description":"日本有100種以上的哺乳類，其中約30%為特有種。"},{"page_url":"https://he.wikipedia.org/wiki/%D7%A9%D7%99%D7%9E%D7%95%D7%A9_%D7%91%D7%98%D7%9C%D7%A4%D7%95%D7%9F_%D7%A0%D7%99%D7%99%D7%93_%D7%91%D7%9E%D7%94%D7%9C%D7%9A_%D7%A0%D7%94%D7%99%D7%92%D7%94","image_url":"http://upload.wikimedia.org/wikipedia/commons/a/af/NotextinganddrivingWestUTX.JPG","page_title":"שימוש בטלפון נייד במהלך נהיגה","context_page_description":"שימש בטלפון הנייד במהלך נהיגה בכלי רכב, ובמיוחד כתיבה, שליחה וקריאה של הודעות טקסט, גורמים לתגובות איטיות ופחות שקולות של הנהג, ועל כן עלול לסכן את הנוהג ומשתמשי דרך אחרים. לכן פעילות זו נקבעה כעבירת תנועה חמורה ברוב מדינות העולם.\\nמחקר של הארגון האמריקני American Automobile Association הראה כי 34% מבני הנוער הודו שהם הוסחו בעת הנהיגה בשל כתיבה/שליחה/קריאה של הודעות טקסט ו-40% מבני הנוער האמריקאים אומרים שהם היו במכונית בה הנהג השתמש בטלפון סלולרי באופן שבו סיכן אנשים אחרים. ממחקר שנערך בספטמבר 2009 בקרב נהגי כלי רכב מסחריים עלה שאף על פי שישנו מיעוט מקרים בהם נהגי כלי רכב מסחריים שולחים הודעות טקסט, כאשר נהגי כלי רכב מסחריים שולחים הודעות טקסט במהלך הנהיגה הם הגדילו באופן משמעותי את הסיכון להיות מעורבים בתאונה.\\nשליחת הודעות טקסט הפכו פופולריים במיוחד ברחבי העולם בתחילת העשור הראשון של המאה ה-21, בעיקר בעקבות העלייה בפופולריות של הטלפונים החכמים. לאורך העשורים האחרונים היו מחקרים רבים שמצאו ששליחת הודעות טקסט במהלך הנהיגה הם הגורם העיקרי שמעלה את הסיכון למות בתאונות דרכים בשל הסחת דעת הנהג. איגוד הטלקומוניקציה הבינלאומי קבע ש\\"שליחת הודעות טקסט, ביצוע שיחות ואינטראקציה אחרת עם מידע בכלי רכב ומערכות תקשורת במהלך נהיגה מהווה מקור רציני להסחת הנהיגה ומגביר את הסיכון לתאונות דרכים\\"."},{"page_url":"https://hu.wikipedia.org/wiki/Gelre","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9d/Gelre_Folio_53v.jpg","page_title":"Gelre","context_page_description":"Claes Heinen, avagy ismertebb nevén Gelre herold, Ruyers címerkirálya, II. Jean de Châtillon, Blois grófjának, Gelderland hercegének a szolgálatában álló herold volt.\\nA neve előfordul Geldre, Gelderland, Gueldre, Claes Heijnen, Heneysoen, Heinenzoon, Heijnenszoon alakban is.\\nAz általános nézet szerint Gelre herold személye megegyezik Beyeren herold személyével, aki a Beyeren címerkönyv összeállítója, a Holland krónika és a Világkrónika írója.\\nMielőtt Beyeren Albert, Hollandia grófjának szolgálatába került volna, a gelrei udvarban volt herold, valószínűleg Mechteld van Gelrenél, aki 1372-ben férjhez ment Châtillon Jánoshoz, Blois grófjához.\\nA neve az általa 1370-1395 között összeállított címerkönyvről ismert, melynek kéziratát a belga Királyi Könyvtár őrzi Brüsszelben.\\nA mű az egyik legfontosabb középkori címerkönyv. 121 pergamenlapból áll, melyek hat részre oszlanak. Az I-V. rész tulajdonképpen a VI., legfontosabb rész kiegészítése. A mű pergamenlapjain összesen 1755 blazon és színes kép található egész Európából, melyek között túlsúlyban vannak a flamand és a rajnai tartományokból származó címerek. Az első rész számos költeményt tartalmaz."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Kirchen_im_Erzbistum_Paderborn","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ec/Pfarrkirche_Christk%C3%B6nig_Bredelar.jpg","page_title":"Liste der Kirchen im Erzbistum Paderborn","context_page_description":"Die Liste der Kirchen im Erzbistum Paderborn zeigt die römisch-katholischen Kirchen und Kapellen im Erzbistum Paderborn sortiert nach Dekanaten und Pfarrverbünden an."},{"page_url":"https://nl.wikipedia.org/wiki/Turijn_(provincie)","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f3/Torino_paradiso.jpg","page_title":"Turijn (provincie)","context_page_description":"De voormalige provincie Turijn was gelegen in de Noord-Italiaanse regio Piëmont. Als gevolg van de Wet 142/1990 op de hervorming van de lokale overheidsorganen, in werking getreden op 1 januari 2015 is de provincie vervangen door de metropolitane stad Turijn.\\nIn het noorden grenst ze aan de autonome regio Aosta, in het oosten aan de provincies Biella, Vercelli en Asti. In het zuiden ligt de provincie Cuneo. De westgrens wordt gevormd met de Franse departementen Savoie en Hautes-Alpes."},{"page_url":"https://fa.wikipedia.org/wiki/%DA%AF%D8%A7%D9%87%E2%80%8C%D8%B4%D9%85%D8%A7%D8%B1%DB%8C_%D9%BE%D8%B1%DA%86%D9%85_%DA%A9%D8%B4%D9%88%D8%B1%D9%87%D8%A7","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d5/Flag_of_Kyrgyz_SSR_before_1952.png","page_title":"گاه‌شماری پرچم کشورها","context_page_description":"پرچم کشورهای مستقل موجود در نگارخانه پرچم کشورهای مستقل از سده ۱۸ میلادی تا کنون."},{"page_url":"https://cs.wikipedia.org/wiki/Rdesno_ble%C5%A1n%C3%ADk","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/93/Persicaria_lapathifolia.jpeg","page_title":"Rdesno blešník","context_page_description":"Rdesno blešník je plevelná bylina velmi variabilní výšky s drobnými, nejčastěji žlutozelenými kvítky, která je zařazena do čeledě rdesnovitých."},{"page_url":"https://vi.wikipedia.org/wiki/South_Charleston,_Ohio","image_url":"http://upload.wikimedia.org/wikipedia/commons/c/c1/OHMap-doton-South_Charleston.png","page_title":"South Charleston, Ohio","context_page_description":"South Charleston là một làng thuộc quận Clark, tiểu bang Ohio, Hoa Kỳ. Năm 2010, dân số của làng này là 1693 người."},{"page_url":"https://en.wikipedia.org/wiki/Iryna_Yatchenko","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/de/Iryna_Yatchenko_2004_Belarusian_stamp.jpg","page_title":"Iryna Yatchenko","context_page_description":"Iryna Vasiliyevna Yatchenko is a Belarusian former discus thrower best known for winning two Olympic bronze medals at the 2000 Summer Olympics and 2004 Summer Olympics, although she was eventually stripped of the latter medal due to a doping offence. She also became world champion at the 2003 World Championships in Athletics. Her personal best is 69.14 metres, achieved in July 2004 in Minsk."},{"page_url":"https://no.wikipedia.org/wiki/Edvard_Hagerup_Bull_(1855%E2%80%931938)","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a9/Den_norske_Regjering_1905_-_no-nb_digifoto_20160225_00007_bldsa_PK14852.jpg","page_title":"Edvard Hagerup Bull (1855–1938)","context_page_description":"Edvard Hagerup Bull var en norsk jurist, politiker, stortingsrepresentant, finansminister og justisminister.\\nEdvard Hagerup Bull ble cand.jur i 1876. Han ble byråsjef i Finansdepartementet i 1882. I 1889 var han konstituert statsråd i Finansdepartementet i Johan Sverdrups regjering i 1889. I 1893 ble han høyesterettsdommer.\\nI 1903 ble Bull valgt inn på Stortinget for Høyre i Akershus og formann for budsjettkomiteen. I 1905 ble han justisminister i Christian Michelsens regjering, deretter finansminister i samme regjering fra november 1905. Han var sentral i regjeringens planlegging forut for unionsoppløsningen i 1905 og den påfølgende folkeavstemningen.\\nBull ble valgt inn på Stortinget igjen i 1909. I 1912 ble han parlamentarisk fører for Høyre. I 1918 tok han ikke gjenvalg til Stortinget og sa samtidig opp sitt embede som høyesterettsdommer. Imidlertid ble han allerede to år senere finansminister i Otto Bahr Halvorsens første regjering.\\nBull ble i 1895 utnevnt til ridder av 1. klasse av St. Olavs orden. 7. november 1906 ble han forfremmet til kommandør av 1. klasse «for statsborgerlig og embedsfortjeneste». Han var også innehaver av 7. juni-medaljen."},{"page_url":"https://de.wikipedia.org/wiki/Eichst%C3%A4tt","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2e/Bastionsgarten_Eichst%C3%A4tt_-2009_%281%29.jpg","page_title":"Eichstätt","context_page_description":"Eichstätt ist eine Große Kreisstadt in Oberbayern. Die Stadt ist Sitz des gleichnamigen Landkreises sowie der Verwaltung des Naturparks Altmühltal, außerdem Bischofssitz des Bistums Eichstätt und Hauptsitz der Katholischen Universität Eichstätt-Ingolstadt."},{"page_url":"https://hu.wikipedia.org/wiki/Tatab%C3%A1nya_t%C3%B6megk%C3%B6zleked%C3%A9se","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4a/Bus_station%2C_T-bus_%28PLM-462%29%2C_2019_Tatab%C3%A1nya.jpg","page_title":"Tatabánya tömegközlekedése","context_page_description":"Tatabánya tömegközlekedéséről 2018. január 1-jétől az önkormányzati tulajdonú T-Busz Kft. gondoskodik. A város tömegközlekedését autóbuszok segítségével oldják meg, jelenleg 35 járat található a helyi járati menetrendben."},{"page_url":"https://sv.wikipedia.org/wiki/Sveriges_milit%C3%A4rhistoria","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3e/Swedish_Military_Observer_Team_Liaison_Officer_in_Afghanistan_2006.JPEG","page_title":"Sveriges militärhistoria","context_page_description":"Sveriges militärhistoria. Sverige har en nästan obruten suveränitet sedan tusen år tillbaka och har varit inblandat i många krig.\\nDen längsta ännu pågående fredsperiod mellan nu existerande stater i världen observeras i Sverige, som har haft fred sedan 15 januari 1814, efter förlusten av stora delar av landet i Napoleonkrigen. Svensk fred kan delvis förklaras av dess geografiska läge, dels av de längre perioder av relativ fred i Europa och världen kända som Pax Britannica och Pax Europaea/Pax Americana, dels av militär alliansfrihet innan världskrigen och neutralitetslinje under första och andra världskriget."},{"page_url":"https://nl.wikipedia.org/wiki/Pieter_Jozef_Taeymans","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c7/Gemeentehuis_Baarle-Hertog.jpg","page_title":"Pieter Jozef Taeymans","context_page_description":"Pieter Jozef Taeymans was een Belgische architect."},{"page_url":"https://en.wikipedia.org/wiki/University_of_Dublin","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/93/Trinity_College.jpg","page_title":"University of Dublin","context_page_description":"The University of Dublin, corporately designated the Chancellor, Doctors and Masters of the University of Dublin, is a university located in Dublin, Ireland. It is the degree-awarding body for Trinity College Dublin. It was founded in 1592 when Queen Elizabeth I issued a charter for Trinity College as \\"the mother of a university\\", thereby making it Ireland's oldest operating university. It was modelled after the collegiate universities of Oxford and of Cambridge, but unlike these other ancient universities, only one college was established; as such, the designations \\"Trinity College\\" and \\"University of Dublin\\" are usually synonymous for practical purposes.\\nThe University of Dublin is one of the seven ancient universities of Britain and Ireland. It is a member of the Irish Universities Association, Universities Ireland, and the Coimbra Group."},{"page_url":"https://de.wikipedia.org/wiki/Anarchismus_in_Kuba","image_url":"http://upload.wikimedia.org/wikipedia/commons/e/ec/Roigsanmartin.png","page_title":"Anarchismus in Kuba","context_page_description":"Der Anarchismus in Kuba hatte als soziale Bewegung einen großen Einfluss auf die kubanische Arbeiterschaft im 19. und frühen 20. Jahrhundert. Die Bewegung war besonders stark nach der Abschaffung der Sklaverei im Jahr 1886, bis die Bewegung durch Präsident Gerardo Machado unterdrückt und schließlich durch Fidel Castros marxistisch-leninistische Regierung nach der Kubanischen Revolution in den späten 1950er Jahren zerschlagen wurde. Der kubanische Anarchismus war vor allem kollektivistisch orientiert und später stark vom Anarchosyndikalismus geprägt. Generell wurde die lateinamerikanische Arbeiterbewegung, insbesondere die kubanische Bewegung am Anfang mehr vom Anarchismus als vom Marxismus beeinflusst."},{"page_url":"https://it.wikipedia.org/wiki/Comedia_delle_ninfe_fiorentine","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a8/Ameto_01.jpg","page_title":"Comedia delle ninfe fiorentine","context_page_description":"La Commedia delle ninfe fiorentine, o Ninfale d'Ameto, è un'opera didattico-moraleggiante di carattere allegorico dello scrittore Giovanni Boccaccio.\\nSi tratta di un prosimetro composto tra il 1341 e il 1342 dal Boccaccio dopo il suo ritorno a Firenze, dedicato all'amico Niccolò di Bartolo del Buono del quale ci sono pervenuti ventotto manoscritti e otto stampe."},{"page_url":"https://en.wikipedia.org/wiki/Spook_(crater)","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f4/Lunar_sample_62275_S72-38389.jpg","page_title":"Spook (crater)","context_page_description":"Spook crater is a small crater in the Descartes Highlands of the Moon visited by the astronauts of Apollo 16. The name of the crater was formally adopted by the IAU in 1973. Geology Station 2 is adjacent to Spook, between it and the smaller, younger crater called Buster to the north of it.\\nOn April 21, 1972, the Apollo 16 Lunar Module Orion landed about 500 m east of Spook, which is between the prominent North Ray and South Ray craters. The astronauts John Young and Charles Duke explored the area over the course of three EVAs using a Lunar Roving Vehicle, or rover. They stopped at Spook during EVA 1, on the way back to the LM from Flag crater.\\nSpook crater is approximately 340 m in diameter and over 20 m deep. Spook is about 550 m west of the landing site itself.\\nThe Lunar Portable Magnetometer was used to obtain a reading of approximately 180 γ at Spook. This was one of five locations at the landing site where the LPM was used.\\nSpook cuts into the Cayley Formation of Imbrian age."},{"page_url":"https://ko.wikipedia.org/wiki/%EB%A1%A0_%ED%8E%84%EB%A8%BC","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/dc/RonPerlman06TIFF.jpg","page_title":"론 펄먼","context_page_description":"로널드 프랜시스 \\"론\\" 펄먼 은 미국의 텔레비전, 영화 배우이자 성우이다. 《미녀와 야수》의 빈센트, 《썬즈 오브 아나키》의 클래이 모로우, 《헬보이》와 속편 《헬보이 2:골든 아미》의 헬보이역으로 유명하다."},{"page_url":"https://sk.wikipedia.org/wiki/IPod_classic","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c7/IPodphoto4G_1.png","page_title":"IPod classic","context_page_description":"iPod Classic je multimediálny prehrávač od firmy Apple. Je súčasťou rodiny iPod. Ide o jediný prehrávač od Applu, ktorý používa ako pamäťové médium hard disk a vďaka tomu dosahuje najvyšších kapacít. V túto chvíľu ako jediný využíva typické ovládacie koliesko \\"Click Wheel\\". Má svoj špeciálny firmware, teda nepoužíva iOS. Dokáže prehrať ako zvukové, tak aj video súbory. Systém obsahuje aj hry ktoré však už nemožno ďalej doinštalovávať. Farebný displej sa začal používať s príchodom iPodu classic 4. generácie a to až v jeho \\"prémiovej\\" verzii Photo, až do štvrtej generácie bol displej monochromatický. Celkovo bolo vydaných 6 generácií. Posledná sa predávala v striebornej a čiernej variante. Celkovo ide o prvý iPod, ktorý sa začal predávať už v roku 2001 so sloganom \\"tisíc skladieb vo tvojom vrecku\\". V priebehu, keď bola 4. generácia aktuálna, z nej vznikli ďalšie modely, a to \\"photo\\" a \\"color\\". Apple 9. septembra 2014 prestal iPod classic oficiálne predávať, bez uvedenia priameho nástupcu.\\niPod 6. generácie z 160 GB pamäte, sa tak stal iPodom s najväčším úložiskom v histórii, zároveň tu bol naposledy použitý 30pinový Apple konektor a ovládacie koliesko Click Wheel."},{"page_url":"https://pl.wikipedia.org/wiki/Wrad%C5%BAajatra","image_url":"http://upload.wikimedia.org/wikipedia/commons/e/ec/Indischer_Maler_um_1760_65_001.jpg","page_title":"Wradźajatra","context_page_description":"Wradźajatra – pielgrzymka hinduistyczna przebiegająca w mieście Vrindavan i okolicy, spopularyzowana przez Narajanę Batta\\n– wisznuickiego świętego z XVI w.\\nCelem wradźajatry jest odwiedzenie miejsc związanych z lila Kryszny – pasterza, Radhy – żony innego hindusa i pasterek. Trasa prowadzi częścią miejską i przyległymi do Wrindawanu lasami. Pielgrzymi odwiedzają: stawy, strumienie, wzgórza, groty i świątynie związane z pobytem tam Kryszny. Odbywają się prelekcje i przedstawienia, prezentujące wydarzenia, które rozegrały się w danym miejscu, w oparciu o treść Bhagawatapurany."},{"page_url":"https://ms.wikipedia.org/wiki/Poland","image_url":"http://upload.wikimedia.org/wikipedia/commons/5/5f/LocationPoland.png","page_title":"Poland","context_page_description":"Poland atau secara rasminya, Republik Poland merupakan sebuah negara yang terletak di Eropah Tengah yang menghadap ke Laut Baltik di utara. Poland bersempadan dengan negara Jerman di barat, Republik Czech dan Slovakia di selatan, Ukraine dan Belarus di timur dan Laut Baltik, Kaliningrad dan Lithuania di sebelah utara. Keluasan negara Poland ialah 312,696 kilometer persegi menjadikan ia negara ke-69 terbesar di dunia dan kesembilan terbesar di Eropah. Dengan jumlah populasi kira-kira 38.5 juta orang, Poland merupakan negara ke-34 terpadat di dunia dan kelapan terpadat di Eropah. Poland juga merupakan sebuah negara kesatuan yang dibahagikan kepada 16 pentadbiran subbahagian.\\nPenubuhan negeri-negeri Poland dapat diimbas pada tahun 966 apabila Raja Mieszko I memerintah negara moden Poland dan memeluk agama Kristian. Kerajaan Poland telah ditubuhkan pada tahun 1025 dan pada tahun 1569, Poland mengeratkan hubungan politik dengan Duchi Agung Lithuania selepas menandatangani Perjanjian Lublin. Kedua-dua negara ini kemudian membentuk Komanwel Poland–Lithuania, salah satu kerajaan terbesar dan terpadat pada abad ke-16 dan ke-17 di Eropah."},{"page_url":"https://fr.wikipedia.org/wiki/Henri_Duhem","image_url":"http://upload.wikimedia.org/wikipedia/commons/a/af/Henri_DUHEM_-_troupeau_%C3%A0_la_tomb%C3%A9e_du_jour_VA.JPG","page_title":"Henri Duhem","context_page_description":"Henri Duhem, né à Douai le 7 avril 1860 et mort à Juan-les-Pins le 24 octobre 1941, est un peintre et écrivain français."},{"page_url":"https://nl.wikipedia.org/wiki/Europese_Commissie","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d2/Belgique_-_Bruxelles_-_Schuman_-_Berlaymont_-_01.jpg","page_title":"Europese Commissie","context_page_description":"De Europese Commissie is het uitvoerende orgaan van de Europese Unie. Ze is verantwoordelijk voor het indienen van wetsvoorstellen, het beheren van de EU-begroting, het handhaven van het EU-recht, en het vertegenwoordigen van de EU op internationaal niveau.\\nDe voorzitter en de leden van de Commissie worden door de lidstaten benoemd na goedkeuring door het Europees Parlement. De Commissie zetelt in het Berlaymontgebouw in Brussel, dat vaak de de facto hoofdstad van Europa wordt genoemd. De huidige Commissie wordt voorgezeten door Ursula von der Leyen."},{"page_url":"https://ca.wikipedia.org/wiki/Vall_de_Cad%C3%AD","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/ad/Vista_de_la_vall_de_Cad%C3%AD_amb_neu_des_del_coll_Barbet_%28cropped%29.jpeg","page_title":"Vall de Cadí","context_page_description":"La Vall de Cadí és una vall del massís del Canigó, dins el terme de Castell de Vernet a la Catalunya Nord, al nord de la pica del Canigó, la qual, juntament amb els pics de Gasamir, Sec, de Tretzevents, de Rojat i de Sethomes, forma el circ de Cadí, al fons del qual, a 2.359 m d'altitud, hi ha els estanyols de Cadí. És drenada pel riu de Cadí, el qual, amb el riu de la Llipodera, forma la capçalera del riu Major, afluent de la Tet."},{"page_url":"https://sv.wikipedia.org/wiki/Ingrid_Kallenb%C3%A4ck","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f8/Ingrid_Kallenb%C3%A4ck.JPG","page_title":"Ingrid Kallenbäck","context_page_description":"Ingrid Kallenbäck född 1955 i Motala, är en svensk författare. Hon är syster till skådespelaren Helena Kallenbäck."},{"page_url":"https://ka.wikipedia.org/wiki/%E1%83%93%E1%83%98%E1%83%93%E1%83%98_%E1%83%9D%E1%83%A7%E1%83%90%E1%83%A0%E1%83%98","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a7/Ardea_alba_distribution_in_Georgia.svg","page_title":"დიდი ოყარი","context_page_description":"დიდი ოყარი, დიდი თეთრი ყანჩა — ფრინველი ყანჩისებრთა ოჯახისა. ადრე შედიოდა ოყარის გვარში. დიდი ზომის ფრინველია. სხეულის სიმაღლეა 94–104 სმ, ფრთების შლილი 131–145 სმ, მასა 912–1140 გრამი. აქვს თეთრი ბუმბული, გრძელი შავი ფეხები და ყვითელი ნისკარტი, რომელიც შეჯვარების პერიოდში მოყვითალო უხდება. გავრცელებულია დასავლეთ და აღმოსავლეთ ნახევარსფეროს ზომიერ და ტროპიკულ სარტყლებში. ბინადრობს წყალსატევებთან ახლოს, როგორც სანაპირო ზოლთან, ისე კონტინენტის შიდა ადგილებში. საქართველოში გვხვდება როგორც მობუდარი გადამფრენი ან, ზოგჯერ, მობინადრე ფრინველი. აღწევს ზღვის დონიდან 1800 მეტრამდე. ჩრდილოეთით მობუდარი პოპულაცია გადამფრენია, დანარჩენის დიდი ნაწილი — მკვიდრი. დროს ხეებზე ატარებს. ფრენისას უკან სწევს თავს და კისერს ლათინური S-ის ფორმას აძლევს. სეზონურად მონოგამური ფრინველია; სქესობრივ სიმწიფეს 2 წელში აღწევს. ბუდობს კოლონიებად, ხშირად სხვა ყანჩებთან ერთად. ბუდეს, ერთ ადგილზე შეგროვილ ჯოხებისა და ტოტების გროვას, აგებს ნაყარ ლერწამზე, მიწაზე ან ხეზე. დებს 3–6 მოცისფრო-მწვანე კვერცხს. ორივე მშობელი კრუხობს 23–26 დღის განმავლობაში. ბარტყები 42–49 დღეში ბუმბულით იმოსებიან, 7 კვირაში ფრენას სწავლობენ. ძირითად შემთხვევაში მხოლოდ ერთი ბარტყი აღწევს ზრდასრულობამდე."},{"page_url":"https://en.wikipedia.org/wiki/Sir_William_Pearce,_1st_Baronet","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/44/William_Pearce.jpg","page_title":"Sir William Pearce, 1st Baronet","context_page_description":"Sir William Pearce, 1st Baronet was a British shipbuilder, under whose management the Fairfield Shipbuilding and Engineering Company in Govan on the River Clyde became the leading shipbuilding company in the world. He was later a Conservative Party politician."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Baudenkm%C3%A4ler_in_Thalkirchen","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/20/Villa_M%C3%BCnchen_Thalkirchen_Heilmannstr.19.jpg","page_title":"Liste der Baudenkmäler in Thalkirchen","context_page_description":"Auf dieser Seite sind die Baudenkmäler im Münchner Stadtteil Thalkirchen im Stadtbezirk 19 Thalkirchen-Obersendling-Forstenried-Fürstenried-Solln aufgelistet. Zu diesen Baudenkmälern gibt es auch eine Bildersammlung und ein Fotoalbum mit ausgewählten Bildern.\\nDiese Liste ist Teil der Liste der Baudenkmäler in München. Grundlage ist die Bayerische Denkmalliste, die auf Basis des bayerischen Denkmalschutzgesetzes vom 1. Oktober 1973 erstmals erstellt wurde und seither durch das Bayerische Landesamt für Denkmalpflege geführt und aktualisiert wird. Die folgenden Angaben ersetzen nicht die rechtsverbindliche Auskunft der Denkmalschutzbehörde."},{"page_url":"https://it.wikipedia.org/wiki/Elvir_Boli%C4%87","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/03/Elvir_Boli%C3%A7.jpg","page_title":"Elvir Bolić","context_page_description":"Elvir Bolić è un ex calciatore bosniaco, di ruolo attaccante."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%92%D1%83%D0%BB%D0%B8%D1%86%D1%8F_%D0%9A%D1%83%D0%BB%D0%B8%D0%BA%D1%96%D0%B2%D1%81%D1%8C%D0%BA%D0%B0_(%D0%A5%D0%B0%D1%80%D0%BA%D1%96%D0%B2)","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d3/%D0%A3%D0%BA%D1%80%D0%B0%D1%97%D0%BD%D0%B0%2C_%D0%A5%D0%B0%D1%80%D0%BA%D1%96%D0%B2%2C_%D0%B2%D1%83%D0%BB._%D0%9C%D0%B5%D0%BB%D1%8C%D0%BD%D0%B8%D0%BA%D0%BE%D0%B2%D0%B0%2C_12_%D1%84%D0%BE%D1%82%D0%BE_1.JPG","page_title":"Вулиця Куликівська (Харків)","context_page_description":"Ву́лиця Куликі́вська — вулиця у Київському районі Харкова. Починається від вул. Громадянської і йде на північний схід до вул. Дарвіна. Від початку і до перехрестя з вул. Маршала Бажанова рух на Куликівській вулиці односторонній, з напрямком до вул. Громадянської. Між вулицями Маршала Бажанова і Дарвіна рух на Куликівській двосторонній."},{"page_url":"https://ko.wikipedia.org/wiki/%ED%8A%B8%EB%A6%AC%EC%8A%88%EB%9D%BC","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/cb/Trishula.svg","page_title":"트리슈라","context_page_description":"트리슈라는 힌두교의 파괴신 시바가 지닌 아스트라의 일종인 삼지창이자 링가와 함께 시바 신의 가장 대표적인 상징이다. 트리슈라의 세 갈래 끝은 샤크티이거나 이차, 즈나나, 크리야을 나타내며 가끔씩 다마루란 작은 북을 달고 있는 경우가 있다. 사두들에게서도 많이 볼 수 있다.또한 파슈파타와 함께 시바의 가장 대표적인 아스트라이며, 신화에 따르면 시바는 창조의 신 브라흐마의 가호를 받던 아수라들이 다스리던 도시들인 금으로 된 도시, 은으로 된 도시, 철로 된 도시를 이 트리슈라로 단 한 방에 모두 불태워버렸다고 한다."},{"page_url":"https://de.wikipedia.org/wiki/Salon_3_sa_85","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/15/Salonwagen_447_innen_-_Verkehrsmuseum_Dresden_11.jpg","page_title":"Salon 3 sa 85","context_page_description":"Der Salonwagen Salon 3 mit der Wagennummer 447 ist das letzte erhalten gebliebene Exemplar aus dem sächsischen Hofzug."},{"page_url":"https://de.wikipedia.org/wiki/Plo%C3%ABrmel","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/33/Ploermel_Eglise.JPG","page_title":"Ploërmel","context_page_description":"Ploërmel ist eine französische Gemeinde mit 9.890 Einwohnern im Département Morbihan in der Region Bretagne. Sie gehört zum Arrondissement Pontivy und zum Kanton Ploërmel.\\nSie entstand mit Wirkung vom 1. Januar 2019 als namensgleiche Commune nouvelle durch die Zusammenlegung der bisherigen Gemeinden Ploërmel und Monterrein. Nur Monterrein hat in der neuen Gemeinde den Status einer Commune déléguée."},{"page_url":"https://zh.wikipedia.org/wiki/%E7%96%8F%E6%95%A3%E6%98%9F%E5%9B%A2","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/27/Open_cluster_HR_diagram_ages.gif","page_title":"疏散星团","context_page_description":"疏散星團，也稱為銀河星團，是由同一個巨分子雲中的數百顆至數千顆恆星形成的集團。在銀河系中發現的疏散星團已經超過1,100個，並且被認為還存在更多。它們環繞著銀河中心運轉時，只靠著微弱的引力吸引維繫在一起，並且很容易因為與其它集團或氣體雲的近距離接觸而瓦解。疏散星團的壽命通常只有幾億年，但少數質量特別大的可以存活數十億年。相較之下，質量更大的球狀星團，擁有更多的恆星，成員彼此間的引力極為強大，可以存活的時間也更長。只有在星系的螺旋臂和不規則星系能發現疏散星團，它們只存在於恆星形成活躍區。\\n年輕的疏散星團可能仍然在它們形成的分子雲中，照亮它們在分子雲內創造出來的H II區。隨著時間推移，來自星團的輻射壓會將分子雲吹散。通常情況下，在輻射壓將氣體驅散之前，大約有10%質量的氣體能凝聚形成恆星。\\n疏散星團是研究恆星演化的關鍵天體。因為集團中的恆星成員年齡和化學成分都相仿，它們的特性也比單獨的恆星容易測量。有些疏散星團，像是昴宿星團、畢宿星團或英仙α星團，都可以用裸眼直接看見。還有一些，例如雙星團，則幾乎不用儀器也可以察覺它們的存在，而使用雙筒望遠鏡或光學望遠鏡還可以看見更多，野鴨星團，M11，就是個例子。"},{"page_url":"https://en.wikipedia.org/wiki/Italian_nationalism","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/89/Pascal_Paoli01.jpg","page_title":"Italian nationalism","context_page_description":"Italian nationalism is a movement which claims that the Italians are a nation with a single homogeneous identity, and therefrom seeks to promote the cultural unity of Italy as a country. From an Italian nationalist perspective, Italianness is defined as claiming cultural and ethnic descent from the Latins, an Italic tribe which originally dwelt in Latium and came to dominate the Italian peninsula and much of Europe. Because of that, Italian nationalism has also historically adhered to imperialist theories. The romantic version of such views is known as Italian patriotism, while their integral version is known as Italian fascism.\\nItalian nationalism is often thought to trace its origins to the Renaissance, but only arose as a political force in the 1830s under the leadership of Giuseppe Mazzini. It served as a cause for Risorgimento in the 1860s to 1870s. Italian nationalism became strong again in World War I with Italian irredentist claims to territories held by Austria-Hungary, and during the era of Italian Fascism."},{"page_url":"https://de.wikipedia.org/wiki/Olympische_Sommerspiele_2012/Leichtathletik_%E2%80%93_Marathon_(Frauen)","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ed/Katar%C3%ADna_Bere%C5%A1ov%C3%A1.jpg","page_title":"Olympische Sommerspiele 2012/Leichtathletik – Marathon (Frauen)","context_page_description":"Der Marathonlauf der Frauen bei den Olympischen Spielen 2012 in London wurde am 5. August 2012 auf einem Kurs in der Innenstadt von London ausgetragen. 118 Athletinnen nahmen teil, von denen 107 das Ziel erreichten.\\nOlympiasiegerin wurde die Äthiopierin Tiki Gelana. Die Kenianerin Priscah Jeptoo gewann die Silbermedaille, Bronze errang die Russin Tatjana Petrowa.\\nFür Deutschland starteten Susanne Hahn und Irina Mikitenko. Hahn erreichte das Ziel auf Platz 32, Mikitenko auf Platz vierzehn.\\nDie Schweizerin Maja Neuenschwander belegte Rang 53, die Österreicherin Andrea Mayr Rang 54.\\nAthletinnen aus Liechtenstein nahmen nicht teil."},{"page_url":"https://fr.wikipedia.org/wiki/M%C3%A2t_tot%C3%A9mique","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0e/Centro_hist%C3%B3rico_de_Skagway%2C_Alaska%2C_Estados_Unidos%2C_2017-08-18%2C_DD_38.jpg","page_title":"Mât totémique","context_page_description":"Un mât totémique est une sculpture monumentale qui se présente sous la forme de poteaux en bois – généralement du thuya géant – sculpté et décoré de symboles et de figures par les peuples amérindiens de la côte Nord-Ouest du Pacifique. Un mât totémique n'est pas un objet religieux ; il sert plutôt d'emblème pour les familles ou pour commémorer des événements historiques.\\nIl peut mesurer plusieurs dizaines de mètres. De par sa composition et la rigueur du climat dans cette région du monde, il a une durée de vie limitée, de l'ordre d'une soixantaine d'années."},{"page_url":"https://ru.wikipedia.org/wiki/6_%D0%BC%D0%B0%D1%8F","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/16/S.George_%28Russian_North%2C_end_15-early_16th_c.%2C_GTG%29.jpg","page_title":"6 мая","context_page_description":"6 мая — 126-й день года в григорианском календаре.\\nДо конца года остаётся 239 дней.\\nДо 15 октября 1582 года — 6 мая по юлианскому календарю, с 15 октября 1582 года — 6 мая по григорианскому календарю.\\nВ XX и XXI веках соответствует 23 апреля юлианского календаря."},{"page_url":"https://cs.wikipedia.org/wiki/Prose%C4%8D_(%C5%BDernov)","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0d/P%C5%99edn%C3%AD_Prose%C4%8D_-_k%C5%99%C3%AD%C5%BEek.jpg","page_title":"Proseč (Žernov)","context_page_description":"Proseč je malá vesnice, část obce Žernov v okrese Semily. Nachází se asi 1 km na východ od Žernova. Je zde evidováno 9 adres. Trvale zde žije 11 obyvatel.\\nProseč leží v katastrálním území Žernov o výměře 4,85 km²."},{"page_url":"https://tr.wikipedia.org/wiki/Kii_Da%C4%9Flar%C4%B1%27ndaki_Kutsal_Yerler_ve_Hac_Yollar%C4%B1","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/03/Kinpusenji_Yoshino_Nara02n4272.jpg","page_title":"Kii Dağları'ndaki Kutsal Yerler ve Hac Yolları","context_page_description":"Kii Dağları'ndaki Kutsal Yerler ve Hac Yolları, Japonya'nın Kii Yarımadası üzerinde yer alan bir UNESCO Dünya Mirası Alanı'dır."},{"page_url":"https://fi.wikipedia.org/wiki/The_Time_of_Our_Lives","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/25/Miley_Cyrus_singing_%22When_I_Look_at_You%22_during_the_Wonder_World_Tour_concert_in_Portland%2C_Oregon.jpg","page_title":"The Time of Our Lives","context_page_description":"The Time of Our Lives on Miley Cyrusin vain Wal-Marteissa ilmestynyt EP, joka julkaistiin 31. elokuuta 2009. Se on Cyrusin ensimmäinen EP, jolla on kokonaan hänen kappaleitaan eikä se sisällä ollenkaan Hannah Montanan kappaleita. Albumi sisältää Cyrusin hitin Party in the U.S.A. Kappaleet kertovat rakkaudesta ja Cyrusin omasta elämästä.\\nElokuvassa The Last Song on mukana Cyrusin kappale When I Look at You. Cyrus esittää kappaleen \\"Before the storm\\" yhdessä Nick Jonasin kanssa, jonka kanssa hän erosi vuonna 2007."},{"page_url":"https://en.wikipedia.org/wiki/Black_Mountains_(California)","image_url":"http://upload.wikimedia.org/wikipedia/commons/1/13/Wpdms_shdrlfi020l_death_valley.jpg","page_title":"Black Mountains (California)","context_page_description":"The Black Mountains are a mountain range located in the southeastern part of Inyo County, California, within southeastern Death Valley National Park."},{"page_url":"https://ja.wikipedia.org/wiki/%E6%97%A5%E6%9C%AC%E3%82%92%E5%85%83%E6%B0%97%E3%81%AB%E3%81%99%E3%82%8B%E4%BC%9A","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fb/2010%E5%B9%B4%E4%BB%A3%E3%81%AE%E7%AC%AC%E4%B8%89%E6%A5%B5.png","page_title":"日本を元気にする会","context_page_description":"日本を元気にする会は、かつて存在した日本の政党・政治団体。政党略称は、元気にする会、元気会、元気。1字表記の際は、気と表記される。\\nなお、2005年に設立された同名の特定非営利活動法人があるが無関係。こちらの読みは「にほんをげんきにするかい」である。"},{"page_url":"https://fr.wikipedia.org/wiki/Liste_des_monuments_historiques_de_Nantes","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/62/Immeuble_6_place_du_Bouffay_-_Nantes.jpg","page_title":"Liste des monuments historiques de Nantes","context_page_description":"Cet article recense les monuments historiques de Nantes, en France."},{"page_url":"https://es.wikipedia.org/wiki/Betsy_Jones-Moreland","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/50/BetsyJonesMoreland1.jpg","page_title":"Betsy Jones-Moreland","context_page_description":"Betsy Jones-Moreland fue una actriz que nació el 1 de abril de 1930 en Brooklyn, Nueva York. Su nombre de nacimiento era Mary Elizabeth Jones. Desarrolló su carrera entre 1956 y 1993 participando en varias películas y series televisivas."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Stolpersteine_in_Frankfurt-Westend","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1b/Bockenheimer_landstr_91.jpg","page_title":"Liste der Stolpersteine in Frankfurt-Westend","context_page_description":"Die Liste der Stolpersteine in Frankfurt am Main führt die vom Künstler Gunter Demnig verlegten Stolpersteine in Frankfurt am Main auf. Die Initiative Stolpersteine in Frankfurt am Main e. V. hat seit November 2003 die Verlegung von fast 1500 Stolpersteinen veranlasst. Die Initiative wird von der Stadt Frankfurt sowie von zahlreichen Institutionen, darunter das Jüdische Museum und das Institut für Stadtgeschichte unterstützt. Mehr Stolpersteine als in Frankfurt gibt es nur in Berlin, Hamburg und Köln.\\nIn der Zeit des Nationalsozialismus wurden 10.231 Juden aus Frankfurt am Main von der Großmarkthalle als Sammelpunkt deportiert. Davon wurden rund 9.500 ermordet. Bei der Verlegung im Oktober 2018 in Frankfurt wurde der siebzigtausendste Stein verlegt.\\nDie Stadtteile sind nach der Liste der Stadtteile von Frankfurt am Main angelegt. Die Ortsteile ohne Verlinkung haben keine Stolpersteine."},{"page_url":"https://sr.wikipedia.org/wiki/%D0%A1%D0%BB%D0%BE%D0%B1%D0%BE%D0%B4%D0%B0%D0%BD_%D0%90%D0%BD%D1%82%D0%BE%D0%BD%D0%B8%D1%9B","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fa/Slobodan_Antoni%C4%87.jpg","page_title":"Слободан Антонић","context_page_description":"Слободан Антонић је српски политиколог, социолог, политички аналитичар и универзитетски професор."},{"page_url":"https://ja.wikipedia.org/wiki/Arithmetica_Universalis","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/51/Arithmetica.jpg","page_title":"Arithmetica Universalis","context_page_description":"Arithmetica Universalis はアイザック・ニュートンによる数学書。原文はニュートンの講義ノートを基にラテン語で書かれ、ウィリアム・ホイストン によって編集、出版された。ホイストンはニュートンからケンブリッジ大学のルーカス教授職を継いだ人である。\\nホイストンによる初版は1707年に出版され、ジョセフ・ラフソン によって翻訳された英語版は Universal Arithmetick の題で1720年に出版された。また、ラテン語第二版はジョン・マチン によって1722年に出版されている。\\nニュートン自身は Arithmetica の出版に不満を持っており、彼の名前が記されることを頑なに拒否したため、これらの版のいずれもニュートンの名は著者として記されていない。\\n実際、ホイストンによる初版が出版されたときニュートンは非常に狼狽し、刊行されたものすべてを買い占め、処分することを考えたという。\\nArithmetica には代数における記法、算術、幾何学と代数学の関係、方程式の解についてが記されている。ニュートンはデカルトの符号律を複素数根について適用し、代数方程式の複素数根の個数が符号律から決まることを、証明なしに要請している。150 年間、このニュートンの方法に厳密な証明が与えられることはなかった 。"},{"page_url":"https://simple.wikipedia.org/wiki/RAF_Down_Ampney","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/ae/RAF_Down_Ampney_-_4_Dec_1943_Airphoto.jpg","page_title":"RAF Down Ampney","context_page_description":"RAF Down Ampney was a Royal Air Force station. It was near Cricklade, Gloucestershire, England. Down Ampney was built in February 1944 and it was closed down in February 1947. It was used during World War II.\\nThe airfield was part of a group of three airfields. The other two were RAF Broadwell and RAF Blakehill Farm. The job of these three airfields was to transport things by air."},{"page_url":"https://nl.wikipedia.org/wiki/Lijst_van_onroerend_erfgoed_in_Roosdaal","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9e/Roosdaal_zicht_op_dorpskern_Strijtem_-_208153_-_onroerenderfgoed.jpg","page_title":"Lijst van onroerend erfgoed in Roosdaal","context_page_description":"Een overzicht van het onroerend erfgoed in de gemeente Roosdaal. Het onroerend erfgoed maakt deel uit van het cultureel erfgoed in België."},{"page_url":"https://hu.wikipedia.org/wiki/Technof%C3%B3bia","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6e/FrameBreaking-1812.jpg","page_title":"Technofóbia","context_page_description":"A technofóbia görög szó a „τέχνη - tekhné”, és a „φόβος - phobosz” szavakból alkották és habár a jelenség tömegesen az ipari forradalom idején jelenik meg, maga a kifejezés a 60-as évekből ered."},{"page_url":"https://ja.wikipedia.org/wiki/%E3%82%A2%E3%83%96%E3%83%89%E3%82%A5%E3%83%A9%E3%82%A4%E3%82%A7%E3%83%BB%E3%83%89%E3%82%A5%E3%82%AF%E3%83%AC","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/73/Stade_rennais_-_Le_Havre_AC_20150708_40.JPG","page_title":"アブドゥライェ・ドゥクレ","context_page_description":"アブドゥライェ・ドゥクレは、フランス共和国イヴリーヌ県ムラン＝アン＝イヴリーヌ出身のサッカー選手。プレミアリーグ・ワトフォードFC所属。ポジションはMF。"},{"page_url":"https://en.wikipedia.org/wiki/Saint-Malo_Cathedral","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/25/Procession_des_saints_de_Bretagne_-_dioc%C3%A8se_de_Saint-Malo%2C_cath%C3%A9drale_saint_Pierre%2C_Rennes%2C_France.jpg","page_title":"Saint-Malo Cathedral","context_page_description":"Saint-Malo Cathedral is a Roman Catholic Cathedral located in Saint-Malo, Brittany. The church was founded in dedication to Saint Vincent of Saragossa, and constitutes a national monument of France. It was built in a mix of Roman and Gothic styles during the episcopacy of Jean de Châtillon on the site of an ancient church founded in the 7th-century. The cathedral suffered damage during WW2 when the steeple toppled onto the Sacred Heart Chapel. An organ which had been built in 1893 by Louis Debierre was destroyed. On 21 May 1972, after twenty-eight years of work, a ceremony was held to celebrate the completion of the restoration."},{"page_url":"https://be.wikipedia.org/wiki/%D0%A2%D1%80%D1%8B_%D0%BA%D0%B0%D1%80%D1%8D%D0%B9%D1%81%D0%BA%D1%96%D1%8F_%D0%B4%D0%B7%D1%8F%D1%80%D0%B6%D0%B0%D0%B2%D1%8B","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a4/Three_Kingdoms_of_Korea_Map_rus.PNG","page_title":"Тры карэйскія дзяржавы","context_page_description":"«Тры карэйскія дзяржавы» — назва раннефеадальных карэйскіх дзяржаў Кагуро, Пэкчэ і Сіла, якія ў перыяд з I стагоддзя да н.э. па VII стагоддзе н.э. займалі Карэйскі паўвостраў і Маньчжурыю. Гэтыя дзяржавы склаліся падчас барацьбы супраць кітайскіх заваёўнікаў. У так званы перыяд трох дзяржаў і раней тут таксама існавалі іншыя, драбнейшыя племянныя адукацыі і дзяржавы, у тым ліку Кая, Тан'е, Акчо, Пуё, Асан, Тамна і г. д.\\nПаводле летапіснай традыцыі, перыяд трох дзяржаў пачаўся ў 57 годзе да н.э., калі дзяржава Саро у паўднёва-ўсходняй частцы паўвострава дамаглося аўтаноміі ад кітайскай імперскай дынастыі Хань. Дзяржава Кагуро, размешчаная на поўнач і поўдзень ад ракі Ялуцзян, якая ў наш час аддзяляе Кітай ад КНДР, дамаглася незалежнасці ад Кітая ў 37 да н.э.. У 18 да н.э. два сына кіраўніка Кагуро, не жадаючы ваяваць за спадчыну, беглі з краіны і заснавалі дзяржаву Пэкчэ на паўднёвым захадзе паўвострава. Сталіцай Пэкчэ з'яўляўся Хансон, а пасля — Унчхон, і нарэшце — Сабуры. У I стагоддзі н.э. ад Пэкчэ аддзялілася Кая.\\nПадзенне Ханскай дынастыі напачатку III стагоддзя пазбавіла тры карэйскія дзяржавы неабходнасці супрацьстаяць знешняй пагрозе."},{"page_url":"https://de.wikipedia.org/wiki/Ancona_(Huhn)","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b5/Free_range_hen_at_Glencat_-_geograph.org.uk_-_869918.jpg","page_title":"Ancona (Huhn)","context_page_description":"Das Ancona ist eine Rasse des Haushuhnes und hat seinen Namen von der italienischen Provinz Ancona. Aufgrund seiner verwandtschaftlichen Beziehung zum Leghorn wird es auch als „schwarzes Leghorn“ bezeichnet und den Legerassen zugerechnet. Britische Züchter brachten diese Landrasse im 19. Jahrhundert nach Großbritannien und von dort aus gelangte es in andere europäische Länder und in die USA. Aufgrund seiner hohen Legeleistung von ca. 220 weißen Eiern pro Jahr ist es über seine Heimat Italien hinaus beliebt und verbreitet.\\nDas Ancona gilt als attraktives, kleines keckes und widerstandsfähiges Huhn mit guten Flugeigenschaften und eher schwach ausgeprägtem Bruttrieb. Die Ursprungsrasse war schwarz-weißgescheckt, der später entwickelte Farbenschlag blau-weißgescheckt wird nicht in allen nationalen Zuchtverbänden als zugelassener Rassenstandard anerkannt. Bei jungen Hühnern sind die weißen Flecken noch nicht stark ausgeprägt, mit jeder Mauser zeigen sich diese Flecken jedoch ausgeprägter. Zu den charakteristischen Merkmalen der Rasse gehören die gelben Beine. Beide Geschlechter haben einen großen, roten Einfachkamm, der bei legenden Hennen am hinteren Ende leicht zur Seite geneigt ist."},{"page_url":"https://zh.wikipedia.org/wiki/%E8%A7%80%E9%9F%B3%E6%B5%B7%E5%B2%B8%E9%87%8E%E7%94%9F%E5%8B%95%E7%89%A9%E9%87%8D%E8%A6%81%E6%A3%B2%E6%81%AF%E7%92%B0%E5%A2%83","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d1/%E8%A7%80%E9%9F%B3%E6%B5%B7%E5%B2%B8%E9%87%8E%E7%94%9F%E5%8B%95%E7%89%A9%E9%87%8D%E8%A6%81%E6%A3%B2%E6%81%AF%E7%92%B0%E5%A2%832017e.jpg","page_title":"觀音海岸野生動物重要棲息環境","context_page_description":"觀音海岸野生動物重要棲息環境位於臺灣宜蘭縣南澳鄉，為依據《野生動物保育法》公告之野生動物重要棲息環境。北自南澳溪口，南迄觀音隧道南口，西面約從海岸山脈─南山間嶺線起往東至太平洋海濱，呈南北狹長帶狀，面積519公頃，有台9線蘇花公路經過。\\n本區範圍南北全長約8,500公尺，南界最高點920公尺，北界最高點瞭望台382公尺。最寬處在南界上，水平投影寬度1,500公尺，最窄處在萼溫斷層中段，水平寬度約250公尺。當地東臨太平洋，沙灘以礫石為主，礫灘寬度極小，海浪可以直淘山波，造成許多海蝕洞、海蝕凹穴和崩落現象。本區地形陡峭，常有崩塌地產生，植被多由崩塌地引發演替而來。陽性植物及一、二年生草本植物頗為常見，海濱植物因受地形限制，並不發達。"},{"page_url":"https://pl.wikipedia.org/wiki/Suzuki_XL-7","image_url":"http://upload.wikimedia.org/wikipedia/commons/1/19/2007-Suzuki-XL7-2.jpg","page_title":"Suzuki XL-7","context_page_description":"Suzuki XL-7 – flagowy model Suzuki na rynek amerykański. Jego linia nadwozia jest odmienna od dotychczasowej, właściwej dla serii Grand Vitara.\\nNapęd – 4x4, maksymalny moment obrotowy – 231 Nm, średnica zawracania – 11,8 m, objętość bagażnika – 187 dm³, ładowność – 535 kg, prędkość maksymalna – 175 km/h."},{"page_url":"https://en.wikipedia.org/wiki/Miramar_Air_Show","image_url":"http://upload.wikimedia.org/wikipedia/commons/3/3f/US_Navy_061014-M-3968C-034_Two_CH-46_Sea_Knights_land_on_the_flight_line_of_Marine_Corps_Air_Station_%28MCAS%29_Miramar_during_a_demonstration_of_how_a_Marine_Air-Ground_Task_Force_responds_when_called_upon_during_the_Miramar_Air_s.jpg","page_title":"Miramar Air Show","context_page_description":"The Miramar Air Show is an annual air show held at Marine Corps Air Station Miramar in San Diego, California. The three-day event is the largest military air show in the United States, with total annual attendance estimated at 700,000. The show is held in October each year. The 2011 show was the 56th edition of the event, and celebrated the 100th anniversary of naval aviation. In 2007, the Miramar Air Show was voted the \\"World's Best Military Air Show\\" by the International Council of Air Shows, the first time the award was given to a Marine Corps air station since 1994.\\nThe show includes a large selection of \\"static\\" displays representing aircraft from the United States Marine Corps, Navy, Army and Air Force, as well as civilian and historic military aircraft. Numerous commercial vendors, recruiting displays representing all of the United States armed forces, area law enforcement recruiters, civilian flight organizations and a business and franchise fair are also on site.\\nThe show's daily performance schedule includes military and civilian aircraft, usually highlighted by the U.S."},{"page_url":"https://la.wikipedia.org/wiki/Lycia","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a9/Sarkophag_in_Kas.jpg","page_title":"Lycia","context_page_description":"Lycia erat regio historica montana in parte meridionali et occidentali Asiae Minoris antiquae posita quae a meridie mari, a septentrione Pisidia, ab ortu solis Pamhylia, ab occasu Caria finiebatur. Secundo millenario ante Christum natum incolae lingua e Luvitica familia utebantur et eorum fines in monumentis Hetthaeorum regum, qui vicini eorum erant, Lukka dicebantur. Primo millenario parvi civitatum dynastae vel reguli de imperio certabant. Mox circa 540 a.C.n. a Persis subacti sunt ac deinde in dominationem Alexandri Magni, Ptolomaeorum, Seleucidarum, Rhodiorum venerunt. Postquam Romani eos a Rhodiorum dominatione liberaverunt confoederationem Lyciam instituerunt, per quam civitates Lyciae de communibus rebus deliberabant. Praecipuae civitates tum erant Patara, Tlos, Xanthus, Olympos, Pinara, Myra quae tria suffragia in consilio ponebant. Telmessos quoque in aliquo honore fuit. Quia socii fideles Romanorum erant diu speciem libertatis retinuerunt donec anno 43 ab imperatore Claudio in provinciam Romanam redigerentur. Tum iampridem incolae huius regionis Graece loquebantur."},{"page_url":"https://vi.wikipedia.org/wiki/Hesperilla_donnysa","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/00/Hesperilla_donnysa.JPG","page_title":"Hesperilla donnysa","context_page_description":"The Donnysa Skipper or Varied Sedge Skipper là một loài bướm ngày thuộc họ Hesperiidae. Nó được tìm thấy ở the Lãnh thổ Thủ đô Úc, New South Wales, Queensland, Nam Úc, Tasmania, Victoria và Tây Úc.\\nSải cánh dài khoảng 30 mm đối với con đực và 35 mm đối với con cái.\\nẤu trùng ăn various sword grass species, bao gồm Gahnia sieberiana. Other recorded food plants include Gahnia decomposita, Gahnia aspera, Gahnia clarkei, Gahnia deusta, Gahnia erythrocarpa, Gahnia filifolia, Gahnia grandis, Gahnia lanigera, Gahnia microstachya, Gahnia radula, Gahnia subaequiglumis và Gahnia trifida."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%9A%D1%83%D0%BB%D1%96%D1%88_%D0%9F%D0%B0%D0%BD%D1%82%D0%B5%D0%BB%D0%B5%D0%B9%D0%BC%D0%BE%D0%BD_%D0%9E%D0%BB%D0%B5%D0%BA%D1%81%D0%B0%D0%BD%D0%B4%D1%80%D0%BE%D0%B2%D0%B8%D1%87","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/06/P._kulish_young.jpg","page_title":"Куліш Пантелеймон Олександрович","context_page_description":"Пантелеймо́н Олекса́ндрович Кулі́ш — український письменник, фольклорист, етнограф, мовознавець, перекладач, критик, редактор, видавець, філософ історії. Активно сприяв розвиткові української літературної мови, науки, філософії, історії.\\nАвтор першої фонетичної абетки для української мови, яка лежить в основі сучасного українського правопису та мовлення.\\nІван Франко називав Куліша «перворядною зіркою» в українському письменстві, «одним із корифеїв нашої літератури». Відомий найбільше як перекладач Біблії та як автор першого українського історичного роману «Чорна рада». Писав українською та російською мовами.\\nЧлен Сербської академії наук та мистецтв."},{"page_url":"https://pl.wikipedia.org/wiki/Aleksiej_Aleluchin","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/03/%D0%90%D0%BB%D0%B5%D0%BA%D1%81%D0%B5%D0%B9_%D0%92%D0%B0%D1%81%D0%B8%D0%BB%D1%8C%D0%B5%D0%B2%D0%B8%D1%87_%D0%90%D0%BB%D0%B5%D0%BB%D1%8E%D1%85%D0%B8%D0%BD.jpg","page_title":"Aleksiej Aleluchin","context_page_description":"Aleksiej Wasiljewicz Aleluchin ros. Алексей Васильевич Алелюхин – radziecki pilot, as myśliwski II wojny światowej, generał major sił powietrznych ZSRR, dwukrotny Bohater Związku Radzieckiego."},{"page_url":"https://ar.wikipedia.org/wiki/%D9%83%D9%84%D9%8A%D9%81%D9%88%D8%B1%D8%AF_%D9%87%D9%86%D8%AA%D8%B1","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4a/Clifford_Lorrie_Hunter.jpg","page_title":"كليفورد هنتر","context_page_description":"كليفورد هنتر ‏ هو سياسي نيوزيلندي، ولد في 11 مايو 1900، وتوفي في 1 يوليو 1990 في أوكلاند في نيوزيلندا. نشط حزبياً في حزب العمال النيوزيلندي. وقد انتخب عضو مجلس النواب النيوزيلندي."},{"page_url":"https://nl.wikipedia.org/wiki/Laagri_(Tallinn)","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4b/Tallinn_%28town_sign%29.jpg","page_title":"Laagri (Tallinn)","context_page_description":"Laagri is een subdistrict of wijk binnen het stadsdistrict Nõmme in Tallinn, de hoofdstad van Estland. De wijk telde 906 inwoners op 1 januari 2017. De oppervlakte bedraagt 0,41 km²; de bevolkingsdichtheid is dus ongeveer 2.210/km²."},{"page_url":"https://de.wikipedia.org/wiki/Carl_Flemming_(Unternehmer)","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/31/1923-10-16_Keune%2C_Flemming_%26_Cie._Briefumschlag_an_Portland_Cementwerk_AG_in_Schwanebeck.jpg","page_title":"Carl Flemming (Unternehmer)","context_page_description":"Carl Flemming war ein deutscher Ingenieur, Industrieller, Verbandsfunktionär der Ziegel- und Ton-Industrie sowie Konsul."},{"page_url":"https://ca.wikipedia.org/wiki/V%C3%A1gs_B%C3%B3ltfelag","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fd/VB_V%C3%A1gur_womens_handball_team_with_silver_medals_2013.JPG","page_title":"Vágs Bóltfelag","context_page_description":"El Vágs Bóltfelag és un club feroès d'handbol de la ciutat de Vágur."},{"page_url":"https://no.wikipedia.org/wiki/T%C3%B8nsberg_reperbane","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/cf/T%C3%B8nsberg_Reperbane%2C_Kaldnes_%2814424497438%29.jpg","page_title":"Tønsberg reperbane","context_page_description":"Tønsberg reperbane er en reperbane, verksted for repslaging, det vil si produksjon av tauverk, på Kaldnes i Tønsberg i Vestfold. Den ble grunnlagt 1795/1796 av og er byens eldste eksisterende bedrift. Bedriften hadde på 1800-tallet et stort marked som leverandør av tauverk til byens seilskipsflåte og i første del av 1900-tallet til hvalfangsten.\\nBedriften ble i 2015 overtatt av det britiske selskapet Bridon, og har nå navnet Bridon Scanrope."},{"page_url":"https://fr.wikipedia.org/wiki/Kalu%C4%91erica_(Petrovo)","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3b/Ozren_02.jpg","page_title":"Kaluđerica (Petrovo)","context_page_description":"Kaluđerica est un village de Bosnie-Herzégovine. Il est situé dans la municipalité de Petrovo et dans la République serbe de Bosnie. Selon les premiers résultats du recensement bosnien de 2013, il compte 109 habitants.\\nSur le territoire du village se trouve le monastère d'Ozren."},{"page_url":"https://de.wikipedia.org/wiki/Architektur_Athens","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3c/Athens_Acropolis.jpg","page_title":"Architektur Athens","context_page_description":"Wer Athen vom Flugzeug oder einem der Hügel im Stadtgebiet betrachtet, dem präsentiert sich die Stadt als weißes Häusermeer von Appartementhäusern und Büros. Diese unstrukturierte Teppichästhetik ist zum einen auf das rasante Wachstum zurückzuführen, zum anderen auch auf die Bauordnung, die die Errichtung von dominanten Gebäuden zum Schutz der Akropolis als Wahrzeichen verhindert.\\nDrei architektonische Schwerpunkte Athens verdienen Beachtung:\\ndie Bauwerke der Antike,\\ndie klassizistischen Bauten aus der Mitte des 19. Jahrhunderts und\\ndie athenischen Interpretationen des modernen Appartementhauses, namentlich vor allem die Bauten bis ca. 1935."},{"page_url":"https://zh.wikipedia.org/zh-tw/%E4%B8%B9%E9%BA%A6%E5%9F%8E%E5%B8%82%E5%88%97%E8%A1%A8","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/11/Nyhavn-panorama.jpg","page_title":"丹麦城市列表","context_page_description":"以下為主要丹麥城市列表："},{"page_url":"https://en.wikipedia.org/wiki/P%C5%99%C3%ADlepy_(Rakovn%C3%ADk_District)","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/24/P%C5%99%C3%ADlepy_2015-09-28_1_Od_jihoz%C3%A1padu.jpg","page_title":"Přílepy (Rakovník District)","context_page_description":"Přílepy is a village and municipality in Rakovník District in the Central Bohemian Region of the Czech Republic."},{"page_url":"https://cs.wikipedia.org/wiki/Nov%C3%A1_Ves_u_Ch%C3%BDnova","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/04/Nov%C3%A1_Ves_u_Ch%C3%BDnova_CoA.jpg","page_title":"Nová Ves u Chýnova","context_page_description":"Obec Nová Ves u Chýnova se nachází v okrese Tábor v Jihočeském kraji. Žije v ní 326 obyvatel."},{"page_url":"https://it.wikipedia.org/wiki/The_Divorcee_(film_1919)","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5f/The_Divorcee_%281919%29_-_1.jpg","page_title":"The Divorcee (film 1919)","context_page_description":"The Divorcee è un film muto del 1919 diretto da Herbert Blaché sotto la supervisione di Maxwell Karger. La sceneggiatura di Katharine Kavanaugh e June Mathis si basa su Lady Frederick, lavoro teatrale di W. Somerset Maugham andato in scena in prima a Londra il 26 ottobre 1907. Prodotto e distribuito dalla Metro Pictures Corporation, il film aveva come interpreti Ethel Barrymore, E.J. Ratcliffe, Holmes Herbert, Naomi Childers, John Goldsworthy, Maude Turner Gordon."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%A2%D1%8C%D0%B5%D1%80%D1%80%D0%B0-%D0%B4%D0%B5-%D0%9C%D0%B5%D0%B4%D0%B8%D0%BD%D0%B0","image_url":"http://upload.wikimedia.org/wikipedia/commons/d/d1/Comarcas_de_Valladolid.svg","page_title":"Тьерра-де-Медина","context_page_description":"Тьерра-де-Медина — район в Испании, входит в провинцию Вальядолид в составе автономного сообщества Кастилия и Леон."},{"page_url":"https://gl.wikipedia.org/wiki/Interestatal_10","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/aa/Interstate_10%2C_Loop_202_%26_SR_51.jpg","page_title":"Interestatal 10","context_page_description":"A Interestatal 10 é a autoestrada interestatal de trazado leste-oeste máis ao sur dos Estados Unidos de América. Comeza preto do océano Pacífico na Ruta Estatal de California 1 en Santa Monica e discorre ata a Interestatal 95 en Jacksonville, Florida"},{"page_url":"https://et.wikipedia.org/wiki/Pinei%C3%B3s","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fc/Tempe1.jpg","page_title":"Pineiós","context_page_description":"Pineiós on ligikaudu 205 km pikkune jõgi Tessaalia tasandikul, mis suubub Egeuse merre. Jõgi on nime saanud vanakreeka jumaluse Peneiόsi järgi."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%9F%D0%BE%D0%B1%D1%8B%D0%B7%D0%B0%D0%BA%D0%BE%D0%B2,_%D0%9C%D0%B8%D1%85%D0%B0%D0%B8%D0%BB_%D0%A1%D1%82%D0%B5%D0%BF%D0%B0%D0%BD%D0%BE%D0%B2%D0%B8%D1%87","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a6/%D0%9F%D0%BE%D0%B1%D1%8B%D0%B7%D0%B0%D0%BA%D0%BE%D0%B2-_%D0%BF%D0%BE%D0%BB%D0%BD%D1%8B%D0%B9_%D0%BA%D0%B0%D0%B2%D0%B0%D0%BB%D0%B5%D1%80_%D0%BE%D1%80%D0%B4%D0%B5%D0%BD%D0%BE%D0%B2_%D0%A1%D0%BB%D0%B0%D0%B2%D1%8B.JPG","page_title":"Побызаков, Михаил Степанович","context_page_description":"Михаил Степанович Побызаков — ветеран войны и труда, участник Великой Отечественной войны. Полный кавалер ордена Славы. Почётный гражданин Республики Хакасия."},{"page_url":"https://es.wikipedia.org/wiki/Elecciones_generales_de_Palaos_de_1992","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f1/Ngiratkel.jpg","page_title":"Elecciones generales de Palaos de 1992","context_page_description":"Las quintas elecciones generales de Palaos se llevaron a cabo en 1992. Fueron las primeras elecciones realizadas después de la reforma constitucional de la administración de Ngiratkel Etpison, que incluía la posibilidad de un balotaje en las elecciones presidenciales y vicepresidenciales si ninguno de los candidatos obtenía mayoría absoluta, reforma que se debió a la propia victoria excesivamente ajustada de Etpison.​ La primera vuelta se llevó a cabo el 22 de septiembre, mientras que la segunda vuelta y las elecciones legislativas se realizaron el 5 de noviembre. Fueron también las primeras elecciones en las que el presidente saliente terminó su presidencia con vida, puesto que Haruo Remeliik y Lazarus Salii, los otros dos presidentes directamente electos, habían muerto de forma violenta en pleno ejercicio de sus mandatos, aunque Remeliik ya había completado un mandato constitucional, siendo reelegido un año antes de su muerte.​​\\nTodos los candidatos a todos los cargos se presentaron como independientes, debido a la intexistencia de partidos políticos en el país.​"},{"page_url":"https://la.wikipedia.org/wiki/Eduardus_Asbury_O%E2%80%99Neal","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/44/EAO%27Neal.jpg","page_title":"Eduardus Asbury O’Neal","context_page_description":"Eduardus Asbury O’Neal, causidicus et inter Bellum Civile Americanum Civitatum Confoederatarum Americae miles, fuit rerum politicarum peritus Americanus factionis Democraticae, qui inter alia ab anno 1882 usque ad annum 1886 Alabamae gubernator fuit. Etiam filius eius Emmet O’Neal Alabamae gubernator erit."},{"page_url":"https://sk.wikipedia.org/wiki/Kal%E2%80%99a_al-Hisn","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/88/Plan_du_Krak_des_Chevaliers_1170_1200.png","page_title":"Kal’a al-Hisn","context_page_description":"Kal’a al-Hisn alebo Kal’a al-Husn je jeden z najzachovalejších križiackych hradov v Sýrii.\\nHrad je od roku 2006 zapísaný na zozname svetového dedičstva UNESCO. Podľa agentúrnych správ prebiehali v roku 2012 v okolí pevnosti boje medzi vládnymi vojakmi a povstalcami, čo ohrozovalo existenciu tejto významnej pamiatky. Svedkovia uvádzali, že v stenách boli viditeľné stopy po streľbe a v okolí sa nachádzali krátery od delostreleckých granátov."},{"page_url":"https://no.wikipedia.org/wiki/Tsjortkiv","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d5/%C4%8Cortkiv%2C_celek%2C_kostel.jpg","page_title":"Tsjortkiv","context_page_description":"Tsjortkiv er en by i Ternopil oblast i det vestlige Ukraina. Byen er hovedstad i Tsjortkivski Region. Byen har rundt 30 000 innbyggere. Byen ligger ved Seretelven."},{"page_url":"https://fr.wikipedia.org/wiki/Chlamyde","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/ad/NAMA_Herm%C3%A8s_Tr%C3%A9z%C3%A8ne.jpg","page_title":"Chlamyde","context_page_description":"La chlamyde est un manteau militaire porté par les hommes dans la Grèce antique et plus précisément en Thessalie, puis par les Romains sous l'Empire byzantin."},{"page_url":"https://pl.wikipedia.org/wiki/Zamach_na_Reinharda_Heydricha","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d5/Atent%C3%A1t_na_Heydricha_-_zvl%C3%A1%C5%A1tn%C3%AD_vyd%C3%A1n%C3%AD.gif","page_title":"Zamach na Reinharda Heydricha","context_page_description":"Zamach na Heydricha – akcja zbrojna, likwidacja protektora Czech i Moraw z ramienia III Rzeszy, SS-Obergruppenführera Reinharda Heydricha. Zamach został przeprowadzony w Pradze-Libeniu przez żołnierzy emigracyjnego rządu Czechosłowacji, w maju 1942 r., pod kryptonimem Operacja Anthropoid."},{"page_url":"https://en.wikipedia.org/wiki/Vehicle_registration_plates_of_Saskatchewan","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/29/SASKATCHEWAN_1949_plate_%282151268093%29.jpg","page_title":"Vehicle registration plates of Saskatchewan","context_page_description":"The Canadian province of Saskatchewan first required its residents to register their motor vehicles and display licence plates in 1912. Plates are currently issued by Saskatchewan Government Insurance. Only rear plates have been required since June 30, 2004."},{"page_url":"https://de.wikipedia.org/wiki/Heinrich_Leonhard_Heubner","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/38/Heubner_HL_Wittenberg_Collegienstra%C3%9Fe54_Schild.jpg","page_title":"Heinrich Leonhard Heubner","context_page_description":"Heinrich Leonhard Heubner war ein deutscher lutherischer Theologe."},{"page_url":"https://sv.wikipedia.org/wiki/James_Gates_Percival","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/85/James_Gates_Percival_by_his_brother.png","page_title":"James Gates Percival","context_page_description":"James Gates Percival, född den 15 september 1795 i Berlin, Connecticut, död den 2 maj 1856 i Hazel Green, Wisconsin, var en amerikansk skald.\\nPercival tjänstgjorde i sin ungdom som militärläkare, fick 1835 i uppdrag att undersöka staten Connecticuts geologiska förhållanden och utgav en redogörelse därför 1842 samt blev statsgeolog för Wisconsin 1854. Han uppträdde 1821 med diktsamlingen Prometheus and other poems, efter vilken följde Clio samt The dream of a day, and other poems. Poetical works utkom i 2 band 1859."},{"page_url":"https://eu.wikipedia.org/wiki/Stefan_Edberg","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2f/Edberg_2009.jpg","page_title":"Stefan Edberg","context_page_description":"Stefan Edberg suediar tenislari ohia da. Wimbledongo txapelketa birritan irabazi du, Boris Becker alemanari aurrea hartuta. Estatu Batuetako Nazioarteko txapelketa ere bitan irabazi du, 1991n Jim Courierren kontra, eta 1992an Pete Samprasen kontra. Davis kopa hirutan irabazi du."},{"page_url":"https://en.wikipedia.org/wiki/Boardman%E2%80%93Mitchell_House","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e3/BOARDMAN-MITCHELL_HOUSE%2C_STAPLETON%2C_RICHMOND_COUNTY%2C_NY.jpg","page_title":"Boardman–Mitchell House","context_page_description":"The Boardman–Mitchell House is a three-story, six-bedroom Italianate villa located at 710 Bay Street, Staten Island, New York. It also has the address of 33 Brownell Street since it connects to both streets. It is a New York City Landmark and was listed on the National Register of Historic Places in 2012. It is known as a good example of a suburban architectural style used in an urban setting, as well as its connection to the piloting history of that portion of Staten Island."},{"page_url":"https://nl.wikipedia.org/wiki/Heldenplein","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/19/Gabriel_archangel%27s_statue_by_night.jpg","page_title":"Heldenplein","context_page_description":"Het Heldenplein is een plein in Boedapest, de hoofdstad van Hongarije. Het plein vormt de afsluiting van de Andrássyboulevard en de verbinding tussen de Dózsa György út en de Hungária körút.\\nHet plein werd vanaf 1896 aangelegd ter gelegenheid van de viering van de duizendste verjaardag van de Hongaarse \\"landname\\". Het plein wordt gedomineerd door het Millenniummonument. Aan weerszijden van het plein liggen het Museum voor Schone Kunsten en de Kunsthal. Beide gebouwen werden, evenals het monument, ontworpen door Albert Schickedanz. Achter het plein ligt het Stadspark.\\nHet plein draagt sinds 1932 zijn huidige naam.\\nJaarlijks wordt het plein omgebouwd tot een arena waarin de paardenraces Nemzeti Vágta worden gehouden."},{"page_url":"https://sv.wikipedia.org/wiki/La_Couronne,_Charente","image_url":"http://upload.wikimedia.org/wikipedia/commons/4/4d/Map_commune_FR_insee_code_16113.png","page_title":"La Couronne, Charente","context_page_description":"La Couronne är en kommun i departementet Charente i regionen Nouvelle-Aquitaine i västra Frankrike. Kommunen ligger i kantonen La Couronne som ligger i arrondissementet Angoulême. År 2009 hade La Couronne 6 995 invånare."},{"page_url":"https://de.wikipedia.org/wiki/Schloss_Herzogsfreude","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/44/Jagdschloss_Herzogsfreude_1785.jpg","page_title":"Schloss Herzogsfreude","context_page_description":"Schloss Herzogsfreude war ein Jagdschloss im Bonner Ortsteil Röttgen."},{"page_url":"https://en.wikipedia.org/wiki/List_of_Ramsar_sites_in_Spain","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/cc/Vistes_des_de_la_Muntanyeta_verda%2C_Marjal_Pego-Oliva.jpg","page_title":"List of Ramsar sites in Spain","context_page_description":"This list of Ramsar sites in Spain includes wetlands that are considered to be of international importance under the Ramsar Convention. Spain currently has 74 sites designated as \\"Wetlands of International Importance\\" with a surface area of 303,090 hectares."},{"page_url":"https://en.wikipedia.org/wiki/H%C3%A4rmelekopf","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/09/Harmelekopf_from_below_Rosshutte_-_4985.JPG","page_title":"Härmelekopf","context_page_description":"The Härmelekopf is a mountain northeast of Seefeld in Tirol in the Karwendel Alps in the Austrian state of Tyrol. It is 2,224 metres high."},{"page_url":"https://ja.wikipedia.org/wiki/%E5%92%8C%E5%B3%B6%E3%81%82%E3%81%BF","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/89/%E3%83%A1%E3%82%A4%E3%82%AD%E3%83%B3%E3%82%B0%E3%80%8C%E5%A4%9A%E9%A6%99%E7%BE%8E%E3%81%A8%E6%98%8E%E6%97%A5%E5%A5%88%E3%80%8D%E2%91%A3_56s_%E5%92%8C%E5%B3%B6%E3%81%82%E3%81%BF.jpg","page_title":"和島あみ","context_page_description":"和島 あみは、日本の女性歌手。北海道倶知安町出身。ホリプロインターナショナル所属。身長154cm。血液型はB型。"},{"page_url":"https://fr.wikipedia.org/wiki/Mor%C3%A8ne","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6e/HydrocharisMorsusRanae.jpg","page_title":"Morène","context_page_description":"La Morène encore appelée petit nénuphar, grenouillette, morène des grenouilles ou hydrocharis des grenouilles est une plante de la famille des Hydrocharitaceae."},{"page_url":"https://zh.wikipedia.org/zh-tw/%E8%B7%AF%E5%8A%A0%E7%A6%8F%E9%9F%B3%E7%AC%AC2%E7%AB%A0","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/76/StJohnsAshfield_StainedGlass_GoodShepherd_Portrait.jpg","page_title":"路加福音第2章","context_page_description":"《路加福音》第2章是《新約聖經·路加福音》的第2章，全章共有52節。內容包括耶穌的出生及幼年。"},{"page_url":"https://en.wikipedia.org/wiki/List_of_tallest_buildings_and_structures_in_Egypt","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/76/Foreign_Ministry_Building_Cairo.jpg","page_title":"List of tallest buildings and structures in Egypt","context_page_description":"List of tallest buildings and structures in Egypt. Compared to many economies in Africa, Egypt's is quite diversified. However, Egypt is one of the largest tourist destinations in the world, which generates a large percentage of its GDP. People come not only for its lush Mediterranean coastline, but also for its rich history and massive megalithic structures which continue to impose on its skyline even after thousands of years. As such, its status as a major tourist destination is reflected by many of its tallest buildings are hotels and even a couple are the world-famous pyramids. Cairo's skyline is one of the most densely packed in Africa and continues to grow.\\nThe tallest project currently under construction is St. Regis Hotel Tower 1 at 180 m tall. This structure will be the tallest building in Egypt when complete. This building will be accompanied by its two smaller twins which will also be the second and third tallest buildings in Egypt. This includes the supertall Eco-tower which, if built, could be well over 500 m tall, making it by far the tallest building in Africa."},{"page_url":"https://id.wikipedia.org/wiki/Masi_Oka","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5d/Masi_Oka_at_Vivo_City_Singapore.jpg","page_title":"Masi Oka","context_page_description":"Masi Oka adalah aktor dan juga digital effects artist. Masi Oka juga bermain dalam beberapa film dan acara televisi. Dia berperan sebagai Hiro Nakamura dalam serial televisi NBC Heroes. Pada saat ini ia tinggal di Los Angeles, Kalifornia."},{"page_url":"https://hy.wikipedia.org/wiki/%D5%8E%D5%A1%D5%B2%D5%A1%D5%BF%D5%AB%D5%B6%D5%AB_%D5%BA%D5%A1%D5%BF%D5%B4%D5%B8%D6%82%D5%A9%D5%B5%D5%A1%D5%B6_%D6%87_%D5%B4%D5%B7%D5%A1%D5%AF%D5%B8%D6%82%D5%B5%D5%A9%D5%AB_%D5%A1%D5%B6%D5%B7%D5%A1%D6%80%D5%AA_%D5%B0%D5%B8%D6%82%D5%B7%D5%A1%D6%80%D5%B1%D5%A1%D5%B6%D5%B6%D5%A5%D6%80%D5%AB_%D6%81%D5%A1%D5%B6%D5%AF_(%D5%8D%D5%B5%D5%B8%D6%82%D5%B6%D5%AB%D6%84%D5%AB_%D5%B4%D5%A1%D6%80%D5%A6)","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/66/%D5%88%D6%80%D5%B8%D5%BF%D5%B6%D5%A1%D5%BE%D5%A1%D5%B6%D6%84_04.jpg","page_title":"Վաղատինի պատմության և մշակույթի անշարժ հուշարձանների ցանկ (Սյունիքի մարզ)","context_page_description":"Այս հոդվածը ներկայացնում է Սյունիքի մարզի Վաղատին գյուղի պատմության և մշակույթի հուշարձանների ցանկը, որը 2002 թ․ հաստատվել է ՀՀ կառավարության կողմից։ Ցանկում ներառված է ընդամենը 64 հուշարձան ։"},{"page_url":"https://ru.wikipedia.org/wiki/%D0%9A%D1%83%D1%80%D0%B3%D0%B0%D0%BD_(%D0%B3%D0%BE%D1%80%D0%BE%D0%B4)","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2f/Flag_of_Ishim_%28Tyumen_oblast%29.png","page_title":"Курган (город)","context_page_description":"Курга́н — город в России, административный центр Курганской области. Основан в 1679 году, но поселение на этом месте существовало с 1553 года. Расположен в Уральском федеральном округе, на берегах Тобола.\\nНаселение города — 312 364 чел. С пригородами формируется городская агломерация с населением 360 000 человек.\\nКурган — один из важнейших экономических, научных и культурных центров УрФО, крупный транспортный узел. Промышленный центр. Город известен в стране благодаря Российскому научному центру «Восстановительная травматология и ортопедия» имени академика Г. А. Илизарова. Также в Кургане производятся автобусы КАвЗ, боевые машины пехоты БМП-3 и Курганец-25, а также медикаменты, нефтегазовое оборудование и трубопроводная арматура.\\nИмеет статус города областного подчинения, в границах которого образовано муниципальное образование город Курган со статусом городского округа как единственный населённый пункт в его составе."},{"page_url":"https://pl.wikipedia.org/wiki/Roman_G%C3%B3recki","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/ff/Gen_Roman_G%C3%B3recki.jpg","page_title":"Roman Górecki","context_page_description":"Roman Górecki – polski doktor nauk prawnych, oficer Legionów Polskich, generał brygady Wojska Polskiego, bankowiec, prezes Banku Gospodarstwa Krajowego, minister przemysłu i handlu II RP, prezes Federacji Polskich Związków Obrońców Ojczyzny, prezes WKS „Legia” Warszawa i pierwszy prezes Ligi Piłki Nożnej, prezes Polskiego Touring Klubu, prezes Rady Głównej Ligi Morskiej i Rzecznej, wolnomularz, członek władz Towarzystwa Rozwoju Ziem Wschodnich."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%91%D0%BE%D1%80%D1%8C%D0%B1%D0%B0_%D0%BD%D0%B0_%D0%BB%D0%B5%D1%82%D0%BD%D0%B8%D1%85_%D0%9E%D0%BB%D0%B8%D0%BC%D0%BF%D0%B8%D0%B9%D1%81%D0%BA%D0%B8%D1%85_%D0%B8%D0%B3%D1%80%D0%B0%D1%85_1980","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2d/RIAN_archive_788965_Magomedgasan_Abushev_vs._Augustin_Atasi.jpg","page_title":"Борьба на летних Олимпийских играх 1980","context_page_description":"Соревнования по вольной и греко-римской борьбе на летних Олимпийских играх 1980 года в Москве проходили с 20 по 31 июля в универсальном спорткомплексе ЦСКА на Ленинградском проспекте.\\n266 мужчин из 35 стран разыграли 20 комплектов наград — по 10 комплектов в вольной и греко-римской борьбе. Программа соревнований и весовые рамки категорий по сравнению с предыдущей Олимпиадой в Монреале изменений не претерпели.\\nУспешнее всего ожидаемо выступили хозяева соревнований — советские борцы выиграли награды в 17 из 20 категорий, в том числе 12 золотых. Советские спортсмены повторили свой успех 4-летней давности, когда они также выиграли 12 золотых наград из 20 возможных. Всего медали по борьбе в Москве завоевали представители 15 стран, 6 из которых выиграли хотя бы одно золото.\\nБратья-близнецы Анатолий и Сергей Белоглазовы выиграли золото в вольной борьбе в категориях до 52 и 57 кг соответственно. Сослан Андиев и Александр Колчинский стали двукратными олимпийскими чемпионами по вольной и греко-римской борьбе в категории свыше 100 кг, повторив свои успехи Монреаля-1976."},{"page_url":"https://sv.wikipedia.org/wiki/Miletus_leos","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/ca/MiletusLeosVirtusMFUpUnAC1.jpg","page_title":"Miletus leos","context_page_description":"Miletus leos är en fjärilsart som beskrevs av Guérin-ménéville 1829. Miletus leos ingår i släktet Miletus och familjen juvelvingar. Inga underarter finns listade i Catalogue of Life."},{"page_url":"https://it.wikipedia.org/wiki/Fondovalle_(Formazza)","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3e/Fondo_Valle.JPG","page_title":"Fondovalle (Formazza)","context_page_description":"Fondovalle è una frazione del comune di Formazza, in provincia del Verbano-Cusio-Ossola."},{"page_url":"https://cs.wikipedia.org/wiki/T%C5%99%C3%ADda_TR-1700","image_url":"http://upload.wikimedia.org/wikipedia/commons/b/b8/S41ARASantaCruzWWM.jpg","page_title":"Třída TR-1700","context_page_description":"Třída TR-1700 či třída Santa Cruz je třída dieselelektrických útočných ponorek argentinského námořnictva. Jedná se o čistě exportní typ vyvinutý německou loděnicí Thyssen Nordseewerke pro země, které doposud provozovaly druhoválečné americké ponorky modernizované v rámci programu GUPPY. Argentina objednala šest lodí této třídy, kvůli finančním problémům se jí ale podařilo dokončit pouze dvě – Santa Cruz a San Juan. První je stále v aktivní službě a tvoří jádro argentinských ponorkových sil, druhá se 15. listopadu 2017 z neznámých příčin potopila asi 460 km jihovýchodně od Comodoro Rivadavia."},{"page_url":"https://fr.wikipedia.org/wiki/Barrage_de_Saucelle","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/40/Hotel_de_Aldeaduero%2C_Salto_de_Saucelle%2C_Castilla_y_Le%C3%B3n_%28Espa%C3%B1a%29.jpg","page_title":"Barrage de Saucelle","context_page_description":"Le barrage de Saucelle, aussi connue comme Salto de Saucelle, est une oeuvre d'ingénierie hydroélectrique bâtie dans le cours moyen du fleuve Douro, à 8 km du village salmantinne de Saucelle, en pleine frontière entre l'Espagne et le Portugal.\\nLe tronçon dans lequel se situe se connaît comme «arribes du Duero», une profonde dépression géographique. À côté du barrage se localise le hameau Salto de Saucelle, construit pour héberger les familles des ouvriers que la bâtissaient."},{"page_url":"https://no.wikipedia.org/wiki/Akselavstand","image_url":"http://upload.wikimedia.org/wikipedia/commons/b/b7/Wheelbase001.png","page_title":"Akselavstand","context_page_description":"Akselavstand er avstanden mellom akselene på et kjøretøy. Et eksempel er avstanden mellom for- og bakhjulene på en bil.\\nEn kortere akselavstand gir bilen en større manøvreringsevne mens en lengre akselavstand gir bilen bedre retningsstabilitet. Her vil imidlertid distribusjonen av masse og tregheten spille en stor rolle."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%A2%D0%B5%D0%BC%D1%80%D0%B5%D0%B7%D0%BE%D0%B2,_%D0%A0%D0%B0%D1%88%D0%B8%D0%B4_%D0%91%D0%BE%D1%80%D0%B8%D1%81%D0%BF%D0%B8%D0%B5%D0%B2%D0%B8%D1%87","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/de/Alexander_Matovnikov_in_Karachay-Cherkessia_%282018-07-20%29_6_%28cropped%29.jpg","page_title":"Темрезов, Рашид Бориспиевич","context_page_description":"Рашид Бориспиевич Темре́зов — российский государственный и политический деятель. Президент Карачаево-Черкесской Республики с 1 марта по 7 апреля 2011. Глава Карачаево-Черкесской Республики с 7 апреля 2011. Член Высшего совета партии «Единая Россия»."},{"page_url":"https://sq.wikipedia.org/wiki/Udh%C3%ABheq%C3%ABs_t%C3%AB_shteteve_n%C3%AB_vitin_1925","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8e/King_Zog.jpg","page_title":"Udhëheqës të shteteve në vitin 1925","context_page_description":"Udhëheqës të shteteve në vitin 1925 janë të radhitur sipas kontinenteve dhe pastaj në kontinente janë të radhitura shtetet sipas shkronjës."},{"page_url":"https://vi.wikipedia.org/wiki/Monzonit","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/ac/NotchPeakDike.JPG","page_title":"Monzonit","context_page_description":"Monzonit là một loại đá magma xâm nhập, có thành phần gần như bẳng nhau giữa plagioclase và alkali feldspar, trong đó có ít hơn 5% thạch anh. Nó có thể chứa một lượng nhỏ hornblend, biotit và các khoáng vật khác. Nếu hàm lượng thạch anh lớn hơn 5%, thì nó được gọi là monzonit thạch anh.\\nNếu đá có hàm lượng alkali feldspar lớn hơn thì được gọi là syenit. Nếu có hàm lượng nhiều hơn về plagioclase canxi và các khoáng vật mafic thì đá được gọi là diorit. Đá magma phun trào có thành phần tương tự được gọi là latite."},{"page_url":"https://it.wikipedia.org/wiki/Tomkyns_Hilgrove_Turner","image_url":"http://upload.wikimedia.org/wikipedia/commons/4/4f/Hilgrove_Turner.jpg","page_title":"Tomkyns Hilgrove Turner","context_page_description":"Sir Tomkyns Hilgrove Turner è stato un militare e archeologo britannico.\\nMilitare di professione, è impegnato dal 1793 in campagne militari in Francia e nei Paesi Bassi.\\nNel 1801 è in Egitto, impegnato nella battaglia della baia di Abukir e di Alessandria d'Egitto."},{"page_url":"https://fa.wikipedia.org/wiki/%DA%A9%D9%84%D9%85%DB%8C","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f1/Kelmis_Li%C3%A8ge_Belgium_Map.png","page_title":"کلمی","context_page_description":"شهر کلمی در شهرستان ورویه در استان لیئژ در منطقه فدرال والوون در کشور بلژیک واقع شده‌است. کلمی بین سال‌های ۱۸۱۶ تا ۱۹۲۰ و پیش از پیوستن به بلژیک، پایتخت کشور مورسنت بی‌طرف بود."},{"page_url":"https://fr.wikipedia.org/wiki/Si%C3%A8ge_de_Delfzijl_(1813-1814)","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5d/Delfzijl_tijdens_de_belegering_van_1813_-1814.JPG","page_title":"Siège de Delfzijl (1813-1814)","context_page_description":"Le Siège de Delfzijl s'est déroulé du 13 novembre 1813 au 23 novembre 1814, pendant la période de transition de l'époque française aux Pays-Bas à la période du Royaume uni des Pays-Bas.\\nContrairement à la situation, par exemple, lors du siège de Leyde, qui s’achève avec la libération de Leyde, l’occupant n’étaient pas autour mais à l’intérieur de la ville, car Delfzijl était aux mains françaises sous le colonel Pierre Maufroy.\\nLes troupes de la garde nationale, les cosaques et les prussiens et les navires de la flotte anglaise, conjointement dirigés par le colonel néerlandais Marcus Busch, ont assiégé la ville fortifiée de Delfzijl pour la reprendre aux mains des Pays-Bas.\\nParce que le colonel Maufroy ne voulait pas croire que Napoléon Bonaparte était vaincu, il continua de défendre Delfzijl avec succès.\\nAinsi, la forteresse de Delfzijl demeura occupée jusqu’après la fin de la période française.\\nDelfzijl fut donc le dernier soutien militaire de Napoléon, qui a été banni à l'île d'Elbe un mois et demi avant la libération de Delfzijl."},{"page_url":"https://de.wikipedia.org/wiki/Stadtschwarzach","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/24/Rathaus%2C_Schwarzach.JPG","page_title":"Stadtschwarzach","context_page_description":"Stadtschwarzach ist ein Ortsteil des Marktes Schwarzach am Main im unterfränkischen Landkreis Kitzingen in Bayern. Stadtschwarzach war bis zum Zusammenschluss mit fünf weiteren Orten in den 1970er Jahren eine selbstständige Gemeinde. Gegründet wurde die Siedlung wohl als Planstadt im 13. Jahrhundert und besaß bis ins Jahr 1818 das Stadtrecht. Eng verbunden ist Stadtschwarzach mit dem benachbarten Münsterschwarzach und seinem Kloster, dessen Äbte zeitweise die Herrschaft über Stadtschwarzach innehatten.\\nHeute bildet Stadtschwarzach als einwohnerreichstes Dorf der Gemeinde den inoffiziellen Hauptort von Schwarzach am Main, wo sich Dienstleistungsunternehmen ansiedelten. Der Tourismus spielt eine nur untergeordnete Rolle, weil die reiche Geschichte des Ortes im Stadtbild nicht mehr ablesbar ist. Stattdessen hat sich Stadtschwarzach zu einem Verkehrsknotenpunkt im nördlichen Landkreis Kitzingen entwickelt, der mit den Nachbarorten Münsterschwarzach und Gerlachshausen zusammengewachsen ist."},{"page_url":"https://nl.wikipedia.org/wiki/Gladde_schijfhoren","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/20/Planorbis_glaber_%28Sowerby%29.jpg","page_title":"Gladde schijfhoren","context_page_description":"De gladde schijfhoren is een slakkensoort uit de familie van de Planorbidae. De wetenschappelijke naam van de soort is voor het eerst geldig gepubliceerd in 1838 door Alder."},{"page_url":"https://fi.wikipedia.org/wiki/Tom_Koivisto","image_url":"http://upload.wikimedia.org/wikipedia/commons/e/ee/Tom_Koivisto.JPG","page_title":"Tom Koivisto","context_page_description":"Tom Koivisto on suomalainen uransa lopettanut jääkiekkopuolustaja. Oikealta pelanneen pienikokoisen Koiviston vahvuuksia olivat hyvä lyöntilaukaus ja hyvä kiekollinen peli."},{"page_url":"https://ceb.wikipedia.org/wiki/W%C3%B3jtowa_(lungsod)","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f5/W%C3%B3jtowa%2C_ko%C5%9Bci%C3%B3%C5%82%2C_widok_od_p%C3%B3%C5%82nocy.jpg","page_title":"Wójtowa (lungsod)","context_page_description":"Lungsod ang Wójtowa sa Polskowa. Nahimutang ni sa powiat sa Powiat gorlicki ug gingsakopan sa Województwo Małopolskie, sa habagatang bahin sa nasod, 280 km sa habagatan sa Warsaw ang ulohan sa nasod. 304 metros ibabaw sa dagat kahaboga ang nahimutangan sa Wójtowa, ug adunay 1,500 ka molupyo.\\nAng yuta palibot sa Wójtowa kay patag sa amihanan, apan sa habagatan nga kini mao ang kabungtoran. Ang kinahabogang dapit sa palibot dunay gihabogon nga 448 ka metro ug 1.7 km sa sidlakan sa Wójtowa. Dunay mga 104 ka tawo kada kilometro kwadrado sa palibot sa Wójtowa medyo hilabihan populasyon. Ang kinadul-ang mas dakong lungsod mao ang Jasło, 13.7 km sa sidlakan sa Wójtowa. Hapit nalukop sa kaumahan ang palibot sa Wójtowa. Sa rehiyon palibot sa Wójtowa, kabukiran talagsaon komon.\\nAng klima hemiboreal. Ang kasarangang giiniton 7 °C. Ang kinainitan nga bulan Hulyo, sa 19 °C, ug ang kinabugnawan Enero, sa -10 °C. Ang kasarangang pag-ulan 1,044 milimetro matag tuig. Ang kinabasaan nga bulan Hunyo, sa 141 milimetro nga ulan, ug ang kinaugahan Disyembre, sa 51 milimetro."},{"page_url":"https://de.wikipedia.org/wiki/Neo_Geo","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7a/Neo-Geo-AES-Opened-FR.jpg","page_title":"Neo Geo","context_page_description":"Neo Geo ist eine stationäre Spielkonsole und ein Arcade-System, das vom Unternehmen SNK entwickelt wurde."},{"page_url":"https://kn.wikipedia.org/wiki/%E0%B2%86%E0%B2%95%E0%B2%BE%E0%B2%B6","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/94/Desert_Electric.jpg","page_title":"ಆಕಾಶ","context_page_description":"ಆಕಾಶವು, ಬಾಹ್ಯಾಕಾಶದ ಗುಮ್ಮಟ ಎಂದೂ ಪರಿಚಿತವಿರುವ, ಸಾಮಾನ್ಯವಾಗಿ, ವಾತಾವರಣ ಮತ್ತು ಉಳಿದ ಬಾಹ್ಯಾಕಾಶವನ್ನು ಒಳಗೊಂಡಂತೆ, ಭೂಮಿಯ ಮೇಲ್ಮೈಯ ಮೇಲೆ ಒಂದು ನಿರ್ದಿಷ್ಟ ದೂರದಲ್ಲಿ ಸ್ಥಿತವಾಗಿರುವ ಎಲ್ಲವನ್ನೂ ನಿರ್ದೇಶಿಸುತ್ತದೆ. ಖಗೋಳಶಾಸ್ತ್ರದ ಕ್ಷೇತ್ರದಲ್ಲಿ, ಆಕಾಶವನ್ನು ಬಾಹ್ಯಾಕಾಶ ಗೋಳ ಎಂದೂ ಕರೆಯಲಾಗುತ್ತದೆ. ಇದು ಸೂರ್ಯ, ನಕ್ಷತ್ರಗಳು, ಗ್ರಹಗಳು, ಮತ್ತು ಚಂದ್ರ ಸಾಗುತ್ತಿರುವಂತೆ ಕಾಣುವ ಒಂದು ಕಾಲ್ಪನಿಕ ಗುಮ್ಮಟ."},{"page_url":"https://cs.wikipedia.org/wiki/%C5%BDelezni%C4%8Dn%C3%AD_tra%C5%A5_Trutnov_%E2%80%93_Svoboda_nad_%C3%9Apou","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e4/V%C5%AFz_810%2C_Svoboda_nad_%C3%9Apou_%282%29.jpg","page_title":"Železniční trať Trutnov – Svoboda nad Úpou","context_page_description":"Železniční trať Trutnov hl. n. – Svoboda nad Úpou je jednokolejná regionální trať v královéhradeckém kraji o délce 10 km."},{"page_url":"https://en.wikipedia.org/wiki/Huqoq","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8c/Huqoq_Inscription_and_face.jpg","page_title":"Huqoq","context_page_description":"Huqoq or Hukkok was an ancient Jewish village, located 12.5 km north of Tiberias.\\nThe area had been settled since ancient times and is mentioned in the Book of Joshua. The Arab village Yaquq was built at Huqoq's location, and a kibbutz named Hukok was established near the site on 11 July 1945."},{"page_url":"https://nl.wikipedia.org/wiki/Paelia_lunuligera","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/87/Fig.18-Paelia_lunuligera.JPG","page_title":"Paelia lunuligera","context_page_description":"Paelia lunuligera is een vlinder uit de familie van de waaiermotten. De wetenschappelijke naam van de soort is voor het eerst geldig gepubliceerd in 1866 door Walker."},{"page_url":"https://bg.wikipedia.org/wiki/%D0%A4%D0%B8%D0%BE%D1%80%D0%B8%D1%82%D1%83%D1%80%D0%B0","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e3/Fioritura_from_concerto_by_Chopin.png","page_title":"Фиоритура","context_page_description":"Фиоритура е музикален термин, означаващ добавяне на музикална орнаментика във вокална или инструментална партия. Терминът е италиански и е равнозначен на термина колоратура, въведен в някои други страни. За разлика от колоратурата обаче, той не се използва само за вокални изпълнения.\\nФиоритурата е един от способите на аранжировката. Може да бъде представена от мелодични украшения, бързи пасажи, рулади, каденца, форшлаг и други. Употребява се най-често при вокални изпълнения. Възможно е да е нотен запис на композитора, или въведена от изпълнителя като негова интерпретация. Изкуството на фиоритурата достига пълния си разцвет в италианската опера от 18 век. Всички сопрана по едно или друго време са изпълнявали фиоритури в рамките на една ария. Някои произведения, изпълнени с богата орнаментика също се наричат фиоритури. Ползва се и при инструменталната музика."},{"page_url":"https://fi.wikipedia.org/wiki/Vuoden_ymp%C3%A4rist%C3%B6rakenne","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/24/Outokumpu_HDQTRS_gate_and_canopy.jpg","page_title":"Vuoden ympäristörakenne","context_page_description":"Vuoden ympäristörakenne on Puutarhaliitto ry:n ja Rakennustuoteteollisuus RTT ry:n järjestämä kilpailu, jossa valitaan Vuoden ympäristörakenne. Tarkoituksena on tehdä tunnetuksi tasokkaita ympäristökokonaisuuksia, joissa on saavutettu esteettisesti ja toiminnallisesti kestävä ja hyvä ympäristö. Vuoden ympäristörakenne on palkittu vuodesta 1991 lähtien."},{"page_url":"https://ko.wikipedia.org/wiki/%EC%95%A8%EB%A6%AD%EC%8A%A4_%ED%8A%B8%EB%A6%AC%EB%B2%A1","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/28/Alex_Trebek_161020-Z-DZ751-129_%2829850172634%29.jpg","page_title":"앨릭스 트리벡","context_page_description":"앨릭스 트리벡은 캐나다에서 태어난 방송인이다. 미국 퀴즈 쇼 《제퍼디!》의 쇼 호스트를 1984년 9월 10일부터 현재까지 맡아왔다. 데이타임 에미상도 여러 차례 수상했다."},{"page_url":"https://en.wikipedia.org/wiki/Samuel_Williams_(engraver)","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3b/1836-06_1837-04_The_Numismatic_Journal_Vol._01_front_page_1.jpg","page_title":"Samuel Williams (engraver)","context_page_description":"Samuel Williams was a British draughtsman and wood-engraver."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Baudenkm%C3%A4ler_in_Altusried","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ea/Gasthaus_R%C3%B6ssle%2C_Altusried%2C_10._Juni_2018.jpg","page_title":"Liste der Baudenkmäler in Altusried","context_page_description":"Auf dieser Seite sind die Baudenkmäler des schwäbischen Marktes Altusried zusammengestellt. Diese Tabelle ist eine Teilliste der Liste der Baudenkmäler in Bayern. Grundlage ist die Bayerische Denkmalliste, die auf Basis des Bayerischen Denkmalschutzgesetzes vom 1. Oktober 1973 erstmals erstellt wurde und seither durch das Bayerische Landesamt für Denkmalpflege geführt wird. Die folgenden Angaben ersetzen nicht die rechtsverbindliche Auskunft der Denkmalschutzbehörde. Die Liste gibt den Fortschreibungsstand vom 2. Februar 2018 wieder und umfasst 65 Baudenkmäler."},{"page_url":"https://en.wikipedia.org/wiki/Hydration_reaction","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d8/Copper_sulfate.jpg","page_title":"Hydration reaction","context_page_description":"In chemistry, a hydration reaction is a chemical reaction in which a substance combines with water. In organic chemistry, water is added to an unsaturated substrate, which is usually an alkene or an alkyne. This type of reaction is employed industrially to produce ethanol, isopropanol, and butan-2-ol."},{"page_url":"https://ta.wikipedia.org/wiki/%E0%AE%A8%E0%AF%8B%E0%AE%95%E0%AF%8D_%E0%AE%AA%E0%AE%A3%E0%AF%8D%E0%AE%AA%E0%AE%BE%E0%AE%9F%E0%AF%81","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fd/Nok-map.png","page_title":"நோக் பண்பாடு","context_page_description":"நோக் பண்பாடு, கிமு 1000 அளவில் வடக்கு நைசீரியாவில் தோற்றம்பெற்று, என்னவென்று தெரியாத சூழ்நிலைகளில் கிபி 300 அளவில் அழிந்துவிட்டது. இது, அவுசா, குவாரி, பிரோம், கனூரி, நூப்பே, யூக்குன் ஆகிய மக்களைக் கிளையினராகக் கொண்ட ஒரு முந்திய பண்பாட்டில் இருந்து உருவாகியதாகக் கருதப்படுகிறது. \\"நோக்\\" இற்கு வடமேற்கில் அமைந்துள்ள குவாத்தார்கவாசி அல்லது சோக்கோத்தோ என்னும் பண்பாடு நோக் பண்பாட்டைப் போன்றது அல்லது அதன் மூதாதையாக இருக்கலாம் என்ற கருத்தும் உண்டு.\\nநோக் பண்பாட்டின் சமூக முறைமை மிகவும் முன்னேற்றம் அடைந்திருந்தது என்கின்றனர். இப்பண்பாடு, ஆப்பிரிக்காவில் பெரிய சுடுமண் சிற்பங்களை உருவாக்கிய மிகப்பழைய பண்பாடுகளுள் ஒன்றாகும். மின்னியாப்பொலிசு கலை நிறுவனத்தில் உள்ள நோக் பிரமுகரின் படிமம் இப்பண்பாட்டின் நேர்த்திக்குச் சான்றாக உள்ளது.\\nகருவிகள் செய்வதற்காக இரும்பை உருக்குதல், காய்ச்சியடித்தல் போன்ற பயன்பாடுகள் நோக் பண்பாட்டில் குறைந்தது கிமு 550 அளவில் அல்லது அதற்கு முன்னர் தோன்றியது. கிறித்தோபர் ஏரட் என்பவரின் கருத்துப்படி, இரும்பை உருக்கும் முறை கிமு 1000க்கு முன்னரே இப்பகுதியில் தனியாக இங்கேயே கண்டுபிடிக்கப்பட்டது."},{"page_url":"https://ar.wikipedia.org/wiki/%D8%A8%D8%B1%D8%AC_%D8%A7%D9%84%D8%B1%D9%8A%D8%A7%D8%AD_(%D8%A3%D8%AB%D9%8A%D9%86%D8%A7)","image_url":"http://upload.wikimedia.org/wikipedia/commons/d/d7/Tower_of_the_Winds_in_Sevastopol.jpg","page_title":"برج الرياح (أثينا)","context_page_description":"برج الرياح أو هورولوجيون من أندرونيكوس كيرهستيس هو برج ساعة بينتيلي ثماني الأعضاء مصنوع من الرخام في الأغورا اليونانية في أثينا والتي تعمل وقفاً لعلم البنكامات أو \\"الساعة\\". وهو يُعتبر أول مرصد لعلوم الجو في العالم. بشكل غير رسمي، النصب يُسمي أيضاً إريادس، والذي يعني الرياح. البناء يوفر مجموعة من الخصائص كالمزولة و الساعة المائية و دوارة الرياح. ويعتقد أنه بُني بواسطة أندرونيكوس حوالي عام 50 ق.م، لكن طبقاً للمصادر الأخرى، ربما يكون تم إنشاؤه في القرن الثاني قبل الميلاد قبل بقية المنتدي الروماني.\\nفي صيف عام 2014، مؤسسة أثينا للأثار بدأت التنظيف وإصلاح المبني، وأعمال التنظيف والإصلاح قد اكتملت في أغسطس 2016."},{"page_url":"https://az.wikipedia.org/wiki/Arras","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0b/Arras%2C_Abbaye_Saint-Vaast_PM_23788.jpg","page_title":"Arras","context_page_description":"Arras fr. Arras, tar. nid. Atrecht — Fransanın departamenti olan Pa-de-Kalenin əsas şəhəri və keçmiş Artois əyaləti. Arras şəhəri O-de-Frans regionunda yerləşir.\\nƏhalisi — 40 970 nəfər."},{"page_url":"https://lt.wikipedia.org/wiki/Vytauto_Did%C5%BEiojo_universiteto_Rasos_gimnazija","image_url":"http://upload.wikimedia.org/wikipedia/commons/a/ae/VDU_Rasos_gimnazija.JPG","page_title":"Vytauto Didžiojo universiteto Rasos gimnazija","context_page_description":"VšĮ Vytauto Didžiojo universiteto „Rasos“ gimnazija – dieninė, keturmetė savarankiško mokymosi bendrojo lavinimo mokykla Kaune, P. Lukšio g. 40, vykdanti pagrindinio, vidurinio ir papildomo ugdymo programas. Įstaigos kodas 190138557. Steigėjai Kauno miesto savivaldybės taryba ir Vytauto Didžiojo universitetas."},{"page_url":"https://ur.wikipedia.org/wiki/%D8%AE%D8%B1%D8%A7%D9%85%DB%8C_%D8%A7%D8%AD%D9%85%D8%AF_%D9%BE%D8%A7%D8%B4%D8%A7_%D9%85%D8%B3%D8%AC%D8%AF","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/eb/HiramiAmhetPasaMosque20071010_01.jpg","page_title":"خرامی احمد پاشا مسجد","context_page_description":"خرامی احمد پاشا مسجد ترکی کا ایک مسجد و گرجا گھر جو استنبول میں واقع ہے۔"},{"page_url":"https://zh.wikipedia.org/zh-tw/%E8%A9%B9%E5%A7%86%E6%96%AF%C2%B7%E8%8E%B1%E6%96%87","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c6/James_Levine_2013.jpg","page_title":"詹姆斯·莱文","context_page_description":"詹姆斯·李汶，出生於美國俄亥俄辛辛那堤，是指揮家和鋼琴演奏家。他出生於一個音樂世家。他的父親是一個舞會樂團的首席小提琴手，他的一個祖父是猶太教廟的領唱。10歲時李汶就已作為鋼琴家上台與辛辛那堤交響樂團同台獻藝了。他在瓦爾特·李汶那學習音樂理論，在魯道夫·塞爾金門下學習鋼琴。1961年他在紐約朱利亞德音樂學院畢業，專業是指揮和歌唱。\\n1964年李汶成為克利夫蘭管弦樂團最年輕的助理指揮，藝術指導則是喬治·塞爾。1971年他轉到紐約大都會歌劇院上任，首演的劇目是普契尼的托斯卡。\\n之後他在大都會歌劇院扶搖直上，1973年成為首席指揮，1976年任音樂指導到1986年成為藝術總監。他在那裡指揮超過2000場，75部歌劇作品，其中很多都是該樂團首次接觸到的。\\n詹姆士·李汶不但帶領樂團作世界巡迴，還經常雙雙出現在電視上。\\n他不但指揮大都會歌劇院管弦樂團，而且還作為鋼琴家演奏和為歌曲伴奏，和他合作的歌唱家有巴托莉、包羅丁娜和卡娜娃。\\n他指揮過世界上所有最重要的樂團，包括柏林愛樂管弦樂團、維也納愛樂管弦樂團和芝加哥交響樂團。他還經常做客薩爾斯堡音樂節和拜羅伊特音樂節，三大男高音卡雷拉斯、多明戈和帕瓦羅蒂的世界巡迴就是由他陪同的，還為迪士尼的電影幻想曲2000配樂。當然還有錄音也是他的藝術生活之一，從1972年起他已錄製超過200款唱片。\\n1999/2000樂季開始李汶被任命為慕尼黑愛樂管弦樂團的首席指揮，在2002年6月他與樂團在巴登巴登音樂節樂廳里獻演。\\n在2004年夏天，他轉到波士頓交響樂團上任，2011年他因為健康因素卸下這個職務。\\n2016年，李汶因健康原因從大都會歌劇院退休，但仍以榮譽指揮的身份在大都會歌劇院登台。2017年12月，李汶被指控性侵年輕男性音樂家，大都會歌劇院決定將其停職。2018年3月12日，大都會歌劇院發表聲明，稱已有確鑿證據證明李汶曾進行性騷擾和性侵活動，歌劇院已與其解除關係。據報導，李汶的性騷擾行為可追溯至幾十年前。"},{"page_url":"https://en.wikipedia.org/wiki/Kinmen","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/ba/Jinchengtownview.JPG","page_title":"Kinmen","context_page_description":"Kinmen or Quemoy, officially Kinmen County, is an insular county in the Republic of China located just off the southeastern coast of mainland China. The county consists of the Kinmen Islands and the Wuqiu Islands more than 110 kilometres to the northeast. It is one of two counties under the streamlined Fujian Province of the Republic of China. The Kinmen Islands are located only about two kilometres east of the mainland city of Xiamen, and their strategic position has reflected the significant change of Cross-Strait relations from a battlefront to a trading point between mainland China and Taiwan. The county is claimed by the People's Republic of China, and Taiwan claims the Dadeng Islands, administered by China, as part of the county."},{"page_url":"https://sv.wikipedia.org/wiki/Calumma_parsonii","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/42/Calumma_Parsonii_Ste_Marie_Madagascar.jpg","page_title":"Calumma parsonii","context_page_description":"Calumma parsonii är en ödleart som beskrevs av Cuvier 1824. Calumma parsonii ingår i släktet Calumma och familjen kameleonter. IUCN kategoriserar arten globalt som nära hotad."},{"page_url":"https://de.wikipedia.org/wiki/F%C3%A9lines-Minervois","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5c/Felines_Minervois.jpg","page_title":"Félines-Minervois","context_page_description":"Félines-Minervois ist ein Ort und eine südfranzösische Gemeinde mit 478 Einwohnern im Département Hérault in der Region Okzitanien. Die Gemeinde gehört zum Arrondissement Béziers und zum Kanton Saint-Pons-de-Thomières. Die Einwohner werden Félinois genannt."},{"page_url":"https://it.wikipedia.org/wiki/Parco_dell%27Orecchiella","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/bd/Falco_peregrinus_nest_USFWS_free.jpg","page_title":"Parco dell'Orecchiella","context_page_description":"Il parco dell'Orecchiella è un'area naturale protetta situata nei territori della Garfagnana, in provincia di Lucca, sulla punta nord-occidentale della Toscana. Il parco è organizzato e suddiviso in tre riserve naturali in gestite sino al 2016 dal Corpo forestale dello Stato: l'Orecchiella, la Pania di Corfino e Lama Rossa.\\nIl centro visitatori ospita il Museo naturalistico e il museo dei rapaci.\\nNel parco è situato anche il giardino di montagna in cui si trovano molti fiori e piante tipici di ambienti montani. Sono presenti, infatti, specie erbacee annuali o perenni, arboree e arbustive tipiche dell'habitat appenninico."},{"page_url":"https://fr.wikipedia.org/wiki/%C3%89glise_Saint-Bernard_de_Reyersviller","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/83/Reyersviller1.jpg","page_title":"Église Saint-Bernard de Reyersviller","context_page_description":"L'église Saint-Bernard se situe dans la commune de Reyersviller et le département français de la Moselle."},{"page_url":"https://de.wikipedia.org/wiki/Saurma_(Adelsgeschlecht)","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/77/Saurma-Jeltsch-Wappen.png","page_title":"Saurma (Adelsgeschlecht)","context_page_description":"Die Grafen von Saurma, Freiherren von und zu der Jeltsch, sind eine schlesische Adelsfamilie."},{"page_url":"https://zh.wikipedia.org/wiki/%E9%9F%B6%E5%B1%B11%E5%9E%8B%E7%94%B5%E5%8A%9B%E6%9C%BA%E8%BD%A6","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/cc/SS1_0675_20111117.jpg","page_title":"韶山1型电力机车","context_page_description":"韶山1型电力机车，是中国铁路的第一代国产客、货两用干线电力机车。该型电力机车原称6Y1型，原型车为苏联的VL60型电力机车，首台机车于1958年试制成功，但因质量不过关未能批量生产，此后20多年间经历了三次重大技术改进，跳出了仿制的框架，于1968年更名为“韶山1型”，1980年基本定型并投入大批量生产。1958年至1988年间，原株洲电力机车厂累计生产了826台韶山1型机车。\\n韶山1型机车在1970年代至1980年代一度成为中华人民共和国电气化铁路干线的主型电力机车，并开创了中国铁路以“韶山”命名的干线电力机车家族的生产历史，其研制经验为以后中国电力机车的研制与发展奠定了坚实的基础。"},{"page_url":"https://ca.wikipedia.org/wiki/Aly_Raisman","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d9/Aly_Raisman_Rio_2016.jpg","page_title":"Aly Raisman","context_page_description":"Alexandra Rose \\"Aly\\" Raisman és una gimnasta artística nord-americana. En els Jocs Olímpics de Londres 2012, va ser capitana de l'equip nord-americà, guanyador de la medalla d'or en aquesta competència. De forma individual va guanyar una medalla d'or en el sòl i una medalla de bronze en la biga d'equilibri. També va formar part de l'equip nord-americà en els mundials celebrats en 2010 i 2011, competició on es va portar la medalla de plata i or respectivament. En 2013, va aparèixer en Dancing with the Stars. El Campionat Mundial de Glasgow de 2015 va marcar el seu retorn a la competició internacional, on va formar part de l'equip nord-americà, guanyador de la medalla d'or."},{"page_url":"https://ca.wikipedia.org/wiki/Charlotte_Becker","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0a/Charlotte_Becker_-_2018_UEC_European_Road_Cycling_Championships_%28Women%27s_road_race%29.jpg","page_title":"Charlotte Becker","context_page_description":"Charlotte Becker és una ciclista alemanya. Professional des del 2006, actualment milita a l'equip Team Hitec Products. Combina tant la carretera amb la pista. Ha obtingut diferents campionats mundials, europeus i nacionals.\\nLa seva germana Christina també ha estat ciclista professional."},{"page_url":"https://lt.wikipedia.org/wiki/Franz_Schubert","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0d/Franz_Schubert_by_Wilhelm_August_Rieder_1875.jpg","page_title":"Franz Schubert","context_page_description":"Francas Šubertas – austrų kompozitorius, romantinės muzikos pradininkas ir vienas žymiausių šios krypties kompozitorių."},{"page_url":"https://bn.wikipedia.org/wiki/%E0%A6%AA%E0%A7%8D%E2%80%8C%E0%A6%A8%E0%A6%AE_%E0%A6%AA%E0%A7%87%E0%A6%A8_%E0%A6%85%E0%A6%B2%E0%A6%BF%E0%A6%AE%E0%A7%8D%E0%A6%AA%E0%A6%BF%E0%A6%95_%E0%A6%B8%E0%A7%8D%E0%A6%9F%E0%A7%87%E0%A6%A1%E0%A6%BF%E0%A6%AF%E0%A6%BC%E0%A6%BE%E0%A6%AE","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2b/PP_Olympic_Stadium_-_Tennis_courts.jpg","page_title":"প্‌নম পেন অলিম্পিক স্টেডিয়াম","context_page_description":"জাতীয় অলিম্পিক স্টেডিয়াম হচ্ছে কম্বোডিয়ার প্‌নম পেনে অবস্থিত একটি বহুমুখী স্টেডিয়াম। এই স্টেডিয়ামে বসে ৭০, ০০০ জন দর্শক একসাথে খেলা দেখার ক্ষমতা রাখে। এটির নাম অলিম্পিক স্টেডিয়াম হওয়া সত্ত্বেও, স্টেডিয়ামটিতে কখনোই অলিম্পিক গেমস আয়োজন করা হয়নি।"},{"page_url":"https://bn.wikipedia.org/wiki/%E0%A6%95%E0%A6%A8%E0%A6%95%E0%A6%9A%E0%A7%82%E0%A6%A1%E0%A6%BC%E0%A6%BE","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b3/Siarjf.JPG","page_title":"কনকচূড়া","context_page_description":"কনকচূড়া লেগুমিনোসি গোত্রের অন্তর্ভুক্ত উদ্ভিদ। এটি চারপাশে শাখা-প্রশাখা ছড়িয়ে দিয়ে বেড়ে ওঠে। পাতা যৌগিক। গাছ ও পাতার আকৃতি কৃষ্ণচূড়াগাছের মতোই। কনকচূড়ার শীতের শেষভাগে পাতা ঝরে যায়। গ্রীষ্মে নতুন কচি পাতা আর ফুলে ফুলে ভরে ওঠে। ফুলে পাপড়ির সংখ্যা পাঁচটি ও পাপড়িগুলো কুঞ্চিত। ফুল ফোটে শাখার ডগার লম্বা মঞ্জরিতে।"},{"page_url":"https://fr.wikipedia.org/wiki/Owen_Jones_(architecte)","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e2/Portrait_of_Owen_Jones%2C_Esq.%2C_R.A_%284674168%29.jpg","page_title":"Owen Jones (architecte)","context_page_description":"Owen Jones est un architecte, artiste des arts décoratifs, auteur et enseignant britannique. Par son travail de publication de ses découvertes sur l’utilisation au cours des âges de la couleur dans la décoration, il devint un des pionniers de la chromolithographie."},{"page_url":"https://de.wikipedia.org/wiki/K%C3%B6lner_Platz_(M%C3%BCnchen)","image_url":"http://upload.wikimedia.org/wikipedia/commons/7/75/Heilig_Kreuz_Kirche_Schwabing-Muenchen-2.jpg","page_title":"Kölner Platz (München)","context_page_description":"Der Kölner Platz, 1906 benannt nach der Stadt Köln, ist ein Platz im Münchner Stadtteil Schwabing, im Stadtbezirk Schwabing-West. Der Kölner Platz liegt an der Parzivalstraße an der Einmündung der Bonner Straße.\\nDas bekannteste Gebäude am Kölner Platz ist das Klinikum Schwabing. Zudem befinden sich am Kölner Platz die katholische Anstaltskirche Heilig Kreuz, eine Trinkwasser-Brunnengrotte im Jugendstil von Maximilian Schachner und ein großer Kinderspielplatz.\\nFür das damals weit außerhalb des Stadtzentrums liegende neue Krankenhaus wurde die Straßenbahn als Anbindung des Platzes an die Innenstadt bereits in die Planungen mit einbezogen. So konnte am 1. Februar 1910 eine neue Verbindung von der Bandstraße über die Leopoldstraße zur Parzivalstraße mit der Endhaltestelle vor dem Krankenhaus am neu gebauten Kölner Platz ihren Betrieb aufnehmen, nur einen Monat nach der Eröffnung der ersten Gebäudeabschnitte des Schwabinger Krankenhauses im Januar 1910. Die Trambahnanbindung an die Klinik am Kölner Platz wurde mit unterschiedlichen Linien bis zum 22. November 1975 aufrechterhalten. Seither enden oder starten die Straßenbahnen am Scheidplatz."},{"page_url":"https://ca.wikipedia.org/wiki/Isis_(cr%C3%A0ter)","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/32/Isis_crater_AS17-P-2760.jpg","page_title":"Isis (cràter)","context_page_description":"Isis és un petit cràter lunar situat a la part sud-est del Mare Serenitatis. És al nord-est del petit cràter Dawes i a l'oest dels Montes Taurus. A l'est-nord-est d'aquesta posició hi ha el punt d'aterratge de la missió Apol·lo 17, a la vall Taurus-Littrow.\\nTot i que se'ls com a \\"cràters\\", Isis i el proper Osiris és probable que siguen petits cons volcànics."},{"page_url":"https://ar.wikipedia.org/wiki/%D9%84%D8%A7%D9%83%D8%AA%D9%88%D9%86","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5b/Caprolactone.png","page_title":"لاكتون","context_page_description":"اللاكتونات في الكيمياء العضوية عبارة عن مركبات حلقية غير متجانسة تشكل رابطة إسترية داخل الجزيء نفسه، أي وجود ذرة أكسجين بشكل مباشر بجانب مجموعة كربونيل. يعبر عن اللاكتونات أنها استرات داخلية لأحماض ألفا هيدروكسي."},{"page_url":"https://fi.wikipedia.org/wiki/Michael_Bennet","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fc/Michael_Bennet_Official_Photo.jpg","page_title":"Michael Bennet","context_page_description":"Michael Farrand Bennet on yhdysvaltalainen demokraattipoliitikko. Hän nousi Coloradon osavaltion senaattoriksi tammikuussa 2009 Ken Salazarin siirryttyä Barack Obaman hallinnon sisäministeriksi. Marraskuussa 2010 Bennet valittiin senaattoriksi seuraavalle kuusivuotiskaudelle.\\nBennet Hän syntyi Intiassa hänen isänsä työskennellessä siellä Yhdysvaltojen Intian-suurlähettilään Chester Bowlesin avustajana. Bennet suoritti alemman korkeakoulututkinnon Wesleyan Universityssä Connecticutissa vuonna 1987. Hän valmistui vuonna 1993 Yalen yliopiston oikeustieteellisestä tiedekunnasta.\\nBennet työskenteli vuosina 2003–2005 Denverin pormestarin John Hickenlooperin henkilöstöpäällikkönä."},{"page_url":"https://id.wikipedia.org/wiki/EXO","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/cb/DW67QQYX4AEj02j.jpg","page_title":"EXO","context_page_description":"Exo adalah sebuah boy band Korea Selatan-Tiongkok berbasis di Seoul, dengan sembilan anggota: Suho, Baekhyun, Chanyeol, D.O., Kai, Sehun, Xiumin, Lay, dan Chen. Grup ini dibentuk oleh SM Entertainment pada tahun 2011 dan debut pada tahun 2012. Musik mereka memasukkan aliran seperti pop, hip-hop, dan R&B, dan juga aliran electronic dance music seperti house, trap, dan synth-pop. Exo merilis dan membawakan musik dalam Bahasa Korea, Mandarin, dan Bahasa Jepang. Grup ini menempati posisi lima besar sebagai selebritas paling berpengaruh dalam daftar Forbes Korea Power Celebrity tiap tahun dari 2014 sampai 2018, dan telah dijuluki \\"boy band terbesar di dunia\\" dan \\"kings of K-pop\\" oleh media.\\nGrup ini debut dengan 12 anggota yang dibagi menjadi dua sub-grup: EXO-K dan EXO-M. EXO-K dan EXO-M membawakan musik dalam Bahasa Korea dan Mandarin, masing-masing, sampai tahun 2014. Exo telah menjadi satu grup sejak saat itu, dengan tetap merilis dan membawakan musik dalam beberapa bahasa. Setelah keluarnya Kris, Luhan, dan Tao ditengan tuntutan hukum pada tahun 2014 dan 2015, grup ini tetap bertahan dengan sembilan anggota."},{"page_url":"https://ar.wikipedia.org/wiki/%D8%AD%D9%86%D8%A7%D9%86_%D9%85%D8%A7%D9%85%D8%A7%D9%86","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/64/Hanan_Maman_-_27_January_2016.JPG","page_title":"حنان مامان","context_page_description":"حنان مامان ‏ هو لاعب كرة قدم إسرائيلي في مركز الوسط، ولد في 28 أغسطس 1989 في حيفا في إسرائيل. لعب مع بيتار القدس وفاسلاند بيفيرين وهابوعيل تل أبيب وهبوعيل حيفا."},{"page_url":"https://sv.wikipedia.org/wiki/Nils_Dahlgren_(sk%C3%A5despelare)","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f0/Nils_Dahlgren.jpg","page_title":"Nils Dahlgren (skådespelare)","context_page_description":"Nils Ivar Edvard Dahlgren, född 2 april 1891 i Voxtorps socken, Kalmar län, död 30 oktober 1948 i Karlskoga, var en svensk skådespelare och sångare."},{"page_url":"https://ca.wikipedia.org/wiki/Baix_Tatra","image_url":"http://upload.wikimedia.org/wikipedia/commons/1/18/Low_tatra_dumbier.jpg","page_title":"Baix Tatra","context_page_description":"El Baix Tatra o Tatras és una serralada al centre d'Eslovàquia. Es troba al sud de l'Alt Tatra, de la qual està separada per la vall del riu Váh. La vall formada pel riu Hron es troba al sud de la serralada del Baix Tatra. La cresta va en direcció oest-est i té uns 80 km de llarg.\\nEl pas de Čertovica divideix la cadena en dues parts. Els punts més alts del Baix Tatra es troben en la seva part occidental. Ďumbier és la muntanya més alta amb 2.042 msnm. El seu veí el Chopok és accessible per un telecadira, i és el lloc més visitat en el Baix Tatra. Altres pics en la part occidental inclouen el Dereši i el Chabenec. El pic més alt en la part oriental és el Kráľova hoľa. Les millors perspectives en la part occidental són les de Vésľká Chochuľa, Salatín, Chabenec, Skalka, Chopok, Ďumbier, Siná, Poludnica i Bava.\\nDiverses zones de carst se situen en formacions de calcària i dolomita en les vores meridionals i septentrionals de la cresta principal, que està composta de granit i Gneis. Entre les moltes coves descobertes, la cova Bystrianska, cova de les ratapinyades mortes, Demänovská jaskyňa Slobody, cova de gel Demänová i cova Važecká estan obertes al públic."},{"page_url":"https://az.wikipedia.org/wiki/G%C3%B6y_M%C9%99l%C9%99kl%C9%99ri_m%C9%99b%C9%99di","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/af/IMG_-Zvatnots.jpg","page_title":"Göy Mələkləri məbədi","context_page_description":"Göy Mələkləri Məbədi — Ermənistan respublikası Üçkilsə rayonunun ərazisində, İrəvan – Üçkilsə yolunun 18 – ci kilometrliyində, Üçkilsə şəhəri yaxınlığında yerləşən erməni məbədi."},{"page_url":"https://nl.wikipedia.org/wiki/Steenkoolmijn_Arthur-de-Buyer","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5b/PAB_%2882%29.JPG","page_title":"Steenkoolmijn Arthur-de-Buyer","context_page_description":"De Steenkolenmijn Arthur-de-Buyer was een van de belangrijkste mijnen van de \\"Société des Houillères de Ronchamp\\". Ze bevindt zich in Magny-Danigon in het departement Haute-Saône. De mijn bezat twee mijnschachten en ze was tussen 1900 en 1910 de diepste mijn in Frankrijk."},{"page_url":"https://pt.wikipedia.org/wiki/Galgo_afeg%C3%A3o","image_url":"http://upload.wikimedia.org/wikipedia/commons/a/ad/312-Zoophoto.jpg","page_title":"Galgo afegão","context_page_description":"Galgo afegão é uma raça canina originária do Afeganistão. Oriundo das montanhas dessa nação, chegou à Inglaterra em 1900, como cão de exposição. É considerado um animal caçador, de perseguição, embora seja popular como um glamuroso canino de competições de beleza. Em estudo realizado por Stanley Coren, é considerado o cão que menos responde aos comandos de obediência, ocupando com isso a última posição na publicação A Inteligência dos Cães ainda que seja uma das raças caninas mais antigas que se tem notícia."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%A4%D0%BB%D0%B0%D0%B3_%D0%9F%D1%80%D0%B0%D0%B3%D0%B8","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3d/Prague_flag_with_CoA.svg","page_title":"Флаг Праги","context_page_description":"Флаг Праги — наравне с гербом один из официальных символов Праги, столицы Чехии."},{"page_url":"https://el.wikipedia.org/wiki/%CE%A4%CE%AF%CF%81%CE%B3%CE%BA%CE%BF%CF%85_%CE%9C%CE%BF%CF%8D%CF%81%CE%B5%CF%82","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/89/Palatul_Culturii_%28Targu_Mures%29.jpg","page_title":"Τίργκου Μούρες","context_page_description":"Το Τίργκου Μούρες είναι πόλη της Ρουμανίας στο κεντρικό τμήμα της χώρας, στη γεωγραφική περιοχή της Τρανσυλβανίας, 340 χιλιόμετρα βορείως του Βουκουρεστίου. Είναι πρωτεύουσα της επαρχίας Μούρες και ο πληθυσμός του είναι 134.290."},{"page_url":"https://it.wikipedia.org/wiki/S%C3%A4bener_Stra%C3%9Fe","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6c/Bistro_f%C3%BCr_Besucher_des_FC_Bayern_M%C3%BCnchen.JPG","page_title":"Säbener Straße","context_page_description":"Säbener Straße è un impianto sportivo di proprietà del Bayern Monaco. Si trova a Monaco di Baviera ed è la sede di allenamento della prima squadra e delle giovanili del team. Qui vengono accolti tesserati e i sostenitori della squadra che possono assistere agli allenamenti. I tifosi posso acquistare vari gadget del Bayern.\\nAll'interno del centro ci sono delle palestre, stanze per il fitness, una sala massaggi, una biblioteca, spogliatoi, docce, bar e una sala conferenze oltre ai 6 campi da calcio di cui uno in erba sintetica. Oltre ai campi da calcio sono anche presenti: un campo da pallavolo, una piscina e un campo da pallamano."},{"page_url":"https://pt.wikipedia.org/wiki/Keke_Palmer","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/74/Keke_Palmer_2016_Paleyfest.jpg","page_title":"Keke Palmer","context_page_description":"Lauren Keyana \\"Keke\\" Palmer, é uma atriz, cantora, compositora e dubladora estadunidense. Ela é mundialmente conhecida pelo papel de True Jackson na série True Jackson, VP da Nickelodeon. Sua estréia no cinema foi em 2006 no filme, Akeelah and the Bee como Akeelah Anderson.\\nEm 2007, ela fez o papel de Mary Thomas no filme da Disney Channel, Jump In!, ao lado de Corbin Bleu. No ano seguinte ela ganhou sua própria série na Nickelodeon chamada, True Jackson, VP.\\nEm 2007, Keke também lançou seu primeiro álbum de estúdio, So Uncool e o seu primeiro EP, intitulado Keke Palmer. Em 2010, ela lançou seu segundo álbum de estúdio, com o mesmo nome do EP, Keke Palmer."},{"page_url":"https://en.wikipedia.org/wiki/Shofar","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/cb/Haredi_man_blowing_a_Shofar.jpg","page_title":"Shofar","context_page_description":"A shofar is an ancient musical horn typically made of a ram's horn, used for Jewish religious purposes. Like the modern bugle, the shofar lacks pitch-altering devices, with all pitch control done by varying the player's embouchure. The shofar is blown in synagogue services on Rosh Hashanah and at the very end of Yom Kippur, and is also blown every weekday morning in the month of Elul running up to Rosh Hashanah. Shofars come in a variety of sizes and shapes, depending on the choice of animal and level of finish."},{"page_url":"https://vi.wikipedia.org/wiki/Brachystelma_foetidum","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1a/Brachystelma_foetidum_145-8817.jpg","page_title":"Brachystelma foetidum","context_page_description":"Brachystelma foetidum là một loài thực vật có hoa trong họ La bố ma. Loài này được Schltr. mô tả khoa học đầu tiên năm 1895."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%97%D0%BD%D0%B0%D0%BA%D0%B8_%D0%BF%D0%BE%D1%87%D1%82%D0%BE%D0%B2%D0%BE%D0%B9_%D0%BE%D0%BF%D0%BB%D0%B0%D1%82%D1%8B_%D0%A3%D0%BA%D1%80%D0%B0%D0%B8%D0%BD%D1%8B_(2014)","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/34/Stamps_of_Ukraine%2C_2014-43.jpg","page_title":"Знаки почтовой оплаты Украины (2014)","context_page_description":"Знаки почтовой оплаты Украины (2014) — перечень знаков почтовой оплаты, введённых в обращение почтой Украины в 2014 году.\\nВ 2014 году было выпущено 67 почтовых марок, в том числе 66 памятных и стандартная восьмого выпуска на самоклеющейся бумаге. Тематика коммеморативных марок охватывала юбилеи выдающихся деятелей культуры, памятники архитектуры Украины, знаменательные даты, виды представителей фауны и флоры и другие сюжеты. В обращение поступили марки номиналом от 2,00 до 5,70 гривны."},{"page_url":"https://sk.wikipedia.org/wiki/20._september","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6b/Brian_JOUBERT_2008_World_Championships.jpg","page_title":"20. september","context_page_description":"20. september je 263. deň roka v gregoriánskom kalendári. Do konca roka zostáva 102 dní. Meniny má Ľuboslav a Ľuboslava."},{"page_url":"https://zh.wikipedia.org/wiki/%E5%B0%8F%E5%BC%97%E9%9B%B7%E8%BF%AA%C2%B7%E6%99%AE%E6%9E%97%E6%96%AF","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/03/Freddie_Prinze_Jr_by_David_Shankbone.jpg","page_title":"小弗雷迪·普林斯","context_page_description":"小弗雷迪·普林斯是美國的一位演員。他是莎拉·蜜雪兒·吉蘭的丈夫，並且為世界摔角娛樂工作。普林斯出生在洛杉磯，成長在一個天主教環境。"},{"page_url":"https://ca.wikipedia.org/wiki/Infanteria_de_Marina_(Espanya)","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/dd/Maniobras_Andarax.jpg","page_title":"Infanteria de Marina (Espanya)","context_page_description":"El Cos d'Infanteria de Marina és una unitat operativa amfíbia d'elit enquadrada dins de l'Armada Espanyola. És la infanteria de marina més antiga del món, creada el 27 de febrer de 1537, per l'emperador Carles V. Les funcions principals dels Infants de Marina són: la seva especialització en operacions amfíbies i la seva operativitat, per mar i per terra, la projecció del poder naval mitjançant l'ús de forces amfíbies sobre una costa hostil o potencialment hostil.\\nLa seva capacitat per embarcar en molt poc temps juntament amb el suport aeri i terrestre orgànic de l'Armada, la converteixen en una unitat d'alt valor estratègic pel seu alt grau d'ensinistrament, capacitat i possibilitat de posicionar-se de forma ràpida i discreta en aigües internacionals, constituint un factor de dissuasió i poder naval considerable."},{"page_url":"https://fi.wikipedia.org/wiki/Sanquharin_linna","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b8/Ruined_Sanquhar_Castle_-_geograph.org.uk_-_1472910.jpg","page_title":"Sanquharin linna","context_page_description":"Sanquharin linna on raunioitunut keskiaikainen linna Skotlannissa Dumfriesin ja Gallowayn alueella. Sijainti on taannut sille hyvän luonnollisen suojan muilta sivuilta paitsi idästä, jossa sitä kiertää syvä vallihauta. Ensimmäinen rakennusvaihe on 1300-luvun lopusta, ja osa piharakennuksista on 1500-luvulta. Buten markiisi kunnosti linnaa 1890-luvulla, mutta työ jäi kesken.\\nLinna on Scheduled Monument -suojelukohde vuodesta 1937 alkaen."},{"page_url":"https://ko.wikipedia.org/wiki/%EB%A9%94%EB%A6%B4%EB%A6%B0_%EB%B3%B4%EC%8A%A4_%EC%82%AC%EB%B0%98%ED%8A%B8","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3f/Monty_open_door.svg","page_title":"메릴린 보스 사반트","context_page_description":"메릴린 보스 사반트는 1986~1989년판 기네스북에 \\"세계에서 가장 지능 지수가 높은 사람\\"으로 등재된 사람이다. 현재 기네스북에서 이 영역은 사라졌는데, 당시 그 책에서는 그녀의 IQ를 228로 소개하고 있었다. 참고로 이는 편차 지능이 아니고 비율 지능에 의한 점수로, 확률은 약 3,000만 분의 1이다. 그녀의 직업은 칼럼니스트이고, 1986년 이래로 퍼레이드라는 잡지에서 \\"사반트에게 물어보세요\\"라는 칼럼을 올리고 있다."},{"page_url":"https://cs.wikipedia.org/wiki/Konstantin_Nikolajevi%C4%8D_Rusk%C3%BD","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ef/Konsztantyin_NyikolajevicsRomanov.JPG","page_title":"Konstantin Nikolajevič Ruský","context_page_description":"Konstantin Nikolajevič Ruský, velkokníže Romanov-Holstein-Gottorp byl syn ruského cara Mikuláše I. a mladší bratr Alexandra II. Zároveň byl také ruský generál admirál a hlavní velitel ruského válečného námořnictva v letech 1855-1881 a v období od června 1862 do 31. října 1863 byl místodržitelem Polského království."},{"page_url":"https://fr.wikipedia.org/wiki/100_Women","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f4/SWF_2008_photo.jpg","page_title":"100 Women","context_page_description":"100 Women est une série multi-formats créée en 2013 par la BBC. La série concerne le rôle des femmes au XXIᵉ siècle et inclut des événements à Londres et à Mexico. Après la publication de la liste, l'émission, intitulée BBC's Women Season, est diffusée pendant trois semaines, pendant lesquelles la BBC propose également des rapports en ligne, des débats et des articles sur les femmes. Les femmes du monde entier sont encouragées à participer sur Twitter, en commentant la liste, ainsi que les entretiens et les débats qui suivent sa publication. Une nouvelle liste de lauréates est publiée chaque année depuis 2013."},{"page_url":"https://it.wikipedia.org/wiki/Stretti_di_Giaredo","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ec/Stretti_di_giaredo_13.jpg","page_title":"Stretti di Giaredo","context_page_description":"Gli Stretti di Giaredo sono delle forre fluviali ubicate lungo il Torrente Gordana che si estendono per circa 2 km e sorgono al confine fra i comuni di Pontremoli e Zeri, in Lunigiana.\\nGli Stretti di Giaredo sono facilmente raggiungibili in automobile: per questo negli ultimi anni, anche a seguito di una crescente attenzione, facilitata soprattutto dai social network, sono diventati frequentati in particolare nei mesi più caldi dell'anno."},{"page_url":"https://pl.wikipedia.org/wiki/Sibigi","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/bc/Groble-Sibigi_-_sklep_spo%C5%BCywczo-przemys%C5%82owy_i_%C5%9Bwietlica_-_DSC09198_v1.jpg","page_title":"Sibigi","context_page_description":"Sibigi – przysiółek wsi Groble, położony w Polsce w województwie podkarpackim, w powiecie niżańskim, w gminie Jeżowe.\\nW latach 1975–1998 przysiółek administracyjnie należał do województwa tarnobrzeskiego.\\nPrzysiółki wsi Groble: Sibigi i Zagórzany tworzą sołectwo Sibigi. 1 stycznia 2006 roku sołectwo liczyło 518 ha powierzchni i 241 mieszkańców."},{"page_url":"https://ar.wikipedia.org/wiki/%D9%83%D9%88%D8%B1%D8%AC%D9%88%D9%86_%D8%A3%D8%B3%D9%88%D8%AF_%D8%A7%D9%84%D8%B2%D8%B9%D8%A7%D9%86%D9%81","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9b/FMIB_42893_Blackfin_of_Lake_Michigan_-_Leucichthys_nigripinnis_%28Gill%29.jpeg","page_title":"كورجون أسود الزعانف","context_page_description":"كورجون أسود الزعانف ‏ هو نوع من الأسماك يتبع جنس الكورجون من فصيلة سمك السلمون."},{"page_url":"https://en.wikipedia.org/wiki/Rogalin","image_url":"http://upload.wikimedia.org/wikipedia/commons/8/8a/Rogalin.jpg","page_title":"Rogalin","context_page_description":"Rogalin is a village in western Poland, situated on the river Warta. It lies approximately 7 kilometres east of the town of Mosina, and 19 km south of the metropolitan city of Poznań. It is perhaps best known for the Rogalin Landscape Park and its oak trees."},{"page_url":"https://de.wikipedia.org/wiki/Terrestrial_Trunked_Radio","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/17/Motorola_MTH800.jpg","page_title":"Terrestrial Trunked Radio","context_page_description":"Terrestrial Trunked Radio, ursprünglich Trans European Trunked Radio mit derselben Abkürzung ist ein Standard für digitalen Bündelfunk. Er ist als universelle Plattform für unterschiedliche Mobilfunkdienste genormt. Mit TETRA lassen sich Universalnetze aufbauen, über die der gesamte betriebliche Mobilfunk von Anwendern wie Behörden, Industrie- oder auch Nahverkehrsbetrieben abgewickelt werden kann."},{"page_url":"https://vi.wikipedia.org/wiki/USS_Porter_(DD-356)","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/03/USS_Porter_%28DD-356%29_off_Yorktown%2C_Virginia_%28USA%29%2C_on_19_April_1939_%28NH_66338%29.jpg","page_title":"USS Porter (DD-356)","context_page_description":"USS Porter (DD-356) là một tàu khu trục, là chiếc dẫn đầu trong lớp của nó bao gồm tám chiếc được Hải quân Hoa Kỳ chế tạo vào giữa những năm 1930. Nó là chiếc tàu chiến thứ ba của Hải quân Hoa Kỳ được đặt tên theo Thiếu tướng Hải quân David Porter, và con ông, Đô đốc David Dixon Porter. Porter đã phục vụ trong Chiến tranh Thế giới thứ hai cho đến khi bị mất do trúng ngư lôi trong Trận chiến quần đảo Santa Cruz tại Thái Bình Dương vào tháng 10 năm 1942."},{"page_url":"https://pt.wikipedia.org/wiki/Lista_de_cidades_na_Bulg%C3%A1ria","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/06/Mosque_in_Dupnitsa.jpg","page_title":"Lista de cidades na Bulgária","context_page_description":"Esta é uma lista de cidades na Bulgária. Capitais das províncias são exbidas em negrito."},{"page_url":"https://lt.wikipedia.org/wiki/Puskiparisis","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2a/Chamaecyparis_lawsoniana_Dorena2.jpg","page_title":"Puskiparisis","context_page_description":"Puskiparisis – pušūnų skyriaus, kiparisinių šeimos spygliuočių augalų gentis. Paplitusi Rytų Azijoje ir Šiaurės Amerikoje.\\nTai 20-70 m aukščio visžaliai medžiai plokščiomis šakelėmis. Kaip ir kitų kiparisinių, puskiparisio spygliai – maži žvyneliai, prigludę prie šakų."},{"page_url":"https://tt.wikipedia.org/wiki/%D0%9C%D0%B8%D1%85%D0%B0%D0%B8%D0%BB_%D0%A0%D0%B5%D0%B9%D1%82%D0%B5%D1%80%D0%BD","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/bb/PGRS_1_079_Reitern_-_full.jpg","page_title":"Михаил Рейтерн","context_page_description":"Михаил Рейтерн — РИ дәүләт эшлеклесе, хакыйкый яшерен киңәшче, РИ финанс министры, РИ министрлар кәмитите рәисе, Казанның шәрәфле ватандашы."},{"page_url":"https://it.wikipedia.org/wiki/Il_Gorzen","image_url":"http://upload.wikimedia.org/wikipedia/commons/0/08/Ridderkerk_-_De_Gorzen_%281%29.jpg","page_title":"Il Gorzen","context_page_description":"Il Gorzen è un parco naturale nella regione olandese dell'Olanda Meridionale, situato sul lato orientale di Ridderkerk, tra il nuovo Veer e il nuovo porto. Il parco naturale e ricreativo \\"Il Gorzen\\" è un'ex discarica con una superficie totale di 16 ettari. Il parco è stato creato allo scopo di poter praticare tutti i tipi di attività e circostanze in un periodo di mezzo secolo modellato ad un parco naturale collinare con alcuni laghi e ruscelli."},{"page_url":"https://sv.wikipedia.org/wiki/Radovi%C5%A1","image_url":"http://upload.wikimedia.org/wikipedia/commons/d/d6/Center_Radovis_Macedonia.jpg","page_title":"Radoviš","context_page_description":"Radoviš är en stad i den Sydöstra regionen i Nordmakedonien. Det är regionens näst största stad, med 16 233 invånare. Det är även centralorten i kommunen Radoviš som ligger vid den sydvästra foten av berget Plačkovica och i den norra delen av dalen Strumica.\\nStaden tros ha uppkommit i början av 1000-talet när Basileios II regerade.\\nRadovišfloden rinner igenom staden."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Stempelstellen_der_Harzer_Wandernadel","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/94/Hexentanzplatz_Walkenried.jpg","page_title":"Liste der Stempelstellen der Harzer Wandernadel","context_page_description":"Diese Liste der Stempelstellen der Harzer Wandernadel bietet einen Überblick über die regulären und ehemaligen Stempelstellen der Harzer Wandernadel, bei der es sich um ein System zur Auszeichnung von aktiven Wanderern im Harz handelt.\\nNeben den regulären und ehemaligen Stempelstellen enthält die Liste auch die Sonderstempelstellen des Wandernden Stempelkastens seit der Wandersaison 2009/10.\\nEs werden die Nummer, die geografische Lage, der Landkreis, in welchem die jeweilige Stempelstelle liegt und der nächste Ort angegeben. Bei den saisonalen Stempelstellen findet sich zudem eine Zeitangabe, zu welcher der Wandernde Stempelkasten an der entsprechenden Sehenswürdigkeit Halt gemacht hat.\\nZu den meisten Stempelstellen ist auch ein Bild der jeweiligen Örtlichkeit verfügbar, welches einen ersten Eindruck des Wanderziels vermittelt."},{"page_url":"https://nl.wikipedia.org/wiki/Atjeh-medaille_1873-1874","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fa/Atjehmedaille.jpg","page_title":"Atjeh-medaille 1873-1874","context_page_description":"De Atjeh-medaille 1873-1874 is een door Koning Willem III der Nederlanden op 12 mei 1874 in een Koninklijk Besluit ingestelde herinnerings- of campagnemedaille. De medaille werd uitgereikt aan de deelnemende troepen aan de eerste Atjeh-oorlog en de tweede Atjeh-oorlog.\\nAan alle militairen, die aan de eerste Atjeh-expeditie en/of de eerste zes maanden van de Tweede Atjeh expeditie, hadden deelgenomen werd bij Koninklijk Besluit no. 9 van 12 mei 1874 een herinneringsmedaille toegekend. Officieel heette deze de \\"Atjeh-medaille 1873-1874\\", maar omdat het doel van de operatie de inname van de Kraton was geweest staat de medaille bekend als de \\"Kraton-medaille\\"."},{"page_url":"https://cs.wikipedia.org/wiki/V%C3%ADly_z_Cottingley","image_url":"http://upload.wikimedia.org/wikipedia/commons/7/74/UK_Cottingley_%28Bradford%29_V2.jpg","page_title":"Víly z Cottingley","context_page_description":"Víly z Cottingley je pojmenování série pěti fotografií, které pořídily dvě mladé sestřenice Elsie Wrightová a Frances Griffithsová žijící ve městě Cottingley poblíž Bradfordu v Anglii. V roce 1917, kdy pořídily první ze dvou fotografií, bylo Elsie 16 let a Frances 10. Snímky přilákaly pozornost spisovatele sira Arthura Conana Doyla, který je využil jako ilustraci k článku o vílách pro vánoční vydání časopisu The Strand Magazine v roce 1920. Conan Doyle, jako spiritualista, byl fotografiemi nadšen a interpretoval je jako jasné a viditelné známky duchovních jevů. Veřejné reakce byly smíšené, někteří považovali obrazy za pravé, jiní však byli přesvědčeni, že jsou falešné.\\nZájem o víly z Cottingley po roce 1921 postupně klesal. Obě dívky vyrostly, vdaly se a nějakou dobu žily v zahraničí. Fotografie přesto udržovaly představivost veřejnosti, v roce 1966 reportér z novin Daily Express vyhledal Elsie, která se vrátila do Velké Británie. Elsie připustila možnost, že si myslela, že fotografovala své představy a média se opět začala o příběh zajímat."},{"page_url":"https://en.wikipedia.org/wiki/Captain_general_of_the_Army","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/46/Retrato_del_general_Rodil_%28Dionisio_Fierros_%C3%81lvarez%29.jpg","page_title":"Captain general of the Army","context_page_description":"Captain General has been the highest rank in the Spanish Army since the 18th century. A five-star rank with NATO code OF-10, it is equivalent to a field marshal of the armies of numerous countries, a general of the Army of the United States, a captain general of the Spanish Navy or a Captain general of the Air Force in the Spanish Air Force. A Captain General's insignia consists of two command sticks under five four-pointed stars below the Royal Crown.\\nA personal rank of captain general was created in the Spanish Army as the highest rank in the hierarchy, not unlike the Marechal de France. Since King Charles IV's reign, the monarchs used captain general insignia when wearing uniform. Briefly abolished by the Second Spanish Republic, it was restored by Nationalist Spain in 1938; Francisco Franco himself was the only officer of this rank. The effective rank was reserved to the reigning monarch. A few posthumous honorary promotions and honorary promotions of retired officers to this rank were also made, such as José Moscardó Ituarte, Agustín Muñoz Grandes, Camilo Alonso Vega or Manuel Gutiérrez Mellado."},{"page_url":"https://ro.wikipedia.org/wiki/Regniowez","image_url":"http://upload.wikimedia.org/wikipedia/commons/0/06/Map_commune_FR_insee_code_08355.png","page_title":"Regniowez","context_page_description":"Regniowez este o comună în departamentul Ardennes din nordul Franței. În 2009 avea o populație de 392 de locuitori."},{"page_url":"https://en.wikipedia.org/wiki/Daniel_Burnham","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/06/Looking_West_From_Peristyle%2C_Court_of_Honor_and_Grand_Basin%2C_1893.jpg","page_title":"Daniel Burnham","context_page_description":"Daniel Hudson Burnham, FAIA was an American architect and urban designer. A proponent of the Beaux-Arts movement, he may have been, \\"the most successful power broker the American architectural profession has ever produced.\\"\\nA successful Chicago architect, he was selected as Director of Works for the 1892–93 World's Columbian Exposition, colloquially referred to as \\"The White City\\". He had prominent roles in the creation of master plans for the development of a number of cities, including the Plan of Chicago, and plans for Manila, Baguio and downtown Washington, D.C.. He also designed several famous buildings, including a number of notable skyscrapers in Chicago, the Flatiron Building of triangular shape in New York City, Union Station in Washington D.C., London's Selfridges department store, and San Francisco's Merchants Exchange.\\nAlthough best known for his skyscrapers, city planning, and for the White City, almost one third of Burnham's total output – 14.7 million square feet – consisted of buildings for shopping."},{"page_url":"https://en.wikipedia.org/wiki/Gene_Lipscomb","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f3/Gene_Lipscomb_1961.jpg","page_title":"Gene Lipscomb","context_page_description":"Eugene Allen \\"Gene\\" Lipscomb was an American football defensive lineman in the National Football League and a professional wrestler. He was known by the nickname \\"Big Daddy\\"."},{"page_url":"https://ja.wikipedia.org/wiki/%E4%B9%85%E5%B1%8B%E5%A4%A7%E9%80%9A%E9%A7%85","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/48/Subway_Hisaya-odori_Station_Platform.JPG","page_title":"久屋大通駅","context_page_description":"久屋大通駅は、愛知県名古屋市中区錦三丁目にある名古屋市営地下鉄の駅である。\\n名城線と桜通線が乗り入れる。名城線にはM06、桜通線にはS05の駅番号が付与されている。"},{"page_url":"https://fi.wikipedia.org/wiki/Riika","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8e/Riikan_rautatiesilta.jpg","page_title":"Riika","context_page_description":"Riika on Latvian pääkaupunki. Se sijaitsee Itämeren rannalla Väinäjoen suulla. Kaupunki on tärkeä alueellinen satamakaupunki ja teollisuuden keskus. Riika on myös Baltian maiden väkiluvultaan suurin kaupunki. Väkiluku on kuitenkin pudonnut jatkuvasti Latvian itsenäistymisen jälkeen. Noin 42,6 prosenttia Riian asukkaista on kansallisuudeltaan latvialaisia, venäläisiä on 39,8 prosenttia, valkovenäläisiä 4,1 prosenttia, ukrainalaisia 3,7 prosenttia, puolalaisia 1,9 prosenttia ja loput muita kansallisuuksia.\\nSuomen kielessä kaupungin nimi Riika taipuu kuten siika: Riika: Riiassa: Riikaan."},{"page_url":"https://da.wikipedia.org/wiki/Johann_Snell","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e0/Dyalogus_creaturarum-s197-cropped.jpg","page_title":"Johann Snell","context_page_description":"Johan Snell var en tysk bogtrykker fra Lübeck, som introducerede bogtrykkerkunsten i Danmark og Sverige og trykte de første kendte bogværker i Norden."},{"page_url":"https://ca.wikipedia.org/wiki/Toul","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/ba/Map_commune_FR_insee_code_54528.png","page_title":"Toul","context_page_description":"Toul és un municipi francès, situat al departament de Meurthe i Mosel·la i a la regió del Gran Est.\\nSituada a l'oest de la capital Nancy, és la subprefectura del districte de Toul. Comptava en 2006 amb una població de 16.617 habitants. La seua economia s'ha centrat des de finals del segle XIX en la seua condició de base militar i caserna de diverses unitats militars franceses i de l'OTAN, així com en la viticultura amb la producció de vins de la denominació d'origen \\"Côtes de Toul\\"."},{"page_url":"https://sr.wikipedia.org/wiki/%D0%9B%D0%B0%D0%B5%D1%80","image_url":"http://upload.wikimedia.org/wikipedia/commons/f/f6/Laer_in_ST.svg","page_title":"Лаер","context_page_description":"Лаер општина је у њемачкој савезној држави Северна Рајна-Вестфалија. Једно је од 24 општинска средишта округа Штајнфурт. Према процјени из 2010. у општини је живјело 6.326 становника. Посједује регионалну шифру 5566036, NUTS и LOCODE код."},{"page_url":"https://en.wikipedia.org/wiki/Timeline_of_Venice","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/88/Canaletto_-_De_ingang_van_het_Canal_Grande_bij_de_Punta_della_Dogana_en_de_Santa_Maria_della_Salute.jpg","page_title":"Timeline of Venice","context_page_description":"The following is a timeline of the history of the city of Venice, Veneto, Italy."},{"page_url":"https://fi.wikipedia.org/wiki/Aavasaksan_kruununpuiston_matkailurakennukset","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ec/Aavasaksa_observation_tower_2.jpg","page_title":"Aavasaksan kruununpuiston matkailurakennukset","context_page_description":"Aavasaksan kruununpuiston matkailurakennukset ovat Ylitornion Aavasaksanvaaralle eri aikoina rakennettuja matkailua palvelevia rakennuksia. Aavasaksan kruununpuisto on perustettu vuonna 1877 – maailmanlaajuisesti ensimmäiset luonnonsuojelualueet perustettiin 1800-luvun loppupuolella. Vuonna 2009 Museovirasto määritteli Aavasaksan kruununpuiston matkailurakennukset yhdeksi Suomen valtakunnallisesti merkittävistä rakennetuista kulttuuriympäristöistä."},{"page_url":"https://fi.wikipedia.org/wiki/Kromosomimutaatio","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/11/Mutaatiotyypit.png","page_title":"Kromosomimutaatio","context_page_description":"Kromosomimutaatio on kromosomin rakenteen muutos. Kaikki kromosomimutaatiot edellyttävät kromosominmurtumaa eli kromosomin rakenteen katkeamista.\\nKromosomimutaation tyypit:\\nHäviämä, jossa kromosomista häviää jokin osa\\nKahdentuma, jossa kromosomiin liittyy toinen samanlainen osa toisesta kromosomista\\nKääntymä, jossa kromosomin geenien järjestys muuttuu käänteiseksi tietyssä kromosomin osassa\\nLiittymä, jossa kromosomiin liittyy jokin toisen kromosomin osa tai osia muualta samasta kromosomista\\nSiirtymä, jossa kaksi erilaista kromosomia vaihtavat osia"},{"page_url":"https://eu.wikipedia.org/wiki/Zaisan_aintzira","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/77/Zaysan.jpg","page_title":"Zaisan aintzira","context_page_description":"Zaisan ekialdeko Kazakhstango aintzira da, Altai eta Tarbagatai mendien artean dagoena. Irtyx ibaiak zeharkatzen du. Kretazeon sortua, munduko aintzirarik zaharrenetariko bat da."},{"page_url":"https://en.wikipedia.org/wiki/Peter_Fulton","image_url":"http://upload.wikimedia.org/wikipedia/commons/8/87/Fulton_and_Broom.jpg","page_title":"Peter Fulton","context_page_description":"Peter Gordon Fulton is a former New Zealand international cricketer who played for Canterbury at domestic level. He comes from a well recognised cricketing family with his uncle Roddy Fulton playing and captaining both Canterbury, Northern Districts, and New Zealand A from 1972–1985. He retired from first-class cricket in April 2017."},{"page_url":"https://pt.wikipedia.org/wiki/Vanguard_(foguete)","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/bb/Vanguard_rocket.jpg","page_title":"Vanguard (foguete)","context_page_description":"O foguete Vanguard foi criado com a intenção de ser o primeiro veículo lançador usado pelos Estados Unidos para\\ncolocar um satélite em órbita.\\nNo entanto, a \\"Crise do Sputnik\\", causada pelo lançamento do Sputnik 1 e a falha do Vanguard TV3, levaram o governo\\namericano a optar pelo satélite Explorer 1, que por sua vez usava o foguete Juno I. Isso fez com que o foguete Vanguard se tornasse apenas o\\nsegundo veículo lançador de satélites americano.\\nOs foguetes Vanguard, foram usados no Projeto Vanguard entre 1957 e 1959. Das doze tentativas de lançamento, apenas três resultaram em sucesso ao colocar um\\nsatélite em órbita."},{"page_url":"https://fr.wikipedia.org/wiki/Liste_des_meilleurs_intercepteurs_en_NBA_en_carri%C3%A8re","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/73/Dwyane_Wade_e1.jpg","page_title":"Liste des meilleurs intercepteurs en NBA en carrière","context_page_description":"Cette page présente la liste des meilleurs intercepteurs en NBA en carrière en saison régulière."},{"page_url":"https://pt.wikipedia.org/wiki/Dom_Quixote_(Gustave_Dor%C3%A9)","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/bc/Cap_IX_Dom_Quixote_em_luta_com_o_escudeiro_Biscainho.jpg","page_title":"Dom Quixote (Gustave Doré)","context_page_description":"Dom Quixote é uma série de 370 gravuras em metal e xilogravuras criada por Gustave Doré, eminente artista francês do século XIX, para a ilustração de Dom Quixote de La Mancha de Miguel de Cervantes na edição em francês de 1863.\\nAs ilustrações da obra foram tão influentes que determinaram a representação de Quixote e Sancho Pança em muitas versões ilustradas subsequentes, produções teatrais e cinematográficas e na imaginação dos leitores, ainda que outros grandes artistas tenham sido atraídos pela obra como por exemplo Honoré Daumier, Pablo Picasso, e Salvador Dalí.\\nNa edição em inglês de 1868 do Dom Quixote com ilustrações de Gustave Doré, é referido que “em todas as casas de língua inglesa onde se pode soletrar a palavra arte encontram-se edições de Doré”, o que demonstra a enorme popularidade das ilustrações de Doré.\\nA ilustração por Gustave Doré da obra de Cervantes não era inédita, pois já havia os exemplos de Coypel e Tony Johannot, e dos ilustradores espanhóis da grande edição de Ibarra publicada em Madrid em 1780."},{"page_url":"https://fi.wikipedia.org/wiki/Come_Taste_the_Band","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7b/Tommy_Bolin_with_a_Yamaha_SX.jpg","page_title":"Come Taste the Band","context_page_description":"Come Taste the Band on englantilaisen hard rock -yhtye Deep Purplen albumi vuodelta 1975. Musiikillisesti se edustaa hard rockia, sisältäen vaikutteita myös progressiivisesta rockista, funkista, heavy metalista ja rock and rollista.\\nLevyllä soittaa yhtyeen neljäs kokoonpano, niin sanottu Mark IV. Se on yhtyeen ainoa albumi, jolla soittaa yhdysvaltalainen kitaristi Tommy Bolin. Bolin korvasi vuonna 1975 yhtyeen alkuperäisen kitaristin Ritchie Blackmoren. Ainoat alkuperäisjäsenet albumilla ovat kosketinsoittaja Jon Lord ja rumpali Ian Paice. Laulaja David Coverdale ja basisti-laulaja Glenn Hughes olivat liittyneet yhtyeeseen aiemmin vuonna 1973. Bolinin pahan huumeriippuvuuden vuoksi Come Taste the Band -kiertueen konserttien onnistuminen oli tuolloin yleensä pitkälti kiinni hänen kunnostaan. Myös Hughesin kokaiininkäyttö aiheutti yhtyeelle ongelmia. Albumi jäi Mark IV:n ainoaksi albumiksi, sillä albumin kiertueiden jälkeen Deep Purple hajosi 1976 kahdeksaksi vuodeksi. Myöhemmin samana vuonna Bolin kuoli heroiinin yliannostukseen.\\nCome Taste the Band menestyi kaupallisesti heikommin kuin aikaisemmat Deep Purple -albumit."},{"page_url":"https://en.wikipedia.org/wiki/Center_for_Philosophy_of_Science","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/53/PhilofSciOfficePitt.jpg","page_title":"Center for Philosophy of Science","context_page_description":"The Center for Philosophy of Science is an academic center located at the University of Pittsburgh in Pittsburgh, Pennsylvania, dedicated to research in the philosophy of science. The Center was founded by Adolf Grünbaum in 1960. The current Director of the Center is Edouard Machery."},{"page_url":"https://de.wikipedia.org/wiki/Emilio_Lunghi","image_url":"http://upload.wikimedia.org/wikipedia/commons/7/74/Emilio_Lunghi.jpg","page_title":"Emilio Lunghi","context_page_description":"Emilio Lunghi war ein italienischer Mittelstreckenläufer und Sprinter.\\nBei den Olympischen Spielen 1908 in London gewann er über 800 Meter mit 1:54,2 min die Silbermedaille hinter dem US-Amerikaner Mel Sheppard. Über 1500 Meter wurde er im Vorlauf mit 4:03,8 min Zweiter hinter Norman Hallows und verpasste damit die Teilnahme am Finale, für das sich nur die Vorlaufsieger qualifizierten, obwohl seine Zeit nicht nur die zweitschnellste in den Vorläufen war, sondern auch im Finale für die Bronzemedaille gereicht hätte. Im 3-Meilen-Mannschaftslauf kam er im Vorlauf nicht ins Ziel und schied mit der italienischen Mannschaft aus.\\nIm Jahr darauf stellte er, für den Irish-American Athletic Club startend, drei Weltbestzeiten auf: 1:27,8 min für 700 Yards, 1:52,8 min für 880 Yards und 2:45,6 min für eine Zwei-Drittel-Meile.\\n1912 erreichte er bei den Olympischen Spielen in Stockholm über 400 Meter und über 800 Meter jeweils das Halbfinale."},{"page_url":"https://fr.wikipedia.org/wiki/Phare_d%27Emden","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a0/Flug_Emden_2010_055.JPG","page_title":"Phare d'Emden","context_page_description":"Le phare d'Emden est un phare actif situé à l'entrée du port de Emden, en Allemagne. Il est géré par la WSV de Emden."},{"page_url":"https://en.wikipedia.org/wiki/Brahmi_script","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/35/AgathoklesCoinage.jpg","page_title":"Brahmi script","context_page_description":"Brahmi is the modern name for a writing system of ancient India. The Brahmi writing system, or script, appeared as a fully developed universal one in South Asia in the third century BCE, and is a forerunner of all writing systems that have found use in South Asia with the exception of the Indus script of the third millennium BCE, the Kharosthi script, which originated in what today is northwestern Pakistan in the fourth or possibly fifth century BCE, the Perso-Arabic Scripts of the medieval period, and the Latin scripts of the modern period. Its descendants, the Brahmic scripts, continue to be in use today not only in South Asia, but also Southeast Asia. Brahmi is an abugida which uses a system of diacritical marks to associate vowels with consonant symbols.\\nSeveral divergent accounts of the origin of the name \\"Brahmi\\" appear in history and legend. Several Sutras of Jainism such as the Vyakhya Pragyapti Sutra, the Samvayanga Sutra and the Pragyapna Sutra of the Jain Agamas include a list of 18 writing scripts known to teachers before the Mahavira was born, with the Brahmi script leading all these lists."},{"page_url":"https://pl.wikipedia.org/wiki/Sprz%C4%99t_wspinaczkowy","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f4/HMS-%28climbing%29.jpg","page_title":"Sprzęt wspinaczkowy","context_page_description":"Sprzęt wspinaczkowy – zestaw urządzeń technicznych stosowanych w trakcie uprawiania wszelkich rodzajów wspinaczki.\\nLina wspinaczkowa – powszechnie rozpoznawany symbol wspinaczki i rzeczywiście najważniejszy składnik systemu asekuracyjnego.\\nUprząż wspinaczkowa – którą wspinacz zakłada na siebie i następnie przywiązuje do niej linę. Uprzęże dzielą się na wygodniejsze, ale mniej bezpieczne, oraz uprzęże pełne składające się z pasa biodrowego i piersiowego.\\nKask wspinaczkowy – zabezpieczający głowę wspinacza przed spadającymi kamieniami lub przed uderzeniem w skałę.\\nPrzyrządy do zakładania punktów asekuracyjnych – składają się na nie:\\nHaki – które wbija się w szczeliny w ścianie. Obecnie nie są one popularne ze względu na dużą masę, konieczność wbijania ich młotkiem i szkody jakie powodują w skale.\\nSpity – stałe elementy asekuracyjne montowane do otworów wierconych w skale, działają podobnie jak kołek rozporowy. Spity bardzo rzadko osadzane są podczas przechodzenia drogi i zdarza się to wyłącznie w rejonach górskich, w rejonach skałkowych spity osadzane są ze zjazdu.\\nRingi – stałe elementy asekuracyjne wklejane w otwory wiercone w skale."},{"page_url":"https://ar.wikipedia.org/wiki/%D9%85%D8%A7%D9%83%D8%A7%D9%8A_(%D8%A7%D9%84%D8%A8%D8%B1%D8%A7%D8%B2%D9%8A%D9%84)","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/11/BrasaoMacae.jpg","page_title":"ماكاي (البرازيل)","context_page_description":"ماكاي هي بلدية في البرازيل، تتبع ريو دي جانيرو، بلغ عدد سكانها 132,461 نسمة في 2000، تبلغ مساحتها 469 ميل مربع."},{"page_url":"https://gl.wikipedia.org/wiki/Appenzeller","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/42/Appb_product_0009_bc.jpg","page_title":"Appenzeller","context_page_description":"O appenzeller é un queixo suízo feito a base de leite de vaca de pasta dura cun gusto intenso, refinado e característico, especialidade dos cantóns de Appenzell Interior e Appenzell Exterior."},{"page_url":"https://fr.wikipedia.org/wiki/James_Earl_Jones","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/14/James_Earl_Jones_2010.jpg","page_title":"James Earl Jones","context_page_description":"James Earl Jones est un acteur américain, né le 17 janvier 1931 à Arkabutla.\\nIl est le fils de l'acteur Robert Earl Jones. Il est notamment connu pour son rôle de Thulsa Doom dans Conan le Barbare et pour avoir prêté sa voix au célèbre Dark Vador de la saga Star Wars ainsi qu'à Mufasa dans Le Roi lion et la voix off de CNN pendant les années 80 et 90 avec le fameux slogan « This is CNN ». Il reçoit en 2012 un Oscar d'honneur pour l'ensemble de sa carrière."},{"page_url":"https://es.wikipedia.org/wiki/American_Alpha","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d8/American_Alpha_NXT_Takeover_Dallas_2016.jpg","page_title":"American Alpha","context_page_description":"American Alpha fue un tag team de lucha libre profesional conformado por Jason Jordan y Chad Gable, que trabajaban para la WWE en su marca SmackDown Live y anteriormente en su territorio de desarrollo NXT.\\nDentro de sus logros, están el haber sido una vez Campeones en Parejas de NXT y una vez Campeones en Parejas de SmackDown."},{"page_url":"https://en.wikipedia.org/wiki/Anti-Concorde_Project","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/61/ACPTimes.jpg","page_title":"Anti-Concorde Project","context_page_description":"The Anti-Concorde Project, founded by environmental activist Richard Wiggs,\\nchallenged the idea of supersonic passenger transport, and curtailed Concorde's commercial prospects. When Concorde entered service in 1976, of the 74 options held at the time of the first flight, only those for the state airlines of Britain and France were taken up, so that only 20 were built, although flights were also flown for Braniff International and Singapore Airlines. It triggered research into the factors affecting the creation of sonic booms, which led to the Shaped Sonic Boom Demonstration which achieved their goal of reducing the intensity of sonic booms, and echoed public concern about aircraft noise that resulted in more restrictive noise limits for aircraft and airport operations, as well as changes in both operating procedures and aircraft design to further reduce noise levels."},{"page_url":"https://de.wikipedia.org/wiki/Californium","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/af/Berkeley_60-inch_cyclotron.jpg","page_title":"Californium","context_page_description":"Californium ist ein künstlich erzeugtes chemisches Element mit dem Elementsymbol Cf und der Ordnungszahl 98. Im Periodensystem steht es in der Gruppe der Actinoide und zählt auch zu den Transuranen. Benannt wurde es nach der Universität von Kalifornien und dem US-amerikanischen Bundesstaat Kalifornien, wo es entdeckt wurde. Bei Californium handelt es sich um ein radioaktives Metall. Es wurde im Februar 1950 erstmals aus dem leichteren Element Curium erzeugt. Es entsteht in geringen Mengen in Kernreaktoren. Anwendung findet es vor allem für mobile und tragbare Neutronenquellen, aber auch zur Erzeugung höherer Transurane und Transactinoide."},{"page_url":"https://de.wikipedia.org/wiki/Ministerium_f%C3%BCr_Gesundheitspflege_und_Soziale_Dienste_der_Vereinigten_Staaten","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/76/Alex_Azar_WWSG_Photo_%28cropped%29.jpg","page_title":"Ministerium für Gesundheitspflege und Soziale Dienste der Vereinigten Staaten","context_page_description":"Das Ministerium für Gesundheitspflege und Soziale Dienste der Vereinigten Staaten stellt das amerikanische Gesundheitsministerium dar und bildet einen Teil der US-Bundesregierung.\\nAufgabe des Ministeriums ist, „Gesundheit und Wohlergehen aller US-Bürger zu fördern und zu schützen, indem es leistungsfähige medizinische und humanitäre Dienste bereitstellt und medizinische Forschung, öffentliche Gesundheit und soziale Dienste adäquat unterstützt.“ Wichtigste untergeordnete Behörde ist der U.S. Public Health Service, der dem Surgeon General of the United States untersteht und eine militärische Organisationsform hat. Sitz des Ministeriums ist Washington, D.C.\\nEs wurde durch den Department of Education Organization Act geschaffen und nahm am 4. Mai 1980 zusammen mit dem ebenfalls neu gegründeten Bildungsministerium die Arbeit auf. Die Aufgaben des Ministeriums waren bis zur Verabschiedung des Bundesgesetzes 1979 im Gesundheits-, Bildungs- und Wohlfahrtsministerium eingegliedert. Das Ministerium wird vom Gesundheitsminister der Vereinigten Staaten geführt."},{"page_url":"https://fr.wikipedia.org/wiki/Vieux_pont_(Bratislava)","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/61/Stary_most.jpg","page_title":"Vieux pont (Bratislava)","context_page_description":"Le Vieux pont est le plus vieux pont encore debout sur le Danube à Bratislava en Slovaquie."},{"page_url":"https://en.wikipedia.org/wiki/Megalith","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/66/Guam_Dolmen_Sites.JPG","page_title":"Megalith","context_page_description":"A megalith is a large pre-historic stone that has been used to construct a structure or monument, either alone or together with other stones. There are over 35,000 in Europe alone, ranging from Sweden to the Mediterranean sea.\\nThe word was first used in 1849 by the British antiquarian Algernon Herbert in reference to Stonehenge and derives from the Ancient Greek. Most extant megaliths were erected between the Neolithic period through the Chalcolithic period and into the Bronze Age."},{"page_url":"https://sr.wikipedia.org/wiki/%D0%A6%D1%80%D0%BA%D0%B2%D0%B0_%D0%A1%D0%B2%D0%B5%D1%82%D0%BE%D0%B3_%D0%94%D0%B8%D0%BC%D0%B8%D1%82%D1%80%D0%B8%D1%98%D0%B0_%D1%83_%D0%9A%D1%80%D0%B0%D0%B3%D1%83%D1%98%D0%B5%D0%B2%D1%86%D1%83","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/71/Wiki_%C5%A0umadija_XI_Crkva_Sv._Dimitrija_%28Kragujevac%29_721.jpg","page_title":"Црква Светог Димитрија у Крагујевцу","context_page_description":"Црква Светог Димитрија у Крагујевцу, на територији града Крагујевца, подигнута је 2003. године, припада Епархији шумадијској Српске православне цркве."},{"page_url":"https://ja.wikipedia.org/wiki/%E3%82%B7%E3%82%AF%E3%83%A9%E3%82%BB%E3%83%B3","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b3/Synthesis_of_612cyclacene_by_Stoddart_and_co-workers.png","page_title":"シクラセン","context_page_description":"シクラセンは、たがに似た形の多環式化合物である。芳香属基が互いに融合し、環状構造を形成している。その電子特性や構造特性や超分子化学、分子認識への応用により、有機化学の分野で注目され、興味深くチャレンジングな合成のターゲットとなっている。1980年代末のフレイザー・ストッダートらの先駆的な研究とその後の他のグループの研究により、様々なシクラセンの合成が達成された。図1は、合成に成功したシクラセンの2つの例を示している。"},{"page_url":"https://ko.wikipedia.org/wiki/%EB%AC%B8%ED%99%94%EB%B0%A9%EC%86%A1","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/88/Mbc_197407_-_198104.png","page_title":"문화방송","context_page_description":"문화방송은 대한민국 수도권을 가시청권으로 하는 지상파 준공영방송사이다. 다른 지역의 16개의 문화방송네트워크 방송사와 함께 전국방송망을 구축하고 있다. 1961년 2월 21일 창립하였으며, 12월 2일에 라디오 방송국으로 개국했다. 문화방송이 운영하고 있는 라디오방송은 표준FM과 FM4U가 있으며, 24시간 방송한다. 문화방송의 호출부호는 HLKV이다."},{"page_url":"https://ca.wikipedia.org/wiki/Pholcus_phalangioides","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e4/Pholcus_phalangioides_MHNT_male.jpg","page_title":"Pholcus phalangioides","context_page_description":"Pholcus phalangioides, anomenada popularment aranya de potes llargues i en alguns casos, aranya calavera per l'aparença del seu cefalotòrax, és una espècie de la família dels fòlcids.\\nLes femelles tenen una longitud corporal de 9 mm; els mascles són lleugerament més petits. Les seves potes són de 6 a 7 vegades la longitud del seu cos. Acostuma a viure en el sostre de les habitacions, coves, garatges o els cellers, la qual cosa li dóna un dels seus noms comuns: aranya de celler. Es consideren beneficioses en algunes parts de món perquè s'alimenta d'insectes i aràcnids molests presents a les cases. Aquesta és l'única espècie d'aranya descrita pel entomòleg suís Johann Kaspar Füssli, que la va registrar el 1775 com a Aranea phalangoides."},{"page_url":"https://de.wikipedia.org/wiki/Eurocheque-Karte","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ea/Eurocheque-Garantie.svg","page_title":"Eurocheque-Karte","context_page_description":"Die Eurocheque-Karte war bis zum 1. Januar 2002 eine Garantiekarte für die Einlösung eines Eurocheques. Der Name der auf einem Scheck und einer Plastikkarte beruhenden Zahlungsverkehrsdienstleistung wurde zu einer der ersten Marken im Bereich der Geldinstitute. Zugleich war der Eurocheque die erste grenzüberschreitende Dienstleistung dieser Art in Europa. Sie wurde inzwischen durch verschiedene Debitkarten abgelöst."},{"page_url":"https://hi.wikipedia.org/wiki/%E0%A4%B8%E0%A4%A4%E0%A4%A4_%E0%A4%AB%E0%A4%B2%E0%A4%A8","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/32/Discontinuity-jump.svg","page_title":"सतत फलन","context_page_description":"गणित में किसी चर राशि x पर परिभाषित फलन f(x) सतत फलन कहलाता है यदि x में अल्प परिवर्तन करने पर f(x) के मान में भी केवल अल्प परिवर्तन हो अन्यथा यह असतत फलन कहलाता है। एक सतत फलन के प्रतिलोम फलन का सतत होना आवश्यक नहीं।"},{"page_url":"https://pl.wikipedia.org/wiki/Fort_Walton_Beach","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/29/Flag_of_Fort_Walton_Beach%2C_Florida.png","page_title":"Fort Walton Beach","context_page_description":"Fort Walton Beach - amerykańskie miasto położone w północno-zachodniej części Florydy w hrabstwie Okaloosa, nad Zatoką Meksykańską, między Pensacolą a Panama City.\\nPowierzchnia: 21,3 km²\\nLudność: 19 817"},{"page_url":"https://hu.wikipedia.org/wiki/Bischofsmais","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/81/Bischofsmais01.jpg","page_title":"Bischofsmais","context_page_description":"Bischofsmais település Németországban, azon belül Bajorországban. Lakosainak száma 3144 fő. +/- Bischofsmais Lalling, Deggendorf, Regen, Schaufling és Grafling községekkel határos."},{"page_url":"https://arz.wikipedia.org/wiki/%D8%B1%D9%8A%D8%AA%D8%B4%D8%A7%D8%B1%D8%AF_%D9%88%D9%88%D9%84%D9%81","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8d/Richard_Wolf_Headshot_1.jpg","page_title":"ريتشارد وولف","context_page_description":"الصفحه دى يتيمه, حاول تضيفلها لينك فى صفحات تانيه متعلقه بيها.\\nريتشارد وولف ملحن مزيكا من امريكا."},{"page_url":"https://no.wikipedia.org/wiki/Tampa_Bay_Buccaneers","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d6/1986_Jeno%27s_Pizza_-_19_-_Ricky_Bell_%28cropped%29.jpg","page_title":"Tampa Bay Buccaneers","context_page_description":"Tampa Bay Buccaneers er et profesjonelt amerikansk fotballag basert i Tampa, Florida. Buccaneers konkurrer i National Football League i ligaens National Football Conference i NFC South-divisjonen. Laget ble med i NFL i 1976 som et ekspansjonslag sammen med Seattle Seahawks. Laget spilte sin første sesong i American Football Conference West som en del av NFLs utvidelsesplan hvor de nye franchisene skulle spille mot alle de andre lagene i ligaen i løpet av sine to første år. Etter sesongen byttet laget plass med Seahawks og ble med i NFC Central. Da ligaen ble omorganisert i 2002 ble Buccaneers flyttet til den nye NFC South-divisjonen sammen med tre lag fra NFC West. Klubben er eid av Glazer-familien og spiller hjemmekamper i Raymond James Stadium i Tampa.\\nBuccaneers var det første ekspansjonslaget etter sammenslåingen av AFL og NFL som vant en divisjonstittel, en kamp i sluttspillet, og til å spille og vinne et Conference Championship på hjemmebane; alle tre skjedde i 1979. De er også det første laget siden sammenslåingen som hadde en positiv sesong med ti eller flere nykommere, som skjedde i 2010-sesongen. I 1976 og '77 tapte Buccaneers sine første 26 kamper."},{"page_url":"https://fr.wikipedia.org/wiki/Parc_national_El_Palmar","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c2/Carpincho.jpeg","page_title":"Parc national El Palmar","context_page_description":"Le parc national El Palmar, en Argentine, créé en 1965 dans le but de sauvegarder un secteur représentatif de territoire peuplé de palmiers butia yatay, est localisé au centre-est de la province d'Entre Ríos, sur le Río Uruguay. Il est proche de la ville de Colón."},{"page_url":"https://pl.wikipedia.org/wiki/Erwin_Geschonneck","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6d/Bundesarchiv_Bild_183-1986-1220-006_Berlin%2C_Erwin_Geschonneck.jpg","page_title":"Erwin Geschonneck","context_page_description":"Erwin Geschonneck – niemiecki aktor filmowy. Związany z teatrem Erwina Piscatora.\\nW latach 30. XX wieku przebywał w Związku Radzieckim, w 1938 r. został zmuszony przez NKWD do opuszczenia ZSRR. W marcu 1939 został aresztowany w Pradze i przekazany Gestapo. Następnie był więziony w obozach koncentracyjnych KL Sachsenhausen, KL Dachau i KL Neuengamme. 3 maja 1945 przeżył zatopienie statku Cap Arcona.\\nPo II wojnie światowej grał w Hamburgu i Berlinie Wschodnim. W 1949 związał się z Berliner Ensemle.\\nOdznaczony m.in. Orderem Karola Marksa oraz Orderem Zasług dla Ojczyzny."},{"page_url":"https://en.wikipedia.org/wiki/1st_San_Marco_Regiment","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/52/2june_2007_209.jpg","page_title":"1st San Marco Regiment","context_page_description":"The 1st San Marco Regiment, located in Brindisi, is an amphibious formation of the Italian Navy. They are the Italian marines.\\nUntil the middle of the 1990s the unit was known as the San Marco Battalion, until it was expanded beyond battalion size because of the new geopolitical situation after the end of the Cold War and an increasing number of international missions, after as the San Marco Regiment. In 2013 it became part of the San Marco Marine Brigade as 1st San Marco Regiment."},{"page_url":"https://en.wikipedia.org/wiki/List_of_Assyrian_kings","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/36/Confirmation_by_Shamash-shum-ukim_of_a_grant_originally_made_by_Ashur-nadin-shumi._670-650_BCE%2C_from_Babylonia%2C_Iraq._The_tablet_is_currently_housed_in_the_British_Museum.jpg","page_title":"List of Assyrian kings","context_page_description":"The King of Assyria, called the Governor or Viceroy of Assyria in the Early and Old periods, was the ruler of the ancient Mesopotamian kingdom of Assyria, which existed from approximately the 26th century BC to the 7th century BC. All modern lists of Assyrian kings generally follow the Assyrian King List, a list kept and developed by the ancient Assyrians themselves over the course of several centuries. Though some parts of the list are probably fictional, the list accords well with Hittite, Babylonian and ancient Egyptian king lists and with the archaeological record, and is generally considered reliable for the age.\\nThe ancient Assyrians did not believe that their king was divine himself, but saw their ruler as the vicar of their principal deity, Ashur, and as his chief representative on Earth. In their worldview, Assyria represented a place of order while lands not governed by the Assyrian king were seen as places of chaos and disorder. As such it was seen as the king's duty to expand the borders of Assyria and bring order and civilization to lands perceived as uncivilized."},{"page_url":"https://azb.wikipedia.org/wiki/%D8%B1%DB%8C%DA%A9%D8%A7%D8%B1%D8%AF%D9%88_%D9%BE%D8%A7%D9%84%D9%85%D8%A7","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6b/Palma1.jpg","page_title":"ریکاردو پالما","context_page_description":"ریکاردو پالما یازیچی - ۷ فوریه ۱۸۳۳ تاریخیندا دۆنیایا گؤز آچیب. ۸۶ ایل عومر ائله‌ییب و ۶ اوکتبر ۱۹۱۹ میلادی تاریخیندا وفات ائدیب."},{"page_url":"https://zh.wikipedia.org/wiki/%E6%B5%B7%E5%B7%9E%E9%A6%99%E8%96%B7","image_url":"http://upload.wikimedia.org/wikipedia/commons/a/ae/Elsholtzia_splendens.JPG","page_title":"海州香薷","context_page_description":"海州香薷，又称海洲香薷、铜草花、铜锈草、牙刷草，为唇形科香薷属下的一个种。"},{"page_url":"https://en.wikipedia.org/wiki/Olu_Jacobs","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7c/Olujacobs.jpg","page_title":"Olu Jacobs","context_page_description":"Oludotun Baiyewu Jacobs, known professionally as Olu Jacobs, is an internationally acclaimed Nigerian actor and film executive. He has starred in several British television series and international films. Olu Jacobs has been hailed by many as one of the greatest and most widely respected African actors of his generation. Together with Pete Edochie, he is considered by several media, film commentators, critics, and other actors to be one of the most influential African actors of all time, and is widely regarded as a cultural icon.\\nFondly called Uncle Olu by his colleagues and teeming admirers, Olu Jacobs has made his mark in the Nigeria's movie industry. With more than 40 years acting experience under his belt, Jacobs is seen as a bridge between the old and new breed of actors. Trained at The Royal Academy of Dramatic Arts, England, Jacobs remains one of Africa's creative gifts to the world, having worked with various repertoire theatres in Britain and starred in some international movies.\\nIn 2007 he won the African Movie Academy Award for Best Actor in a Leading Role."},{"page_url":"https://cs.wikipedia.org/wiki/%C5%98%C3%ADmskokatolick%C3%A1_farnost_Svojanov","image_url":"http://upload.wikimedia.org/wikipedia/commons/7/7a/Star%C3%BD_svojanov_-_kostel_svat%C3%A9ho_Mikul%C3%A1%C5%A1e.jpg","page_title":"Římskokatolická farnost Svojanov","context_page_description":"Římskokatolická farnost Svojanov je územním společenstvím římských katolíků v litomyšlském vikariátu královéhradecké diecéze."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%9A%D0%B0%D1%80%D0%B5%D1%82%D0%B0","image_url":"http://upload.wikimedia.org/wikipedia/commons/0/06/Stamp_of_Armenia_h256.jpg","page_title":"Карета","context_page_description":"Не следует путать с термином Каретка\\nКаре́та, или конный экипаж — закрытая пассажирская повозка с рессорами. Первоначально кузов кареты подвешивался на ремнях, потом для подрессоривания, с начала XVIII века, стали использовать пружины, а с начала XIX века стали использовать рессоры. Наиболее часто использовались для личного пользования, хотя с позднего средневековья в Европе начали использоваться в том числе и в качестве общественного транспорта. В качестве примера можно привести дилижанс, омнибус и шарабан. Самым распространенным видом дилижанса можно считать почтовую карету."},{"page_url":"https://fi.wikipedia.org/wiki/Cornstalk","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c3/1872_Chiefs_Cornstalk_Logan_and_Red_Eagle_from_Frosts_pictorial_history_of_Indian.jpg","page_title":"Cornstalk","context_page_description":"Cornstalk oli shawneiden huomattava johtaja 1770-luvun alkuvuosina ennen Yhdysvaltain vapaussotaa. Hänet tunnettiin myös nimillä Hokoleskwa ja Wynepuechsika.\\nCornstalk vastusti vuosikymmenien ajan eurooppalaisten siirtokuntien leviämistä Ohiolaaksoon. Parhaiten hänet tunnetaan Point Pleasantin taistelusta, jossa hän johti noin tuhatta shawneeta, wyandotia ja delawarea Virginian miliisiä vastaan käydyssä yhteenotossa. Allekirjoitettuaan kaksi rauhansopimusta vuonna 1775 Cornstalkista tuli viimeisten elinvuosiensa ajaksi rauhanlähettiläs, joka kielsi intiaaneja liittymästä Britannian puolelle Yhdysvaltoja vastaan. Marraskuussa 1777 virginialaiset miliisit murhasivat hänet Fort Randolphissa diplomaattisen vierailun aikana. Tämä verityö järkytti sekä intiaaneja että virginialaisia."},{"page_url":"https://en.wikipedia.org/wiki/The_Dairy","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/10/Dairy_in_Central_Park%2C_NYC_-_IMG_5647.JPG","page_title":"The Dairy","context_page_description":"The Dairy is a small building in Central Park in Manhattan, New York City, just south of the 65th Street transverse road. The building was designed by the architect Calvert Vaux, and was completed in 1871 as a restaurant. After a restoration, it serves as one of several visitor centers in Central Park."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%93%D0%B5%D1%80%D0%B1_%D0%92%D0%B5%D0%BB%D0%B8%D0%BA%D0%B8%D1%85_%D0%9B%D1%83%D0%BA","image_url":"https://upload.wikimedia.org/wikipedia/ru/b/b9/Flag_Velikolutsrii_polk_%281712%29.gif","page_title":"Герб Великих Лук","context_page_description":"Герб Великих Лук — является официальным символом муниципального образования «город Великие Луки» Великолукского района Псковской области Российской Федерации.\\nИсторический герб Великих Лук был создан в начале XVIII века товарищем герольдмейстера Герольдмейстерской конторы Ф. М. Санти, Высочайше утверждён 28 мая 1781 года императрицей Екатериной II вместе с другими гербами городов Псковского наместничества. Официально использовался до ноября 1917 года. 21 июня 2001 года Решением Великолукской городской думы исторический герб Великих Лук был восстановлен в качестве официального символа города и внесён в Государственный геральдический регистр Российской Федерации под регистрационным номером 791."},{"page_url":"https://zh.wikipedia.org/wiki/%E5%A4%A7%E6%9C%83%E5%A0%82%E5%85%AC%E5%85%B1%E5%9C%96%E6%9B%B8%E9%A4%A8","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3d/City_Hall_Public_Library_Level_2_Children_Library_2016.jpg","page_title":"大會堂公共圖書館","context_page_description":"大會堂公共圖書館是位於香港島中西區中環香港大會堂的香港公共圖書館，位於大會堂高座，樓面面積3,277平方米；以面積計算是香港第6大公共圖書館，於1962年3月5日落成啟用。剛落成時稱大會堂中央圖書館，為了配合香港中央圖書館於2001年啟用，於2000年更名為大會堂公共圖書館。1976年增設音響圖書館，於2003年至2004年大會堂公共圖書館重新裝修及擴建參考圖書館。位於9樓的電腦資訊中心，則遷至6樓。\\n大會堂公共圖書館是香港第二次世界大戰後興建的首間公共圖書館。雖然18世紀後期至19世紀早期，香港匯豐銀行總行大廈現址旁的舊香港大會堂同樣設立了一所圖書館，由香港的英資集團出資創辦，惟華人使用此圖書館是受到十分的限制。隨著華人地位的提升，新大會堂的圖書館才爭取到有現今平等的狀況。\\n香港中央圖書館於2001年成立前，大會堂公共圖書館是1962建立之香港公共圖書館的總部。大會堂公共圖書館成立初期藏書只有2萬冊，開館後頭一個月即發出1萬張借書證，每人每次只可外借1本圖書，而兩個市政局時期的參考圖書館已經於2003下半年重組成為工商業圖書館，另5字樓為專門收藏香港及澳門基本法之基本法圖書館。現在藏書約有36萬本。"},{"page_url":"https://fi.wikipedia.org/wiki/Valokuvaus","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7f/Tartan_Ribbon.jpg","page_title":"Valokuvaus","context_page_description":"Valokuvaus on menetelmä, jossa luodaan kuvia kohdistamalla valoa tai muuta sähkömagneettista säteilyä valoherkälle pinnalle. Valokuvia on perinteisesti tuotettu kemiallisesti, käyttämällä valoherkkänä pintana valoon reagoivalla aineella päällystettyä filmiä. Perinteisen kemiallisen menetelmän on nykyään lähes kokonaan syrjäyttänyt digitaalinen valokuvaus, jossa valoon reagoivana materiaalina on kameran sisään sijoitettu valoherkkä kenno, joka tallentaa kuvattavasta kohteesta pintaansa osuvan valon tietokoneille soveltuvaksi digitaaliseksi informaatioksi.\\nValokuvausta käytetään monilla elämänalueilla. Valokuvaajia työskentelee muun muassa tiedonvälityksessä kuten journalismissa ja markkinointiviestinnässä, dokumentoinnissa ja tieteellisessä tutkimuksessa. Valokuvataide on osa kuvataidetta. Elokuva alkoi kehittyä valokuvauksesta, kun yksittäisiä valokuvia tuottavasta kamerasta kehitettiin peräkkäisiä valokuvia nopeasti filminauhalle tallentava elokuvakamera. Lääketieteessä erityisen merkittäväksi valokuvauksen muodoksi on kehittynyt ihmissilmälle näkymättömän sähkömagneettisen säteilyn, kuten röntgensäteiden käyttö kudosten \\"läpivalaisuun\\"."},{"page_url":"https://hu.wikipedia.org/wiki/Finta_J%C3%B3zsef","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/82/%C3%9Atirajz_12_P%C3%A1rizs_SKMBT_C25008111810212.jpg","page_title":"Finta József","context_page_description":"Finta József a Nemzet Művésze címmel kitüntetett, Kossuth-díjas magyar építész, az MTA és a MMA rendes tagja."},{"page_url":"https://nn.wikipedia.org/wiki/Basadingen-Schlattingen","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/96/Schlattingen_Dorf.jpg","page_title":"Basadingen-Schlattingen","context_page_description":"Basadingen-Schlattingen er ein kommune i Frauenfeld i kantonen Thurgau i Sveits. Kommunen har 1 699 innbyggjarar og eit areal på 16 km². Kommunesenteret ligg 410 meter over havet.\\nHan vart skapt 1. januar 1999 då Basadingen og Schlattingen vart slått saman til èin kommune.\\nKommunen består av landsbyane Basadingen og Schlattingen og busetnadane Mett-Oberschlatt og Unterschlatt."},{"page_url":"https://oc.wikipedia.org/wiki/Lombard","image_url":"http://upload.wikimedia.org/wikipedia/commons/6/69/Bait_dal_comun.jpg","page_title":"Lombard","context_page_description":"Lo lombard es una lenga romanica dau grop nòrd-italian. Se parla essencialament en Lombardia e en Soïssa italiana.\\nSei dialèctes principaus son l’insubre e l'orobic."},{"page_url":"https://ja.wikipedia.org/wiki/%E3%83%87%E3%83%80%E3%83%AD_(%E6%B0%B4%E4%B8%8A%E6%A9%9F%E6%AF%8D%E8%89%A6)","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/73/Seaplane_carrier_D%C3%A9dalo%2C_Cartagena_1920.jpg","page_title":"デダロ (水上機母艦)","context_page_description":"デダロは、スペイン海軍の飛行船母艦兼水上機母艦で同型艦はない。"},{"page_url":"https://fr.wikipedia.org/wiki/Polygonum_polystachyum","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a0/Polygonum_polystachyum_pr%C3%A8s_Sizun_2010_3.JPG","page_title":"Polygonum polystachyum","context_page_description":"Polygonum polystachyum est une plante herbacée vivace rhizomateuse, appelée renouée de l'Himalaya ou renouée à nombreux épis en français.\\nC'est une des nombreuses renouées de la famille des Polygonacées.\\nElle fait partie des membres d'une famille botanique dont certaines espèces sont localement devenues invasives quand elles ont été introduites en Europe ou en Amérique du Nord à partir de l'Asie d'où elles sont originaires.\\nElle fait par exemple en Suisse partie de la Liste noire des plantes invasives. En Suisse, les citoyens sont invités à signaler les nouveaux foyers d'apparition de cette espèce. Des sites de science participative et collaborative comme Tela Botanica permettent aussi de contribuer à alimenter les bases de données ou de photos concernant les espèces invasives."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%9C%D0%BE%D0%B4%D0%B5%D1%80%D0%BD_(%D0%BC%D0%B8%D1%81%D1%82%D0%B5%D1%86%D1%82%D0%B2%D0%BE)","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/40/Lw%C3%B3w_-_Pl._Pokoju_01.JPG","page_title":"Модерн (мистецтво)","context_page_description":"Моде́рн або а́р-нуво́ — стиль у мистецтві кінця XIX — початку XX століття, переважно в архітектурі, образотворчому й декоративно-ужитковому мистецтві.\\nСтиль здобув різні назви у різних країнах. У Бельгії й Франції — «нове мистецтво», у Німеччині — «молодий стиль», в Італії — «квітковий стиль» або «стиль Ліберті», у Великій Британії — «сучасний стиль», у США — «стиль Тіфані», в Австрії, Україні — «сецесія», у скандинавських країнах — «національний романтизм»."},{"page_url":"https://en.wikipedia.org/wiki/List_of_paintings_by_Bartholomeus_van_der_Helst","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/07/Portrait_sophia_trip_wife_of_balthasar_coymans.jpg","page_title":"List of paintings by Bartholomeus van der Helst","context_page_description":"The following is an incomplete list of paintings by Bartholomeus van der Helst that are generally accepted as autograph by Judith van Gent and other sources. The list is in order of creation, starting from his first dated work in 1637 for the regents of the Walloon Orphanage in Amsterdam. Most of his works are portraits, but he also made some allegories."},{"page_url":"https://eu.wikipedia.org/wiki/Selman_Abraham_Waksman","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/33/Selman_Waksman_NYWTS.jpg","page_title":"Selman Abraham Waksman","context_page_description":"Selman A. Waksman biokimikaria eta mikrobiologoa izan zen. Ukraniar jatorrikoa, estatubatuar nazionalitatea hartu zuen. Medikuntzako Nobel Saria eskuratu zuen 1952. urtean.\\nOdessa hirian egin zituen oinarrizko ikasketak, eta 1910ean AEB-etara abiatu zen. Biokimikan doktoratu zen 1918an Berkeleyko Unibertsitatean eta mikrobiologia irakasle aritu zen Rutgersko Unibertsitatean geroago.\\nWaksman-en ekarpen nagusia hainbat antibiotikoren aurkikuntzan datza. Bakterio patogenoen hazkuntza galarazten zuten substantziekin ikertuz aktinomizina, estreptomizina eta neomizina antibiotikoak aurkitu zituen. Estreptomizinaren aurkikuntzak, hain zuzen ere, Nobel Saria ekarri zion Waksmani 1952an.\\nAurkikuntza horren omenez, Eibarko Klub Deportiboak monolitoa altxatu zion Eibarko Arrate gainean.\\nDatuak: Q232308\\nMultimedia: Selman Waksman"},{"page_url":"https://cs.wikipedia.org/wiki/N%C3%A1rodn%C3%AD_park_Padjelanta","image_url":"http://upload.wikimedia.org/wikipedia/commons/7/7c/Padjelanta-staloloukta-1.jpg","page_title":"Národní park Padjelanta","context_page_description":"Národní park Padjelanta je národní park v severním Švédsku, na norské hranici, na území komuny Jokkmokk v kraji Norrbotten v Laponsku. Rozkládá se na ploše 1 984 km², což z něj činí největší národní park v zemi. Sousedí s národními parky Sarek, Stora Sjöfallet a norským parkem Rago.\\nNázev Padjelanta v sámštině znamená „horní země“, což docela dobře vystihuje geografii místa. Park je vskutku především vysokohorskou planinou Skandinávského pohoří, s nadmořskou výškou asi 700 m, s mírnými zvlněnými kopci. Tato krajina ostře kontrastuje s oblastmi, které hraničí s parkem, které mají výrazně alpský charakter. Na jihu je hranice obou oblastí méně ostrá, přímo v parku se nachází několik vysokých vrcholů. Mírný terén je způsoben podložím tvořeným svory a vápenci, které nejsou příliš odolné vůči erozi. Říční systém je velmi bohatý, park se nachází u prameniště řeky Lule a několika jejich hlavních přítoků. Jednou z hlavních charakteristik Padjelanty je však přítomnost velkých jezer, zejména Virihaure a Vastenjaure.\\nPadjelanta, stejně jako zbytek Laponska, které se nachází kolem, se často označuje jako „největší a dosud nedotčená oblast“ v Evropě."},{"page_url":"https://pt.wikipedia.org/wiki/Ahu_Tongariki","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/41/Ahu-Tongariki-from-south-west-2013.jpg","page_title":"Ahu Tongariki","context_page_description":"Ahu Tongariki é o maior ahu na Ilha de Páscoa. Seus moai foram derrubados durante as guerras civis da ilha e no século XX o ahu foi varrido para o interior por um tsunami. Desde então tem sido restaurado e tem quinze moai, incluindo um moai de 86 toneladas que foi o mais pesado já erguido na ilha. Ahu Tongariki está a um quilômetro de Rano Raraku e Poike na área de Hotu-iti do Parque Nacional Rapa Nui. Todo o moai aqui enfrenta o por do sol durante o solstício de verão."},{"page_url":"https://sv.wikipedia.org/wiki/Mika_Tiivola","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/13/Mika-Tiivola-1992.jpg","page_title":"Mika Tiivola","context_page_description":"Carl Mikael \\"Mika\\" Augustinus Tiivola, född 31 oktober 1922 i Villmanstrand, död 13 april 1994 i Helsingfors, var en finländsk bankman. Han ingick äktenskap med hotellägaren Satu Vuoristo 1975.\\nTiivola utexaminerades från kadettskolan 1943, tjänstgjorde i Finlands flygvapen till 1945, blev politices magister 1948 och juris kandidat 1956. Han var anställd vid J. Merivaara Oy 1947–1954, delägare i advokatbyrån Dittmar & Indrenius 1954–1961, blev direktör vid Föreningsbanken i Finland 1961, verkställande direktör 1966 samt var styrelseordförande och koncernchef 1970–1988.\\nTiivola förnyade Föreningsbankens profil, inledde dess internationalisering och ledde dess övertagande av Helsingfors Aktiebank 1986. Han var bland annat ordförande i Näringslivets delegation 1974–1988 samt styrelseordförande i Kymmene Ab från 1967 samt i Oy Nokia Ab 1978–1986 och 1990–1992. Han tilldelades ministers titel 1988 och blev ekonomie hedersdoktor 1989."},{"page_url":"https://ar.wikipedia.org/wiki/%D8%A3%D9%88%D8%B1%D9%88%D8%A8%D9%8A%D8%B3%D8%A7_(%D8%A5%D8%B3%D8%A8%D8%A7%D9%86%D9%8A%D8%A7)","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9e/Oropesa_-_square_tower.jpg","page_title":"أوروبيسا (إسبانيا)","context_page_description":"أوروبيسا، إسبانيا ‏ هي بلدية ومدينة في منطقة الحكم الذاتي كاستيا-لا مانتشا وتقع في مقاطعة طليطلة في وسط إسبانيا. تبلغ مساحة هذه المدينة 337، ويبلغ عدد سكانها 2940 نسمة حسب إحصاء المعهد الوطني الإسباني سنة 2008 م."},{"page_url":"https://ru.wikipedia.org/wiki/Windows_Phone","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/81/Nokia_Lumia_520_Windows_Phone_8.1_ru.JPG","page_title":"Windows Phone","context_page_description":"Windows Phone — мобильная операционная система, разработанная Microsoft, вышла 11 октября 2010 года. 21 октября начались поставки первых устройств на базе новой платформы. В России телефоны с Windows Phone начали продаваться 16 сентября 2011 года, первым из которых стал HTC 7 Mozart. 9 октября 2017 года исполнительный директор Microsoft Джо Бельфиор заявил о прекращении создания новых устройств и обновлений Windows 10 Mobile. В 2019 году компанией Microsoft официально заявлено, что поддержка Windows 10 Mobile будет прекращена 10 декабря 2019 года; владельцам мобильных устройств под управлением этой системы рекомендовано перейти на устройства с Android или iOS. Также есть официальные сведения о том, что Магазин Приложений для Windows Phone 8.1 будет закрыт после 16 декабря того же года.\\nОперационная система является преемником Windows Mobile, хотя и несовместима с ней с полностью новым интерфейсом и — впервые — с интеграцией сервисов Microsoft: игрового Xbox Live и медиаплеера Zune. В отличие от предшествующей системы, Windows Phone в большей степени ориентирован на рынок потребителей, чем на корпоративную сферу."},{"page_url":"https://hy.wikipedia.org/wiki/%D5%82%D5%A1%D5%BD%D5%AB%D5%B4_%D5%A2%D5%A5%D5%AF_%D4%B6%D5%A1%D6%84%D5%AB%D6%80","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e4/Gasim_bey_Zakir.jpg","page_title":"Ղասիմ բեկ Զաքիր","context_page_description":"Ղասիմ բեկ Ալի բեկ օղլի Զաքիր, ադրբեջանցի բանաստեղծ, Ադրբեջանական գրականության քննադատական ռեալիզմի հիմնադիրներից մեկը:"},{"page_url":"https://en.wikipedia.org/wiki/K._J._George","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/13/KJ_George.jpg","page_title":"K. J. George","context_page_description":"Kelachandra Joseph George is a politician from the state of Karnataka, India. He was a minister of large and medium size industry in the cabinet of H D Kumaraswamy and was the Minister for Bengaluru Development and Town Planning. He was previously the Home Minister of Karnataka. He was also the Minister of State Transport, Food and Civil Supplies in the Veerendra Patil government and Cabinet Minister for Housing & Urban Development in the S. Bangarappa government."},{"page_url":"https://it.wikipedia.org/wiki/Boca","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ec/Festa_dell%27Uva_%E2%80%93_2012.JPG","page_title":"Boca","context_page_description":"Boca è un comune italiano di 1 178 abitanti della provincia di Novara in Piemonte. È conosciuto per la produzione dell'omonimo vino DOC e per il santuario del Santissimo Crocifisso, progettato dall'architetto Alessandro Antonelli. L'area collinare a nord-ovest del paese dal 1987 fa parte del Parco naturale del Monte Fenera."},{"page_url":"https://la.wikipedia.org/wiki/Scanaues","image_url":"http://upload.wikimedia.org/wikipedia/commons/6/69/Karte_Gemeinde_Schnaus_2009.png","page_title":"Scanaues","context_page_description":"Scanaues est parvus vicus Helveticus 133 incolarum qui ad pagum Grisoniam pertinet."},{"page_url":"https://ar.wikipedia.org/wiki/%D8%A3%D8%AD%D8%AF%D8%A7%D8%AB_9_%D8%A3%D8%A8%D8%B1%D9%8A%D9%84_1938","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c5/Manifestation_1938_Tunis.JPG","page_title":"أحداث 9 أبريل 1938","context_page_description":"أحداث 9 أبريل 1938 هي أحداث حصلت في تونس وسط احتجاجات شعبيّة طالبت بإصلاحات سياسية، بما في ذلك إنشاء برلمان، كانت هذه الأحداث خطوة رئيسية نحو استقلال تونس التي كانت لا تزال تحت الحماية الفرنسية. لم يستطع الاحتلال الفرنسي خلالها استعادة الهدوء إلّا بعد سقوط العديد من الشهداء."},{"page_url":"https://it.wikipedia.org/wiki/Fuat_Necati_%C3%96ncel","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/53/FuatNecatiOncel.jpg","page_title":"Fuat Necati Öncel","context_page_description":"Fuat Necati Öncel è un avvocato e politico turco.\\nSuo padre, Hacıisazade Halil Agha era un leader feudale e un eroe della resistenza di Urfa contro l'invasione francese nel 1920. Si è laureato dell'Università d'Istanbul nel 1969. Ha iniziato la sua carriera politica e giuridica in Viranşehir, Şanlıurfa. Dopo aver lavorato a diversi livelli di organizzazione del Partito Popolare Repubblicano in Şanlıurfa, ha contribuito a creare il Partito Socialdemocratico in Turchia nel 1983. È stato il presidente dell'organizzazione del Partito Socialdemocratico in Şanlıurfa. È stato anche uno dei fondatori del Partito Popolare Socialdemocratico, che è formato dopo l'unione del Partito Socialdemocratico e del Partito Popolare e ha servito nel Comitato Centrale di Disciplina del nuovo partito. Si è opposto all'espulsione di alcuni soci e si è dimesso dal suo posto alla commissione di disciplina, ma ha continuato a servire il partito. Ha anche fatto una notevole contribuzione all'unione del Partito Socialdemocratico Popolare e il Partito Popolare Repubblicano. Nel 2001, si è dimesso da tutti i suoi posti al Partito Popolare Repubblicano a causa di suo disaccordo con il sede centrale del partito."},{"page_url":"https://es.wikipedia.org/wiki/Evangelios_de_Lichfield","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8c/LichfieldGospelsEvangelist.jpg","page_title":"Evangelios de Lichfield","context_page_description":"Los Evangelios de Lichfield es un evangeliario insular, escrito en latín, del siglo VIII conservado actualmente en la catedral de Lichfield.\\nHan sobrevivido 236 folios, ocho de los cuales están iluminados. Otros cuatro contienen texto enmarcado. Dan la sensación de que el texto se convierte en mero pretexto para la creación de una obra de arte. Las páginas miden 30,8 cm por 23,5 cm. El manuscrito es también importante porque incluye, como marginalia, alguno de los primeros ejemplos conocidos del galés escrito. Peter Lord data el manuscrito hacia el año 730, situándolo cronológicamente antes del Libro de Kells, pero después de los Evangelios de Lindisfarne.​\\nEl manuscrito fue vuelto a encuadernar en 1962 por Roger Powell. En ese momento se descubrió que en la encuadernación de 1862 el manuscrito había sido cortado en hojas individuales y que en la reencuadernación de 1701, las páginas había sido recortadas."},{"page_url":"https://de.wikipedia.org/wiki/Cranshaws_Castle","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f0/Cranshaws_Castle_-_geograph.org.uk_-_142497.jpg","page_title":"Cranshaws Castle","context_page_description":"Cranshaws Castle ist ein Tower House nahe der schottischen Ortschaft Longformacus in der Council Area Scottish Borders. 1971 wurde das Bauwerk in die schottischen Denkmallisten in der höchsten Denkmalkategorie A aufgenommen."},{"page_url":"https://zh-min-nan.wikipedia.org/wiki/Grimaucourt-en-Wo%C3%ABvre","image_url":"http://upload.wikimedia.org/wikipedia/commons/8/8e/Map_commune_FR_insee_code_55219.png","page_title":"Grimaucourt-en-Woëvre","context_page_description":"Grimaucourt-en-Woëvre sī ūi-tī Hoat-kok Lorraine toā-khu Meuse koān ê chi̍t ê commune."},{"page_url":"https://en.wikipedia.org/wiki/Liparis_agassizii","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/71/Liparis_agassizii.jpg","page_title":"Liparis agassizii","context_page_description":"Liparis agassizii, in one instance called \\"agassiz's snailfish\\", is a fish from the genus Liparis. It lives in the North Pacific Ocean at a depth range between zero and one hundred meters. The fish may especially be found from the Iwate Prefecture to Hokkaido, off the coast of Primorskiy, off the western and southeastern coast of Sakhalin, and in the southern Kuril Islands."},{"page_url":"https://pl.wikipedia.org/wiki/D%C4%85b_szypu%C5%82kowy_w_Warszawie_(ul._Zakopia%C5%84ska_28)","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3a/Zakopia%C5%84ska_27.jpg","page_title":"Dąb szypułkowy w Warszawie (ul. Zakopiańska 28)","context_page_description":"Dąb szypułkowy – dąb rosnący w Warszawie, w dzielnicy Praga-Południe, przy ul. Zakopiańskiej 28. Jeden z ośmiu pomników przyrody na szlaku przyrodniczym po Saskiej Kępie."},{"page_url":"https://nl.wikipedia.org/wiki/Grote_Kerk_(Nijkerk)","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1c/Grote-Kerk-Nijkerk-Gewelven-Gedenkbord.jpg","page_title":"Grote Kerk (Nijkerk)","context_page_description":"De Grote- of St. Catharinakerk in de Nederlandse stad Nijkerk is gebouwd in 1461 en herbouwd na een stadsbrand in 1540. De kerk bestaat uit een middenschip, met twee zijbeuken en een koor.\\nMet Sint Catharina, naar wie de kerk genoemd is, wordt bedoeld de legendarische Catharina van Alexandrië. In de huidige rooms-katholieke kerk van Nijkerk staat een oud beeld van deze heilige, dat ooit in de Grote Kerk zou hebben gestaan. Tegenwoordig wordt de kerk meestal 'Grote Kerk' genoemd en niet meer 'Sint Catharinakerk'. De kerk is nog steeds voor kerkdiensten in gebruik. In 1594 werd de kerk officieel protestants. De Hervormde Gemeente Nijkerk behoort tot de Protestantse Kerk in Nederland."},{"page_url":"https://zh.wikipedia.org/zh-tw/%E7%B4%90%E7%B4%84%E5%85%AC%E5%85%B1%E5%9C%96%E6%9B%B8%E9%A4%A8%E7%B8%BD%E9%83%A8","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7d/Loz-ny-library-3.png","page_title":"紐約公共圖書館總部","context_page_description":"蘇世民大樓通稱為紐約公共圖書館總部是美國紐約市的一個歷史地標，位於曼哈頓中城第五大道40-42街之間，建於1897-1911年，目前面積 646,680平方英尺。2008年以猶太富商蘇世民命名。\\n著名的主閱覽室面積78乘297英尺，天花板高52-英尺，有華麗的窗戶和大吊燈。有許多著名作家和學者在圖書館進行研究和寫作。\\n該建築於1965年列為美國國家歷史地標，1966年列為國家史蹟名錄，1967年列為紐約市地標。"},{"page_url":"https://eu.wikipedia.org/wiki/Ettal","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/12/Iglesia_Maria_Schutz%2C_Ettal%2C_Baviera%2C_Alemania%2C_2014-03-22%2C_DD_02.JPG","page_title":"Ettal","context_page_description":"Ettal Alemaniako udalerria da. Bavaria estatuan kokatuta dago, Garmisch-Partenkirchen barrutian. 2014an 812 biztanle zituen 14,75 kilometro koadrotan banatuta."},{"page_url":"https://it.wikipedia.org/wiki/Nickelodeon_Days","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f3/Easystreet.jpg","page_title":"Nickelodeon Days","context_page_description":"Nickelodeon Days è un'antologia cinematografica del 1962 diretta e prodotta da Fred von Bernewitz includente vari spezzoni delle comiche dei migliori attori della commedia quali Laurel e Hardy, Buster Keaton e Charlie Chaplin."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Baudenkmale_in_Niemegk","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d1/Gro%C3%9Fstra%C3%9Fe_50_Niemegk.jpg","page_title":"Liste der Baudenkmale in Niemegk","context_page_description":"In der Liste der Baudenkmale in Niemegk sind alle Baudenkmale der brandenburgischen Stadt Niemegk und ihrer Ortsteile aufgelistet. Grundlage ist die Veröffentlichung der Landesdenkmalliste mit dem Stand vom 31. Dezember 2019. Die Bodendenkmale sind in der Liste der Bodendenkmale in Niemegk aufgeführt."},{"page_url":"https://es.wikipedia.org/wiki/Seeliger_(cr%C3%A1ter)","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/37/R%C3%A9aumur_%2B_Oppolzer_-_LROC_-_WAC.JPG","page_title":"Seeliger (cráter)","context_page_description":"Seeliger es un cráter de impacto lunar relativamente pequeño que se encuentra cerca del borde sureste del Sinus Medii. Al sureste aparece una grieta denominada Rima Réaumur, siguiendo una línea hacia el noroeste. En el norte se encuentra la Rima Oppolzer de 110 km de largo, que divide el mare donde se encuentra Seeliger del resto del Sinus Medii.\\nSe trata de un elemento circular en forma de copa que no ha sido apreciablemente desgastado por la erosión producida por otros impactos."},{"page_url":"https://sv.wikipedia.org/wiki/Machaerium_condensatum","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/38/Machaerium_condensatum_1.jpg","page_title":"Machaerium condensatum","context_page_description":"Machaerium condensatum är en ärtväxtart som beskrevs av João Geraldo Kuhlmann och Frederico Carlos Hoehne. Machaerium condensatum ingår i släktet Machaerium och familjen ärtväxter. Inga underarter finns listade i Catalogue of Life."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%A1%D1%82%D1%80%D1%96%D1%82-%D0%B0%D1%80%D1%82","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c9/Wcarousel_ArticleImages_3665_1.jpg","page_title":"Стріт-арт","context_page_description":"Стріт-арт, також зустрічається варіант стрит-арт — образотворче мистецтво, характерною особливістю якого є яскраво виражений урбаністичний стиль. Основна частина стріт-арту — графіті, але не можна ототожнювати графіті і стріт-арт. До стріт-арту належать також постери, трафарети тощо. Термін «стріт-арт» поширився в процесі розвитку графіті на початку 1980-х років і пізніше використовувався як назва наступних вуличних шедеврів. Особливої популярності набув вже в ХХІ столітті.\\nХудожники, що вибирають вулиці як свої картинні галереї, займаються стріт-артом у більшості випадків для того, щоб безпосередньо спілкуватися з громадськістю в цілому та привернути увагу до цього мистецтва як молоді, так і старшого покоління. Звичайно, вуличні художники часто подорожують між країнами, щоб розширювати свої уявлення про різні види стріт-арту та втілювати їх у свої роботи."},{"page_url":"https://en.wikipedia.org/wiki/List_of_towns_and_cities_with_100,000_or_more_inhabitants/cityname:_C","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/52/%D0%9F%D0%BB%D0%BE%D1%89%D0%B0%D0%B4%D1%8C.%D0%A0%D0%B5%D0%B2%D0%BE%D0%BB%D1%8E%D1%86%D0%B8%D0%B8.%D1%81%D0%B2%D0%B5%D1%80%D1%85%D1%83.%D0%A7%D0%B5%D0%BB%D1%8F%D0%B1%D0%B8%D0%BD%D1%81%D0%BA2.jpg","page_title":"List of towns and cities with 100,000 or more inhabitants/cityname: C","context_page_description":"This is a list of towns and cities in the world believed to have 100,000 or more inhabitants, sorted alphabetically by the letter C. Unless otherwise noted, populations are based on United Nations estimates from 2016.\\nIndex\\nBy country name:\\nBy city name:\\nBack to main page"},{"page_url":"https://it.wikipedia.org/wiki/Guerra_del_Pacifico_(1941-1945)","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/47/Franklin_D._Roosevelt_TIME_Man_of_the_Year_1933_color_photo.jpg","page_title":"Guerra del Pacifico (1941-1945)","context_page_description":"La guerra del Pacifico, conosciuta in Giappone come grande guerra dell'Asia orientale, è parte integrante della seconda guerra mondiale ed è stata combattuta tra l'Impero giapponese e gli Alleati, principalmente gli Stati Uniti d'America e l'Impero britannico.\\nNegli anni venti e trenta il Giappone visse una progressiva militarizzazione e sviluppò un'ideologia imperialista panasiatica, sfociate nella creazione del Manciukuò e nel brutale assalto alla Cina: queste azioni provocarono forti tensioni con le potenze europee che detenevano possedimenti in Asia e anche con gli Stati Uniti, preoccupati per l'integrità della Cina. La crisi diplomatica tra occidentali e Giappone si acuì a seguito dei successi-politico militari della Germania nazista tra 1939 e 1940, che convinsero Tokyo a stringere con i tedeschi e l'Italia un patto tripartito e ad assorbire lentamente l'Indocina francese. Colpito da un severo embargo petrolifero nell'estate 1941, l'Impero giapponese perfezionò i piani di conquista integrale dell'Asia orientale per avere accesso alle risorse utili alla propria macchina militare e all'obiettivo ultimo di vincere la guerra in Cina."},{"page_url":"https://ba.wikipedia.org/wiki/%D0%9A%D0%BE%D0%BB%D1%8B%D0%BC%D0%B0","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/dc/%D0%9C%D0%BE%D1%81%D1%82_%D1%87%D0%B5%D1%80%D0%B5%D0%B7_%D0%9A%D0%BE%D0%BB%D1%8B%D0%BC%D1%83.jpg","page_title":"Колыма","context_page_description":"Колыма́ — Рәсәйҙең Саха Республикаһы һәм Магадан өлкәһендәге йылға."},{"page_url":"https://zh.wikipedia.org/zh-cn/2005%E5%B9%B44%E6%9C%8824%E6%97%A5%E6%9C%88%E9%A3%9F","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0d/Visibility_Lunar_Eclipse_2005-10-17.png","page_title":"2005年4月24日月食","context_page_description":"2005年4月24日月食发生在2005年4月24日，是一次半影月食，这次是2005年第一次的月食，第二次是发生在同年10月17日的月偏食。\\n在4:09 UTC时，月球开始进入地球半影，9:54 UTC 时月球达到食甚状态，此时月球南部一部分未被地球半影遮盖，其余地区则皆被覆盖。月亮离开地球半影时在11:59 UTC 时。\\n在下一次月食发生在2005年10月17日。"},{"page_url":"https://en.wikipedia.org/wiki/Planning_and_development_in_Detroit","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/ce/Grande_Ballroom_Detroit_2009.jpg","page_title":"Planning and development in Detroit","context_page_description":"Planning and development in Detroit since the late 20th century has attempted to enhance the economy and quality of life of Detroit, Michigan, United States. In 1970, the private group Detroit Renaissance began to facilitate development in the city. Its successor, Business Leaders for Michigan, has continued to facilitate development into the 21st century. Projects have included new commercial facilities, revitalization of neighborhoods, hospitality infrastructure, and improvements to recreational and public facilities, such as the QLine light rail project."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%94%D0%B8%D0%BA%D0%B0%D0%BD%D1%8C%D0%BA%D0%B0","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/58/%D0%94%D0%B8%D0%BA%D0%B0%D0%BD%D1%8C%D0%BA%D0%B0._%D0%92%D1%85%D1%96%D0%B4_%D0%B4%D0%BE_%D0%9A%D0%BE%D1%87%D1%83%D0%B1%D0%B5%D1%97%D0%B2%D1%81%D1%8C%D0%BA%D0%BE%D0%B3%D0%BE_%D0%BF%D0%B0%D1%80%D0%BA%D1%83.jpg","page_title":"Диканька","context_page_description":"Дика́нька — селище міського типу в Україні, центр Диканського району Полтавської області. Є адміністративним центром Диканської селищної ради, до складу якої також входять села Василівка, Проні та Трояни.\\nСелище міського типу. Постановою Кабітету Міністрів України Диканька внесена до Списку історичних населених місць України.\\nПрославлена Миколою Гоголем у хрестоматійній книзі «Вечори на хуторі біля Диканьки». Відома також завдяки іншим важливим історичним подіям на Диканщині."},{"page_url":"https://sv.wikipedia.org/wiki/Tahkuranna","image_url":"http://upload.wikimedia.org/wikipedia/commons/7/74/Statue_of_P%C3%A4ts_in_Tahkuranna2.jpg","page_title":"Tahkuranna","context_page_description":"Tahkuranna är en ort i sydvästra Estland. Den ligger i Tahkuranna kommun i landskapet Pärnumaa, 130 km söder om huvudstaden Tallinn. Tahkuranna ligger vid Pärnuviken och udden Suurna nina. Antalet invånare är 118.\\nTerrängen runt Tahkuranna är mycket platt. Runt Tahkuranna är det glesbefolkat, med 9 invånare per kvadratkilometer. Närmaste större samhälle är Pärnu, 15,7 km norr om Tahkuranna. Söder om Tahkuranna ligger kommunens största samhälle, småköpingen Võiste och norr om Tahkuranna ligger kommunens administrativa centrum Uulu. I Tahkuranna föddes Konstantin Päts som var Estlands första president.\\nInlandsklimat råder i trakten. Årsmedeltemperaturen i trakten är 3 °C. Den varmaste månaden är juli, då medeltemperaturen är 17 °C, och den kallaste är januari, med -12 °C."},{"page_url":"https://nl.wikipedia.org/wiki/Dorpskerk_van_Peckatel","image_url":"http://upload.wikimedia.org/wikipedia/commons/4/45/Kirche_Peckatel.jpg","page_title":"Dorpskerk van Peckatel","context_page_description":"De Dorpskerk van Peckatel in de gemeente Plate is de kleinste vakwerkkerk in Mecklenburg. Het kerkje met een driezijdig gesloten koor werd in het jaar 1692 gebouwd. Aan de westelijke kant is een lage, houten toren met zadeldak aangebouwd. De planken van de toren zouden afkomstig zijn van de voorganger. Het dak is bedekt met beverstaart dakpannen. Het kerkgebouw wordt door een voormalig kerkhof omgeven met een oud bomenbestand. Vroeger was het kerkje alleen op 23 november geopend, op de dag van boetedoening en gebed."},{"page_url":"https://zh.wikipedia.org/zh-tw/%E6%96%87%E8%89%BA%E5%A4%8D%E5%85%B4","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8f/Leonardo_da_Vinci_-_Lady_with_an_Ermine.jpg","page_title":"文艺复兴","context_page_description":"文藝復興是一場大致發生在14世紀至17世紀歐洲的文化運動，在中世紀晚期發源於義大利中部的佛羅倫斯，即義大利文藝復興，後擴展至歐洲各國。其辭源為義大利語「Rinascimento」，由ri-和nascere構成。文藝復興時期的思想基礎是其人文浪漫主義版本，它源於羅馬人文主義的概念和對普羅塔哥拉斯等古典希臘哲學的重新發現，後者說「人是萬物的尺度」。\\n「文藝復興」一詞亦可粗略地指代這一歷史時期，但由於歐洲各地因其引發的變化並非完全一致，故「文藝復興」只是對這一時期的通稱。這場文化運動基本上以復興古羅馬為名，動機大致上是要改變中世紀社會逐漸嚴重的腐敗，卻不是將古羅馬原樣重現，反而是加入新思考和檢討，所以做出實際上是一種徹底不同的新型態文化變革，其中雖囊括了對古典文獻的重新學習和承接，卻在繪畫方面透過直線透視法的發展，以及逐步而廣泛開展的中古時代教育變革，乃至於人體結構、化學、天文技術和科學知識的追求等等，這些極重要的近代科學發展，除了打破神權時代，也打破了希臘羅馬的古文化。傳統觀點認為，這種知識上的轉變讓文藝復興發揮了銜接中世紀和近代的作用。儘管文藝復興在知識、文學、社會和政治各個方面都引發了巨大變革，但令其聞名於世的或許還在於這一時期的藝術成就，以及李奧納多·達文西、米開朗基羅等博學家做出的創新貢獻。\\n一般認為，文藝復興始於義大利，這與其北部興盛的地中海貿易有關，商人除了將當時中東和希臘的古羅馬文獻匯集於此，富裕的風雅紳商更傾力支持著藝術創作。正式的發展是從14世紀托斯卡尼的佛羅倫斯開展的，但對此尚有質疑之聲。就這場運動的起源和特點而言，多種理論已經提出了各自的見解，但其關注的焦點不盡相同：其中包括有當時佛羅倫斯的社會和公民的特點；當地的政治結構；當地統治階級美第奇家族的贊助；以及鄂圖曼土耳其人攻陷君士坦丁堡後，大批流入義大利的希臘語學者及書籍。史學上關於文藝復興的內容很多且頗為複雜，而「文藝復興」作為詞彙的作用，及其作為歷史過渡期的意義，都引發了史學家的諸多爭論。文藝復興一詞能否作為是中世紀後的文化「進步」，一些史學家對此是持懷疑態度的：他們認為，這個階段只是對古典時代抱持悲觀與緬懷的時期，社會早就不是單純的撿拾古人的思想，反而是巨大創新的重塑了一個時代。而另一些人則關注兩個時代之間的連續性。實際上，現在已有人提出不應繼續使用這個詞彙，因為他們認為「文藝復興」一詞只是現代主義的產物，是使用歷史來驗證和發揚當代理想的工具。「文藝復興」一詞也被用於其他歷史或文化運動，如卡洛林文藝復興和12世紀的文藝復興就是這樣的例子。"},{"page_url":"https://fi.wikipedia.org/wiki/Shankar_(elokuvaohjaaja)","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a6/Shankar_%28director%29.jpg","page_title":"Shankar (elokuvaohjaaja)","context_page_description":"Shanmugam Shankar on intialainen elokuvaohjaaja, -tuottaja ja -käsikirjoittaja, joka työskentelee tamilinkielisessä elokuvateollisuudessa."},{"page_url":"https://ar.wikipedia.org/wiki/%D9%85%D8%AD%D9%85%D8%AF_%D8%A7%D9%84%D8%B9%D8%A7%D9%8A%D8%B4","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/35/%D9%85%D8%B9%D8%A7%D9%84%D9%8A_%D8%A7%D9%84%D9%88%D8%B2%D9%8A%D8%B1_%D9%85%D8%AD%D9%85%D8%AF_%D8%A8%D9%83_%D8%A7%D9%84%D8%B9%D8%A7%D9%8A%D8%B4_%D9%81%D9%8A_%D8%A7%D8%B3%D8%AA%D9%82%D8%A8%D8%A7%D9%84_%D8%A7%D9%84%D8%A3%D9%85%D9%8A%D8%B1_%D8%B9%D8%A8%D8%AF%D8%A7%D9%84%D9%84%D9%87.jpg","page_title":"محمد العايش","context_page_description":"محمد العايش سياسي ونائب ووزير سوري خلال عهد الجمهورية السورية الأولى، يعتبر أول وزير من مدينة دير الزور في الحكومة السورية المشكلة عام 1941، وبعد توزيره تكرّس التقليد بتخصيص مقعد وزاري لأحد أبناء الطبقة البرجوازية في دير الزور في الحكومات السورية المتعاقبة."},{"page_url":"https://fr.wikipedia.org/wiki/David_Starkey","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/bc/David_Starkey_LSE.jpg","page_title":"David Starkey","context_page_description":"David Robert Starkey, né le 3 janvier 1945 à Kendal dans le comté de Cumbria au Royaume-Uni, est un historien constitutionnel, et présentateur de radio et de télévision britannique. Il est un spécialiste de la dynastie des Tudor et de la Période Tudor."},{"page_url":"https://hy.wikipedia.org/wiki/%D5%8E%D5%AB%D5%B6_%D4%B2%D5%A5%D5%B5%D6%84%D5%A5%D6%80","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/51/Lipofsky-Vin_Baker.jpg","page_title":"Վին Բեյքեր","context_page_description":"Վինսենթ Լամոնտ Բեյքեր, ամերիկացի նախկին, բասկետբոլիստ, հարձակվող, կենտրոնական, օլիմպիական խաղերի ոսկե մեդալակիր ։ Մասնագիտական կարիերայի ընթացքում հանդես է եկել Բասկետբոլի ազգային ասոցիացիայի «Միլուոքի Բաքս», «Սիեթլ Սուպերսոնիքս» և մի շարք այլ ակումբներում։\\nՉնայած ունենալով հաջող մասնագիտական կարիերա NBA-ում, Բեյքերն ունեցել է լուրջ խնդիրներ ալկոհոլիզմի հետ, ինչի պատճառով կորցրել է շուրջ 100 միլիոն ԱՄՆ դոլարի կարողություն։\\n2015 թվականի հուլիսի դրությամբ, Բեյքերը մասնաճյուղային մենեջերի վերապատրաստում է անցնում «Ստարբաքս» ցանցում։"},{"page_url":"https://he.wikipedia.org/wiki/%D7%A8%D7%A6%D7%97_%D7%94%D7%A2%D7%9D_%D7%94%D7%90%D7%A9%D7%95%D7%A8%D7%99","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1a/Ruins_of_Gulpashan.jpg","page_title":"רצח העם האשורי","context_page_description":"רצח העם האשורי הוא הכינוי למעשי הטבח ההמוניים באוכלוסייה האשורית בתחומי האימפריה העות'מאנית ובפרס, על ידי חיילים עות'מאניים במהלך מלחמת העולם הראשונה, במקביל לרצח העם הארמני ורצח העם היווני.\\nהמשלחת האשורית להסכמי לוזאן דיווחה על כ-275,000 מקרי מוות, ושהמספרים עלולים להגיע עד 300,000 בשל האזורים האשורים המיושבים שלא נספרו. חוקרים אחרים מעריכים את המספרים בכ-150,000.\\nבדומה לרצח העם הארמני ולרצח העם היווני, טורקיה של ימינו מכחישה גם את רצח העם האשורי."},{"page_url":"https://zh.wikipedia.org/zh-tw/%E6%AC%A7%E7%8E%9B%E5%B0%94%C2%B7%E6%B5%B7%E4%BA%9A%E5%A7%86%E7%8E%AF%E5%BD%A2%E5%B1%B1","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a0/Normal_omar-khayyam-clem1.jpg","page_title":"欧玛尔·海亚姆环形山","context_page_description":"歐瑪爾·海亞姆環形山是位於月球背面北半部的一座古老大撞擊坑，約形成於45.5-39.2億年前的前酒海紀，其名稱取自波斯哲學家、數學家、天文學家暨詩人\\"奧瑪爾·海亞姆\\"，1970年被國際天文學聯合會正式批准接受。"},{"page_url":"https://ja.wikipedia.org/wiki/%E3%82%AF%E3%83%AA%E3%82%B9%E3%83%86%E3%82%A3%E3%82%A2%E3%83%B3%E3%83%BB%E3%83%95%E3%82%A9%E3%83%B3%E3%83%BB%E3%82%B1%E3%83%BC%E3%83%8B%E3%82%B0%E3%82%BB%E3%82%B0","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e5/Christian_Von_Koenigsegg_Interview_at_Goodwood_Festival_of_Speed_%2814340401677%29.jpg","page_title":"クリスティアン・フォン・ケーニグセグ","context_page_description":"クリスティアン・エアラント・ハラルト・フォン・ケーニグセグは、スウェーデンの高性能自動車製造会社、ケーニグセグの創業者であり、CEOである。\\nケーニグセグは1994年に創業され、彼の妻であるハルドーラ・ケーニグセグと共同で経営されている。\\n6歳の時にカートをはじめた。初めての夏の職業体験では、ストックホルム郊外のスズキのディーラーで勤務した。またその当時の趣味はバイク・モペットの改造だった。"},{"page_url":"https://ja.wikipedia.org/wiki/%E3%83%89%E3%82%A5%E3%83%AB%E3%82%AC%E3%83%BC","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c4/Durga_at_Rewalsar_Lake._2010.jpg","page_title":"ドゥルガー","context_page_description":"ドゥルガーは、ヒンドゥー教の女神である。その名は「近づき難い者」を意味する。デーヴァ神族の要請によってアスラ神族と戦った。シヴァ神の神妃とされ、パールヴァティーと同一視された。"},{"page_url":"https://en.wikipedia.org/wiki/Cedar_Point","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c0/CP-Cedar_Creek_Mine_Ride.jpg","page_title":"Cedar Point","context_page_description":"Cedar Point is a 364-acre amusement park located on a Lake Erie peninsula in Sandusky, Ohio. Opened in 1870, it is considered the second-oldest operating amusement park in the United States behind only Lake Compounce. Cedar Point is owned and operated by Cedar Fair and is considered the flagship of the amusement park chain. Known as \\"America's Roller Coast\\", the park features a world-record 71 rides, including 17 roller coasters – the second-most in the world behind Six Flags Magic Mountain. Its newest roller coaster, Steel Vengeance, opened to the public on May 5, 2018.\\nCedar Point's normal operating season runs from early May until Labor Day in September. The park then reopens only on weekends until the end of October or early November for a Halloween-themed event known as HalloWeekends. Other attractions near the park include a one-mile-long white-sand beach, an outdoor water park called Cedar Point Shores, an indoor water park called Castaway Bay, two marinas, an outdoor sports complex called Cedar Point Sports Center, and several nearby resorts.\\nThe park has reached several milestones."},{"page_url":"https://es.wikipedia.org/wiki/Procatedral_de_San_Patricio_(Newark)","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/bd/Patrick_pro_cathedral_Newark_jeh.jpg","page_title":"Procatedral de San Patricio (Newark)","context_page_description":"La Procatedral de San Patricio​ ​ es un templo católico conocido como proto catedral de la Iglesia católica en los Estados Unidos, con sede en Newark, ​ Nueva Jersey dentro de la Arquidiócesis de Newark.\\nLa iglesia de San Patricio fue construida en 1846 y sirvió como sede de su obispo prelado a partir de 1853 hasta la finalización de la basílica del Sagrado Corazón.​\\nEl edificio en sí fue incluido en el Registro Nacional de Lugares Históricos en 1972, y se ha sometido a una rehabilitación durante los últimos quince años desde que dejó de ser catedral. Varias tradiciones se mantienen, la conexión de la parroquia a su historia como la \\"Catedral Vieja\\" de Newark, incluyendo la Liturgia de 12:15, Miércoles de Ceniza con el arzobispo, la liturgia dominical de 12:15 de Pascua en memoria del levantamiento de Pascua de 1916 en Dublín, la misa anual de bomberos de Newark, y muchos otros sucesos de la herencia irlandesa y arquidiocesana. La parroquia es también el santuario nacional de la Virgen de El Quinche."},{"page_url":"https://de.wikipedia.org/wiki/Henry_Maske","image_url":"http://upload.wikimedia.org/wikipedia/commons/4/4a/Henry_Maske_Berlinale_2008.jpg","page_title":"Henry Maske","context_page_description":"Henry Maske ist ein ehemaliger deutscher Boxer, der in den 1980er Jahren als Amateur große Erfolge unter anderem als Olympiasieger 1988 im Mittelgewicht feierte und anschließend Weltmeister bei den Profis war. Aufgrund seines kultivierten Auftretens in der Öffentlichkeit sowie wegen seines Boxstils bekam er den Spitznamen Gentleman und gelangte deutschlandweit zu großer Popularität. Maske gilt als einer der Mitbegründer des sogenannten Box-Booms, der Anfang der 1990er Jahre Deutschland erfasste."},{"page_url":"https://fr.wikipedia.org/wiki/Jardin_botanique_de_Peradeniya","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/15/Royal_Botanical_Gardens%2C_Sri_Lanka%2C_chauve-souris.jpg","page_title":"Jardin botanique de Peradeniya","context_page_description":"Le jardin botanique de Peradeniya ou Royal Botanical Garden est un jardin botanique situé à Peradeniya dans la banlieue proche de Kandy. Il est renommé pour son impressionnante collection d'orchidées. Il présente, en outre, un jardin d'épices et de plantes médicinales ainsi que de nombreux palmiers. Le jardin est situé dans une boucle de la rivière Mahaweli."},{"page_url":"https://es.wikipedia.org/wiki/Casa_de_Dinefwr","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/56/Dinefwr_Castle.jpg","page_title":"Casa de Dinefwr","context_page_description":"La Casa de Dinefwr fue una casa real de Gales y se refiere a los descendientes de Cadell ap Rhodri, rey de Seisyllwg, hijo de Rhodri el Grande.\\nCon la muerte de Rhodri Mawr, el reino de Gwynedd pasó a su hijo mayor Anarawd ap Rhodri. Su siguiente hijo, Cadell ap Rhodri, sin embargo, puso su mirada fuera de las fronteras tradicionales de Gwynedd tomó posesión del reino de Dyfed a finales del IX tardío, estableciendo su capital en la ciudadela de Dinefwr. Los descendientes de Cadell ap Rhodri fueron conocidos como Dinefwr por el nombre de la ciudadela desde la que gobernarían Dyfed. La dinastía de Dinefwr bajo Hywel Dda uniría Dyfed y Seisyllwg para fomar Deheubarth a comienzos del siglo X. La casa de Dinefwr gobernaría en Deheubarth hasta la conquista anglonormada del siglo XIII. Esta rama competiría con la Casa de Aberffraw por la supremacía en Gales hasta el siglo XII, con Powys entrando ocasionalmente en la liza. Finalmente, una rama de cadete de Dinefwr se establecería en Powys a mediados del siglo XI, conocida como Mathrafal por el castillo donde establecieron su sede."},{"page_url":"https://ar.wikipedia.org/wiki/%D9%83%D8%B1%D9%8A%D8%B3_%D9%85%D9%8A%D9%84%D8%B1_(%D9%85%D9%85%D8%AB%D9%84)","image_url":"http://upload.wikimedia.org/wikipedia/commons/4/45/Chris_Miller_by_Gage_Skidmore.jpg","page_title":"كريس ميلر (ممثل)","context_page_description":"كريس ميلر هو مخرج أفلام، وممثل صوت، وكاتب سيناريو، ومخرج تلفزيوني، من الولايات المتحدة، ولد في إيفرت."},{"page_url":"https://nn.wikipedia.org/wiki/Draguignan","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0a/Couvent_et_Chapelle_des_Minimes_-_Draguignan_%282%29.jpg","page_title":"Draguignan","context_page_description":"Draguignan er ein by og kommune søraust i Frankrike. Han er sous-préfecture i departementet Var i regionen Provence-Alpes-Côte d'Azur, og har om lag 35 000 innbyggjarar. Byen ligg ved elva Verdon."},{"page_url":"https://bg.wikipedia.org/wiki/%D0%98%D0%B7%D1%81%D1%82%D1%80%D0%B5%D0%BB","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8e/5-54-Mark-45-firing_edit.jpg","page_title":"Изстрел","context_page_description":"Изстрел се нарича действие с което се изхвърля с висока скорост материално тяло или енергия. Най-често под изстрел се разбира изстрела от стрелково оръжие. Изстрел е също и действието произвеждано от различните енергийни оръжия. За някой живи организми също се използва термина изстрел за да обозначи изхвърляне на отровен шип, жило или химична смес по неприятелите им.\\nПроизвеждането на изстрел или изстрели от стрелково оръжие се нарича стрелба. Изстрелите произведени от различните типове оръжия имат различна същност."},{"page_url":"https://en.wikipedia.org/wiki/Silver_Line_(Grand_Rapids)","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/33/Fulton_Street_Station%2C_Silver_Line%2C_Grand_Rapids%2C_Michigan.JPG","page_title":"Silver Line (Grand Rapids)","context_page_description":"The Silver Line is a bus rapid transit line run by the Interurban Transit Partnership in Grand Rapids, Michigan, United States. The line runs along Division Avenue on the Wyoming-Kentwood border into downtown Grand Rapids, where it loops around before terminating at Rapid Central Station. It began operation on August 25, 2014.\\nThe route is part of The Rapid transit network in the Grand Rapids metro area. It is the first BRT service in the state of Michigan.\\nThere are 34 stations including the terminus platform at Central Station. Each station is equipped with a fare card vending machine, 24-hour lighting, an emergency phone, and a snow melt system under the platform. An illuminated text display informs passengers of expected arrival times. All stations have raised platforms that align with the floor of the rapid transit vehicle, making for very easy boarding and alighting."},{"page_url":"https://ca.wikipedia.org/wiki/Griqual%C3%A0ndia","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/bd/Coloured_Trek-boer_nomads_-_Cape_Colony.jpg","page_title":"Griqualàndia","context_page_description":"Griqualàndia és el nom donat a territoris regits per la gent griqua; els griques són un subgrup de Sud-àfrica heterogeni i multiracial, d'origen mixt blanc o xines o indi amb negres, anomenats coloured, que té un origen únic en la història inicial de la Colònia del Cap.\\nIgual que altres parlants de l'Afrikaans en aquell temps, els Trekboers, originalment van poblar les fronteres de la incipient Colònia del Cap. La seva societat semi-nòmada es va moure en escamots d'homes a cavall armats. També com el bòers, van emigrar des de Ciutat del Cap cap a l'interior i van establir diversos estats en lo que són ara Namíbia i Sud-àfrica.\\nSota l'apartheid van ser classificats com a \\"coloured\\" i de llavors ençà majoritàriament s'han integrat amb altres poblacions barrejades dins Sud-àfrica."},{"page_url":"https://en.wikipedia.org/wiki/VA-155_(U.S._Navy)","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d0/TBM-3E_Oakland_Reserve_%284806327736%29.jpg","page_title":"VA-155 (U.S. Navy)","context_page_description":"VA-155 was an Attack Squadron of the U.S. Navy. It was established as Torpedo Squadron VT-153 on 26 March 1945. The squadron was redesignated as VA-16A on 15 November 1946, and finally designated as VA-155 on 15 July 1948. It was disestablished on 30 November 1949. Its nickname is unknown. It was the first squadron to be named VA-155, the second VA-155 was originally established in 1946, redesignated as VA-155 on 4 February 1953, and disestablished on 30 September 1977, while a third VA-155 was established on 1 September 1987 and disestablished on 30 April 1993.\\nDuring the squadron’s deployment to the western Pacific from March to October 1947, three of its aircraft were equipped as antisubmarine warfare planes, giving it an ASW mission as well as attack."},{"page_url":"https://zh.wikipedia.org/wiki/%E8%98%87%E6%A0%BC%E8%98%AD%E7%9A%84%E7%91%AA%E8%92%82%E7%88%BE%E9%81%94","image_url":"http://upload.wikimedia.org/wikipedia/commons/2/2b/Matylda_zena.jpg","page_title":"蘇格蘭的瑪蒂爾達","context_page_description":"苏格兰的玛蒂尔达，原名为伊迪丝，英格兰王后，丈夫是征服者威廉的第四子亨利一世。\\n玛蒂尔达是苏格兰国王马尔科姆三世的女儿，三个哥哥邓肯二世、埃德加、亚历山大一世与弟弟大卫一世在父亲去世后先后成为苏格兰国王。"},{"page_url":"https://pt.wikipedia.org/wiki/Manuel_Ant%C3%B4nio_Pacheco","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/aa/Bar%C3%A3o_de_Sabar%C3%A1%2C_da_cole%C3%A7%C3%A3o_Museu_Hist%C3%B3rico_Nacional.jpg","page_title":"Manuel Antônio Pacheco","context_page_description":"Manuel Antônio Pacheco, primeiro e único barão de Sabará foi um nobre brasileiro, agraciado barão.\\nFoi agraciado comendador da Imperial Ordem da Rosa e da Imperial Ordem de Cristo e cavaleiro da Imperial Ordem do Cruzeiro."},{"page_url":"https://ar.wikipedia.org/wiki/%D9%85%D8%B3%D9%8A%D8%B1%D8%A9_%D8%A7%D9%84%D9%88%D9%81%D8%A7%D8%A1_%D9%84%D9%84%D8%B4%D9%87%D8%AF%D8%A7%D8%A1","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/55/Panoramic_image_for_march_of_loyalty_to_Martyrs.jpg","page_title":"مسيرة الوفاء للشهداء","context_page_description":"مسيرة الولاء للشهداء أقيمت في 22 فبراير 2011 في المنامة عاصمة مملكة البحرين. شارك عشرات الآلاف في الاحتجاج وهي أحد أكبر المسيرات ضمن احتجاجات عام 2011. سميت على إثر القتلى السبعة الذين قتلوا على أيدي قوات الشرطة والجيش خلال الاحتجاجات حيث ملئت المسيرة ما بين مجمع البحرين ودوار اللؤلؤة. حمل المتظاهرون علم البحرين وطالبوا بسقوط الحكومة وتنفيذ النظام الملكي الدستوري وإصلاحات أخرى وطالب البعض الآخر باسقاط النظام.\\nاعتبرت المسيرة الأكبر في تاريخ البلاد من قبل المنظمين. قدرت مصادر أنها بلغت أكثر من 100 ألف متظاهر بينما أعطت مصادر أخرى تقديرات أعلى وأدنى. انضم عدد من سائقي سيارات الإسعاف والشرطة وضباط الجيش للاحتجاج. كانت قوات الامن غير موجودة وعلى عكس الاحتجاجات السابقة فقد انتهت سلميا."},{"page_url":"https://sv.wikipedia.org/wiki/Kulistenen","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/76/Kulsteinen.JPG","page_title":"Kulistenen","context_page_description":"Kulistenen är en runsten från Kuløy i Smøla kommun i Møre og Romsdal.\\nPå den flata sidan är ett kors inhugget, och på kantsidan en runinskrift i två linjer. Toppen av stenen är avslagen, och det är sannolikt att något av inskriften saknas efter brottet. Stenen finns nu i Vitenskapsmuseet i Trondheim."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Kirchen_im_Bistum_Osnabr%C3%BCck","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/25/Alfhausen_johanneskirche.jpg","page_title":"Liste der Kirchen im Bistum Osnabrück","context_page_description":"Die Liste der Kirchen Bistum Osnabrück zeigt die katholischen Kirchen und Kapellen im Bistum Osnabrück an."},{"page_url":"https://pl.wikipedia.org/wiki/Samatan","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e6/EDVV_-_Samatan_-_00004.jpg","page_title":"Samatan","context_page_description":"Samatan – miejscowość i gmina we Francji, w regionie Oksytania, w departamencie Gers.\\nWedług danych na rok 1990 gminę zamieszkiwało 1716 osób, a gęstość zaludnienia wynosiła 51 osób/km²."},{"page_url":"https://de.wikipedia.org/wiki/Bataillon_Zo%C5%9Bka","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c7/Warsaw_Uprising_Batalion_Zo%C5%9Bka_2_%281944%29.jpg","page_title":"Bataillon Zośka","context_page_description":"Das Bataillon „Zośka“ war eine Einheit der polnischen Pfadfinderbewegung Szare Szeregi im Zweiten Weltkrieg und kämpfte im Warschauer Aufstand als ein Teil der polnischen Heimatarmee gegen die deutsche Besetzung Polens."},{"page_url":"https://ca.wikipedia.org/wiki/Mol%C3%AD_de_Puig_Rosell","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/03/Calonge_moli_puig_Rosell_sup.jpg","page_title":"Molí de Puig Rosell","context_page_description":"El Molí de Puig Rosell és un monument protegit com a bé cultural d'interès local del municipi de Calonge."},{"page_url":"https://hi.wikipedia.org/wiki/%E0%A4%8F%E0%A4%9C_(%E0%A4%B5%E0%A5%80%E0%A4%A1%E0%A4%BF%E0%A4%AF%E0%A5%8B_%E0%A4%97%E0%A5%87%E0%A4%AE)","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fe/Edge_%28video_game%29_app_icon.jpg","page_title":"एज (वीडियो गेम)","context_page_description":"एज आईओएस उपकरणों के लिए मोबीगैम द्वारा विकसित एक पहेली प्लेटफ़ॉर्म गेम है। उद्देश्य भूलभुलैया जैसे स्तरों के माध्यम से एक रोलिंग क्यूब का मार्गदर्शन करना और लक्ष्य तक पहुंचना है। मूल रूप से दिसंबर 2008 में ऐप स्टोर पर जारी किया गया था, इसे टाइज शब्द के शब्द \\"एज\\" के उपयोग से संबंधित टिम लैंगडेल के साथ ट्रेडमार्क विवाद के कारण कई बार स्टोर से हटा दिया गया और फिर से जोड़ा गया। जनवरी 2010 में अपने मूल नाम के तहत ऐप स्टोर में लौटने से पहले इस गेम को संक्षिप्त रूप से मोबीगाम और एडी द्वारा एज के रूप में जारी किया गया था। मोबाइल फोन, PlayStation पोर्टेबल, विंडोज, मैक ओएस एक्स, लिनक्स, एंड्रॉइड, Wii यू, और निनटेंडो 3 डीएस सहित कई प्लेटफार्मों पर खेल जारी किया गया था।"},{"page_url":"https://ca.wikipedia.org/wiki/Catedral_de_M%C3%B2dena","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/61/Modena_Cathedral_north_portal_archivolt_and_lintel.jpg","page_title":"Catedral de Mòdena","context_page_description":"La Catedral de Mòdena és una església catòlica romana, romànica de Mòdena, Itàlia. És la catedral o duomo en italià, de l'arxidiòcesi catòlica de Mòdena-Nonantola. Consagrada el 1184, és un important edifici romànic a Europa i està inscrita a la llista del Patrimoni de la Humanitat des del 1997."},{"page_url":"https://fa.wikipedia.org/wiki/%DA%A9%D8%A7%D8%B2%DB%8C%D9%86%D9%88_%D8%AF_%D9%BE%D8%A7%D8%B1%DB%8C%D8%B3","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f4/Casino-de-Paris.jpg","page_title":"کازینو د پاریس","context_page_description":"کازینو د پاریس واقع در پلاک ۱۶ خیابان د کلیشی در منطقه نهم پاریس یکی از شناخته‌شده‌ترین تالارهای موسیقی پاریس است که تاریخچه آن به قرن هجدهم میلادی می‌رسد. بر خلاف نامش، کازینو د پاریس مکانی برای قماربازی نیست و سالن اجرای زنده است."},{"page_url":"https://en.wikipedia.org/wiki/United_States_Naval_Academy_Drum_and_Bugle_Corps","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f7/US_Navy_031004-N-6157F-009_Mid%27n_2nd_Class_John_Weier%2C_20%2C_of_Palmdale%2C_Calif.%2C_leads_the_Naval_Academy%27s_Drum_and_Bugle_Corps_during_halftime.jpg","page_title":"United States Naval Academy Drum and Bugle Corps","context_page_description":"The United States Naval Academy Drum and Bugle Corps is the military band and drum and bugle corps of the United States Naval Academy, which is a federal service academy in the United States Armed Forces based Maryland. Like its counterpart at the Air Force Academy, it is staffed by midshipmen from the Brigade of Midshipmen. It provides support to the brigade as well as the Plebe Summer Regiment. It is the oldest continuously active drum and bugle corps in the United States. It currently performs over 100 times per year."},{"page_url":"https://fr.wikipedia.org/wiki/Changement_de_couleur_des_feuilles","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/14/Through_two_leaves.jpg","page_title":"Changement de couleur des feuilles","context_page_description":"Durant les mois d'automne, des arbres feuillus et des fougères connaissent un changement de couleur des feuilles et des frondes avant qu'elles ne tombent. Ce changement de couleurs, qui existe chez beaucoup d'arbres des régions tempérées, est souvent appelé couleurs automnales. Il est associé au dernier stade du développement de la feuille, la sénescence qui se caractérise par de véritables bouleversements biochimiques."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Kulturdenkmale_in_Weimar_(Einzeldenkmale)","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/78/Herderplatz_14_Weimar_1.JPG","page_title":"Liste der Kulturdenkmale in Weimar (Einzeldenkmale)","context_page_description":"Die Liste der Kulturdenkmale in Weimar (Einzeldenkmale) umfasst die als Einzeldenkmale erfassten Kulturdenkmale der thüringischen Stadt Weimar, die vom Thüringischen Landesamt für Denkmalpflege und Archäologie als Bau- und Kunstdenkmale auf dem Gebiet der Stadt mit Stand vom 20. November 2013 erfasst wurden.\\nDie als Sachgesamtheiten und Ensembles nach dem Thüringischen Denkmalschutzgesetz erfassten Kulturdenkmale sind in der Liste der Kulturdenkmale in Weimar aufgeführt."},{"page_url":"https://fr.wikipedia.org/wiki/S%C3%A9nat_(Uruguay)","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/17/2016_columnas_de_la_fachada_del_Palacio_Legislativo_de_Montevideo.jpg","page_title":"Sénat (Uruguay)","context_page_description":"Le Sénat d'Uruguay est la chambre haute de l'Uruguay. Il est issu de la Lex Magna de 1967, qui a conservé la structure bicamérale mise en place en 1830."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%96%D0%B0%D1%81_%D0%9E%D1%82%D0%B0%D0%BD","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/73/Zhas_Otan_-_1_syezd_-_003.JPG","page_title":"Жас Отан","context_page_description":"Жас Отан — молодёжное крыло партии «Nur Otan», которое было создано в форме общественного объединения на I съезде «Жас Отана» 14 мая 2008 года в Астане. Организация имеет филиалы во всех областях страны, городах Нур-Султане, Алматы и Шымкент, а также отделения на районном и городском уровне: региональные филиалы — 17, городские отделения — 37, районные отделения — 171, отделения на предприятиях — 230, отделения в ВУЗах — 96. В центральный совет молодёжного крыла «Жас Отан» входят депутаты Мажилиса Парламента Казахстана, Маслихатов всех уровней, лидеры молодёжных НПО, молодые спортсмены и деятели культуры. Численность организации на 2019 год составляла более 106 тысяч членов."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%A1%D1%83%D0%B3%D0%B8%D1%8F%D0%BC%D0%B0,_%D0%9A%D0%BE%D0%B8%D1%82%D0%B8","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8c/Kohichi_Sugiyama_2011-06-30.jpg","page_title":"Сугияма, Коити","context_page_description":"Коити Сугияма — японский игровой композитор, постоянный член совета JASRAC, почётный председатель Японской федерации коротких нард. Наиболее известен по музыке к серии компьютерных игр Dragon Quest, выпускаемых компанией Enix с 1986 года, а также по ряду японских телевизионных шоу и аниме и фильмов\\nБудучи дирижёром с классическим образованием, Сугияма часто сотрудничал с другими именитыми композиторами, в частности с Нобуо Уэмацу, который в одном из интервью назвал его «большим боссом в области музыки для компьютерных игр».\\nКроме музыки Коити Сугияма интересуется политикой, отстаивая крайне правые ревизионистские убеждения. Например, он неоднократно оправдывал Японскую империю в отношении станций комфорта и военных преступлений в Нанкине. Из-за националистических статей в газете Washington Post некоторые фанаты даже призывали к бойкоту серии Dragon Quest, в играх которой как правило рассказываются истории, наполненные гуманистическими идеалами."},{"page_url":"https://id.wikipedia.org/wiki/Ornithorhynchidae","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f2/Platypus.jpg","page_title":"Ornithorhynchidae","context_page_description":"Ornithorhynchidae adalah satu dari dua famili dalam ordo Monotremata dan terdiri atas platipus dan saudaranya yang sudah punah. Famili lainnya adalah Tachyglossidae atau echidna. Ornithorhynchidae terdiri atas dua genera yaitu: Obdurodon dan Ornithorhynchus.\\nFamili Ornithorhynchidae\\nGenus Obdurodon\\nSpesies Obdurodon dicksoni\\nSpesies Obdurodon insignis\\nSpesies Obdurodon/Monotrematum sudamericanum\\nGenus Ornithorhynchus\\nSpesies Ornithorhynchus anatinus\\nDua genera lainnya, Steropodon dan Teinolophos juga dapat termasuk dalam Ornithorhynchidae. Namun, keduanya sangat tua dan tulisan ilmiah kelihatannya menunjukkan bahwa keduanya berelasi dengan, tetapi bukan bagian dari, Ornithorhynchidae."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%9B%D0%B0-%D0%91%D0%B0%D1%81%D1%82%D1%96%D0%B4-%D0%B4%D1%8E-%D0%A1%D0%B0%D0%BB%D0%B0%D1%82","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/30/La_Bastide-du-Salat.jpg","page_title":"Ла-Бастід-дю-Салат","context_page_description":"Ла-Басті́д-дю-Сала́т — муніципалітет у Франції, у регіоні Південь-Піренеї, департамент Ар'єж. Населення — 206 осіб.\\nМуніципалітет розташований на відстані близько 660 км на південь від Парижа, 75 км на південний захід від Тулузи, 55 км на захід від Фуа."},{"page_url":"https://ro.wikipedia.org/wiki/Hadji_Ghirai_I","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/18/CrimeeXV-s.jpg","page_title":"Hadji Ghirai I","context_page_description":"Hadji Ghirai I a fost un han tătar, fondatorul și cel dintâi conducător al Hanatului Crimeii, întemeietorul dinastiei hanilor Ghirai din Crimeea. Uneori este supranumit Hacı Devlet Giray sau Devlet Hacı Giray, de asemenea Al Sultan Hadji Ghirai ibn Ghias ad-Din."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%A2%D0%B8%D0%BF%D0%BE%D0%BB%D0%BE%D0%B3%D0%B8%D1%8F_%D0%9E%D1%83%D0%BA%D1%88%D0%BE%D1%82%D1%82%D0%B0","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5b/Albion_Regent_Medieval_Sword_2_%286092092593%29.jpg","page_title":"Типология Оукшотта","context_page_description":"Типология Оукшотта — классификация средневековых мечей, разработанная английским исследователем Эвартом Оукшоттом. Классификация получила признание историков, оружиеведов, реконструкторов средневековья и любителей холодного оружия во всём мире. С исчерпывающей полнотой Оукшоттом были описаны все основные виды использовавшихся в средние века мечей, разделённых на 13 основных типов и 9 подтипов. Нумерация внутри типологии начинается с типа Х, так как, по замыслу Оукшотта, его классификация логично продолжает классификацию мечей эпохи викингов, оканчивающуюся на типе IX.\\nВ основу типологической схемы поставлена форма и конструкция клинка — основной, рабочей части меча, что выгодно отличает классификацию Оукшотта от других подобных систем, построенных на сравнении формы эфеса.\\nСам же Оукшотт, помимо классифицирования собственно мечей, параллельно разработал типологические схемы наверший и крестовин. Все эти три тесно взаимосвязанные схемы образуют стройную и удобную систему, позволяющую описать практически любой меч формулой вида: XVIIIa-T-4, где XVIIIa — это тип меча, T — форма навершия, 4 — стиль исполнения крестовины."},{"page_url":"https://en.wikipedia.org/wiki/Parkside_High_School","image_url":"http://upload.wikimedia.org/wikipedia/commons/1/1b/Parkside_High_School.JPG","page_title":"Parkside High School","context_page_description":"Parkside High School is a four-year public high school in Salisbury, Wicomico County, Maryland, United States. It is one of four public high schools in Wicomico County along with James Bennett High School, Wicomico High School, and Mardela Middle and High School."},{"page_url":"https://es.wikipedia.org/wiki/Saint-Aubin-l%C3%A8s-Elbeuf","image_url":"http://upload.wikimedia.org/wikipedia/commons/1/12/Gare_de_ST_Aubin_les_Elbeuf.JPG","page_title":"Saint-Aubin-lès-Elbeuf","context_page_description":"Saint-Aubin-lès-Elbeuf es una población y comuna francesa, en la región de Alta Normandía, departamento de Sena Marítimo, en el distrito de Rouen y cantón de Elbeuf."},{"page_url":"https://ja.wikipedia.org/wiki/%E8%8F%AF%E5%BC%B7%E5%8C%97%E9%A7%85","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fb/Huaqiang_North_Station_%28Shekou_line%29_20130726.JPG","page_title":"華強北駅","context_page_description":"華強北駅は、中華人民共和国深圳市福田区に位置する2号線、7号線の駅である。"},{"page_url":"https://es.wikipedia.org/wiki/Acci%C3%B3n_Alfa","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b8/11._Acci%C3%B3n_Alfa.png","page_title":"Acción Alfa","context_page_description":"La Acción Alfa, también denominada Operación Alfa fue una ofensiva desarrollada por el Ejército Croata en el marco de la operación Papuk - 91 en Eslavonia Occidental. La acción tuvo lugar entre el 26 y el 29 de diciembre de 1991 con la intención de eliminar la amenaza serbia al este de Pakrac y contribuir con la ofensiva general contra el Ejército Popular Yugoslavo en la región.\\nComo consecuencia de un fuerte contraataque del JNA y la descoordinación de los atacantes, su resultado fue un rechazo rotundo de la ofensiva y una importante cantidad de bajas croatas."},{"page_url":"https://nl.wikipedia.org/wiki/Lijst_van_personen_geboren_op_5_oktober","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/29/Simon_Verelst_-_Mary_of_Modena_-_Google_Art_Project.jpg","page_title":"Lijst van personen geboren op 5 oktober","context_page_description":"Dit is een lijst van personen die geboren zijn op 5 oktober.\\nDe inhoud van deze pagina is gebaseerd op gegevens in Wikidata. Als er onvolkomenheden in deze lijst zitten, gelieve dan aldaar de gegevens aan te passen. Achter iedere persoon is hiervoor een link aanwezig met de aanduiding bewerken.\\nWijzigingen in Wikidata worden met enige regelmatigheid geautomatiseerd overgenomen naar deze pagina.\\n954 - Malcolm II van Schotland, koning, koning van Schotland uit het Koninkrijk Schotland bewerken\\n1319 - Peter IV van Aragón, schrijver uit de Kroon van Aragón bewerken\\n1377 - Lodewijk II van Napels, Franse heer van Guisa, monarch bewerken\\n1409 - Karel VIII van Zweden, Zweedse koning bewerken\\n1494 - Jan Adornes, geboren de la Coste, politicus bewerken\\n1546 - Rudolph Snel van Royen, Nederlandse rector magnificus van de Universiteit Leiden, wiskundige, taalkundige, academisch docent en theoloog bewerken\\n1600 - Thomas Goodwin, theoloog uit het Koninkrijk Engeland bewerken\\n1624 - Gaspar de Witte, kunstschilder uit de Zuidelijke Nederlanden bewerken\\n1625 - Eduard van de Palts, Duitse prins, aristocraat bewerken\\n1626 - George II van Württemberg-Mömpelgard, graaf, aristocraat bewerken"},{"page_url":"https://ru.wikipedia.org/wiki/%D0%A1%D0%BF%D0%B8%D1%81%D0%BE%D0%BA_%D1%83%D1%87%D0%B0%D1%81%D1%82%D0%BA%D0%BE%D0%B2_%D0%BE%D1%81%D0%BE%D0%B1%D0%BE%D0%B3%D0%BE_%D0%BD%D0%B0%D1%83%D1%87%D0%BD%D0%BE%D0%B3%D0%BE_%D0%B7%D0%BD%D0%B0%D1%87%D0%B5%D0%BD%D0%B8%D1%8F_%D0%91%D0%BE%D0%BB%D1%8C%D1%88%D0%BE%D0%B3%D0%BE_%D0%9C%D0%B0%D0%BD%D1%87%D0%B5%D1%81%D1%82%D0%B5%D1%80%D0%B0","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ed/Rochdale_canal_railway_viaduct.jpg","page_title":"Список участков особого научного значения Большого Манчестера","context_page_description":"Это список участков особого научного значения на территории Большого Манчестера.\\nБольшой Манчестер — церемониальное и метропольное графство на западе Англии. Площадь графства составляет 1285 км². На территории Большого Манчестера был выделен 21 участок особого научного значения: 14 из них представляют особый биологический интерес, 5 — геологический интерес, а 2 — оба одновременно.\\nСпециальный охраняемый статус получают памятники природы биологического и геологического значения в соответствии со специальными правилами выбора. В Англии за присвоение статуса участка особого научного значения отвечает организация Natural England, специалисты которой оценивают, представляет ли данная территория особый интерес в силу своей фауны, флоры, геологических, физико-географических или геоморфологических особенностей. Natural England была создана 1 октября 2006 года в результате объединения трёх организаций — Countryside Agency, English Nature и Rural Development Service; она получила все их полномочия, в частности по присвоению статуса территориям особого научного значения."},{"page_url":"https://it.wikipedia.org/wiki/Rolls-Royce_Silver_Spur","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fb/1991_Rolls-Royce_Silver_Spur_II%2C_front.jpg","page_title":"Rolls-Royce Silver Spur","context_page_description":"La Silver Spur, autovettura prodotta dalla casa britannica Rolls-Royce Motors, è stata in produzione dal 1980 al 1997 con 3 revisioni, nel 1989, nel 1993 e nel 1994.\\nL'automobile è la versione con interasse allungato di 4 pollici, circa 10 cm, della Silver Spirit."},{"page_url":"https://ga.wikipedia.org/wiki/Buam%C3%A1il_na_C%C3%A1sca_i_Sr%C3%AD_Lanca,_2019","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/bb/Pray_for_Sri_Lanka_-_solidarity_in_Freiburg_im_Breisgau%2C_Germany.jpg","page_title":"Buamáil na Cásca i Srí Lanca, 2019","context_page_description":"Maraíodh timpeall trí chéad duine in ionsaithe buamála ar an 21 Aibreán 2019, Domhnach Cásca, i Srí Lanca.\\nPléascadh 8 gcinn de bhuamaí i 3 óstán agus 3 shéipéal Caitliceach, formhór an áir tarlaithe sa bpríomhchathair Colombo. Beirt bhuamálaí féin-mharfacha a ba chúis le cuid den sléacht. Chuir duine acu siúd den tsaol é féin sa scuaine don bhricfeasta i gceann de na hóstáin.\\nFritheadh buama eile ar maidin 21 Aibreán ag aerfort na príomhcathrach agus baineadh an dochar as.\\nMaraíodh 290 duine ar a laghad. Seasann an lá seo mar cheann de na laethanta ab fhuiltí i stair nua-aimseartha na tíre."},{"page_url":"https://zh.wikipedia.org/zh-sg/%E4%BA%94%E5%8D%81%E9%88%B4","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e2/ISUZUDMAX031.JPG","page_title":"五十鈴","context_page_description":"五十铃汽车是一家日本汽车制造公司，总公司位于日本东京都品川区，制造与组装则设厂于日本神奈川县藤泽市、栃木县及北海道，以生产商用车辆、巴士以及柴油内燃机著名。"},{"page_url":"https://bg.wikipedia.org/wiki/%D0%92%D0%B5%D0%BB%D0%B8%D0%BA%D0%B8_%D0%9F%D1%80%D0%B5%D1%81%D0%BB%D0%B0%D0%B2","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8b/Weliki-Preslaw-coat-of-arms.png","page_title":"Велики Преслав","context_page_description":"Велѝки Пресла̀в е град в област Шумен, Североизточна България. Той е административен и стопански център на едноименната община Велики Преслав. Населението на града към края на 2009 година наброява 8951 жители, което го прави третото по големина населено място в областта.\\nСтолица на страната от времето на Първото българско царство, в новата история Велики Преслав е със статут на град от 1883 година. До Освобождението през 1878 година градът е наричан и с турското название Ески Стамболук. Селището носи името Преслав до 1993 година, когато е издаден указ за преименуването му на Велики Преслав."},{"page_url":"https://zh.wikipedia.org/zh-tw/%E6%9C%A8%E6%A7%BF","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/08/Hibiscus_syriacus_June-1.jpg","page_title":"木槿","context_page_description":"木槿，錦葵科木槿屬的一種，是一種很常見的庭園灌木花種；原生地很可能在亞洲。\\n本種是韓國的國花，又名無窮花。"},{"page_url":"https://fr.wikipedia.org/wiki/Distinctions_au_tir_%C3%A0_l%27arc","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7b/Badges_chevreuil.png","page_title":"Distinctions au tir à l'arc","context_page_description":"Le niveau des archers peut être déterminé d'après les distinctions obtenues, soit hors concours, dans son club, soit lors de concours officiels dont la discipline permet l'obtention de distinctions. Les distinctions doivent être demandées par l'archer et ne sont donc pas automatiquement attribuées."},{"page_url":"https://fr.wikipedia.org/wiki/Monuments_nationaux_de_Vare%C5%A1","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5f/Stary_kostelik_se_sindelovou_strechou%2C_Vares.jpg","page_title":"Monuments nationaux de Vareš","context_page_description":"Cet article recense les monuments nationaux situés sur le territoire de la municipalité de Vareš en Bosnie-Herzégovine et dans la Fédération de Bosnie-et-Herzégovine. La liste établie par la Commission pour la protection des monuments nationaux compte 8 monuments nationaux inscrits sur la liste principale."},{"page_url":"https://fi.wikipedia.org/wiki/Culoz","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1b/Grand_Colombier%2C_Ain%2C_France.jpg","page_title":"Culoz","context_page_description":"Culoz on kunta itäisessä Ranskassa Ainin departementissa Auvergne-Rhône-Alpesin alueella. Se sijaitsee Rhônejoen varrella. Kunnan alueella on 1534 metriä korkea vuori Grand Colombier."},{"page_url":"https://en.wikipedia.org/wiki/Gornozavodsky_District","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/81/Coat_of_Arms_of_Gornozavodsky_rayon_%28Perm_krai%29_%282008%29.png","page_title":"Gornozavodsky District","context_page_description":"Gornozavodsky District is an administrative district of Perm Krai, Russia; one of the thirty-three in the krai. Municipally, it is incorporated as Gornozavodsky Municipal District. It is located on the western slopes of the Ural Mountains in the east of the krai. The area of the district is 7,057 square kilometers. Its administrative center is the town of Gornozavodsk. Population: 26,044; 30,172; 38,004. The population of Gornozavodsk accounts for 46.3% of the district's total population."},{"page_url":"https://no.wikipedia.org/wiki/Gotthelf_Fischer_von_Waldheim","image_url":"http://upload.wikimedia.org/wikipedia/commons/c/c2/Fischer_von_Waldheim_1771-1853.jpg","page_title":"Gotthelf Fischer von Waldheim","context_page_description":"Johann Gotthelf Fischer von Waldheim var en tysk zoolog, forsker i anatomi, paleontolog og geolog.\\nFischer begynte sin utdannelse i Mainz og studerte siden medisin i Leipzig. Etter at han i 1798 ble doktor, bosatte Fischer seg igjen i Mainz hvor han var lærer i naturhistorie og bibliotekar. Han reiste med sin venn Alexander von Humboldt til Wien og Paris og studerte der hos Georges Cuvier som var paleontologiens første autoritet.\\nFra 1795 forfattet han flere zoologiske avhandlinger, for eksempel om fiskenes svømmeblære og om primatenes anatomi. På grunn av disse skriftene ble han i 1804 innbudt til Moskva hvor han ble direktør for det naturvitenskapelige kabinett hos vitenskapsakademiet, og samtidig keiserlig hoffråd. I august 1805 skapte han Société Impériale des Naturalistes de Moscou. Han bedrev omfattende studier om Russlands geologi og beskrev flere paleontologiske funn. For sine fortjenester ble han senere adlet."},{"page_url":"https://cy.wikipedia.org/wiki/Gorsaf_reilffordd_Heol_Dingle","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/01/Arrival_at_Dingle_Rd_%282553263887%29.jpg","page_title":"Gorsaf reilffordd Heol Dingle","context_page_description":"Mae gorsaf reilffordd Heol Dingle yn orsaf reilffordd sy'n gwasanaethu tref Penarth ym Mro Morgannwg, Cymru. Mae gwasanaethau teithwyr yn cael eu darparu gan Trafnidiaeth Cymru."},{"page_url":"https://en.wikipedia.org/wiki/Mark_Suster","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4b/MarkSuster2019.jpg","page_title":"Mark Suster","context_page_description":"Mark Suster is an American entrepreneur and venture capitalist. He is a managing partner at Upfront Ventures, the largest venture capital firm in Los Angeles. Suster is a prominent blogger in the startup venture capital world."},{"page_url":"https://en.wikipedia.org/wiki/Compression_(physics)","image_url":"http://upload.wikimedia.org/wikipedia/commons/3/3e/Compression_test.jpg","page_title":"Compression (physics)","context_page_description":"In mechanics, compression is the application of balanced inward forces to different points on a material or structure, that is, forces with no net sum or torque directed so as to reduce its size in one or more directions. It is contrasted with tension or traction, the application of balanced outward forces; and with shearing forces, directed so as to displace layers of the material parallel to each other. The compressive strength of materials and structures is an important engineering consideration.\\nIn uniaxial compression, the forces are directed along one direction only, so that they act towards decreasing the object's length along that direction. The compressive forces may also be applied in multiple directions; for example inwards along the edges of a plate or all over the side surface of a cylinder, so as to reduce its area, or inwards over the entire surface of a body, so as to reduce its volume.\\nTechnically, a material is under a state of compression, at some specific point and along a specific direction, if the normal component of the stress vector across a surface with normal direction is directed opposite to."},{"page_url":"https://ko.wikipedia.org/wiki/%EC%9D%B4%EC%86%8C%ED%95%98%EB%9D%BC_%EC%97%AD","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b2/Isoharastation.jpg","page_title":"이소하라 역","context_page_description":"이소하라 역은 일본 이바라키현 기타이바라키시에 있는 동일본 여객철도의 철도역이다."},{"page_url":"https://ht.wikipedia.org/wiki/Moultrie,_Georgie","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2e/Moultrie_Municipal_Building.JPG","page_title":"Moultrie, Georgie","context_page_description":"Moultrie, Georgie se yon vil Etazini. Li sitye nan leta Georgie.\\nChèf-lye li se?\\n."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%90%D0%B2%D1%96%D0%B0%D0%B1%D0%BE%D0%BC%D0%B1%D0%B0","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5a/Grand_slam_bomb.jpg","page_title":"Авіабомба","context_page_description":"Авіаційна бомба, або Авіабомба, один з видів авіаційних боєприпасів, що скидаються з літак а чи іншого літального апарата і відокремлюються від тримачів під дією сили тяжіння або з невеликою швидкістю примусового відділення."},{"page_url":"https://sl.wikipedia.org/wiki/%C5%A0umarak,_Kovin","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9c/Etelep1.jpg","page_title":"Šumarak, Kovin","context_page_description":"Šumarak je naselje v Srbiji, ki upravno spada pod Občino Kovin; slednja pa je del Južno-banatskega upravnega okraja."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%A1%D0%B0%D0%BB%D0%BC%D0%B0%D0%BD%D0%BE%D0%B2,_%D0%9C%D0%B0%D0%BC%D0%B5%D0%B4_%D0%90%D1%85%D0%B0%D0%B4_%D0%BE%D0%B3%D0%BB%D1%8B","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/85/M%C9%99mm%C9%99d_Salmanov.jpg","page_title":"Салманов, Мамед Ахад оглы","context_page_description":"Мамед Ахад оглы Салманов — азербайджанский биолог, доктор биологических наук, профессор, действительный член НАНА."},{"page_url":"https://fr.wikipedia.org/wiki/Gnose","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/46/Jacques-B%C3%A9nigne_Bossuet_1.PNG","page_title":"Gnose","context_page_description":"De façon très générale, la gnose est un concept philosophico-religieux selon lequel le salut de l'âme passe par une connaissance directe de la divinité, et donc par une connaissance de soi.\\nDans le christianisme antique, le mot a été employé pour la première fois par Paul de Tarse, puis défendu et développé par un certain nombre de théologiens orientaux qui pendant les premiers siècles ont marqué le concept. Parmi les plus importants se trouvent Irénée de Lyon, Clément d'Alexandrie, Origène, ou encore Évagre le Pontique. Au XVIIᵉ siècle, le principe est ré-exploité en France par Bossuet et Fénelon.\\nPlus récemment, une importante confusion s'est créée sur le sens du mot gnose et sur son amalgame avec le terme gnosticisme. Le gnosticisme ou « gnosticisme historique » est un terme employé pour désigner certains mouvements du christianisme ancien qui relèvent d'une idéologie dualiste. Cette gnose dualiste contraire aux principes métaphysiques du christianisme, a été combattue par les théologiens chrétiens des premiers siècles qui l'ont qualifiée de pseudo-gnose, ou de « gnose au faux nom »."},{"page_url":"https://en.wikipedia.org/wiki/National_Register_of_Historic_Places_listings_in_Coventry,_Rhode_Island","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/09/CoventryRI_JosephBriggsHouseTownFarm.jpg","page_title":"National Register of Historic Places listings in Coventry, Rhode Island","context_page_description":"List of Registered Historic Places in Coventry, Rhode Island, which has been transferred from and is an integral part of National Register of Historic Places listings in Kent County, Rhode Island\\nThis National Park Service list is complete through NPS recent listings posted September 29, 2017."},{"page_url":"https://en.wikipedia.org/wiki/List_of_European_archaeological_sites_on_the_National_Register_of_Historic_Places_in_Pennsylvania","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/31/Bradys_Bend_Iron_Company_Furnace.jpg","page_title":"List of European archaeological sites on the National Register of Historic Places in Pennsylvania","context_page_description":"This is a list of European archaeological sites on the National Register of Historic Places in Pennsylvania.\\nHistoric sites in the United States qualify to be listed on the National Register of Historic Places by passing one or more of four different criteria; Criterion D permits the inclusion of proven and potential archaeological sites. Approximately one hundred different sites in Pennsylvania are listed under this criterion, including both Native American and European sites. This list includes all properties in Pennsylvania that qualify under Criterion D due to the presence of European artifacts."},{"page_url":"https://nn.wikipedia.org/wiki/Hammerfest_kommune","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5a/Hammerfest_Juni_2005.jpg","page_title":"Hammerfest kommune","context_page_description":"Hammerfest er ein kyst- og øykommune på vestkysten av Finnmark, nord i Troms og Finnmark fylke. Kommunen omfattar øyane Kvaløya, Seiland og Sørøya og Porsangerhalvøya på fastlandet. Han grensar til Måsøy kommune i nordaust, Porsanger i aust, Alta i sør og Hasvik i vest. Byen Hammerfest ligg på Kvaløya, som er forbunde med bru til fastlandet. Hammerfest er ein av verdas nordlegaste byar, på 70°40' nordleg breidde. Andre tettstadar i kommunen er mellom anna Kvalsund, Rypefjord, Forsøl, Akkarfjord, Hønseby, Hellefjord, Kårhamn, Skarvfjordhamn og Sandøybotn.\\nSjølv om han ligg langt nord for polarsirkelen, har byen ei isfri hamn. Hammerfest har tradisjonelt vore eit senter for fiskeri, handel, kommunikasjonar og offentlege tenester i Vest-Finnmark. I dag er byen også sterkt prega av utbygginga av Snøhvitfeltet, sidan gassen frå feltet skal førast i land og skipast ut i ein LNG-terminal på Melkøya utanfor byen. I 2005 kom Hammerfest på UNESCO si verdsarvliste med det nordlegaste målepunktet i Struves meridianboge."},{"page_url":"https://gl.wikipedia.org/wiki/Jean_Simmons","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/11/Jean_Simmons_in_Young_Bess_trailer.jpg","page_title":"Jean Simmons","context_page_description":"Jean Merilyn Simmons, nada o 31 de xaneiro de 1929 en Londres e falecida o 22 de xaneiro de 2010 en Santa Monica, foi unha actriz británica."},{"page_url":"https://de.wikipedia.org/wiki/J%C3%BCdischer_Friedhof_(Hoch-Weisel)","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5d/J%C3%BCdischer_Friedhof_%28Hoch-Weisel%29_11.JPG","page_title":"Jüdischer Friedhof (Hoch-Weisel)","context_page_description":"Der Jüdische Friedhof Hoch-Weisel ist ein Friedhof im Ortsteil Hoch-Weisel der Stadt Butzbach im Wetteraukreis in Hessen.\\nDer 2218 m² große jüdische Friedhof befindet sich südwestlich der geschlossenen Ortslage auf einer Anhöhe in einem Kiefernwald. Es sind nur noch wenige Grabsteine vorhanden."},{"page_url":"https://de.wikipedia.org/wiki/549","image_url":"http://upload.wikimedia.org/wikipedia/commons/5/5c/Erster_und_Zweiter_Gotenkrieg.png","page_title":"549","context_page_description":"Aufdeckung einer Verschwörung gegen Justinian I.\\nRom wird erneut von den Ostgoten zurückerobert, die es kurzzeitig an das oströmische Heer verloren hatten. Im selben Jahr gelingt Totila auch die Einnahme von Tarent, wo er eine Garnison stationiert, sowie von Perugia, dessen Bischof Herculanus er töten lässt. Im Circus Maximus in Rom finden daraufhin zum letzten Mal Wagenrennen statt.\\nKaiser Justinian I. lässt den in Italien im Gotenkrieg glücklos agierenden Belisar abberufen und später durch Narses ersetzen.\\nAgila I. folgt Theudigisel als König der Westgoten nach."},{"page_url":"https://en.wikipedia.org/wiki/Ivano-Frankivsk","image_url":"http://upload.wikimedia.org/wikipedia/commons/f/fd/Klemens_Stefan_Sielecki_1940.JPG","page_title":"Ivano-Frankivsk","context_page_description":"Ivano-Frankivsk is a historic city located in Western Ukraine. It is the administrative centre of Ivano-Frankivsk Oblast. Administratively, it is designated as a city of regional significance within the oblast, and together with a number of rural localities, is incorporated as Ivano-Frankivsk Municipality. Population: 230,929.\\nBuilt in the mid-17th century as a fortress of the Polish Potocki family, Stanisławów was annexed to the Habsburg Empire during the First Partition of Poland in 1772, after which it became the property of the State within the Austrian Empire. The fortress was slowly transformed into one of the most prominent cities at the foothills of the Carpathian Mountains. After World War I, for several months, it served as a temporary capital of the West Ukrainian People's Republic. Following Peace of Riga, Stanisławów became part of the Second Polish Republic. After the Soviet invasion of Poland at the onset of World War II, the city was annexed by the Soviet Union, only to be occupied by Nazi Germany two years later. With the liberation of Soviet Ukraine in 1944 and the shifting of borders, the Communist regime ran the city for the next four-and-a-half decades."},{"page_url":"https://de.wikipedia.org/wiki/Extraktion_(Zahnmedizin)","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b2/Knopfsonde.jpg","page_title":"Extraktion (Zahnmedizin)","context_page_description":"Als Extraktion, Exodontie oder Zahnextraktion wird in der Zahnmedizin die Entfernung eines Zahnes ohne operativen Eingriff bezeichnet. Ist zur Zahnentfernung eine Schnittführung und gegebenenfalls die Bildung eines Schleimhautperiostlappens erforderlich, handelt es sich um eine Osteotomie.\\nDie Extraktion erfolgt in der Regel unter einer Lokalanästhesie in Form einer Infiltrations- oder Leitungsanästhesie."},{"page_url":"https://nl.wikipedia.org/wiki/Neoclassicisme","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/04/Mercure4.jpg","page_title":"Neoclassicisme","context_page_description":"Het neoclassicisme was aan het eind van de 18e en het begin van de 19e eeuw een stroming in de kunst, waarin opnieuw de vermeende puurheid van de klassieken werd nagestreefd. Men richtte zich daarbij met name op de kunst van de oude Grieken en Romeinen. Beroemde neoclassicistische kunstenaars zijn de Franse schilders Jacques Louis David en Jean Auguste Dominique Ingres, en de in Rome werkzame beeldhouwers Antonio Canova en Bertel Thorvaldsen."},{"page_url":"https://da.wikipedia.org/wiki/Ryttere_og_hold_i_Tour_de_France_2010","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/36/MaillotEspa%C3%B1a.PNG","page_title":"Ryttere og hold i Tour de France 2010","context_page_description":"Dette er en liste over ryttere og hold, som deltager i Tour de France 2010."},{"page_url":"https://ja.wikipedia.org/wiki/%E3%83%9E%E3%83%AA%E3%82%A2%E3%83%BB%E3%83%95%E3%82%A9%E3%83%B3%E3%83%BB%E3%83%88%E3%83%A9%E3%83%83%E3%83%97","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/de/Maria_von_Trapp_in_1948.jpg","page_title":"マリア・フォン・トラップ","context_page_description":"マリア・アウグスタ・フォン・トラップは、オーストリア生まれの人物。元オーストリア海軍将校ゲオルク・フォン・トラップと結婚し、亡くなった前妻の子供たちと自らの子供たちでトラップ・ファミリー合唱団を結成して有名になる。彼女の自叙伝を脚色してつくられたのがミュージカル・映画『サウンド・オブ・ミュージック』である。"},{"page_url":"https://en.wikipedia.org/wiki/Colleen_Graffy","image_url":"http://upload.wikimedia.org/wikipedia/commons/2/28/Colleen_Graffy_Budapest_cropped.jpg","page_title":"Colleen Graffy","context_page_description":"Colleen Graffy is a former United States Deputy Assistant Secretary of State for Public Diplomacy for Europe and Eurasia, and associate professor of law and Director of Global Programs at Pepperdine University School of Law and Academic Director of their London campus. She is former Chairman of SEAL, the Society of English and American Lawyers.\\nGraffy is originally from Santa Barbara, California. She earned her B.A. from Pepperdine University and her M.A. from Boston University. She attended Pepperdine’s study abroad program in Heidelberg while an undergraduate and later became co-Director of Pepperdine’s campus in Heidelberg, Germany.\\nShe moved to the United Kingdom after completing her master's degree to start Pepperdine’s new London undergraduate program where she was the director and taught international relations and British government. She earned a law degree at City University and the Inns of Court School of Law and an LLM at King's College London. She was called to the Bar of England & Wales and is a Barrister and Bencher at The Honourable Society of the Middle Temple. She was chairman of Republicans Abroad for the United Kingdom.\\nShe joined the U.S."},{"page_url":"https://en.wikipedia.org/wiki/Iranians_in_the_Netherlands","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/cd/Persian_New_Year_Table_-_Haft_Sin_-in_Holland_-_Nowruz_-_Photo_by_Pejman_Akbarzadeh_PDN.JPG","page_title":"Iranians in the Netherlands","context_page_description":"Iranians in the Netherlands form one of the newer and larger populations of the Iranian diaspora in Europe. Iranians in the Netherlands are referred to by hyphenated terms such as Dutch-Iranians, Iranian-Dutch, Dutch-Persian, or Persian-Dutch. Similar terms Iraanse Nederlanders, Nederlandse Iraniërs, and Perzische-Nederlanders may be found in Dutch-language media."},{"page_url":"https://pt.wikipedia.org/wiki/Cidade_de_Deus_-_10_Anos_Depois","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7c/Favela_Vidigal.jpg","page_title":"Cidade de Deus - 10 Anos Depois","context_page_description":"Cidade de Deus - 10 Anos Depois é um documentário brasileiro, lançado em 2015.\\nO documentário pretende mostrar o que mudou na vida dos intérpretes do longa de 2002. Personagens que já fazem parte da história recente do cinema nacional, como Dadinho, Bené e Zé Pequeno, entre outros, participam do documentário dez anos após protagonizarem o filme Cidade de Deus, dirigido por Fernando Meirelles."},{"page_url":"https://nl.wikipedia.org/wiki/Wapen_van_Rottevalle","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/81/De_Rottefalle_wapen.svg","page_title":"Wapen van Rottevalle","context_page_description":"Het wapen van Rottevalle is het dorpswapen van het Nederlandse dorp Rottevalle, in de Friese gemeente Smallingerland. Het wapen werd in 2014 geregistreerd."},{"page_url":"https://gl.wikipedia.org/wiki/Mutaci%C3%B3n_neutra","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8a/Charles_Darwin_by_Julia_Margaret_Cameron_2.jpg","page_title":"Mutación neutra","context_page_description":"As mutacións neutras son cambios na secuencia do ADN que nin son beneficiosas nin prexudiciais para a capacidade dos organismos de sobrevivir e reproducirse. En xenética de poboacións, as mutacións nas cales a selección natural non afecta á transmisión desa mutación nunha especie denomínanse mutacións neutras. As mutacións neutras que son herdables e non están ligadas a ningún xene baixo selección vanse perder ou ben serán substituídas por outros alelos do xene. Esta perda ou fixación do xene ten lugar por medio dun proceso de mostraxes aleatorias naturais denominadas deriva xenética. Unha mutación neutra que está en desequilibrio de ligamento con outros alelos que están baixo selección pode encamiñarse á súa fixación ou á súa perda por medio do autostop xenético ou a selección de fondo ambiental.\\nAínda que moitas das mutacións que se producen nun xenoma poden facer diminuír a capacidade do organismos de sobrevivir e reproducirse, tamén chamada fitness, estas mutacións sofren unha forte selección en contra e non se transmiten a futuras xeracións."},{"page_url":"https://pt.wikipedia.org/wiki/Speicher","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/92/Speicher-Blazono.jpg","page_title":"Speicher","context_page_description":"Speicher é uma comuna da Suíça, no Cantão Appenzell Exterior, com cerca de 3.963 habitantes. Estende-se por uma área de 8,21 km², de densidade populacional de 483 hab/km². Confina com as seguintes comunas: Bühler, Eggersriet, Rehetobel, San Gallo, Teufen, Trogen.\\nA língua oficial nesta comuna é o Alemão."},{"page_url":"https://fr.wikipedia.org/wiki/Faux_bourdon","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/74/Drone_honey_bee_reproductive_organ-_cornua.JPG","page_title":"Faux bourdon","context_page_description":"Un faux bourdon parfois appelé aussi abeillaud ou bourdon, est le mâle de l'abeille. Il est important de le distinguer du bourdon en tant que tel, un animal différent, du genre Bombus. Le faux bourdon est le produit de l'éclosion d'un œuf non fécondé. Contrairement à l'abeille ouvrière femelle, il ne possède pas de dard et ne récolte ni nectar ni pollen. Avant toute chose, son rôle consiste à s'accoupler avec une reine fertile lors du vol nuptial, auquel il ne survit habituellement pas."},{"page_url":"https://nl.wikipedia.org/wiki/Simitli","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ed/Simitli-ploshtad-3.jpeg","page_title":"Simitli","context_page_description":"Simitli is een stad en een gemeente in de oblast Blagoevgrad in het zuidwesten van Bulgarije. De stad ligt 17 km ten zuiden van de stad Blagoëvgrad en is de hoofdplaats van de gemeente Simitli, die ook zeventien nabijgelegen dorpen omvat."},{"page_url":"https://de.wikipedia.org/wiki/Highways_in_Australien","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/ff/AUSR2.png","page_title":"Highways in Australien","context_page_description":"Die Highways in Australien sind hier in alphabetischer Reihenfolge aufgelistet, zusammen mit ihrer Nummer und dem Bundesstaat in dem sie sich befinden. Einige der Highways erstrecken sich dabei auch über mehrere Bundesstaaten."},{"page_url":"https://hy.wikipedia.org/wiki/%D5%8D%D6%84%D5%B8%D5%A9_(%D5%B0%D5%A1%D5%B4%D5%A1%D6%81%D5%B8%D6%82%D6%81%D5%A1%D5%AF)","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1b/Scott_catalog_1868_cover.jpg","page_title":"Սքոթ (համացուցակ)","context_page_description":"Սքոթ -, հրատարակչության դուստր Ամոս Փրես հրատարակչության ամենամյա, անգլերեն լեզվով հրատարակվող աշխարհի փոստային նամականիշերի լրիվ համացուցակ, որտեղ ներկայացվում են այն նամականիշերը, որոնք ըստ հրատարակչության կարծիքի՝ թողարկված են փոստային շրջանառության նպատակով։"},{"page_url":"https://hu.wikipedia.org/wiki/Kabar%C3%A9_(sz%C3%ADnh%C3%A1zi_produkci%C3%B3)","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/86/2014_01_Havana_653.jpg","page_title":"Kabaré (színházi produkció)","context_page_description":"A kabaré – sajátos szórakoztató színház. Franciaországból ered. A lényege egy olyan színházi produkció, amelyet általában kis színháztermekben, kávéházakban, akár kocsmákban adnak – elő szatirikus, humoros, szórakoztató prózai és verses-dalos elemekből lazán összefűzve.\\nA kabaré francia szó: cabaret, kocsma, csapszék jelentéssel, és eredetileg egy hidegtál, az „hors d'oeuvre” felszolgálását is jelentette.\\nA szórakoztató színpadon a kabarét megelőzte a vaudeville; hasonló szellemű populáris látványosságok már a középkorban is voltak.\\nA mai értelemben vett kabaré a 19. század legvégén Párizsban jött létre, azonnal népszerű lett, és rövidesen elterjedt egész Európában.\\nA kabaré-előadásokban a jeleneteket, magánszámokat, kuplékat, sanzonokat, eltérő stílusú és hangulatú műsorszámokat a konferanszié előadása, monológja köti össze. A kabaréra jellemző a mindenkori jelenre vonatkozó aktualitás, és a rögtönzés is.\\nA kabaré 1901-ben jelent meg Budapesten, majd már 1907-re ki is alakult a jellegzetes „pesti kabaré”, ugyanis 1907-ben nyílt meg a „Bonbonnière”. Konferansziéja Nagy Endre volt, aki 1907 és 1912 között megteremtette az irodalmi szintű kabarét."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%A1%D0%BE%D0%B1%D0%BE%D0%BB%D0%B5%D0%B2,_%D0%AE%D1%80%D0%B8%D0%B9_%D0%90%D0%BB%D0%B5%D0%BA%D1%81%D0%B5%D0%B5%D0%B2%D0%B8%D1%87","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/57/Peterburg3171.jpg","page_title":"Соболев, Юрий Алексеевич","context_page_description":"Соболев Юрий Алексеевич — советский инженер, специалист в области машиностроения. Лауреат Ленинской премии."},{"page_url":"https://de.wikipedia.org/wiki/John_Friedmann_(Schauspieler)","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/37/John_Friedmann_Miami_2012.jpg","page_title":"John Friedmann (Schauspieler)","context_page_description":"John Friedmann ist ein deutscher Schauspieler und Comedian. Bekannt wurde er zunächst unter dem Pseudonym Erkan Maria Moosleitner zusammen mit Florian Simbeck als Comedyduo Erkan und Stefan."},{"page_url":"https://zh.wikipedia.org/zh-tw/2016%E5%B9%B4%E4%BC%8A%E6%9C%97%E8%AE%AE%E4%BC%9A%E9%80%89%E4%B8%BE","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/bc/Ali_Motahari.jpg","page_title":"2016年伊朗议会选举","context_page_description":"2016年伊朗議會選舉舉行於2016年2月26日，選舉出伊斯蘭共和國時期的伊朗第10屆議會，或自波斯立憲革命以來的第34屆議會的全部席次。選舉人未取得最低限制25%選票的選區，於2016年2月29日舉行了第二輪選舉。新當選議員的任期為2016年5月28日至2020年五月27日。\\n本次選舉同時也綁定專家會議的選舉。\\n本次選舉也是伊朗第一次將伊斯蘭議會與專家議會聯合綁定選舉。\\n本次選舉登記選民共有54,915,024名。超過12,000人申請競選公職 。\\n5200名候選人的提名被憲法監督委員會拒絕，612名候選人退出競選。"},{"page_url":"https://es.wikipedia.org/wiki/Rosana_dos_Santos_Augusto","image_url":"http://upload.wikimedia.org/wikipedia/commons/9/93/2010NJSkyblue.jpg","page_title":"Rosana dos Santos Augusto","context_page_description":"Rosana dos Santos Augusto es una futbolista profesional brasileña que juega como centrocampista para el Olympique de Lyon de la Primera División Francesa de fútbol femenino, además de jugar en la Selección femenina de fútbol de Brasil."},{"page_url":"https://fr.wikipedia.org/wiki/Pont_de_l%27Ermitage","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5c/Beggrov2.jpg","page_title":"Pont de l'Ermitage","context_page_description":"Le pont de l'Ermitage est un pont en arc jeté sur le canal d'Hiver à Saint-Pétersbourg, en Russie. Le pont fait partie de l'ensemble constitué par l'Ermitage et du Palais d'Hiver."},{"page_url":"https://fr.wikipedia.org/wiki/Liste_des_s%C3%A9nateurs_des_%C3%89tats-Unis_pour_le_New_Hampshire","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/71/JamesSheafe.jpg","page_title":"Liste des sénateurs des États-Unis pour le New Hampshire","context_page_description":"Le New Hampshire élit deux membres du Sénat des États-Unis : un sénateur de classe 2 et un sénateur de classe 3."},{"page_url":"https://fi.wikipedia.org/wiki/Anarkismi","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e9/Gato-negro.jpeg","page_title":"Anarkismi","context_page_description":"Anarkismi on taloudellisista, yhteiskunnallisista ja sosiaalisista valtahierarkioista vapaata yhteiskuntaa tavoitteleva poliittinen ideologia, joka korostaa yksilönvapautta. Anarkismin klassisen määritelmän mukaan se on ajattelutapa, jossa vastustetaan valtiota, siihen sisältyvän pakkovallan, poliittisen auktoriteetin sekä valtakoneiston muodollis-oikeudellisuuden ja byrokraattisuuden vuoksi. Anarkismi sekoitetaan tai yhdistetään usein virheellisesti anarkiaan.\\nSana ”anarkismi” tulee muinaiskreikan johtajattomuutta tai esivallan puutetta tarkoittavasta sanasta, joka keskiajalla käännettiin latinaksi muodossa anarchia. Joskus anarkismi suomennetaan hallituksettomuudeksi. Poliittisesta filosofiasta puhuttaessa anarkismi ei tarkoita yhteiskunnallista kaaosta, vaikka käsitteellä anarkia on arkikielessä sellainen sisältö. John Zerzan on määritellyt anarkismin autoritarismin vastaisuudeksi.\\nAnarkismi on keskeisesti antistatistinen ideologia, mutta valtiovastaisuuden lisäksi anarkismiin kuuluu hierarkkisesti organisoidun teollisuustuotannon kritiikkiä. Sekä anarkismi että sosialismi kehittyivät teollisen vallankumouksen seurauksena ja vastasivat sen ajan yhteiskunnan ongelmiin."},{"page_url":"https://sl.wikipedia.org/wiki/X-letala","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8f/X-47A_rollout.jpg","page_title":"X-letala","context_page_description":"X-letala je serija ameriških eksperimentalnih letal, ki so raziskovali nove tehnologijo in aerodinamiko. Večino X-letal je raziskovala NACA, pozneje NASA, velikokrat pa so bile udeležene tudi Ameriške zračne sile - USAF. Večino letal se je testiralo v letalski bazi Edwards.Nekatera letala so razvijali javno kot npr. X-16, nekatera druga so bila strogo zaupna. Prvo X-letalo je bil raketni Bell X-1, ki je prvi prebil zvočni zid v ravnem letu. X-1 in X-15 sta verjetno najbolj znani X-letali. X-letala niso bila namenjena serijski proizvodnji, izjema je Lockheed Martin X-35, ki je bil poddlaga z JSF lovca F-35.V ZDA so sicer razvijali precej več eksperimentalnih letal, kot jih je na seznamu \\"X\\"."},{"page_url":"https://ast.wikipedia.org/wiki/Cassida_murraea","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/34/Cassida_murraea.jpg","page_title":"Cassida murraea","context_page_description":"Cassida murraea ye un inseutu coleópteru de la familia Chrysomelidae.\\nDistribúise pel paleárticu d'Eurasia."},{"page_url":"https://pt.wikipedia.org/wiki/Joe_Hill_(escritor)","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d4/Joehillgfdl.PNG","page_title":"Joe Hill (escritor)","context_page_description":"Joseph Hillstrom King, mais conhecido como Joe Hill é um escritor estadunidense de livros do gênero de ficção. É filho do também escritor Stephen King. Seu nome foi escolhido como uma forma de homenagem ao anarquista sueco Joe Hill."},{"page_url":"https://arz.wikipedia.org/wiki/%D8%B1%D9%8A%D8%AA%D8%B4%D8%A7%D8%B1%D8%AF_%D9%87%D8%A7%D8%B1%D9%84%D8%A7%D9%86","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/14/Harlan_Richard_1796-1843.png","page_title":"ريتشارد هارلان","context_page_description":"الصفحه دى يتيمه, حاول تضيفلها لينك فى صفحات تانيه متعلقه بيها.\\nريتشارد هارلان كان عالم نباتات من امريكا."},{"page_url":"https://zh.wikipedia.org/wiki/%E8%A5%BF%E5%AD%90%E7%81%A3%E7%AB%99","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ea/Sizihwan_Station_Platform.JPG","page_title":"西子灣站","context_page_description":"西子灣站，副站名中山大學，位於台灣高雄市鼓山區，為高雄捷運橘線的捷運車站。目前為端點站之一，可站外轉乘環狀輕軌哈瑪星站。車站實際上位於哈瑪星聚落內，離西子灣尚有一段距離。"},{"page_url":"https://ko.wikipedia.org/wiki/%ED%95%9C%EC%8B%A0%EC%BD%94%EC%BF%A0%EB%8F%84_%EC%97%AD","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9e/Hanshin-kokudo_Station_%2801%29_IMG_1807_20140719.JPG","page_title":"한신코쿠도 역","context_page_description":"한신코쿠도 역은 일본 효고현 니시노미야시에 있는 한큐전철 이마즈 선의 역이다. 역 번호는 HK-22이다."},{"page_url":"https://id.wikipedia.org/wiki/Chris_Connor","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/34/Chris_Connor_1957.JPG","page_title":"Chris Connor","context_page_description":"Chris Connor adalah seorang penyanyi beraliran jazz."},{"page_url":"https://nn.wikipedia.org/wiki/Toyota_Racing","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fb/Toyota_F1_Canada_2006_%28crop%29.PNG","page_title":"Toyota Racing","context_page_description":"Toyota F1 var eit formel 1-lag som høyrde til den japanske bilprodusenten Toyota. Toyota annonserte planane om å delta i formel 1 i 1999, og etter omfattande testar debuterte laget i 2002."},{"page_url":"https://pt.wikipedia.org/wiki/S%C3%A9rie_5000_(Metr%C3%B4_de_Madrid)","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9e/Serie_5000_Metro_de_Madrid_%288871649558%29.jpg","page_title":"Série 5000 (Metrô de Madrid)","context_page_description":"A Série 5000 é um tipo de automotora fabricada pela empresa espanhola Construcciones y Auxiliar de Ferrocarriles, utilizada no Metro de Madrid."},{"page_url":"https://it.wikipedia.org/wiki/Duomo_di_Verona","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1a/Duomo_%28Verona%29_-_Facades.jpg","page_title":"Duomo di Verona","context_page_description":"Il duomo di Verona, il cui nome ufficiale è cattedrale di Santa Maria Assunta ma conosciuto anche come cattedrale di Santa Maria Matricolare, dal nome dell'antica chiesa paleocristiana, è il principale luogo di culto cattolico della città di Verona, chiesa madre dell'omonima diocesi. Esso fa parte di un complesso architettonico articolato, di cui fanno parte anche il palazzo del Vescovado, il chiostro dei Canonici, la biblioteca capitolare, il battistero di San Giovanni in Fonte e la chiesa di Sant'Elena, questi ultimi due collegati al duomo tramite il porticato di Santa Maria Matricolare."},{"page_url":"https://zh.wikipedia.org/wiki/%E5%B8%95%E5%A4%AB%E5%88%A9%E5%A4%AB%E5%8D%A1%E6%B2%B3","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c7/%D0%A0%D1%96%D1%87%D0%BA%D0%B0_%D0%9F%D0%B0%D0%B2%D0%BB%D1%96%D0%B2%D0%BA%D0%B0.jpg","page_title":"帕夫利夫卡河","context_page_description":"帕夫利夫卡河，是乌克兰的河流，位于该国东北部，属于克里加河的右支流，发源自马基伊夫卡以北，流经苏梅州，河道全长31公里。"},{"page_url":"https://uk.wikipedia.org/wiki/%D0%9D%D0%B0%D0%BA%D0%BE%D0%B2%D0%B0%D0%BD%D1%8C_(%D0%9E%D1%80%D0%B5%D0%B1%D0%B8%D1%87)","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/bd/PANOrama_Nakovane_01813_1826stitch-cyl-autocr.jpg","page_title":"Наковань (Оребич)","context_page_description":"Наковань — населений пункт у Хорватії, у Дубровницько-Неретванській жупанії у складі громади Оребич."},{"page_url":"https://fr.wikipedia.org/wiki/Ch%C3%A2teau_de_Peyrepertuse","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/32/Ch%C3%A2teaux_du_Pays_cathare_-_Ch%C3%A2teau_de_Peyrepertuse_-_13.jpg","page_title":"Château de Peyrepertuse","context_page_description":"Le château de Peyrepertuse est un château dit « cathare » situé dans le département de l'Aude en région Occitanie.\\nIl est le centre du micro-pays et de l'ancienne seigneurie du Peyrepertusès qui veut dire « pierre percée »."},{"page_url":"https://ur.wikipedia.org/wiki/%D8%B1%DB%8C%D9%86%DA%88%DB%8C%D9%88%D9%88_%D9%85%D8%A7%D8%A4%D9%86%D9%B9%DB%8C%D9%86","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/cc/Rv-summit.jpg","page_title":"رینڈیوو ماؤنٹین","context_page_description":"رینڈیوو ماؤنٹین ریاستہائے متحدہ امریکا کا ایک پہاڑ جو وائیومنگ میں واقع ہے۔"},{"page_url":"https://zh.wikipedia.org/zh-my/2015%E5%B9%B4%E9%98%BF%E5%85%8B%E6%8B%89%E5%8A%A0%E6%B2%B9%E7%AB%99%E7%88%86%E7%82%B8%E7%81%AB%E7%81%BD","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7a/Goil.jpg","page_title":"2015年阿克拉加油站爆炸火災","context_page_description":"2015年阿克拉加油站爆炸火灾，是指发生于当地时间2015年6月3日晚，于西非国家加纳首都阿克拉的一起爆炸火灾。当地的一座加油站发生了大爆炸而导致火灾。当地消防局在晚上9时45分接到火警通报，而大火延烧至4日清晨4时后才扑灭，也连带烧毁了加油站附近的几间平房。死亡人数超过百人，而消防局长证实的死亡人数为96人，受伤人数以及事故原因有待进一步调查。"},{"page_url":"https://es.wikipedia.org/wiki/Rising_Sun-Lebanon","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3d/AMCC-54_with_visitors.jpg","page_title":"Rising Sun-Lebanon","context_page_description":"Rising Sun-Lebanon es un lugar designado por el censo ubicado en el condado de Kent en el estado estadounidense de Delaware. En el año 2000 tenía una población de 2,458 habitantes y una densidad poblacional de 279 personas por km²."},{"page_url":"https://it.wikipedia.org/wiki/Jackson_Soloist","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/12/Solois1987.jpg","page_title":"Jackson Soloist","context_page_description":"La Jackson Soloist è un modello di chitarra prodotta dalla Jackson Guitars a partire dal 1984. La forma del body è quella di una superstrat, con una costruzione neck-thru e un ponte Floyd Rose. La Soloist adotta pick-up sia humbucker che single coil a seconda del sottomodello. Come per tutti i modelli Jackson, la Soloist è usata soprattutto dai chitarristi in genere nella musica heavy metal."},{"page_url":"https://hu.wikipedia.org/wiki/V._Ijaszu_eti%C3%B3p_cs%C3%A1sz%C3%A1r","image_url":"http://upload.wikimedia.org/wikipedia/commons/b/b4/Yasu_V.jpg","page_title":"V. Ijaszu etióp császár","context_page_description":"V. Ijaszu, neve az etióp Józsua, Józsué, Jézus megfelelője, névváltozata: Jaszu, eredeti neve: Kifle Jakob, Etiópia császára. II. Menelik etióp császár unokája. A Salamon-dinasztia soai ágának a tagja női ágon."},{"page_url":"https://hy.wikipedia.org/wiki/%D5%8D%D6%84%D6%80%D5%A1%D6%83%D5%A2%D5%B8%D6%82%D6%84%D5%AB%D5%B6%D5%A3","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a5/Example_European_asterix.jpg","page_title":"Սքրափբուքինգ","context_page_description":"Սքրափբուքինգ, սքրեփբուքինգ, ձեռագործ արվեստի տեսակ, որն ներառում է ընտանեկան կամ անձնական լուսանկարների պատրաստում և ձևավորում։\\nՍտեղծագործության այս տեսակի նպատակն անձնական և ընտանեկան պատմության պահպանումն է լուսանկարների, լրագրերի կտրածոների, նկարների, ձայնագրությունների և հիշարժան այլ մանրուքների տեսքով։ Առանձին պատմությունների պահպանման և փոխանցման համար սովորական պատմությունների հետ մեկտեղ օգտագործվում են տեսողական և շոշափելիքի յուրահատուկ եղանակներ։ Սքրափբուքինգի հիմնական գաղափարն ապագա սերունդների համար ինչ-որ իրադարձության լուսանկարների և այլ հիշարժան իրերի երկարաժամկետ պահպանումն է։\\nԲառարաններում սովորաբար սքրափբուք եզրույթը ներկայացվում է ավելի լայն իմաստով՝ ալբոմ կտրածոներ փակցնելու համար կամ տպագրությունների կտրվածքների, պատկերների, լուսանկարների ալբոմ, բայց հաճախ այդ եզրույթը հենց վերաբերում է հատուկ կերպով ձևավորված լուսանկարչական ալբոմներին, որոնք կազմված են ֆոտոկոլաժների միջոցով ամբողջական միտք ունեցող առանձին էջերից։ Այսպիսի ալբոմները կարող են լինել ամենատարբեր թեմաներով՝ հարսանիք, տարեդարձ, երեխայի ծնունդ, արձակուրդները ծովում և այդպես շարունակ։"},{"page_url":"https://sco.wikipedia.org/wiki/Le%C3%B3n_Febres_Cordero","image_url":"http://upload.wikimedia.org/wikipedia/commons/7/70/Firma_de_Le%C3%B3n_Febres-Cordero_Ribadeneyra.jpg","page_title":"León Febres Cordero","context_page_description":"León Esteban Febres-Cordero Ribadeneyra wis an Ecuadorian politician.\\nHe wis kent in the Ecuadorian media as LFC or bi his surname. He wis Preses o Ecuador o Ecuador faer a four-year term frae 10 August 1984 tae 10 August 1988.\\nCordero dee'd on 15 December 2008 in Guayaquil, Ecuador frae lung cancer an emphysema, agit 77."},{"page_url":"https://de.wikipedia.org/wiki/WMS_Industries","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/ad/Beat_Time.jpg","page_title":"WMS Industries","context_page_description":"WMS Industries, Inc. stellte als eines der ersten Unternehmen Spielautomaten wie Flipper, Arcade-Spiele und Bowling-Automaten her. Der Hauptsitz befindet sich in Waukegan bei Chicago."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%97%D0%B0%D1%80%D1%83%D0%B4%D0%BD%D0%B8%D1%86%D0%BA%D0%B8%D0%B9,_%D0%92%D0%BB%D0%B0%D0%B4%D0%B8%D0%BC%D0%B8%D1%80_%D0%91%D0%BE%D1%80%D0%B8%D1%81%D0%BE%D0%B2%D0%B8%D1%87","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/37/Pankov_and_Zarudnitsky.jpg","page_title":"Зарудницкий, Владимир Борисович","context_page_description":"Влади́мир Бори́сович Зарудни́цкий — российский военачальник. Начальник Военной академии Генерального штаба Вооружённых сил Российской Федерации с 22 ноября 2017 года, генерал-полковник.\\nКомандующий войсками Центрального военного округа."},{"page_url":"https://xmf.wikipedia.org/wiki/%E1%83%91%E1%83%A3%E1%83%9F%E1%83%A3%E1%83%9B%E1%83%91%E1%83%A3%E1%83%A0%E1%83%90","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/54/Bujumbura_University.JPG","page_title":"ბუჟუმბურა","context_page_description":"ბუჟუმბურა — ბურუნდიშ უდიდაში ნოღა დო ჸოფილი ნანანოღა. მახორობა დოხოლაფირო 550 ვთშ. ადმ. ნოღა ოორუე-ბჟაეიოლშე ომძღჷ ტობა ტანგანიკას, ქიანაშ თარი ონიშოლი რე ტობას."},{"page_url":"https://zh.wikipedia.org/zh-tw/%E5%BE%B7%E5%9B%BD%E8%81%94%E9%82%A6%E9%93%81%E8%B7%AF111%E5%9E%8B%E7%94%B5%E5%8A%9B%E6%9C%BA%E8%BD%A6","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8a/HGG-111-039-HEBli.jpg","page_title":"德国联邦铁路111型电力机车","context_page_description":"德國聯邦鐵路111型電力機車是德國聯邦鐵路使用的一款四軸電力機車型號，在1974年至1984年期間共計生產了227台。其使用範圍如今主要集中在限速為160km/h的區域鐵路和短途鐵路客運，並擔當部分輕型長途鐵路客運的牽引任務。在1980年代，111型機車也曾用作萊茵-魯爾城市群的S-Bahn運輸，並加裝有目的地顯示屏和採用相應的塗裝。"},{"page_url":"https://fr.wikipedia.org/wiki/Dardanus_(crustac%C3%A9)","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8a/Dardanus_gemmatus.JPG","page_title":"Dardanus (crustacé)","context_page_description":"Dardanus est un genre de crustacés décapodes de la famille des Diogenidae.\\nPlusieurs espèces sont capables de vivre en symbiose avec des anémones."},{"page_url":"https://zh.wikipedia.org/wiki/%E9%BB%83%E5%8F%B3%E6%98%8C","image_url":"http://upload.wikimedia.org/wikipedia/commons/d/d2/Huang_Youchang1.jpg","page_title":"黃右昌","context_page_description":"黄右昌字黼馨，号溇江子，湖南省临澧县人。中华民国法学家。"},{"page_url":"https://vi.wikipedia.org/wiki/B%C3%A1n_h%C3%B3a_th%E1%BA%A1ch","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/97/Dodo-Skeleton_Natural_History_Museum_London_England.jpg","page_title":"Bán hóa thạch","context_page_description":"Bán hóa thạch hay Á hóa thạch là một thuật ngữ để chỉ di tích của những sinh vật từng sinh sống chưa được xem hoàn toàn là hóa thạch vì một trong hai lý do sau: không có đủ thời gian từ khi sinh vật chết, hay điều kiện hình thành hóa thạch không đủ tốt.\\nBán hóa thạch từ thời kỳ Đại Trung Sinh rất hiếm, và thường hư hỏng rất nặng, do đó dễ gây ra tranh cãi."},{"page_url":"https://no.wikipedia.org/wiki/Liste_over_norske_ambassad%C3%B8rer_i_Washington","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/37/Embassy_of_Norway.JPG","page_title":"Liste over norske ambassadører i Washington","context_page_description":"Dette er en liste over norske ministre og ambassadører i Washington, D.C. i USA."},{"page_url":"https://fr.wikipedia.org/wiki/Auguste_Steinheil","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/27/Bayonne-Cath%C3%A9drale_Notre_Dame-Chapelle_de_la_Sainte_Vierge-20110313.jpg","page_title":"Auguste Steinheil","context_page_description":"Louis Charles Auguste Steinheil, né le 26 juillet 1814 à Strasbourg et mort le 16 mars 1885 à Paris, est un peintre français du XIXᵉ siècle spécialiste de l'art historique et médiéval."},{"page_url":"https://ro.wikipedia.org/wiki/Ry%C5%8Dan-ji","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9d/Ryoanji_Temple_-_Kuri_Main_Building_Interior.jpg","page_title":"Ryōan-ji","context_page_description":"Ryōan-ji este un templu Zen-budist în partea de nord-vest a orașului Kyoto. Acest templu face parte din complexul Monumente istorice ale vechiului Kyoto, inclus în Partimoniul Mondial UNESCO."},{"page_url":"https://de.wikipedia.org/wiki/Kabinett_Merkel_III","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d9/Sigmar_Gabriel_2015_cropped.jpg","page_title":"Kabinett Merkel III","context_page_description":"Das Kabinett Merkel III war das 23. Regierungskabinett der Bundesrepublik Deutschland. Der am 22. September 2013 gewählte 18. Deutsche Bundestag konstituierte sich am 22. Oktober 2013 und wählte in seiner vierten Sitzung am 17. Dezember 2013 die bereits seit 2005 als Bundeskanzlerin amtierende Angela Merkel mit 462 Ja-Stimmen, 150 Nein-Stimmen und 9 Enthaltungen im ersten Wahlgang zur Bundeskanzlerin einer großen Koalition aus CDU/CSU und SPD. Zuvor hatte eine Abstimmung unter allen Mitgliedern der SPD den Koalitionsvertrag mit 75,96 Prozent der gültigen Stimmen bestätigt. Merkel und die von ihr vorgeschlagenen Bundesminister wurden umgehend noch am 17. Dezember 2013 vom Bundespräsidenten ernannt und vor dem Bundestag vereidigt.\\nDie geänderten Zuständigkeiten der Ministerien ergaben sich aus dem Organisationserlass der Bundeskanzlerin vom 17. Dezember 2013. Vor den Bundestagswahlen und während der Koalitionsverhandlungen etablierte sich in der Medien- und Alltagssprache als Abkürzung für Große Koalition der Begriff GroKo, der schließlich zum Wort des Jahres gewählt wurde.\\nAm 24."},{"page_url":"https://en.wikipedia.org/wiki/Sara_Blackwell","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/03/Attorney_Sara_Blackwell.jpg","page_title":"Sara Blackwell","context_page_description":"Sara Blackwell is an American attorney specializing in employment law and is the founder of Protect US Workers, a non profit organization. Blackwell gained national media attention when she represented hundreds of United States citizens and permanent residents who were replaced by recipients of H-1B temporary work visas. In 2018, she represented New Orleans Saints cheerleader, Bailey Davis, who was fired for an Instagram post and allegedly attending a party where NFL players were present."},{"page_url":"https://sl.wikipedia.org/wiki/Karnijske_Alpe","image_url":"http://upload.wikimedia.org/wikipedia/commons/2/26/Mokrine_Gartnerkofel.jpg","page_title":"Karnijske Alpe","context_page_description":"Karnijske Alpe so gorstvo v Južnih apneniških Alpah na Vzhodnem Tirolskem in Koroškem ter Furlaniji-Julijski krajini. Karnijske Alpe, imenovane po nekdanji rimski provinci Karniji, se od vzhoda do zahoda razprostirajo v dolžini okoli 100 km in tvorijo naravno mejo med Avstrijo in Italijo. Gorstvo ločuje od severno ležečih Ziljskih Alp Ziljska dolina z reko Ziljo, od vzhodno in jugovzhodno ležečih Karavank in Julijskih Alp jih ločuje reka Ziljica z Belo in Kanalsko dolino, na zahodu pa ga od Dolomitov ločuje zgornja dolina reke Piave. Južno od toka reke Tilment se gorovje preko Karnijskih Predalp počasi spušča v Furlansko nižino."},{"page_url":"https://ur.wikipedia.org/wiki/%D9%85%D8%B3%D9%84%D9%85_%D8%B1%DB%8C%D8%A7%D8%B3%D8%AA%D9%88%DA%BA_%D8%A7%D9%88%D8%B1_%D8%AD%DA%A9%D9%85%D8%B1%D8%A7%D9%86_%D8%AE%D8%A7%D9%86%D8%AF%D8%A7%D9%86%D9%88%DA%BA_%DA%A9%DB%8C_%D9%81%DB%81%D8%B1%D8%B3%D8%AA","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/ba/Battle_of_Preveza_%281538%29.jpg","page_title":"مسلم ریاستوں اور حکمران خاندانوں کی فہرست","context_page_description":"مسلم ریاستوں اور حکمران خاندانوں کی فہرست"},{"page_url":"https://nl.wikipedia.org/wiki/Lijst_van_gemeentelijke_monumenten_in_Weert_(plaats)","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c7/Weert-begijnenhofstraat-186035.jpg","page_title":"Lijst van gemeentelijke monumenten in Weert (plaats)","context_page_description":"De plaats Weert, hoofdplaats van de gemeente Weert, kent 138 gemeentelijke monumenten:"},{"page_url":"https://fa.wikipedia.org/wiki/%D8%A7%D8%AB%D8%B1_%D8%A8%D9%86%DB%8C%D8%A7%D9%86%E2%80%8C%DA%AF%D8%B0%D8%A7%D8%B1","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c7/Founder_effect.png","page_title":"اثر بنیان‌گذار","context_page_description":"در مباحث مربوط به ژنتیک جمعیت‌ها، به کاهش تنوع ژنتیکی که در اثر ایجاد یک جمعیت جدید توسط شمار اندکی از افراد یک جمعیت بزرگ رخ می‌دهد، اثر بنیان‌گذار می‌گویند. ارنست مایر در سال ۱۹۵۲ با بهره‌گیری از نظرات افرادی چون سؤال رایت، این موضوع را مورد بررسی کامل قرار داد. به دلیل کاهش چشمگیر تنوع ژنتیکی، جمعیت تازه ایجاد شده ممکن است از نظر ژنتیکی و فنوتیپی از جمعیت اولیه کاملاً متمایز باشد. در شکل روبرو جمعیت اولیه به‌طور تقریبی شمار یکسانی اعضای آبی و قرمز دارد.\\nسه جمعیت کوچک جدا شده در شکل به دلیل خطای نمونه‌گیری برخی از رنگ‌ها را به شکلی غالب از خود نشان می‌دهند. این حالت همان اثر بنیان‌گذار است. گر چه در مورد پدیده گلوگاه جمعیت، یک جمعیت جدید به مفهوم واقعی آن تشکیل نمی‌شود، ولی می‌توان اثر بنیان‌گذار را در آن جا نیز مشاهده کرد. اثر بنیان‌گذار شکلی ویژه از رانش ژنتیکی است. جمعیت‌های دچار اثر بنیان‌گذاردر بیشتر مواقع جمعیت‌های کوچکی هستند و به همین دلیل نسبت به رانش ژنتیکی حساسند. این امر خود سبب کاهش تنوع ژنتیکی در این جمعیت‌ها می‌گردد."},{"page_url":"https://fi.wikipedia.org/wiki/Luettelo_Italian_p%C3%A4%C3%A4ministereist%C3%A4","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/52/Bundesarchiv_B_145_Bild-F054628-0037%2C_Ludwigshafen%2C_CDU-Bundesparteitag%2C_Rumor.jpg","page_title":"Luettelo Italian pääministereistä","context_page_description":"Tämä on luettelo Italian pääministereistä. Vuosina 1861–1946 pääministerin nimitys oli \\"Italian kuningaskunnan ministerineuvoston puheenjohtaja\\" ja vuodesta 1946 alkaen \\"Italian tasavallan mininisterineuvoston puheenjohtaja\\"."},{"page_url":"https://en.wikipedia.org/wiki/Cortina_d%27Ampezzo","image_url":"http://upload.wikimedia.org/wikipedia/commons/a/a8/Chiesa_di_Grava_con_Tofane.JPG","page_title":"Cortina d'Ampezzo","context_page_description":"Cortina d'Ampezzo, commonly referred to as Cortina, is a town and comune in the heart of the southern Alps in the Veneto region of Northern Italy. Situated on the Boite river, in an alpine valley, it is a winter sport resort known for its skiing trails, scenery, accommodation, shops and après-ski scene, and for its jet set and Italian aristocratic crowd.\\nIn the Middle Ages, Ampezzo fell under the jurisdiction of the Patriarchate of Aquileia and of the Holy Roman Empire. In 1420 it was conquered by the Republic of Venice. It then spent much of its history under Austrian rule, briefly undergoing some territorial changes under Napoleon, before being returned to Austria, who held it until 1918. From the nineteenth century, Ampezzo became a notable regional centre for crafts. The local handmade products were appreciated by early British and German holidaymakers as tourism emerged late nineteenth century. Among the specializations of the town were crafting wood for furniture, the production of tiled stoves and iron, copper and glass items."},{"page_url":"https://simple.wikipedia.org/wiki/Apollo_12","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8d/Apollo_12_insignia.png","page_title":"Apollo 12","context_page_description":"Apollo 12 was the sixth manned flight in the Apollo program. It was the second manned spacecraft to land on the Moon. Apollo 12 was launched on November 14, 1969. Charles \\"Pete\\" Conrad and Alan Bean become the third and fourth persons to stand on the lunar surface, while Richard Gordon stayed in orbit around the Moon. The two astronauts spent over seven hours exploring the surface of the Ocean of Storms. They brought back pieces of Surveyor III which had landed on the Moon in April 1967. They set up a number of experiments which would continue to collect information after they left. The Lunar ascent stage, the part that helped it take off from the surface, was deliberately crashed back onto the Moon so that shock waves could be measured by seismic equipment left behind."},{"page_url":"https://nl.wikipedia.org/wiki/Lijst_van_rijksmonumenten_aan_de_Geldersekade","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c3/Geldersekade_65_door.jpg","page_title":"Lijst van rijksmonumenten aan de Geldersekade","context_page_description":"Een overzicht van de 68 rijksmonumenten aan de Geldersekade in Amsterdam."},{"page_url":"https://ml.wikipedia.org/wiki/%E0%B4%95%E0%B5%87%E0%B4%95%E0%B5%8D%E0%B4%95%E0%B5%81%E0%B4%95%E0%B4%B3%E0%B5%81%E0%B4%9F%E0%B5%86_%E0%B4%AA%E0%B4%9F%E0%B5%8D%E0%B4%9F%E0%B4%BF%E0%B4%95","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0f/Salzburger_Nockerln_04_gastronomie_001.jpg","page_title":"കേക്കുകളുടെ പട്ടിക","context_page_description":"Bustrengo\\nCassava cake\\nCountess\\nKrantz cake\\nVanilla slice\\nUbe cake\\nUl boov\\nYema cake"},{"page_url":"https://it.wikipedia.org/wiki/Vitalienbr%C3%BCder","image_url":"http://upload.wikimedia.org/wikipedia/commons/8/86/Stoertebeker.jpg","page_title":"Vitalienbrüder","context_page_description":"I Vitalienbrüder, o Vitalier, chiamati anche Likedeeler, erano una compagnia di navigatori del XIV sec. Operarono nel Mar Baltico e nel Mar del Nord, dapprima contrabbandando viveri per la città di Stoccolma, assediata dai danesi; successivamente si batterono come corsari al soldo di vari regni, infine divennero famigerati pirati.\\nI capitani più famosi della compagnia furono Arnd Stuke, Henning Mandüvel, Nikolaus Milies, Klaus Störtebeker, Gödeke Michels, Magister Wigbold e Hennig Wichmann. All'apice della loro potenza, nel periodo in cui controllavano Gotland, contavano circa 2000 uomini."},{"page_url":"https://sv.wikipedia.org/wiki/Postiljonen_fr%C3%A5n_Lonjumeau","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d8/Pr%C3%A9vost_%26_Chollet_in_Le_postillon_de_Longjumeau_by_Adam_%28Gustave_Janer%29_Gallica.jpg","page_title":"Postiljonen från Lonjumeau","context_page_description":"Postiljonen från Lonjumeau, är en opéra comique i tre akter med musik av Adolphe Adam och med libretto av Adolphe de Leuven och Léon-Lévy Brunswick."},{"page_url":"https://vo.wikipedia.org/wiki/Madras_(Oregon)","image_url":"http://upload.wikimedia.org/wikipedia/commons/2/27/Jefferson_County_Oregon_Incorporated_and_Unincorporated_areas_Madras_Highlighted.svg","page_title":"Madras (Oregon)","context_page_description":"Madras binon zif in komot: Jefferson, in tat: Oregon, in Lamerikän."},{"page_url":"https://nl.wikipedia.org/wiki/Lijst_van_gemeentelijke_monumenten_in_Apeldoorn_(plaats)","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/16/Apeldoorn-raadhuisplein-06190025.jpg","page_title":"Lijst van gemeentelijke monumenten in Apeldoorn (plaats)","context_page_description":"De plaats Apeldoorn, hoofdplaats van de gelijknamige gemeente, heeft 671 gemeentelijke monumenten, hieronder een overzicht."},{"page_url":"https://pt.wikipedia.org/wiki/Hans_Enoksen","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7e/Landsstyreformand_Hans_Enoksen_til_Folkeafstemning_i_Multihallen_i_Nuuk_med_Pipaluk_Petersen_pa_5_ar.jpg","page_title":"Hans Enoksen","context_page_description":"Hans Enoksen é um político que já foi primeiro-ministro da Groenlândia de 2002 até 2009, sendo sucedido por Kuupik Kleist."},{"page_url":"https://de.wikipedia.org/wiki/Kurt-Schumacher-Kaserne","image_url":"http://upload.wikimedia.org/wikipedia/commons/c/c5/Kurt-Schumacher-Kaserne_Hannover_Turm.jpg","page_title":"Kurt-Schumacher-Kaserne","context_page_description":"Die Kurt-Schumacher-Kaserne in Hannover ist eine Kaserne der Bundeswehr und war bis 2015 Hauptquartier der 1. Panzerdivision. Sie ist nach dem ehemaligen SPD-Parteivorsitzenden Kurt Schumacher benannt und steht unter Denkmalschutz."},{"page_url":"https://fi.wikipedia.org/wiki/Firenzen_Akatemia","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6f/Cosimo_de%27_Medici_Rubens.jpg","page_title":"Firenzen Akatemia","context_page_description":"Firenzen Akatemia oli renessanssiaikana Firenzessä toiminut akatemia, jonka perusti Cosimo de' Medici vuonna 1462. Akatemian merkittävimpiä jäseniä olivat Marsilio Ficino, Giovanni Pico della Mirandola ja Filippo Brunelleschi.\\nFirenzen akatemia oli filosofialtaan uusplatoninen. Sen kilpailijaksi asetetaan usein Padovan yliopisto, joka oli puolestaan aristoteelinen."},{"page_url":"https://zh.wikipedia.org/zh-cn/%E8%87%BA%E4%B8%AD%E5%B8%82%E6%94%BF%E5%BA%9C%E8%AD%A6%E5%AF%9F%E5%B1%80","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c8/%E8%87%BA%E4%B8%AD%E5%B8%82%E8%AD%A6%E5%AF%9F%E5%B1%80%E7%83%8F%E6%97%A5%E5%88%86%E5%B1%80.jpg","page_title":"臺中市政府警察局","context_page_description":"台中市政府警察局，为台中市最高警察行政机关，隶属于内政部警政署以及台中市政府。负责台中市的警察行政、人事等事务以及维护地方治安。下辖第一、第二、第三、第四、第五、第六、东势、丰原、大雅、和平、大甲、太平、雾峰、清水、乌日 等15个分局，市警局本部设于潭子区。"},{"page_url":"https://ast.wikipedia.org/wiki/Cicl%C3%B3n_extratropical","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c7/Uk-cyclone-2.png","page_title":"Ciclón extratropical","context_page_description":"Los ciclones extratropicales, dacuando llamaos ciclones de llatitú media, son un grupu de ciclones definíos como sistemes meteorolóxicos de baxa presión d'escala sinóptica, alcontraos nes llatitúes medies de la Tierra, que nun presenten les carauterístiques típiques de los ciclones tropicales nin de los polares, y tán venceyaos a los frentes, a los gradientes térmicos horizontales y al puntu de rosada, tamién llamaes \\"zones baroclinas\\". Los ciclones extratropicales son un fenómenu diariu que, xuntu colos anticiclones, mueven el tiempu sobre munches partes de la Tierra, produciendo siquier nubosidad y nubes.\\nTrátase d'un fenómenu meteorolóxicu acomuñáu con una baxa presión atmosférica que tien llugar nes rexones templaes ente'l trópicu y los polos. Por ello, conócense tamién como ciclones templaos. Nel hemisferiu norte un ciclón rota en sentíu opuestu a les aguyes del reló, y en sentíu de les aguyes del reló nel hemisferiu sur. La rotación ye causada pol efeutu Coriolis. Los ciclones de llatitú media o extratropicales dependen de procesos baroclínicos, como'l contraste de temperatura ente mases d'aire frío y templáu."},{"page_url":"https://it.wikipedia.org/wiki/Torriglia","image_url":"http://upload.wikimedia.org/wikipedia/commons/a/a4/Torriglia-castello.jpg","page_title":"Torriglia","context_page_description":"Torriglia è un comune italiano di 2 211 abitanti della città metropolitana di Genova in Liguria."},{"page_url":"https://fi.wikipedia.org/wiki/Etel%C3%A4-Saimaa_(j%C3%A4rvi)","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8d/Typical_rocky_shores_of_Lake_Saimaa.jpg","page_title":"Etelä-Saimaa (järvi)","context_page_description":"Etelä-Saimaa, joka joskus tunnetaan nimellä Saimaa, on Etelä-Savossa ja Etelä-Karjalassa sijaitseva järvi. Se on Puumalansalmen eteläpuolelle jäävä osa Suur-Saimaata. Etelä-Saimaan pinta-ala on lähteestä riippuen noin 1 377 tai 1 490 neliökilometriä.\\nToinen salpausselkä eli Kyläniemi jakaa Etelä-Saimaan kahteen osaan. Eteläisen osan pinta-ala on 621 km² ja keskisyvyys 8,4 m.\\nEtelä-Saimaan eteläosassa on Taipalsaaren laaja saaristo. Järven itäosassa on useita laajoja saaria, kuten Äitsaari ja Salosaari. Luoteessa Etelä-Saimaa jakautuu useisiin salmien yhdistämiin järvenselkiin, kuten Luonteri, Yövesi ja Louhivesi.\\nEtelä-Saimaa on Vuoksen vesistön varsinainen pääjärvi. Järven kaakkoisosasta Vuoksenniskalta lähtee vesistön laskujoki Vuoksi, joka virtaa Laatokkaan."},{"page_url":"https://ca.wikipedia.org/wiki/Tokyo_Metro_Hibiya_Line","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e2/Kasumigaseki-Sta-A3a.JPG","page_title":"Tokyo Metro Hibiya Line","context_page_description":"La Tokyo Metro Hibiya Line és una línia de metro, propietat i explotada per l'empresa Tokyo Metro, situada a Tòquio, Japó. El nom de la línia ve arran del districte de Hibiya, lloc per on passa."},{"page_url":"https://nl.wikipedia.org/wiki/Station_Mont-de-Marsan","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/17/Gare_MDM_7.JPG","page_title":"Station Mont-de-Marsan","context_page_description":"Station Mont-de-Marsan is een spoorwegstation in de Franse stad Mont-de-Marsan."},{"page_url":"https://zh.wikipedia.org/wiki/%E8%8A%99%E8%93%89%E8%A1%97","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5c/%E5%B1%B1%E4%B8%9C%E7%9C%81%E6%B5%8E%E5%8D%97%E5%B8%82%E8%8A%99%E8%93%89%E8%A1%97.jpg","page_title":"芙蓉街","context_page_description":"芙蓉街位于山东省济南市历下区，南起繁华的泉城路中段，北到西花墙子街南口、济南府学文庙前，长432米，平均宽4.6米，为济南最为古老和繁华的综合性商业街道。芙蓉街得名于街中段路西的芙蓉泉，其街名的最早记载来自清乾隆三十六年的《历城县志地域考》。"},{"page_url":"https://en.wikipedia.org/wiki/Juliette_Drouet","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/aa/Juliette_Drouet.jpg","page_title":"Juliette Drouet","context_page_description":"Juliette Drouet, born Julienne Josephine Gauvain, was a French actress. She abandoned her career on the stage after becoming the mistress of Victor Hugo, to whom she acted as a secretary and travelling companion. Juliette accompanied Hugo in his exile to the Channel Islands, and wrote thousands of letters to him throughout her life."},{"page_url":"https://de.wikipedia.org/wiki/Bahnhof_Metz-Ville","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/af/Metz_-_Gare_-_4.jpg","page_title":"Bahnhof Metz-Ville","context_page_description":"Der Bahnhof Metz-Ville ist der Bahnhof der französischen Stadt Metz im Département Moselle."},{"page_url":"https://nl.wikipedia.org/wiki/Hobby-Wohnwagenwerk","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6c/Hobby_Classic_einachsig_vl.jpg","page_title":"Hobby-Wohnwagenwerk","context_page_description":"Hobby-Wohnwagenwerk Ing. Harald Striewski GmbH is een Duits fabrikant van caravans en campers. Het is gevestigd in Fockbek in de deelstaat Sleeswijk-Holstein.\\nHet bedrijf is in 1967 opgericht door ingenieur Harald Striewski die het anno 2013 nog steeds leidt. Striewski kwam als zevenjarige met zijn moeder en broer als vluchteling uit Oostpruisen naar Sleeswijk-Holstein. In 1964 bouwde hij met geleend geld zijn eerste caravan. In 1984 bouwde hij de eerste Hobby 600, een klassieker onder de campers.\\nZijn bedrijf groeide uit tot een van de grootste producenten van caravans in de wereld. Met een marktaandeel van 23% was het de marktleider in Europa in 2005. In de fabriek in Fockbek produceren rond de 1000 medewerkers jaarlijks circa 13.000 caravans en 1.000 mobilhomes.\\nSedert 1998 behoort ook de caravanafdeling van Fendt uit Mertingen tot het Hobby-concern, dat ook de tentenfabriek Nordland Zeltfabrik in Fockbek en de verzinkerij Rendsburger Feuerverzinkerei in Rendsburg bezit.\\nDe jaaromzet van Hobby ligt rond de 200 miljoen euro. Daarmee is Hobby in de Kreis Rendsburg-Eckernförde het bedrijf met de hoogste omzet."},{"page_url":"https://tl.wikipedia.org/wiki/Santa_Maria,_Bulacan","image_url":"http://upload.wikimedia.org/wikipedia/commons/c/ce/Sta._Maria_Town_Proper.jpg","page_title":"Santa Maria, Bulacan","context_page_description":"Ang Bayan ng Santa Maria ay isang unang klaseng bayan sa lalawigan ng Bulacan, Pilipinas. Ayon sa 2015 senso, ito ay may populasyon na 256,454 sa may 57,575 na kabahayan."},{"page_url":"https://br.wikipedia.org/wiki/Ch%C3%A2teau-Salins","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/30/Chateau-salins_SP-Mairie.jpg","page_title":"Château-Salins","context_page_description":"Krogit e-barzh!\\nUn danvez pennad eo ar pennad-mañ ha labour zo d'ober c'hoazh a-raok e beurechuiñ.\\nGallout a rit skoazellañ Wikipedia dre glokaat anezhañ.\\nChâteau-Salins zo ur gumun en departamant Moselle hag er rannvro Alsace-Champagne-Ardenne-Lorraine, e reter Bro-C'hall. Pennlec'h arondisamant Château-Salins e oa betek 2015.\\nEr bloavezh 2015 e oa 2 442 a annezidi hag a reer Castelsalinois anezho e galleg."},{"page_url":"https://en.wikipedia.org/wiki/Tangent_lines_to_circles","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/43/Inner_tangent1.svg","page_title":"Tangent lines to circles","context_page_description":"In Euclidean plane geometry, a tangent line to a circle is a line that touches the circle at exactly one point, never entering the circle's interior. Tangent lines to circles form the subject of several theorems, and play an important role in many geometrical constructions and proofs. Since the tangent line to a circle at a point P is perpendicular to the radius to that point, theorems involving tangent lines often involve radial lines and orthogonal circles."},{"page_url":"https://th.wikipedia.org/wiki/%E0%B8%AA%E0%B8%96%E0%B8%B2%E0%B8%99%E0%B8%B5%E0%B8%9A%E0%B8%B2%E0%B8%87%E0%B8%AB%E0%B8%A7%E0%B9%89%E0%B8%B2","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/ae/Transfer_hall_Bang_Wa_Station_%28MRT_Side%29_2.jpg","page_title":"สถานีบางหว้า","context_page_description":"สถานีบางหว้า เป็นสถานีรถไฟฟ้าในเขตภาษีเจริญ กรุงเทพมหานคร ในเส้นทางรถไฟฟ้าบีทีเอส สายสีลม และรถไฟฟ้ามหานคร สายเฉลิมรัชมงคล"},{"page_url":"https://ml.wikipedia.org/wiki/%E0%B4%9A%E0%B5%88%E0%B4%A8%E0%B4%AF%E0%B5%81%E0%B4%9F%E0%B5%86_%E0%B4%9A%E0%B4%B0%E0%B4%BF%E0%B4%A4%E0%B5%8D%E0%B4%B0%E0%B4%82","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/62/Qing_china.jpg","page_title":"ചൈനയുടെ ചരിത്രം","context_page_description":"ചൈനീസ് സംസ്കാരം മഞ്ഞനദിയോടും യാങ്സി നദിയോടും ചേർന്ന നദീതടങ്ങളിലെ വിവിധ കേന്ദ്രങ്ങളിൽ നവീനശിലായുഗത്തോട് അനുബന്ധിച്ചാണ് വികസിച്ചത്. എങ്കിലും മഞ്ഞനദിയെയാണ് ചൈനീസ് സംസ്കാരത്തിന്റെ\\nതൊട്ടിലായി വിശേഷിപ്പിക്കുന്നത്. ആയിരക്കണക്കിനു വർഷങ്ങളുടെ തുടർച്ചയായ ചരിത്രമുള്ള ചൈന ലോകത്തെ ഏറ്റവും പ്രാചീനമായ സംസ്കാരങ്ങ‌ളിലൊന്നാണ്.\\nഷാങ് രാജവംശത്തിന്റെ കാലം മുതൽക്കുള്ള ലിഖിതചരിത്രം ലഭ്യമാണ്,\\nറെക്കോഡ്സ് ഓഫ് ദി ഗ്രാന്റ് ഹിസ്റ്റോറിയൻ ബാംബൂ ആനൽസ് മുതലായ ഗ്രന്ഥങ്ങൾ ഷാങ് രാജവംശത്തിനു മുൻപേ സിയ രാജവംശം നിലവിലുണ്ടായിരുന്നു എന്ന്\\nപറയുന്നുണ്ട് എന്നിരുന്നാലും\\nചൈനയുടെ സംസ്കാരവും, സാഹിത്യവും തത്ത്വശാസ്ത്രവും കൂടുതൽ വികസിച്ചത് ഷൗ രാജവംശത്തിന്റെ കാലത്താണ്.\\nഷൗ രാജവംശം ബി.സി. എട്ടാം നൂറ്റാണ്ടിൽ ബാഹ്യവും ആന്തരികവുമായ സമ്മർദ്ദങ്ങൾ നേരിട്ട് തകർച്ച നേരിട്ടുകൊണ്ടിരിക്കുകയായിരുന്നു. പിൽക്കാലത്ത് ഇത് ചെറിയ രാജ്യങ്ങളായി വിഘടിച്ചു. ഇതോടെ സ്പ്രിംഗ് ആൻഡ് ഓട്ടം കാലഘട്ടം ആരംഭിച്ചു.\\nയുദ്ധം ചെയ്യുന്ന രാജ്യങ്ങളുടെ കാലത്തിലാണ് ഇത് അവസാനിച്ചത്. ഭര‌ണം പരാജയപ്പെടുന്ന പല സാഹചര്യങ്ങൾ ചൈനീസ് ചരിത്രത്തിലുണ്ട്. ഇത് അത്തരമൊരു കാലഘട്ടമായിരുന്നു.\\nപല രാജ്യങ്ങ‌ളായും യുദ്ധപ്രഭുക്കന്മാരുടെ ഭരണത്തിൻ കീഴിലായും ശിധിലമായിരുന്ന കാലങ്ങൾക്കിടെ ചില രാജവംശങ്ങൾ ചൈനയുടെ ഭൂരിഭാഗം പ്രദേശങ്ങളും ഭരിച്ചിരുന്നു."},{"page_url":"https://ja.wikipedia.org/wiki/%E3%83%99%E3%83%AB%E3%82%B8%E3%82%A2%E3%83%B3%E3%83%BB%E3%82%B7%E3%82%A7%E3%83%91%E3%83%BC%E3%83%89%E3%83%BB%E3%83%89%E3%83%83%E3%82%B0%E3%83%BB%E3%82%BF%E3%83%BC%E3%83%93%E3%83%A5%E3%83%AC%E3%83%B3","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/99/Tervueren.jpg","page_title":"ベルジアン・シェパード・ドッグ・タービュレン","context_page_description":"ベルジアン・シェパード・ドッグ・タービュレンとは、ベルギー原産の牧羊犬種である。ベルジアン・シェパード・ドッグの愛好家などからは単にタービュレンと呼ばれることもある。"},{"page_url":"https://ja.wikipedia.org/wiki/%E3%83%87%E3%82%A3%E3%82%A2%E3%83%AD%E3%83%83%E3%82%B8%E9%83%A1_(%E3%83%A2%E3%83%B3%E3%82%BF%E3%83%8A%E5%B7%9E)","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9b/AnacondaStainedGlass.jpg","page_title":"ディアロッジ郡 (モンタナ州)","context_page_description":"ディアロッジ郡は、アメリカ合衆国モンタナ州の西部に位置する郡である。2010年国勢調査での人口は9,298人であり、2000年の9,417人から1.3％減少した。モンタナ州の郡では面積で少ないほうから第2位である。郡庁所在地はアナコンダ市であり、アナコンダ市とディアロッジ郡は統合市郡になっている。"},{"page_url":"https://cs.wikipedia.org/wiki/Carl_Jenkinson","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1d/Carl_Jenkinson_vs_Liverpool_2011.jpg","page_title":"Carl Jenkinson","context_page_description":"Carl Daniel Jenkinson je profesionální fotbalista, který má otce Angličana a matku Finku. V mládežnických týmech reprezentoval Anglii i Finsko.\\nV současné době hraje jako pravý obránce v anglické Premier League za West Ham United FC, hostuje z Arsenal FC."},{"page_url":"https://en.wikipedia.org/wiki/Alice%27s_Adventures_in_Wonderland","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0c/Lewis_carroll%2C_alice%27s_adventures_in_wonderland%2C_macmillian_%26_co._londra_1884_%28gabinetto_vieusseux%29.JPG","page_title":"Alice's Adventures in Wonderland","context_page_description":"Alice's Adventures in Wonderland is an 1865 novel by English author Lewis Carroll. It tells of a young girl named Alice, who falls through a rabbit hole into a subterranean fantasy world populated by peculiar, anthropomorphic creatures. It is considered to be one of the best examples of the literary nonsense genre. The tale plays with logic, giving the story lasting popularity with adults as well as with children.\\nOne of the best-known and most popular works of English-language fiction, its narrative, structure, characters and imagery have been enormously influential in popular culture and literature, especially in the fantasy genre. The work has never been out of print, and it has been translated into at least 97 languages. Its ongoing legacy encompasses many adaptations for stage, screen, radio, art, theme parks, board games, and video games. Carroll published a sequel in 1871, entitled Through the Looking-Glass, and a shortened version for young children, The Nursery \\"Alice\\", in 1890."},{"page_url":"https://en.wikipedia.org/wiki/1944_United_States_Senate_election_in_Pennsylvania","image_url":"http://upload.wikimedia.org/wikipedia/commons/7/7f/M001127.jpg","page_title":"1944 United States Senate election in Pennsylvania","context_page_description":"The 1944 United States Senate election in Pennsylvania was held on November 7, 1944. Incumbent Republican U.S. Senator James J. Davis sought re-election, but was defeated by Democratic nominee Francis J. Myers."},{"page_url":"https://id.wikipedia.org/wiki/Geografi_Sydney","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/49/Sydney_ASTER_2001_oct_12.jpg","page_title":"Geografi Sydney","context_page_description":"Sydney, Australia terletak di daerah aliran sungai tepi pantai, yang berbatasan dengan Samudera Pasifik di timur, Pegunungan Blue di barat, Sungai Hawkesbury di utara dan Royal National Park di selatan. Terletak di tepi pantai terbenam, di mana permukaan laut meningkat dan membanjiri lembah sungai yang dalam pada batuan pasir Hawkesbury. Port Jackson, dikenal sebagai Sydney Harbour, adalah satu contoh ria dan pelabuhan alami terbesar di dunia. Daerah Sydney tidak pernah terkena dampak dari gempa bumi. Wilayah urbannya memiliki sekitar 70 pelabuhan dan pantai, termasuk Bondi Beach yang terkenal. Wilayah urban Sydney memiliki luas 1;687 km² pada tahun 2001. Sydney Statistical Division, digunakan untuk data sensus, adalah wilayah metropolitan tak resmi dan mencakup 12;145 km². Wilayah ini meliputi Central Coast, Pegunungan Blue, dan taman nasional dan daratan non-urban lainnya. Ini menjadikan Sydney aglomerasi urban terbesar ke-3 di dunia setelah Brasília dan Rokyo."},{"page_url":"https://en.wikipedia.org/wiki/Huaynaputina","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a9/Golod.jpg","page_title":"Huaynaputina","context_page_description":"Huaynaputina is a stratovolcano in a volcanic upland in southern Peru. Part of the Central Volcanic Zone of the Andean Volcanic Belt, it is the product of the subduction of the oceanic Nazca tectonic plate beneath the continental part of the South American tectonic plate at a rate of 10.3 centimetres per year. Huaynaputina is a large volcanic crater, lacking an identifiable mountain profile, with an outer stratovolcano and three younger volcanic vents. The vents of Huaynaputina form a north-northwest–south-southeast trend.\\nThe volcano erupted several times during the Holocene, the largest eruption took place in the year 1600. The 1600 eruption was the largest historical eruption in South America, measuring 6 on the Volcanic Explosivity Index. It occurred on 19 February and continued with a series of events into March. Witnessed by the people of the city of Arequipa, its impact in the region was severe, wiping out vegetation and burying the surroundings with 2 metres of volcanic rock; it also damaged infrastructure and economic resources."},{"page_url":"https://de.wikipedia.org/wiki/Koppenbr%C3%BCllerh%C3%B6hle","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/77/Koppenbr%C3%BCllerh%C3%B6hle_-_entrance.jpg","page_title":"Koppenbrüllerhöhle","context_page_description":"Die Koppenbrüllerhöhle ist eine Schauhöhle im Tal der Koppentraun bei Obertraun."},{"page_url":"https://ml.wikipedia.org/wiki/%E0%B4%B5%E0%B4%B0%E0%B4%AF%E0%B5%BB%E0%B4%A8%E0%B5%80%E0%B4%B2%E0%B4%BF","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b3/Life_cycle_of_opaque_sixlineblue_by_Balakrishnan_Valappil_%28egg_laying%29.jpg","page_title":"വരയൻനീലി","context_page_description":"ഒരു നീലി ചിത്രശലഭമാണ് വരയൻനീലി ‌. Nacaduba beroe എന്ന ശാസ്ത്രീയ നാമത്തിൽ അറിയപ്പെടുന്നു."},{"page_url":"https://en.wikipedia.org/wiki/Picard_language","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/69/Enseigne_caf%C3%A9_picard_Cayeux_sur_mer.JPG","page_title":"Picard language","context_page_description":"Picard is a langue d'oïl dialect of the Romance language family spoken in the northernmost part of France and southern Belgium. Administratively, this area is divided between the French Hauts-de-France region and the Belgian Wallonia along the border between both countries due to its traditional core being the districts of Tournai and Mons.\\nPicard is referred to by different names as residents of Picardy simply call it Picard, but it is more commonly known as chti or chtimi in the more populated Nord-Pas-de-Calais. It is also named Rouchi around Valenciennes, Roubaignot around Roubaix, or simply patois in general.\\nAs of 2008, Picard native speakers amount to 700,000 individuals, the vast majority of which are elderly people. Since its daily use had drastically declined, Picard was declared by the United Nations Educational, Scientific and Cultural Organization a \\"seriously endangered language\\"."},{"page_url":"https://ro.wikipedia.org/wiki/Remetea,_Mure%C8%99","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6f/Josephinische_Landaufnahme_pg128.jpg","page_title":"Remetea, Mureș","context_page_description":"Remetea este o localitate componentă a municipiului Târgu Mureș din județul Mureș, Transilvania, România."},{"page_url":"https://de.wikipedia.org/wiki/Boulangerit","image_url":"http://upload.wikimedia.org/wikipedia/commons/b/b1/Boulangerite%2C_Calcite_-_Stari_Trg_Mine%2C_Trepca%2C_Kosovo1.jpg","page_title":"Boulangerit","context_page_description":"Boulangerit ist ein häufig vorkommendes Mineral aus der Mineralklasse der „Sulfide und Sulfosalze“. Es kristallisiert im orthorhombischen Kristallsystem mit der chemischen Zusammensetzung Pb₅Sb₄S₁₁ und entwickelt meist körnige oder feinfaserige Aggregate, selten aber auch nadelige, gestreifte Kristalle von grauschwarzer Farbe bei schwarzer Strichfarbe.\\nBoulangerit ist undurchsichtig und zeigt bei kristalliner Ausbildung einen metallischen Glanz, bei faserigen Aggregaten dagegen Seidenglanz. Seine Mohshärte schwankt zwischen 2,5 und 3, lässt sich also von einem Fingernagel kaum noch, mit einer Kupfermünze dagegen schon noch ritzen."},{"page_url":"https://en.wikipedia.org/wiki/List_of_Catholic_dioceses_in_the_Philippines","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d2/Vigan_cathedral_1.jpg","page_title":"List of Catholic dioceses in the Philippines","context_page_description":"This is a list of the Catholic dioceses in the Philippines. The dioceses' bishops comprise the Catholic Bishops' Conference of the Philippines, an episcopal conference. The dioceses are grouped into ecclesiastical provinces, each of which comprises a Metropolitan archdiocese and several suffragan dioceses and is headed by the archbishop, as the metropolitan bishop of the province.\\nApostolic vicariates and the military ordinariate are not part of any ecclesiastical province, but are included in the table. Like diocesean bishops, they are the ordinary responsible for spiritual care the Catholics under them and are directly subject to the Holy See."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%91%D1%80%D0%B5%D0%BD%D1%87,_%D0%A2%D1%8D%D0%B4","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/72/National_Defense_Service_Medal.png","page_title":"Бренч, Тэд","context_page_description":"Тэд Бренч — американский военно-морской деятель, военнослужащий ВМС США, вице-адмирал, с 2011 года — начальник разведывательного управления военно-морских сил США."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%94%D0%B0%D1%81%D1%8F%D1%85%D1%8D","image_url":"http://upload.wikimedia.org/wikipedia/commons/f/fb/5915-Linxia-County-Daxiahe-fall-into-Liujaixia-Reservoir.jpg","page_title":"Дасяхэ","context_page_description":"Дасяхэ́ — река в провинции Ганьсу, приток Хуанхэ."},{"page_url":"https://en.wikipedia.org/wiki/Sentinel_program","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/02/Glassboro_%282%29.jpg","page_title":"Sentinel program","context_page_description":"Sentinel was a proposed US Army anti-ballistic missile system designed to provide a light layer of protection over the entire United States, able to defend against small ICBM strikes like those expected from China, or accidental launches from the USSR or other states. The system would have seventeen bases, each centered on its Missile Site Radar and a computerized command center buried below it. The system was supported by a string of five long-range Perimeter Acquisition Radars spread across the US/Canada border area and another in Alaska. The primary weapon was the long-range Spartan missile, with short range Sprint missiles providing additional protection near US ICBM fields and PAR sites. The system would initially have a total of 480 Spartan and 192 Sprint missiles.\\nSentinel was a response to the rapidly rising costs of the earlier Nike-X concept. Nike-X was designed to handle full-out attacks by the Soviet ICBM force of thousands of missiles, stockpiling more interceptors than the Soviets had ICBMs. As the number of Soviet ICBMs grew, the number of interceptor missiles required to maintain the defense soared."},{"page_url":"https://io.wikipedia.org/wiki/1503","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/ab/Parmigianino_Selfportrait.jpg","page_title":"1503","context_page_description":"13ma di mayo - Hispani kaptas Napoli.\\n22ma di septembro - Pius la 3ma divenas papo.\\n31ma di oktobro - Julius la 2ma divenas papo."},{"page_url":"https://de.wikipedia.org/wiki/Stra%C3%9Fenbauer","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6f/Fotothek_df_n-06_0000389_Dresdner_Stra%C3%9Fe_in_Freital-Hainsberg_.jpg","page_title":"Straßenbauer","context_page_description":"Straßenbauer ist ein Beruf, der sich mit der Herstellung und Instandhaltung von Straßen, Wegen und Plätzen beschäftigt. Er ist dem Bauhauptgewerbe zuzuordnen und wird im Rahmen einer mehrjährigen Ausbildung erlernt. Anstellung finden Straßenbauer überwiegend in Straßen- und Pflasterbaubetrieben. Es handelt sich bei dem Beruf Straßenbauer um einen anerkannten Ausbildungsberuf in Deutschland, in der Schweiz ist Strassenbauer EFZ ein Grundberuf."},{"page_url":"https://en.wikipedia.org/wiki/Chicken","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/78/Florida_chicken_house.jpg","page_title":"Chicken","context_page_description":"The chicken is a type of domesticated fowl, a subspecies of the red junglefowl. Chickens are one of the most common and widespread domestic animals, with a total population of 23.7 billion as of 2018. up from more than 19 billion in 2011. There are more chickens in the world than any other bird or domesticated fowl. Humans keep chickens primarily as a source of food and, less commonly, as pets. Originally raised for cockfighting or for special ceremonies, chickens were not kept for food until the Hellenistic period.\\nGenetic studies have pointed to multiple maternal origins in South Asia, Southeast Asia, and East Asia, but with the clade found in the Americas, Europe, the Middle East and Africa originating in the Indian subcontinent. From ancient India, the domesticated chicken spread to Lydia in western Asia Minor, and to Greece by the 5th century BC. Fowl had been known in Egypt since the mid-15th century BC, with the \\"bird that gives birth every day\\" having come to Egypt from the land between Syria and Shinar, Babylonia, according to the annals of Thutmose III."},{"page_url":"https://fr.wikipedia.org/wiki/Liste_de_sources_par_d%C3%A9bit","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1a/Aguas_Claras_DSCN8406mod.jpg","page_title":"Liste de sources par débit","context_page_description":"Cette liste de sources par débit a pour objectif de classer les sources dont le débit moyen est supérieur à 1 000 litres/seconde.\\nLa plupart de ces sources sont des exsurgences dont l'eau provient d'un réseau karstique souterrain.\\nLes sources du sud des États-Unis sont liées à la présence de deux grands aquifères, ceux de Floride et d'Edwards. Les sources de l'Idaho se trouvent sur un sol basaltique.\\nLes chiffres peuvent différer considérablement à la suite de la construction d'installations hydroélectriques et de captages pour l'irrigation ou l'approvisionnement en eau potable.\\nIl peut aussi y avoir des changements dans les regroupements des sources qui n'ont pas toujours été suivies séparément.\\nIl existe 62 sources donnant plus de 3000 l/s en ex-Yougoslavie. 17 sources dépassent les 1000 l/s en Albanie."},{"page_url":"https://nl.wikipedia.org/wiki/Lijst_van_county%27s_in_Iowa","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4d/Iowa_counties_with_names.jpg","page_title":"Lijst van county's in Iowa","context_page_description":"De Amerikaanse staat Iowa is onderverdeeld in 99 county's."},{"page_url":"https://pl.wikipedia.org/wiki/Polscy_biskupi_katoliccy","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/cf/Biskup_Wetkowski.jpg","page_title":"Polscy biskupi katoliccy","context_page_description":"Polscy biskupi katoliccy – duchowni rzymskokatoliccy i greckokatoliccy posiadający święcenia biskupie i sprawujący posługę w Polsce."},{"page_url":"https://tr.wikipedia.org/wiki/Birle%C5%9Fik_Krall%C4%B1k%27taki_yel_de%C4%9Firmenleri_listesi","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f5/Balsall_Common_Mill%2C_Berkswell.jpg","page_title":"Birleşik Krallık'taki yel değirmenleri listesi","context_page_description":"Bu maddede Birleşik Krallık'taki yel değirmenleri ve rüzgan türbinleri listelenmiştir."},{"page_url":"https://zh-yue.wikipedia.org/wiki/%E5%B6%BA%E5%8D%97%E5%A4%A7%E5%AD%B8_(%E5%BB%A3%E5%B7%9E)","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/31/First_Graduates_SYS_College_Lingnan_U..jpg","page_title":"嶺南大學 (廣州)","context_page_description":"嶺南大學（嗰陣嘅簡稱係南大，英文：Canton Christian College；Lingnan University），係廣州度一個已經消失咗嘅大學，原先喺1888年創校，係不隸屬於任何教派嘅基督教大學，係中華民國陣嘅13個基督教大學之一。學科最初係有英文、格致、理化、算術、地理、生物等西學課程，由1927年開始，原有文理學科外，開辦咗農、商、工、醫等學院。經過十年左右發展，成為咗中國大陸南方一個舉足輕重嘅私立大學。史堅如、陳毅、廖承志、冼星海、鄒至莊、曹安邦、陳香梅、姜伯駒等都係呢間學校出來嘅學生，喺全球各地設有同學會、校友會17個。\\n據宴文士校長喺1912年嘅報告，辦呢間學校不單止係為咗華人教育同總體福祉，更係要將基督教嘅精神，展示俾啲學友同學校嘅贊助人。經學校同董事會嘅努力，1920年嘅第一屆嶺南本科畢業生，可以直接北美十間名校嘅研究生部進修，令嶺南聲望大增。到1927年廣州嶺南正名做咗大學，時任校長鍾榮光博士俾稱之為「嶺南之父」。同年向國民政府呈請立案，俾當局確定係私立基督教大學，而俾納入咗國民政府教育體系。跟著來自大馬、星洲、印尼、泰國、緬甸、美洲等地嘅華僑紛紛捐錢俾嶺南，為康樂園嘅建造貢獻唔少，由呢啲捐款起出嚟嘅校舍有張弼士紀念堂、陸佑堂、陳嘉庚紀念堂、爪哇堂、榮光堂、馬應彪護養院、招待室、譚禮庭同學屋等等。而就嗰陣嘅華南地區嚟講，嶺南大學嘅聲譽，其實係仲要高過香港大學嘅。\\n1938年日軍南下，廣州嶺南大學遷香港，四年後遷至粵北大村復校。1945年光復後返回咗廣州康樂校園。1952年廣州嶺大畀中共政府分拆嗮啲院系，將河南校園交咗俾中山大學繼續用。嶺南大學喺廣州冇咗後，一班住香港嘅嶺大舊生就喺1967年，用「嶺南書院」名義喺司徒拔道復校。開頭香港嶺南嘅使費比較多，1980年代時書院嘅董事會主席利榮康，就自己嚟補足啲唔夠嘅經費。1987年後香港高教委員會將學校納入咗公共教育體系，由政府補助啲經費而緩解財困。而1987年經北京中央嘅批准，喺廣州中山大學（康樂園）入邊又成立返個嶺南（大學）學院。到1999年，香港嶺南恢復返咗嶺南大學個名。"},{"page_url":"https://ca.wikipedia.org/wiki/Graham_McRae","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/34/International_Motor_Races%2C_Levin_%2824422898464%29.jpg","page_title":"Graham McRae","context_page_description":"Graham McRae va ser un pilot de curses automobilístiques neozelandès que va arribar a disputar curses de Fórmula 1.\\nVa néixer el 5 de març del 1940 a Wellington, Nova Zelanda."},{"page_url":"https://ja.wikipedia.org/wiki/%E7%A7%8B%E7%94%B0%E8%BC%9D%E5%AD%A3","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/df/Akita_Terusue.jpg","page_title":"秋田輝季","context_page_description":"秋田 輝季は、陸奥三春藩の第3代藩主。秋田家第5代当主。"},{"page_url":"https://sk.wikipedia.org/wiki/Biele_Karpaty","image_url":"http://upload.wikimedia.org/wikipedia/commons/7/73/Krivokl%C3%A1tsk%C3%A1_tiesnava.jpg","page_title":"Biele Karpaty","context_page_description":"Biele Karpaty sú pohorie Vonkajších Západných Karpát na hraniciach medzi Slovenskom a Moravou. Najvyšším vrchom je Veľká Javorina."},{"page_url":"https://ca.wikipedia.org/wiki/Fiscorn","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/aa/Fiscornaire.jpg","page_title":"Fiscorn","context_page_description":"El fiscorn és un instrument de la cobla. Es tracta d'un instrument de vent metall, és a dir amb embocadura de broquet, vàlvules i tub cònic, de la família dels flugelhorns. Els fiscorns de la cobla són flugelhorns barítons afinats en Do i amb la configuració típica de la banda: amb el pavelló o campana que mira cap endavant, com un gran bugle. Els intèrprets del fiscorn es designen com a fiscornaires o simplement com a fiscorns.\\nActualment es troba en formacions musicals a Catalunya ja siguin cobles o grups de música tradicional.\\nEl fiscorn Quant és introduït a Catalunya fruit de la reforma de la cobla realitzada per Pep Ventura, Ventura impulsà l'arraconament del sac de gemecs o cornamusa -substituït per la tenora-, perfeccionar el tible i introduir-hi el cornetí, el fiscorn i el contrabaix. Ell i altres autors anaven fent partitures i en cada una anaven assajant nous instruments i combinacions. Així va tenir lloc la introducció de les tres tenores, de les dues tenores, de les campanes i de les formacions de cinc fins a dotze músics. Va caldre cercar l'equilibri sonor i aquest es va trobar amb la formació \\"definitiva\\" que actualment coneixem."},{"page_url":"https://ka.wikipedia.org/wiki/%E1%83%A1%E1%83%94%E1%83%98%E1%83%A8%E1%83%94%E1%83%9A%E1%83%98%E1%83%A1_%E1%83%99%E1%83%A3%E1%83%9C%E1%83%AB%E1%83%A3%E1%83%9A%E1%83%94%E1%83%91%E1%83%98%E1%83%A1_%E1%83%98%E1%83%A1%E1%83%A2%E1%83%9D%E1%83%A0%E1%83%98%E1%83%90","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8d/James_Michel_in_meeting.jpg","page_title":"სეიშელის კუნძულების ისტორია","context_page_description":"სეიშელის კუნძულების ისტორია პორტუგალიელი ზღვაოსნების მიერ XVI საუკუნეში, კუნძულების აღმოჩენით იწყება.\\nXVIII საუკუნის შუა ხანებში ფრანგებმა სეიშელის კუნძულები თავიანთ კოლონიად აქციეს. როდესაც 1502 წელს ვასკო და გამა, იმ დროს ადმირალი, ამ ადგილას მოვიდა, აღმოაჩინა ამირანტის კუნძულები. პორტუგალიელმა კარტოგრაფებმა, პირველად შეიტანეს თავიანთ რუკაზე დიდი კუნძული ილია-განა, ახლანდელი კუნძული მაე. შემონახულია მტკიცებულებები იმისა, რომ არაბმა ზღვაოსნებმა იმოგზაურეს ამ კუნძულებზე. იმ დროს ეს არქიპელაგი დაუსახლებელი იყო. მეცნიერები ვარაუდობენ, რომ სეიშელის დაუსახლებელ ტერიტორიას, თავიდან ავსტრონეზიელი, მალდიველი და არაბი ვაჭრები ეწვიენ. სწორედ, მალდიველმა ზღვაოსნებმა აღმოაჩინეს კუნძული სილუეტი. შემდგომ, ორი საუკუნის შემდეგ, სეიშელის კუნძულები წარმოადგენდა მეკობრეთა თავშესაფარს. ევროპელებიდან, პირველად ამ არქიპელაგზე ფეხი დადგეს ინგლისელებმა. 1609 წელს, კუნძულები პირველად შეისწავლა და აღწერა კაპიტანმა ა. შარპეამ. პირველი მოსახლეებს კუნძულ მაესა და პრასლინზე, შეადგენდნენ ფრანგები, რომლებმაც 1756 წლიდან დაიწყეს დარიჩინის, მიხაკისა და ვანილის პლანტაციების მოშენება. მას შემდეგ ტერიტორიას, საფრანგეთის ფინანსთა მინისტრის — მორო დე სეიშელის სახელი ეწოდა."},{"page_url":"https://vi.wikipedia.org/wiki/Anthoxanthum_odoratum","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4a/Anthoxanthum_odoratum_%E2%80%94_Flora_Batava_%E2%80%94_Volume_v2.jpg","page_title":"Anthoxanthum odoratum","context_page_description":"Anthoxanthum odoratum là một loài thực vật có hoa trong họ Hòa thảo. Loài này được L. mô tả khoa học đầu tiên năm 1753."},{"page_url":"https://fr.wikipedia.org/wiki/Ath%C3%A9n%C3%A9e_royal_Isabelle_Gatti_de_Gamond","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/77/Marie_Popelin_%281846-1923%29.jpg","page_title":"Athénée royal Isabelle Gatti de Gamond","context_page_description":"L’Athénée royal Isabelle Gatti de Gamond est un établissement d'enseignement fondamental et secondaire situé à Bruxelles. Fondée par Isabelle Gatti de Gamond en 1864, l'école fut la première institution d'enseignement non-confessionnel pour filles de Belgique."},{"page_url":"https://es.wikipedia.org/wiki/Michelle_Pfeiffer","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/70/Michelle_Pfeiffer_2007.jpg","page_title":"Michelle Pfeiffer","context_page_description":"Michelle Marie Pfeiffer es una actriz estadounidense, una de las más populares y laureadas de los años 80 y 90. Conocida por su versatilidad como actriz de personajes, se ha hecho particularmente conocida por retratar a mujeres emocionalmente distantes, matizadas y poco atractivas, así como a personajes femeninos fuertes con un atractivo sexual intenso.\\nPfeiffer comenzó su carrera artística actuando en series y películas para televisión, como La isla de la fantasía y Delta House a finales de los años 1970. Debutó en el cine en 1980 en el largometraje The Hollywood Knights. Posteriormente, obtuvo reconocimiento de la prensa y los críticos con su interpretación en películas como Scarface, Las brujas de Eastwick, Las Amistades Peligrosas, Casada con todos, Los fabulosos Baker Boys, La casa Rusia, Frankie and Johnny, Por encima de todo, Batman Returns y La edad de la inocencia. Sus interpretaciones la hicieron acreedora de numerosos premios y galardones, entre ellos un premio BAFTA y un Oso de Plata."},{"page_url":"https://nl.wikipedia.org/wiki/East_Winch","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6b/All_Saints%27_Church%2C_East_Winch_-_geograph.org.uk_-_261348.jpg","page_title":"East Winch","context_page_description":"East Winch is een civil parish in het bestuurlijke gebied King's Lynn en West Norfolk, in het Engelse graafschap Norfolk met 779 inwoners."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%9F%D0%B0%D0%BD%D1%87%D1%85%D0%B0%D0%BD","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1c/Korean_cuisine-Baekban-01.jpg","page_title":"Панчхан","context_page_description":"Панчхан, кор. 반찬 — общее название различных закусок и салатов в Корее, которые подаются как аккомпанемент к основному блюду и рису, в небольших неглубоких тарелках.\\nСлово используется как в единственном числе, так и во множественном. Один из самых известных корейских панчханов — кимчхи.\\nПанчхан сервируют вдоль всего стола, по центру, чтобы каждый мог свободно дотянуться до блюда, так как все панчханы принято есть сообща, также как и основное блюдо, в то время, как супы и рис подаются индивидуально каждому. Панчхан подается небольшими порциями, но постоянно пополняется во время застолья. Количество панчханов зависит от события, чем важнее событие, тем больше закусок. Количество и ассортимент закусок также зависит от провинции. Например, провинция Чолладо известна тем, что подает большое и разнообразное количество панчхан к каждому основному блюду."},{"page_url":"https://fr.wikipedia.org/wiki/Iviers","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7b/Iviers_%28Aisne%29_%C3%A9glise_%2801%29.JPG","page_title":"Iviers","context_page_description":"Iviers est une commune française située dans le département de l'Aisne, en région Hauts-de-France."},{"page_url":"https://ja.wikipedia.org/wiki/%E3%83%AC%E3%83%BC%E3%83%AB%E3%83%90%E3%82%B9","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0e/071020_Shigaraki_Station_Koga_Shiga_pref_Japan02s3.jpg","page_title":"レールバス","context_page_description":"レールバスとは、バスなどの自動車の装備を流用した、もしくはそれをベースに造られた小型の気動車である。軽量で製造・運用コストが低いことから、乗客の少ない閑散路線への投入が古くから行なわれている。"},{"page_url":"https://en.wikipedia.org/wiki/Radio_City_Tower","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f8/Rad-city-ghr_logo_png.png","page_title":"Radio City Tower","context_page_description":"Radio City Tower is a radio and observation tower in Liverpool, England, built in 1969 and opened by Queen Elizabeth II. It was designed by James A. Roberts Associates in Birmingham. It is 125 metres tall, and is the second tallest free-standing building in Liverpool and the 32nd tallest in the United Kingdom. When considering the height of the building, it has a 10m long antenna on the roof, making it the tallest structure in Liverpool. The Tower takes its name from the main radio station that operates from it, Radio City and its sister station Greatest Hits Liverpool."},{"page_url":"https://de.wikipedia.org/wiki/Richard_Meili","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/db/Richard_Meili.jpg","page_title":"Richard Meili","context_page_description":"Richard Meili war ein Schweizer Psychologe auf den Gebieten Persönlichkeitspsychologie, Psychodiagnostik und der Entwicklungspsychologie."},{"page_url":"https://br.wikipedia.org/wiki/Ardamezeg_familho%C3%B9_Breizh","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/83/Aymeret_de_Gazeau.jpg","page_title":"Ardamezeg familhoù Breizh","context_page_description":"Amañ emañ diskouezet skoedoù familhoù an uhelidi a Vreizh, gant o deskrivadur hervez reolennoù an ardamezouriezh.\\nEtre sonnelloù emañ an andonioù, a gavor el Levrlennadur."},{"page_url":"https://pl.wikipedia.org/wiki/Felipe_Carrillo_Puerto","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/bf/Felipe_Carrillo_Puerto_-_Localidades.png","page_title":"Felipe Carrillo Puerto","context_page_description":"Felipe Carrillo Puerto – miasto położone około 30 km od meksykańskiego wybrzeża Morza Karibskiego w stanie Quintana Roo. Miasto zostało założone przez Majów w 1850 roku w czasie ich walk o niepodległość i nazywało się Chan Santa Cruz. Obecna nazwa miasta została nadana na cześć Felipe Carrillo Puerto meksykańskiego rewolucjonisty i gubernatora Jukatanu w latach 20. XX w."},{"page_url":"https://nl.wikipedia.org/wiki/Zijdewind","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b7/Aanzicht_-_Zijdewind_-_20224074_-_RCE.jpg","page_title":"Zijdewind","context_page_description":"Zijdewind is een dorp in de West-Friese gemeente Hollands Kroon, in de provincie Noord-Holland. De plaats heeft ongeveer 290 inwoners. Tot 1970 vormde Zijdewind met de dorpen 't Veld en Oude Niedorp de gemeente Oude Niedorp. In de oudere geschiedenis is het ook bekend als Zijdenskerk.\\nDe naam komt van Seitwende dat een zijde wenden zou betekenen. Het dorp lag aan de oever van een meer. Zijdewind kende vroeger een gereformeerde kerk uit 1652, maar deze is in 1970 gesloopt. Op deze locatie bevindt zich thans een rotonde. De kerk werd spottend koeienkerk genoemd omdat hij tijdens de Tweede Wereldoorlog werd gebruikt als koeienstal. Een bakker heeft Zijdewind niet meer; op de zijgevel van de voormalige bakkerij is een tekst in de muur gemetseld met de tekst Eet meer brood.\\nTer hoogte van Zijdewind, in het buitengebied van Waarland, staat de Slootgaardmolen. Deze molen werd rond 1590 gebouwd om als eerste het meertje Slootgaard droog te malen en daarna de ontstaande Slootgaardpolder droog te houden."},{"page_url":"https://en.wikipedia.org/wiki/National_Register_of_Historic_Places_listings_in_Washington_County,_Maine","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b7/LubecME_ChalonerHouse.jpg","page_title":"National Register of Historic Places listings in Washington County, Maine","context_page_description":"This is a list of the National Register of Historic Places listings in Washington County, Maine.\\nThis is intended to be a complete list of the properties and districts on the National Register of Historic Places in Washington County, Maine, United States. Latitude and longitude coordinates are provided for many National Register properties and districts; these locations may be seen together in a map.\\nThere are 100 properties and districts listed on the National Register in the county. Another property was once listed but has been removed.\\nThis National Park Service list is complete through NPS recent listings posted July 17, 2020."},{"page_url":"https://sv.wikipedia.org/wiki/Himalayaspett","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/06/Himalayan_Woodpecker_%28female%29_I_IMG_6731.jpg","page_title":"Himalayaspett","context_page_description":"Himalayaspett är en asiatisk fågel i familjen hackspettar inom ordningen hackspettartade fåglar."},{"page_url":"https://en.wikipedia.org/wiki/Joseph_Blick","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6d/Jason_Evans_Residence%2C_1899.jpg","page_title":"Joseph Blick","context_page_description":"Joseph James Blick, sometimes credited as Joseph J. Blick, was an American architect who worked on commercial and residential projects and is best known for diverse residences in Southern California ranging from Mission to Modern styles. Born and raised in Clinton, Iowa, his father James Shannon Blick was a building contractor. The Blick family moved to Pasadena, California in 1887 soon after his sister Blanche married Frederick Russell Burnham, the celebrated scout and long time resident of California. Blick began working in Pasadena as a contractor with his father and in 1889 he apprenticed with T. William Parkes, a member of the Royal Institute of British Architects. In 1891, he married Daisy Russell, a first cousin of Frederick Russell Burnham. After completing his apprenticeship, Blick and Lester S. Moore founded their own architecture firm, Blick & Moore, in Los Angeles in 1895, where he continued to work until his retirement in 1937. Several of his commercial buildings and residences have been listed with the National Register of Historic Places."},{"page_url":"https://ja.wikipedia.org/wiki/%E3%83%92%E3%83%AD_(%E3%83%8F%E3%83%AF%E3%82%A4%E5%B7%9E)","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/cd/Hilo_bay.jpg","page_title":"ヒロ (ハワイ州)","context_page_description":"ヒロ は、アメリカ合衆国ハワイ州ハワイ島の東海岸の都市で、同島最大の町である。2000年現在の国勢調査によると総人口40,759人である。ヒロはまたハワイ郡を伝統的なモクにより6地区に分けた時の名称「ヒロ地区」でもあり、最近は「北ヒロ地区」と「南ヒロ地区」に分かれている。\\nヒロはハワイ郡の郡庁所在地であり、東海岸の南ヒロ地区に位置している。ヒロはホノルルに次ぐハワイ諸島第二の港湾都市であり、ハワイ島西海岸のコナと共にリゾート地としても知られている。\\n地名について定説はないが、「新月の最初の夜」か、あるいは「ポリネシア人の航海者」にちなんで命名されたものであろうといわれる。ヒロは数千種類のランの栽培地としても知られ、「果樹園の町」または「ハワイのランの中心地」の異名がある。日系人も多く居住し、市内には日本庭園で知られるリリウオカラニ公園やカメハメハ大王像があるワイロア川州立公園もある。"},{"page_url":"https://ru.wikipedia.org/wiki/%D0%93%D0%BE%D1%81%D1%83%D0%B4%D0%B0%D1%80%D1%81%D1%82%D0%B2%D0%B5%D0%BD%D0%BD%D1%8B%D0%B9_%D0%BC%D1%83%D0%B7%D0%B5%D0%B9_%D0%B8%D0%B7%D0%BE%D0%B1%D1%80%D0%B0%D0%B7%D0%B8%D1%82%D0%B5%D0%BB%D1%8C%D0%BD%D1%8B%D1%85_%D0%B8%D1%81%D0%BA%D1%83%D1%81%D1%81%D1%82%D0%B2_%D0%B8%D0%BC%D0%B5%D0%BD%D0%B8_%D0%90._%D0%A1._%D0%9F%D1%83%D1%88%D0%BA%D0%B8%D0%BD%D0%B0","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/38/Pushkin_museum_-_19th_and_20th_Century_European_and_American_Art_-_building_01_by_shakko.jpg","page_title":"Государственный музей изобразительных искусств имени А. С. Пушкина","context_page_description":"Госуда́рственный музе́й изобразительных иску́сств и́мени А. С. Пу́шкина — московский музей зарубежного искусства, основанный профессором Московского университета Иваном Цветаевым в 1912 году. Здание музея было построено по проекту архитектора Романа Клейна в неоклассическом стиле в виде античного храма. Изначально музей был задуман как учебный, однако после революции 1917 года учреждение было преобразовано в Государственный музей изобразительных искусств. В 1937-м музей получил имя поэта Александра Пушкина. В 1991 году ГМИИ имени Пушкина внесли в Государственный свод особо ценных объектов культурного наследия народов России.\\nПо состоянию на 2018 год экспозиция состоит из более чем 700 тысяч предметов и включает в себя коллекцию слепков с античных статуй, художественные произведения, археологические находки, а также собрание предметов из Древнего Египта и Древнего Рима.\\nВ 2018 году музей посетили 1,3 млн человек, благодаря чему он занял 47-е место в числе самых посещаемых художественных музеев мира."},{"page_url":"https://ar.wikipedia.org/wiki/%D9%85%D8%A7%D8%B1%D9%83_%D8%A5%D9%85._%D8%AF%D9%8A%D9%81%D9%8A%D8%B2","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/90/Professor_Mark_Davis_ForMemRS.jpg","page_title":"مارك إم. ديفيز","context_page_description":"مارك إم. ديفيز ‏‏ عالم أحياء جزيئية، وأستاذ جامعي، وعالم مناعة من الولايات المتحدة."},{"page_url":"https://de.wikipedia.org/wiki/Marie_B%C3%A4umer","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0d/Grimme-Preis_2011_-_Marie_B%C3%A4umer_1.JPG","page_title":"Marie Bäumer","context_page_description":"Henrike Marie Bäumer ist eine deutsche Theater- und Filmschauspielerin."},{"page_url":"https://ca.wikipedia.org/wiki/Cos_de_pau_estatunidenc","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b5/Peace_Corps_headquarters.JPG","page_title":"Cos de pau estatunidenc","context_page_description":"El Cos de Pau és una agència federal independent dels Estats Units. Va ser establerta pel Decret Llei 10.924 l'1 de març de 1961 i va ser autoritzada pel Congrés el 22 de setembre del mateix any en aprovar l'Acta del Cos de Pau. L'Acta del Cos de Pau declara que el seu propòsit és:\\n\\"Promoure la pau i l'amistat mundial a través del Cos de Pau, el qual farà disponible per als països i àrees interessats als homes i les dones nord-americanes que estiguin disposats a servir i estiguin capacitats per treballar a l'estranger, sota condicions difícils si cal, i ajudar a les persones d'aquests països i àrees a satisfer les seves necessitats de mà d'obra qualificada. \\"\\nDes de 1960, més de 187.000 persones han treballat com a voluntaris del Cos de Pau a 139 països.\\nEl president Barack Obama va nomenar a Aaron Williams com a director el 14 de juliol de 2009. Williams era anteriorment el vicepresident d'una empresa de desenvolupament internacional, i voluntari del Cos de Pau en els anys 60, a la República Dominicana."},{"page_url":"https://pl.wikipedia.org/wiki/Pomniki_papie%C5%BCa_Jana_Paw%C5%82a_II","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/88/Pomnik_ko%C5%82o_Kaplicy_na_Groniu_Jana_Paw%C5%82a_II.jpg","page_title":"Pomniki papieża Jana Pawła II","context_page_description":"Pomniki Jana Pawła II – zespół memoratywnych dzieł wznoszonych dla upamiętnienia osoby i pontyfikatu Jana Pawła II w Polsce i poza jej granicami. Do momentu śmierci Jana Pawła II w Polsce powstało ponad 230 dzieł figuralnych. W okresie 2005-2009 kolejnych 300."},{"page_url":"https://de.wikipedia.org/wiki/Fu%C3%9Fball_in_Luxemburg","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/11/Baustelle_National-Stadion_Luxembourg_01.jpg","page_title":"Fußball in Luxemburg","context_page_description":"Fußball ist die beliebteste Sportart in Luxemburg. Es besteht ein Ligasystem, an dessen Spitze die BGL Ligue steht. In ihr wird der luxemburgische Fußballmeister ermittelt. Zugleich gibt es nationale Pokalwettbewerbe wie die Coupe de Luxembourg. Im Jahr 2016 waren rund 31.000 lizenzierte Spieler in 105 Vereinen aktiv."},{"page_url":"https://fr.wikipedia.org/wiki/%C3%89glise_Saint-Just_de_Lyon","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a2/%C3%89glise_Saint-Just_de_Lyon_-_Ch%C5%93ur_de_face.jpg","page_title":"Église Saint-Just de Lyon","context_page_description":"La Collégiale Saint-Just ou Saint-Just des Macchabées, située 41 rue des Farges, à Lyon, est la reconstruction d'une des plus anciennes églises de Lyon, dédiée comme elle à saint Just, le 13ᵉ évêque de la ville au IVᵉ siècle, bâtie sur l'ancienne nécropole romaine.\\nSa construction date du XVIᵉ siècle."},{"page_url":"https://pl.wikipedia.org/wiki/Pinot_noir","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0c/OV-pinot-noir.jpg","page_title":"Pinot noir","context_page_description":"Pinot noir, spätburgunder, pinot nero – czerwona odmiana winorośli wykorzystywana w przemyśle winiarskim. Nazwę stosuje się również do wina odmianowego wyprodukowanego z tego szczepu."},{"page_url":"https://en.wikipedia.org/wiki/Fifth_generation_of_video_game_consoles","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/02/N64-Console-Set.png","page_title":"Fifth generation of video game consoles","context_page_description":"The fifth-generation era refers to computer and video games, video game consoles, and handheld gaming consoles dating from approximately October 4, 1993 to March 23, 2006. For home consoles, the best-selling console was the Sony PlayStation, followed by the Nintendo 64, and then the Sega Saturn. The PlayStation also had a redesigned version, the PSone, which was launched on July 7, 2000.\\nFor handhelds, this era was characterized by significant fragmentation, because the first handheld of the generation, the Sega Nomad, had a lifespan of just two years, and the Nintendo Virtual Boy had a lifespan of less than one. Both of them were discontinued before the other handhelds made their debut. The Neo Geo Pocket was released on October 28, 1998, but was dropped by SNK in favor of the fully backwards-compatible Neo Geo Pocket Color just a year later. Nintendo's Game Boy Color was the winner in handhelds by a large margin. There were also two simply updated versions of the original Game Boy: Game Boy Light and Game Boy Pocket.\\nSome features that distinguished fifth generation consoles from previous fourth generation consoles include:\\n3D polygon graphics with texture mapping"},{"page_url":"https://ka.wikipedia.org/wiki/%E1%83%94%E1%83%9C%E1%83%A2%E1%83%9D%E1%83%9C%E1%83%98_%E1%83%93%E1%83%9D%E1%83%93_%E1%83%9B%E1%83%94%E1%83%9C%E1%83%A2%E1%83%9A%E1%83%98","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b5/Anthony_Dod_Mantle_photograph_by_Linh_Chameleon_%28cropped%29.jpg","page_title":"ენტონი დოდ მენტლი","context_page_description":"ენტონი დოდ მენტლი — ინგლისელი კინოოპერატორი. ოჯახთან ერთდ ცხოვრობს დანიაში, კოპენჰაგენში. არის ლარს ფონ ტრიერისა და დენი ბოილის ფილმების ოპერატორი. მიღებული აქვს ოსკარისა და BAFTA-ს ჯილდოები."},{"page_url":"https://de.wikipedia.org/wiki/Balthasar_Wolff","image_url":"http://upload.wikimedia.org/wikipedia/commons/a/ad/Hn-7roehrenbrunnen-2.jpg","page_title":"Balthasar Wolff","context_page_description":"Balthasar Wolff war ein deutscher Steinmetz und Baumeister.\\nDer 1522 erstmals erwähnte Baumeister erhielt im Jahre 1533 das Heilbronner Bürgerrecht. In Heilbronn gestaltete er 1534 den Käthchenhauserker mit den vier Brustbildern von vier jüdischen Propheten. 1541 erhielt er den Auftrag zur Gestaltung des Heilbronner Siebenröhrenbrunnens. Das am Tympanon des Brunnens befindliche Relief Christus und die Samariterin wurde jedoch nicht von Wolff geschaffen. In Heilbronn ist seit 1925 die Balthasar-Wolff-Straße nach ihm benannt.\\nAußerhalb von Heilbronn erbaute er mehrere Schlösser für die Freiherren von Gemmingen, gestaltete Schloss Neuenstein um und erweiterte Schloss Weilburg. Zudem baute er am Schloss Waldenburg sowie in Homburg und in Mainz."},{"page_url":"https://de.wikipedia.org/wiki/1557","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/71/Emperor_Ogimachi_cropped.jpg","page_title":"1557","context_page_description":"3. Februar: Kaiser Karl V. bezieht nach Fertigstellung sein an das Kloster von Yuste angebautes Refugium, wo er nach seiner Abdankung die letzten Monate seines Lebens zubringt.\\n11. Juni: Nach dem Tode Johanns III. folgt ihm sein Enkelsohn Sebastian auf den portugiesischen Thron. Der Dreijährige steht vorläufig unter der Vormundschaft seiner Großmutter Katharina von Kastilien.\\n24. Juli: Im Edikt von Compiègne droht der französische König Heinrich II. den Hugenotten mit der Gerichtsbarkeit, wenn sie die Ordnung stören.\\n10. August: Mit dem entscheidenden Sieg Spaniens in der Schlacht bei Saint-Quentin steht der jahrzehntealte Habsburgisch-Französische Konflikt vor seinem Ende."},{"page_url":"https://ca.wikipedia.org/wiki/Kali%C5%A1t%C4%9B","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/ff/Kaliste_PE_CZ_CoA.jpg","page_title":"Kaliště","context_page_description":"Kaliště és una vila i municipi a prop de Humpolec, a Okres Pelhřimov, a la regió de Vysočina, de la República Txeca. La seva població és de 330 habitants.\\nLa vila és esmentada per primera vegada com a propietat del Capítol de Vyšehrad el 1318. El poble és sobretot conegut per ser el lloc de naixement del compositor Gustav Mahler."},{"page_url":"https://sv.wikipedia.org/wiki/Tv%C3%A5_Systrars_kapell","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/98/Tv%C3%A5_systrars_kapell020.JPG","page_title":"Två Systrars kapell","context_page_description":"Två systrars kapell är en kyrkobyggnad i Kalmar i Växjö stift. Den är församlingskyrka i Två systrars församling."},{"page_url":"https://es.wikipedia.org/wiki/Mastrils","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8e/Reformierte_Kirche_Mastrils_1.jpg","page_title":"Mastrils","context_page_description":"Mastrils es una localidad y antigua comuna suiza del cantón de los Grisones, situada en el distrito de Landquart, círculo de los Fünf Dörfer.\\nDesde el 1 de enero de 2012 hace parte de la comuna de Landquart, tras su fusión con la comuna de Igis."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Baudenkm%C3%A4ler_in_R%C3%B6sberg","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/74/R%C3%B6sberg_Theisenkreuzweg_%2801%29.jpg","page_title":"Liste der Baudenkmäler in Rösberg","context_page_description":"Die Liste der Baudenkmäler in Rösberg enthält die denkmalgeschützten Bauwerke auf dem Gebiet von Bornheim-Rösberg in Nordrhein-Westfalen. Diese Baudenkmäler sind in der Denkmalliste der Stadt Bornheim eingetragen; Grundlage für die Aufnahme ist das Denkmalschutzgesetz Nordrhein-Westfalen."},{"page_url":"https://vi.wikipedia.org/wiki/Epimedium_pinnatum","image_url":"http://upload.wikimedia.org/wikipedia/commons/b/b4/Epimedium-pinnatum-foliage.jpg","page_title":"Epimedium pinnatum","context_page_description":"Epimedium pinnatum là một loài thực vật có hoa trong họ Hoàng mộc. Loài này được Fisch. ex DC. mô tả khoa học đầu tiên năm 1821."},{"page_url":"https://hu.wikipedia.org/wiki/K%C3%B3rh%C3%A1zhaj%C3%B3","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c7/090411-A-1786S-088_-_USNS_Comfort_%28T-AH-20%29_in_Hati.jpg","page_title":"Kórházhajó","context_page_description":"A kórházhajók olyan hajók, amelyeket háborúkban alkalmaztak a sérült katonák szállítására, ellátására. Rendszerint a legnagyobb hajókat alakították át kórházhajóvá, hogy minél több sebesültet legyenek képesek szállítani. A hajók oldalára vörös keresztet festettek, ezzel jelezték, hogy a hajó sebesülteket szállít.\\nA harci cselekmények megszűnte után számos kórházhajót más célokra építették át és továbbra is használatban maradtak."},{"page_url":"https://fr.wikipedia.org/wiki/La_Chapelle_(Ardennes)","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/88/La_Chapelle_%28Ardennes%29_-_la_Mairie_-_Photo_Francis_Neuvens_lesardennesvuesdusol.fotoloft.fr.JPG","page_title":"La Chapelle (Ardennes)","context_page_description":"La Chapelle est une commune française située dans le département des Ardennes, en région Grand Est."},{"page_url":"https://sh.wikipedia.org/wiki/Tampramin","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/bb/Tampramine.png","page_title":"Tampramin","context_page_description":"Tampramin je organsko jedinjenje, koje sadrži 27 atoma ugljenika i ima molekulsku masu od 472,536 Da."},{"page_url":"https://zh.wikipedia.org/wiki/%E9%92%99","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6c/Caflame.jpg","page_title":"钙","context_page_description":"鈣是一種化學元素。其化學符號是Ca，原子序數是20。鈣是銀白色的鹼土金屬，具有中等程度的延展性。雖然在地殼的含量也很高，為地殼中第五豐富的元素，占地殼總質量3%，因其化學活性頗高，可以和水或酸反應放出氫氣，或是在空氣中便可氧化，因此在自然界多以離子狀態或化合物形式存在，而沒有單質存在。\\n鈣屬於鹼土金屬，它的物理和化學性質與其較重的同族元素鋇和鍶相似。它是地殼中第五豐富的元素，占地殼總質量3%，也是地殼中第三豐富的金屬，僅次於鐵和鋁。地球上最常見的鈣化合物是碳酸鈣，發現於石灰岩和早期海洋生物的化石殘骸;石膏，硬石膏，螢石和磷灰石也是鈣的來源。該名稱源自拉丁語calx，可藉由加熱石灰石獲得。\\n雖然在很久以前就已經發現許多鈣的化合物，但是在十七世紀後，才開始對這些化合物的性質有更深一層的了解；純鈣直到西元1808年才由命名這個元素的漢弗里·戴維的藉由電解法分離出來。鈣化合物有廣泛的工業應用：作為食品工業中的額外添加物，在造紙工業中作為漂白劑的使用，作為水泥和絕緣體的原料，也使用在製作肥皂中。另一方面，純鈣因為高活性有一些獨特應用，少量的純鈣使用在鋼的煉製，鈣鉛合金也可以做汽車電池。在工業的主要礦物來源如石灰岩、石膏等，在建築、肥料、制鹼、和醫療上用途佷廣。\\n鈣是人體內最豐富的金屬元素及第五豐富的元素。作為電解質，鈣離子在生物體及細胞內的化學反應中扮演重要的角色:在細胞信息傳導的過程中，鈣離子作為第二信使系統的一份子；作為神經遞質，被神經元釋放；參與肌肉收縮的過程；它同時也是各種酵素與的輔因子；協助受精作用。鈣離子在細胞極化的過程中，負責維持細胞膜內外的電位差，並在成骨作用中扮演關鍵角色。"},{"page_url":"https://ja.wikipedia.org/wiki/%E3%82%B9%E3%83%A9%E3%82%A4%E3%82%B5%E3%83%BC","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/61/Meat_slicer.jpg","page_title":"スライサー","context_page_description":"スライサーとは、物を薄く切断するための機器類である。"},{"page_url":"https://it.wikipedia.org/wiki/Isole_Snares","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/ab/NZOffshoreIslandsMap.png","page_title":"Isole Snares","context_page_description":"Le Isole Snares sono un piccolo arcipelago che si trova circa 200 chilometri a sud dell'Isola del Sud, in Nuova Zelanda. Esse consistono dell'isola principale e delle più piccole Broughton Island e Western Chain, estendendosi su di un'area totale di circa 3,5 chilometri quadrati.\\nLe isole vennero cartografate per la prima volta nel 1791 da George Vancouver, che le battezzò The Snares perché considerava un azzardo tentare di avvicinarsi alla costa. I Māori conoscevano già le isole e il loro nome per la maggiore era Te Taniwha.\\nAl contrario di altre isole sub-antartiche, che vennero depredate nel corso del XIX secolo da pescatori e cacciatori di balene, le Isole Snares rimangono una delle poche zone ancora incontaminate della Nuova Zelanda. Anche per questa ragione, insieme alle Isole Auckland, Bounty, Campbell e Antipodi, le Isole Snares sono state inserite nel 1998 nell'elenco dei Patrimoni dell'umanità dell'UNESCO, col nome unitario di Isole sub-antartiche della Nuova Zelanda."},{"page_url":"https://fr.wikipedia.org/wiki/Si%C3%A8ge_de_Venlo_(1702)","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/16/Venlo_september_1702.jpg","page_title":"Siège de Venlo (1702)","context_page_description":"Le siège de Venlo a lieu durant la guerre de Succession d'Espagne : l'armée des alliés du duc de Marlborough prend Venlo après un siège de quelques semaines. Venlo, place forte située sur la rive droite du Rhin, appartient au Duché de Gueldre. Il s'agit de la seconde place forte prise pendant la campagne de 1702 dans les Pays-Bas espagnols."},{"page_url":"https://es.wikipedia.org/wiki/Ricardo_Rozzi","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4e/Sesiontallerfilosofiamabientaldecampo.jpg","page_title":"Ricardo Rozzi","context_page_description":"Ricardo Rozzi es un filósofo y biólogo chileno. Es profesor titular en la University of North Texas en EE. UU. y en la Universidad de Magallanes en Chile. Su investigación combina ambas disciplinas a través del estudio de las interrelaciones entre los modos de conocer y de habitar el mundo natural, proponiendo un feedback continuo y dinámico entre ambos dominios.​ En UNT su trabajo forma parte del Centro de Filosofía Ambiental Center for Environmental Philosophy, centro que lidera los programas de ética ambiental a nivel mundial. Con estas universidades y el Instituto de Ecología y Biodiversidad ha establecido el Programa de Conservación Biocultural Subantárctica, con su aproximación metodológica de la \\"filosofía ambiental de campo\\" y el marco conceptual de la \\"ética biocultural\\" que integra las ciencias ecológicas y la filosofía ambiental."},{"page_url":"https://de.wikipedia.org/wiki/Elmaubach","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4a/Lindertal_vom_P%C3%BCrschling142302.jpg","page_title":"Elmaubach","context_page_description":"Der Elmaubach ist ein Fließgewässer im Ammergebirge in Oberbayern, das in die Linder mündet und damit zum Flusssystem der Amper gehört."},{"page_url":"https://de.wikipedia.org/wiki/K%C3%B6nigreich_Italien_(1861%E2%80%931946)","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/78/Camera_dei_deputati_nel_1865.JPG","page_title":"Königreich Italien (1861–1946)","context_page_description":"Das Königreich Italien war ein Staat in Südeuropa, welcher von 1861 bis 1946 auf dem Gebiet der heutigen Italienischen Republik und Teilen derer Nachbarstaaten bestand. Während dieses Zeitraums war Italien eine zentralistisch organisierte, am monarchischen Prinzip ausgerichtete konstitutionell-parlamentarische Monarchie.\\nDie Gründung des Königreichs 1861 erfolgte im Zuge der Risorgimentobewegungen, in deren Endphase mit der Proklamation des sardischen Königs Viktor Emanuel II. zum König von Italien am 17. März 1861 in Turin der erste moderne italienische Nationalstaat unter der Herrschaft des Hauses Savoyen entstanden war. 1866 erklärte er dem Kaisertum Österreich den Krieg und erwarb Venetien mit Friaul. 1871 folgte der Kirchenstaat mit Rom, womit die italienischen Unabhängigkeitskriege endeten."},{"page_url":"https://pl.wikipedia.org/wiki/Patyczak_indyjski","image_url":"http://upload.wikimedia.org/wikipedia/commons/e/eb/Eierenklein.jpg","page_title":"Patyczak indyjski","context_page_description":"Patyczak indyjski – gatunek bezskrzydłego owada z rodziny Phasmatidae, przypominający kształtem patyk, koloru od brązowego do zielonego. Mierzy około 7-10 cm. Popularny jako zwierzę domowe.\\nPochodzenie\\nIndie\\nRozmnażanie\\nPłciowe oraz partenogenetyczne.\\nDługość życia\\nMłode patyczaki nimfy osiągają postać dorosłą po około 4 miesiącach. Postać dorosła żyje od pół do jednego roku.\\nPożywienie\\nLiście i zielone części roślin."},{"page_url":"https://it.wikipedia.org/wiki/Fortezza_di_Erivan","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/64/Wall_decoration_of_Erivan_Sardar_Palace.png","page_title":"Fortezza di Erivan","context_page_description":"La fortezza di Erivan è stata una fortezza del sedicesimo secolo situata a Erevan, l'attuale capitale dell'Armenia, sita in particolare sulla riva sinistra del fiume Hrazdan."},{"page_url":"https://zh.wikipedia.org/zh-sg/%E6%9D%BF%E6%A9%8B%E5%8D%80_(%E5%8F%B0%E7%81%A3)","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1e/Lin_Family_Mansion_and_Garden_2006-6-28_11-16-18_0048.jpg","page_title":"板橋區 (台灣)","context_page_description":"板桥区为台湾新北市的一个区，是新北市政府所在地，也是新北市首善之区。板桥在清领时期即为西边台北的重要商业聚集地，发展历史早。板桥林本源园邸为境内颇负盛名的名胜古迹，与近来快速发展的城市面貌相互呼应，形成新旧并蓄、宜古宜今的城市景致。\\n行政区划分为126里、2515邻，人口数高达55.7万，密度约2.41万人/km²，是新北市人口数最多、密度第三高的行政区，在全国368个乡、镇、县辖市、区之中，人口数居全国第一，密度则居全国第五；现为全国唯一符合省辖市人口数门槛的乡镇市区，且高于全国半数以上县市的人口数。"},{"page_url":"https://de.wikipedia.org/wiki/Torre_dei_Salassi","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/29/Torre_dei_Salassi_in_inverno_8.jpg","page_title":"Torre dei Salassi","context_page_description":"Der Torre dei Salassi oder Tour de la Ville de Cordèle oder das Casaforte di Pompiod ist ein verfallener, mittelalterlicher Turm im Ortsteil Pompoid der Gemeinde Jovençan im Aostatal. Er befindet sich an der Regionalstraße 20 zwischen Jovençan und Aymavilles."},{"page_url":"https://zh.wikipedia.org/zh-mo/%E5%BA%9A%E5%AD%90%E8%BE%9B%E4%BA%A5%E5%BF%A0%E7%83%88%E5%83%8F%E8%B5%9E","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/19/%E8%BD%BD%E7%A9%86.jpg","page_title":"庚子辛亥忠烈像赞","context_page_description":"庚子辛亥忠烈像讚是1934年馮恕輯的一部讚頌1900年庚子事變、1911年辛亥革命中殉難的清朝高級官員的書籍。該書每個人物前列遺像，後附小傳及贊。\\n該書第一冊收庚子殉難諸臣32位，第二冊收辛亥殉難諸臣36位，目錄以死節先後為次。\\n第一冊為《庚子殉難諸臣》，首許侍郎景澄，終布政使廷雍，補二人，翰林院編修王廷相，郎中春林，凡三十二人\\n第二冊為《辛亥殉難諸臣》，首田總兵徵葵，終軍諮使良弼，補二人，署廣東西寧縣馮汝楨，京口副都統載穆，凡三十六人。"},{"page_url":"https://nl.wikipedia.org/wiki/Natarajatempel","image_url":"http://upload.wikimedia.org/wikipedia/commons/4/49/Temple_Tangore_1.jpg","page_title":"Natarajatempel","context_page_description":"De Natarajatempel of Chidambaramtempel is een Hindoetempel in Chidambaram, Tamil Nadu, India.\\nDe tempel werd gebouwd uit enorme brokken graniet rond 1120 door Rajaraja II, het kleinkind van Rajaraja I.\\nDe tempel zou gevestigd zijn op de plaats waar Shiva zijn kosmische dans uitvoerde.\\nNet op die plek is er een bassin de Shivaganga. Dit is omgeven met trappen, kleine ruimtes.\\nHet bad werd gebruikt om zich ritueel te reinigen voordat met het heiligdom van Shiva inging.\\nNaast dit bassin zijn er dus ook nog heiligdommen. Eén daarvan is de Rajasabha, een zaal met duizend pilaren."},{"page_url":"https://az.wikipedia.org/wiki/Rus_poeziyas%C4%B1n%C4%B1n_g%C3%BCm%C3%BC%C5%9F_%C9%99sri","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/98/Alexander_Blok.jpeg","page_title":"Rus poeziyasının gümüş əsri","context_page_description":"Gümüş əsr - XX əsrin əvvəllərinə təsadüf edən rus poeziyası tarixindəki dövrün məcazi adı. Bu ad rus poeziyası tarixindəki \\"Qızıl dövr\\" adlanan illərlə bənzərlik təşkil etdiyi üçün verilmişdir. Termin müəllifliyinə filosof Nikolay Berdyayev, şairlər və tənqidçilər Nikolay Otsup, Vladimir Mayakovski iddia etmişdilər."},{"page_url":"https://pt.wikipedia.org/wiki/Alonso_Cano","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/01/Spain_Andalusia_Granada_BW_2015-10-25_13-20-43.jpg","page_title":"Alonso Cano","context_page_description":"Alonso Cano foi um pintor, arquiteto e escultor espanhol nascido em Granada. Durante toda a sua vida foi um demandista e os duelos estiveram sempre na ordem do dia. Em que pese ter ganho grandes quantidades de dinheiro, sempre esteve endividado, chegando a ser preso, ainda que seu amigo Juan del Castillo lhe tenha pago as dívidas.\\nSuas obras foram uma mescla entre o maneirismo italiano e o barroco. Seus desenhos foram o que mais se destacou da sua obra. Em uma época na qual dominava o tenebrismo, foi capaz de ser colorista em seus trabalhos, como Zurbarán, Sánchez Cotán e João Batista Mayno. Como escultor, suas obras mais famosas são o retábulo de Nossa Senhora da Oliveira na Igreja de Lebrija e as figuras colossais de São Pedro e São Paulo."},{"page_url":"https://zh.wikipedia.org/wiki/%E7%AC%AC42%E5%B1%8A%E4%B8%83%E5%9B%BD%E9%9B%86%E5%9B%A2%E4%BC%9A%E8%AE%AE","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/be/Justin_Trudeau_and_Benigno_Aquino_III_November_2015_cropped.jpg","page_title":"第42届七国集团会议","context_page_description":"第42届七国集团会议，别称伊势志摩峰会，于2016年5月26日至27日在日本三重县志摩市的志摩观光酒店召开。这是日本第六次主办工业国首脑峰会，同时也是俄罗斯于2014年被逐出八国集团后七国集团举办的第三次会议。"},{"page_url":"https://ru.wikipedia.org/wiki/%D0%A8%D0%BF%D0%B8%D1%86%D0%BA%D0%BE%D0%BF%D1%84","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/31/Spitzkopf.jpg","page_title":"Шпицкопф","context_page_description":"Шпицкопф — вершина в Вогезах, 1290 м в высоту, в 1 км южнее Онека.\\nДля альпинистов открыты два хребта Шпицкопфа: восточный и северный. Восточный предлагает безопасный подъём на 700 м, в то время как северный достигает 50°-60° крутизны."},{"page_url":"https://no.wikipedia.org/wiki/Vitenskaps%C3%A5ret_1634","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/66/Theater_of_Insects.jpg","page_title":"Vitenskapsåret 1634","context_page_description":"Vitenskapsåret 1634 er en oversikt over hendelser, prisvinnere, fødte og avdøde personer med tilknytning til vitenskap i 1634."},{"page_url":"https://ca.wikipedia.org/wiki/Corb%C3%A8ras_e_Avera","image_url":"http://upload.wikimedia.org/wikipedia/commons/7/70/Map_commune_FR_insee_code_64193.png","page_title":"Corbèras e Avera","context_page_description":"Corbèras e Avera és un municipi francès, situat al departament dels Pirineus Atlàntics i a la regió de la Nova Aquitània."},{"page_url":"https://hy.wikipedia.org/wiki/%D5%88%D6%82%D5%A1%D5%B5%D5%A4%D5%A5%D5%B6%D5%A5%D6%80%D5%AB_%D5%A3%D6%80%D5%A1%D5%A4%D5%A1%D6%80%D5%A1%D5%B6","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1b/HarryElkinsWidener_YearbookPhoto.jpg","page_title":"Ուայդեների գրադարան","context_page_description":"Հարրի Էլքինս Ուայդեների հուշարձան - գրադարանը, որը պարունակում է ավելի քան 3.5 միլիոն գրքեր իր \\"հսկա և քարայրանման\\" գրապահոցներում, Հարվարդ Քոլլեջի Գրադարաններից, և ընդհանրապես, ամբողջ Հարվարդի Գրադարանների Համակարգում ամենաշքեղն ու ամենաընդարձակն է։ Այն անվանվել է ի պատիվ Հարվարդի Քոլլեջի 1907թ․ շրջանավարտ և գրքերի կոլլեկցիոներ Հարրի Էլքինս Ուայդեների, և կառուցվել է իր մոր՝ Էլեանոր Էլքինս Ուայդեների կողմից այն բանից հետո, երբ իր որդին մահացավ 1912թ․՝ Տիտանիկի սուզման ժամանակ։\\nԳրադարանի ունեցվածքը, որն ընդգրկում է զանազան աշխատություններ ավելի քան հարյուր լեզվով, համարվում է \\"աշխարհի՝ հումանիտար և հասարակական գիտությունների հետազոտությունների ամենաամբողջական հավաքածուներից մեկը\\"։ Գրադարանի 92 կիլոմետրանոց գրադարակները երեք մակարդակներում 8 կիոլմետրանոց միջանցքների հետ միասին կազմում են մի լաբիրինթոս, որը աշակերտը \\"երբեք չի կարող հաղթահարել առանց կողմնացույցի, սենդվիչի և սուլիչի\\"։"},{"page_url":"https://ru.wikipedia.org/wiki/%D0%A5%D1%80%D0%B0%D0%BC%D1%8B_%D0%9F%D1%81%D0%BA%D0%BE%D0%B2%D1%81%D0%BA%D0%BE%D0%B9_%D0%BE%D0%B1%D0%BB%D0%B0%D1%81%D1%82%D0%B8","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6f/Nieviel%2C_Rynak%2C_Franci%C5%A1kanski._%D0%9D%D0%B5%D0%B2%D0%B5%D0%BB%D1%8C%2C_%D0%A0%D1%8B%D0%BD%D0%B0%D0%BA%2C_%D0%A4%D1%80%D0%B0%D0%BD%D1%86%D1%96%D1%88%D0%BA%D0%B0%D0%BD%D1%81%D0%BA%D1%96_%281942%29.jpg","page_title":"Храмы Псковской области","context_page_description":"Боровик. Церковь Покрова Богородицы.\\nВыбуты. Церковь Ильи Пророка. Погост у села Раздолье на левом берегу реки Великой в 16 км выше Пскова.\\nКусва. Церковь Мины, Виктора и Викентия. Погост на левом берегу Великой в 8 км ниже Пскова.\\nНёготь. Погост в Писковичах на правом берегу Великой в 8 км ниже Пскова. Церковь Апостола Матфея.\\nУстье. На левом берегу реки Великой в 18 км ниже Пскова. Церковь Николы с Устья. Реставрация проведена в 1956—1961 гг. по проекту арх. Скобельцына Б. С.\\nд. Остров имени Белова. Церковь Петра и Павла. XVI вв. Памятник истории и культуры.\\nд. Остров-Залит. Церковь Николы Чудотворца. XVI в.\\nКривовицы. Погост Кривовицы в 12 км от Пскова по Гдовской дороге. Церковь Ильи Пророка. Памятник истории и культуры.\\nЕлизарово. Спасо-Елеазаров монастырь. Действующий женский. Настоятельница: игуменья Елисавета 2000—2010 гг.\\nМаслогостицы Церковь Николая Чудотворца\\nКрыпецы. Крыпецкий монастырь. Действующий мужской. Подворье: Псков, собор Иоанна Предтечи Ивановского монастыря.\\nМелётово. Церковь Успения Пресвятой Богородицы. Памятник истории и культуры. Филиал Псковского государственного историко-архитектурного и художественного музея-заповедника."},{"page_url":"https://de.wikipedia.org/wiki/Kernkraftwerk_Neckarwestheim","image_url":"http://upload.wikimedia.org/wikipedia/commons/5/51/GKN_Maschine_retouched.jpg","page_title":"Kernkraftwerk Neckarwestheim","context_page_description":"Das Kernkraftwerk Neckarwestheim in Neckarwestheim in Baden-Württemberg, Deutschland mit zwei Druckwasserreaktoren wird vom EnBW-Tochterunternehmen EnBW Kernkraft GmbH mit Sitz in Obrigheim betrieben."},{"page_url":"https://en.wikipedia.org/wiki/Hoppo","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/68/Customs_House_and_Hoppo%27s_Headquarters_at_Canton.gif","page_title":"Hoppo","context_page_description":"Hoppo or Administrator of the Canton Customs, was the Qing dynasty official at Guangzhou given responsibility by the emperor for controlling shipping, collecting tariffs, and maintaining order among traders in and around the Pearl River Delta from 1685 to 1904.\\nInitially, the Hoppo was always a Manchu and a bondservant of the imperial family, appointed personally by the emperor, not a scholar-official chosen through the exams, but after the mid-18th century this expectation was relaxed. Since he depended on the good will of emperor and the Imperial Household Department, the Hoppo could be trusted to send revenues directly to the court rather than through the normal bureaucratic channels. In the mid-18th century the Qianlong emperor approved the Canton system, which restricted the burgeoning overseas trade with Europeans to Canton and granted a monopoly on that trade to Chinese merchants, who formed the Thirteen Hongs. European governments likewise granted monopolies to their trading companies, such as the British East India Company."},{"page_url":"https://sv.wikipedia.org/wiki/Frigento","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6c/Frigento_2018.png","page_title":"Frigento","context_page_description":"Frigento är en kommun i provinsen Avellino, i regionen Kampanien. Kommunen hade 3 663 invånare och gränsar till kommunerna Carife, Flumeri, Gesualdo, Grottaminarda, Guardia Lombardi, Rocca San Felice, Sturno samt Villamaina."},{"page_url":"https://en.wikipedia.org/wiki/Dougga","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/53/Temple_aux_six_colonnes_03.jpg","page_title":"Dougga","context_page_description":"Dougga or Thugga or TBGG was a Berber, Punic and Roman settlement near present-day Téboursouk in northern Tunisia. The current archaeological site covers 65 hectares. UNESCO qualified Dougga as a World Heritage Site in 1997, believing that it represents \\"the best-preserved Roman small town in North Africa\\". The site, which lies in the middle of the countryside, has been protected from the encroachment of modern urbanization, in contrast, for example, to Carthage, which has been pillaged and rebuilt on numerous occasions. Dougga's size, its well-preserved monuments and its rich Numidian-Berber, Punic, ancient Roman and Byzantine history make it exceptional. Amongst the most famous monuments at the site are a Libyco-Punic Mausoleum, the Capitol, the Roman theatre, and the temples of Saturn and of Juno Caelestis."},{"page_url":"https://zh.wikipedia.org/wiki/%E5%B8%83%E8%B3%B4%E6%81%A9%C2%B7%E4%BC%AF%E5%85%8B","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/55/Bryanburk.jpg","page_title":"布賴恩·伯克","context_page_description":"布賴恩·伯克是一名美国电影与电视制作人。\\n在南加州大学的电影电视学院毕业后，布賴恩·伯克开展了和哥伦比亚片场的Brad Weston、索尼片场的斯内德·泰惀和福克斯广播公司的约翰·戴维斯的合作关系。在1995年，他加入了Gerber pictures，他在那里发展了TNT获得艾美奖提名的\\"James Dean,\\"并现在参与制作\\"NFL: A Love Story.\\"\\n他与J·J·艾布拉姆斯合作并制作出一些电视节目如《双面女间谍》、《6ﾟ接触》、《What About Brian》、《迷失》和《西部世界》。他也和亚伯拉罕合作制作了《星际迷航》和《苜蓿地》。\\n2011年，他参与监制电影《不可能的任务：鬼影行动》。"},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_denkmalgesch%C3%BCtzten_Objekte_in_Wien/Innere_Stadt/Hi%E2%80%93K","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4b/Wien10K%C3%A4rntnerstrasse32.JPG","page_title":"Liste der denkmalgeschützten Objekte in Wien/Innere Stadt/Hi–K","context_page_description":"Die Liste der denkmalgeschützten Objekte in Wien/Innere Stadt enthält die 791 denkmalgeschützten, unbeweglichen Objekte des 1. Wiener Gemeindebezirks Innere Stadt."},{"page_url":"https://el.wikipedia.org/wiki/%CE%91%CE%BD%CF%84%CF%8C%CE%BD%CE%B9%CE%BF_%CE%9A%CE%B1%CE%BD%CF%8C%CE%B2%CE%B1","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f5/Antonio_canova%2C_socrate_salva_alcibiade_nella_battaglia_di_potidea%2C_1797%2C_gesso_01.JPG","page_title":"Αντόνιο Κανόβα","context_page_description":"Ο Αντόνιο Κανόβα ήταν Ιταλός γλύπτης, ο σημαντικότερος εκπρόσωπος του νεοκλασσικισμού στην γλυπτική."},{"page_url":"https://cs.wikipedia.org/wiki/Stij","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ef/Stiy_mountain.JPG","page_title":"Stij","context_page_description":"Stij je hora na Ukrajině v Zakarpatské oblasti, nejvyšší vrchol pohoří Boržavy které je součástí Poloninského hřbetu. Nadmořská výška vrcholu je 1681 metrů.\\nLeží asi 10 kilometrů jižně od města Volovec a 40 km severovýchodním směrem od Mukačeva. Na východním svahu hory pramení řeka Boržava.\\nNa odlesněném vrcholu byly za druhé světové války postaveny tři radarové stanice určené pro sledování širokého okolí. Radary po několik desetiletí využívala Rudá armáda; rozebrány byly roku 1995. Jejich přítomnost dosud připomínají chátrající betonové plošiny a ocelové výztuže."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%9A%D1%80%D0%BE%D0%BD%D1%88%D1%82%D0%B0%D0%B4%D1%82%D1%81%D0%BA%D0%B0%D1%8F_%D0%BA%D1%80%D0%B5%D0%BF%D0%BE%D1%81%D1%82%D0%BD%D0%B0%D1%8F_%D0%B6%D0%B5%D0%BB%D0%B5%D0%B7%D0%BD%D0%B0%D1%8F_%D0%B4%D0%BE%D1%80%D0%BE%D0%B3%D0%B0","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/17/%D0%A4%D1%80%D0%B0%D0%B3%D0%BC%D0%B5%D0%BD%D1%82_%D0%B7%D0%B4%D0%B0%D0%BD%D0%B8%D1%8F_%D0%BC%D0%B0%D1%81%D1%82%D0%B5%D1%80%D1%81%D0%BA%D0%B8%D1%85_%28%D0%94%D0%B5%D0%BF%D0%BE%3F%29_%D0%BE%D0%BA%D0%BE%D0%BB%D0%BE_%D0%B1%D1%8B%D0%B2%D1%88%D0%B5%D0%B9_%D1%81%D1%82%D0%B0%D0%BD%D1%86%D0%B8%D0%B8_%22%D0%93%D0%BE%D1%80%D0%BE%D0%B4%22.JPG","page_title":"Кронштадтская крепостная железная дорога","context_page_description":"Кронштадтская крепостная железная дорога — это железнодорожная сеть, существовавшая на острове Котлин с 1860-х годов до конца XX века и выполнявшая транспортные функции на территории Кронштадтской крепости."},{"page_url":"https://ast.wikipedia.org/wiki/Zazuar","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/48/Bodega_e_iglesia_de_San_Andr%C3%A9s.jpg","page_title":"Zazuar","context_page_description":"Zazuar ye una llocalidá y un conceyu asitiaos na provincia de Burgos, comunidá autónoma de Castiella y Llión, contorna de La Ribera, partíu xudicial d'Aranda, conceyu del mesmu nome."},{"page_url":"https://vi.wikipedia.org/wiki/%C4%90%C3%A0i_t%C6%B0%E1%BB%9Fng_ni%E1%BB%87m_chi%E1%BA%BFn_s%C4%A9_tr%E1%BA%ADn_vong_(Hu%E1%BA%BF)","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/76/Bia_Chien_si_tran_vong4.jpg","page_title":"Đài tưởng niệm chiến sĩ trận vong (Huế)","context_page_description":"Đài tưởng niệm chiến sĩ trận vong tại Huế còn được gọi là Bia Quốc Học, toạ lạc sát bờ nam sông Hương, trước mặt trường Quốc Học. Công trình này được xây vào đầu thế kỷ 20 để tưởng niệm những binh sĩ người Pháp và người Việt ở Trung kỳ đã bỏ mạng vì sự nghiệp giúp nước Pháp đánh Đức trong chiến tranh thế giới lần thứ nhất."},{"page_url":"https://el.wikipedia.org/wiki/%CE%A7%CE%B1%CF%83%CE%AC%CE%BD_%CE%A0%CF%81%CE%AF%CF%83%CF%84%CE%B9%CE%BD%CE%B1","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9a/Shkup1912.jpg","page_title":"Χασάν Πρίστινα","context_page_description":"Ο Χασάν Πρίστινα, αρχικά γνωστός ως Χασάν Μπερίσα, ήταν Αλβανός πολιτικός, ο οποίος υπηρέτησε ως ο 8ος Πρωθυπουργός της Αλβανίας τον Δεκέμβριο του 1921."},{"page_url":"https://fr.wikipedia.org/wiki/Giovanni_Antonio_Benvenuti","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b4/Podesti_ritratto_del_cardinale_Benvenuti.JPG","page_title":"Giovanni Antonio Benvenuti","context_page_description":"Giovanni Antonio Benvenuti né le 15 mai 1765 à Belvedere Ostrense, dans l'actuelle province d'Ancône, dans les Marches, alors dans les États pontificaux, et mort le 14 novembre 1838 à Osimo est un cardinal italien du XIXᵉ siècle."},{"page_url":"https://en.wikipedia.org/wiki/Moran_Building","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/70/Moran_Building.jpg","page_title":"Moran Building","context_page_description":"The Moran Building is an historic Second Empire style building, located at 501-509 G Street, Northwest, Washington, D.C.. It was listed on the National Register of Historic Places in 1983 for its architecture. The building was then vacant."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%9F%D0%BB%D1%8F%D0%B6%D0%B8_%D0%9F%D1%80%D0%B0%D0%B4%D0%BE","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9c/Mistral_gagnant_Plages_du_Prado%2C_Marseille.jpg","page_title":"Пляжи Прадо","context_page_description":"Пляжи Прадо́ — пляжи, расположенные на побережье Средиземного моря в городе Марсель. Созданы искусственно, в 1970 году, в виде насыпей из строительного мусора, вырабатываемого при строительстве Марсельского метрополитена. Пляжи возводились с целью ограждения от моря прибрежной пешеходной и автомобильной дорог, страдавших от стихии при штормах и сильном ветре со стороны моря. С другой стороны с помощью этих насыпей от впадения в море огораживался сток вод реки Ивон, являвшейся на тот момент одной из самых загрязненных во Франции. Позже на месте искусственно созданной бухты были выстроены одни из самых больших в Европе водоочистительных сооружений. В большинстве своем пляжи имеют гравийное покрытие.\\nВ 2008 году на территории пляжей были возведены площадки для пляжного футбола, на которых был проведен Чемпионат мира по этому виду спорта, впервые — за пределами Бразилии. Вместимость главной арены состязаний составила 8 500 зрительных мест.\\nТакже на пляже Прадо проходит один из этапов кубка мира по пляжному волейболу."},{"page_url":"https://az.wikipedia.org/wiki/Kral_saray%C4%B1_(Kazerta)","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/01/Reggia_di_Caserta4.jpg","page_title":"Kral sarayı (Kazerta)","context_page_description":"Kral Sarayı Kazertada — Neapol Krallığının Burbones üçün keçmiş kral iqamətgahı idi. XVIII əsrdə Avropada yüksələn ən geniş saray və bəlkə də ən geniş quruluş hesab edilirdi. 1996-cı ildə Caserta Sarayı Ümumdünya İrs Siyahısına daxil edildi."},{"page_url":"https://de.wikipedia.org/wiki/Brenouille","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/44/Brenouille_%2860%29%2C_la_mairie%2C_rue_Robert-Guerlin_1.JPG","page_title":"Brenouille","context_page_description":"Brenouille ist eine französische Gemeinde mit 2.016 Einwohnern im Département Oise in der Region Hauts-de-France. Sie gehört zum Arrondissement Clermont und zum Kanton Pont-Sainte-Maxence. Brenouille gehört zum Gemeindeverband Communauté de communes des Pays d’Oise et d’Halatte. Die Einwohner werden Brenouillois genannt."},{"page_url":"https://sv.wikipedia.org/wiki/Ayaan_Hirsi_Ali","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f8/Ayaan_Hirsi_Ali_by_Gage_Skidmore.jpg","page_title":"Ayaan Hirsi Ali","context_page_description":"Ayaan Hirsi Ali, fullständigt namn Ayaan Hirsi Magan Isse Guleid Ali Wai'ays Muhammad Ali Umar Osman Mahamud, född 13 november 1969 i Mogadishu, är en somalisk-nederländsk-amerikansk aktivist, författare samt tidigare politiker och parlamentsledamot för Nederländernas högerliberala parti VVD mellan 2002 och 2003. Sedan 2006 är hon bosatt i USA och knuten till American Enterprise Institute i Washington DC. Hennes senaste bok släpptes 2015 och heter: Reformera islam."},{"page_url":"https://sv.wikipedia.org/wiki/Lepidophora","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/88/Lepidophora_lepidocera.jpg","page_title":"Lepidophora","context_page_description":"Lepidophora är ett släkte av tvåvingar. Lepidophora ingår i familjen svävflugor.\\nKladogram enligt Catalogue of Life:"},{"page_url":"https://ru.wikipedia.org/wiki/%D0%9B%D1%83%D0%B1%D0%BE%D0%BA","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b8/%D0%9B%D1%83%D0%B1%D0%BE%D0%BA_%D0%9A%D0%B0%D0%BA_%D0%BC%D1%8B%D1%88%D0%B8_%D0%BA%D0%BE%D1%82%D0%B0_%D1%85%D0%BE%D1%80%D0%BE%D0%BD%D0%B8%D0%BB%D0%B8.png","page_title":"Лубок","context_page_description":"Лубо́к — вид графики, изображение с подписью, отличающееся простотой и доступностью образов. Первоначально вид народного творчества. Выполнялся в технике ксилографии, гравюры на меди, литографии и дополнялся раскраской от руки.\\nДля лубка характерны простота техники, лаконизм изобразительных средств. Часто в лубке содержится развернутое повествование c пояснительными надписями и дополнительные к основному изображения."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%A1%D0%B0%D1%82%D1%83%D1%80%D0%BD_(%D0%BF%D1%80%D0%B5%D0%BC%D0%B8%D1%8F,_1981)","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9a/%D0%9D%D0%B5%D1%82_%D1%84%D0%BE%D1%82%D0%BE.png","page_title":"Сатурн (премия, 1981)","context_page_description":"8-я церемония вручения наград премии «Сатурн» за заслуги в области фантастики, фэнтези и фильмов ужасов за 1980 год состоялась в 1981 году, в США."},{"page_url":"https://en.wikipedia.org/wiki/Dedicated_to_Bobby_Jameson","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/09/Ariel_Pink_---_Bluebird_Theater_---_10.24.17_%2837902997922%29.jpg","page_title":"Dedicated to Bobby Jameson","context_page_description":"Dedicated to Bobby Jameson is the eleventh studio album by American recording artist Ariel Pink, released on September 15, 2017, through Mexican Summer. It is the follow-up to 2014's pom pom and features a narrative Pink described in a press release as \\"a battery of tests and milestones, the first of which sees him [the protagonist] reborn into life out of death.\\" It peaked at number 193 on the Billboard 200 and received generally positive reviews from music critics.\\nThe album was named in honor of Bobby Jameson, a 1960s singer-songwriter who retreated from the music industry after a series of misfortunes. In 2007, Jameson resurfaced with an autobiographical blog that alleged wrongdoing on the part of various managers and record company agents, which he maintained until his passing in 2015. Pink said that Jameson's \\"life resonated with me to such a degree that I felt a need to dedicate my latest record to him.\\" Three singles were issued in advance of the album's release: \\"Another Weekend\\", \\"Time to Live\\", and \\"Feels Like Heaven\\"."},{"page_url":"https://sv.wikipedia.org/wiki/Inger_Berggr%C3%A9n","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6f/Hultsbergsskolan5.JPG","page_title":"Inger Berggrén","context_page_description":"Inger Berggrén född Ryberg 4 april 1943 i Göteborg, är en svensk arkitekt i huvudsak verksam i Värmland där hon var länsarkitekt 1992-2005.\\nEfter studentexamen i Göteborg 1963 följde arkitektstudier vid Chalmers Tekniska Högskola. Under studietiden hade hon praktiserat hos Per Lagergren som var stadsarkitekt i Karlstad, och hit flyttade hon också efter examen 1967 för arbete på Havstad, Hollström och Lindells arkitektkontor. 1970 började hon arbeta på Skanark under Janne Feldts ledning, där senare blev delägare. I arkitektbyråns uppdrag ingick stadsarkitektstjänster som konsultuppdrag hon verkade härigenom som stadsarkitekt i Kil, Hammarö och Storfors kommuner. 1992 bytte hon tjänst och blev länsarkitekt i Värmland, ett uppdrag hon hade till 2005.\\nHon har skrivit flertalet böcker med anknytning till arkitektyrket, ibland tillsammans med maken Per Berggrén."},{"page_url":"https://fi.wikipedia.org/wiki/Stadler_Flirt","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0e/STA-Flirt_Suedtirol_Bahn.jpg","page_title":"Stadler Flirt","context_page_description":"Stadler Flirt on Stadler Railin valmistama sähkö- tai dieselmoottorikäyttöinen junayksikkö. Muun muassa suomalaisen Pääkaupunkiseudun Junakaluston tilaamat uudet Sm5-kaupunkijunat ovat Flirtejä. Stadler Flirt koostuu kahdesta junan päissä sijaitsevasta päätyvaunusta ja 0–4:stä päätyvaunujen välissä sijaitsevasta välivaunusta. Flirtille tunnusomaisia piirteitä ovat rakenteen keveys ja Jakobsin telit. Juna on suunniteltu keskipitkän ja lyhyen matkan liikennöintiin, mutta niitä on toimitettu hyvin erilaisiin käyttötarkoituksiin. Junia on käytössä useissa Euroopan maissa ja Afrikassa. Pääkaupunkiseudun junakalustoyhtiön lisätilaus Suomeen syksyllä 2014 nosti tilattujen Flirtien määrän yli tuhanteen junayksikköön."},{"page_url":"https://fa.wikipedia.org/wiki/%D9%BE%D8%AA%D8%A7%D8%B3%DB%8C%D9%85_%D9%85%D9%86%DA%AF%D9%86%D8%A7%D8%AA","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f7/Potassium-manganate-unit-cell-3D-balls.png","page_title":"پتاسیم منگنات","context_page_description":"پتاسیم منگنات ترکیبی معدنی با فرمول شیمیایی K₂MnO₄ است."},{"page_url":"https://en.wikipedia.org/wiki/Elizaveta_Kazelina","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/33/WSDSSC_Kolomna_2016_-_Kazelina_2.JPG","page_title":"Elizaveta Kazelina","context_page_description":"Elizaveta Sergeyevna Kazelina is a Russian speed skater, bronze medalist in single distance at the 2016 World Single Distance Speed Skating Championships. Kazelina is Master of Sports of Russia. Her coaches are her parents Olga and Sergey. Her twin brother Mikhail Kazelin is also a speed skater."},{"page_url":"https://hr.wikipedia.org/wiki/Jugozapadni_tai_jezici","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0e/Lenguas_Tai_suroccidentales.png","page_title":"Jugozapadni tai jezici","context_page_description":"Jugozapadni tai jezici, jugozapadni ogranak jezične skupine tai raširenih po Vijetnamu, Tajlandu, Indiji, Burmi, Laosu i Kini. Obuhvaća jezika unutar nekoliko užih skupina to su:\\na. Istočni Centralni ili Chiang Saeng: phuan [phu], tai daeng [tyr], tai dam [blt], tai dón [twh], tai hang tong [thc], tày tac [tyt], thai [tha], thai song [soa], sjeverni thai [nod], thu lao [tyl]\\nb. Lao-Phutai: lao [lao], nyaw [nyw], phu thai [pht], Sjeveroistočni thai [tts]\\nc. Sjeveozapadni: ahom [aho], aiton [aio], khamti [kht], khamyang [ksu], khün [kkh], lü [khb], phake [phk], shan [shn], tai nüa [tdd]\\nd. Južni: Thai, Južni [sou]\\ne. Neklasificirani: tai hongjin [tiz], yong [yno]\\npa di [pdi],\\npu ko [puk]\\ntai long [thi],\\ntai thanh [tmm],\\ntai ya [cuu],\\ntày sa pa [tys]"},{"page_url":"https://es.wikipedia.org/wiki/Especies_vivientes_de_Primates_del_Cono_Sur","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fd/Callithrix_penicillata.jpg","page_title":"Especies vivientes de Primates del Cono Sur","context_page_description":"El Cono Sur es el área más meridional del continente americano que, como una gran península, define el sur del subcontinente de Sudamérica.\\nEn este anexo el área que el mismo comprende es la referida más habitualmente a este concepto, es decir: todas las superficies americanas de la Argentina, Chile, Paraguay, y Uruguay, más la región Sur de Brasil formada por tres estados: Paraná, Río Grande del Sur y Santa Catarina.\\nLos primates son el orden de mamíferos al que pertenecen el hombre y sus parientes más cercanos. El orden Primates se divide en dos subórdenes, estrepsirrinos, y haplorrinos, que incluye a los tarseros, los monos, los grandes simios y los humanos. Los platirrinos o monos del nuevo mundo son un parvorden que comprende a las cinco familias de primates nativas de América Central y del Sur: Cebidae, Aotidae, Pitheciidae, Atelidae y Callitrichidae ahora reconocidas.​ La región neotropical es muy rica en especies de Primates, contando con 19 géneros, y 139 especies, con un total de taxas de 199.​\\nEn el Cono Sur se hacen presentes las 5 familias, con un total de 16 taxas y 15 especies, siendo 3 de ellas introducidas."},{"page_url":"https://zh-min-nan.wikipedia.org/wiki/Shushensky_Ko%C4%81n","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b9/%D0%A0%D0%B0%D0%BD%D0%BD%D1%8F%D1%8F_%D0%BE%D1%81%D0%B5%D0%BD%D1%8C%D0%B2_%D0%93%D0%BE%D1%80%D0%BD%D0%BE%D0%BC_%D0%BB%D0%B5%D1%81%D0%BD%D0%B8%D1%87%D0%B5%D1%81%D1%82%D0%B2%D0%B5.jpg","page_title":"Shushensky Koān","context_page_description":"Shushensky Koān sī Lō͘-se-a Liân-pang Krasnoyarsk Pian-kiong-khu ê chi̍t ê koān."},{"page_url":"https://it.wikipedia.org/wiki/Concerti_per_clavicembalo_di_Johann_Sebastian_Bach","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/16/BWV_1060.jpg","page_title":"Concerti per clavicembalo di Johann Sebastian Bach","context_page_description":"I concerti per clavicembalo di Johann Sebastian Bach sono una serie di tredici composizioni per clavicembalo solista, orchestra d'archi e basso continuo.\\nÈ possibile ordinare queste composizioni secondo il numero di clavicembali solisti:\\n- sette volte il solista è un unico clavicembalo;\\n- tre volte i solisti sono due clavicembali;\\n- due volte i solisti sono tre clavicembali;\\n- una sola volta i solisti sono quattro clavicembali.\\nAnche altri due concerti al di fuori di questo elenco includono parti per clavicembalo solista:\\n- il concerto BWV 1044, che ha parti solistiche per clavicembalo, violino e flauto;\\n- il Quinto Concerto Brandeburghese, BWV 1050. Anche in questo caso il clavicembalo fa parte di un trio di solisti completato da un violino e da un flauto.\\nInoltre esiste un frammento di nove battute di un concerto per clavicembalo solista, catalogato come BWV 1059, con oboe, archi e continuo.\\nTutti questi concerti, a eccezione del BWV 1050, sono arrangiamenti da pezzi precedentemente esistenti, in origine composti per violino, oboe o flauto e orchestra, scritti in larga parte da Bach durante la sua permanenza a Cöthen."},{"page_url":"https://arz.wikipedia.org/wiki/%D8%A7%D8%AF%D9%88%D9%84%D9%81_%D9%88%D9%8A%D8%B1%D9%85%D8%A7%D9%86","image_url":"http://upload.wikimedia.org/wikipedia/commons/4/44/Adolph_Woermann.jpg","page_title":"ادولف ويرمان","context_page_description":"الصفحه دى يتيمه, حاول تضيفلها لينك فى صفحات تانيه متعلقه بيها.\\nادولف ويرمان كان سياسى من المانيا."},{"page_url":"https://ca.wikipedia.org/wiki/Casa_Maria_S%C3%A0bat","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0b/Sant_Sadurni_D%27Anoia-PM_28625.jpg","page_title":"Casa Maria Sàbat","context_page_description":"La Casa Maria Sàbat, o Casa Rigol, és un edifici modernista de Miquel Madurell i Rius protegit com a bé cultural d'interès local del municipi de Sant Sadurní d'Anoia."},{"page_url":"https://es.wikipedia.org/wiki/Cueva_del_Rayo","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/80/Cueva_del_Rayo_%2829%29.JPG","page_title":"Cueva del Rayo","context_page_description":"Cueva del Rayo es un hábitat prehistórico en cueva. Es uno de los testimonios más antiguos de población documentados en el municipio de Puerto Lumbreras. Se emplaza en el sector central de la Sierra de Enmedio, en la ladera alta de un relieve que presenta fuertes pendientes en todas sus vertientes. Fue declarado bien catalogado por su relevancia cultural por resolución de fecha 20 de mayo de 2010.​"},{"page_url":"https://bs.wikipedia.org/wiki/Fitoplankton","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f3/Spring_Bloom_Colors_the_Pacific_Near_Hokkaido.jpg","page_title":"Fitoplankton","context_page_description":"Fitoplankton su autotrofne omponente planktonske zajednice i ključni organizmi okeanskih, morskih i slatkovodnih bazena u vodenim ekosistemima. Većina fitoplanktona je premala da bi se mogla pojedinačno vidjeti golim okom. Međutim, ako su prisutni u dovoljno velikom broju, neki tipovi mogu se primijetiti kao obojene mrlje na vodenoj površini zbog prisustva hlorofila u ćelijama i pratećih pigmenata kod nekih vrsta. Otprilike 1% globalne biomase nastaje djelovanjem fitoplanktona."},{"page_url":"https://nl.wikipedia.org/wiki/Gel%C3%B6bnis_treuester_Gefolgschaft","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2b/Bundesarchiv_Bild_146-1990-048-29A%2C_Adolf_Hitler_retouched.jpg","page_title":"Gelöbnis treuester Gefolgschaft","context_page_description":"De Gelöbnis treuester Gefolgschaft was een gelofte van trouw aan Adolf Hitler, die op 26 oktober 1933 werd afgelegd door 88 Duitse schrijvers en dichters, die werd gepubliceerd in het Berlijnse dagblad Vossische Zeitung en werd gepropageerd door de Pruisische Academie voor de Kunsten. De verklaring volgde op de eerder die maand door de nationaalsocialistische regering uitgevaardigde Schriftleitergesetz, die de gelijkschakeling van Duitse auteurs met het nationaalsocialisme zocht te bewerkstelligen."},{"page_url":"https://en.wikipedia.org/wiki/Tremor_Mountain","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4a/Tremor_Mountain.jpg","page_title":"Tremor Mountain","context_page_description":"Tremor Mountain is a prominent 2,691-metre summit located in the Garibaldi Ranges of the Coast Mountains, in Garibaldi Provincial Park of southwestern British Columbia, Canada. It is the highest point of the Spearhead Range, which is a subset of the Garibaldi Ranges. It is situated 13 km southeast of Whistler, and 8.7 km south of Wedge Mountain, its nearest higher peak. Precipitation runoff from the south side of the peak as well as meltwater from the Platform Glacier drains into Fitzsimmons Creek which is a tributary of the Cheakamus River. Meltwater from the Tremor Glacier on the northwestern slope drains to Wedge Creek, and meltwater from the Shudder Glacier on the northeast slope drains into Billygoat Creek, a tributary of the Lillooet River. Tremor Mountain is often climbed as part of the Spearhead Traverse. The first ascent of the mountain was made in 1928 by A.J. Campbell Garibaldi survey party. The mountain's name origin refers to unexplained earth tremors when the first ascent party was on the summit. The mountain's name was officially adopted on September 6, 1951, by the Geographical Names Board of Canada."},{"page_url":"https://de.wikipedia.org/wiki/Sidelenhorn","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6c/Galenstock_%26_Gross_Furkahorn_from_Grimselpass%2C_2010_07_cropped.jpg","page_title":"Sidelenhorn","context_page_description":"Das Sidelenhorn ist ein 3217 m ü. M. hoher Berg in den südlichen Urner Alpen, etwa drei Kilometer nördlich des Furkapass. Über seinen Gipfel verläuft die Grenze der Schweizer Kantone Uri und Wallis."},{"page_url":"https://ko.wikipedia.org/wiki/%EB%94%94_%ED%86%A0%ED%8A%BC_%ED%98%B8%EC%A0%A0","image_url":"http://upload.wikimedia.org/wikipedia/commons/3/33/Campino.Wroclaw2010.JPG","page_title":"디 토튼 호젠","context_page_description":"디 토텐 호젠은 82년 초에 독일의 펑크 붐을 타고 결성된 뒤셀도르프 출신의 펑크록 밴드이다. 거의 모든 가사를 모국어인 독일어로 쓰고, 장르는 펑크록이다. 디 토튼 호젠은 Die Ärzte 와 함께 독일의 펑크 밴드 중 가장 대중적인 성공을 거둔 밴드 중 하나이다. 현재까지 15 장의 정규앨범, 네 장의 라이브 앨범, 일곱 장의 베스트 앨범을 발매하였고 1990년 이후 독일 앨범 차트의 1위에 총 여덟 번 올랐다.\\n독일, 오스트리아, 스위스 뿐만 아니라 국외에서도 큰 성공을 거두었으며, 공연 활동과 팬들과 친밀한 관계형성에 중점을 두고 활동하고 있다."},{"page_url":"https://es.wikipedia.org/wiki/Bombardeo_del_Demo","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/71/Marcelo_Mart%C3%ADnez_%28Pelado_Torabe%29_-_Foto_para_el_diario_Clar%C3%ADn_-_2009.-.jpg","page_title":"Bombardeo del Demo","context_page_description":"Bombardeo del Demo es un programa radial sobre bandas independientes.​"},{"page_url":"https://de.wikipedia.org/wiki/Argenbach_(Speyerbach)","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/00/20180420_122412_Kopie_4K.jpg","page_title":"Argenbach (Speyerbach)","context_page_description":"Der Argenbach ist ein Bach im mittleren Pfälzerwald."},{"page_url":"https://fr.wikipedia.org/wiki/Liste_des_m%C3%A9moriaux_et_cimeti%C3%A8res_militaires_de_la_Moselle","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/00/Monument_comm%C3%A9moratif_Rezonville_1.jpg","page_title":"Liste des mémoriaux et cimetières militaires de la Moselle","context_page_description":"La liste des mémoriaux et cimetières militaires du département de la Moselle répertorie les cimetières militaires, les mémoriaux ainsi que les stèles, plaques commémoratives et autres monuments qui honorent la mémoire des morts aux combats, des victimes de bombardements ou d’exactions de l'ennemi ainsi que celle de personnels de santé, de chefs militaires ou politiques pendant :\\nla guerre franco-allemande de 1870 ;\\nla Première Guerre mondiale ;\\nla Seconde Guerre mondiale ;\\nles guerres coloniales.\\nLes lieux sont classés par conflit, par nationalité et par commune."},{"page_url":"https://arz.wikipedia.org/wiki/%D9%85%D8%A7%D8%AB%D9%8A%D9%88_%D9%81%D9%88%D9%86%D8%AA%D8%A7%D9%86","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6c/RC_Lens_-_Red_Star_%2804-08-2018%29_24.jpg","page_title":"ماثيو فونتان","context_page_description":"ماثيو فونتان لاعب كورة قدم من فرنسا."},{"page_url":"https://de.wikipedia.org/wiki/COVID-19-Pandemie_im_Main-Tauber-Kreis","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/93/Landratsamt_Main-Tauber-Kreis_%E2%80%93_Gesundheitsamt_02.jpg","page_title":"COVID-19-Pandemie im Main-Tauber-Kreis","context_page_description":"Die COVID-19-Pandemie hat den Main-Tauber-Kreis in Baden-Württemberg am 4. März 2020 erreicht.\\nNachdem am 7. März 2020 insgesamt 21 Neuinfektionen im Kreis bekanntgegeben wurden, allesamt Rückkehrer einer Reisegruppe aus Südtirol, mussten bereits ab dem 9. März 2020 drei Schulen und der bekannte Bundesstützpunkt Fechten in Tauberbischofsheim zeitweise geschlossen werden.\\nVon Ende März bis Anfang April 2020 mussten zwei Kliniken und sechs Pflegeheime im Landkreis unter vollständige Quarantäne gestellt werden. In der Median Klinik Hohenlohe in Bad Mergentheim infizierten sich seit Ende März über 100 Patienten und Mitarbeiter. Die infizierten Patienten verblieben zunächst bis auf weiteres isoliert in der Klinik. Anfang April musste mit der Fachklinik Schwaben bereits eine zweite Klinik in Bad Mergentheim mit etwa 70 Patienten unter Quarantäne gestellt werden.\\nReiserückkehrer einer Familienfeier im benachbarten Ausland lösten ab Mitte Juli 2020 eine zweite Infektionswelle im Main-Tauber-Kreis aus, die dazu führte, dass der Kreis anhand der 7-Tage-Inzidenz der gemeldeten Neuinfektionen in den vergangenen sieben Tagen am 21."},{"page_url":"https://fr.wikipedia.org/wiki/Saison_2014_de_S%C3%A9bastien_Loeb_en_sport_automobile","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f5/2014_WTCC_Shanghai_-_Loeb.jpg","page_title":"Saison 2014 de Sébastien Loeb en sport automobile","context_page_description":"Sa reconversion sur circuit désormais achevée, Sébastien Loeb intègre en 2014 le plateau du Championnat du monde des voitures de tourisme à temps complet en prenant part au débarquement de Citroën Racing dans la discipline. Aux côtés de Yvan Muller, quadruple champion du monde, de José María López et de Ma Qing Hua, il participe à la conquête du sacre Constructeurs par la marque aux chevrons et termine sa saison en troisième position du classement mondial. Parallèlement à cet engagement, il reprend ponctuellement le volant de la Peugeot 208 T16 Pikes Peak dans le cadre du Festival de vitesse de Goodwood, poursuit ses piges récurrentes en Mitjet et fait ses débuts dans les courses sur glace du Trophée Andros."},{"page_url":"https://es.wikipedia.org/wiki/Torneo_Apertura_2016_Liga_Premier_de_Ascenso","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8e/600px_Blu_Arancio_e_Blu.png","page_title":"Torneo Apertura 2016 Liga Premier de Ascenso","context_page_description":"El Torneo Apertura 2016 de la Liga Premier de Ascenso fue el 39° torneo corto que abrió la LXVII temporada de la Segunda División.\\nYa confirmada la participación de UDG \\"B\\" quien ascendió al ser campeón de Temporada 2015-16 y la no participación de Club Deportivo Uruapan quien pese a ser campeón de Temporada 2014-15 no pudo cumplir con los requisitos de su estadio; participan 48 Clubes -30 de Segunda Premier o Liga Premier de Ascenso con derecho a ascenso y 18 equipos filiales de Liga MX-, distribuidos en 3 grupos de 16 equipos cada uno.\\nEs importante mencionar que los equipos filiales de Liga MX no pueden participar en la fase final o liguilla por el ascenso sino que tendrán su propia liguilla. Para ver más información ir a sección -Sistema de competición-.\\nEsta liga representa el tercer nivel del fútbol mexicano, no obstante es de vital importancia citar que la Segunda División en sus 2 ramales tienen límite de edades, para la Liga Premier de Ascenso es sub-25 más 3 refuerzos sub-26, mientras que para la Liga de Nuevos Talentos son sub-22 más 3 refuerzos sub-23.​"},{"page_url":"https://mr.wikipedia.org/wiki/%E0%A4%87%E0%A4%B8%E0%A5%8D%E0%A4%B0%E0%A4%BE%E0%A4%AF%E0%A4%B2%E0%A4%9A%E0%A5%87_%E0%A4%AA%E0%A4%82%E0%A4%A4%E0%A4%AA%E0%A5%8D%E0%A4%B0%E0%A4%A7%E0%A4%BE%E0%A4%A8","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1f/Ehud_Barak_official.jpg","page_title":"इस्रायलचे पंतप्रधान","context_page_description":"इस्रायलचे पंतप्रधान हे इस्रायल देशाचे शासनप्रमुख आहेत व इस्रायली राजकारणात सर्वात शक्तिशाली व्यक्ती आहे. पंतप्रधानांची नियुक्ती इस्रायलचे राष्ट्रपती करतात. १४ मे १९४८ला इजरायलच्या स्वातंत्र्याच्या घोषणे नंतर डेव्हिड बेन-गुरियन इस्रायलच्या अस्थायी सरकारचे नेता म्हणून पंतप्रधान झाले व पहिल्या निवडणुकीत तेच निवडुन आले. गोल्डा मायर या एकमेव महिला पंतप्रधान होत्या. ३१ मार्च २००९ पासुन बिन्यामिन नेतान्याहू सध्याचे पदस्त पंतप्रधान आहेत. पंतप्रधान असताना लेव्हि एश्कॉल यांचे निधन झाले व यित्झाक राबिन यांची हत्या करण्यात आली."},{"page_url":"https://sk.wikipedia.org/wiki/%C3%8Drsky_teri%C3%A9r","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e8/Irish-terrier.jpg","page_title":"Írsky teriér","context_page_description":"Írsky teriér je psie plemeno vyšľachtené v Írsku, uznané v FCI v 3. skupine a 1. sekcii pod číslom 139."},{"page_url":"https://it.wikipedia.org/wiki/Villa_Cavrois","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/62/Villa_Cavrois_arri%C3%A8re_cuisine.JPG","page_title":"Villa Cavrois","context_page_description":"La Villa Cavrois a Croix, nel dipartimento francese del Nord, è una grande costruzione di architettura modernista costruita nel 1932 da Robert Mallet-Stevens per Paul Cavrois, un industriale tessile di Roubaix."},{"page_url":"https://mr.wikipedia.org/wiki/%E0%A4%85%E0%A4%B6%E0%A5%8B%E0%A4%95%E0%A4%BE%E0%A4%9A%E0%A5%87_%E0%A4%B6%E0%A4%BF%E0%A4%B2%E0%A4%BE%E0%A4%B2%E0%A5%87%E0%A4%96","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c5/Ashoka_pillar_lauriya-araraj2.png","page_title":"अशोकाचे शिलालेख","context_page_description":"अशोकाचे शिलालेख म्हणजेच अशोकस्तंभ, मोठमोठे गोलाकार खडक आणि गुहांमधील भिंतीवर कोरलेल्या ३३ शिलालेखांचा संग्रह आहे. आणि मौर्य साम्राज्याचा सम्राट अशोक याने इ.स.पू. २७२ ते इ.स.पू. २३२ या आपल्या राज्यकारभाराच्या काळात हे शिलालेख तयार करून घेतलेले आहेत.\\nसध्याच्या पाकिस्तान, नेपाळ आणि भारत या देशांमध्ये सगळीकडे हे शिलालेख विखुरलेले आहेत आणि बौद्ध धर्माचा हा पहिला स्पष्ट आणि निश्चित पुरावा आहे. भारतीय इतिहासात होऊन गेलेल्या सर्वात सामर्थ्यवान व बलाढ्य अशा सम्राट अशोकाच्या पुरस्कारामुळे आणि प्रयत्नांमुळे बौद्ध धर्माचा पहिल्यांदाच प्रचंड प्रसार कसा झाला त्याचे इत्थंभूत वर्णन या आज्ञापत्रांमध्ये केलेले आहे."},{"page_url":"https://pl.wikipedia.org/wiki/Ruf_CTR","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/90/Ruf_CTR_Yellowbird_2.jpg","page_title":"Ruf CTR","context_page_description":"RUF CTR Yellowbird – supersamochód produkowany przez niemiecką firmę RUF, skonstruowany z myślą o walce z Ferrari F40 wówczas najszybszym samochodem na świecie 1987, który ten tytuł odebrał konkurencyjnemu Porsche 959. Po raz pierwszy został zaprezentowany w końcu 1987 na Geneva Motor Show w Szwajcarii i wzbudził ogólny zachwyt publiczności. Wersja CTR Cabrio także została zaprezentowana w 1990 posiadała ten sam silnik co wersja Coupe i była wówczas najszybszym autem na rynku bez dachu. Do dzisiaj jest jednym z najszybszych samochodów typu cabrio. CTR zebrał także dobre oceny od dziennikarzy. Jako jeden z pierwszych samochodów na świecie miał tak duże tarcze hamulcowe o średnicy 330 mm, co przełożyło się na krótką drogę hamowania. Ponadto był jednym z lepiej prowadzących się aut, które miały cokolwiek wspólnego z firmą Porsche. Bezpośrednim następcą modelu CTR Yellowbird był Ruf CTR2. Cel jaki zakładano budując go, a więc pokonanie F40, został zrealizowany."},{"page_url":"https://nl.wikipedia.org/wiki/Postrijtuig","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3d/Posttrein.JPG","page_title":"Postrijtuig","context_page_description":"Een postrijtuig is een rijtuig, speciaal ingericht voor het transporteren van poststukken. Vaak werd de post tijdens de rit gesorteerd.\\nIn de jaren vijftig van de 20e eeuw werden voor de getrokken treinen van de Nederlandse Spoorwegen de postrijtuigen Plan C, Plan E en Plan L gebouwd. Deze postrijtuigen deden dienst tot 1980-’83. Een rijtuig van Plan C is bewaard gebleven bij het Nederlands Spoorwegmuseum en een rijtuig Plan L is bewaard gebleven bij de Stichting Historisch Dieselmaterieel.\\nVoor het postvervoer met Stroomlijnmaterieel werden in de jaren dertig tot en met de jaren vijftig de rijtuigen type Pec, gebouwd. Ze konden worden gekoppeld aan het stroomlijnmaterieel dat is gebouwd vanaf de jaren dertig tot en met de jaren veertig en met de treinstellen van het type Mat '54. De laatste Pec’s werden buiten dienst gesteld in 1979. Eén exemplaar is bewaard gebleven bij het Nederlands Spoorwegmuseum.\\nVanaf de jaren vijftig werden diverse motorrijtuigen van het type Mat '24 verbouwd tot motorpostrijtuigen. Vanaf 1965 werden ze vervangen door nieuwgebouwde motorpostrijtuigen. Vanaf de jaren zeventig werden speciaal voor postvervoer gebouwde postgoederenwagens gebruikt."},{"page_url":"https://pl.wikipedia.org/wiki/Paraceratherium","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0f/Indricotherium11.jpg","page_title":"Paraceratherium","context_page_description":"Paraceratherium – wymarły rodzaj bezrogiego nosorożca, a właściwie przedstawiciel rodziny Hyracodontidae z podrodziny Indricotheriinae; jeden z największych ssaków lądowych w historii. Żył od wczesnej do późnej epoki oligoceńskiej. Jego szczątki znaleziono w Eurazji od Chin do terenów byłej Jugosławii. Nazwa Paraceratherium oznacza „obok bezrogiej bestii”, odnosi się do Aceratherium, rodzaju uznawanego niegdyś za podobny.\\nDokładna wielkość Paraceratherium pozostaje nieznana z powodu niekompletności znalezisk. Masę ciała zwierzęcia szacuje się na 15-20 ton. Wysokość w kłębie wynosiła około 4,8 m, długość zaś około 7,4 m. Długie kończyny przypominały słupy. Długa szyja nosiła głowę o czaszce mierzącej 1,3 m. Długie siekacze przypominały ciosy. Wcięcie nosowe sugeruje obecność chwytnej górnej wargi bądź nawet trąby.\\nTrybem życia Paraceratherium mogło przypominać współczesne wielkie ssaki, jak słoniowate czy przetrwałe do dziś nosorożcowate. Z uwagi na rozmiary groziło mu niewielu drapieżników, natomiast rozmnażanie następowało wolno. Paraceratherium żywiło się liśćmi, miękkimi roślinami, krzewami."},{"page_url":"https://sv.wikipedia.org/wiki/Pilosocereus_tuberculatus","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fc/Pilosocereus_tuberculatus.jpg","page_title":"Pilosocereus tuberculatus","context_page_description":"Pilosocereus tuberculatus är en kaktusväxtart som först beskrevs av Erich Werdermann, och fick sitt nu gällande namn av Byles och Gordon Douglas Rowley. Pilosocereus tuberculatus ingår i släktet Pilosocereus och familjen kaktusväxter. Inga underarter finns listade i Catalogue of Life."},{"page_url":"https://en.wikipedia.org/wiki/Mus%C3%A9um_de_Toulouse","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ed/P%C3%A9trel_g%C3%A9ant_MHNT.jpg","page_title":"Muséum de Toulouse","context_page_description":"The Muséum de Toulouse is a museum of natural history in Toulouse, France. It is in the Busca-Montplaisir, houses a collection of more than 2.5 million items, and has some 3,000 square metres of exhibition space. Its Index Herbariorum code is TLM."},{"page_url":"https://de.wikipedia.org/wiki/Araber","image_url":"http://upload.wikimedia.org/wikipedia/commons/9/9f/Eid_Ahwaz.jpg","page_title":"Araber","context_page_description":"Die Araber sind eine semitischsprachige Ethnie auf der Arabischen Halbinsel und in Nordafrika, die überwiegend in den arabischen Ländern beheimatet ist. Als nicht-autochthone Gemeinden leben Araber zudem in der Diaspora in vielen Ländern der Welt, überwiegend in Süd- und Nordamerika sowie Europa, vor allem in Brasilien, Argentinien, Frankreich und in den Vereinigten Staaten.\\nNachdem die Definition in unterschiedlichen Kulturen und Zeiten stark voneinander abweicht, ist eine eindeutige Zuweisung nur im entsprechenden Kontext möglich. Für Araber gelten Fremde, die nicht korrekt Arabisch sprechen, als ʿAdscham. Nicht zu den Arabern gezählt werden Ethnien wie Berber, Somali, Kurden, Turkmenen, Suryoye, Habescha sowie andere, die in arabischen Ländern leben. Viele von ihnen beherrschen Arabisch als Zweitsprache."},{"page_url":"https://hy.wikipedia.org/wiki/%D5%84%D5%AB%D6%84%D5%A1%D5%B5%D5%A5%D5%AC_%D5%94%D5%A5%D6%80%D5%B8%D5%A2%D5%B5%D5%A1%D5%B6","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/70/%22Clapotis%22.jpg","page_title":"Միքայել Քերոբյան","context_page_description":"Միքայել Քերոբյան, հայկական ծագմամբ ամերիկացի քանդակագործ։"},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Baudenkm%C3%A4ler_in_Dinkelsb%C3%BChl/Kernstadt","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c1/Dinkelsb%C3%BChl%2C_Unterer_Mauerweg_2-20160807-001.jpg","page_title":"Liste der Baudenkmäler in Dinkelsbühl/Kernstadt","context_page_description":"Diese Liste ist eine Teilliste der Liste der Baudenkmäler in Dinkelsbühl. Grundlage der Liste ist die Bayerische Denkmalliste, die auf Basis des bayerischen Denkmalschutzgesetzes vom 1. Oktober 1973 erstmals erstellt wurde und seither durch das Bayerische Landesamt für Denkmalpflege geführt und aktualisiert wird. Die folgenden Angaben ersetzen nicht die rechtsverbindliche Auskunft der Denkmalschutzbehörde."},{"page_url":"https://en.wikipedia.org/wiki/Elmina_Castle","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a6/Elmina_slave_castle.jpg","page_title":"Elmina Castle","context_page_description":"Elmina Castle was erected by the Portuguese in 1482 as Castelo de São Jorge da Mina, also known as Castelo da Mina or simply Mina in present-day Elmina, Ghana. It was the first trading post built on the Gulf of Guinea, and the oldest European building in existence south of the Sahara. First established as a trade settlement, the castle later became one of the most important stops on the route of the Atlantic slave trade. The Dutch seized the fort from the Portuguese in 1637, after an unsuccessful attempt to the same extent in 1596, and took over all of the Portuguese Gold Coast in 1642. The slave trade continued under the Dutch until 1814. In 1872, the Dutch Gold Coast, including the fort, became a possession of Great Britain.\\nThe Gold Coast, which is now Ghana, gained its independence in 1957 from Britain, and had control of the castle. Elmina Castle is a historical site, and was a major filming location for Werner Herzog's 1987 drama film Cobra Verde. The castle is recognized by UNESCO as a World Heritage Site."},{"page_url":"https://pt.wikipedia.org/wiki/Dottore","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/aa/Dottore2.png","page_title":"Dottore","context_page_description":"O Dottore, Dottore Gratiano, Balanzone, Scarpazon, Forbizone, Boloardo é uma personagem da commedia dell'arte."},{"page_url":"https://hy.wikipedia.org/wiki/%D5%88%D5%BD%D5%AF%D5%A5_%D5%B0%D6%80%D5%A1%D5%A2%D5%B8%D6%82%D5%AD","image_url":"http://upload.wikimedia.org/wikipedia/commons/f/f5/%27The_Golden_Volcano%27_by_George_Roux_45.jpg","page_title":"Ոսկե հրաբուխ","context_page_description":"Ոսկե հրաբուխ, ֆրանսիացի գրող Ժյուլ Վեռնի ֆանտաստիկ և արկածային վեպը, որը մտնում է «Անսովոր ճանապարհորդություններ» շարքի մեջ։ Այս վեպը հեղինակի քիչ հայտնի վեպերից է։ Վեպը գրվել է 1899 թվականից մինչև 1902 թվականներն ընկած ժամանակաշրջանում, սակայն Ժյուլ Վեռնը այն համարում էր անհաջող և այդ պատճառով այն չէր հրատարակում։ Այնուհետև վեպը խմբագրվել է Ժյուլ Վեռնի որդու՝ Միշել Վեռնի կողմից։ Վեպը հրատարակվել է 1906 թվականին՝ հեղինակի մահից հետո։ Վեպի պատկերազարդումները կատարվել են Ջորջ Ռուի կողմից։ Սա հեղինակի միակ գիրքն է, որը հրատարակվել է երկու հատորով։ Առաջին հատորը հրատարակվել է 1906 թվականի հունվարի 1-ին՝ «Անսովոր ճանապարհորդություններ» շարքի քսաներեքերորդ հատորը և երկրորդ հատորը՝ դեկտեմբերի 15-ին՝ «Անսովոր ճանապարհորդություններ»-ի քսանչորսերորդ հատորը։\\nՎեպի բնօրինակը հրատարակվել է միայն 1989 թվականին՝ Պիեռ Գոնդոլո դելլա ՌիվաJի աշխատանքների արդյունքում։ Այն հրատարակվել է Ժյուլ Վեռնի աշխատանքները հետազոտող կազմակերպության կողմից։\\nԵրկար ժամանակ այս վեպը եղել է քննադատների ուշադրության կենտրոնում, քանի որ անհայտ էր, թե բնօրինակի մեջ ինչ փոփոխություններ է մտցրել Ժյուլ Վեռնի որդին՝ Միշելը։"},{"page_url":"https://fi.wikipedia.org/wiki/Ahmed_S%C3%A9kou_Tour%C3%A9","image_url":"http://upload.wikimedia.org/wikipedia/commons/f/fc/Sekou_Toure_usgov-83-08641.jpg","page_title":"Ahmed Sékou Touré","context_page_description":"Ahmed Sékou Touré oli guinealainen poliitikko ja maansa ensimmäinen presidentti.\\nTouré syntyi köyhään mandinkaperheeseen Faranahissa ja opiskeli kirjekurssien avulla. Hän osallistui 1940-luvulla ammattiyhdistystoimintaan ja oli monien Afrikan johtajien tavoin mukana perustamassa Rassemblement démocratique africain -järjestöä vuonna 1946. Vuonna 1952 hän nousi Guinean demokraattisen puolueen pääsihteeriksi ja vuonna 1956 Ranskan kansalliskokoukseen.\\nVuonna 1955 hänestä tuli Conakryn pormestari, ja kun Guinea vuonna 1958 saavutti itsenäisyyden, Touré nousi maan ensimmäiseksi presidentiksi. Ranskan toimien johdosta maan talous kurjistui, mutta avuksi tulivat Itä-Euroopan kommunistimaat ja Ghana. Touré julisti perustamansa PDG-puolueen maan ainoaksi lailliseksi puolueeksi. Touré toimi presidenttinä, kunnes hän vuonna 1984 kuoli Yhdysvalloissa, jossa hän oli ollut sydänleikkauksessa.\\nTourén kuolemaa seuranneen vallankaappauksen jälkeen häntä seurasi presidenttinä Lansana Conté, joka johti maata omaan kuolemaansa vuonna 2008."},{"page_url":"https://en.wikipedia.org/wiki/List_of_historic_places_in_Allentown,_Pennsylvania","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6c/1950_-_Freemans_Dairy_Delivery_Truck.jpg","page_title":"List of historic places in Allentown, Pennsylvania","context_page_description":"The city of Allentown, Pennsylvania, was established in 1762 and is one of the oldest major cities in the Commonwealth of Pennsylvania and the United States. It has deep roots in the history of the nation; it was the hiding place of the Liberty Bell during the American Revolution, and its oldest city cemetery has graves of patriots who served in the Continental Army. Over its 250-year history, many people and things have played a part in the history of the city; numerous buildings, bridges, parks and other locations in the city have come and gone, but many remain, with thirteen of them being on the National Register of Historic Places.\\nBelow is a list of major historical and notable sites in the city. See the linked article for a full description and history of each site."},{"page_url":"https://eu.wikipedia.org/wiki/Kagawa_(prefektura)","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/94/Great_Seto_Bridge-Rikujyo01.jpg","page_title":"Kagawa (prefektura)","context_page_description":"Kagawa prefektura\\nJaponiako Shikoku uharteko prefektura bat da. Hiriburua Takamatsu hiria da."},{"page_url":"https://zh.wikipedia.org/wiki/%E5%8F%A4%E5%A7%86%E8%92%82%E6%B2%B3","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2d/Gumti_River_2018-08-31_%284%29.jpg","page_title":"古姆蒂河","context_page_description":"古姆蒂河是流经印度东北特里普拉邦及孟加拉国的一条河流，发源于特里普拉邦的东部山区，向西南200公里汇入孟加拉国的梅克纳河。\\n在印度特里普拉邦的达来县南部的河道，建有一方水坝，形成了一个41平方公里的湖泊，叫顿布尔湖（Dumbur /Dumboor Lake，意为湿婆神的手摇鼗（damaru））。"},{"page_url":"https://ja.wikipedia.org/wiki/%E6%A9%8B%E6%9D%AD%E5%B2%A9","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a7/180429_Hashiguiiwa_Kushimoto_Wakayama_pref_Japan11bs.jpg","page_title":"橋杭岩","context_page_description":"橋杭岩は、和歌山県東牟婁郡串本町にある奇岩群。同町の大字鬮野川小字橋杭の海岸から紀伊大島方面へ大小約40の岩が南西一列におよそ850メートルもの長きにわたって連続してそそり立っている。直線上に岩が立ち並ぶ姿が橋の杭のように見えることから橋杭岩と呼ばれている。また干潮時には岩の列中ほどに附属する弁天島まで歩いて渡ることができる。なお、弁天島の西側には朱色の鳥居があり、それをくぐると小道があって少し登ると岸壁を背にした祠があり、参拝することができる。\\n吉野熊野国立公園に属しており、国の名勝や国の天然記念物の指定も受け観光名所となっている。また橋杭岩を通して見る朝日はとても美しいと評判で日本の朝日百選の認定も受けている。"},{"page_url":"https://sq.wikipedia.org/wiki/The_Walking_Dead_(serial_televisiv)","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/77/David_Morrissey_by_Gage_Skidmore.jpg","page_title":"The Walking Dead (serial televisiv)","context_page_description":"Walking Dead është një seri televizive amerikane prodhuar nga 2010.\\nIdeuar nga drejtori Frank Darabont, seriali është i bazuar në librin me figura i shkruar nga Robert Kirkman i cili eshte gjithashtu edhe producent ekzekutiv i emisionit, ilustruar nga Tony Moore dhe Charlie Adlard.\\nEpisodi i parë u transmetua nga rrjeti i televizioneve kabllore AMC në 31 tetor të vitit 2010 gjatë Fearfest."},{"page_url":"https://en.wikipedia.org/wiki/Laurent_Lefran%C3%A7ois","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ee/MSL-Lefrancois.jpg","page_title":"Laurent Lefrançois","context_page_description":"Laurent Lefrançois is a French composer."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%91%D0%BE%D0%B4%D0%B0%D0%BA%D0%B2%D0%B0_(%D1%81%D0%B5%D0%BB%D0%BE)","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/ab/2016_Bodakva_Lokhvytskyi_02.jpg","page_title":"Бодаква (село)","context_page_description":"Бодаква — село, Бодаквянский сельский совет, Лохвицкий район, Полтавская область, Украина.\\nКод КОАТУУ — 5322681101. Население по переписи 2001 года составляло 1152 человека.\\nЯвляется административным центром Бодаквянского сельского совета, в который, кроме того, входят сёла Дедов Яр, Забодаква, Замориевка, Нижняя Будаковка, Песочки, Хрули и Червоные Луки."},{"page_url":"https://es.wikipedia.org/wiki/Ana_Amalia_de_Brunswick-Wolfenb%C3%BCttel","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/67/Weimar_Anna_Amalia_Bibliothek%40Anna_Amalie_von_Sachsen-Weimar_%281%29.JPG","page_title":"Ana Amalia de Brunswick-Wolfenbüttel","context_page_description":"Ana Amalia de Brunswick-Wolfenbüttel, por matrimonio Duquesa de Sajonia-Weimar-Eisenach, fue una mecenas y compositora alemana. Nació en el castillo de Wolfenbüttel, siendo la quinta de un total de trece hijos del duque Carlos I de Brunswick-Wolfenbüttel y la princesa Filipina Carlota de Prusia. Su abuelo materno fue el rey Federico Guillermo I de Prusia."},{"page_url":"https://nl.wikipedia.org/wiki/Begur","image_url":"http://upload.wikimedia.org/wikipedia/commons/7/76/BegurCastle.jpg","page_title":"Begur","context_page_description":"Begur is een gemeente in de Spaanse provincie Gerona in de regio Catalonië met een oppervlakte van 21 km². In 2007 telde Begur 4086 inwoners."},{"page_url":"https://et.wikipedia.org/wiki/V%C3%B6%C3%B6tkoodiluger","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/83/Ps-2-ports.jpg","page_title":"Vöötkoodiluger","context_page_description":"Vöötkoodiluger ehk vöötkoodiskanner on elektroonikaseade, mis loeb trükitud vöötkoode. Sarnaselt tasaskanneriga koosneb see valgusallikast, läätsesüsteemist ja valgussensorist, mis tõlgib valgusimpulsid elektrilisteks impulssideks. Peaaegu kõik vöötkoodilugerid sisaldavad dekooderit, mis analüüsib sensorist saadud vöötkoodi visuaalset informatsiooni ja saadab vöötkoodi sisu lugeri väljundi porti."},{"page_url":"https://vi.wikipedia.org/wiki/M%C3%A3_Anh_C%E1%BB%ADu","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e4/%E4%B8%AD%E8%8F%AF%E6%B0%91%E5%9C%8B%E7%AC%AC12%E3%80%8113%E4%BB%BB%E7%B8%BD%E7%B5%B1%E9%A6%AC%E8%8B%B1%E4%B9%9D%E5%85%88%E7%94%9F%E5%AE%98%E6%96%B9%E8%82%96%E5%83%8F%E7%85%A7.jpg","page_title":"Mã Anh Cửu","context_page_description":"Mã Anh Cửu là tổng thống thứ 23 của Trung Hoa Dân Quốc. Ông thắng cử trong cuộc bầu cử tổng thống Trung Hoa Dân quốc năm 2008 và nhậm chức vào ngày 20 tháng 5 năm 2008.\\nMã Anh Cửu sinh năm 1950 tại bệnh viện Quảng Hoa Cửu Long ở Hồng Kông, bố mẹ ông là người huyện Tương Đàm. Lúc ông lên 1 tuổi, gia đình đã chuyển đến Đài Loan sinh sống. Ông đã đảm nhận các chức vụ như: Bộ trưởng Tư pháp Trung Hoa Dân quốc, Thị trưởng Đài Bắc, Chủ tịch Trung Hoa Quốc dân Đảng từ năm 2005-2007.\\nÔng đã được bầu làm Chủ tịch Quốc dân đảng năm 2005. Ngày 13 tháng 2 năm 2007, ông bị Viện công tố thượng cấp Đài Loan cáo buộc biển thủ ngân quỹ thị trưởng trong thời gian giữ chức Thị trưởng Đài Bắc nhưng tòa án hai cấp đã kết luận ông vô tội và vụ này đã được đưa lên Tòa án tối cao Trung Hoa Dân quốc.\\nÔng đã tốt nghiệp cử nhân luật tại Đại học quốc gia Đài Loan năm 1972. Ông đã qua Hoa Kỳ học và tốt nghiệp Cao học luật tại Đại học Luật New York năm 1976 và sau đó là Tiến sĩ luật tại Đại học Luật Harvard năm 1981. Sau khi có bằng thạc sĩ luật, ông đã làm luật sư trong một thời gian ngắn tại phố Wall ở New York. Ông đã trở về Đài Loan năm 1981 để giảng dạy luật.\\nÔng đã kết hôn với bà Christine Chu Mỹ Thanh."},{"page_url":"https://zh.wikipedia.org/zh-tw/%E7%B4%AB%E8%A3%B8%E8%83%B8%E9%B1%94","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8d/Naturalis_Biodiversity_Center_-_RMNH.ART.40_-_Gymnothorax_hepaticus_%28R%C3%BCppell%29_-_Kawahara_Keiga_-_1823_-_1829_-_Siebold_Collection_-_pencil_drawing_-_water_colour.jpeg","page_title":"紫裸胸鱔","context_page_description":"紫裸胸鱔，又名白邊裸胸鯙、暗色裸胸鯙，俗名薯鰻、錢鰻，為輻鰭魚綱鰻鱺目鯙亞目鯙科的其中一個種。"},{"page_url":"https://ja.wikipedia.org/wiki/%E3%82%A8%E3%83%86%E3%82%A3%E3%82%A8%E3%83%B3%E3%83%8C%E3%83%BB%E3%83%93%E3%83%A5%E3%83%95%E3%82%A7","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c5/Etienne_buffet_le_kimono_1931.jpg","page_title":"エティエンヌ・ビュフェ","context_page_description":"エティエンヌ・ビュフェはフランスの画家である。人物画や風景画を描いた。"},{"page_url":"https://fy.wikipedia.org/wiki/Kansas_City_(Missoery)","image_url":"http://upload.wikimedia.org/wikipedia/commons/9/92/Kcsky.jpg","page_title":"Kansas City (Missoery)","context_page_description":"Kansas City, gauris ôfkoarte ta K.C., is de grutste stêd fan 'e sintraal leine Amerikaanske steat Missoery. It is ien fan 'e beide haadplakken fan Jackson County, mar it omfettet ek parten fan 'e oanswettende countys Clay, Platte en Cass. Neffens in offisjele skatting út 2012, hie Kansas City dat jiers krapoan 465.000 ynwenners. Boppedat is it de wichtichste stêd fan 'e stêdekloft dêr't ek Kansas City yn Kansas ta heart, dat foar Kansas City yn Missoury oer leit, oarekant de rivier de Missoery."},{"page_url":"https://es.wikipedia.org/wiki/Cabo_Leeuwin","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a8/Cape_Leeuwin_context.jpg","page_title":"Cabo Leeuwin","context_page_description":"El cabo Leeuwin es el confín sudoccidental del continente australiano, ubicado en el estado de Australia Occidental. Es considerado uno de los tres grandes cabos de la circunnavegación terrestre, junto al cabo de Hornos y el cabo de Buena Esperanza.\\nAlgunas pequeñas islas y roquedos, las islas Saint-Aloüarn, se extienden hacia el sur. El asentamiento humano más cercano es Augusta, un poco más al norte del cabo. Sobre el cabo se encuentra un faro."},{"page_url":"https://ca.wikipedia.org/wiki/Lafarge","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/45/Mazan_-_entr%C3%A9e_Lafarge.jpg","page_title":"Lafarge","context_page_description":"Lafarge és una companyia francesa de construcció creada l'any 1833 i especialitzada en ciment, formigó, àrids, guix, asfalts i paviments. L'any 2015 es va fusionar amb l'empresa suïssa Holcim convertint-se en '''LafargeHolcim''', líder mundial del sector del ciment amb una facturació de 26.000 milions d'euros l'any 2018. Opera a Amèrica, Àsia, Europa, Àfrica i Orient Mitjà i té uns 78.000 treballadors."},{"page_url":"https://de.wikipedia.org/wiki/Burgstall_K%C3%BChstein","image_url":"http://upload.wikimedia.org/wikipedia/commons/0/03/K%C3%BChstein.jpg","page_title":"Burgstall Kühstein","context_page_description":"Der Burgstall Kühstein bezeichnet eine abgegangene Höhenburg in der Wappenau zwischen dem Auerbach und der Kleinen Mühl nördlich von Meisingeröd in der Gemeinde Sarleinsbach im Bezirk Rohrbach von Oberösterreich.\\nDer Burgstall liegt auf einem mächtigen Felsblock, der nach Norden 20 Meter steil abfällt, von Süden aber auf einem Steig leicht erreichbar ist. Der markante Felskopf des Kühstein ist vor allem gegen Westen von einem doppelten, annähernd halbkreisförmigen Graben abgesichert. Am Felsplateau finden sich verschliffene Hinweise auf Einstemmungen. Mittelalterliche Keramikfunde wurden gemacht. Die Anlage steht nicht unter Denkmalschutz."},{"page_url":"https://es.wikipedia.org/wiki/Marck","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6c/Marck_-_Place_de_l%27Europe_-_1.JPG","page_title":"Marck","context_page_description":"Marck es una comuna y población de Francia, en la región de Norte-Paso de Calais, departamento de Paso de Calais, en el distrito de Calais y cantón de Calais-Est.\\nEstá integrada en la Communauté d'agglomération du Calaisis."},{"page_url":"https://ar.wikipedia.org/wiki/%D8%A8%D8%A7%D8%AA%D8%B1%D9%8A%D9%83_%D9%87%D8%A7%D9%84_(%D8%B3%D9%8A%D8%A7%D8%B3%D9%8A)","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/85/Patrick_Hall.jpg","page_title":"باتريك هال (سياسي)","context_page_description":"باتريك هال ‏ هو سياسي بريطاني، ولد في 20 أكتوبر 1951 في برمنغهام في المملكة المتحدة. حزبياً، نشط في حزب العمال. في الانتخابات العامة في المملكة المتحدة 1997، انتخب عضو البرلمان الثاني والخمسون للمملكة المتحدة عن دائرة بيدفورد وقد انضم خلال فترته النيابية للكتلة البرلمانية حزب العمال وفي الانتخابات العامة في المملكة المتحدة 2001، انتخب عضو برلمان المملكة المتحدة الـ53 عن دائرة بيدفورد وقد انضم خلال فترته النيابية للكتلة البرلمانية حزب العمال وفي الانتخابات العامة في المملكة المتحدة 2005، انتخب عضو برلمان المملكة المتحدة الـ54 عن دائرة بيدفورد وقد انضم خلال فترته النيابية للكتلة البرلمانية حزب العمال."},{"page_url":"https://sr.wikipedia.org/wiki/Ciljana_terapija","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/49/Mechanism_imatinib.svg","page_title":"Ciljana terapija","context_page_description":"Ciljana terapija je oblik lečenja zasnovan na načelima moderne molekularne medicine koja je svojim novootkrivenim tehnikama otkrila mnoge mehanizme koji stimulišu nastajanje i rast tumora i time omogućila proizvodnju lekova koji ciljano deluju na te procese. Glavna prednost ovakve terapije je ciljano uništavanje tumorske ćelije, bez negativnog dejstva na zdrave ćelije i tkiva.\\nZato primena bioloških lekova nije povezana s neželjenim dejstvima karakterističnima za primenu hemoterapije."},{"page_url":"https://cs.wikipedia.org/wiki/Kladruby_(Kohoutov)","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/60/Kladruby_01.JPG","page_title":"Kladruby (Kohoutov)","context_page_description":"Kladruby je vesnice, součást obce Kohoutov v okrese Trutnov. Nachází se asi 1¼ km jihovýchodně od Kohoutova a 8 km vsv. od města Dvůr Králové nad Labem. Sídlo je rozloženo kolem kyjovitě okrouhlé návsi v kratičkém bočním údolí bezejmenného levého přítoku potoka Drahyně. V roce 2001 zde bylo evidováno 15 domů a trvale zde žilo 27 obyvatel.\\nKladruby leží v katastrálním území Kladruby u Kohoutova o rozloze 3,38 km²."},{"page_url":"https://fa.wikipedia.org/wiki/%D8%A7%DA%A9%D8%A7%D9%BE%D9%86%D9%88","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d7/View_of_Akapnou.jpg","page_title":"اکاپنو","context_page_description":"اکاپنو یک منطقهٔ مسکونی در قبرس است که در ناحیه لیماسول واقع شده‌است."},{"page_url":"https://en.wikipedia.org/wiki/List_of_tallest_buildings_in_Scandinavia","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/19/Domkyrkan_i_Uppsalas_stadsbild.jpg","page_title":"List of tallest buildings in Scandinavia","context_page_description":"This list of tallest buildings in Scandinavia ranks skyscrapers in Denmark, Finland, Norway, Sweden that stand at least 100 m tall, based on height to architectural top."},{"page_url":"https://de.wikipedia.org/wiki/Masada","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7f/Masada_ostraka_-_heatkernel.jpg","page_title":"Masada","context_page_description":"Masada ist eine archäologische Stätte in Israel. Sie liegt im Südbezirk. Auf einem Gipfelplateau am Rand der Judäischen Wüste, hoch über dem Toten Meer, ließ sich Herodes eine Palastfestung erbauen. Fertiggestellt wurde dieses königliche Refugium etwa 15 v. Chr. Die Architektur ist teils traditionell, teils am Vorbild römischer Villen orientiert. Eine besondere Attraktion bot Herodes seinen Gästen mit Wasserluxus in Gestalt einer Thermenanlage und eines Schwimmbeckens.\\nRund 70 Jahre später, während des Jüdischen Krieges, nutzten viele Menschen Masada als Fluchtfelsen. Archäologische Befunde zeigen einen von Armut geprägten Alltag und eine hohe Fluktuation der hier lebenden Bevölkerung. Kommen und Gehen war jahrelang möglich, bis die Legio X Fretensis unter Flavius Silva 73 oder 74 n. Chr. vor Masada erschien, die Festung mit einem Wall einschloss und eine Belagerungsrampe aufschüttete. Nach der Darstellung von Flavius Josephus gelang es den Römern schließlich, eine Bresche in die Außenmauer zu reißen. In aussichtsloser Lage habe der Befehlshaber von Masada, Eleasar ben Jaʾir, alle Rebellen überzeugt, mit ihren Frauen und Kindern Selbstmord zu begehen."},{"page_url":"https://fr.wikipedia.org/wiki/B%C3%BCdelsdorf","image_url":"http://upload.wikimedia.org/wikipedia/commons/c/c9/Buedelsdorf_in_RD.png","page_title":"Büdelsdorf","context_page_description":"Büdelsdorf est une commune d'Allemagne, située dans le land du Schleswig-Holstein et l'arrondissement de Rendsburg-Eckernförde."},{"page_url":"https://vi.wikipedia.org/wiki/B%C3%A3o_Mangkhut_(2018)","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/bf/Typhoon_Mangkhut_in_Macau_%28Oriental_Pearl_Terminal_Station%29.jpg","page_title":"Bão Mangkhut (2018)","context_page_description":"Bão Mangkhut, được biết tới tại Philippines với tên Bão Ompong, Việt Nam gọi là Cơn bão số 6 được coi là cơn bão nhiệt đới mạnh nhất đổ bộ vào Luzon kể từ bão Megi vào năm 2010, và là cơn bão mạnh nhất đổ bộ vào Philippines kể từ Bão Haiyan vào tháng 11 năm 2013. Ngoài ra, Mangkhut cũng là cơn bão mạnh nhất đổ bộ Hồng Kông kể từ Bão Ellen vào năm 1983. Là áp thấp nhiệt đới thứ 31, cơn bão nhiệt đới thứ 22, và cơn bão cuồng phong thứ chín của mùa bão Tây Bắc Thái Bình Dương 2018, Mangkhut đổ bộ đất liền tỉnh Cagayan của Philippine vào ngày 15 tháng 9 năm 2018 khi nó đang là một siêu bão có cường độ tương đương cấp 5, và sau đó ảnh hưởng tới Hồng Kông và phía nam Trung Quốc.\\nTính tới ngày 19 tháng 9, ít nhất 102 trường hợp thương vong đã được xác định do bão Mangkhut, trong đó có 95 trường hợp ở Philippines, 6 ở Trung Quốc đại lục, và 1 ở Đài Loan."},{"page_url":"https://de.wikipedia.org/wiki/Liste_von_Sakralbauten_in_Krefeld","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/ad/2020_02_23_Mimar_Sinan_Moschee_%28Krefeld%29.jpg","page_title":"Liste von Sakralbauten in Krefeld","context_page_description":"Die Liste von Sakralbauten in Krefeld listet gegenwärtige und ehemalige Sakralbauten in der nordrhein-westfälischen Stadt Krefeld auf. Zusätzlich werden hier auch Versammlungshäuser und -räume von religiösen Gemeinschaften aus Krefeld sowie Trauerhallen auf Friedhöfen aufgeführt, die im engeren Sinne ja keine Sakralbauten sind."},{"page_url":"https://arz.wikipedia.org/wiki/%D8%A7%D9%85%D9%88%D8%B3_%D8%B3%D8%A7%D9%84%DA%A4%D8%A7%D8%AF%D9%88%D8%B1_%D8%B1%D9%88%D8%AF%D8%B1%D9%8A%D8%AC%D8%A7%D9%86%D9%8A%D8%B2","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/bc/Am%C3%B3s_Salvador_y_Rodrig%C3%A1%C3%B1ez_%28Jos%C3%A9_Pinazo%29.jpg","page_title":"اموس سالڤادور رودريجانيز","context_page_description":"اموس سالڤادور رودريجانيز كان سياسى من اسبانيا."},{"page_url":"https://de.wikipedia.org/wiki/Dodge_County_(Minnesota)","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d6/Olecarlsonslide.jpg","page_title":"Dodge County (Minnesota)","context_page_description":"Das Dodge County ist ein County im US-amerikanischen Bundesstaat Minnesota. Im Jahr 2010 hatte das County 20.087 Einwohner und eine Bevölkerungsdichte von 17,6 Einwohnern pro Quadratkilometer. Der Verwaltungssitz ist Mantorville, das nach C. Peter Mantor, dem Gründer der Stadt, benannt wurde."},{"page_url":"https://fr.wikipedia.org/wiki/XVIIIe_si%C3%A8cle_en_Lorraine","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/bc/Martin_van_Meytens_007.jpg","page_title":"XVIIIe siècle en Lorraine","context_page_description":"Cette page concerne les événements qui se sont produits au dix-huitième siècle en Lorraine."},{"page_url":"https://en.wikipedia.org/wiki/Greater_flamingo","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/be/White_Pelican_and_Greater_Flamingo_%28Walvis_Bay%29.jpg","page_title":"Greater flamingo","context_page_description":"The greater flamingo is the most widespread and largest species of the flamingo family. It is found in Africa, on the Indian subcontinent, in the Middle East, and in southern Europe."},{"page_url":"https://en.wikipedia.org/wiki/Aquapalace_Prague","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b9/Aquapalace_Praha_2016_2.jpg","page_title":"Aquapalace Prague","context_page_description":"Aquapalace Prague is the biggest water park in the Czech Republic and Central Europe. It is located in Čestlice, about 100 metres from Prague's borders. It was opened on May 5, 2008. It has both indoor and outdoor areas, which are connected. The main water park has 9150 m² and is made up of three palaces: Palace of Treasures, Palace of Adventure and Palace of Relaxation, the \\"Sauna World\\" has another 1750 m².\\nIt contains twelve water slides up to 250 metres long, many pools, 450 m long water river, themed areas, artificial waves, jacuzzis, diving cliff, bar, wellness, fitness or a physiotherapy. There is also a four-star hotel serving this park."},{"page_url":"https://arz.wikipedia.org/wiki/%D9%88%D8%A7%D9%88%D8%B1%D8%B2%D9%8A%D9%86%D9%8A%D9%83_%D8%B2%D9%88%D9%84%D8%A7%D9%88%D8%B3%D9%83%D9%89","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/62/Wawrzyniec_%C5%BBu%C5%82awski_%28tablica_w_Warszawie%29.JPG","page_title":"واورزينيك زولاوسكى","context_page_description":"الصفحه دى يتيمه, حاول تضيفلها لينك فى صفحات تانيه متعلقه بيها.\\nواورزينيك زولاوسكى كان ملحن مزيكا من بولاندا."},{"page_url":"https://zh-yue.wikipedia.org/wiki/%E7%9B%B8%E4%BD%8D","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d8/Oscillating_sine_wave.gif","page_title":"相位","context_page_description":"相位（phase）係有關波動嘅一個概念。一個實數變數 （例如係時間）嘅週期性函數 嘅相位係一個角度，代表嗰一個點嘅 喺個週期嘅邊一忽。0 度代表週期嘅起始，180 度代表週期嘅一半，而 360 度代表週期嘅最後一點。"},{"page_url":"https://en.wikipedia.org/wiki/Radekhiv_Raion","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/84/Map_of_Lviv_Oblast_highlighting_Radekhiv_Raion.png","page_title":"Radekhiv Raion","context_page_description":"Radekhiv Raion is a raion in Lviv Oblast in western Ukraine. Its administrative center is Radekhiv. Population: 47,786.\\nIt was established in 1965."},{"page_url":"https://en.wikipedia.org/wiki/Pedro_L%C3%B3pez_de_Monforte","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/41/Castillo_de_Salda%C3%B1a.jpg","page_title":"Pedro López de Monforte","context_page_description":"Pedro López de Monforte was an Iberian nobleman and castellan, probably originally from the Rioja. He was most active in the Kingdom of León, where he was appointed a count, the highest rank in the kingdom, by Alfonso VII sometime before 1 July 1131.\\nThe identity of his family is unclear. His brothers were Jimeno and Lope López, both majordomos under Queen Urraca. He may have been a son of Lope Íñiguez and thus kinsmen of the house of Haro that held the Lordship of Biscay. The family of Pedro's wife, Sancha Gómez, is also unclear. She is known by name only from a charter of their daughter Countess Urraca, in which the latter granted some lands she had inherited from both parents to the Diocese of Burgos in 1173. A certain \\"countess Sancha\\" made a donation to the monastery of San Salvador de Oña on 19 December 1135 along with her sister Estefanía and brother Rodrigo Gómez. This may be the widow of Pedro López.\\nPedro was a courtier during the latter half of the reign of Queen Urraca. He witnessed nineteen royal diplomas between 1114 and 1125. On the death of Pedro Ansúrez in 1117 Pedro López received the strategically important tenencia of Saldaña, which he ruled until 1126."},{"page_url":"https://eu.wikipedia.org/wiki/Hamtramck_(Michigan)","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/bd/Jos_Campau_at_Norwalk_-_Hamtramck_MI.JPG","page_title":"Hamtramck (Michigan)","context_page_description":"Hamtramck Michigango hiri bat da. Wayne konderrian kokatua dago. 2010ean 22.423 biztanle zituen, 5,40 kilometro koadrotan banatuta."},{"page_url":"https://pt.wikipedia.org/wiki/Aqueduto_da_%C3%81gua_de_Prata","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/66/Arcadas_do_Aquetuto_da_%C3%81gua_da_Prata_%28Rua_do_Salvador%29.jpg","page_title":"Aqueduto da Água de Prata","context_page_description":"O Aqueduto da Água de Prata, conhecido também por Aqueduto da Água da Prata ou Aqueduto da Prata é uma complexa obra de engenharia hidráulica renascentista com o objectivo de abastecer a cidade de Évora com água. Inaugurado no ano de 1537, foi edificado no reinado de D. João III e projectado e construído pelo arquitecto régio Francisco de Arruda. O aqueduto transporta água desde nascentes situadas na Graça do Divor, dentro dos terrenos do Convento São Bento de Castris, que \\"têm o seu primeiro principio na Herdade das Figueiras de Lobo\\", até à cidade de Évora percorrendo cerca de 18 km. É parte integrante do Centro Histórico de Évora incluído Lista do Património Mundial da UNESCO e está classificado como Monumento Nacional desde 1910. O aqueduto é um dos poucos desta época que continua a funcionar na actualidade, contribuindo para o abastecimento da cidade.\\nDevido à forte necessidade de preservação, o Aqueduto entrou para a lista bienal do World Monuments Watch."},{"page_url":"https://simple.wikipedia.org/wiki/Deaths_in_January_2018","image_url":"http://upload.wikimedia.org/wikipedia/commons/b/bc/Jean_Porter_in_Thrill_of_a_Romance_still_cropped.jpg","page_title":"Deaths in January 2018","context_page_description":"The following is a list of notable deaths in January 2018. Names under each date are reported in alphabetical order by last name or pseudonym. Deaths of non-humans are reported here also if notable.\\nEach listing of a death must have a source. If no reference is included, the death notice will be removed. The following are the requirements of adding a name to the list in its order: name, age, nationality, what the person is known for, cause of death and most importantly a source."},{"page_url":"https://pt.wikipedia.org/wiki/L%C3%ADder_da_Oposi%C3%A7%C3%A3o_(Portugal)","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3a/EPP_Summit%2C_Brussels%2C_October_2018_%2843568572310%29.jpg","page_title":"Líder da Oposição (Portugal)","context_page_description":"O Líder da oposição, em Portugal, é o político que, pelo menos em teoria, chefia a oposição parlamentar na Assembleia da República. O atual líder é Rui Rio, do Partido Social Democrata.\\nPor convenção, o líder da oposição é o líder do maior partido da Oposição. Historicamente, têm quase sido sempre os partidos Partido Social Democrata e Partido Socialista.\\nO líder da oposição não tem um grande papel oficial, visto que a maioria das funções do posto são honoríficas, cerimoniais e nominais. Ele ou ela é sempre visto como a alternativa ao Governo em vigor."},{"page_url":"https://eo.wikipedia.org/wiki/Soko","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7c/Old_plough_schema.svg","page_title":"Soko","context_page_description":"La soko aŭ sok-tranĉilo estas tiu parto de la plugilo, - konsistanta el horizontala tranĉa peco-, kiu distranĉas la terbulojn post la koltro. Ĝia tasko estas uzado de la tirforto per tuttranĉado de la grundo, direktado de plugado.\\nĈar la soko tute foruziĝas, forfrotiĝas dum la uzado, ĝia restaĵo estas tute senvalora."},{"page_url":"https://es.wikipedia.org/wiki/Mohammad_Najibul%C3%A1","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/83/Mohammad_Najibullah.png","page_title":"Mohammad Najibulá","context_page_description":"Mohammad Najibulá, también conocido como Dr. Najib, fue un médico y político afgano, gobernante del país entre 1986 y 1992.\\nDurante la Guerra de Afganistán fue promovido a Director del JAD, equivalente afgano del KGB, en 1986 se convirtió en secretario del Partido, y poco después en presidente de la República.\\nDurante su mandato los soviéticos retiraron sus tropas de ocupación, si bien continuaron apoyando económica y militarmente su régimen. Por ello su política se orientó a la llamada «Reconciliación Nacional», que buscaba poner fin a la Guerra Civil mediante negociaciones y concesiones a los muyahidines, a los que concedió amnistías por sus crímenes. De igual modo, la nueva Constitución de 1990 convirtió el país en un Estado islámico, borrando toda referencia al comunismo hasta entonces imperante.\\nSin embargo, la disolución de la URSS, de cuyo apoyo dependía totalmente su gobierno, así como el apoyo de Estados Unidos a los fundamentalistas islámicos, provocó el colapso del régimen y su derrocamiento. Desde entonces, vivió asilado en la sede de la ONU en Kabul hasta que en 1996 los talibanes irrumpieron en la capital afgana, castrándolo y asesinándolo públicamente."},{"page_url":"https://ast.wikipedia.org/wiki/Donbass_Arena","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/76/Donetsk_Donbass_Arena_24.jpg","page_title":"Donbass Arena","context_page_description":"El Donbass Arena ye un estadiu de fútbol allugáu en Donetsk, Ucraína. Foi inauguráu'l 29 d'agostu de 2009.\\nAllugáu nel centru de la ciudá, nel parque Lenin Comsomol. Pensáu p'allugar 50.000 espectadores, l'estadiu ye'l llar del Shakhtar Donetsk, y va ser tamién una de les sedes de la Eurocopa 2012. Ta a la espera de la so catalogación como Categoría Élite per parte de la UEFA.\\nEl costu envaloráu primeramente del proyeutu foi de 250 millones de dólares, de los que 30 millones asignáronse a crear un parque de recréu alredor del estadiu. El costu final del proyeutu algamó los 400 millones de dólares."},{"page_url":"https://en.wikipedia.org/wiki/Stanis%C5%82aw_Kluza","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/66/Stanis%C5%82aw_Kluza.JPG","page_title":"Stanisław Kluza","context_page_description":"Stanisław Kluza is a Polish economist who, from July 14 to September 22, 2006, was the Finance Minister in the cabinet of Jarosław Kaczyński. He is the successor of Paweł Wojciechowski, who lasted only two weeks in this position as a man personally unknown to the Law and Justice party leader. Kluza claimed to continue the financial politics of Zyta Gilowska and Wojciechowski. Advocate of support for numerous families in their income tax, he is against lowering taxes until 2009 and calls for reform of the euro zone enlargement procedures to new member countries.\\nKluza was the founder and first President of the Polish Financial Supervision Authority.\\nPolish Financial Supervision Authority: “Five years of activity 2006-2011”; http://www.knf.gov.pl/en/Images/KNF_5_years_of_activity_tcm81-30164.pdf\\nHe is a member of the Economic Shadow Cabinet of Business Centre Club in Poland, responsible for the financial sector stability and development issues. He is a member of the ProEuro Initiative supporting adoption of the euro in Poland together with: Danuta Hübner, Dimitris Dimitriadis, Władysław Bartoszewski, ks. Adam Boniecki, Jerzy Buzek, Marek Goliszewski, Dariusz Rosati."},{"page_url":"https://ko.wikipedia.org/wiki/%EB%A7%90%EC%BD%A4_%EC%9E%90%EB%A7%90_%EC%9B%8C%EB%84%88","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fc/Malcolm-Jamal_Warner.jpg","page_title":"말콤 자말 워너","context_page_description":"말콤 자말 워너는 미국의 텔레비전 배우, 영화배우, 영화 프로듀서이다.\\n저지시티에서 태어났다."},{"page_url":"https://sr.wikipedia.org/wiki/%D0%9C%D0%B0%D0%BD%D1%82%D1%83%D1%80%D0%BE%D0%B2%D0%BE","image_url":"http://upload.wikimedia.org/wikipedia/commons/0/0f/Flag_of_Manturovo_%28Kostroma_oblast%29.png","page_title":"Мантурово","context_page_description":"Мантурово град је у Русији у Костромској области. Према попису становништва из 2010. у граду је живело 17479 становника."},{"page_url":"https://ko.wikipedia.org/wiki/%EB%B2%A8%EC%A0%80%EA%B0%80","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/ae/Coat_of_arms_of_Welser_family.svg","page_title":"벨저가","context_page_description":"벨저 가문 은 아우크스부르크를 중심으로 부흥했던 귀족 가문으로, 푸거 가문과 함께 은행업과 상업으로 중세 유럽을 풍미하였다."},{"page_url":"https://ja.wikipedia.org/wiki/%E9%95%B7%E9%96%80%E5%B8%82%E9%A7%85","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/01/Nagatoshi_station_0.jpg","page_title":"長門市駅","context_page_description":"長門市駅は、山口県長門市東深川駅前にある、西日本旅客鉄道の駅である。事務管コードは▲800701。"},{"page_url":"https://ru.wikipedia.org/wiki/%D0%94%D0%B5_%D0%90%D0%BC%D0%B0%D1%80%D0%B0%D0%BB%D1%8C,_%D0%9E%D0%BB%D1%8C%D0%B3%D0%B0","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3d/Olga_in_Ubat%C3%A9.jpg","page_title":"Де Амараль, Ольга","context_page_description":"Ольга де Амараль — колумбийская художница по текстилю, известная своими масштабными абстрактными работами. Одна из немногих художников из Южной Америки, ставшая всемирно известной благодаря своей работе в области новой таписерии в 1960-х и 1970-х годах. Одна из значимых фигур в развитии послевоенной латиноамериканской абстракции. В настоящее время живет и работает в Боготе."},{"page_url":"https://pl.wikipedia.org/wiki/Premierzy_Nepalu","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/30/Ranaudip_Singh_Bahadur_Rana.jpg","page_title":"Premierzy Nepalu","context_page_description":null},{"page_url":"https://de.wikipedia.org/wiki/Zschirla","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/43/ZschirlaKirche1.JPG","page_title":"Zschirla","context_page_description":"Zschirla ist seit 2011 ein Ortsteil der Stadt Colditz im Landkreis Leipzig in Sachsen, zuvor war der Ort ein Ortsteil von Zschadraß."},{"page_url":"https://de.wikipedia.org/wiki/Fl%C3%BCssigkeitsraketentriebwerk","image_url":"http://upload.wikimedia.org/wikipedia/commons/7/7d/MRO_Liftoff.jpeg","page_title":"Flüssigkeitsraketentriebwerk","context_page_description":"Flüssigkeitsraketentriebwerke sind Reaktionsantriebe, die heute vor allem in der Raumfahrt eingesetzt werden.\\nIm Gegensatz zu Feststoffantrieben, bei denen im Brennraum ein fertiges, in festem Zustand befindliches Gemisch von Brennstoff und Oxidator abbrennt, werden bei Flüssigkeitsraketen eine oder mehrere flüssige chemische Komponenten in Tanks mitgeführt und in das eigentliche Triebwerk gefördert. Dort kommt es zu einer kontinuierlichen chemischen Reaktion. Die dabei durch die Volumenzunahme entstehenden Gasmassen strömen als Stützmasse aus einer Düse aus und erzeugen dadurch Schub in die entgegengesetzte Richtung. Da der Oxidator in der Rakete mitgeführt wird, kann die Verbrennung des Treibstoffes auch ohne die Gegenwart von atmosphärischem Sauerstoff stattfinden, z. B. in der Hochatmosphäre oder im Weltall. Die Mischung von Brennstoff und Oxidator erfolgt bei diergolen Flüssigkeitsraketen erst in der Brennkammer, die Förderung bis zur Brennkammer erfolgt in getrennten Leitungssystemen.\\nTypische Kenngrößen eines solchen Raketentriebwerkes sind der Schub sowie der spezifische Impuls als Kennzahl der Effizienz des Triebwerkes unabhängig von seiner Größe."},{"page_url":"https://de.wikipedia.org/wiki/Gedenkm%C3%BCnzen_der_Bundesrepublik_Deutschland","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a0/20_Euro_GM_Deutschland_275_Jahre_Gewandhausorchester_Bildseite.jpg","page_title":"Gedenkmünzen der Bundesrepublik Deutschland","context_page_description":"Gedenkmünzen der Bundesrepublik Deutschland, die auf erinnerungswürdige Ereignisse verweisen, werden seit dem Jahr 1953 ausgegeben. Die Münzen, deren Auflage amtlich limitiert ist, sind gültige Zahlungsmittel, befinden sich aber im Allgemeinen nicht im normalen Geldumlauf, sondern sind Sammlerstücke. Der Bund als Inhaber des Münzrechts beauftragt die Prägeanstalten der Länder mit der Herstellung. Die Münzen sind von einem Künstler gestaltet und stellen auf der Bildseite jeweils eine Illustration im Zusammenhang mit dem Ausgabezweck dar. Die Wertseite zeigt einen Adler in einer dem Motiv angepassten Form. Die Aufsicht hat das Bundesministerium der Finanzen.\\nBis zum Ende des Jahres 2001 wurden Gedenkmünzen in der Währung „Deutsche Mark“ geprägt. Es gab Motive mit Nennwerten von 5 DM und 10 DM. In der Geschichte der Deutschen Mark wurde eine Goldmünze im Jahr 2001 ausgegeben.\\nSeit der Währungsumstellung am 1. Januar 2002 tragen kursgültige bundesdeutsche Münzen die Währungsbezeichnung „Euro“. Alle vorherigen Ausgaben werden unbefristet durch die Deutsche Bundesbank in Euro umgetauscht. Nach diesem Datum wurden Gedenkmünzen zu 2, 10, 100 und 200 Euro ausgegeben. Am 23."},{"page_url":"https://pl.wikipedia.org/wiki/Tatra_KT4","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/53/EupatoriaTram.jpg","page_title":"Tatra KT4","context_page_description":"Tatra KT4 – typ tramwaju wytwarzanego w latach 1974–1997 w zakładach ČKD w Pradze w Czechosłowacji."},{"page_url":"https://kk.wikipedia.org/wiki/%D0%AD%D1%80%D0%B5%D0%BD%D1%81%D0%B8%D0%B0","image_url":"http://upload.wikimedia.org/wikipedia/commons/a/ab/Panoramica-herencia.jpg","page_title":"Эренсиа","context_page_description":"Эренсиа — Испаниядағы қала. Кастилия — Ла-Манча автономды бірлестігіне қарасты Сьюдад-Реаль провинциясының құрамына кіреді. Муниципалитет Кампо-де-Сан-Хуан ауданында орналасқан.\\n2010 жылғы мәліметтер бойынша тұрғындарының саны 9215 адамды құрайды. Алып жатқан жер аумағы 227 км² шамасында. Провинцияның әкімшілік орталығына дейінгі қашықтығы — 76 км."},{"page_url":"https://zh.wikipedia.org/zh-tw/%E6%BD%AE%E5%B7%9E%E8%8F%9C","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/25/2014.11.16.120213_Restaurant_Yuyuan_Tourist_Mart_Shanghai.jpg","page_title":"潮州菜","context_page_description":"潮州菜，簡稱潮菜，是粵菜菜系之一，起源於中國廣東省潮汕地區。低檔的潮州菜館大多樹立潮菜自己的名稱，高檔的潮菜酒樓則一般用潮粵菜。潮州菜的特點有善烹海鮮、重湯輕油、崇尚清淡、注重養生等。"},{"page_url":"https://pt.wikipedia.org/wiki/Warmsen","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c1/Hoyersv%C3%B6rde_Windm%C3%BChle.jpg","page_title":"Warmsen","context_page_description":"Warmsen é um município da Alemanha localizado no distrito de Nienburg, estado da Baixa Saxônia.\\nPertence ao Samtgemeinde de Uchte."},{"page_url":"https://de.wikipedia.org/wiki/Herz-Jesu-Kirche_(Weimar)","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/43/HerzJesu3.JPG","page_title":"Herz-Jesu-Kirche (Weimar)","context_page_description":"Die Herz-Jesu-Kirche ist die Pfarrkirche der katholischen Pfarrei Weimar in der Paul-Schneider-Straße 1. Sie ist Sitz des Dekanates Weimar im Bistum Erfurt. Die ehemalige Lottenmühle in der Paul-Schneider-Straße 3 ist Sitz des Pfarramtes dieser Kirche."},{"page_url":"https://he.wikipedia.org/wiki/%D7%97%D7%99%D7%99%D7%9D_%D7%90%D7%A4%D7%A8%D7%99%D7%9D_%D7%91%D7%90%D7%9C%D7%90%D7%99%D7%98%D7%99","image_url":"https://upload.wikimedia.org/wikipedia/he/8/8e/%D7%97%D7%AA%D7%99%D7%9E%D7%94_%D7%97%D7%99%D7%99%D7%9D_%D7%90%D7%A4%D7%A8%D7%99%D7%9D_%D7%91%D7%90%D7%9C%D7%90%D7%99%D7%98%D7%99.png","page_title":"חיים אפרים באלאיטי","context_page_description":"הרב חיים אפרים באלאיטי היה אב בית דין, מורה צדק, רב העיר טורנלה בסלובקיה ומחבר ספרים אשל חיים וחמודי אפרים."},{"page_url":"https://vi.wikipedia.org/wiki/Tu_vi%E1%BB%87n_Th%C3%A1nh_Gioan,_M%C3%BCstair","image_url":"http://upload.wikimedia.org/wikipedia/commons/2/21/St_Johann_-_6.jpg","page_title":"Tu viện Thánh Gioan, Müstair","context_page_description":"Tu viện Thánh Gioan là một tu viện dòng Biển Đức cổ ở Val Müstair, Graubünden, Thụy Sĩ. Nó mang kiến trúc Nghệ thuật Carolingian đặc biệt được bảo quản rất tốt và đã được UNESCO công nhận từ năm 1983."},{"page_url":"https://sv.wikipedia.org/wiki/Tom%C3%A1%C5%A1_Dvo%C5%99%C3%A1k","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/79/ThomasDvorak.jpg","page_title":"Tomáš Dvořák","context_page_description":"Tomáš Dvořák född 11 maj 1972 i Zlín, Tjeckien är en friidrottare som tävlar i tiokamp.\\nDvořáks genombrott kom när han blev silvermedaljör vid inomhus-VM 1995 i sjukamp. Samma år var han i final vid VM i Göteborg och slutade då femma i tiokamp. Under 1996 slutade han på tredje plats vid Olympiska sommarspelen 1996 efter Dan O'Brien och Frank Busemann.\\nVid VM 1997 övertog han O'Briens tron som den bäste mångkamparen i världen när han vann guldet efter en serie på 8 837 poäng. Han följde upp detta med att vinna guld vid VM 1999 denna gång på 8 744 poäng.\\nHan var en av favoriterna till guldet vid Olympiska sommarspelen 2000 men slutade på en sjätte plats. Däremot tangerade han O'Briens svit på tre raka VM-guld när han vann i Edmonton 2001 efter en serie på 8904 poäng.\\nEfter framgången i Edmonton har han inte nått samma nivåer. Vid EM i München 2002 och vid Olympiska sommarspelen 2004 avbröt han tävlingen och vid VM 2003 slutade han på fjärde plats. Vid VM 2005 blev han åtta och vid EM 2006 blev han tolva.\\nHan har även blivit Europamästare inomhus i sjukamp.\\nUnder 1999 slog han O'Briens världsrekord i tiokamp när han noterade 8 994 poäng."},{"page_url":"https://it.wikipedia.org/wiki/Erik_Nilsson","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a2/Erik_Nilsson_%281952%29.png","page_title":"Erik Nilsson","context_page_description":"Erik Nilsson è stato un calciatore svedese."},{"page_url":"https://pt.wikipedia.org/wiki/Brunello_di_Montalcino","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/30/Brunello_di_Montalcino_vines.jpg","page_title":"Brunello di Montalcino","context_page_description":"O Brunello di Montalcino é um vinho tinto classificado como DOCG produzido na região da Toscana, território da comuna de Montalcino, província de Siena, Itália. O Brunello di Montalcino pode ser considerado, junto com os Barolos, o vinho tinto italiano dotado de maior longevidade além de ser o primeiro vinho italiano a receber a certificação DOCG. São produzidos cerca de 7.000.000 litros/ano."},{"page_url":"https://af.wikipedia.org/wiki/Koopkragpariteit","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f6/GDP_per_capita_PPP_2014-en.svg","page_title":"Koopkragpariteit","context_page_description":"Koopkragpariteit is 'n ekonomiese teorie wat op die beginsel berus dat die ware wisselkoers tussen twee geldeenhede bepaal kan word deur wat met 'n eenheid van elk van die geldeenhede gekoop kan word.\\nPariteit bestaan wanneer dieselfde met elke eenheid gekoop kan word. Die ware koopkrag van 'n geldeenheid kan aan baie kommoditeite of produkte gemeet word. 'n Gewilde manier is om te kyk hoeveel MacDonalds se Big Mac-burger in verskeie lande in die inheemse geldeenheid kos. As die burger byvoordeeld twee Amerikaanse dollar kos en 14 Suid-Afrikaanse rand, en die wisselkoers is R7 vir $1, beteken dit daar bestaan koopkragpariteit tussen die Amerikaanse dollar en Suid-Afrikaanse rand volgens die sogenaamde Big Mac-indeks, wat deur die Britse saketydskrif The Economist uitgedink is.\\nDie teorie wil dit hê dat wisselkoerse moet aanpas om koopkragpariteit te bereik. As 'n burger in Suid-Afrika dus minder as $2 kos, beteken dit die Suid-Afrikaanse rand is te swak en sal vroeër of later moet versterk om nader aan die dollar se waarde te beweeg."},{"page_url":"https://it.wikipedia.org/wiki/Invasione_del_Regno_Unito_pianificata_da_Napoleone","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2e/Disposition_d%27appareillage_de_la_flottille_imp%C3%A9riale.jpg","page_title":"Invasione del Regno Unito pianificata da Napoleone","context_page_description":"L’Invasione del Regno Unito pianificata da Napoleone fu una spedizione militare mai attuata che Napoleone Bonaparte aveva pianificato ed era sul punto di attuare ai danni del Regno Unito. I francesi avevano già tentato di invadere l'Irlanda per destabilizzare la Gran Bretagna nel 1796. Una prima \\"Armata d'Inghilterra\\" si riunì presso la costa del Canale della Manica nel 1798, ma l'attenzione di Napoleone venne concentrata all'epoca nelle campagne in Egitto ed in Austria che portarono poi nel 1802 alla firma della Pace di Amiens. Già all'epoca della Francia dell' Ancien Régime del resto vi erano stati dei tentativi di invasione dell'Inghilterra nel 1744, nel 1759 e nel 1779. In considerazione della netta superiorità quantitativa e qualitativa dell'esercito di terra napoleonico rispetto a quello inglese, se tale operazione fosse riuscita a Napoleone, probabilmente sarebbe mutata profondamente la storia delle Guerre napoleoniche."},{"page_url":"https://ca.wikipedia.org/wiki/Arc_esbiaixat","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/16/Seu_biaix.jpg","page_title":"Arc esbiaixat","context_page_description":"L'Arc esbiaixat és l'arc que presenta els suports o dovelles col·locats obliquament respecte a la seua planta. Sovint s'utilitza per crear perspectives i efectes visuals que intenten enganyar l'espectador, com ara per crear una sensació de major produnditat en una finestra."},{"page_url":"https://zh.wikipedia.org/zh-cn/%E6%B5%B7%E7%AB%AF%E9%84%89%E7%AB%8B%E5%9C%96%E6%9B%B8%E9%A4%A8","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c8/%E6%B5%B7%E7%AB%AF%E5%9C%96%E6%9B%B8%E9%A4%A8_03.jpg","page_title":"海端鄉立圖書館","context_page_description":"海端乡立图书馆，又作海端图书馆，是位于台湾台东县海端乡海端村的公共图书馆，位于台东县立海端国民中学的校园内。"},{"page_url":"https://zh.wikipedia.org/wiki/%E8%91%89%E5%8D%A1%E6%8D%B7%E7%90%B3%E8%AB%BE%E6%96%AF%E6%8B%89%E5%A4%AB%E7%9C%81","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/21/Coat_of_Arms_of_Yekaterinoslav_Governorate.png","page_title":"葉卡捷琳諾斯拉夫省","context_page_description":"叶卡捷琳诺斯拉夫省是俄罗斯帝国的一个省，范围大致包括乌克兰东南部的卢甘斯克州、顿涅茨克州、扎波罗热州和第聂伯罗彼得罗夫斯克州的一部分。面积63,393平方公里，1897年人口2,113,674人。首府叶卡捷琳诺斯拉夫。\\n1803年建省。1923年撤销。"},{"page_url":"https://nl.wikipedia.org/wiki/Het_offer_van_Abraham_(atelier_van_Rembrandt)","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3c/Rembrandt_The_Sacrifice_of_Abraham.jpg","page_title":"Het offer van Abraham (atelier van Rembrandt)","context_page_description":"Het offer van Abraham is een schilderij uit het atelier van Rembrandt, mogelijk met correcties van Rembrandt zelf. Het schilderij bevindt zich in de Alte Pinakothek in München."},{"page_url":"https://es.wikipedia.org/wiki/Taco_Bell","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4d/Flickr_stevendepolo_3427412201--Taco_Bell_tacos.jpg","page_title":"Taco Bell","context_page_description":"Taco Bell es una cadena de restaurantes de comida rápida, especializada en cocina Tex-Mex. La cadena fue fundada en 1962 por Glen Bell y actualmente pertenece a la multinacional Yum! Brands."},{"page_url":"https://en.wikipedia.org/wiki/List_of_rivers_of_Antarctica","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/04/Lassen_Creek.jpg","page_title":"List of rivers of Antarctica","context_page_description":"This is a list of rivers of Antarctica. Although they are variously named river, creek or stream, those listed are technically all meltwater streams."},{"page_url":"https://fi.wikipedia.org/wiki/Luettelo_Yhdysvaltain_edustajainhuoneen_j%C3%A4senist%C3%A4","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/49/Louie_Gohmert_official_congressional_photo_%28cropped%29.jpg","page_title":"Luettelo Yhdysvaltain edustajainhuoneen jäsenistä","context_page_description":null},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_999_Frauen_des_Heritage_Floor/Kali","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e3/Nornorna_spinner_%C3%B6dets_tr%C3%A5dar_vid_Yggdrasil.jpg","page_title":"Liste der 999 Frauen des Heritage Floor/Kali","context_page_description":"Diese Liste beschreibt das Gedeck für Kali auf dem Tisch der Kunstinstallation The Dinner Party von Judy Chicago. Sie ist Teil der Liste der 999 Frauen des Heritage Floor, die den jeweiligen Gedecken auf dem Tisch zugeordnet sind. Die Namen der 999 Frauen befinden sich auf den Kacheln des Heritage Floor, der unterhalb des Tisches angeordnet, zur Kunstinstallation gehört."},{"page_url":"https://en.wikipedia.org/wiki/Iryna_Herashchenko","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6c/Iryna_Herashchenko_September_2016_%2829376164683%29.jpg","page_title":"Iryna Herashchenko","context_page_description":"Iryna Volodymyrivna Herashchenko is a People's Deputy of Ukraine of IX convocation from the European Solidarity party, a politician and journalist of Ukraine. She is a Merited Journalist of Ukraine. Former First Deputy Chairwoman of the Verkhovna Rada, also serving as President's Humanitarian Envoy at the Minsk peace talks regarding the War in Donbass."},{"page_url":"https://it.wikipedia.org/wiki/Natal_(Brasile)","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d9/Natal_-_Rio_Grande_do_Norte_-_Brasil%283%29.jpg","page_title":"Natal (Brasile)","context_page_description":"Natal è una città del Brasile, capitale dello Stato del Rio Grande do Norte, parte della mesoregione del Leste Potiguar e della microregione di Natal."},{"page_url":"https://de.wikipedia.org/wiki/Sojus_(Raumschiff)","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a7/APAS-89_docking_system_drawing.svg","page_title":"Sojus (Raumschiff)","context_page_description":"Sojus ist der Name einer Reihe von bemannten sowjetischen, später dann russischen Raumschiffen für Besatzungen von bis zu drei Personen. Das während der 1960er-Jahre im Experimental-Konstruktionsbüro-1 unter Leitung von Sergei Koroljow bzw. seit 1966 in der Nachfolgeorganisation, dem Zentralen Konstruktionsbüro für Experimentalen Maschinenbau unter Wassili Mischin entwickelte und anschließend mehrfach modifizierte Sojus-Raumschiff wurde zu einer bemannten Fähre für die Raumstationen der Saljut-Reihe, später für die Mir und derzeit für die Internationale Raumstation. Das Sojus-Raumschiff ist seit 1967 im Einsatz und inzwischen eines der sichersten Transportsysteme. Als Träger dient die Sojus-Rakete, die in der russischen Tradition, Raketen in der Öffentlichkeit nach ihrer ersten Nutzlast zu benennen, ihren Namen erhielt."},{"page_url":"https://no.wikipedia.org/wiki/Limbach-Oberfrohna","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/ff/Schloss_Wolkenburg_01.jpg","page_title":"Limbach-Oberfrohna","context_page_description":"Limbach-Oberfrohna er en større kretsby i Landkreis Zwickau i Direktionsbezirk Chemnitz i den sørvestlige delen av Fristaten Sachsen. Byen ble opprettet den 1. juli 1950 gjennom en sammenslåing av de to byene Limbach og Oberfrohna. Limbach har hatt bystatus siden 1883, Oberfrohna siden 1935. Sammen med kommunen Niederfrohna utgjør byen forvaltningsfellesskapet Limbach-Oberfrohna. Limbach-Oberfrohna har 25 957 innbyggere.\\nLimbach-Oberfrohna var en større by i Kreis Chemnitz fra 1952 til 1990, og i Landkreis Chemnitz fra den 17. mai 1990 til 1994. Fra 1. august 1994 frem til 1. august 2008 var byen innlemmet i Landkreis Chemnitzer Land, som oppstod gjennom en sammenslåing av kretser i forbindelse med kretsreformen i Sachsen i 1994 og 1996, og deretter siden 1. august 2008 i den utvidede Landkreis Zwickau."},{"page_url":"https://en.wikipedia.org/wiki/Jelebu_District","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c7/Jelebu_District_Council.jpg","page_title":"Jelebu District","context_page_description":"The Jelebu District is the second largest district in Negeri Sembilan, Malaysia after Jempol, with a population over 40,000. Jelebu borders on the Seremban district, Jempol district, Kuala Pilah district, Pahang and Selangor. Jelebu is a suburban district with blossoming semi-agricultural industry. Jelebu is also a parliamentary constituency of the Dewan Rakyat in the Malaysian Parliament. Kuala Klawang is the principal town of the district.\\nJelebu has an infamous recorded history of British and Japanese colonization as compared to other parts of Negeri Sembilan. Numerous priceless colonial artifacts were discovered in the small semi-agricultural town of Sungai Muntoh, which was a once-booming mining town a century ago. These artifacts are now displayed in the state museum. Titi and neighbouring Sungai Muntoh were the most developed towns of all mining sites in Jelebu. The booming tin industry was one of the main reasons of the massacre in Titi, where more than 1,500 people were killed. Altogether, there were about 5,000 people killed under the Japanese-led army during World War II."},{"page_url":"https://ca.wikipedia.org/wiki/L%C3%ADnia_Reus-Salou","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/14/Accions_carrilet_reus_salou.jpg","page_title":"Línia Reus-Salou","context_page_description":"La línia Reus-Salou, coneguda com el Carrilet de Reus a Salou o Tren de Salou, era una línia de ferrocarril que unia les ciutats de Reus i Salou. La línia va ser construïda i explotada per la companyia Companyia Reusenca de Tramvies entre 1887 i 1975."},{"page_url":"https://de.wikipedia.org/wiki/Netzpolitik","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/60/Tauss_heine_bahls.jpg","page_title":"Netzpolitik","context_page_description":"Netzpolitik bezeichnet im Kern ein Politikfeld um netzkulturelle, medienpolitische und medienrechtliche Fragen.\\nDer Begriff war ursprünglich als Metapher gebildet worden für die Entwicklungen und Kontroversen, mit denen die global vernetzten digitalen Medientechnologien und ihre Anwendungen sich in gesellschaftliche, kulturelle, wirtschaftliche und politische Handlungsfelder einschreiben. In der Netzpolitik verbinden sich seit Mitte der 2000er-Jahre zwei Denkschulen: Die ursprünglich aus dem Liberalismus entwickelten Freiheitsrechte in Gestalt der Grundrechte und der Bürgerrechte sowie die aus der Netzkultur entstandenen Vorstellungen eines freien, offenen und selbstbestimmten Internets als eines gesellschaftlichen und politischen Raums. Als Querschnittsmaterie umfasst die Netzpolitik in einem weiteren Sinne alle gesellschaftlichen Bereiche, die von der Digitalisierung betroffen sind. Prägende Begriffe aus der jüngeren Debatte sind beispielsweise die Zukunft der Arbeit einschließlich ihrer sozialpolitischen Auswirkungen oder die staatliche und private Überwachung der Internetnutzung."},{"page_url":"https://pt.wikipedia.org/wiki/Espanha","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/15/Mosque_Cordoba.jpg","page_title":"Espanha","context_page_description":"Espanha, oficialmente Reino de/da Espanha, é um país principalmente localizado na Península Ibérica na Europa. Seu território também inclui dois arquipélagos: as ilhas Canárias, na costa da África, e as ilhas Baleares, no mar Mediterrâneo. Os enclaves africanos de Ceuta e Melilla fazem da Espanha o único país europeu a ter uma fronteira terrestre com um país africano. Várias pequenas ilhas no mar de Alborão também fazem parte do território espanhol. A Espanha continental é limitada a sul e a leste pelo Mediterrâneo, exceto por uma pequena fronteira terrestre com Gibraltar; a norte e a nordeste pela França, por Andorra e pelo Golfo da Biscaia; e a oeste e noroeste por Portugal e pelo Oceano Atlântico. Com uma área de 505 990 quilômetros quadrados, a Espanha é o maior país da Europa Meridional, o segundo maior país da Europa Ocidental e da União Europeia e o quarto maior país de todo o continente europeu. Também é o sexto país mais populoso da Europa e o quinto da UE. A capital e maior cidade é Madri; outras grandes áreas urbanas incluem Barcelona, Valência, Sevilha, Málaga e Bilbau.\\nOs humanos modernos chegaram pela primeira vez na Península Ibérica há cerca de 35 mil anos."},{"page_url":"https://en.wikipedia.org/wiki/Brooklyn_Center_Transit_Center","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b6/Brooklyn_Center_Transit_Center_June_2020.jpg","page_title":"Brooklyn Center Transit Center","context_page_description":"Brooklyn Center Transit Center is a transit center in the Minneapolis suburb of Brooklyn Center, Minnesota. Owned and operated by Metro Transit, it is one of the busiest single boarding locations in the Twin Cities. The transit center is not a park and ride, but provides free 10-minute parking and free outdoor bike racks. June 8, 2019 Metro Transit's second bus rapid transit line, the METRO C Line, opened with Brooklyn Center Transit Center as the line's northern terminus. The center will also be the northern terminus for the planned METRO D Line, expected to open 2021. The transit center opened December 4th, 2004 and cost $1.9 million. Before opening of the C Line, charging stations were installed for end-of-the-line charging of 8 battery electric buses used on the C Line."},{"page_url":"https://zh-min-nan.wikipedia.org/wiki/Isabela_Ko%C4%81n","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1c/Bandera_del_Cant%C3%B3n_Isabela.png","page_title":"Isabela Koān","context_page_description":"Isabela Koān sī Ecuador Galápagos Séng ê chi̍t ê koān."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%A1%D0%B5%D0%B4%D0%BB%D0%B5%D1%86%D0%B5","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ee/Bocianie_gniazdo_Siedlece.jpg","page_title":"Седлеце","context_page_description":"Седлеце — село в Польщі, у гміні Ботьки Більського повіту Підляського воєводства.\\nНаселення — 27 осіб.\\nУ 1975-1998 роках село належало до Білостоцького воєводства."},{"page_url":"https://nl.wikipedia.org/wiki/Euscarthmus","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/84/Euscarthmus_meloryphus_-Piraju%2C_Sao_Paulo%2C_Brazil-8.jpg","page_title":"Euscarthmus","context_page_description":"Euscarthmus is een geslacht van zangvogels uit de familie tirannen."},{"page_url":"https://zh.wikipedia.org/zh-my/%E4%B9%9D%E9%BE%8D%E5%B7%B4%E5%A3%AB2F%E7%B7%9A","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/43/KMB_TW5558_2F.jpg","page_title":"九龍巴士2F線","context_page_description":"九龙巴士2F线是香港九龙市区的一条日间巴士路线，来往慈云山及长沙湾，途经黄大仙、横头磡、九龙塘、石硖尾、深水埗等地区。"},{"page_url":"https://ja.wikipedia.org/wiki/%E3%82%A8%E3%82%A4%E3%83%80%E9%83%A1","image_url":"http://upload.wikimedia.org/wikipedia/commons/6/68/Map_of_Idaho_highlighting_Ada_County.svg","page_title":"エイダ郡","context_page_description":"エイダ郡 は、アメリカ合衆国アイダホ州に位置する郡である。2000年の国勢調査で、この郡は人口300,904人である。郡庁所在地は、ボイシ である。郡の名前はボイシの設立者、H・C・リッグスの最初の娘、エイダ・リッグスに由来している。"},{"page_url":"https://en.wikipedia.org/wiki/Spice_Run_Wilderness","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0a/Greenbrier_River-27527.jpg","page_title":"Spice Run Wilderness","context_page_description":"Spice Run Wilderness is a U.S. Wilderness area within the Monongahela National Forest of West Virginia in the United States. The remote area has no passenger car access."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Wiener_Gemeindebauten/Favoriten","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/85/Leebgasse_14.JPG","page_title":"Liste der Wiener Gemeindebauten/Favoriten","context_page_description":"Diese Liste zählt die Gemeindebauten im 10. Wiener Gemeindebezirk Favoriten auf.\\nEs werden nur solche Objekte angeführt, die seit Beginn des sozialen Wohnbaus errichtet wurden. Ältere Häuser, die im Besitz der Stadt Wien sind und in denen ebenfalls Gemeindewohnungen vergeben werden, fehlen daher."},{"page_url":"https://ckb.wikipedia.org/wiki/%DA%BE%D8%A7%D9%86%DB%86%DB%8C","image_url":"http://upload.wikimedia.org/wikipedia/commons/0/0f/LocationVietnamHaNoi3.png","page_title":"ھانۆی","context_page_description":"ھانۆی، پایتەخت و دووھەمین شاری گەورەی ڤیەتنامە‌. بەپێی سەرژمێرییەکانی ساڵی ٢٠٠٩ ژمارەی دانیشتوانی ئەم شارە ٦, ٥٠٠, ٠٠٠ کەس بووە."},{"page_url":"https://nl.wikipedia.org/wiki/De_drie_levenden_en_de_drie_doden","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/17/Incontro_dei_3_vivi_e_dei_3_morti_%281260_circa%29.jpg","page_title":"De drie levenden en de drie doden","context_page_description":"De drie levenden en de drie doden is een legende die de ontmoeting vertelt van drie jonge edellieden die tijdens een jachtpartij drie lijken tegenkomen die hen vermanen te denken aan de dood die voor iedereen onafwendbaar is. Afbeeldingen van deze legende vindt men vanaf 1225 in Italië, maar de eerste teksten die bewaard zijn gebleven, ontstonden in Frankrijk in de tweede helft van de 13e eeuw."},{"page_url":"https://fr.wikipedia.org/wiki/Suisse","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/29/Karte_Schweizer_Sprachgebiete_2018.png","page_title":"Suisse","context_page_description":"La Suisse, en forme longue la Confédération suisse est un pays d'Europe centrale et, selon certaines définitions, de l'Ouest, formé de 26 cantons, avec Berne pour capitale de facto, parfois appelée « ville fédérale ». La Suisse est bordée par l'Allemagne au nord, l'Autriche et le Liechtenstein à l'est-nord-est, l'Italie au sud et au sud-est et la France à l'ouest. C'est un pays sans côte océanique, mais qui dispose d'un accès direct à la mer par le Rhin. La superficie de la Suisse est de 41 285 km². Elle est géographiquement divisée entre les Alpes, le plateau suisse et le Jura. Les Alpes occupent la majeure partie du territoire. La population de la Suisse dépasse les 8,5 millions d'habitants et elle se concentre principalement sur le plateau, là où se trouvent les plus grandes villes. Parmi elles, Zurich, Genève et Bâle sont les agglomérations les plus importantes du pays en termes économiques et de population, et des villes mondiales où se trouvent le siège d'organisations internationales et des aéroports de dimension internationale.\\nL'établissement de la Confédération suisse est traditionnellement daté au 1ᵉʳ août 1291, jour célébré chaque année en tant que Fête nationale."},{"page_url":"https://uk.wikipedia.org/wiki/ProjeQtOr","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/71/LogoProjeqtor.png","page_title":"ProjeQtOr","context_page_description":"ProjeQtOr — вільний серверний веб-застосунок для управління проектами, розроблений Pascal Bernard. Активно підтримується й вдосконалюється."},{"page_url":"https://ja.wikipedia.org/wiki/%E6%A0%83%E6%9C%A8%E7%9C%8C%E9%81%93296%E5%8F%B7%E5%B0%8F%E5%B1%B1%E9%83%BD%E8%B3%80%E7%B7%9A","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/be/Tochigi_prefectural_road_No.296_on_Tsuga_town.jpg","page_title":"栃木県道296号小山都賀線","context_page_description":"栃木県道296号小山都賀線は、栃木県小山市と栃木市を結ぶ一般県道である。"},{"page_url":"https://ru.wikipedia.org/wiki/%D0%9F%D1%80%D0%BE%D0%B5%D0%B7%D0%B4_%D1%81%D0%BD%D0%B0%D1%80%D1%83%D0%B6%D0%B8_%D0%BF%D0%BE%D0%B5%D0%B7%D0%B4%D0%BE%D0%B2","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/92/Bundesarchiv_Bild_104-0332%2C_Truppentransport_zur_Front.jpg","page_title":"Проезд снаружи поездов","context_page_description":"Проезд снаружи поездов — способ передвижения, заключающийся в проезде на поездах и иных рельсовых транспортных средствах с их внешней стороны. Включает в себя проезд на крышах, переходных площадках, в открытых кузовах либо с боковых или торцевых сторон вагонов или в подвагонном пространстве на элементах наружной арматуры подвижного состава. Люди, неофициально практикующие данный способ проезда, именуются «трейнсёрферами», «трейнхопперами» или «зацеперами». Для проезда снаружи грузовых поездов также используется термин «фрейтхоп».\\nПрактика такого передвижения возникла с момента появления рельсового транспорта и была широко распространена в первой половине XX века, однако на многих железных дорогах в той или иной мере сохранилась и в настоящее время. На сегодняшний день проезд снаружи поездов имеет распространение во многих странах мира и практикуется преимущественно молодёжью и вольными путешественниками. В некоторых развивающихся странах Юго-восточной Азии, Африки и Южной Америки в связи с хронической перегруженностью железнодорожного транспорта носит массовый характер."},{"page_url":"https://en.wikipedia.org/wiki/Klemm_Kl_26","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e5/Klemm_L_26_Deutschlandflug_1931.jpg","page_title":"Klemm Kl 26","context_page_description":"The Klemm L 26, later Klemm Kl 26, was a low-wing trainer aircraft built by Klemm."},{"page_url":"https://cs.wikipedia.org/wiki/Motorov%C3%A9_vozy_850_a_851","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3f/851_2010_Zabreh.JPG","page_title":"Motorové vozy 850 a 851","context_page_description":"Motorové vozy řady 850 a 851 byly vyráběny v 60. letech 20. století ve Vagónce Tatra Studénka. Československé státní dráhy je pod označením M 286.0 a M 286.1 využívaly pro vozbu rychlíků a osobních vlaků nejen na hlavních neelektrifikovaných tratích. Na Slovensku byly vyřazeny do roku 2007, České dráhy je provozovaly do roku 2014."},{"page_url":"https://hu.wikipedia.org/wiki/Ragy%C3%A1s_tin%C3%B3ru","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/cf/Hemileccinum_depilatum.jpg","page_title":"Ragyás tinóru","context_page_description":"A ragyás tinóru a tinórufélék családjába tartozó, Európában elterjedt, meleg lomberdőkben élő, ehető gombafaj."},{"page_url":"https://cs.wikipedia.org/wiki/Kalina_Sieboldova","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0d/2867-Viburnum_sieboldii-Arb.Brno-8.12.JPG","page_title":"Kalina Sieboldova","context_page_description":"Kalina Sieboldova je opadavý keř pocházející z Japonska. Vzácně se v Česku pěstuje v arboretech a botanických zahradách."},{"page_url":"https://cs.wikipedia.org/wiki/Lourmarin","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7b/LOURMARIN_Le_Chateau.jpg","page_title":"Lourmarin","context_page_description":"Lourmarin je francouzská obec v departementu Vaucluse v regionu Provence-Alpy-Azurové pobřeží."},{"page_url":"https://et.wikipedia.org/wiki/Eesti_merev%C3%A4gi","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e0/Lembit_%28allveelaev%29.jpg","page_title":"Eesti merevägi","context_page_description":"Eesti merevägi on Eesti kaitseväe põhiväeliik, mis vastutab mereoperatsioonide eest.\\nEesti mereväe tunnuslause on \\"Mere kutsel – mere kaitsel!\\"\\nEesti mereväe lipulaev on miinijahtija Admiral Cowan."},{"page_url":"https://zh-min-nan.wikipedia.org/wiki/Fontanes_(Loz%C3%A8re)","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/98/Fontanes_%28Loz%C3%A8re%2C_Fr%29%2C_moutons_sur_le_haut_plateau.JPG","page_title":"Fontanes (Lozère)","context_page_description":"Fontanes sī ūi-tī Hoat-kok Languedoc-Roussillon toā-khu Lozère séng ê chi̍t ê commune."},{"page_url":"https://sk.wikipedia.org/wiki/Brid%C5%BEov%C3%A1_terminol%C3%B3gia","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4f/Sidorkianica.jpg","page_title":"Bridžová terminológia","context_page_description":"Vzhľadom na to, že bridžistov je na Slovensku málo a sú ovplyvňovaní piatimi jazykmi, či už z turnajovej praxe alebo čítaním cudzojazyčnej literatúry, je slovenská bridžová terminológia pomerne rozkolísaná. Ten istý pojem označujú rôzni slovenskí bridžisti rôzne. Mala by tu byť uvedená väčšina základných bridžových termínov a ich synoným spolu s ich vysvetlením. Popri slovenských termínoch sú uvedené aj anglické a poľské výrazy. Bolo by vhodné doplniť ich o české, nemecké a maďarské výrazy. Ak vám tu nejaký termín chýba, dajte návrh na jeho doplnenie cez diskusiu alebo ho sami doplňte. Väčšina tu uvedených bridžových výrazov sa v Krátkom slovníku slovenského jazyka nevyskytuje.\\nPri hraní na zahraničných turnajoch, môžete byť prekvapení pre nás netradičnými symbolmi niektorých figúr. Preto sú tu uvedené symboly, ktoré sa vyskytujú na našich, poľských, nemeckých kartách a francúzskych kartách."},{"page_url":"https://pt.wikipedia.org/wiki/Tom%C3%A1s_Luis_de_Victoria","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c3/Tom%C3%A1s_Luis_de_Victoria.jpg","page_title":"Tomás Luis de Victoria","context_page_description":"Tomás Luis de Victoria foi um compositor sacro espanhol que formou, com Giovanni Palestrina e Orlando di Lasso, a tríade que dominou a música quinhentista.\\nTeve as primeiras aulas de música como coralista de catedral. Enviado a Roma por Filipe II, a fim de se preparar para o sacerdócio no Collegium Germanicum, estudou com Palestrina, a quem sucedeu na direção musical do Seminário Romano. Assumiu como assistente de são Filipe Neri como capelão na igreja de San Girolamo della Carità e, mais tarde, passou ao serviço da imperatriz Maria, viúva de Maximiliano II da Alemanha. Entrou para o convento de las Descalzas Reales, em Madri, onde se tornou mestre de capela e organista e ficaria até sua morte.\\nSua produção conhecida compreende 21 missas e 44 motetes, além de magnificats, missas fúnebres, salmos, hinos e composições para a semana santa, como Improperia e Lamentações de Jeremias. Em seu último trabalho, o réquiem em memória da imperatriz, o emprego de contrastes tonais antecipa concepções harmônicas do barroco."},{"page_url":"https://bn.wikipedia.org/wiki/%E0%A6%B8%E0%A6%A6%E0%A6%B0%E0%A6%98%E0%A6%BE%E0%A6%9F,_%E0%A6%A2%E0%A6%BE%E0%A6%95%E0%A6%BE","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/20/Sadarghat_panorama.jpg","page_title":"সদরঘাট, ঢাকা","context_page_description":"সদরঘাট বাংলাদেশ-এর আদি ঢাকা শহরের একটি নদীবন্দর যাকে ঘিরে উনিশ শতকে একটি ব্যবসায়িক জনপদ গড়ে ওঠে। এই নদীবন্দরটি বুড়িগঙ্গা নদীর তীরে অবস্থিত। একবিংশ শতকের শুরুতেও এটির গুরুত্ব অক্ষুণ্ন রয়েছে। এর সন্নিহিত এলাকা পুরনো ঢাকা নামে প্রসিদ্ধ। এর অতি নিকটে রয়েছে পুস্তক প্রকাশনার ঘাঁটি বাংলাবাজার, জগন্নাথ বিশ্ববিদ্যালয়, বলধা গার্ডেন এবং আহসান মঞ্জিল এবং, সর্বোপরি, বিভিন্ন নদী পরিবাহিত পণ্য, বিশেষ করে মাছ ও ফলের সুবিশাল সব আড়ত। সারাদেশ, বিশেষ করে, দক্ষিণাঞ্চলের সঙ্গে ঢাকা শহরের নদীকেন্দ্রিক যোগাযোগ ব্যবস্থার পরিকেন্দ্র এই সদরঘাট। অসংখ্যা লঞ্চ ঘাটে ভীড় করে আছে। ডিঙ্গি নৌকাগুলো যাত্রী নিয়ে এপার-ওপার করছে, কুলিদের শোরগোল—সব কিছু মিলে সদরঘাট এমন একটি জায়গা যা কখনো নীরব থাকে না।\\nঢাকার সদরঘাট লঞ্চ টার্মিনাল থেকে সর্বমোট ৪৫ টি রুটে নৌযান চলাচল করে। এই নদীবন্দর থেকে বাংলাদেশের দক্ষিণ অঞ্চলের এলাকাগুলো যেমন, পটুয়াখালী, বরগুনা, ভোলা, ঝালকাঠী, মাদারীপুর, চাঁদপুর, খুলনা, হাতিয়া, বাগেরহাট প্রভৃতি গন্তব্যে লঞ্চ ও স্টিমার ছেড়ে যায়।"},{"page_url":"https://bn.wikipedia.org/wiki/%E0%A6%A7%E0%A7%81%E0%A6%A4%E0%A7%81%E0%A6%B0%E0%A6%BE","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b8/Datura_metel_Prague_2017_3.jpg","page_title":"ধুতুরা","context_page_description":"ধুতরা বা ধুতুরা বৈজ্ঞানিক নাম: Dutura metel, Solanaceae পরিবারের Datura গণের এক প্রকারের বিষাক্ত উদ্ভিদ।"},{"page_url":"https://it.wikipedia.org/wiki/Marco_Mordente","image_url":"http://upload.wikimedia.org/wikipedia/commons/7/78/MarcoMordente.jpg","page_title":"Marco Mordente","context_page_description":"Marco Mordente è un ex cestista italiano.\\nGuardia di 1,90 m di altezza e 85 kg di peso, dal 2010 al 2011 è stato il capitano della Nazionale Italiana di Pallacanestro"},{"page_url":"https://fr.wikipedia.org/wiki/Pierre_fine","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c3/Opledefeu2.jpg","page_title":"Pierre fine","context_page_description":"Les pierres fines sont des pierres gemmes non classées parmi les quatre pierres précieuses. Bien que parfois appelées semi-précieuses, ce terme est interdit dans le commerce, en France, par un décret du 14 janvier 2002.\\nLes pierres fines sont définies par une liste de la CIBJO dressée en 1970 à Zurich qui les considère comme des minéraux extraits de gîtes naturels.\\nCes gemmes sont notamment utilisées en joaillerie."},{"page_url":"https://de.wikipedia.org/wiki/Evangelisch-lutherisches_Pfarrhaus_(Gattenhofen)","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/ad/Gattenhofen_Nr._29_Pfarrhaus-001.jpg","page_title":"Evangelisch-lutherisches Pfarrhaus (Gattenhofen)","context_page_description":"Das Pfarrhaus in Gattenhofen, einem Ortsteil der Gemeinde Steinsfeld im mittelfränkischen Landkreis Ansbach in Bayern, wurde 1778 errichtet. Das Pfarrhaus mit der Adresse Gattenhofen 29 neben der Pfarrkirche Sankt Michael ist ein geschütztes Baudenkmal.\\nDer ein- bis zweigeschossige Krüppelwalmdachbau in Hanglage mit mittigem Zwerchhaus, Eckquaderung und Gurtgesims besitzt Hausteinelemente an Tür- und Fensteröffnungen. Unter der Freitreppe ist ein rundbogiger Kellerabgang.\\nDie Einfriedung, eine Gartenmauer mit Steinpfosten, ist mit der Jahreszahl 1789 bezeichnet."},{"page_url":"https://en.wikipedia.org/wiki/Chicago_Air_Shower_Array","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0d/CASA-MIA.png","page_title":"Chicago Air Shower Array","context_page_description":"The Chicago Air Shower Array was a very large array of scintillation detectors located at Dugway Proving Grounds in Utah, USA, approximately 80 kilometers southwest of Salt Lake City. The full CASA detector, consisting of 1089 detectors began operating in 1992 in conjunction with a second instrument, the Michigan Muon Array, under the name CASA-MIA. MIA was made of 2500 square meters of buried muon detectors. At the time of its operation in the 1990s, CASA-MIA was the most sensitive experiment built to date in the study of gamma ray and cosmic ray interactions at energies above 100 TeV. Research topics on data from this experiment covered a wide variety of physics issues, including the search for gamma rays from Galactic sources and extragalactic sources, the study of diffuse gamma-ray emission, and measurements of the cosmic ray composition in the region from 100 to 100,000 TeV. For the topic of composition, CASA-MIA worked in conjunction with several other experiments at the same site: the Broad Laterial Non-imaging Cherenkov Array, the Dual Imaging Cherenkov Experiment and the Fly's Eye HiRes prototype experiment. CASA-MIA operated continuously between 1992 and 1999."},{"page_url":"https://de.wikipedia.org/wiki/Radcliffe_on_Trent","image_url":"http://upload.wikimedia.org/wikipedia/commons/3/3c/UK_RadcliffeOnTrent.jpg","page_title":"Radcliffe on Trent","context_page_description":"Radcliffe on Trent ist eine Gemeinde in Rushcliffe im englischen Nottinghamshire mit einer Einwohnerzahl von ca. 8000.\\nIn Radcliffe, kaum zehn Kilometer östlich von Nottingham gelegen, wurde die Versuchsstrecke für die Gleise im Kanaltunnel entwickelt.\\nNur einen weiteren Kilometer östlich befindet sich der Spellow Hill."},{"page_url":"https://en.wikipedia.org/wiki/Sg%C3%B9rr_a%27_Mhadaidh_Ruaidh","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/df/Dismantled_railway_-_geograph.org.uk_-_1347296.jpg","page_title":"Sgùrr a' Mhadaidh Ruaidh","context_page_description":"Sgùrr a' Mhadaidh Ruaidh is a summit in the Trotternish range of hills in the north of the Isle of Skye, Scotland. It is located about ten kilometres south-east of Uig, and 15 kilometres north of Portree, at the point where the long ridge running from north to south down the Trotternish peninsula loops suddenly eastward. It is 593 m high, and its grid reference is NG474584.\\nThe cultural importance of this landmark lies in part in that it gave its name to the novel The Hill of the Red Fox by Allan Campbell McLean."},{"page_url":"https://eo.wikipedia.org/wiki/Jiangnanaj_subtropikaj_%C4%89iamverdaj_arbaroj","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/db/800px-tropical_wet_forests.png","page_title":"Jiangnanaj subtropikaj ĉiamverdaj arbaroj","context_page_description":"La jiangnanaj subtropikaj ĉiamverdaj arbaroj estas tersupraĵa ekoregiono el la hindoĉina ekoprovinco de la orientalisa ekozono laŭ la tipologio de la Monda Natur-Fonduso. Biome la ekoregiono apartenas al la tropikaj kaj subtropikaj humidaj foliarbaroj de Jiangnano en sudorienta Ĉinujo. La ekoregiono estas parto de tutmondaj 200-regiono, la \\"sudorient-ĉinaj kaj hajnanaj humidaj arbaroj\\"."},{"page_url":"https://de.wikipedia.org/wiki/Mohamed_Zidan","image_url":"http://upload.wikimedia.org/wikipedia/commons/8/86/Mohammed_zidan.jpg","page_title":"Mohamed Zidan","context_page_description":"Mohamed Abdullah Zidan ist ein ehemaliger ägyptischer Fußballspieler, der seit 2011 auch die deutsche Staatsangehörigkeit besitzt."},{"page_url":"https://es.wikipedia.org/wiki/Temporada_de_huracanes_en_el_Pac%C3%ADfico_de_1995","image_url":"http://upload.wikimedia.org/wikipedia/commons/3/32/1995_Pacific_hurricane_season_summary.jpg","page_title":"Temporada de huracanes en el Pacífico de 1995","context_page_description":"La Temporada de huracanes en el Pacífico de 1995 fue la temporada menos activa desde la de 1979.​ De los once ciclones tropicales que se formaron durante la temporada, cuatro alcanzaron tierra, siendo el más famoso el Huracán Ismael, que mató al menos a 116 personas en México. El huracán más fuerte fue el Huracán Juliette, que en su punto más alto alcanzó vientos con una velocidad de 150 mph.\\nLa temporada empezó oficialmente el 15 de mayo de 1995 en el Pacífico oriental y el 1 de junio de ese mismo año en el Pacífico central, manteniéndose hasta el 30 de noviembre de 1995. Estas fechas convencionalmente delimitan el periodo del año en que se forman la mayoría de los ciclones en el noroeste del océano Pacífico. Durante la temporada se generaron 11 ciclones tropicales de los cuales 10 degeneraron en tormentas tropicales. 7 de estas tormentas alcanzaron la categoría de huracán, de los cuales 3 alcanzaron la categoría de grandes huracanes. El número de tormentas tropicales fue muy inferior a la media, que se sitúa en 16, mientras que el número de huracanes y grandes huracanes se situó ligeramente por debajo de lo normal.​"},{"page_url":"https://it.wikipedia.org/wiki/Adelinae","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/09/Nemophora_associatella_BE-MK-2187a.jpg","page_title":"Adelinae","context_page_description":"Le Adelinae Bruand, 1850 sono una sottofamiglia di lepidotteri, che comprende 190 specie diffuse in Eurasia, Africa, America Settentrionale e Centrale."},{"page_url":"https://zh.wikipedia.org/zh-tw/%E4%BD%B3%E8%83%BD_EOS-1Ds_Mark_II","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0c/EOS-1Ds_IMG_0090.JPG","page_title":"佳能 EOS-1Ds Mark II","context_page_description":"佳能 EOS-1Ds Mark II是日本佳能製造的一款全畫幅數位單眼相機，具有1,670萬像素CMOS感光元件，支持佳能EF接環鏡頭。佳能 EOS-1Ds Mark II是一款專業級別的單反相機機身，體積較大，可以抵擋較強的風塵和惡劣天氣。"},{"page_url":"https://zh.wikipedia.org/wiki/%E5%90%89%E4%B8%95","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/50/Ji_Ping_Qing_illustration.jpg","page_title":"吉丕","context_page_description":"吉丕，或因字形相近误作吉本，东汉末年太医令，"},{"page_url":"https://bg.wikipedia.org/wiki/%D0%A5%D0%B0%D0%B4%D0%B6%D0%B8%D0%B4%D0%B8%D0%BC%D0%BE%D0%B2%D0%BE","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/99/%D0%A5%D0%B0%D0%B4%D0%B6%D0%B8%D0%B4%D0%B8%D0%BC%D0%BE%D0%B2%D0%BE.jpg","page_title":"Хаджидимово","context_page_description":"Хаджѝдимово е град в Югозападна България. Той се намира в област Благоевград, на около 15 km от град Гоце Делчев. Градът е административен център на община Хаджидимово."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%A1%D0%BA%D0%BB%D0%B5%D1%80%D0%BE%D1%86%D0%B5%D1%84%D0%B0%D0%BB","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/63/Sclerocephalus_skull_1.jpg","page_title":"Склероцефал","context_page_description":"Склероцефал — вымерший представитель темноспондилов раннепермской эпохи. Относится к группе архегозавроидов. Внешне сходен с эриопоидами, вероятно, конвергентно.\\nРанее этот род относили к семейству эриопид. Сейчас он чаще выделяется в особое семейство Actinodontidae. Дело в том, что в род Sclerocephalus сейчас включают и род Actinodon."},{"page_url":"https://cs.wikipedia.org/wiki/Soubor_%C5%A1esti_soch_z_kostela_sv._Mikul%C3%A1%C5%A1e_v_Chebu","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/97/Sv._Al%C5%BEb%C4%9Bta_Durynsk%C3%A1%2C_kostel_sv._Mikul%C3%A1%C5%A1e_v_Chebu.jpg","page_title":"Soubor šesti soch z kostela sv. Mikuláše v Chebu","context_page_description":"Soubor šesti soch z kostela sv. Mikuláše v Chebu patří k nejkvalitnějším a nejstarším dílům vytvořeným místní chebskou řezbářskou dílnou v 80.-90. letech 15. století. Sochy mají podobnou výšku a mohly být součástí jednoho či více gotických oltářních nástavců. Pocházejí z Kaple sv. Kříže v již zaniklé obci Sv. Kříž mezi Chebem a Waldsassen, kde je roku 1856 objevil Bernhard Grüber. V 60. letech 19. století byly druhotně umístěny do novogotických retáblů navržených B. Grüberem v kostele sv. Mikuláše v Chebu."},{"page_url":"https://de.wikipedia.org/wiki/Asamkirche_(M%C3%BCnchen)","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a3/M%C3%BCnchen_Sendlinger_Stra%C3%9Fe_32_Asamkirche_BW_2017-03-16_17-23-02_s.jpg","page_title":"Asamkirche (München)","context_page_description":"Die Asamkirche in der Sendlinger Straße in Münchens Altstadt wurde von 1733 bis 1746 von den Brüdern Asam errichtet. Sie gilt als eines der bedeutendsten Bauwerke der beiden Hauptvertreter des süddeutschen Spätbarocks. Die Asamkirche steht bereits an der Schwelle zum Rokoko, doch tritt hier die typische Leitform im Ornament, die Rocaille, noch nicht auf."},{"page_url":"https://he.wikipedia.org/wiki/%D7%93%D7%9C%D7%A7%D7%AA_%D7%A7%D7%A8%D7%95%D7%9D_%D7%94%D7%9E%D7%95%D7%97","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/36/Angiostrongylus_cantonensis.png","page_title":"דלקת קרום המוח","context_page_description":"דלקת קרומי המוח המוכרת גם בתור: דלקת עוצבה ו-מנינגיטיס היא מחלה דלקתית חריפה של הקרומים הרכים של המוח וחוט השדרה, הנגרמת בעיקר בשל זיהום חיידקי ונגיפי, אולם במקרים מסוימים גם ממיקרואורגניזמים אחרים דוגמת פטרייתי וטפילי ולעיתים נדירות גם כתוצאה ממחלות לא זיהומיות ומשימוש בתרופות מסוימות. דלקת קרום המוח נחשבת למחלה מסכנת חיים שדורשת התערבות רפואית מיידית."},{"page_url":"https://en.wikipedia.org/wiki/Pressure-sensitive_adhesive","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1b/Laptop_stickers.jpg","page_title":"Pressure-sensitive adhesive","context_page_description":"Pressure-sensitive adhesive is a type of non reactive adhesive which forms a bond when pressure is applied to bond the adhesive with a surface. No solvent, water, or heat is needed to activate the adhesive.\\nIt is used in pressure-sensitive tapes, labels, glue dots, note pads, automobile trim, and a wide variety of other products.\\nAs the name \\"pressure-sensitive\\" indicates, the degree of bond is influenced by the amount of pressure which is used to apply the adhesive to the surface.\\nSurface factors such as smoothness, surface energy, removal of contaminants, etc. are also important to proper bonding.\\nPSAs are usually designed to form a bond and hold properly at room temperatures. PSAs typically reduce or lose their tack at low temperatures and reduce their shear holding ability at high temperatures; special adhesives are made to function at high or low temperatures."},{"page_url":"https://ko.wikipedia.org/wiki/%EC%B9%B4%ED%8E%80%ED%85%8C%EB%A6%AC%EC%95%84%EB%91%90%EB%82%98%ED%8A%B8","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e9/Carpentarian_Dunnart_area.png","page_title":"카펀테리아두나트","context_page_description":"카펀테리아두나트는 주머니고양이목 주머니고양이과에 속하는 유대류의 일종이다. 버틀러두나트로도 알려져 있으며 상체는 갈색 또는 쥐색이고 하체는 흰색을 띠며, 근연종 카카두두나트를 닮았다. 머리에서 항문까지 몸길이는 75~88mm이고, 꼬리 길이는 72~90mm이며 전체 몸길이는 147~178mm이다. 몸무게는 10~20g 사이로 성과 영양 상태, 서식지 등에 따라 다양하다."},{"page_url":"https://et.wikipedia.org/wiki/Must_kuusk","image_url":"http://upload.wikimedia.org/wikipedia/commons/c/c3/Picea_mariana_levila.png","page_title":"Must kuusk","context_page_description":"Must kuusk on igihaljas okaspuuliik kuuse perekonnast. Nad kasvavad Alaskal, Kanadas ja USA kirdeosas, niiske või mõõdukalt niiske kliimaga aladel meretasemel ja mägedes kuni 1830 m kõrgusel. Puude eluiga on 200–300 aastat ja need kasvad 10–15 m, harva kuni 30 m kõrguseks."},{"page_url":"https://fr.wikipedia.org/wiki/For%C3%AAt_nationale_de_San_Bernardino","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e8/Abies_concolor_subsp._lowiana_near_Washington_Monument.jpg","page_title":"Forêt nationale de San Bernardino","context_page_description":"La forêt nationale de San Bernardino, est une forêt nationale américaine située dans le Sud de la Californie. Couvrant 3 334 km², elle s'étend dans les comtés de Riverside et San Bernardino. Créée en 1907, l'aire protégée est gérée par le Service des forêts des États-Unis."},{"page_url":"https://en.wikipedia.org/wiki/Fairlight_CMI","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c8/Fairlight_green_screen.jpg","page_title":"Fairlight CMI","context_page_description":"The Fairlight CMI is a digital synthesizer, sampler and digital audio workstation introduced in 1979 by Fairlight. It was based on a commercial licence of the Qasar M8 developed by Tony Furse of Creative Strategies in Sydney, Australia. It was one of the earliest music workstations with an embedded digital sampler, and is credited for coining the term sampling in music. It rose to prominence in the early 1980s and competed with the Synclavier from New England Digital."},{"page_url":"https://en.wikipedia.org/wiki/National_Register_of_Historic_Places_listings_in_Nebraska","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/cc/Prairie_Dog_Creek_Bridge_6.jpg","page_title":"National Register of Historic Places listings in Nebraska","context_page_description":"This is a list of more than 1,100 properties and districts in Nebraska that are on the National Register of Historic Places. Of these, 20 are National Historic Landmarks. There are listings in 90 of the state's 93 counties.\\nThis National Park Service list is complete through NPS recent listings posted July 17, 2020."},{"page_url":"https://sv.wikipedia.org/wiki/Lake_Eucumbene","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c4/Lakeeucumbenefrom_sky.JPG","page_title":"Lake Eucumbene","context_page_description":"Lake Eucumbene är en sjö i Australien. Den ligger i delstaten New South Wales, i den sydöstra delen av landet, omkring 340 kilometer sydväst om delstatshuvudstaden Sydney. Arean är 145 kvadratkilometer.\\nTrakten runt Lake Eucumbene består i huvudsak av gräsmarker. Runt Lake Eucumbene är det mycket glesbefolkat, med 3 invånare per kvadratkilometer. Genomsnittlig årsnederbörd är 1 117 millimeter. Den regnigaste månaden är februari, med i genomsnitt 168 mm nederbörd, och den torraste är juli, med 51 mm nederbörd."},{"page_url":"https://ast.wikipedia.org/wiki/Cabrejas_del_Campo","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/88/Ojuel-_Iglesia_de_San_Pedro_Ap%C3%B3stol_%287071960103%29.jpg","page_title":"Cabrejas del Campo","context_page_description":"Cabrejas del Campo ye un conceyu de la provincia de Soria, na comunidá autónoma de Castiella y Lleón. En 2006 tenía 75 habitantes y el so términu municipal ocupa 17,87 km².\\nPlantía:Campu de Gómara\\nDatos: Q832022\\nMultimedia: Cabrejas del Campo"},{"page_url":"https://sk.wikipedia.org/wiki/Beaucoudray","image_url":"http://upload.wikimedia.org/wikipedia/commons/2/2c/Map_commune_FR_insee_code_50039.png","page_title":"Beaucoudray","context_page_description":"Beaucoudray je francúzska obec, ktorá sa nachádza v departemente Manche, v regióne Dolná Normandia."},{"page_url":"https://fr.wikipedia.org/wiki/%C3%89glise_des_Grands-Carmes_de_Marseille","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b5/Carmes-Marseille-Stalles-3.jpg","page_title":"Église des Grands-Carmes de Marseille","context_page_description":"L’église des Grands-Carmes est située dans le 2ᵉ arrondissement de Marseille à la place du même nom qui se trouve entre les places Jules-Guesde et Sadi-Carnot, sur une butte à laquelle elle a donné son nom. Elle a été classée Monument historique par arrêté du 20 janvier 1983 pour son intérieur et inscrite monument historique pour ses façades et toitures à cette même date."},{"page_url":"https://ru.wikipedia.org/wiki/S35_(%D1%82%D0%B0%D0%BD%D0%BA)","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9b/Bundesarchiv_Bild_101I-212-0209-32%2C_Russland-Nord%2C_Panzer_und_Soldat.jpg","page_title":"S35 (танк)","context_page_description":"S35 — французский средний танк 1930-х годов. Был разработан фирмой Somua в 1934—1935 годах в качестве основного танка бронетанковых частей кавалерии, из-за чего в литературе порой классифицируется как «кавалерийский» или «крейсерский» танк. Первые предсерийные S35 были выпущены в 1936 году, а его массовое серийное производство началось с 1938 года и продолжалось вплоть до поражения Франции в июне 1940 года. Всего было выпущено 427 танков этого типа.\\nНа момент начала Второй мировой войны S35 являлся одним из наиболее современных и боеспособных танков французской армии и активно использовался ею во время германского вторжения в 1940 году. После поражения Франции и подписания перемирия 297 танков S35 были захвачены Германией. В вермахте S35 использовались вплоть до 1944 года, в основном на второстепенных театрах военных действий и в качестве учебно-тренировочных машин. Кроме того, незначительное количество S35 было поставлено союзникам Германии. Некоторое количество танков этого типа применялось также войсками правительства Виши в Северной Африке, а позднее — войсками «Свободной Франции», в том числе в 1944—1945 годах."},{"page_url":"https://pt.wikipedia.org/wiki/Pra%C3%A7a_Diana","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0d/Place_Diana_Paris.jpg","page_title":"Praça Diana","context_page_description":"A Praça Diana é una célebre praça de Paris, perto da Rio Sena."},{"page_url":"https://en.wikipedia.org/wiki/Einstein_family","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ec/Maja_and_Albert_Einstein_c1886.jpg","page_title":"Einstein family","context_page_description":"The Einstein family is the family of the renowned physicist Albert Einstein. Einstein's great-great-great-great-grandfather, Jakob Weil, was his oldest recorded relative, born in the late 17th century, and the family continues to this day. Albert Einstein's great-great-grandfather, Löb Moses Sontheimer, was also the grandfather of the prominent tenor Heinrich Sontheim of Stuttgart.\\nAlbert's three children were from his relationship with his first wife, Mileva Marić, his daughter Lieserl being born a year before they married.\\nAlbert Einstein's second wife was Elsa Einstein, whose mother Fanny Koch was the sister of Albert's mother, and whose father, Rudolf Einstein, was the son of Raphael Einstein, a brother of Albert's paternal grandfather. Thus Albert and Elsa were first cousins through their mothers and second cousins through their fathers."},{"page_url":"https://en.wikipedia.org/wiki/John_FitzJohn","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3f/Arms_of_Eustace_FitzJohn%2C_Lord_Vesci.svg","page_title":"John FitzJohn","context_page_description":"John FitzJohn was an English nobleman who was a leading baron during the Second Barons' War."},{"page_url":"https://fr.wikipedia.org/wiki/Savigny_(Rh%C3%B4ne)","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d5/Savigny_-_L%27%C3%A9glise.jpg","page_title":"Savigny (Rhône)","context_page_description":"Savigny est une commune française située dans le département du Rhône, en région Auvergne-Rhône-Alpes."},{"page_url":"https://fi.wikipedia.org/wiki/Zeuksen_temppeli_(Dodona)","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/03/Temple_of_Zeus_in_Dodona.jpg","page_title":"Zeuksen temppeli (Dodona)","context_page_description":"Zeuksen temppeli eli ”Pyhä talo” oli antiikin aikainen Zeus Naïokselle omistettu kreikkalainen temppeli ja siihen liittynyt pyhäkkökokonaisuus Dodonassa Kreikassa. Se oli paikka, jossa Dodonan oraakkeli toimi. Temppelin rauniot sijaitsevat Dodonan arkeologisella alueella Dodónin kunnassa."},{"page_url":"https://nl.wikipedia.org/wiki/This_is_Holland","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/88/This_Is_Holland_15.jpg","page_title":"This is Holland","context_page_description":"This is Holland is een toeristenattractie met panoramavliegsimulator in Amsterdam. De attractie is in 2017 geopend in Amsterdam-Noord, naast het EYE Filmmuseum, in een 24 meter hoog cilindrisch paviljoen op het voormalige Shellterrein Overhoeks, boven de ondergrondse parkeergarage van de A'DAM Toren."},{"page_url":"https://de.wikipedia.org/wiki/Plesiosaurier","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/36/Kaiwhekea1DB.jpg","page_title":"Plesiosaurier","context_page_description":"Die Plesiosaurier sind eine Gruppe von ausgestorbenen Reptilien, die von der späten Obertrias bis zum Ende der Kreide im Meer gelebt haben und gleichzeitig mit den Dinosauriern ausgestorben sind.\\nAls Meeresbewohner hatten sie einen länglichen Körper und vier paddelförmige Flossen. Sie gehörten wie die heutigen Echsen und Schlangen zu den Lepidosauromorpha und werden in zwei deutlich verschiedene Taxa unterteilt: die langhalsigen und kleinköpfigen eigentlichen Plesiosaurier und die Pliosaurier, für die ein kurzer, kräftiger Hals und ein großer Kopf mit langer Schnauze charakteristisch ist."},{"page_url":"https://fr.wikipedia.org/wiki/Saison_cyclonique_2018-2019_dans_l%27oc%C3%A9an_Indien_sud-ouest","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0f/Eketsang_2019_track.png","page_title":"Saison cyclonique 2018-2019 dans l'océan Indien sud-ouest","context_page_description":"La saison cyclonique 2018-2019 dans l'océan Indien sud-ouest devait s'étendre officiellement du 15 novembre 2018 au 30 avril 2019, à l'exception de l'île Maurice et des Seychelles, dont la saison se terminerait le 15 mai 2019. Ces dates délimitent traditionnellement la période de l'année durant laquelle la plupart des cyclones tropicaux et subtropicaux se forment dans le bassin qui est à l'ouest de 90° E et au sud de l'équateur. La formation de cyclones dans ce bassin est surveillée par le Centre météorologique régional spécialisé cyclones de La Réunion.\\nLe premier système, la dépression tropicale Un, est apparu le 13 septembre 2018. Le cyclone le plus coûteux et le plus meurtrier fut Idai qui frappa Madagascar, le Malawi, le Mozambique et le Zimbabwe, faisant plus d'un millier de morts et 2,3 milliards de $ de dégâts. Le système le plus intense sera Kenneth."},{"page_url":"https://fr.wikipedia.org/wiki/Henry_Strachey_(1er_baronnet)","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1c/Back_of_Sutton_Court.JPG","page_title":"Henry Strachey (1er baronnet)","context_page_description":"Sir Henry Strachey, 1ᵉʳ baronnet est un fonctionnaire et homme politique britannique qui siège à la Chambre des communes pendant 39 ans, entre 1768 et 1807."},{"page_url":"https://en.wikipedia.org/wiki/Houston_Cougars","image_url":"http://upload.wikimedia.org/wikipedia/commons/e/ec/UH_Athletics-Alumni_Center_2.jpg","page_title":"Houston Cougars","context_page_description":"The Houston Cougars are the athletic teams representing the University of Houston. Informally, the Houston Cougars have also been referred to as the Coogs, UH, or simply Houston. Houston's nickname was suggested by early physical education instructor of the university and former head football coach, John R. Bender after one of his former teams, Washington State later adopted the mascot and nickname. The teams compete in the NCAA's Division I and the Football Bowl Subdivision as members of the American Athletic Conference.\\nThe official school colors of the University of Houston are scarlet red and albino white, and the mascot is a cougar named Shasta. Houston's traditional rival has been Rice with whom the Cougars shared a conference for thirty-three non-consecutive years.\\nHouston has had notable sports teams in its history, including Phi Slama Jama and the sixteen-time national champion men's golf team. The university's campus is home to many on-campus athletic facilities including TDECU Stadium, Fertitta Center, and Darryl & Lori Schroeder Park."},{"page_url":"https://sv.wikipedia.org/wiki/J%C3%A4rvaf%C3%A4ltet","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/11/Mellanj%C3%A4rva_g%C3%A5rd_2015c.jpg","page_title":"Järvafältet","context_page_description":"Järvafältet är ett större grönområde som reserverades som militärt övningsfält mellan 1905 och 1970. Det har fått namn av Järvagårdarna i Solna. Området, som från 1960-talet och framåt till stor del bebyggts, sträcker sig genom Solna, Sundbybergs, Stockholms, Sollentuna och Järfälla kommuner. Fältet motsvarar Igelbäckens bördiga dalgång som under bronsåldern var en del av en havsvik som sträckte sig från Östersjön via Edsviken fram till Säbysjön. Det finns flera naturreservat i området."},{"page_url":"https://fr.wikipedia.org/wiki/Monuments_culturels_du_district_du_Banat_m%C3%A9ridional","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0f/Nadgrobni_spomenik_Tomi_Sandulovi%C4%87u_1.JPG","page_title":"Monuments culturels du district du Banat méridional","context_page_description":"Cet article recense les monuments culturels du district du Banat méridional en Serbie."},{"page_url":"https://es.wikipedia.org/wiki/Condado_de_Thayer","image_url":"http://upload.wikimedia.org/wikipedia/commons/3/39/Thayer_County%2C_Nebraska_courthouse_from_E_1.JPG","page_title":"Condado de Thayer","context_page_description":"El condado de Thayer, fundado en 1872, es un condado del estado estadounidense de Nebraska. En el año 2000 tenía una población de 6.055 habitantes con una densidad de población de 4 personas por km². La sede del condado es Hebron.​"},{"page_url":"https://ml.wikipedia.org/wiki/%E0%B4%9B%E0%B4%BF%E0%B4%A8%E0%B5%8D%E0%B4%A8%E0%B4%97%E0%B5%8D%E0%B4%B0%E0%B4%B9%E0%B4%B5%E0%B4%B2%E0%B4%AF%E0%B4%82","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f3/InnerSolarSystem-en.png","page_title":"ഛിന്നഗ്രഹവലയം","context_page_description":"സൗരയൂഥത്തിൽ ഏതാണ്ട് ചൊവ്വയ്ക്കും വ്യാഴത്തിനുമിടയിലെ മേഖലയാണ് ഛിന്നഗ്രഹ വലയം. ഛിന്നഗ്രഹങ്ങൾ എന്ന് വിളിക്കപ്പെടുന്ന അനിയതരൂപത്തിലുള്ള വളരെയധികം വസ്തുക്കൾ കാണപ്പെടുന്ന മേഖലയാണ് ഇത്. ട്രോജൻ ഛിന്നഗ്രഹങ്ങൾ, ഭൂമിയോടടുത്ത ഛിന്നഗ്രഹങ്ങൾ എന്നിങ്ങനെ സൗരയൂഥത്തിന്റെ മറ്റ് മേഖലകളിലും ഛിന്നഗ്രഹങ്ങൾ ഉള്ളതിനാൽ ഈ ഛിന്നഗ്രഹ വലയത്തെ പ്രധാന ഛിന്നഗ്രഹ വലയം എന്ന് വിളിക്കാറുണ്ട്.\\nഈ വലയത്തിന്റെ മൊത്തം പിണ്ഡത്തിന്റെ പാതിയും സീറീസ്, 4 വെസ്റ്റ, 2 പാളസ്, 10 ഹൈഗീയ എന്നീ അംഗങ്ങളുടെ ഭാഗമാണ്. ഈ നാലെണ്ണത്തിനും 400 കിലോമീറ്ററിൽ കുറയാത്ത വ്യാസമുണ്ട്, അതിൽ തന്നെ ഛിന്നഗ്രഹ വലയത്തിലെ ഒരേയൊരു കുള്ളൻ ഗ്രഹമായ സീറീസിന് ഏതാണ്ട് 950 കിലോമീറ്റർ വ്യാസമുണ്ട്. ഇതിൽ താഴോട്ട് വലിപ്പം കുറഞ്ഞ് പൊടിപടലങ്ങൾ വരെ ഈ മേഖലയിലുണ്ട്. ഈ ഛിന്നഗ്രഹ പദാർത്ഥങ്ങളെല്ലാം നേർത്തരീതിയിലാണ് വിതരണം ചെയ്യപ്പെട്ടിരിക്കുന്നത്, ഏതാനും ബഹിരാകാശപേടകങ്ങൾ കേടുപാടുകൾ കൂടാതെ ഈ മേഖല കടന്ന് സഞ്ചരിച്ചിട്ടുണ്ട്. എങ്കിലും ഇവയ്ക്കിടയിലെ വലിയ അംഗങ്ങൾ തമ്മിൽ കൂട്ടിയിടികൾ നടക്കാറുണ്ട്, തൽഫലമായി സമാന പരിക്രമണ സ്വഭാവങ്ങളും ഘടനകളുമുള്ള ഒരു ഛിന്നഗ്രഹം കുടുംബം രൂപം കൊള്ളും. കൂട്ടിയിടികൾ ഫലമായി നേർത്ത ധൂളികളും രൂപം കൊള്ളാറുണ്ട്, രാശി പ്രഭ ഉണ്ടാവാൻ ഈ ധൂളികളും കാരണക്കാരാണ്."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%A1%D0%BB%D0%BE%D0%B6%D0%BD%D1%8B%D0%B9_%D0%B2%D1%83%D0%BB%D0%BA%D0%B0%D0%BD","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a2/Taal_volcano_crater.jpg","page_title":"Сложный вулкан","context_page_description":"Сложный вулкан — вулканическая структура, имеющая несколько вершин и кратеров. Сложный вулкан образуется в результате нескольких извержений, происходивших при смещении жерла на небольшие расстояния, нарушающие правильную форму конуса, или вследствие поднятия молодых конусов в руинах или кальдере старого вулкана. Зачастую они формируются за счёт стратовулканов, поскольку потоки лавы и пепла накладываются друг на друга неравномерно, создавая условия для повторных взрывных извержений. Стратовулканы могут образовывать также большие кальдеры, в которых образуются многочисленные небольшие шлаковые конусы, лавовые купола и кратеры.\\nОбычно в конце их развития происходят крупные извержения, во время которых выбрасываются многие кубические километры раскалённого пепла и пемзы, образующихся при застывании магмы. Извержение такого большого количества магмы лишает вулкан опоры, и в результате часто происходит обрушение верхней части конуса и образование кальдеры."},{"page_url":"https://de.wikipedia.org/wiki/Savoyer_Voralpen","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c6/SOIUSA-Alpi_Occidentali-sezione08.png","page_title":"Savoyer Voralpen","context_page_description":"Die Savoyer Voralpen sind eine Gebirgsgruppe der Westalpen. Sie erstrecken sich vom Schweizer Wallis über die beiden Départments Savoie und Haute-Savoie bis ins Département Isère.\\nSie grenzen im Osten an die Grajischen Alpen, im Süden an die Dauphiné-Alpen und im Südwesten an die Dauphiné-Voralpen.\\nGemäß internationaler Übereinkunft gliedern sich die Savoyer Voralpen in sechs Gebirgsstöcke:\\nAiguilles-Rouges-Kette\\nGiffre\\nChablais\\nBornes\\nBauges\\nChartreuse.\\nIn anderen Quellen fehlt die Aiguilles-Rouges-Kette.\\nDie Savoyer Voralpen bilden einen Teil der Kalkzone, die sich als Französische Kalkalpen nach Südwesten in die Dauphiné-Voralpen und Provenzalischen Voralpen, und nach Nordosten in die Schweizer Voralpen und weiter in die nördlichen Kalkalpen der Ostalpen fortsetzt. Diese Zone ist durch Täler recht scharf von den kristallinen Zentralmassiven getrennt."},{"page_url":"https://ja.wikipedia.org/wiki/%E8%92%B2%E9%83%A1%E5%B8%82","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0a/Gamagori_Classic_Hotel.jpg","page_title":"蒲郡市","context_page_description":"蒲郡市は、愛知県の東三河地方に位置する市。\\n三河湾に面する観光都市であり、「蒲郡競艇」の「ムーンライトレース」や、リゾート施設「ラグーナテンボス」のテーマパーク「ラグナシア」、「蒲郡温室みかん」の産地、また西浦温泉、三谷温泉、形原温泉、蒲郡温泉の4つの温泉街を有する。"},{"page_url":"https://cs.wikipedia.org/wiki/Kura%C5%A1","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f6/Kurash_National_Wrestling.jpg","page_title":"Kuraš","context_page_description":"Kuraš, kurash někdy též historicky nepřesně uzbecký kuraš nebo přesněji bucharský kuraš je úpolový sport, zápasnický souboj dvou soupeřů podobné hmotnostní kategorie, snažících se pomocí chvatů na pravidly povolenou část soupeřova obleku a kalhot zvítězit buď hodem na lopatky nebo na body. Zápas probíhá na boso na žíněnce gilam velikosti 14×14m a to výhradně ve stoje. Úchop je volný, je však zakázán od kolen dolů a při pasivním souboji je vyhlášeno džazo, kdy se soupeři chytí do předepsaného úchopu za opasek. Pravidla kuraše reguluje Mezinárodní kurašová asociace."},{"page_url":"https://ml.wikipedia.org/wiki/%E0%B4%87%E0%B4%B2%E0%B5%8D%E0%B4%AF_%E0%B4%8E%E0%B4%B9%E0%B5%8D%E0%B4%B0%E0%B5%86%E0%B5%BB%E0%B4%AC%E0%B5%BC%E0%B4%97%E0%B5%8D","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/93/%D0%9C%D0%BE%D0%BB%D0%BE%D0%B4%D0%BE%D0%B9_%D0%98._%D0%AD%D1%80%D0%B5%D0%BD%D0%B1%D1%83%D1%80%D0%B3.jpg","page_title":"ഇല്യ എഹ്രെൻബർഗ്","context_page_description":"ഇല്യ ഗ്രീഗോറിയെവിച്ച് എഹ്രെൻബർഗ് യഹൂദ സോവിയറ്റ് എഴുത്തുകാരൻ, ബോൾഷെവിക് വിപ്ലവകാരി, പത്രപ്രവർത്തകൻ, ചരിത്രകാരൻ എന്നിവയായിരുന്നു.\\nസോവിയറ്റ് യൂണിയന്റെ ഏറ്റവും വിപുലവും ശ്രദ്ധേയവുമായ രചയിതാക്കളിൽ ഒരാളാണ് എഹ്രെൻബർഗ്. നൂറോളം ശീർഷകങ്ങൾ അദ്ദേഹം പ്രസിദ്ധീകരിച്ചു. ഒരു നോവലിസ്റ്റ്, പത്രപ്രവർത്തകൻ എന്നീ നിലകളിലും പ്രത്യേകിച്ചും, മൂന്ന് യുദ്ധങ്ങളിൽ ഒരു റിപ്പോർട്ടർ എന്ന നിലയിൽ അദ്ദേഹം ആദ്യമായി അറിയപ്പെട്ടു. രണ്ടാം ലോക മഹായുദ്ധത്തെക്കുറിച്ചുള്ള അദ്ദേഹത്തിന്റെ ലേഖനങ്ങൾ പശ്ചിമ ജർമ്മനിയിൽ, പ്രത്യേകിച്ച് അറുപതുകളിൽ കടുത്ത വിവാദങ്ങൾക്ക് കാരണമായി.\\nജോസഫ് സ്റ്റാലിന്റെ മരണശേഷം സോവിയറ്റ് രാഷ്ട്രീയത്തിന്റെ ഒരു യുഗത്തിലേക്കാണ് ദി താവ് എന്ന നോവൽ അതിന്റെ പേര് നൽകിയത്. എഹ്രെൻബർഗിന്റെ യാത്രാ രചനയ്ക്കും വലിയ മാറ്റൊലി ഉണ്ടായിരുന്നു. അദ്ദേഹത്തിന്റെ ഓർമക്കുറിപ്പായ പീപ്പിൾ, ഇയേഴ്സ്, ലൈഫ് ഏറ്റവും അറിയപ്പെടുന്നതും ചർച്ച ചെയ്യപ്പെട്ടതുമായ കൃതിയായിരിക്കാം. അദ്ദേഹവും വാസിലി ഗ്രോസ്മാനും ചേർന്ന് എഡിറ്റ് ചെയ്ത ബ്ലാക്ക് ബുക്ക് ചരിത്രപരമായ പ്രാധാന്യമുണ്ട്. ജൂത വംശജരായ സോവിയറ്റ് പൗരന്മാർക്ക് നാസികൾ നടത്തിയ വംശഹത്യയെക്കുറിച്ച് ഇതിൽ വിശദീകരിക്കുന്നു. ഹോളോകോസ്റ്റിനെക്കുറിച്ചുള്ള ആദ്യത്തെ ഡോക്യുമെന്ററി കൃതിയാണിത്. ഇതുകൂടാതെ, എഹ്രെൻബർഗ് തുടർച്ചയായി ഇതിനെക്കുറിച്ച് കവിതകൾ എഴുതി."},{"page_url":"https://vi.wikipedia.org/wiki/John_Terry","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0a/John_Terry_original.jpg","page_title":"John Terry","context_page_description":"John George Terry là một huấn luyện viên và cựu cầu thủ bóng đá chuyên nghiệp người Anh thi đấu ở vị trí trung vệ. Anh là cầu thủ trưởng thành từ lò đào tạo trẻ của Chelsea và từng là đội trưởng của đội bóng Chelsea cũng như đội tuyển Anh. Terry được bầu là Hậu vệ xuất sắc nhất năm của Cúp các đội vô địch bóng đá quốc gia châu Âu hai lần vào năm 2005 và 2008, Cầu thủ xuất sắc nhất năm của Hiệp hội Cầu thủ Chuyên nghiệp Anh năm 2005, và có tên trong danh sách FIFPro World XI 5 mùa giải liên tiếp, từ 2005 đến 2009. Ngoài ra, anh còn là cầu thủ đội tuyển Anh duy nhất có mặt trong đội hình tiêu biểu của Giải bóng đá vô địch thế giới 2006. Anh là một huyền thoại tại câu lạc bộ bóng đá Chelsea.\\nNăm 2007, Terry trở thành đội trưởng đầu tiên nâng cao chiếc cúp FA trên sân vận động Wembley mới sau khi Chelsea giành chiến thắng 1-0 trước Manchester United trong trận chung kết. Anh cũng là cầu thủ đầu tiên ghi bàn thắng trên sân vận động này khi đánh đầu mở tỉ số 1-0 trong trận giao hữu quốc tế với Brasil."},{"page_url":"https://pl.wikipedia.org/wiki/Riley_Cooper","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a4/Riley_Cooper_Eagles_vs_Redskins.jpg","page_title":"Riley Cooper","context_page_description":"Riley Thomas Cooper – amerykański zawodnik futbolu amerykańskiego, grający na pozycji wide receiver. W rozgrywkach akademickich NCAA występował w drużynie Florida.\\nW roku 2010 przystąpił do draftu NFL. Został wybrany przez drużynę Philadelphia Eagles w piątej rundzie. W drużynie z Pensylwanii występuje do tej pory."},{"page_url":"https://fa.wikipedia.org/wiki/%D9%BE%D8%B1%D8%B3%D8%AA%D9%88_%D8%B5%D8%A7%D9%84%D8%AD%DB%8C","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/28/Salehi_Actress.jpg","page_title":"پرستو صالحی","context_page_description":"پرستو صالحی با نام اصلی الهام صالحی سیاوشانی بازیگر ایرانی است."},{"page_url":"https://sq.wikipedia.org/wiki/Lista_e_Trash%C3%ABgimive_Bot%C3%ABrore_n%C3%AB_rrezik","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5c/San%27a03_flickr.jpg","page_title":"Lista e Trashëgimive Botërore në rrezik","context_page_description":"Lista e trashëgimisë botërore në rrezik është përpiluar nga ana e organizata e Kombeve të Bashkuara për Arsim, Shkencë dhe Kulturë përmes Komitetit për Trashëgimisë Botërore sipas nenin 11.4 të Konventës së Trashëgimisë Botërore, e cila ishte themeluar në vitin 1972 për të përcaktuar dhe për të menaxhuar Vendet e Trashëgimisë Botërore. Hyrjet në listën janë Vende të Trashëgimisë Botërore të kërcënuara, për konservimin e të cilave nevojiten ndërhyrje të mëdha dhe për të cilat \\"është kërkuar ndihmë\\". Lista synon të rrisë ndërgjegjësimin ndërkombëtar për kërcënimet dhe të inkurajojë masat kundërshtuese. Kërcënimet në një vend mund ose të provohen si kërcënime të menjëhershme ose rreziqe potenciale që mund të kenë efekte negative në një vend.\\nNë rastin e zonave natyrore, rreziqet e konstatuara përfshijnë rënien serioze të popullsisë së një specieje të rrezikuar ose të tjerave të vlefshme ose përkeqësimin e bukurisë natyrore ose vlerën shkencore të një vendi të shkaktuar nga aktivitetet njerëzore si prerja, ndotja, vendbanimi, minierat, bujqësia dhe veprat e mëdha publike."},{"page_url":"https://kn.wikipedia.org/wiki/%E0%B2%A8%E0%B2%BE%E0%B2%B8%E0%B3%8D%E0%B2%9F%E0%B3%8D%E0%B2%B0_%E0%B2%A1%E0%B2%AE%E0%B2%B8%E0%B3%8D","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/53/Nostradamuss_house_at_Salon-de-Provence.jpg","page_title":"ನಾಸ್ಟ್ರ ಡಮಸ್","context_page_description":"ಮೈಕೆಲ್ ಡೆ ನಾಸ್ಟ್ರೆಡೇಮ್ ಸಾಮಾನ್ಯವಾಗಿ ಲ್ಯಾಟಿನ್ನಾಸ್ಟ್ರಾಡಾಮಸ, ಈತ ಒಬ್ಬ ಫ್ರೆಂಚ್ ಪ್ರಾಚೀನ ಔಷಧ ವ್ಯಾಪಾರಿ ಮತ್ತು ಹೆಸರಾಂತ ಕಾಲಜ್ಞಾನಿ.ಆತ ತನ್ನ ಹಲವು ತತ್ವ ಸಿದ್ದಾಂತಗಳನ್ನು ಪ್ರಕಟಿಸಿದ್ದಾನೆ. ಅವುಗಳು ಆವಾಗಿನಿಂದಲೂ ಜಗತ್ತಿನಾದ್ಯಂತ ಪ್ರಖ್ಯಾತವಾಗಿವೆ. ಆತನ ಅತ್ಯುತ್ತಮ ಪುಸ್ತಕ ಲೇಸ್ ಪ್ರೊಫೆಟೀಸ್ ಇದರ ಸಂಪುಟ ೧೫೫೫ರಲ್ಲಿ ಪ್ರಕಟಿಸಲ್ಪಟ್ಟಿತು. ಈ ಪುಸ್ತಕದ ಪ್ರಕಟನೆಯು ಆತನ ಮರಣಾನಂತರ ಇದರ ಮರುಮುದ್ರಣಕ್ಕೆ ಯಾವದೇ ಅಡ್ದಿಯಾಗಿರಲಿಲ್ಲ.ಇದರ ಪ್ರಕಾಶಕರು ಇದರಲ್ಲಿನ ವಿಶ್ವ ಪ್ರಸಿದ್ದ ಘಟನೆ ಮತ್ತು ಆಗುಹೋಗುಗಳ ಬಗ್ಗೆ ಜನರು ಆಕರ್ಷಿತರಾಗಿರುವದನ್ನು ಗಮನಿಸಿ ನಾಸ್ಟ್ರಾಡಾಮಸ್ ನ ಜನಪ್ರಿಯತೆಯನ್ನು ಗಮನಿಸಿದರು.ಅದೂ ಅಲ್ಲದೇ ಇಂತಹ ಘಟನೆಗಳ ಬಗ್ಗೆ ಆತ ಊಹಿಸಿರುವದನ್ನು ಗಮನಿಸಿದರೆ ಅದೊಂದು ಪವಾಡವೆಂದು ಅವರು ಹೇಳುತ್ತಾರೆ. ಆತನ ಹಲವಾರು ಸಂಶೋಧನೆಗಳು ಮತ್ತು ತತ್ವಗಳು ಬೈಬಲ್ ನಿಯಮದಲ್ಲಿರುವ ಭೋದನೆಯನ್ನು ಹೋಲುತ್ತವೆಯಲ್ಲದೇ ಇನ್ನುಳಿದ ಯಾವದೇ ಸಿದ್ದಾಂತಕ್ಕೂ ಸರಿಸಾಟಿಯಾಗುವ ಧಾಟಿಯಲ್ಲಿವೆ.\\nಹಲವಾರು ಶಿಕ್ಷಣ ತಜ್ಞರು ಈ ನಾಸ್ಟ್ರಾಡಾಮಸ್ ನ ತತ್ವಗಳನ್ನು ಜಗತ್ತಿನ ಘಟನೆಗಳಿಗೆ ಹೋಲಿಕೆ ಮಾಡುವುದನ್ನು ಇದು ನಾಸ್ಟ್ರಾಡಾಮಸ್ ನ ಈ ನಾಲ್ಕು ಸಾಲಿನ ಪದ್ಯಗಳನ್ನು ತಪ್ಪು ತಪ್ಪಾಗಿ ಅರ್ಥೈಸಲಾಗಿದೆ ಇಲ್ಲವೇ ಅದು ತಪ್ಪು ತರ್ಜುಮೆಯಾಗಿರಬಹದೆಂದು ಅಭಿಪ್ರಾಯಪಡುತ್ತಾರೆ. ಅದೂ ಅಲ್ಲದೇ ಆತನ ಪದ್ಯದ ಸಾಲುಗಳಲ್ಲಿ ನಾಸ್ಟ್ರಾಡಾಮಸ್ ಯಾವ ತೆರನಾಗಿ ಘಟನೆಗಳ ಬಗ್ಗೆ ಏನು ಬರೆದಿದ್ದಾನೆಂಬುದನ್ನು ಯಾರೂ ಸಾಕ್ಷಿ ಪುರಾವೆಗಳನ್ನುಹುಡುಕುವ ಪ್ರಯತ್ನ ಮಾಡಿಲ್ಲ.ಆದರೆ ಈ ಘಟನೆಯ ಸ್ಪಷ್ಟ ಗುರುತಿಸುವಿಕೆಯಲ್ಲಿ ಸಹ ವಿಫಲಗೊಂಡ ಬಗ್ಗೆ ಅವರ ಟೀಕೆ ಇದನ್ನು ಪುನರುಚ್ಚರಿಸಿದೆ."},{"page_url":"https://nl.wikipedia.org/wiki/Knooppunt_Strombeek-Bever","image_url":"http://upload.wikimedia.org/wikipedia/commons/0/0c/Knooppunt_Strombeek-Bever_A12.jpg","page_title":"Knooppunt Strombeek-Bever","context_page_description":"De verkeerswisselaar van Strombeek-Bever is een Belgisch knooppunt tussen de A12 en de Brusselse Ring R0 nabij Strombeek-Bever, een deelgemeente van Grimbergen. Het knooppunt is ongelijkvloers, de hoofdassen van de R0 en A12 lopen normaal rechtdoor, de afslagen zijn via een soort uitgerekte rotonde op elkaar aangesloten."},{"page_url":"https://zh.wikipedia.org/zh-tw/%E7%A3%B7%E9%85%B8%E9%94%8C","image_url":"http://upload.wikimedia.org/wikipedia/commons/5/5e/Fosfore%C4%8Dnan_zine%C4%8Dnat%C3%BD.PNG","page_title":"磷酸锌","context_page_description":"磷酸鋅是一種無機化合物，化學式為Zn₃(PO₄)₂。"},{"page_url":"https://zh.wikipedia.org/zh-tw/NBA%E5%B9%B4%E5%BA%A6%E6%9C%80%E4%BD%B3%E6%96%B0%E7%A7%80","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c3/Jordan_by_Lipofsky_16577.jpg","page_title":"NBA年度最佳新秀","context_page_description":"國家籃球協會年度最佳新秀獎是美國國家籃球協會從1952-53 NBA賽季開始頒發的年度獎勵，表彰例行賽期間表現最優秀的新手球員。獲獎者獲得艾迪·戈特利伯獎盃，名稱源自前費城勇士總教練。\\n獎項由美國和加拿大的體育作家和播音員組建評審團投票選出，每人的選票上可以寫上三人，分別是第一名、第二名和第三名，分別為球員增加五分、三分和一分，總分最高的球員獲獎。\\n盧卡·唐西奇是最新的年度最佳新秀。至今有21位得主成為選秀狀元籤，16人曾獲NBA最有價值球員獎，其中威爾特·張伯倫和衛斯·安索是在同一季獲得兩個獎項。42名退休年度最佳新秀中有19人入選奈史密斯籃球名人紀念堂。另外有三個賽季出現多人並列獲獎，分別是1970-1971年賽季的戴夫·考文斯和傑夫·皮泰瑞，1994-1995年賽季的格蘭特·希爾和傑森·基德，1999–2000年賽季的艾爾頓·布蘭德和史蒂夫·法蘭西斯。共有五位球員獲全票通過勝出，分別是雷夫·辛普森、大衛·羅賓森、布雷克·葛里芬、達米安·里拉德和卡爾-安東尼·唐斯.。\\n除牙買加的派屈克·尤英，西班牙的保羅·蓋索，澳大利亞的凱里·厄文和賓·西蒙斯，加拿大的安德魯·威金斯和斯洛維尼亞的盧卡·唐西奇外，其他獲獎者均是在美國出生，其中三人出生時便有雙重國籍：厄文的雙親，以及威金斯和西蒙斯的父親都是美國人。尤英11歲時移民波士頓地區，厄文兩歲時遷居美國，威金斯和西蒙斯搬到美國念高中；只有蓋索和唐西奇沒有在美國訓練。"},{"page_url":"https://nl.wikipedia.org/wiki/Mols-Linien","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5c/Odden_Faergehavn.jpg","page_title":"Mols-Linien","context_page_description":"Mols-Linien is een Deens bedrijf dat veerdiensten op de Kattegat tussen Jutland en Seeland onderhoudt.\\nDe rederij werd in 1963 opgericht. De eerste veerdienst startte echter pas op 18 mei 1966 en liep tussen Ebeltoft en Sjællands Odde. In 2016 onderhield de rederij twee veerverbindingen, Sjællands Odde-Aarhus en Sjællands Odde-Ebeltoft.\\nDe rederij is voor 78,9% in handen van Kapitaalfonds Polaris; de rest is in handen van de reder zelf."},{"page_url":"https://pt.wikipedia.org/wiki/Helv%C3%A9cia","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8a/Zweifranken_%28cropped%29.jpg","page_title":"Helvécia","context_page_description":"Helvécia é o nome dado pelos antigos romanos à região da Europa Central, e também a personificação nacional feminina da Suíça, que provém do nome da tribo dos helvécios, localizado mais precisamente no planalto situado entre os Alpes suíços e a cordilheira do Jura. A Helvécia correspondia aproximadamente à parte ocidental da Suíça atual, e o nome Helvécia, oriundo de uma derivação neolatina. Ainda é usado de forma poética para se referir ao país.\\nNo século I a.C. uma tribo celta conhecida pelos romanos como helvécios migrou do sul da atual Alemanha para a região da Suíça. Eventualmente deslocaram-se para outros territórios e entraram em choque com os romanos, e acabaram por ser expulsos de volta à Suíça pelo exército de Júlio César, em 58 a.C.. O Império Romano fundou oficialmente a província da Helvécia em 15 a.C..\\nO território viveu em paz e prosperou por muitos anos, até que em 260 d.C. os povos germânicos cruzaram as fronteiras, forçando os romanos a recuarem. A Helvécia passou para o domínio dos francos e outros povos germânicos até a fundação da Confederação Suíça, em 1 de agosto de 1291."},{"page_url":"https://nv.wikipedia.org/wiki/Naakaii_%C5%81izhin%C3%AD_Bik%C3%A9yahd%C4%99%CC%81%C4%99%CC%81%CA%BC_ch%CA%BCiltaat%CA%BCagii","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/03/Circus_ranivorus_distribution.png","page_title":"Naakaii Łizhiní Bikéyahdę́ę́ʼ chʼiltaatʼagii","context_page_description":"Naakaii Łizhiní Bikéyahdę́ę́ʼ chʼiltaatʼagii éí atsá dóó giní dah yikahjí atah yisdzoh, áádóó éí Naakaii Łizhiní Bikéyahdi tʼéiyá hólǫ́. Ndaʼałkaahí dóó ééʼdeetįįhii éí \\"Circus ranivorus\\" deiłníigo dayózhí."},{"page_url":"https://es.wikipedia.org/wiki/Distrito_de_Steinburg","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/11/DEU_Kreis_Steinburg_COA.svg","page_title":"Distrito de Steinburg","context_page_description":"El Distrito de Steinburg es un Landkreis del estado federal de Schleswig-Holstein. El distrito pertenece a la Región Metropolitana de Hamburgo y tiene como capital a Itzehoe."},{"page_url":"https://ro.wikipedia.org/wiki/Sedlisk%C3%A1","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/35/%C4%8Ci%C4%8Dava_zr%C3%BAcanina_hradu.jpg","page_title":"Sedliská","context_page_description":"Sedliská este o comună slovacă, aflată în districtul Vranov nad Topľou din regiunea Prešov. Localitatea se află la altitudinea de 138 m deasupra n.m., se întinde pe o suprafață de 10,13 km² și în 2017 număra 1.422 de locuitori."},{"page_url":"https://de.wikipedia.org/wiki/Alexander_von_Jugoslawien","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c4/HRH_Crown_Prince_Alexander_II_with_Legion_of_Honour.jpg","page_title":"Alexander von Jugoslawien","context_page_description":"Alexander II. von Jugoslawien ist der aktuelle serbische Thronprätendent des Hauses Karađorđević."},{"page_url":"https://lv.wikipedia.org/wiki/Eiropas_autoce%C4%BC%C5%A1_E19","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3e/A4_RIJSWIJK.JPG","page_title":"Eiropas autoceļš E19","context_page_description":"Eiropas autoceļš E19 ir daļa no Starptautiskā E ceļu tīkla. Ceļš sākas Amsterdamā, Nīderlandē, bet beidzas Parīzē, Francijā. Ceļa garums ir 591 kilometri."},{"page_url":"https://cs.wikipedia.org/wiki/Wengernalpbahn","image_url":"http://upload.wikimedia.org/wikipedia/commons/3/3a/WAB_Wengen_Pendelzuege_Sommer_09.jpg","page_title":"Wengernalpbahn","context_page_description":"Wengernalpbahn: Lauterbrunnen - Wengen - Kleine Scheidegg - Grindelwald je světově nejdelší ozubená železnice s nepřetržitým ozubeným hřebenem, tedy nemá pouze adhezní úseky. V současnosti patří tato společnost pod Jungfraubahnen."},{"page_url":"https://da.wikipedia.org/wiki/Ritual","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9a/Edmund_blair_leighton_accolade.jpg","page_title":"Ritual","context_page_description":"Et ritual er en symbolsk handling der har til formål at påvirke noget, f.eks. at opnå guders velvilje eller skabe en overgang fra en tilstand til en anden. Med et ritual følger en forventning eller en påstand, om at de pågældende ord og handlinger er i stand til ændre noget ved ritualets objekt. Et ritual omfatter typisk en række handlinger, ceremonier og ord, som kan udgøre en forskrift på, hvorledes den specifikke rite udføres."},{"page_url":"https://fr.wikipedia.org/wiki/%C3%89levage_bovin_en_Espagne","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e9/051127_1327_Villalba_de_los_Llanos_-_Vaca_morucha_T01.JPG","page_title":"Élevage bovin en Espagne","context_page_description":"L'Espagne est un pays d'élevage où la race bovine tient une place très importante. Le contexte géographique a façonné de nombreuses races bouchères. En revanche, les races autochtones sont de mauvaises à moyennes laitières, aussi des races purement laitières ont été importées pour assurer l'alimentation de l'industrie agroalimentaire."},{"page_url":"https://arz.wikipedia.org/wiki/%D8%AA%D8%A7%D8%B1%D9%8A%D8%AE_%D9%85%D8%B5%D8%B1_%D8%A7%D9%84%D9%82%D8%A8%D8%B7%D9%8A%D9%87","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2d/ModernEgypt%2C_Muhammad_Ali_by_Auguste_Couder%2C_BAP_17996.jpg","page_title":"تاريخ مصر القبطيه","context_page_description":"تاريخ مصر القبطيه هو مرحله مهمه من مراحل تاريخ مصر ابتدت فى القرن الاول الميلادى، لكن رغم كده فجذور الثقافه القبطيه بتمتد لعصور مصر الفرعونيه. اللغه القبطيه اللى لسه بتستخدم لغاية النهارده فى طقوس الكنيسه القبطيه المصريه هى اخر مرحله من مراحل تطور اللغه المصريه القديمه اللى كان المصريين بيكتبوا و بيقروا بيها من 5000 سنه، و استمر المصريين يستخدموا لغتهم القبطيه لكذا قرن بعد دخول العرب مصر، و لسه لغاية النهارده كلمات كتيره من اللغه القبطيه بتستخدم و لسه الفلاح المصرى مسيحى او مسلم بيستعمل التقويم القبطى فى تنظيم زراعة ارضه. و بيظهر بوضوح تأثير التراث المصرى القديم فى الفن و الادب القبطى. و تاريخ اقباط مصر بمفهومه الاثنولوجى و مفهومه الثيولوجى هو تاريخ مصر اللى مر على كل المصريين من بداية تاريخ مصر و لحد النهارده، لكن اكمن الاقباط بالمفهوم الدينى عدت عليهم احداث تاريخيه خاصه بيهم فليهم برضه تاريخ خاص، صحيح هو تاريخ مصر لكن انعكاساته عليهم كانت مختلفه عن انعكاساته على بقية المصريين. فى الواقع تاريخ مصر هو تاريخ الأقباط حيث انهم عاصروا كل العصور و المراحل التاريخيه اللى سادت على ارض مصر من ايام الفراعنه لحد النهارده."},{"page_url":"https://it.wikipedia.org/wiki/Sainte-Victoire-de-Sorel","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/84/Sainte-Victoire-de-Sorel_-_presbyt%C3%A8re.jpg","page_title":"Sainte-Victoire-de-Sorel","context_page_description":"Sainte-Victoire-de-Sorel è un comune del Canada, situato nella provincia del Québec, nella regione di Montérégie."},{"page_url":"https://en.wikipedia.org/wiki/2008_Beijing_Drum_Tower_stabbings","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/76/Beijing_drum_tower.JPG","page_title":"2008 Beijing Drum Tower stabbings","context_page_description":"On August 9, 2008 in the People's Republic of China, two American tourists and their Chinese tour guide were stabbed at the historic Beijing Drum Tower; one of the tourists was killed. The assailant then committed suicide by jumping from the tower. The incident occurred during the 2008 Summer Olympics in Beijing. The incident has been described as isolated since attacks on foreigners while visiting China are rare."},{"page_url":"https://kn.wikipedia.org/wiki/%E0%B2%95%E0%B2%B0%E0%B3%8D%E0%B2%A8%E0%B2%BE%E0%B2%9F%E0%B2%95%E0%B2%A6_%E0%B2%AE%E0%B3%8A%E0%B2%A6%E0%B2%B2_%E0%B2%B8%E0%B3%8C%E0%B2%B0_%E0%B2%B5%E0%B2%BF%E0%B2%A6%E0%B3%8D%E0%B2%AF%E0%B3%81%E0%B2%A4%E0%B3%8D_%E0%B2%B8%E0%B3%8D%E0%B2%A5%E0%B2%BE%E0%B2%B5%E0%B2%B0","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/63/Solar_Power_Plant_Karnataka_I_in_state_of_Karnataka%2C_India%2C_40.5-MWp_DC.jpg","page_title":"ಕರ್ನಾಟಕದ ಮೊದಲ ಸೌರ ವಿದ್ಯುತ್ ಸ್ಥಾವರ","context_page_description":"ಕರ್ನಾಟಕದ ಮೊದಲ ಸೌರ ವಿದ್ಯುತ್ ಸ್ಥಾವರವು ೪0.೫ ಮೆಗಾವ್ಯಾಟ್ ದ್ಯುತಿವಿದ್ಯುಜ್ಜನಕ ವಿದ್ಯುತ್ ಕೇಂದ್ರ ಆಗಿದೆ.ಇದು ಕರ್ನಾಟಕ ರಾಜ್ಯದ ಕೊಪ್ಪಳ ತಾಲೂಕಿನ ಚಿಕ್ಕೋಪ ಎನ್ನುವ ಗ್ರಾಮದಲ್ಲಿ ಇದೆ.ಇದನ್ನು ೨೦೧೮ ಜನವರಿ ತಿಂಗಳಲ್ಲಿ ನಿಯೋಜಿಸಲಾಯಿತು.ಇದು ೧೭೮ ಎಕರೆ ಪ್ರದೇಶವನ್ನು ಒಳಗೊಂಡಿದೆ.ಇದು ಸರಿ ಸುಮಾರು ೭೨00೦ ಜನರಿಗೆ ಶಕ್ತಿಯನ್ನು ಪೂರೈಸುವ ಶಕ್ತಿಯನ್ನು ಹೊಂದಿದೆ.ಇದನ್ನು ಖಾಸಗಿ ಸೌರ ಯೋಜನೆಯು ನಿರ್ವಹಿಸುತ್ತದೆ.\\nಇದನ್ನು ೧೨೫೦೮೦ ಸೌರ ಕೋಶವನ್ನು ಉಪಯೋಗಿಸಿ ರಚಿಸಲಾಗಿದೆ.\\nಇದರಿಂದ ತಯಾರಾದ ಸೌರ ಶಕ್ತಿಯನ್ನು ಭಾರತದ ಸೌರ ಶಕ್ತಿ ನಿಗಮವು ತಗೆದುಕೊಳ್ಳುತ್ತದೆ.\\nಡೆವಲಪರ್ ಸೋಲಾರ್ ಅರೈಸ್ ಇಂಡಿಯಾ ಪ್ರಾಜೆಕ್ಟ್ಸ್ ಲಿಮಿಟೆಡ್, ಇದರ ಅಬಿವೃದ್ಧಿಕಾರರು ಆಗಿರುತ್ತಾರೆ. ಷೇರುದಾರರು ಥಾಮಸ್ ಲಾಯ್ಡ್ ಗ್ರೂಪ್, ಜಾಗತಿಕ ಇಂಧನ ದಕ್ಷತೆ, ಹವಮಾನ ಬದಲಾವಣೆ ಮತ್ತು ನವೀಕರಿಸಬಹುದಾದ ಇಂಧನ ನಿಧಿಗೆ, ಯುರೋಪಿಯನ್ ಇನ್ವೆಸ್ಟ್ಮೆಂಟ್ ಬ್ಯಾಂಕ್ ಗ್ರೂಪ್ನ ಸಲಹೆಯಂತೆ, ಕೊಟಕ್ ಮಹೀಂದ್ರಾ ಕೋರ್ ಇನ್ಫ್ರಾಸ್ಟ್ರಕ್ಚರ್ ಇಂಡಿಯಾ ಫಂಡ್ ಮತ್ತು ಸ್ಥಾಪಕ ನಿರ್ವಹಣಾ ತಂಡ ಅನಿಲ್ ನಾಯರ್, ಜೇಮ್ಸ್ ಅಬ್ರಹಾಂ ಮತ್ತು ತಾನ್ಯಾ ಸಿಂಘಾಲ್ ಅವರನ್ನು ನಿರ್ವಹಿಸುತ್ತಿತ್ತು. ಸೋಲಾರ್ ಏರಿಸ್ ಭಾರತದಲ್ಲಿ ೧೩೦ ಮೆಗಾವ್ಯಾಟ್ ಗ್ರಿಡ್-ಸಂಪರ್ಕಿತ ಸೌರ ವಿದ್ಯುತ್ ಯೋಜನೆಗಳನ್ನು ಹೊಂದಿದೆ ಮತ್ತು ನಿರ್ವಹಿಸುತ್ತದೆ. ಸೌರ ಅರೈಸ ಎನ್ನುವ ಕಂಪನಿಯು ಭಾರತದಾದ್ಯಂತ ಒಟ್ಟಾರೆ ಸುಮಾರು ೧೩೦ ಮೆಗಾ ವ್ಯಾಟ್ ಸಂಪರ್ಕದಲ್ಲಿರುವ ಸೌರ ಯೋಜನೆಯನ್ನು ನಿರ್ವಹಿಸುತ್ತದೆ."},{"page_url":"https://ast.wikipedia.org/wiki/Pueblu_xud%C3%ADu","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/19/IDF_soldier_put_on_tefillin.jpg","page_title":"Pueblu xudíu","context_page_description":"El pueblu xudíu ye un grupu descendiente de los hebreos y antiguos israelites del llevante mediterraneu. La relixón constitúi un posible aspeutu de pertenencia al pueblu xudíu según les tradiciones, práutiques culturales, sociales y llingüístiques. Magar pueden presentar carauterístiques comunes, tales como l'idioma o la creencia, los xudíos nun constitúin un grupu étnicu homoxéneu, por ello la definición precisa de xudíu ye revesosa y puede variar dependiendo de la énfasis que se faiga na observancia relixosa o na identidá secular.\\nLos xudíos sufrieron una llarga historia de persecución en distintos llugares y la so población foi variando a lo llargo de los sieglos. Según datos de Berman Jewish DataBank, en 2015 la población xudía algamaba los 14,3 millones. Representando alredor d'un 0,2 per cientu de la población mundial. La mayoría d'ellos mora n'Israel y Estaos Xuníos. Según investigaciones llevaes a cabu na Universidá Hebrea de Xerusalén, el 96 per cientu de los xudíos que moren fora d'Israel tiende a concentrase en diez países, toos ellos democráticos."},{"page_url":"https://en.wikipedia.org/wiki/John_II,_Count_of_Gorizia","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/99/XIngeram_Codex_091b-G%C3%B6rz.jpg","page_title":"John II, Count of Gorizia","context_page_description":"John II of Gorizia was the penultimate\\nCount of Gorizia. He ruled the County of Gorizia from 1454 until his death."},{"page_url":"https://de.wikipedia.org/wiki/Postamt","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b2/Postamt_Thorn.JPG","page_title":"Postamt","context_page_description":"Als Postamt wurde bis zur Privatisierung in Deutschland und Österreich eine örtliche Dienststelle der Post bezeichnet, die in einem öffentlichen Gebäude, ISO-Container oder amtlich gemieteten Räumen untergebracht ist. Der Begriff stand auch für eine Verwaltungseinheit, wenn eine Posteinrichtung für bestimmte Verwaltungstätigkeiten anderer Posteinrichtungen zuständig war. Seit der Privatisierung sind die Nachfolger der Postämter für den Abgang Postfilialen und für die Zustellung die Zustellstützpunkte. Die Poststellen sind heute meist Postagenturen. Bei der Bundeswehr werden die Postämter im Ausland oft in ISO-Container eingerichtet."},{"page_url":"https://fa.wikipedia.org/wiki/%D8%B7%D8%B1%D8%AD_%DB%8C%DB%8C%D9%86%D9%88%D9%86","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/bf/The_Middle_East_in_1980.png","page_title":"طرح یینون","context_page_description":"طرح یینون به مقاله‌ای گفته می‌شود که در سال ۱۹۸۲ میلادی در نشریه عبری کی‌وونیم منتشر شد و از راهبرد جدید اسرائیل برای دهه ۸۰ میلادی خبر می‌داد. کی‌وونیم نشریه‌ای بود که به بحثهای مربوط به صهیونیسم و یهودیت در بین سالهای ۱۹۷۸ تا ۱۹۸۷ می‌پرداخت. این مجله در جهت پیشبرد اهداف سازمان جهانی صهیونیسم فعالیت می‌کرد و مقر اصلی آن در اورشلیم بود. این مقاله توسط فردی به نام اودِد یینون مشاور پیشین آریل شارون ارائه شد که پیش از آن از افراد رسمی وزارت خارجه اسرائیل نیز بود. وی روزنامه‌نگار جروزالم پست نیز بود و برای آن روزنامه مقاله‌های سیاسی می‌نوشت.\\nاین مقاله در آن زمان بعنوان نخستین پروژهٔ برنامه‌ریزی‌شدهٔ سیاسی برای دامن‌زدن و گسترش فرقه‌گرایی در خاورمیانه شناخته می‌شد. بنا بر باور بسیاری از پژوهشگران، اندیشهٔ اودِد یینون بر روی دو مبحث مربوط به خاورمیانه تأثیر بسزایی گذاشته‌است. نخستین تأثیر آن بر روی سیاستهای دولت جرج دابلیو بوش ارزیابی شد و دیگری نیز ایجاد تئوری‌های توطئه بود و پرسش‌هایی مطرح شد که آیا این مقاله تنها بصورت تصادفی بحران‌های خاورمیانه را پیشبینی کرده بود، یا اینکه برنامه‌ای از پیش تعیین شده توسط سران اسرائیل بود که به سرنگونی صدام حسین در جنگ عراق و ظهور داعش و بروز جنگ داخلی سوریه ختم شد."},{"page_url":"https://fr.wikipedia.org/wiki/Nicolas_Sicard","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/cf/Nicolas_Sicard%2C_Pont_de_la_guilloti%C3%A8re_%C3%A0_Lyon.jpg","page_title":"Nicolas Sicard","context_page_description":"Nicolas Sicard, né le 9 janvier 1846 à Lyon, où il est mort le 1ᵉʳ janvier 1920, est un artiste peintre français. Il est reconnu pour ses nombreuses peintures d’histoire et de guerre mais son œuvre est très diverse. Il fut élève de Danguin et Vibert avant de devenir lui-même professeur puis directeur de l’école des beaux-arts de Lyon. Il reçoit la médaille d’honneur en 1889."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%91%D0%BE%D1%87%D0%BA%D0%B0_(%D0%B2%D0%B8%D1%89%D0%B8%D0%B9_%D0%BF%D1%96%D0%BB%D0%BE%D1%82%D0%B0%D0%B6)","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2a/Barrelroll.gif","page_title":"Бочка (вищий пілотаж)","context_page_description":"Бочка — фігура пілотажу, при виконанні якої літальний апарат повертається відносно поздовжньої осі на 360° із збереженням загального напрямку польоту."},{"page_url":"https://en.wikipedia.org/wiki/HMS_Ajax_(22)","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c6/HMS_Achilles_%2870%29.jpg","page_title":"HMS Ajax (22)","context_page_description":"HMS Ajax was a Leander-class light cruiser which served with the Royal Navy during World War II. She became famous for her part in the Battle of the River Plate, the Battle of Crete, the Battle of Malta and as a supply escort in the Siege of Tobruk. This ship was the eighth in the Royal Navy to bear the name. In February 1942, she was adopted by the civil community of Halifax."},{"page_url":"https://ko.wikipedia.org/wiki/%EC%A6%9D%EA%B3%B5","image_url":"http://upload.wikimedia.org/wikipedia/commons/5/59/Zeng_Gong.jpg","page_title":"증공","context_page_description":"증공은 북송의 산문가이다. 자는 子固, 시호는 文定. 建昌 南豊에서 출생. 왕안석·유종원·한유·소순·소식·소철·구양수와 더불어 당송팔대가로 일컬어지며 증조·증포·증우·증굉·증협·증돈과 더불어 南豐七曾으로도 일컬어진다. 세상에서 南豐先生으로 불리기도 했다."},{"page_url":"https://tg.wikipedia.org/wiki/%D0%9C%D0%B0%D1%80%D0%BA%D0%BE%D1%81_%D0%91%D0%BE%D0%BB%D0%B0%D0%B4%D0%BE%D1%81","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8e/Audax_Italiano_v_Colo-Colo_20200209_31.jpg","page_title":"Маркос Боладос","context_page_description":"Маркос Николас Боладос Идалго — футболбози чилигӣ, нимҳимоятгари ҳуҷумкуни канорӣ."},{"page_url":"https://zh.wikipedia.org/zh-cn/SMRT%E5%B7%B4%E5%A3%AB","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c5/SMB136C-855.JPG","page_title":"SMRT巴士","context_page_description":"SMRT巴士是新加坡的公共运输机构之一，于1982年5月31日成立，当时称为八达巴士。2001年，SMRT集团收购了八达巴士有限公司。八达巴士于2004年5月10日正式更名为SMRT巴士。"},{"page_url":"https://no.wikipedia.org/wiki/Bugulma","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b5/Memorial_BOB_Bugulma_01.jpg","page_title":"Bugulma","context_page_description":"Bugulma er en by i Republikken Tatarstan i Russland. Innbyggertall: 93 014.\\nBugulma ble grunnlagt i 1736. Byen utviklet seg til et sentrum for oljeproduksjon og maskinbygging."},{"page_url":"https://ko.wikipedia.org/wiki/%EC%84%B8%EB%A0%88%EC%8A%A4_(%EC%99%9C%ED%96%89%EC%84%B1)","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/db/PIA20132-Ceres-DwarfPlanet-Dawn-3rdMapOrbit-HAMO-image69-20151018.jpg","page_title":"세레스 (왜행성)","context_page_description":"세레스는 소행성대에 있는 왜행성으로, 공식 명칭인 소행성명은 1 세레스이다. 현재 태양계의 소행성대에 존재하는 유일한 왜행성이다. 1801년 1월 1일 이탈리아의 천문학자 주세페 피아치가 발견하여, 그 후 반세기 동안 행성에 속했었다. 세레스라는 이름은 로마 신화의 농업과 곡물의 여신인 케레스에서 따왔다.\\n지름은 970 km 로, 소행성대에서 가장 크고 무거운 천체이다.\\n다른 소행성은 불규칙한 모형, 약한 중력임에 반해 세레스는 관측을 통해 구형임이 밝혀졌다.\\n표면은 물얼음과 다양한 수화물이 혼합되어 있는 것으로 추정된다.\\n세레스의 내부는 암석질의 핵 그리고 얼음 맨틀으로 구성되어 있으며, 표면 아래에는 물로 이루어진 바다가 존재하는 것으로 생각된다.\\n세레스의 겉보기등급은 +6.7 ~ +9.3 등급으로, 육안으로는 볼 수가 없다.\\n2007년 9월 27일, NASA에서는 4 베스타, 세레스 를 탐사하기 위하여 돈 탐사선을 발사했다."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%9F%D0%BE%D0%BD%D0%BD%D0%B5%D0%BB%D1%8C,_%D0%96%D0%B0%D0%BD-%D0%9F%D1%8C%D0%B5%D1%80","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/78/Jean-Pierre_Ponnelle_par_Claude_Truong-Ngoc_1980.jpg","page_title":"Поннель, Жан-Пьер","context_page_description":"Жан-Пьер Понне́ль — французский оперный режиссёр, постановщик и сценограф."},{"page_url":"https://da.wikipedia.org/wiki/Slaget_ved_Halbe","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c4/Waldfriedhof_Halbe_Glockenplastik.jpg","page_title":"Slaget ved Halbe","context_page_description":"Slaget ved Halbe var et slag, der fandt sted fra 24. april til 1. maj 1945 i slutningen af 2. verdenskrig.\\nUnder 2. Verdenskrig blev resterne af den tyske 9. armé under kommando af general Theodor Busse omringet af sovjetiske styrker den 16. april 1945. Fra 28. april var resten af arméen trængt sammen indenfor området Löpten – Hermsdorf – Märkisch Buchholz – Halbe sydøst for Berlin. Indenfor det omringede område befandt der sig omkring 200.000 soldater samt 10-15.000 civile borgere, deriblandt adskillig tusinder flygtninge fra områderne øst for floden Oder.\\nChefen for XI. SS Panzerkorps, Matthias Kleinheisterkamp, kaldte alle chefer ned til og med bataljonschefer sammen til den befalingsudgivelse. Et udbrud skulle forsøges, og den eneste mulighed var at bryde gennem omringningen i den lille by Halbe og derfra fortsætte tværs over Dresden–Berlin motorvejen mod vest i et forsøg på at nå frem til general Walther Wencks 12. armé vest for Berlin. På tidspunktet for udbrudsforsøget var Halbe besat og omringet af stærke sovjetiske styrker, hvis ledere forventede et udbrud gennem området Oderin-Halbe-Teupitz, idet der ikke var andre muligheder."},{"page_url":"https://pl.wikipedia.org/wiki/Schronisko_powy%C5%BCej_Jaskini_nad_Sza%C5%84cem","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/47/RenderImage83.jpg","page_title":"Schronisko powyżej Jaskini nad Szańcem","context_page_description":"Schronisko powyżej Jaskini nad Szańcem – schronisko położone w orograficznie lewych zboczach Doliny Będkowskiej, w bocznym wąwozie Pod Sadem. Znajduje się na jego południowych zboczach, w niewielkiej, bezimiennej skale powyżej udostępnionej do wspinaczki skały Barykada. Otwór wejściowy znajduje się na poziomie ziemi i widoczny jest tylko z odległości kilku metrów. Pod względem geograficznym jest to obszar Wyżyny Olkuskiej wchodzącej w skład Wyżyny Krakowsko-Częstochowskiej."},{"page_url":"https://fi.wikipedia.org/wiki/J%C3%A4%C3%A4kiekon_maailmanmestaruuskilpailut_2010","image_url":"http://upload.wikimedia.org/wikipedia/commons/b/bd/SAParenaPanoN.jpg","page_title":"Jääkiekon maailmanmestaruuskilpailut 2010","context_page_description":"Jääkiekon maailmanmestaruuskilpailut 2010 olivat 74. miesten MM-kilpailut. Turnaus pelattiin Saksassa 7.–23. toukokuuta 2010. Kisakaupunkeina toimivat Köln ja Mannheim. Lisäksi kisojen avausottelu pelattiin Gelsenkirchenissä, jalkapallojoukkue Schalke 04:n kotistadionilla, Veltins-Arenalla. Mestaruuden voitti Tšekki, joka kukisti loppuottelussa kaksi edellistä mestaruutta voittaneen Venäjän. Pronssia sai Ruotsi. Suomi hävisi puolivälierissä mestaruuden voittaneelle Tšekille rangaistuslaukauskilpailun jälkeen.\\nPelijärjestelmä oli sama kuin yhdeksänä aiempana vuonna; ensin pelattiin neljässä alkulohkossa, joiden kolme parasta jatkoivat jatkolohkoihin E ja F, lohkojen huonoimmat joutuivat putoamislohkoon G. Molempien jatkolohkojen neljä parasta pelasivat puolivälierät, joiden voittajat jatkoivat välieriin. Välierien häviäjät pelasivat pronssiottelun ja voittajat loppuottelun.\\nSaksan ja Yhdysvaltojen välisessä avausottelussa syntyi uusi maailmanennätys, kun paikalla oli 77 803 katsojaa."},{"page_url":"https://fr.wikipedia.org/wiki/Formation_de_Dashanpu","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4d/%D0%A7%D0%B5%D1%80%D0%B5%D0%BF_%D1%82%D0%B5%D0%BB%D0%B5%D0%BE%D0%B7%D0%B0%D0%B2%D1%80%D0%B0.jpg","page_title":"Formation de Dashanpu","context_page_description":"La formation de Dashanpu est une formation géologique chinoise d'âge Jurassique moyen, soit il y a entre 174,1 ± 1,0 et 163,5 ± 1,0 Ma. Cette formation est célèbre pour les fossiles qu'elle renferme et, en particulier, ses dinosaures."},{"page_url":"https://cs.wikipedia.org/wiki/D%C5%AFm_um%C4%9Bn%C3%AD_(Mnichov)","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/ad/M%C3%BCnchen_%E2%80%94_Haus_der_Kunst_%E2%80%94_Mittelhalle.jpg","page_title":"Dům umění (Mnichov)","context_page_description":"Dům umění je výstavní síň a galerie v Mnichově, Prinzregentenstrasse, na jižním okraji Anglické zahrady, za bývalou residencí. Nemá své vlastní sbírky, nýbrž slouží různým výstavám..Budova patří bavorskému státu a provozuje ji nadace s významným podílem státu."},{"page_url":"https://sv.wikipedia.org/wiki/Komoro","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ea/Nunobiki-kannon_Komoro_Shinshu.jpg","page_title":"Komoro","context_page_description":"Komoro är en stad i Nagano prefektur i Japan, och ligger på ön Honshu. Komoro fick stadsrättigheter 1 april 1954."},{"page_url":"https://pl.wikipedia.org/wiki/Bia%C5%82y_Kamie%C5%84_(Ukraina)","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/22/BialyKamienBudynekAdministracji.JPG","page_title":"Biały Kamień (Ukraina)","context_page_description":"Biały Kamień – wieś na Ukrainie, w obwodzie lwowskim, w rejonie złoczowskim. Liczy niecałe 800 mieszkańców.\\nZa II Rzeczypospolitej miejscowość była siedzibą wiejskiej gminy Białykamień w powiecie złoczowskim w województwie tarnopolskim. W 1921 roku liczył 1515 mieszkańców.\\nWedług jednej z hipotez jest to miejsce urodzenia króla Polski Michała Korybuta Wiśniowieckiego."},{"page_url":"https://sv.wikipedia.org/wiki/1964","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6f/Juliette_Binoche_and_Jean_Reno.jpg","page_title":"1964","context_page_description":"1964 var ett skottår som började en onsdag i den gregorianska kalendern."},{"page_url":"https://fr.wikipedia.org/wiki/Site_arch%C3%A9ologique_de_Jublains","image_url":"http://upload.wikimedia.org/wikipedia/commons/b/bd/Jublains_museum_deesse_mere_sanctuaire.JPG","page_title":"Site archéologique de Jublains","context_page_description":"Le site archéologique de Jublains est un ensemble de vestiges, datés principalement de l'époque romaine, présents sur le territoire de l'actuelle commune française de Jublains, située dans le département de la Mayenne.\\nLieu d'un sanctuaire du peuple celte des Diablintes, une ville du nom de Noviodunum décidée par le pouvoir romain, devient la capitale de ce peuple au moment de l'organisation administrative augustéenne et s'urbanise dans la seconde moitié du Iᵉʳ siècle. La cité est dotée d'une parure monumentale, avec un ensemble de monuments publics témoignant de la diffusion du mode de vie romain : théâtre, forum et thermes, outre le sanctuaire celte qui est reconstruit en dur. La cité témoigne aussi des difficultés rencontrées à partir du IIIᵉ siècle, avec la construction d'un élément fortifié qui constitue encore l'élément le plus impressionnant du site. Durant l'Antiquité tardive, la cité perd son statut de capitale, lorsque l'entité diablinte est rattachée au territoire des Cénomans.\\nEssentiellement connu pour le « camp romain », classé monument historique en 1840, le site recèle d'autres vestiges intéressants tels que le théâtre, les thermes et le temple romain."},{"page_url":"https://en.wikipedia.org/wiki/Suomenlinna_Church","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/53/Lighthouse_Finland_1408_%284046568327%29.jpg","page_title":"Suomenlinna Church","context_page_description":"The Suomenlinna Church in Helsinki, Finland, was built in 1854 as an Eastern Orthodox garrison church for the Russian troops stationed at the Suomenlinna sea fortress. The fortress comprises five islands joined together by bridges, and the church is the central feature on the island of Iso Mustasaari, located at its highest point. It is surrounded by other fortress buildings, but the old parade ground is immediately to the east, and a park lies immediately to the south. It is oriented southwest to northeast so that it would align with the Crownwork Ehrensvärd defense front located to the southwest of the church.\\nBefore the design and construction of the Orthodox church, plans were drawn up in the 1820s by architect Carl Ludvig Engel for a church on the same site, but designed in the neoclassical style in keeping with the rest of buildings at the fortress and the buildings in the capital city, Helsinki. The actual church was designed by Konstantin Thon, an official architect of Imperial Russia during the reign of Czar Nicholas I, whose major works included the Cathedral of Christ the Saviour, the Grand Kremlin Palace, and the Kremlin Armoury in Moscow."},{"page_url":"https://sk.wikipedia.org/wiki/Kapu%C5%A1iansky_hrad","image_url":"http://upload.wikimedia.org/wikipedia/commons/7/7a/Slovakia_Castle_Kapusany_1.JPG","page_title":"Kapušiansky hrad","context_page_description":"Kapušiansky hrad je zrúcaninou hradu nad obcou Kapušany, nad cestou do Bardejova a je situovaná na skalnom výbežku vrchu Zámčisko."},{"page_url":"https://zh.wikipedia.org/zh-tw/%E8%A7%A3%E6%94%BE%E8%B7%AF_(%E6%9D%AD%E5%B7%9E)","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5e/20180829%E6%84%8F%E6%B3%95%E6%9C%8D%E9%A5%B0%E5%9F%8E%E5%92%8C%E6%84%8F%E6%B3%95%E5%A4%A7%E5%8E%A6.jpg","page_title":"解放路 (杭州)","context_page_description":"解放路位於中國浙江省杭州市上城區中部，是杭州市的東西交通幹道。東起環城東路南段金衙莊，西接西湖景區，與湖濱路和南山路相接。沿線與浣紗路、中山路、中河路、建國路相交。長2148米，寬18米，為瀝青路面。在1980-90年代是杭州最繁華的商業購物中心。沿途的著名建築物有浙二醫院、奎元館、天香樓、杭州解百等。通多路公共汽車。"},{"page_url":"https://fr.wikipedia.org/wiki/Vieillissement_de_l%27Europe","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b0/Countries_by_Birth_Rate_in_2017.svg","page_title":"Vieillissement de l'Europe","context_page_description":"Le vieillissement de l'Europe est un phénomène démographique et sociétal caractérisé par une baisse du taux de fécondité, une baisse du taux de mortalité et une espérance de vie grandissante en Europe.\\nCe vieillissement entraîne une baisse du pourcentage d'Européens dans la population mondiale qui devrait s'amplifier au cours des quatre prochaines décennies. Il est aussi à l'origine de l'augmentation de la population âgée et donc de problèmes se rapportant à la main-d'œuvre. Ainsi la population européenne en âge de travailler constitue, en 2005, 11,9 % de la population active mondiale mais elle pourrait passer à seulement 6,4 % en 2050. Ce phénomène pourrait conduire à un déclassement de l'Europe et de son importance dans le monde."},{"page_url":"https://sr.wikipedia.org/wiki/%D0%9E%D0%B1%D0%B5%D1%80%D1%80%D0%BE%D1%82_(%D0%91%D0%B0%D0%B4%D0%B5%D0%BD-%D0%92%D0%B8%D1%80%D1%82%D0%B5%D0%BC%D0%B1%D0%B5%D1%80%D0%B3)","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6e/RotMuehlrad.jpg","page_title":"Оберрот (Баден-Виртемберг)","context_page_description":"Оберрот општина је у њемачкој савезној држави Баден-Виртемберг. Једно је од 30 општинских средишта округа Швебиш Хал. Према процјени из 2010. у општини је живјело 3.699 становника. Посједује регионалну шифру 8127062."},{"page_url":"https://de.wikipedia.org/wiki/Burg_Kalbe","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b2/Kalbe_Burg.jpg","page_title":"Burg Kalbe","context_page_description":"Die Burg Kalbe, früher Calbe geschrieben, ist die Ruine einer Wasserburg zwischen zwei Armen der Milde im Stadtgebiet der Stadt Kalbe im Altmarkkreis Salzwedel in Sachsen-Anhalt.\\nDie Wasserburg wurde im 10. Jahrhundert als sächsische Grenzfestung gegen die Wenden erbaut, vermutlich an der Stelle einer slawischen Wallburg im Sumpfgebiet der Milde. Ein in ihrem Schutz begründetes Nonnenkloster, das die Obotriten 983 verwüsteten, bestand hier bis 1121. Die Burg gehörte zu den vier altmärkischen Burgwarden, die landesherrliche Gerichts- und Wehrbezirke verwalteten, neben Burg Tangermünde, Osterburg und Arneburg. Diese schützten das fränkisch kolonisierte Gebiet und die Missionsklöster zwischen Elbe und Milde.\\nDie Burg war durch drei Wassergräben und vier Vorburgen und Verschanzungen vor Angreifern gut geschützt. Sie war namensgebend für das märkische Adelsgeschlecht von Kalben, das 1207 urkundlich in Zusammenhang mit der Burg genannt wird und hier Ministerialendienst tat."},{"page_url":"https://cs.wikipedia.org/wiki/Nedachlebice","image_url":"http://upload.wikimedia.org/wikipedia/commons/7/7b/Nedachlebice-znak.png","page_title":"Nedachlebice","context_page_description":"Obec Nedachlebice se nachází v okrese Uherské Hradiště ve Zlínském kraji. Žije zde 817 obyvatel."},{"page_url":"https://de.wikipedia.org/wiki/Wilhelm_Georg_Berger","image_url":"http://upload.wikimedia.org/wikipedia/commons/0/07/Wilhelm_Georg_Berger.jpg","page_title":"Wilhelm Georg Berger","context_page_description":"Wilhelm Georg Berger war ein siebenbürgisch-sächsischer Komponist, Violinist und Musikwissenschaftler."},{"page_url":"https://nl.wikipedia.org/wiki/Andre_Agassi","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/93/Andre_Agassi_%282011%29.jpg","page_title":"Andre Agassi","context_page_description":"Andre Kirk Agassi is een voormalig tennisser uit de Verenigde Staten. Zijn vader is afkomstig uit Iran en van Armeense en Assyrische afkomst.\\nIn 1999 werd Agassi de vijfde speler in de geschiedenis van de sport die een Career Slam won: alle vier de grandslamtoernooien: de Australian Open, de Open Franse Tenniskampioenschappen, Wimbledon en de US Open. In totaal won hij acht grandslamtoernooien en hij staat hiermee op de lijst van grandslamtitels op een gedeelde negende plaats.\\nAgassi is de enige speler ooit die alle grandslamtoernooien én de Tennis Masters Cup heeft gewonnen, deel uitmaakte van een winnend Davis Cup-team en een olympische gouden medaille heeft gewonnen. Daarnaast won hij zeventien Tennis Masters Series-titels. Hoewel hij daarmee recordhouder was toen hij op de US Open 2006 afscheid nam als speler, hebben meerdere spelers dat aantal sindsdien overtroffen.\\nHij is op 22 oktober 2001 getrouwd met de voormalige Duitse toptennisspeelster Steffi Graf – ze hebben twee kinderen."},{"page_url":"https://sh.wikipedia.org/wiki/Novi_Zeland","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/ab/Detail_of_1657_map_Polus_Antarcticus_by_Jan_Janssonius%2C_showing_Nova_Zeelandia.png","page_title":"Novi Zeland","context_page_description":"Novi Zeland je ostrvska država u jugozapadnom delu Tihog okeana. Sastoji se od dva velika ostrva ‒ Severnog i Južnog ‒ kao i većeg broja manjih ostrva. Zvanično ime države na maorskom je Aotearoa, što se često prevodi kao „Zemlja dugog belog oblaka“. Novi Zeland je geografski najizolovanija država na svetu. Najbliži sused, Australija, udaljena je 1.500 kilometara severozapadno od glavnih ostrva, preko Tasmanovog mora. Jedina značajnija kopnena masa ka jugu je Antarktik, ka severu su Nova Kaledonija, Fidži i Tonga.\\nZbog svoje izolovanosti Novi Zeland je jedno od poslednje naseljenih mesta na planeti. Tokom ove izolacije razvijen je karakterističan diverzitet flore i faune. Najznačajniji je veliki broj jedinstvenih ptica, od kojih su mnoge izumrle dolaskom ljudi i sisara. Sa umerenom morskom klimom, zemljište je uglavnom pokriveno šumom. Raznovrsnu topografiju zemlje čine i oštri planinski vrhovi koji su rezultat tektonskog pomeranja tihookeanske i indo-australijske ploče.\\nPolinežani su naselili teritoriju današnjeg Novog Zelanda između 1250. i 1300. godine, pritom razvivši karakterističnu Maori kulturu. Prvi kontakt Evropljana je bio 1642. kada je do obala doplovio Abel Tasman."},{"page_url":"https://ca.wikipedia.org/wiki/Resoluci%C3%B3_291_del_Consell_de_Seguretat_de_les_Nacions_Unides","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4e/Kaart_Cyprus.jpg","page_title":"Resolució 291 del Consell de Seguretat de les Nacions Unides","context_page_description":"La Resolució 291 del Consell de Seguretat de les Nacions Unides, aprovada per unanimitat el 10 de desembre de 1970 després de reafirmar les resolucions anteriors sobre el tema i observant els esdeveniments recents, el Consell va ampliar l'estacionament a Xipre de la Força de les Nacions Unides pel Manteniment de la Pau a Xipre per un altre període, que acaba el 15 de juny de 1971. El Consell també va demanar a les parts directament interessades que continuessin actuant amb la màxima restricció i cooperessin plenament amb la força de manteniment de la pau."},{"page_url":"https://hy.wikipedia.org/wiki/%D5%86%D5%B8%D6%80%D5%BE%D5%A5%D5%A3%D5%AB%D5%A1%D5%B5%D5%AB_%D6%84%D5%A1%D5%B2%D5%A1%D6%84%D5%B6%D5%A5%D6%80","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f0/Honningsv%C3%A5g.jpg","page_title":"Նորվեգիայի քաղաքներ","context_page_description":"Նախկինում Նորվեգիայի Թագավորության քաղաքները բաժանված էին երկու կատեգորիաների՝ գյուղաքաղաքներ կամ առևտրային քաղաքներ և նավահանգստային քաղաքներ: Ամեն մի քաղաք ուներ իր հատուկ արտոնությունները, որոնք վերացան 1857 թվականին: իսկ արդեն 1952 թվականին փոփոխվեց քաղաքների դասակարգման ամբողջ համակարգը և բոլորը ուղղակի կոչվեցին քաղաքներ:\\nՆորվեգիայի կոմունաները բաժանվեցին քաղաքների և գյուղերի: 1946 թվականին ամեն մի կոմունայի տրամադրվեց քառանիշ կոդեր՝ հիմք ընդունելով ISO 3166-2:NO կոդը: Նորվեգիայում գյուղական և քաղաքային համայնքների ձևավորումը չեղարկվեց 1992 թվականին՝ պառլամենտում ընդունված օրենքից ելնելով:"},{"page_url":"https://sv.wikipedia.org/wiki/Bischheim","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3f/Bischheim_Ch%C3%A2teau_de_la_Cour_d%E2%80%99Angleterre.jpg","page_title":"Bischheim","context_page_description":"Bischheim är en kommun i departementet Bas-Rhin i regionen Grand Est i nordöstra Frankrike. Kommunen ligger i kantonen Bischheim som tillhör arrondissementet Strasbourg-Campagne, och ingår i Strasbourgs storstadsområde. År 2009 hade Bischheim 17 777 invånare."},{"page_url":"https://de.wikipedia.org/wiki/K.k._Polytechnisches_Institut","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0a/Tafel_Vivaldi_Grabstaette_TU_Wien_DSC_6740w.jpg","page_title":"K.k. Polytechnisches Institut","context_page_description":"Das k.k. Polytechnische Institut in Wien wurde 1815 von Kaiser Franz I. von Österreich gegründet. Aus diesem Institut ist später die heutige Technische Universität Wien hervorgegangen. Das Gebäude steht unter Denkmalschutz. Von 1847 bis 1857 diente es auch als Sitz der Österreichischen Akademie der Wissenschaften."},{"page_url":"https://en.wikipedia.org/wiki/National_Register_of_Historic_Places_listings_in_Vance_County,_North_Carolina","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f2/Thomas_Capehart_House.jpg","page_title":"National Register of Historic Places listings in Vance County, North Carolina","context_page_description":"This list includes properties and districts listed on the National Register of Historic Places in Vance County, North Carolina. Click the \\"Map of all coordinates\\" link to the right to view an online map of all properties and districts with latitude and longitude coordinates in the table below."},{"page_url":"https://zh.wikipedia.org/zh-sg/%E4%B8%B9%E9%BA%A5%E6%96%87%E5%AD%B8","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/cb/Johannes_V_Jensen_1902.jpg","page_title":"丹麥文學","context_page_description":"丹麦文学在发展的过程中，除了吸收自身文化成长外，其发展也深受南边欧洲地区国家和斯堪的纳维亚岛上北欧国家的影响，在不同的时期融合其他国家当时盛行的主流思潮和文化，使得丹麦文学呈现丰富多元的面貌。\\n以下将会依据丹麦文学发展的历程大致区分为六个重要的时期－－中世纪前、中世纪时期、十六世纪宗教改革与人文主义时期、十八世纪文艺复兴时期、十九世纪黄金时代和二十世纪战争思潮，并于各个时期依据需要细分出不同的分期，以供参考。"},{"page_url":"https://tl.wikipedia.org/wiki/Batirol","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/65/Molinillos.jpg","page_title":"Batirol","context_page_description":"Ang batirol, batidor o molinilyo ay isang tradisyonal na kagamitang pangkusina na nagmula sa Mehiko, at ginagamit din sa Pilipinas at Kolombiya, na gawa sa inukit na kahoy at ginagamit bilang palis. Pangunahin itong ginagamit para sa paghahanda ng mga maiinit na inumin tulad ng tsokolate, at sa Mehiko ginagamit rin ito sa paggawa ng mga atole tulad ng tsamporado.\\nInimbento ang batirol sa may taong 1700 ng mga Espanyol na naninirahan sa Bagong Espanya bilang pamalit sa kinasanayang pabalik-balik ng pagbuhos ng mainit na inuming tsokolate upang bumula ito."},{"page_url":"https://de.wikipedia.org/wiki/Singer_(Unternehmen)","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f3/Singer_Tradition_2250.jpg","page_title":"Singer (Unternehmen)","context_page_description":"The Singer Company wurde 1851 als I.M. Singer & Company von dem Unternehmer und Erfinder Isaac Merritt Singer und dem New Yorker Rechtsanwalt Edward Clark gegründet. Innerhalb kürzester Zeit stieg das Unternehmen zum größten Nähmaschinenproduzenten der Welt auf."},{"page_url":"https://fr.wikipedia.org/wiki/Liste_du_patrimoine_mondial_en_Sierra_Leone","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d9/Tiwai_Island_River.jpg","page_title":"Liste du patrimoine mondial en Sierra Leone","context_page_description":"Cet article recense les sites inscrits au patrimoine mondial en Sierra Leone."},{"page_url":"https://en.wikipedia.org/wiki/1915_Uruguayan_Primera_Divisi%C3%B3n","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5d/Silueta_trofeo_Campeonato_Uruguayo.png","page_title":"1915 Uruguayan Primera División","context_page_description":"The Uruguayan Championship 1915 was the 15th season of Uruguay's top-flight football league."},{"page_url":"https://it.wikipedia.org/wiki/Acamante_(figlio_di_Teseo)","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/71/Altes_Museum_-_Antikensammlung_022.jpg","page_title":"Acamante (figlio di Teseo)","context_page_description":"Acamante è un personaggio della mitologia greca, figlio di Fedra e Teseo e fratello di Demofonte, fu un personaggio della Guerra di Troia."},{"page_url":"https://nl.wikipedia.org/wiki/Ho_Chi_Minhstad","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/38/Nh%C3%ACn_t%E1%BB%AB_C%E1%BB%91i_Xay_C%E1%BB%A7a_Th%E1%BA%A7n_Gi%C3%B3.jpg","page_title":"Ho Chi Minhstad","context_page_description":"Ho Chi Minhstad, eerder bekend als Saigon en daarvoor als Prey Nokor, is de grootste stad in Vietnam. De volledige Vietnamese naam van de stad is Thành phố Hồ Chí Minh. Het ligt op de westelijke oever van de Sài Gòn en valt in de regio Dông Nam Bô. Binnen de stadsgrenzen, zo'n 7 kilometer ten noordwesten van het centrum bevindt zich de Internationale Luchthaven Tân Sơn Nhất."},{"page_url":"https://fr.wikipedia.org/wiki/Liste_des_%C3%A9glises_romanes_des_Pyr%C3%A9n%C3%A9es-Orientales","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0f/Conat003.JPG","page_title":"Liste des églises romanes des Pyrénées-Orientales","context_page_description":"Cet article présente une liste des églises romanes des Pyrénées-Orientales."},{"page_url":"https://ro.wikipedia.org/wiki/Magyartelek,_Baranya","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/44/HUN_Magyartelek_COA.jpg","page_title":"Magyartelek, Baranya","context_page_description":"Magyartelek este un sat în districtul Sellye, județul Baranya, Ungaria, având o populație de 222 de locuitori."},{"page_url":"https://de.wikipedia.org/wiki/Rodolfo_Cardoso","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ea/Cardoso%2C_Rudolfo_Trainer_HSVII_13-14_WP.JPG","page_title":"Rodolfo Cardoso","context_page_description":"Rodolfo Esteban Cardoso ist ein ehemaliger argentinischer Fußballspieler und heutiger -trainer."},{"page_url":"https://vi.wikipedia.org/wiki/Chu%E1%BB%99t_h%E1%BA%A3i_ly","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/58/Zoo_Praha_0353.jpg","page_title":"Chuột hải ly","context_page_description":"Chuột hải ly hay còn gọi là chuột Coypu là một phân loài của loài Myocastor coypus có nguồn gốc ở khu vực Nam Mỹ, là phân bố ở tận cùng phía bắc của dải phân bố các loài Coypu trong vùng cận nhiệt đới, được cho là loài được du nhập phổ biến từ các lục địa khác, ở Việt Nam chúng được gọi nhầm lẫn với cái tên là hải ly, thực chất là chuột hải ly, nhiều văn bản của các cơ quan và thông tấn báo chí dùng từ hải ly cho những con vật nhập về từ Trung Quốc là không chính xác.\\nChúng là loài duy nhất thuộc họ Chuột hải ly Myocastoridae, thuộc bộ gặm nhấm. Chúng hoàn toàn sai khác với hai loài hải ly châu Âu và hải ly Bắc Mỹ thuộc họ hải ly. Chuột hải ly được nuôi để lấy lông, da, thịt của chúng có giá trị kinh tế cao, chúng cũng được nuôi làm cảnh tại nhiều vùng ở châu Á trước khi xâm nhập vào môi trường tự nhiên tại đây và trở thành loài xâm lấn Các nước phát triển chỉ sử dụng bộ lông, trong khi thịt chỉ được sử dụng ở các nước đang phát triển, bộ lông da dùng cho xuất khẩu là quý nhất."},{"page_url":"https://ja.wikipedia.org/wiki/%E8%97%A4%E3%81%AE%E6%A3%AE%E5%8F%A4%E5%A2%B3","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f8/Fujinomori_Kofun%2C_sekishitsu-2.jpg","page_title":"藤の森古墳","context_page_description":"藤の森古墳は、大阪府藤井寺市野中にあった古墳。形状は円墳。古市古墳群を構成した古墳の1つ。\\n畿内の横穴式石室としては最古級の例として知られるが、現在では墳丘は失われている。"},{"page_url":"https://de.wikipedia.org/wiki/Bahnstrecke_Nauendorf%E2%80%93Gerlebogk","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/46/Naundorf-Gerlebogker_Eisenbahn-Gesellschaft_1000_Mk_1900.jpg","page_title":"Bahnstrecke Nauendorf–Gerlebogk","context_page_description":"Die Bahnstrecke Nauendorf–Gerlebogk ist eine eingleisige Nebenbahn in Sachsen-Anhalt. Die 15,2 km lange Strecke zweigte nördlich von Halle am Bahnhof Nauendorf im Saalekreis von der Bahnstrecke Halle–Halberstadt ab und verlief in nördlicher Richtung nach Löbejün. Vom dortigen Kopfbahnhof, wo die Bahnverwaltung der Nauendorf-Gerlebogker Eisenbahn-Gesellschaft ihren Sitz hatte, führte die Bahn weiter auf anhaltinischem Gebiet über Gröbzig nach Gerlebogk; hier bestand Anschluss an die Bahnstrecke Biendorf–Gerlebogk. Die 1900 eröffnete Bahnstrecke ist heute größtenteils stillgelegt, nur ein circa 3 km langes Teilstück wird noch im Güterverkehr befahren."},{"page_url":"https://nl.wikipedia.org/wiki/Bl%C3%AD%C5%BEejov","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/48/Bl%C3%AD%C5%BEejov_vlajka.jpg","page_title":"Blížejov","context_page_description":"Blížejov is een Tsjechische gemeente in de regio Pilsen, en maakt deel uit van het district Domažlice. Blížejov telt 1203 inwoners."},{"page_url":"https://ms.wikipedia.org/wiki/Papua_Barat","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d2/IndonesiaWestPapua.png","page_title":"Papua Barat","context_page_description":"Papua Barat merupakan salah satu provinsi Indonesia. Ibu negerinya ialah Manokwari.\\nJika anda melihat rencana yang menggunakan templat {{tunas}} ini, gantikanlah ia dengan templat tunas yang lebih spesifik."},{"page_url":"https://no.wikipedia.org/wiki/Woodhouse_Grove_skole","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2d/Woodhouse_Grove_1.JPG","page_title":"Woodhouse Grove skole","context_page_description":"Woodhouse Grove School er en private skole som ligger mellom Bradford og Leeds. Tidligere elever heter Old Grovians."},{"page_url":"https://zh.wikipedia.org/zh-tw/VFTS_352","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8c/An_artist%E2%80%99s_impression_of_the_hottest_and_most_massive_touching_double_star.jpg","page_title":"VFTS 352","context_page_description":"VFTS 352是一個位於大麥哲倫星系蜘蛛星雲內的密接聯星，距離地球約160,000光年。該聯星系是至今質量最大，並且光譜型是最早期型的密接聯星。"},{"page_url":"https://en.wikipedia.org/wiki/Suresnes%E2%80%93Mont-Val%C3%A9rien_station","image_url":"http://upload.wikimedia.org/wikipedia/commons/4/4d/Gare_de_Suresnes-Mont-Val%C3%A9rien_02.jpg","page_title":"Suresnes–Mont-Valérien station","context_page_description":"Suresnes–Mont-Valérien is a railway station in the town Suresnes, Hauts-de-Seine department, in the western suburbs of Paris, France."},{"page_url":"https://eu.wikipedia.org/wiki/Koblenz_(Argovia)","image_url":"http://upload.wikimedia.org/wikipedia/commons/4/46/Karte_Gemeinde_Koblenz_2010.png","page_title":"Koblenz (Argovia)","context_page_description":"Koblenz Suitzako udalerria da. Argovia kantonamenduan dago, Zurzach barrutia barrutian. 2014an 1,656 biztanle zituen 4.08 kilometro koadrotan banatuta."},{"page_url":"https://cs.wikipedia.org/wiki/Zbo%C5%BEnice","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0f/Zbo%C5%BEnice%2C_kapli%C4%8Dka_zep%C5%99edu.jpg","page_title":"Zbožnice","context_page_description":"Zbožnice je malá vesnice, část obce Václavice v okrese Benešov. Nachází se asi 2 km na východ od Václavic. V roce 2009 zde bylo evidováno 24 adres. Zbožnice leží v katastrálním území Václavice u Benešova o výměře 8,26 km².Dnes zde žije 50 obyvatel. vposledních letech se rozšířila směrem k vesnici žabovřesky."},{"page_url":"https://ja.wikipedia.org/wiki/%E3%83%AD%E3%83%89%E3%83%8B%E3%83%BC%E3%83%BB%E3%83%87%E3%83%B3%E3%82%B8%E3%83%A3%E3%83%BC%E3%83%95%E3%82%A3%E3%83%BC%E3%83%AB%E3%83%89","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/bf/RodneyDangerfield1978.jpg","page_title":"ロドニー・デンジャーフィールド","context_page_description":"ロドニー・デンジャーフィールドは、アメリカ合衆国ニューヨーク州生まれのコメディアン・俳優・声優である。"},{"page_url":"https://af.wikipedia.org/wiki/Hughes_H-4_Hercules","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4d/Spruce_Goose_wing_with_enjins.jpg","page_title":"Hughes H-4 Hercules","context_page_description":"Die Hughes H-4 Hercules is 'n prototipe swaarvervoervliegtuig wat deur die Hughes Aircraft-maatskappy ontwerp en gebou is. Die vliegtuig het sy eerste en enigste vlug in 1947 onderneem. As gevolg van hulpbronbeperkings tydens die Tweede Wêreldoorlog, is die vliegtuig uit hout gebou; sy kritici het ook na hom as die \\"Spruce Goose\\" verwys. Die Hercules is die grootste vliegboot wat ooit gebou is en het die grootste vlerkspan en hoogte van enige vliegtuig in die geskiedenis. Die vliegtuig het behoue gebly en word in goeie toestand in die Evergreen Lugvaartmuseum bewaar.\\nDie H-4 is byna geheel en al uit gelamineerde berkehout gebou, met slegs klein hoeveelhede esdoring, populier, balsahout, en sparhout gebou; ten spyte daarvan dat die bynaam op sparhout dui. Die \\"Duramold\\"-proses, 'n vorm van samestellingstegnologie, is gebruik in die lamelhoutkonstruksie. Die vliegtuig is as 'n tegnologiese tour de force beskou: die projek het vliegbote byeengebring met 'n kolossale vliegraam wat werklik vindingryke ingenieursinnovasies geverg het. Op die ou einde was die projek egter 'n duur, vernederende mislukking en teen die einde van die oorlog is dit gekanselleer."},{"page_url":"https://ro.wikipedia.org/wiki/Helle_Thorning-Schmidt","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/79/Danmarks_statsminister_Helle_Thorning-Schmidt_vid_de_nordiska_statsministrarnas_mote_vid_Nordiska_Radets_session_i_Kopenhamn_%281%29.jpg","page_title":"Helle Thorning-Schmidt","context_page_description":"Helle Thorning-Schmidt este un om politic danez, prim-ministru al Danemarcei între 3 octombrie 2011-28 iunie 2015.\\nA fost membru al Parlamentului European din partea Danemarcei în perioada 1999-2004."},{"page_url":"https://fi.wikipedia.org/wiki/Salon_kaupungintalo","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a6/Salonkaupungintalo7.jpg","page_title":"Salon kaupungintalo","context_page_description":"Salon kaupungintalo on Salon kaupungin hallintorakennus, joka sijaitsee aivan keskustassa. NCC toteutti kaupungintalon rakennustyöt. Rakentaminen alkoi maaliskuussa 2010 ja rakennus valmistui elokuun 2011 lopussa.\\nVuonna 2016 kaupungintalossa todettiin sisäilmaongelmia, jotka johtuivat ensimmäisen kerroksen lattian kosteusongelmista. NCC maksoi kosteusongelmien korjaamisen."},{"page_url":"https://pt.wikipedia.org/wiki/Habitat","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ed/Restinga_Guarapari.jpg","page_title":"Habitat","context_page_description":"Um habitat ou hábitat é uma área ecológica ou ambiental que é habitada por uma determinada espécie de animal, planta ou outro organismo. O habitat está relacionado ao lugar, ou ambiente físico em que esse organismo vive e onde pode encontrar alimento, abrigo, proteção e companheiros para reprodução. É o ambiente natural em que vive um organismo, ou o ambiente físico que envolve uma população de espécies. Sendo assim, alguns exemplos que podem ser citados incluem: o habitat de um organismo intestinal é o canal alimentar de um animal, o habitat de um peixe pode ser uma lagoa inteira. Também é interessante apontar que cada habitat pode proporcionar muitos nichos diferentes.\\nUm habitat é composto de fatores físicos como solo, umidade, intervalo de temperatura e intensidade da luz, bem como fatores bióticos, como a disponibilidade de alimentos e a presença ou ausência de predadores. Cada organismo tem certas necessidades de habitat para as condições em que irá prosperar, mas alguns são tolerantes a grandes variações, enquanto outros são muito específicos em suas exigências."},{"page_url":"https://de.wikipedia.org/wiki/Broken_Hill","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/dc/Sulphide_St_station.jpg","page_title":"Broken Hill","context_page_description":"Broken Hill ist eine Bergbausiedlung mit knapp 17.600 Einwohnern im äußersten Westen des australischen Bundesstaats New South Wales 20 Kilometer Luftlinie östlich der Grenze zu South Australia. Die Entfernung zur Metropole Sydney beträgt ca. 1200 km in Richtung Osten, Adelaide liegt etwa 500 km südwestlich.\\nDie Stadt Broken Hill deckt sich zum größten Teil mit dem lokalen Verwaltungsgebiet Broken Hill City. Die Stadt ist Sitz des römisch-katholischen Bischofs des Bistums Wilcannia-Forbes.\\nIn Broken Hill gilt wie im benachbarten South Australia die Australian Central Standard Time, anders als im Rest von New South Wales, wo die Australian Eastern Standard Time gilt. In der Stadt ist es damit immer eine halbe Stunde früher als im Rest des Bundesstaates."},{"page_url":"https://en.wikipedia.org/wiki/Controversy_surrounding_Resistance:_Fall_of_Man","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b5/Manchester_Cathedral.JPG","page_title":"Controversy surrounding Resistance: Fall of Man","context_page_description":"The 2006 video game Resistance: Fall of Man, developed by Insomniac Games, published by Sony Computer Entertainment and released for the PlayStation 3 video game console, features combat scenes that take place within a virtual representation of Manchester Cathedral in England set in an alternate history. It was released on 23 March 2007 in the United Kingdom. The use of images of the cathedral caused controversy with the leaders of the Church of England, which claimed its depiction to be desecration and copyright infringement, and that it was inappropriate of Sony to allow players to fire guns in a city with a gun problem. They have made several legal threats against Sony. They intended to make several demands of Sony, including an apology, a substantial donation, complete withdrawal of the game or modifying the segment featuring the interior of the cathedral, and financial support of Manchester groups trying to reduce gun crime in the city.\\nIn response to the allegations, Sony stated that the game was not based on reality, and they believed they had adequate permissions necessary."},{"page_url":"https://zh.wikipedia.org/wiki/%E5%87%B1%E8%90%8A%C2%B7%E9%BA%A5%E8%82%AF%E9%98%BF%E5%B0%BC","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/51/White_House_Press_Briefing_%2849842842011%29_%28cropped_2%29.jpg","page_title":"凱萊·麥肯阿尼","context_page_description":"凯莱·麦肯阿尼是美国政治评论员、律师和作家，自2020年4月起开始担任第31届白宫新闻秘书。她毕业于乔治敦大学和哈佛大学。她的媒体职业生涯始于担任福克斯新闻“赫克比”节目的制片人，后来担任CNN的评论员。2017年，她被任命为共和党全国委员会的国家发言人。 2020年4月7日，她被任命为川普政府的白宫新闻秘书。"},{"page_url":"https://fi.wikipedia.org/wiki/Jenni_Haukio","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/34/Vladimir_Putin%2C_Donald_Trump_%26_Sauli_Niinist%C3%B6_in_Helsinki%2C_16_July_2018.jpg","page_title":"Jenni Haukio","context_page_description":"Jenni Elina Haukio on suomalainen runoilija ja valtiotieteen maisteri. Hänen puolisonsa on tasavallan presidentti Sauli Niinistö.\\nEnnen Niinistön presidentiksi valintaa Haukio työskenteli muun muassa kokoomuksen viestintäpäällikkönä. Hän on julkaissut kolme runokokoelmaa."},{"page_url":"https://pl.wikipedia.org/wiki/Kot_Schr%C3%B6dingera","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/91/Schrodingers_cat.svg","page_title":"Kot Schrödingera","context_page_description":"Kot Schrödingera – eksperyment myślowy, czasem określany mianem paradoksu, opublikowany w 1935 roku przez austriackiego fizyka, Erwina Schrödingera, laureata Nagrody Nobla z dziedziny fizyki w roku 1933, w trzech częściach artykułu przeglądowego Obecna sytuacja w mechanice kwantowej. Ilustruje problem zastosowania interpretacji kopenhaskiej mechaniki kwantowej w odniesieniu do obiektów makroskopowych. Eksperyment ten jest jednym z wielu pomysłów tworzenia „przekładni” ze świata obiektów nano do świata makroskopowego."},{"page_url":"https://en.wikipedia.org/wiki/List_of_Christian_denominational_positions_on_homosexuality","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6f/SLC_Temple_Rainbow_Flag.jpg","page_title":"List of Christian denominational positions on homosexuality","context_page_description":"This is a list of Christian denominational positions on homosexuality. The issue of homosexuality and Christianity is a subject of ongoing theological debate within and between Christian denominations and this list seeks to summarise the various official positions. Within denominations, many members may hold somewhat differing views on and even differing definitions of homosexuality."},{"page_url":"https://de.wikipedia.org/wiki/Orune","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/60/Orune_-_panoramio.jpg","page_title":"Orune","context_page_description":"Orune ist eine Gemeinde in der Provinz Nuoro in der italienischen Region Sardinien mit 2320 Einwohnern."},{"page_url":"https://hy.wikipedia.org/wiki/%D4%B1%D5%B6_%D5%BD%D5%B5%D5%B8%D6%82%D6%80_%D4%BC%D5%A5%D5%BD","image_url":"http://upload.wikimedia.org/wikipedia/commons/d/d6/Onze_lieve_vrouwe_en_manneke_pis.JPG","page_title":"Ան սյուր Լես","context_page_description":"Ան սյուր Լես ՝ բնական ծագում ունեցող քարանձավ, Բելգիայի զբոսաշրջային կարևորագույն օբյեկտներից մեկը, ուր տարեկան այցելում է կես միլիոնից ավելի մարդ: Գտնվում է Նամյուր պրովինցիայի Ան սյուր Լես գյուղի մերձակայքում:"},{"page_url":"https://ja.wikipedia.org/wiki/%E5%B8%82%E5%B7%9D%E7%9C%9F%E9%96%93%E9%A7%85","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/58/Keisei-main-line-Ichikawa-mama-station-platform.jpg","page_title":"市川真間駅","context_page_description":"市川真間駅は、千葉県市川市真間一丁目にある、京成電鉄本線の駅である。駅番号はKS14。"},{"page_url":"https://ast.wikipedia.org/wiki/Curia_Romana","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/dd/Nazareth_Church_of_the_Annunciation.jpg","page_title":"Curia Romana","context_page_description":"La Curia Romana ye'l conxuntu d'órganos de gobiernu de la Santa Sede y de la Ilesia católica. Ta compuestu por un grupu d'instituciones, denominaes dicasterios, so la direición del papa, qu'exercen les funciones llexislatives, executives y xudiciales. Coordina y apurre la necesaria organización central pal correutu funcionamientu de la Ilesia y el llogru de los sos oxetivos. La potestá de la curia romana considérase vicaria del papa:\\nNel exerciciu supremu, plenu ya inmediatu del so poder sobre tou la Ilesia, el Romanu Pontífiz sirvir de los dicasterios de la Curia Romana, que, arriendes d'ello, realicen el so llabor nel so nome y so la so autoridá, para bien de les Ilesies y serviciu de los sagraos pregueros.\\nDecreto sobre la función pastoral de los obispos na Ilesia, Christus Dominus, 9."},{"page_url":"https://no.wikipedia.org/wiki/MAGIC_(teleskop)","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/83/Tiles_of_a_MAGIC_telescope.jpg","page_title":"MAGIC (teleskop)","context_page_description":"MAGIC er et system av to atmosfæriske Cherenkov-teleskoper som ligger ved Roque de los Muchachos Observatoriet på La Palma, en av Kanariøyene, ca 2200 m over havet. MAGIC skal oppdage og registrere partikkelstrømmer fra gammastråling, ved hjelp av tsjerenkovstråling, dvs., svake lysstråler med ladde partikler i partikkelstrømmene. Med en diameter på 17 meter for den reflekterende overflaten, var dette det største i verden før bygging av H.E.S.S. II.\\nDet første teleskopet ble bygget i 2004 og ble drevet i fem år i frittstående modus. Et annet MAGI teleskop, med en avstand på 85 m fra den første, begynte de å motta data i juli 2009. Sammen er de integrert i et stereoskopisk system.\\nMAGIC er følsom for kosmisk gammastråling med fotonenergi mellom 50 GeV og 30 TeV på grunn av sitt store speil. Andrebakkebaserte gammastråleteleskop vil vanligvis observere gamma energier over 200-300 GeV. Satellittbaserte detektorer kan oppdage gamma-stråler med energi som varierer fra keV opp til flere GeV."},{"page_url":"https://vi.wikipedia.org/wiki/Chi_H%C3%A0_nu","image_url":"http://upload.wikimedia.org/wikipedia/commons/9/91/Ixonanthes_icosandra_tronc.jpg","page_title":"Chi Hà nu","context_page_description":"Ixonanthes là một chi thực vật có hoa trong họ Ixonanthaceae."},{"page_url":"https://en.wikipedia.org/wiki/Economic_depression","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f3/Past_Great_Depressions.jpg","page_title":"Economic depression","context_page_description":"Economic depression is a sustained, long-term downturn in economic activity in one or more economies. It is a more severe economic downturn than a recession, which is a slowdown in economic activity over the course of a normal business cycle.\\nEconomic depressions are characterized by their length, by abnormally large increases in unemployment, falls in the availability of credit, shrinking output as buyers dry up and suppliers cut back on production and investment, more bankruptcies including sovereign debt defaults, significantly reduced amounts of trade and commerce, as well as highly volatile relative currency value fluctuations. Price deflation, financial crises, stock market crash, and bank failures are also common elements of a depression that do not normally occur during a recession."},{"page_url":"https://ceb.wikipedia.org/wiki/Sestino_(munisipyo)","image_url":"http://upload.wikimedia.org/wikipedia/commons/4/47/Centro_storico_sestino.jpg","page_title":"Sestino (munisipyo)","context_page_description":"Munisipyo ang Sestino sa Italya. Nahimutang ni sa lalawigan sa Province of Arezzo ug rehiyon sa Toscana, sa sentro nga bahin sa nasod, 200 km sa amihanan sa Rome ang ulohan sa nasod. Adunay 1,421 ka molupyo.\\nAng klima umogon ug subtropikal. Ang kasarangang giiniton 11 °C. Ang kinainitan nga bulan Hulyo, sa 22 °C, ug ang kinabugnawan Enero, sa 1 °C. Ang kasarangang pag-ulan 1,283 milimetro matag tuig. Ang kinabasaan nga bulan Nobiyembre, sa 219 milimetro nga ulan, ug ang kinaugahan Agosto, sa 46 milimetro."},{"page_url":"https://eo.wikipedia.org/wiki/Disentis/Must%C3%A9r","image_url":"http://upload.wikimedia.org/wikipedia/commons/1/1d/Disentis_Westsicht.jpg","page_title":"Disentis/Mustér","context_page_description":"Disentis/Mustér estas komunumo en la distrikto Surselva, Kantono Grizono, Svislando. Ĝi havis 2122 loĝantojn je la 31-a de decembro 2006. Ĝis 1962 la komunumo nomiĝis nur Disentis."},{"page_url":"https://ur.wikipedia.org/wiki/%D8%AA%D9%84%DB%81%D8%A7%D8%B1","image_url":"http://upload.wikimedia.org/wikipedia/commons/8/8e/Chowk.jpg","page_title":"تلہار","context_page_description":"تلہار ضلع بدین کی ايک تحصیل ہے، اس کی آبادی تقریبٱ 40 ہزار نفوس پر مشتعمل ہے۔"},{"page_url":"https://sco.wikipedia.org/wiki/Admeenistrative_diveesions_o_Chechnie","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/54/The_administrative-territorial_division_of_the_Chechen_Republic.svg","page_title":"Admeenistrative diveesions o Chechnie","context_page_description":"This airticle leets the admeenistrative diveesions o Chechnie, Roushie.\\nCeeties an touns unner republic's jurisdiction:\\nGrozny\\nCeety destricts:\\nLeninsky\\nOktyabrsky\\nStaropromyslovsky\\nZavodskoy\\nArgun\\nGudermes\\nShali\\nUrus-Martan\\nDestricts:\\nAchkhoy-Martanovsky\\nGroznensky\\nGudermessky\\nItum-Kalinsky\\nKurchaloyevsky\\nNadterechny\\nNaursky\\nNozhay-Yurtovsky\\nShalinsky\\nSharoysky\\nShatoysky\\nShelkovskoy\\nSunzhensky\\nUrus-Martanovsky\\nVedensky"},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Kulturdenkmale_in_Raguhn-Je%C3%9Fnitz","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/30/Raguhn%2CAm_Markt.jpg","page_title":"Liste der Kulturdenkmale in Raguhn-Jeßnitz","context_page_description":"In der Liste der Kulturdenkmale in Raguhn-Jeßnitz sind alle Kulturdenkmale der Stadt Raguhn-Jeßnitz und ihrer Ortsteile aufgelistet. Grundlage ist das Denkmalverzeichnis des Landes Sachsen-Anhalt, das auf Basis des Denkmalschutzgesetzes vom 21. Oktober 1991 durch das Landesamt für Denkmalpflege und Archäologie Sachsen-Anhalt erstellt und seither laufend ergänzt wurde."},{"page_url":"https://sv.wikipedia.org/wiki/Tectaria_gaudichaudii","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4a/Starr_030405-0378_Tectaria_gaudichaudii.jpg","page_title":"Tectaria gaudichaudii","context_page_description":"Tectaria gaudichaudii är en ormbunkeart som först beskrevs av Georg Heinrich Mettenius, och fick sitt nu gällande namn av William Ralph Maxon. Tectaria gaudichaudii ingår i släktet Tectaria och familjen Tectariaceae. Inga underarter finns listade."},{"page_url":"https://es.wikipedia.org/wiki/Blackheath_(Londres)","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/56/The_Paragon%2C_SE3_-_geograph.org.uk_-_359588.jpg","page_title":"Blackheath (Londres)","context_page_description":"Blackheath es una zona de brezales del sureste de Londres. Antiguamente en Kent, ahora se comparte entre los municipios londinenses de Lewisham y Greenwich. Blackheath tiene una de las mayores áreas de tierra común en el Gran Londres.​"},{"page_url":"https://hu.wikipedia.org/wiki/Skellig_Michael","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/cd/Skellig_Michael_-_cell_E_and_F.jpg","page_title":"Skellig Michael","context_page_description":"Skellig Michael sziklasziget 15 kilométerre nyugatra Írország délnyugati partjaitól. A név az ír Sceilig Mhichil-ből ered és Mihály-sziklát jelent. A két Skellig-sziget közül ez a nagyobbik, területe kb. 17 hektár. A sziget legmagasabb pontja 289 méterre van a tengerszint felett.\\n600 éven át a sziget az ír keresztény szerzetesek fontos központja volt. Az 588-ban épített kolostorban a szerzetesek a sziklafalhoz épített kőkunyhókban spártaian egyszerű életmódot folytattak. Ivóvíznek esővizet gyűjtöttek, a szikla védettebb oldalán zöldségeket és gyógynövényeket termesztettek.\\nA Skellig Michael közössége soha nem volt nagy – valószínűleg 12 szerzetes és egy apát élt itt, a 12 apostol mintájára.\\nAz ismert, de nehezen megközelíthető kolostor 1996 óta az UNESCO Világörökség listáján szerepel. Éppen a nehéz megközelíthetőség miatt a kolostor épen maradt meg. A turisták belépését korlátozzák, mert úgy vélik, hogy a növekvő számú látogató tönkretenné a sziget állapotát, különösen a sziklára vezető kb. 600 kőlépcsőt."},{"page_url":"https://vo.wikipedia.org/wiki/Genestrerio","image_url":"http://upload.wikimedia.org/wikipedia/commons/9/9e/Karte_Gemeinde_Genestrerio_2007.png","page_title":"Genestrerio","context_page_description":"Genestrerio binon zif in kanton: Tessin, in Jveizän. Genestrerio topon videtü 45°51’ N e lunetü 8°58’ L.\\nSürfat ela Genestrerio binon mö 1,47 km².\\nGenestrerio labon belödanis 905."},{"page_url":"https://de.wikipedia.org/wiki/Stra%C3%9Fen_und_Pl%C3%A4tze_in_Ludwigshafen_am_Rhein/N","image_url":"http://upload.wikimedia.org/wikipedia/commons/c/c3/St_Hildegard_Ludwigshafen_06.jpg","page_title":"Straßen und Plätze in Ludwigshafen am Rhein/N","context_page_description":"67065 Ludwigshafen-Gartenstadt\\nGustav Nachtigal war ein deutscher Afrikaforscher. Er durchquerte die Sahara und ging dann in das vorher von keinem Weißen betretene Gebiet der Tibbu, das Land Tibesti. 1870 erreichte er Kuka, die Residenz des Sultans von Bornu, und überreichte diesem die Geschenke des preußischen Königs.\\nDie Nachtigalstraße ist eine Querstraße zur Niederfeldstraße im Norden der Gartenstadt."},{"page_url":"https://cs.wikipedia.org/wiki/Barv%C3%ADnek","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f6/Vinca_minor_%27Illumination%27_Leaves_2000px.jpg","page_title":"Barvínek","context_page_description":"Barvínek, v minulosti též nazývaný brčál, je rod rostlin z čeledi toješťovité. Barvínky jsou vytrvalé byliny a polokeře s jednoduchými, celokrajnými, vstřícnými listy a pohlednými, nejčastěji modrofialovými květy. Rod zahrnuje 6 druhů a je rozšířen v Evropě, severozápadní Africe a jihozápadní Asii. V České republice roste jediný druh, barvínek menší. Barvínky mají význam v lékařství a jsou pěstovány jako okrasné rostliny."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Baudenkm%C3%A4ler_in_Weilheim_in_Oberbayern","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b9/Weilheim%2C_Stadtmauer_Theaterplatz%2C_2.jpeg","page_title":"Liste der Baudenkmäler in Weilheim in Oberbayern","context_page_description":"Auf dieser Seite sind die Baudenkmäler der oberbayerischen Stadt Weilheim zusammengestellt. Diese Tabelle ist eine Teilliste der Liste der Baudenkmäler in Bayern. Grundlage ist die Bayerische Denkmalliste, die auf Basis des Bayerischen Denkmalschutzgesetzes vom 1. Oktober 1973 erstmals erstellt wurde und seither durch das Bayerische Landesamt für Denkmalpflege geführt wird. Die folgenden Angaben ersetzen nicht die rechtsverbindliche Auskunft der Denkmalschutzbehörde."},{"page_url":"https://sr.wikipedia.org/wiki/%D0%93%D0%BB%D1%83%D1%85%D0%B8%D0%B2","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/00/Hlukhiv_gerb.png","page_title":"Глухив","context_page_description":"Глухив град је Украјини у Сумској области. Према процени из 2012. у граду је живело 34.790 становника."},{"page_url":"https://af.wikipedia.org/wiki/Melissa_Fahn","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/dd/Melissa_Fahn_on_Otalku_at_Anime_USA_2015.jpg","page_title":"Melissa Fahn","context_page_description":"Melissa Fahn is 'n Amerikaanse aktrise. Sy is bekend vir haar rolle in die rolprente Cowboy Bebop: The Movie en Boruto: Naruto the Movie, en in die televisiereekse Cowboy Bebop en Digimon: Digital Monsters."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%94%D0%B8%D0%BD%D0%B5%D1%80,_%D0%90%D0%BB%D1%8C%D1%84%D1%80%D0%B5%D0%B4","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/dd/17Juni_Jena_Holzmarkt.JPG","page_title":"Динер, Альфред","context_page_description":"Альфред Ди́нер — немецкий слесарь, участник демонстраций в ходе волнений 17 июня 1953 года в ГДР. Был арестован представителями советских оккупационных властей и казнён в соответствии с вынесенным спустя день приговором."},{"page_url":"https://ko.wikipedia.org/wiki/%EC%9D%B8%ED%85%94_%ED%8C%8C%EB%9D%BC%EA%B3%A4","image_url":"http://upload.wikimedia.org/wikipedia/commons/4/4d/Paragon_XP-E_-_inside.jpg","page_title":"인텔 파라곤","context_page_description":"인텔 파라곤은 일련의 인텔의 대규모 병렬 컴퓨터이다. 파라곤 XP/S는 Caltech에 설치된 실험용 터치스톤 델타시스템의 상용 버전으로 1992년에 출시되었다. 파라곤은 인텔의 초기 iPSC/860 시스템을 대체했다.\\n파라곤 계열은 인텔 i860 RISC 마이크로프로세서 기반 시스템으로 최대 2048 개의 i860 프로세서들이 2차원의 그리드로 연결이 된다. 1993년에 엔트리 레벨 파라곤 XP/E 종류가 발표되었으며 이 시스템은 최대 32개의 컴퓨팅 노드로 구성된다. 시스템 아키텍처는 분할 시스템 구조로 대부분을 차지하는 디스크가 없는 컴퓨팅 노드와 서비스 노드에 상호 연결되는 소수의 입출력 노드로 구성된다. 많은 수의 노드는 저장공간이 없기때문에 컴퓨트 파티션이 분류된 것에서 부터 분류되지 않은 것까지 \\"Red/Black 스위치\\"가 가능하다. 한 집합의 입출력 노드들을 분류된 디스크로부터 분리한 다음에 분류되지 않은 입출력 파티션들을 연결한다.\\n인텔은 파라곤을 모든 프로세서가 OSF/1 AD 분산 운영 체제위에서 동작하도록 하고자 하였지만 실제로는 효율적이지 않다라는 것을 알게 되었다. 파라곤 프로세서위의 OSF/1 AD를 대체하기 위해 샌디아 국립연구소에서 SUNMOS라고 불리는 가벼운 커널을 개발하게 되었다.\\n인텔 파라곤의 시제품은 인텔 델타이며 DARPA로부터 자금을 제공받아 제작되었다. 1980년대 말에 National Science Foundation의 자금 지원으로 California Institute of Technology에 설치 운영되었다. 델타 시스템은 무어의 법칙 보다 더 빠른 소수 시스템중의 하나였다."},{"page_url":"https://be.wikipedia.org/wiki/%D0%9D%D1%96%D0%BA%D0%B0%D0%BB%D0%B0%D1%81_%D0%A2%D1%8B%D0%BD%D0%B1%D0%B5%D1%80%D0%B3%D0%B5%D0%BD","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/95/Lorenz_and_Tinbergen1.jpg","page_title":"Нікалас Тынберген","context_page_description":"Нікалас Тынберген — нідэрландскі вучоны ў галіне эталогіі і зоапсіхалогіі. Прафесар.\\nСкончыў Лейдэнскі ўніверсітэт. З 1949 года ў Оксфардскім універсітэце. Навуковыя працы па паводзінах птушак. Распрацаваў вучэнне пра інстынктыўныя паводзіны жывёл і іх развіццё ў онта- і філагенезе. Нобелеўская прэмія па фізіялогіі і медыцыне."},{"page_url":"https://ca.wikipedia.org/wiki/Hanazono","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f9/Emperor_Hanazono_detail.jpg","page_title":"Hanazono","context_page_description":"L'emperador Hanazono va ser el 95è emperador del Japó, segons l'ordre tradicional de successió. Va regnar entre el 1308 i el 1318. Abans de ser ascendit al Tron de Crisantem, el seu nom personal era Príncep Imperial Tomihito."},{"page_url":"https://ja.wikipedia.org/wiki/%E3%83%9E%E3%82%B7%E3%83%8A%E3%83%AA%E3%82%A6%E3%83%A0","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ed/Floex_2015.jpg","page_title":"マシナリウム","context_page_description":"『マシナリウム』は、チェコのインディーゲームスタジオAmanita Designによって開発されたポイント・アンド・クリック型アドベンチャーゲーム。日本語版はPLAYISMがローカライズを行っている。"},{"page_url":"https://es.wikipedia.org/wiki/Orden_de_la_Corona_de_Italia","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/ca/Order_Crown_of_Italy_officer_medal.jpg","page_title":"Orden de la Corona de Italia","context_page_description":"La Orden de la Corona de Italia fue una orden civil y militar del Reino de Italia, creada por el rey Víctor Manuel II el 20 de febrero de 1868, y otorgada para premiar a ciudadanos italianos y extranjeros que hubieran realizado hechos meritorios para la Nación, la Corona o con el Monarca, tanto en el mérito civil como militar, especialmente aquellos directamente relacionados con los intereses políticos de la Nación."},{"page_url":"https://ceb.wikipedia.org/wiki/Abinger","image_url":"http://upload.wikimedia.org/wikipedia/commons/d/d7/Abingerhatchchurch.jpg","page_title":"Abinger","context_page_description":"Parokya ang Abinger sa Hiniusang Gingharian. Nahimutang ni sa kondado sa Surrey ug apil sa nasod sa Inglatera, sa habagatang bahin sa nasod, 40 km sa habagatan-kasadpan sa London ang ulohan sa nasod.\\nAng klima baybayon. Ang kasarangang giiniton 8 °C. Ang kinainitan nga bulan Agosto, sa 17 °C, ug ang kinabugnawan Disyembre, sa 0 °C."},{"page_url":"https://en.wikipedia.org/wiki/Robert_George_Thomas","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6c/Stow_Memorial_Church_%28now_Pilgrim_Church%29%2C_Flinders_Street%2C_Adelaide_SLSA_B-1941.jpeg","page_title":"Robert George Thomas","context_page_description":"Robert George Thomas FRIBA was a draftsman and architect in the British colony of South Australia. He drew the original plans for the City of Adelaide and was later responsible for the design and execution of some of its significant buildings, including several churches in a Gothic style."},{"page_url":"https://id.wikipedia.org/wiki/Henuttawy_C","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/01/%22Amduat%22_Papyrus_of_Henettawy%2C_daughter_of_Isetemkheb_MET_25.3.28_EGDP015978-5982_Stitiched.jpg","page_title":"Henuttawy C","context_page_description":"Henuttawy atau Henettawy, merupakan seorang putri Mesir Kuno dan imam selama Dinasti kedua puluh satu Mesir."},{"page_url":"https://en.wikipedia.org/wiki/Grade_II*_listed_buildings_in_Brighton_and_Hove","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/52/North_Gatehouse%2C_8_Church_Street%2C_Brighton.JPG","page_title":"Grade II* listed buildings in Brighton and Hove","context_page_description":"There are 72 Grade II* listed buildings in the city of Brighton and Hove, England. The city, on the English Channel coast approximately 52 miles south of London, was formed as a unitary authority in 1997 by the merger of the neighbouring towns of Brighton and Hove. Queen Elizabeth II granted city status in 2000.\\nIn England, a building or structure is defined as \\"listed\\" when it is placed on a statutory register of buildings of \\"special architectural or historic interest\\" by the Secretary of State for Culture, Media and Sport, a Government department, in accordance with the Planning Act 1990. English Heritage, a non-departmental public body, acts as an agency of this department to administer the process and advise the department on relevant issues. There are three grades of listing status. Grade I, the highest, is defined as being of \\"exceptional interest\\"; Grade II* is used for \\"particularly important buildings of more than special interest\\"; and Grade II, the lowest, is used for buildings of \\"special interest\\".\\nBrighton was founded on top of the sea-facing cliffs where the South Downs meet the English Channel."},{"page_url":"https://war.wikipedia.org/wiki/Santa_Lucia_(nasod)","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b6/LocationSaintLucia.png","page_title":"Santa Lucia (nasod)","context_page_description":"An Santa Lucia amo an usa ka nasod isla ha sidlangan Dagat Caribe nga ada ha katubtuban han Kalawdan Atlantiko. An kapital hini amo an Castries."},{"page_url":"https://it.wikipedia.org/wiki/Prima_guerra_giudaica","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a4/IOTAPATA_SIEGE_67_AD_png.png","page_title":"Prima guerra giudaica","context_page_description":"La prima guerra giudaica fu combattuta tra l'Impero romano ed Ebrei ribelli; durò dal 66 al 70 ed ebbe come conseguenza la distruzione del tempio di Gerusalemme."},{"page_url":"https://simple.wikipedia.org/wiki/%C5%8Cei","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/23/Tsushima_1471.jpg","page_title":"Ōei","context_page_description":"Ōei was a Japanese era name after Meitoku and before Shōchō. This period started in July 1394 and ended in April 1428. During this time, the emperors were Go-Komatsu-tennō and Shōkō-tennō."},{"page_url":"https://ja.wikipedia.org/wiki/%E3%83%94%E3%82%A2%E3%83%8E%E3%82%BD%E3%83%8A%E3%82%BF%E7%AC%AC16%E7%95%AA_(%E3%82%B7%E3%83%A5%E3%83%BC%E3%83%99%E3%83%AB%E3%83%88)","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/ce/845_m2.png","page_title":"ピアノソナタ第16番 (シューベルト)","context_page_description":"ピアノソナタ第16番 イ短調 作品42 D 845 は、フランツ・シューベルトが1825年5月に作曲したピアノソナタ。ルドルフ・ヨハネス・フォン・エスターライヒに献呈された。"},{"page_url":"https://ru.wikipedia.org/wiki/%D0%A1%D0%BF%D0%B8%D1%81%D0%BE%D0%BA_%D0%BE%D0%B4%D0%BD%D0%BE%D1%80%D0%BE%D0%B4%D0%BD%D1%8B%D1%85_%D0%BC%D0%BD%D0%BE%D0%B3%D0%BE%D0%B3%D1%80%D0%B0%D0%BD%D0%BD%D0%B8%D0%BA%D0%BE%D0%B2_%D0%BF%D0%BE_%D0%BF%D0%BE%D1%80%D0%BE%D0%B6%D0%B4%D0%B0%D1%8E%D1%89%D0%B8%D0%BC_%D1%82%D1%80%D0%B5%D1%83%D0%B3%D0%BE%D0%BB%D1%8C%D0%BD%D0%B8%D0%BA%D0%B0%D0%BC_%D0%A8%D0%B2%D0%B0%D1%80%D1%86%D0%B0","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a6/Cuboctahedron.png","page_title":"Список однородных многогранников по порождающим треугольникам Шварца","context_page_description":"Существует много связей между однородными многогранниками. Построение Витхоффа способно построить почти все однородные многогранники из треугольников Шварца. Числа, которые могут быть использованы для сторон недиэдрического треугольника Шварца, которые не обязательно приводят только к вырожденным многогранникам, равны 2, 3, 3/2, 4, 4/3, 5, 5/2, 5/3 и 5/4. Число 4/2 тоже можно использовать, но оно приводит к вырожденным однородным многогранникам, поскольку 4 и 2 имеют общий делитель. Существует 44 таких треугольников Шварца, которые, вместе с бесконечным семейством диэдрических треугольников Шварца, могут образовать почти все невырожденные однородные многогранники. Многие вырожденные однородные многогранники с полностью совпадающими вершинами, рёбрами или гранями могут быть также сгенерированы с помощью построения Витхоффа, и те, которые возникают из треугольников Шварца, не использующих 4/2, также включены в таблицы ниже вместе с их невырожденными аналогами.\\nСуществует несколько невитхоффовых однородных многогранника, которые треугольники Шварца не могут сгенерировать."},{"page_url":"https://bg.wikipedia.org/wiki/%D0%98%D1%80%D0%BE%D0%B4_%D0%90%D1%80%D1%85%D0%B5%D0%BB%D0%B0%D0%B9","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/11/Judea_after_Herod.png","page_title":"Ирод Архелай","context_page_description":"Ирод Архелай е етнарх на Самария, Юдея, Идумея от 4 г. пр. Хр. до 6 г. сл. Хр.\\nАрхелай е най-възрастният син на Ирод Велики и неговата четвърта съпруга самаритянката Малтака.\\nБрат е на Ирод Антипа и Олимпия. Полубрат е на Ирод II\\nЗаедно с брат си е възпитаван в Рим.\\nПоследното желание на баща му е той да стане цар на цялото царство. След смъртта на баща си през 4 г. пр. Хр. Архелай потушава брутално бунта на фарисеите и отива в Рим, за да му бъде призната титлата от император Август.\\nАвгуст му отказва обаче царската титла и го назначава за етнарх на Юдея, Идумея и Самария.\\nАрхелай управлява народа си обаче тирански и невъздържано. След връщането му от Рим той сменя Йоазар бен Боет и назначава брат си Елеазар за първосвещеник, като след кратко време го сменя с Йешуа бен Сие и скоро след това отново с Йоазар бен Боет.\\nТой прогонва първата си съпруга Мариамна, за да се ожени за Глафира, съпругата на екзекутирания му брат Александър, въпреки че е още омъжена за Юба II. Женитбата с вдовица на брат е обаче забранена.\\nАрхелай получава годишно общо 600 таланта от данъци и от неговата собственост.\\nПрез 6 г. сл. Хр."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%9F%D0%B0%D0%BC%D1%8F%D1%82%D0%BD%D0%B8%D0%BA_%D0%B3%D1%80%D0%B0%D0%BD%D0%B8%D1%86_%D0%B3%D0%B5%D1%82%D1%82%D0%BE_%D0%B2_%D0%92%D0%B0%D1%80%D1%88%D0%B0%D0%B2%D0%B5","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e0/Upami%C4%99tnienie_muru_getta_PKiN.jpg","page_title":"Памятник границ гетто в Варшаве","context_page_description":"Памятники границ гетто в Варшаве – группа из 22 мемориальных досок и бетонных плит, показывающие расположение стен варшавского гетто в районе Воля и Средместье.\\nПамятники увековечивают в городском пространстве современной Варшавы наиболее отдаленные пункты на границах закрытого еврейского района. Возникли в местах, где в 1940-1943 гг. находились, в частности, ворота, деревянные мостики, переброшеные над арийскими улицами, а также здания, важные для жителей варшавского гетто."},{"page_url":"https://de.wikipedia.org/wiki/No%C3%ABl_Marie_Paymal_Lerebours","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/70/No%C3%ABl_Paymal_Lerebours_04_Paris.jpg","page_title":"Noël Marie Paymal Lerebours","context_page_description":"Noël Marie Paymal Lerebours war ein französischer Optiker und Verleger."},{"page_url":"https://zh.wikipedia.org/wiki/%E7%95%AA%E8%8C%84%E5%B7%A5%E4%BD%9C%E6%B3%95","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/34/Il_pomodoro.jpg","page_title":"番茄工作法","context_page_description":"番茄工作法是一种时间管理法，在1980年代由Francesco Cirillo创立。\\n该方法使用一个定时器来分割出一个一般为25分钟的工作时间和5分钟的休息时间，而那些时间段被称为pomodoros，为意大利语单词pomodoro之复数。"},{"page_url":"https://de.wikipedia.org/wiki/Liste_von_Internaten_in_Deutschland","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/aa/Theresianum_%28Bamberg%29_01.JPG","page_title":"Liste von Internaten in Deutschland","context_page_description":"Die Liste von Internaten in Deutschland umfasst Internate in Deutschland.\\nIn Deutschland bestehen etwa 35 katholische Internate, 34 evangelische Internate, 21 deutsche Landerziehungsheime, 27 im Bundesverband Deutscher Privatschulen zusammengeschlossene Einrichtungen, 13 Schulen unter der Trägerschaft des Christlichen Jugenddorfwerks Deutschlands sowie eine Reihe von öffentlichen Internaten und Sportinternaten."},{"page_url":"https://de.wikipedia.org/wiki/Sankt-Andreas-Kirche_(Ermstedt)","image_url":"http://upload.wikimedia.org/wikipedia/commons/f/f8/Ermstedt-Kirche-22.JPG","page_title":"Sankt-Andreas-Kirche (Ermstedt)","context_page_description":"Die Kirche St. Andreas in Ermstedt, einem Ortsteil von Erfurt, der Hauptstadt Thüringens, ist das kunsthistorisch wichtigste Gebäude des Ortes. Die Kirche wurde nach der Wende außen und innen umfänglich restauriert."},{"page_url":"https://zh.wikipedia.org/zh-my/%E6%B8%A1%E5%8F%A3%E5%BB%BA%E8%A8%AD%E6%8C%87%E6%8F%AE%E9%83%A8%E6%8B%9B%E5%BE%85%E6%89%80","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7b/Panzhihua_Development_and_Construction_Memorial_Hall.jpg","page_title":"渡口建設指揮部招待所","context_page_description":"渡口建设指挥部招待所位于四川省攀枝花市东区，文物遗址年代判定为1964年。2012年7月16日公布为第八批四川省文物保护单位。\\n渡口建设指挥部招待所坐落于大渡口街北边的山坡上，始建于1964年，坐东朝西，占地面积1400平方米，砖木混合结构，青砖素墙，两面坡悬山式青瓦顶，长35米，宽12米，高二层7.5米。1964年，攀枝花开发建设初始，为了让“三线”建设者进得来住得下，云南省建设公司奉命在大渡口北边山坡上修建起一批“干打垒”房屋，俗称“万人招待所”。这批房屋共有十六栋，依序排列唯第十三栋为一楼一底的青砖瓦房，“十三栋”由此得名。1965-1970年期间，邓小平、余秋里、贺龙、彭德怀、陈伯达、李井泉、彭真、郭沫若、吕正操等来攀枝花时，均下榻于此。1995年3月被确定为攀枝花市“爱国主义教育基地”，2002年2月渡口建设指挥部招待所被攀枝花市人民政府公布为市级文物保护单位。"},{"page_url":"https://zh.wikipedia.org/wiki/%E7%BD%AE%E5%AF%8C%E7%AC%AC%E4%B8%80%E5%9F%8E","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/85/Fortune_City_One_Void_view_2017.jpg","page_title":"置富第一城","context_page_description":"置富第一城，為香港新界沙田城河東沙田第一城一個商場及街市建築群，位於新界沙田銀城街1號、2號及樂城街6號，為沙田第一城及附近居民提供服務，現由置富產業信託持有。"},{"page_url":"https://fr.wikipedia.org/wiki/Mus%C3%A9e_Adolf_Michaelis","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/13/Archer_du_fronton_du_temple_d%27Ath%C3%A9na-Apha%C3%AFa.jpg","page_title":"Musée Adolf Michaelis","context_page_description":"Le musée Adolf Michaelis – ou gypsothèque de Strasbourg – est un musée qui conserve la collection de l’Institut d’Archéologie classique de l’université de Strasbourg. Cette collection fut réunie par Adolf Michaelis dès son arrivée en 1874, il est le premier titulaire de la chaire d’Archéologie classique de l’université impériale de Strasbourg fondée en 1872.\\nIl est possible de visiter cette collection située au rez-de-jardin du Palais universitaire de Strasbourg les lundis, mercredis et vendredis de 14 à 18h.. Le musée est également ouvert lors d'évènements culturels comme la Nuit des Musées ou les Journées du Patrimoine."},{"page_url":"https://sk.wikipedia.org/wiki/De_Havilland_Canada_Dash_8","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/de/Austrojet_OE-HWG.jpg","page_title":"De Havilland Canada Dash 8","context_page_description":"De Havilland Canada DHC-8, bežne známe ako Dash 8, je kanadské turbovrtuľové dopravné lietadlo určené na prepravu osôb na regionálnych linkách."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%A6%D0%B5%D1%80%D0%BA%D0%B2%D0%B0_%D0%A0%D1%96%D0%B7%D0%B4%D0%B2%D0%B0_%D0%9F%D1%80%D0%B5%D1%81%D0%B2%D1%8F%D1%82%D0%BE%D1%97_%D0%91%D0%BE%D0%B3%D0%BE%D1%80%D0%BE%D0%B4%D0%B8%D1%86%D1%96_(%D0%92%D0%BE%D1%80%D0%BE%D1%85%D1%82%D0%B0)","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/59/%D0%A6%D0%B5%D1%80%D0%BA%D0%B2%D0%B0_%D0%A0%D1%96%D0%B7%D0%B4%D0%B2%D0%B0_%D0%9F%D1%80%D0%B5%D1%81%D0%B2%D1%8F%D1%82%D0%BE%D1%97_%D0%91%D0%BE%D0%B3%D0%BE%D1%80%D0%BE%D0%B4%D0%B8%D1%86%D1%96_%28%D0%92%D0%BE%D1%80%D0%BE%D1%85%D1%82%D0%B0%29.jpg","page_title":"Церква Різдва Пресвятої Богородиці (Ворохта)","context_page_description":"Це́рква Різдва́ Пресвято́ї Богоро́диці — дерев'яна церква, яка знаходиться у смт Ворохта, Івано-Франківської області. Розташована у північній частині селища, на вершині пагорба, вона є своєрідною візитівкою Ворохти й унікальним одним із найдавніших храмів Гуцульщини."},{"page_url":"https://en.wikipedia.org/wiki/Franja_Transversal_del_Norte","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8f/A_glimpse_of_Guatemala_151-Iglesia_de_Coban_1898.png","page_title":"Franja Transversal del Norte","context_page_description":"The Franja Transversal del Norte is a region in Guatemala delimited on the north by an imaginary line between Vértice de Santiago in Huehuetenango and Modesto Méndez Port in Izabal and in the south by La Mesilla in Huehuetenango and Izabal lake. It is composed, from west to east, of part of the Guatemalan departments of Huehuetenango, Quiché, Alta Verapaz and the entire department of Izabal. It extends roughly 15750 km². During the Guatemalan Civil War, most of the massacres took place there due to the oil, mineral and precious wood reserves in the region. In the 21st century, there are projects to work in the region and a modern highway was built in 2010."},{"page_url":"https://en.wikipedia.org/wiki/Lincoln_cent","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/ab/Abraham_Lincoln%2C_Bronze_Plaque_by_Victor_Brenner.jpg","page_title":"Lincoln cent","context_page_description":"The Lincoln cent is a one-cent coin that has been struck by the United States Mint since 1909. The obverse or heads side was designed by Victor David Brenner, as was the original reverse, depicting two stalks of wheat. The coin has seen several reverse, or tails, designs and now bears one by Lyndall Bass depicting a Union shield. All coins struck by the United States government with a value of 1/100 of a dollar are called cents because the United States has always minted coins using decimals. The penny nickname is a carryover from the coins struck in England, which went to decimals for coins in 1971.\\nIn 1905, sculptor Augustus Saint-Gaudens was hired by the Mint to redesign the cent and the four gold coins, which did not require congressional approval. Two of Saint-Gaudens's proposed designs for the cent were eventually adapted for the gold pieces, but Saint-Gaudens died in August 1907 before submitting additional designs for the cent. In January 1909, the Mint engaged Brenner to design a cent depicting the late president Abraham Lincoln, 1909 being the centennial year of his birth."},{"page_url":"https://lt.wikipedia.org/wiki/Kadrinos_vals%C4%8Dius","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/13/Kallukse_hiiem%C3%A4nd_%28foto_Martin_Suuroja%29.jpg","page_title":"Kadrinos valsčius","context_page_description":"Kadrinos valsčius – valsčius šiaurės Estijoje, Vakarų Viru apskrityje. Jo administracinis centras – Kadrina. Valsčiuje gyvena 5,2 tūkst. žmonių, teritorija užima 329,26 km². Šiaurėje ribojasi su Lahemos nacionaliniu parku. Teritoriją kerta Talino–Narvos kelias, Talino–Sankt Peterburgo geležinkelis.\\nValsčiaus ribos paskutinį kartą nustatytos 2005 m., kai buvo panaikintas Saksio valsčius, ir prijungti Kiku, Parisio ir Saldos kaimai. Didesnė naikinamo valsčiaus dalis tuomet buvo jungiama prie Tapos valsčiaus."},{"page_url":"https://ja.wikipedia.org/wiki/%E3%82%AE%E3%83%A7%E3%83%99%E3%82%AF%E3%83%AA%E3%83%BB%E3%83%86%E3%83%9A","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c8/G%C3%B6bekli_Tepe_surrounding_area.JPG","page_title":"ギョベクリ・テペ","context_page_description":"ギョベクリ・テペ は、アナトリア南東部、シャンルウルファの郊外の丘の上に在る新石器時代の遺跡。遺丘の高さは15メートル、直径はおよそ300メートルに及ぶ。地名は「太鼓腹の丘」の意。標高はおよそ760メートル。ドイツの考古学チームにより発掘調査が行われた。発掘は1996年から始まり、チームの指揮を執ったクラウス・シュミットが他界する2014年まで続いた。\\nギョベクリ・テペの遺丘に残された構造物は非常に古く、紀元前1万年から紀元前8000年の期間に建てられた。祭祀に用いられたと考えられるこれらの構造物には2段階の発達が見られる。第一段階では巨大な丁字型の石柱がいくつも円を描くように並べられている。物理探査により石柱の総数は200本以上、それらの描き出す円が20確認されている。各石柱は6メートル以上、重さは20トン。それらが基盤岩に穿たれた穴にはめ込まれている。第二段階では石柱は小さくなり、磨かれた石灰の床を持つ長方形の部屋に立てられた。遺丘の隣に位置し発掘調査が待たれている構造物は1万4000年から1万5000年前のものであることがトポグラフィック・スキャンによって明らかにされた。これはともすれば更新世を1000年遡行することになる。先土器新石器B期が終わると遺跡は打ち捨てられた。比較的新しい構造物にはギリシャ・ローマ時代のものも見られる。\\nこの構造物が何に使われていたのかははっきりしていない。発掘に携わったクラウス・シュミットは初期新石器時代の神殿だと信じていた。"},{"page_url":"https://hy.wikipedia.org/wiki/%D5%84%D5%B8%D5%B6%D5%B2%D5%B8%D5%AC%D5%A1%D5%AF%D5%A1%D5%B6_%D6%84%D5%A1%D6%80%D5%A1%D5%A4%D6%80","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2f/Charadrius_mongolus_stegmanni_eating_ragworm.JPG","page_title":"Մոնղոլական քարադր","context_page_description":"Մոնղոլական քարադր քարադրների ընտանիքին պատկանող թռչուն:"},{"page_url":"https://pl.wikipedia.org/wiki/Sooronbaj_D%C5%BCeenbekow","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5b/Sooronbay_Jeenbekov_%282018-05-14%29_02.jpg","page_title":"Sooronbaj Dżeenbekow","context_page_description":"Sooronbaj Szaripowicz Dżeenbekow, kirg. Сооронбай Шарипович Жээнбеков; – kirgiski polityk, premier Kirgistanu od 13 kwietnia 2016 do 22 sierpnia 2017, prezydent Kirgistanu od 24 listopada 2017."},{"page_url":"https://de.wikipedia.org/wiki/Luftwaffe_(Bundeswehr)","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/cd/Bundesarchiv_B_145_Bild-F029235-0029%2C_N%C3%BCrburgring%2C_Bundeswehrparade_zum_NATO-Jubil%C3%A4um.jpg","page_title":"Luftwaffe (Bundeswehr)","context_page_description":"Als Luftwaffe werden die deutschen Luftstreitkräfte bezeichnet. Sie ist neben Heer und Marine eine Teilstreitkraft der Bundeswehr."},{"page_url":"https://de.wikipedia.org/wiki/Noyales","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/91/Noyales_%28Aisne%29_mairie.JPG","page_title":"Noyales","context_page_description":"Noyales ist eine französische Gemeinde mit 170 Einwohnern im Département Aisne in der Region Hauts-de-France. Sie gehört zum Arrondissement Vervins, zum Kanton Guise und zum Kommunalverband Thiérache Sambre et Oise."},{"page_url":"https://ga.wikipedia.org/wiki/Chaim_Herzog","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8d/Chaim_herzog.jpeg","page_title":"Chaim Herzog","context_page_description":"An 6ú hUachtarán ar Iosrael ab ea Chaim Herzog. Saighdiúir, dlíodóir, fear gnó agus taidhleoir ab ea é chomh maith, a d'fhás suas in Éirinn."},{"page_url":"https://br.wikipedia.org/wiki/Taddea_Malaspina","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/55/Jacopo_Pontormo_056.jpg","page_title":"Taddea Malaspina","context_page_description":"Taddea Malaspina a oa ur varkizez italian hag a oa serc'h da Alessandro de' Medici, dug Firenze, e deroù ar bloavezhioù 1530 betek war-dro 1537, ha moarvat ivez mamm da zaou eus e vugale, Giulio di Alessandro de' Medici ha Giulia de' Medici."},{"page_url":"https://fr.wikipedia.org/wiki/Monast%C3%A8re_de_Santa_Maria_de_Vilabertran","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1d/Canonica_de_Santa_Maria_de_Vilabertran_04.jpg","page_title":"Monastère de Santa Maria de Vilabertran","context_page_description":"Le monastère de Santa Maria est un monastère situé sur le territoire de Vilabertran, commune de la comarque d'Alt Empordà dans le nord de la province de Gérone et de la communauté autonome de Catalogne en Espagne."},{"page_url":"https://en.wikipedia.org/wiki/Richea_victoriana","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b1/Richea_victoriana_2679.JPG","page_title":"Richea victoriana","context_page_description":"Richea victoriana is a species of flowering plant in the family Ericaceae that is endemic to Victoria, Australia. It is similar to Richea continentis, with differences including the presence of prominent leaf scars on the stems and inflorescences that are less than 12 cm long and have a hairless stem. The species was first formally described in 1995 in Muelleria based on plant material collected from the Thomson River headwaters. It occurs in wet areas in the vicinity of the Baw Baw plateau and the Blue Range."},{"page_url":"https://fr.wikipedia.org/wiki/Velsk","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/37/Flag_of_Velsk_%28Arkhangelsk_oblast%29.png","page_title":"Velsk","context_page_description":"Velsk est une ville de l'oblast d'Arkhangelsk, en Russie. Sa population s'élevait à 22 311 habitants en 2019."},{"page_url":"https://es.wikipedia.org/wiki/Dorothy_Davenport","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f3/Dorothy_Davenport_from_Famous_Film_Folk.jpg","page_title":"Dorothy Davenport","context_page_description":"Dorothy Davenport fue una actriz, guionista, directora y productora cinematográfica estadounidense, cuya trayectoria principal tuvo lugar en la época del cine mudo, en los Biograph Studios bajo la dirección de D.W. Griffith."},{"page_url":"https://de.wikipedia.org/wiki/Rimbachzell","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6a/Rimbach-Zell_079.JPG","page_title":"Rimbachzell","context_page_description":"Rimbachzell ist eine französische Gemeinde mit 198 Einwohnern im Département Haut-Rhin in der Region Grand Est. Sie gehört zum Arrondissement Thann-Guebwiller, zum Kanton Guebwiller und zum Gemeindeverband Région de Guebwiller.\\nDie Nachbargemeinden sind Rimbach-près-Guebwiller und Jungholtz. Das Gemeindegebiet liegt im Regionalen Naturpark Ballons des Vosges."},{"page_url":"https://ja.wikipedia.org/wiki/%E3%82%A2%E3%82%B7%E3%83%A5%E3%83%A9%E3%83%B3%E3%83%89%E9%83%A1_(%E3%82%AA%E3%83%8F%E3%82%A4%E3%82%AA%E5%B7%9E)","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ef/Seal_of_Ashland_County_%28Ohio%29_Clerk_of_Common_Pleas_Court.svg","page_title":"アシュランド郡 (オハイオ州)","context_page_description":"アシュランド郡は、アメリカ合衆国オハイオ州の北部に位置する郡である。2010年国勢調査での人口は53,139人であり、2000年の52,523人から1.2%増加した。郡庁所在地はアシュランド市であり、同郡で人口最大の都市でもある。\\nアシュランド郡はその全体で、アシュランド小都市圏を構成している。"},{"page_url":"https://bn.wikipedia.org/wiki/%E0%A6%96%E0%A6%BE%E0%A6%A6%E0%A6%BF%E0%A6%AE%E0%A6%A8%E0%A6%97%E0%A6%B0_%E0%A6%9C%E0%A6%BE%E0%A6%A4%E0%A7%80%E0%A6%AF%E0%A6%BC_%E0%A6%89%E0%A6%A6%E0%A7%8D%E0%A6%AF%E0%A6%BE%E0%A6%A8","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9e/Common_garden_lizard.jpg","page_title":"খাদিমনগর জাতীয় উদ্যান","context_page_description":"খাদিমনগর জাতীয় উদ্যান বাংলাদেশের সিলেট জেলায় অবস্থিত একটি জাতীয় উদ্যান। ২০০৬ সালের ১৩ এপ্রিল এটি প্রতিষ্ঠিত হয়। ৬৭৮.৮০ হেক্টর জমি নিয়ে এই জাতীয় উদ্যানটি গঠিত।"},{"page_url":"https://fr.wikipedia.org/wiki/Ottignies","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/69/Ferme_du_Douaire_04.jpg","page_title":"Ottignies","context_page_description":"Ottignies est une section de la ville belge d'Ottignies-Louvain-la-Neuve, située en Région wallonne dans la province du Brabant wallon.\\nC'était une commune à part entière avant la fusion des communes de 1977.\\nAvec 10 049 habitants au 1ᵉʳ janvier 2018, Ottignies est la deuxième section la plus peuplée de la Commune, derrière Louvain-la-Neuve."},{"page_url":"https://mk.wikipedia.org/wiki/%D0%93%D0%B0%D0%BB%D0%B8%D1%87%D0%BD%D0%B8%D0%BA","image_url":"http://upload.wikimedia.org/wikipedia/commons/8/8d/Galicnik_Juni_2009_%2819%29.JPG","page_title":"Галичник","context_page_description":"Галичник — село во Општина Маврово и Ростуше, во областа Мала Река. Сместено е на падините на планината Бистра, во центарот на регионот Мијачија. Галичник е туристича знаменитост поради неговата автентична архитектура, богатото културно наследство и восхитувачките пејзажи."},{"page_url":"https://fr.wikipedia.org/wiki/Jean_Bugatti","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/59/St%C3%A8le_Jean_Bugatti_001.jpg","page_title":"Jean Bugatti","context_page_description":"Jean Bugatti est un ingénieur en mécanique, designer et industriel constructeur automobile, pilote d'essai d'usine français, héritier de Bugatti, fondé par son père Ettore Bugatti en 1909."},{"page_url":"https://vi.wikipedia.org/wiki/C%E1%BB%99ng_h%C3%B2a_X%C3%A3_h%E1%BB%99i_ch%E1%BB%A7_ngh%C4%A9a_X%C3%B4_vi%E1%BA%BFt_Litva","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/30/Lithuanian_SSR_1940.jpg","page_title":"Cộng hòa Xã hội chủ nghĩa Xô viết Litva","context_page_description":"Cộng hòa Xã hội chủ nghĩa Xô viết Litva, viết tắt CHXHCNXV Litva hay Litva Xô viết, là một trong các nước cộng hòa thuộc Liên Xô, tồn tại từ năm 1940 đến 1990.\\nCộng hòa Xã hội chủ nghĩa Xô viết Litva thành lập vào ngày 21 tháng 7 năm 1940 với vị thế một chính phủ vệ tinh. Trong Chiến tranh thế giới thứ hai, vào ngày 16 tháng 6 năm 1940, Liên Xô đã tiến hành sáp nhập lãnh thổ của nước Cộng hòa Litva và thành lập CHXHCNXV Litva, Litva trở thành một nước cộng hòa thành viên của Liên bang Xô viết.\\nTừ năm 1941 đến năm 1944, Đức Quốc xã tiến hành xâm lược Liên Xô, vì thế Litva Xô viết đã giải thể trên thực tế. Tuy nhiên, sau khi người Đức rút lui vào các năm 1944–1945, quyền lãnh đạo của Liên Xô lại được thiết lập và tồn tại cho đến năm 1990."},{"page_url":"https://de.wikipedia.org/wiki/Christiane_Rochefort","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1d/Rochefort-ch4.JPG","page_title":"Christiane Rochefort","context_page_description":"Christiane Rochefort war eine französische Schriftstellerin und Feministin. Einige ihrer Schriften publizierte sie unter dem Pseudonym Dominique Féjos."},{"page_url":"https://fr.wikipedia.org/wiki/Tanya_Donelly","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e3/Tanya_Donelly_%282006%29.jpg","page_title":"Tanya Donelly","context_page_description":"Tanya Donelly est une musicienne américaine de Boston, Massachusetts, née le 14 juillet 1966."},{"page_url":"https://fr.wikipedia.org/wiki/Raymond_Vivi%C3%A8s_de_La_Prade","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/24/Premiere-legion-dhonneur.jpg","page_title":"Raymond Viviès de La Prade","context_page_description":"Guillaume Raymond Amant Viviès, baron de La Prade, né le 3 novembre 1763 à Sainte-Colombe-sur-l'Hers et mort le 12 janvier 1813 à Vilnius, en Lituanie, est un général français de la Révolution et de l’Empire."},{"page_url":"https://sr.wikipedia.org/wiki/%D0%A5%D0%B0%D1%81%D0%BB%D0%BE%D1%85_(%D0%91%D0%B0%D0%B2%D0%B0%D1%80%D1%81%D0%BA%D0%B0)","image_url":"http://upload.wikimedia.org/wikipedia/commons/b/b0/Hasloch_in_MSP.svg","page_title":"Хаслох (Баварска)","context_page_description":"Хаслох општина је у њемачкој савезној држави Баварска. Једно је од 40 општинских средишта округа Мајна-Шпесарт. Према процјени из 2010. у општини је живјело 1.394 становника. Посједује регионалну шифру 9677137."},{"page_url":"https://lt.wikipedia.org/wiki/Frank%C5%B3_valstyb%C4%97","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/13/Le_royaume_des_Francs_en_628.svg","page_title":"Frankų valstybė","context_page_description":"Frankų valstybė, Frankų karalystė, Frankija, Frankų žemė, Frangistanas – valstybinis junginys, kelių karalysčių konfederacija Vakarų Europoje, egzistavęs kurią V–VIII a., kurį valdė germanų frankų diduomenė. Iš pradžių valdė tik teritorijas dab. Belgijoje, bet vėliau išsiplėtė, apimdama ir teritorijas dab. Prancūzijoje, Šveicarijoje ir vakarų Vokietijoje.\\nNėra visuotinai sutariama, kuri data gali būti laikoma Frankų valstybės oficialia pabaiga ir imperijos pradžia. Vieni ja laiko Karolingų dinastijos atėjimą į valdžią 752 m., kiti – Karolio Didžiojo valdymo pražią 768 m. Oficialia pabaiga yra laikomi 800 m., kuomet jos valdovas Karolis Didysis buvo karūnuotas imperatoriumi, ir valstybė tapo Frankų imperija."},{"page_url":"https://pl.wikipedia.org/wiki/Droga_N707_(Holandia)","image_url":"http://upload.wikimedia.org/wikipedia/commons/d/d0/Kaart_Provinciale_weg_707.png","page_title":"Droga N707 (Holandia)","context_page_description":"Droga prowincjonalna N707 – droga prowincjonalna w Holandii, w prowincji Flevoland. Przebiega od ronda z drogami N302 i N306 w okolicach Harderwijku do miejscowości Zeewolde."},{"page_url":"https://es.wikipedia.org/wiki/Moore_Haven","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a0/Moore_Haven_FL_crths01.jpg","page_title":"Moore Haven","context_page_description":"Moore Haven es una ciudad ubicada en el condado de Glades en el estado estadounidense de Florida. En el Censo de 2010 tenía una población de 1.680 habitantes y una densidad poblacional de 564,54 personas por km².​"},{"page_url":"https://it.wikipedia.org/wiki/Chiesa_di_Santa_Maria_dell%27Itria_(Milazzo)","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e5/SMI_21_04_2019_08.jpg","page_title":"Chiesa di Santa Maria dell'Itria (Milazzo)","context_page_description":"La chiesa di Santa Maria dell'Itria e il convento dell'Ordine dei frati minori cappuccini costituiscono un aggregato religioso sconsacrato, polo monumentale altrimenti noto come primitivo complesso dei Cappuccini sotto il titolo della Madonna Odigitria; gli edifici sorgono accanto al cimitero cittadino su un'altura posta a levante che domina la località Croce di Mare di Milazzo."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%92%D0%BE%D0%BB%D0%B3%D0%BE%D0%B3%D1%80%D0%B0%D0%B4%D1%81%D0%BA%D0%B8%D0%B9_%D0%BF%D1%80%D0%BE%D1%81%D0%BF%D0%B5%D0%BA%D1%82_(%D1%81%D1%82%D0%B0%D0%BD%D1%86%D0%B8%D1%8F_%D0%BC%D0%B5%D1%82%D1%80%D0%BE)","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5d/Volgogradsky_Prospekt_%28%D0%92%D0%BE%D0%BB%D0%B3%D0%BE%D0%B3%D1%80%D0%B0%D0%B4%D1%81%D0%BA%D0%B8%D0%B9_%D0%BF%D1%80%D0%BE%D1%81%D0%BF%D0%B5%D0%BA%D1%82%29_%284472349983%29.jpg","page_title":"Волгоградский проспект (станция метро)","context_page_description":"«Волгогра́дский проспект» — станция Таганско-Краснопресненской линии Московского метрополитена. Расположена между станциями «Пролетарская» и «Текстильщики»."},{"page_url":"https://pt.wikipedia.org/wiki/Stowarzyszenie_Pi%C5%82karskie_Zawisza_Bydgoszcz","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2d/Bydgoszcz_-_Stadion_Zawiszy.jpg","page_title":"Stowarzyszenie Piłkarskie Zawisza Bydgoszcz","context_page_description":"O Zawisza Bydgoszcz é um clube de futebol polonês da cidade de Bydgoszcz que disputa a 6ª Divisão."},{"page_url":"https://zh.wikipedia.org/zh-cn/%E6%B3%B0%E6%97%8F","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f1/Ayutthaya_Thailand_2004.jpg","page_title":"泰族","context_page_description":"泰族，华裔称呼暹罗人，是泰国的主体民族，即泰国中部人，讲泰语，有自己的文字。在狭义指泰国中部地区、泰国南部地区、德林达依省泰族、在缅甸阿瑜陀耶族和呵叻泰人的傣族。政治指在所有的泰国民族，这包含所有已泰化人民如伊森人、泰沅、华裔、波斯裔泰国人、高棉裔、葡萄牙裔泰国人等。"},{"page_url":"https://ar.wikipedia.org/wiki/STS-133","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/45/President_Obama_Meets_With_STS-133_Crew.jpg","page_title":"STS-133","context_page_description":"إس تي إس-133 ‏ الرحلة الثالثة والثلاثون بعد المائة ضمن برنامج مكوك الفضاء لوكالة ناسا، والرحلة التاسعة والثلاثون والأخيرة لمكوك الفضاء ديسكفري، انطلقت الرحلة في 24 فبراير سنة 2011 من مركز كينيدي للفضاء، وهبطت بتاريخ 9 مارس في مركز كينيدي أيضاً، بعد اثنى عشر يوماً و19 ساعة مكثتها الرحلة في الفضاء، تم خلال الرحلة الرسو على محطة الفضاء الدولية ونقل امدادات وعناصر لوحدة ليوناردو وتجميعها بالاستعانة برجل آلي، وإجراء عمليات سير في الفضاء، بلغ عدد الرواد المشاركين في الرحلة ستة رواد."},{"page_url":"https://sv.wikipedia.org/wiki/Sydlig_sn%C3%A5rtyrann","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/57/Sublegatus_modestus_-_Southern_Scrub-Flycatcher%3B_Potengi%2C_Cear%C3%A1%2C_Brazil.jpg","page_title":"Sydlig snårtyrann","context_page_description":"Sydlig snårtyrann är en fågel i familjen tyranner inom ordningen tättingar. IUCN kategoriserar arten som livskraftig.\\nSydlig snårtyrann delas in i två underarter:\\nSublegatus modestus modestus – förekommer från tropiska östra Peru till Maranhão, Pernambuco och Paraná i östra Brasilien\\nSublegatus modestus brevirostris – förekommer från östra Bolivia till Paraguay, Uruguay och centrala Argentina"},{"page_url":"https://en.wikipedia.org/wiki/Lucas_Baiano","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e3/LucasBaianoPublicDomain.jpg","page_title":"Lucas Baiano","context_page_description":"Lucas R. Baiano is an award-winning, Emmy Award Judging, American political and commercial filmmaker, referenced as “one of the most impressive millennial-generation ad-makers”. Baiano has directed for Hillary Clinton, John McCain, The Republican Governors Association, Tim Pawlenty, Rick Perry, Chris Christie Mitch McConnell, Donald Trump. Commercially including Google and BMW. Baiano has been featured in Time, Forbes, GQ, The Wall Street Journal, The New York Times, Vanity Fair and cited in First Cameraman: Documenting the Obama Presidency in Real Time, written by Arun Chaudhary, Barack Obama's White House Cameraman and Collision 2012: Obama vs. Romney and the Future of Elections in America written by bestselling author Dan Balz."},{"page_url":"https://he.wikipedia.org/wiki/%D7%9E%D7%97%D7%A0%D7%94_%D7%A4%D7%A4%D7%A0%D7%93%D7%95%D7%A8%D7%A3","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b5/ForstWaldhusen03.JPG","page_title":"מחנה פפנדורף","context_page_description":"מחנה פפנדורף שימש כמחנה מעבר במחוז ליבק, היה ביער וולדהוסנר בין השנים 1945 – 1951. במחנה עברו מיליון איש: חיילי הוורמאכט, פליטים גרמנים, מהגרים מאזורי המזרח וחלק מהמעפילים מאניית המעפילים \\"אקסודוס-1947\\" שגורשו מארץ ישראל על ידי הבריטים כחלק ממבצע אואזיס. מחנה פפנדורף היה מחנה הפליטים הגדול ביותר במדינת שלזוויג-הולשטיין שבצפון גרמניה."},{"page_url":"https://es.wikipedia.org/wiki/Tubo_card%C3%ADaco_primitivo","image_url":"http://upload.wikimedia.org/wikipedia/commons/3/35/Gray461-es.png","page_title":"Tubo cardíaco primitivo","context_page_description":"El tubo cardíaco primitivo es el nombre que recibe el corazón primitivo formado a partir del día 19 del desarrollo embrionario. Inicialmente son dos tubos paralelos provenientes de una zona cerca a la cabeza embrionaria llamada región cardiogénica. A comienzos de la tercera semana embrionaria se fusionan formando un solo tubo o corazón tubular.​ El tubo cardíaco crece dentro de la cavidad pericárdica a mayor velocidad que la cavidad que lo contiene. Por tal razón, el tubo cardiaco experimenta un replegamiento complejo aproximdamente en el 25to. día que conlleva a irregularidades en el calibre del tubo que al transcurrir los días de desarrollo embrionario se acentúan.​"},{"page_url":"https://en.wikipedia.org/wiki/Amish","image_url":"http://upload.wikimedia.org/wikipedia/commons/a/a4/De_Ausbund_329.jpg","page_title":"Amish","context_page_description":"The Amish are a group of traditionalist Christian church fellowships with Swiss German Anabaptist origins. They are closely related to, but a distinct branch off from, Mennonite churches. The Amish are known for simple living, plain dress, Christian pacifism, and are slower to adopt many conveniences of modern technology, with a view to not interrupting family time, nor replacing face-to-face conversations whenever possible.\\nThe history of the Amish church began with a schism in Switzerland within a group of Swiss and Alsatian Mennonite Anabaptists in 1693 led by Jakob Ammann. Those who followed Ammann became known as Amish. In the second half of the 19th century, the Amish divided into Old Order Amish and Amish Mennonites. The latter do not eschew motor cars, whereas the Old Order Amish retained much of their traditional culture. When people refer to the Amish today, they normally refer to the Old Order Amish.\\nIn the early 18th century, many Amish and Mennonites immigrated to Pennsylvania for a variety of reasons."},{"page_url":"https://sl.wikipedia.org/wiki/Transalpski_naftovod","image_url":"http://upload.wikimedia.org/wikipedia/commons/1/11/TAL_km_2%2C003%2C_1.jpeg","page_title":"Transalpski naftovod","context_page_description":"Transalpski naftovod je naftovod, ki povezuje Tržaško pristanišče s centralno Evropo. Poteka od Trsta proti severu preko Avstrije v Nemčijo, zato ga upravlja konzorcij TAL, ki ga sestavljajo tri samostojne delniške družbe, in sicer v Italiji Società Italiana per l'Oleodotto Transalpino S.p.A., v Avstriji Transalpine Ölleitung in Österreich GmbH in v Nemčiiji Deutsche Transalpine Oelleitung GmbH. Naftovod TAL je last osmih delničarjev, ki so:\\nOMV\\nRoyal Dutch Shell\\nExxonMobil\\nRuhr Oel\\nEni\\nBP\\nConocoPhillips\\nTotal\\nDružba PKN Orlen, glavni delničar češke Unipetrol, se pogaja za nakup 2 % naftovoda TAL.\\nČe se bo uresničil Pan-evropski naftovod, za čigar zgradnjo se trenutno pogajajo Romunija, Srbija, Hrvaška, Slovenija in Italija, bo speljan od Črnega morja do Trsta, kjer se bo priključil na TAL."},{"page_url":"https://hr.wikipedia.org/wiki/Podmornice_klase_Holland","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8d/Holland_submarine_model.jpg","page_title":"Podmornice klase Holland","context_page_description":"Klasa Holland je klasa britanskih obalnih podmornica koje su prema američkoj licenci izgrađivane u Velikoj Britaniji."},{"page_url":"https://pt.wikipedia.org/wiki/Viburgo_(R%C3%BAssia)","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/ff/Street_in_Vyborg.jpg","page_title":"Viburgo (Rússia)","context_page_description":"Viburgo é uma cidade da Rússia situada no Oblast de Leningrado, distante 130 quilômetros ao noroeste de São Petersburgo, 38 km ao sul da beira de Rússia com Finlândia, onde o canal de Saimaa entra no golfo da Finlândia. Segundo dados de 2002 sua população é de 79 224 habitantes."},{"page_url":"https://en.wikipedia.org/wiki/Sensitive_Security_Information","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/15/SSI_Cover_Sheet.png","page_title":"Sensitive Security Information","context_page_description":"Sensitive Security Information is a category of sensitive but unclassified information under the United States government's information sharing and control rules. SSI is information obtained in the conduct of security activities whose public disclosure would, in the judgement of specified government agencies, harm transportation security, be an unwarranted invasion of privacy, or reveal trade secrets or privileged or confidential information. SSI is governed by Title 49 of the Code of Federal Regulations, parts 15 and 1520.\\nSSI was created to help share transportation-related information deemed too revealing for public disclosure between Federal government agencies; State, local, tribal, and foreign governments; U.S. and foreign air carriers; and others.\\nSSI is not a form of classification under Executive Order 12958 as amended; that is, it is not classified national security information in the sense of Top Secret, Secret or Confidential."},{"page_url":"https://azb.wikipedia.org/wiki/%D8%B1%D9%88%D9%81%D9%88%D8%B3%D8%8C_%D8%A7%D9%88%D8%B1%D9%82%D9%86","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a7/Rufus_Oregon_cityscape.jpg","page_title":"روفوس، اورقن","context_page_description":"روفوس، اورقن آمریکانین اورقن ایالتیندا یئر آلان بیر شهردیر و ۳٫۱۳ کیلومتر موربّع ساحه سی وار. ۲۰۱۰-جی ایلين نۆفوس ساییمی اساسیندا ۲۴۹ نفر و اها‌لی سیخلیغی ۸۰٫۸ اینسان کیلومتر موربّع دیر. بۇ شهر ۷۱٫۶ متر دنیز سئوییه‌سیندن اۇجالیقیدا یئرلشیر. ایالتین % ۴۶ مئشه‌لر ایحاطه ائدیب. بۇ مشه‌لرین ۶۰٪ - فدرال دؤولتین مۆلکودور.\\n۲۰۰۸-جی ایلین رقملرینه گؤره ۳۳٫۰۰۰ قدر موستانق آت بۇ مشه‌لرده واردیر."},{"page_url":"https://de.wikipedia.org/wiki/Sportjahr_1863","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/60/Deutsches_Turnfest_1863_Festplatz_1.jpg","page_title":"Sportjahr 1863","context_page_description":"19. April: Auf Initiative von Rudolf Theodor Simler wird im Bahnhofbuffet Olten von 35 Herren der Schweizer Alpen-Club gegründet. Als erste Berghütte der Schweiz wird später die Grünhornhütte errichtet.\\n12. August: Melchior Anderegg, Florence Crauford Grove und anderen gelingt die Erstbesteigung des 4171 m hohen Dent d’Hérens in den Walliser Alpen.\\n16. August: Melchior Anderegg, Florence Crauford Grove und anderen gelingt die Erstbesteigung der 4432 m hohen Parrotspitze im Monte-Rosa-Massiv.\\n29. August: Paul Grohmann und Francesco Lacedelli gelingt die Erstbesteigung der 3244 m hohen Tofana di Mezzo in den Dolomiten.\\n7. September: Gemeinsam mit anderen besteigt Abraham Roth erstmals den Bifertenstock in den Glarner Alpen.\\n23. Oktober: In Turin wird auf Initiative von Quintino Sella der Club Alpino Italiano gegründet.\\nLudwig Barth und Leopold Pfaundler besteigen als erste die Pfaffenschneide, wenige Tage später folgen Joseph Anton Specht und Alois Tanzer im Zuge der Zuckerhütl-Besteigung.\\nJosef Anton Specht gelingt mit Bergführer Alois Tanzer die Erstbesteigung des Zuckerhütl, des höchsten Berges der Stubaier Alpen in Tirol."},{"page_url":"https://en.wikipedia.org/wiki/Firdaus_Kasman","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/dc/1_firdaus_kasman_2014.jpg","page_title":"Firdaus Kasman","context_page_description":"Mohammad Firdaus bin Kasman is a Singapore international footballer who plays as a midfielder for Warriors in the S.League."},{"page_url":"https://hu.wikipedia.org/wiki/Velbasta%C3%B0ur","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1f/Velbasta%C3%B0ur%2C_Faroe_Islands_%283%29.JPG","page_title":"Velbastaður","context_page_description":"Velbastaður település Feröer Streymoy nevű szigetén. Közigazgatásilag Tórshavn községhez tartozik."},{"page_url":"https://nl.wikipedia.org/wiki/Martin_Walser","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5e/Martin_Walser_2010-4604.jpg","page_title":"Martin Walser","context_page_description":"Martin Johannes Walser is een Duits schrijver van romans, verhalen en toneel, en vooraanstaand intellectueel."},{"page_url":"https://arz.wikipedia.org/wiki/%D8%AA%D8%A7%D8%B1%D9%8A%D8%AE_%D9%85%D8%B5%D8%B1_%D8%A7%D9%84%D8%AE%D8%B1%D8%A7%D9%81%D9%89","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/01/Jean-Francois_Champollion_1828_29.jpg","page_title":"تاريخ مصر الخرافى","context_page_description":"تاريخ مصر الخرافى - Imaginary History of Egypt -، هو تاريخ مصر اللى كان معروف قبل فك شامبوليون للهيروغليفيه المصريه و إهتمام الأوروبيين بإكتشاف تاريخ مصر الحقيقى Real history of Egypt عن طريق الابحاث العلميه و الإكتشافات الاثريه. تاريخ مصر الخرافى ده موجود فى كتب القرون الوسطى و ساعات لغاية دلوقتى فى عقول غير المثقفين.\\nقبل شامبوليون كات الهيروغليفيه المصريه نفسها بتتفسر غلط، و كان السايد إن الرسومات الهيروغليفيه دى مش حروف لكن رسومات بترمز لحاجات. و من المنطلق الغلط ده اترجمت الرسومات و اتفسرت بطريقه خرافيه و ظهرت نظريات لجهال ومنجمين وسحره ورجال دين من الشرق والغرب.\\nقبل الإكتشافات و الابحاث العلميه اللى فتح بابها شامبوليون كان المعروف من تاريخ مصر اللى اتذكر فى الكتب الدينيه و قصة فرعون و موسى و يوسف إتضافت ليها قصص و تفسيرات خرافيه. ده مع انه كانت فيه كتب لرحاله و مؤرخين يونانيين و رومان زاروا مصر و كتبوا عنها و عن تاريخها و ديانتها بطريقه موضوعيه. وده السبب أن الأوروبيين كانوا بيعرفوا عن تاريخ مصر أكتر بكتير من المصريين فى عصور ما بعد الفرعونيه، اللى من كتابتهم واضح انهم فى الغالب ما كانوش بيطلعوا على الكتب دى."},{"page_url":"https://nl.wikipedia.org/wiki/Lijst_van_kerken_in_Friesland","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/89/Zuidgevel_-_Katlijk_-_20124051_-_RCE.jpg","page_title":"Lijst van kerken in Friesland","context_page_description":"De Lijst van kerken in de Nederlandse provincie Friesland telt honderden kerkgebouwen, waaronder meer dan 130 middeleeuwse kerken die de tand des tijds geheel of gedeeltelijk hebben doorstaan.\\nDe provincie was in de middeleeuwen relatief dichtbevolkt. De bevolking woonde met name in en rond de Friese elf steden en meer dan honderd dorpen. Centraal in stad en dorp stond de kerk. Daarnaast werd het platteland gedomineerd door de talloze kloosters in Friesland. Van de kloosters is weinig overgebleven, maar van de kerken des te meer.\\nFriesland maakte tot 1559 vrijwel in zijn geheel deel uit van het bisdom Utrecht, enkel het gebied van de huidige gemeente Achtkarspelen behoorde tot het bisdom Münster. Tijdens de Beeldenstorm in Friesland gingen de meeste kerken over van de Rooms-Katholieke Kerk naar het Protestantisme. Hierbij ging veel van het kerkmeubilair verloren en werden de kerkgebouwen soberder ingericht.\\nDoor de ontkerkelijking en het samengaan van hervormde en gereformeerde kerken werd in de 20e en 21e eeuw een groot aantal kerkgebouwen overbodig. De Stichting Alde Fryske Tsjerken heeft meer dan 40 kerken in Friesland overgenomen, alle erkend als rijksmonument."},{"page_url":"https://da.wikipedia.org/wiki/Neuwerk","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/55/Leuchtturm_auf_Neuwerk.jpg","page_title":"Neuwerk","context_page_description":"Neuwerk er en beboet ø med ca. 40 indbyggere i den sydøstlige del af Nordsøen og i den sydvestlige del af Elbenmunsdingen i det nordvestlige Tyskland. Øen ligger ca. 13 kilometer nordvest for Cuxhaven. Administrativt udgør øen, sammen med de ubeboede naboøer Scharhörn og Nigehörn, eksklaven Stadtteil Neuwerk i Hamborg, som ligger ca. 100 kilometer længere mod sydøst. Øen er en del af den 13.750 hektar store Nationalpark Hamburgisches Wattenmeer. Det højeste punkt er på ca. 7 meter."},{"page_url":"https://ja.wikipedia.org/wiki/%E3%83%87%E3%82%A3%E3%83%B3%E3%82%AD%E3%83%B3%E5%9B%B3%E5%BD%A2","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a6/Geometric_folding_Dynkin_graphs_affine2.png","page_title":"ディンキン図形","context_page_description":"リー理論という数学の分野において、ディンキン図形とは、二重あるいは三重の辺を持ち得るグラフの一種であり、イェヴゲニ・ディンキン にちなんで名づけられた。多重辺は制約条件により有向である。\\nディンキン図形は代数閉体上の半単純リー環を分類する手段として主に興味を持たれている。これはワイル群を生じる、すなわち多くの有限鏡映群を生じる。ディンキン図形は他の文脈においても現れる。\\n「ディンキン図形」という用語には曖昧さがある。ある場合にはディンキン図形は有向であると仮定され、この場合それらはルート系や半単純リー環に対応するが、他の場合には有向でないと仮定され、この場合ワイル群に対応する；有向図形 Bₙ, Cₙ は同じ無向図形を生じ、これは BCₙ と呼ばれる。この記事では、「ディンキン図形」は「向き付けられた」ディンキン図形を意味し、「向き付けられていない」ディンキン図形は明示的にそう呼ぶ。"},{"page_url":"https://fr.wikipedia.org/wiki/Prix_M%C3%A9dicis","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c3/Jean-Marie_Blas_de_Robl%C3%A8s_%282014%29.jpg","page_title":"Prix Médicis","context_page_description":"Le prix Médicis est un prix littéraire français fondé par Gala Barbisan et Jean-Pierre Giraudoux le 1ᵉʳ avril 1958 afin de couronner un roman, un récit, un recueil de nouvelles dont l'auteur débute ou n'a pas encore une notoriété correspondant à son talent. Historiquement attribué en même temps que le prix Femina à l'hôtel de Crillon, il est désormais décerné deux jours plus tard au restaurant La Méditerranée situé place de l'Odéon à Paris."},{"page_url":"https://he.wikipedia.org/wiki/%D7%A2%D7%99%D7%98%D7%9D_%D7%9C%D7%91%D7%9F-%D7%96%D7%A0%D7%91","image_url":"http://upload.wikimedia.org/wikipedia/commons/8/8b/Haliaeetus_albicilla_1_%28Martin_Mecnarowski%29.jpg","page_title":"עיטם לבן-זנב","context_page_description":"עֵיטָם לְבֶן-זָנָב, מין עוף דורס גדול גוף בסוג עיטם שבמשפחת הנציים. השם \\"עיטם\\" הוא הלחם של המילים \\"עיט\\" ו\\"ים\\" המצביעות על מקום חיותו של העוף - בקרבת מקווי מים גדולים. שם המין נובע מזנבו הלבן כליל. העיטם לבן-הזנב הוא הציפור הלאומית של פולין."},{"page_url":"https://en.wikipedia.org/wiki/Charles_H._Dyson_School_of_Applied_Economics_and_Management","image_url":"http://upload.wikimedia.org/wikipedia/commons/3/37/Cornell_Warren_Hall_2.jpg","page_title":"Charles H. Dyson School of Applied Economics and Management","context_page_description":"The Charles H. Dyson School of Applied Economics and Management is a unit within both the College of Agriculture and Life Sciences and the newly founded Cornell S.C. Johnson College of Business of Cornell University, a private Ivy League university located in Ithaca, New York.\\nWith an acceptance rate of 3%, The Dyson School is the most selective program in the Cornell University system. The Dyson School houses Cornell's undergraduate business school as well as graduate education in applied economics. The school focuses on business, agribusiness, environmental and resource economics, and international and development economics offering a Bachelor of Science in Applied Economics and Management and three graduate degrees, M.S., M.P.S. and Ph.D, in Applied Economics and Management. As of 2017, the Dyson School has 64 full-time faculty and 17 lecturers or adjunct faculty. In 2015, there were 104 graduate students and 735 undergraduates in Dyson School. Of these 735 undergraduates, 39% are female students and 11% international students."},{"page_url":"https://ast.wikipedia.org/wiki/Dardos","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9c/Harrows_Bristle_Board_Bullseye.JPG","page_title":"Dardos","context_page_description":"Los dardos son un xuegu que se practica individualmente o por equipos, y que consiste en llanzar tres dardos alternativamente cada xugador a una diana hasta completar una puntuación determinada o algamar unos sectores determinaos una serie de vegaes tamién determinada, según la variante del xuegu a la que se tea xugando."},{"page_url":"https://hu.wikipedia.org/wiki/N%C3%A9metorsz%C3%A1g_m%C3%A1sodik_kateg%C3%B3ri%C3%A1ba_tartoz%C3%B3_vas%C3%BAt%C3%A1llom%C3%A1sai","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e1/Hauptbahnhof-Trier.jpg","page_title":"Németország második kategóriába tartozó vasútállomásai","context_page_description":"Ez a szócikk azokat a német vasútállomásokat sorolja fel, mely a német vasútállomás kategóriák közül a másodikba tartoznak."},{"page_url":"https://en.wikipedia.org/wiki/Tenente_Ananias","image_url":"http://upload.wikimedia.org/wikipedia/commons/8/8c/Bras%C3%A3o_de_Tenente_Ananias_%28RN%29.PNG","page_title":"Tenente Ananias","context_page_description":"Tenente Ananias is a municipality in the state of Rio Grande do Norte in the Northeast region of Brazil."},{"page_url":"https://nl.wikipedia.org/wiki/Station_Hollandsche_Rading","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/cc/Hollandsche_Rading_13-03-2005.JPG","page_title":"Station Hollandsche Rading","context_page_description":"Station Hollandsche Rading is een spoorwegstation aan de spoorlijn Hilversum - Utrecht, nabij het dorp Hollandsche Rading. Langs deze spoorlijn is een bijzonder type bovenleidingportalen toegepast met als bijnaam De Gotische Bogen.\\nHet eerste station werd op 1 juni 1885 in gebruik genomen. In 1987 werd een nieuw eenvoudig haltegebouw geopend, dat in 1995 alweer buiten gebruik gesteld werd, en sindsdien een bank huisvest. In maart 2008 werd bekend dat NS het gebouw zal gaan verkopen. In de zomer van 2010 is er in dit gebouw een kiosk gevestigd.\\nDe perrons liggen in een bajonetligging, waardoor de opmerkelijke situatie is ontstaan dat het perron richting Utrecht Centraal in de provincie Utrecht ligt, en het perron richting Hilversum in de provincie Noord-Holland."},{"page_url":"https://ja.wikipedia.org/wiki/%E3%83%AC%E3%82%AF%E3%83%86%E3%82%A3%E3%83%B3%E3%82%B0","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e7/Tinganes.jpg","page_title":"レクティング","context_page_description":"レクティングは、フェロー諸島の議会。"},{"page_url":"https://de.wikipedia.org/wiki/1._Minensuchgeschwader","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/eb/1._MSG_%28Wappen%29.JPG","page_title":"1. Minensuchgeschwader","context_page_description":"Das 1. Minensuchgeschwader wurde 1956 in der neuen Bundesmarine aufgestellt. Es gehörte zur Flottille der Minenstreitkräfte und wurde 2005 aufgelöst."},{"page_url":"https://de.wikipedia.org/wiki/Fred_Sinowatz","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5a/Fred_Sinowatz.jpg","page_title":"Fred Sinowatz","context_page_description":"Alfred „Fred“ Sinowatz war ein österreichischer Politiker und Historiker. Von 1983 bis 1986 war er Bundeskanzler der Republik Österreich.\\nAls Bundesminister für Unterricht und Kunst unter den Regierungen Bruno Kreiskys in den Jahren 1971 bis 1983 zeichnete er für sozial orientierte Reformen im Bildungssystem verantwortlich. Er ließ zahlreiche neue höhere Schulen in Bezirkshauptstädten bauen, erleichterte den AHS-Zugang, führte unter anderem die Schülerfreifahrt, Gratis-Schulbücher sowie Schul- und Heimbeihilfen ein.\\nWährend des Wahlkampfs zur Bundespräsidentenwahl im Juni 1986 trat Bundeskanzler Sinowatz im Zuge der sogenannten „Waldheim-Affäre“ vehement gegen den Kandidaten der ÖVP, Kurt Waldheim, auf. Als dieser gewählt wurde, trat Sinowatz als Bundeskanzler zurück. Gemäß seinem Vorschlag wurde Franz Vranitzky sein Nachfolger."},{"page_url":"https://fr.wikipedia.org/wiki/Audi_80","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/11/Audi_4000CS.jpg","page_title":"Audi 80","context_page_description":"Audi 80 a été le nom de quatre générations d'automobiles - du segment intermédiaire-supérieur - fabriquées par le constructeur allemand Audi. La première génération d'Audi 80 a tracé l'avenir de la nouvelle génération de familiales pour tous, basée sur le fameux adage de la marque — « Vorsprung durch Technik » — toujours en application."},{"page_url":"https://en.wikipedia.org/wiki/List_of_canals_in_France","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d3/French_canals_index_map.jpg","page_title":"List of canals in France","context_page_description":"This is a list of the navigable canals and rivers in France. For reference purposes, all waterways are listed, including many that have been abandoned for navigation, mostly in the period 1925-1955, but some in later years. Although several sources are used and listed in the references below, an important source of up-to-date information on French waterways is Inland Waterways of France, by David Edwards-May, and its online version, navigation details for 80 French rivers and canals. Other sources using the same public information are the historic publishing house Berger-Levrault, Hugh McKnight, David Jefferson, Editions de l'Ecluse and the series of waterway guides published by Les Editions du Breil, all listed below the table. A comprehensive historic list with 513 entries for French canals is published online by Charles Berg."},{"page_url":"https://th.wikipedia.org/wiki/%E0%B8%81%E0%B8%B2%E0%B8%A3%E0%B9%80%E0%B8%A5%E0%B8%B7%E0%B8%AD%E0%B8%81%E0%B8%95%E0%B8%B1%E0%B9%89%E0%B8%87%E0%B8%AA%E0%B8%A1%E0%B8%B2%E0%B8%8A%E0%B8%B4%E0%B8%81%E0%B8%A3%E0%B8%B1%E0%B8%90%E0%B8%AA%E0%B8%A0%E0%B8%B2%E0%B9%80%E0%B8%81%E0%B8%B2%E0%B8%AB%E0%B8%A5%E0%B8%B5%E0%B9%80%E0%B8%AB%E0%B8%99%E0%B8%B7%E0%B8%AD_%E0%B8%9E.%E0%B8%A8._2546","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/48/Kim_Jong-il_on_August_24%2C_2011.jpg","page_title":"การเลือกตั้งสมาชิกรัฐสภาเกาหลีเหนือ พ.ศ. 2546","context_page_description":"การเลือกตั้งสมาชิกสภาแห่งชาติ เกิดขึ้นที่ประเทศเกาหลีเหนือ เมื่อวันที่ 3 สิงหาคม พ.ศ. 2544 ผลปรากฏว่า พรรคแรงงานแห่งเกาหลีโดย คิม จ็อง-อิล ได้รับชัยชนะด้วยจำนวน 687 ที่นั่ง จาก 687 ที่นั่ง"},{"page_url":"https://es.wikipedia.org/wiki/Ronald_Aguilar","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/27/Ronald_Aguilar_%28Pol%C3%ADtico%29.jpg","page_title":"Ronald Aguilar","context_page_description":"Ronald Jesús Aguilar Pérez, es un docente y político de la oposición venezolana. Fue alcalde del municipio Antonio José de Sucre, llegando a este cargo a través de las elecciones municipales de 2013, por el partido de la MUD.​ Además de haber participado como candidato, por el circuito 2 de Barinas, para diputado de la Asamblea Nacional en 2010.\\nAños más tarde, se postuló para su reelección en las elecciones municipales de 2017, pero perdió ante la candidata del PSUV, Belkis Pidiachi.​"},{"page_url":"https://ga.wikipedia.org/wiki/C%C3%BAige_Zaporizhia","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/18/Map_of_Ukraine_political_simple_Oblast_Saporischja.png","page_title":"Cúige Zaporizhia","context_page_description":"Is cúige de chuid na hÚcráine é Cúige Zaporizhia. Is é Zaporizhia an phríomhchathair. Bunaíodh an cúige seo sa bhliain 1939."},{"page_url":"https://zh.wikipedia.org/zh-tw/%E5%A4%9A%E9%BD%92%E6%96%B0%E7%B1%B3%E8%9D%A6","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/57/Minaminumaebi.jpg","page_title":"多齒新米蝦","context_page_description":"多齒新米蝦，台灣水族市場上之「黑殼蝦」多為此種，生物分類屬於匙指蝦科新米蝦屬，陸封型淡水蝦，分布於越南、香港、台灣、中國、琉球、日本及韓國。具協助清除殘餌、藻類之功用，可混養於水族箱作為魚缸之清道夫，或是作為中大型肉食性魚類的餌料；但個體食藻種類與食量不敵大和藻蝦，因為價格便宜、容易飼養而以量取勝。各體色變種相當受水族玩家歡迎，其中尤以紅色系變種「玫瑰蝦」最為常見。"},{"page_url":"https://da.wikipedia.org/wiki/Grace_Hopper","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/37/Grace_Hopper_and_UNIVAC.jpg","page_title":"Grace Hopper","context_page_description":"Grace Murray Hopper, var en amerikansk matematiker, IT-specialist og kontreadmiral i US Navy.\\nHopper arvede en interesse for matematik fra sin mor Mary Van Horne. Hun blev tidligt interesseret i maskiner generelt og senere i specielt regne- og automatiseringsmaskiner. Hun blev tidligt reserveofficer i United States Navy, og arbejdede under 2. verdenskrig med flådens regneautomater. Hun skiftede til civil tjeneste og blev ansat ved Eckert-Mauchly Computer Corporation i 1949. Senere vendte hun tilbage til flåden, hvor hun arbejdede indtil hun i 1966 blev pensioneret som kommandørkaptajn. Otte måneder senere blev hun genansat midlertidigt i en periode på seks måneder, og denne midlertidige ansættelse blev herefter forlænget gennem en årrække, indtil Hopper lod sig endeligt pensionere fra US Navy som 79-årig den 14. august 1986. Hun fortsatte imidlertid med at arbejde som seniorkonsulent for Digital Equipment Corporation indtil kort tid før sin død.\\nGrace Hopper fandt det unødigt arbejdskrævende at programmere datidens beregningsautomater og fik ideen til et program som kunne oversætte tekst til datasprog, en såkaldt compiler."},{"page_url":"https://de.wikipedia.org/wiki/Fischer_am_Rathaus","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d4/B%C3%A4ckerei_Fischer_am_Rathaus_%281%29.jpg","page_title":"Fischer am Rathaus","context_page_description":"Fischer am Rathaus ist eine Bäckerei und Konditorei in der Innenstadt von Dortmund. Sie wurde 1848 gegründet und befindet sich seither in Familienbesitz.\\nDie Bäckerei gilt als Erfinder des Dortmunder Salzkuchens, eine Brötchenspezialität, die hier häufig mit Mett und Zwiebeln gegessen wird."},{"page_url":"https://arz.wikipedia.org/wiki/%D9%85%D8%A7%D9%8A%D9%83%D9%84_%D9%87%D8%A7%D8%B1%D8%AA%D9%85%D8%A7%D9%86","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/63/Michael_Hartmann_by_Olaf_Kosinsky-1.jpg","page_title":"مايكل هارتمان","context_page_description":"مايكل هارتمان سياسى من المانيا."},{"page_url":"https://cs.wikipedia.org/wiki/Seznam_rozhleden_v_Pardubick%C3%A9m_kraji","image_url":"http://upload.wikimedia.org/wikipedia/commons/f/fa/Rozhledna-bara-slatinany-05.jpg","page_title":"Seznam rozhleden v Pardubickém kraji","context_page_description":"Seznam rozhleden v Pardubickém kraji představuje výčet rozhleden a vyhlídkových věží, které se nachází v Pardubickém kraji.\\nVzhledem k nejednoznačné definici rozhleden a stále přibývajících staveb tohoto druhu je pravděpodobné, že seznam nebude úplný."},{"page_url":"https://fr.wikipedia.org/wiki/Ordre_du_Saint-Esprit","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/bc/Roslin_Louis_XVI_of_France.jpg","page_title":"Ordre du Saint-Esprit","context_page_description":"L’ordre du Saint-Esprit est un ordre de chevalerie français, fondé le 31 décembre 1578 par Henri III. Pendant les deux siècles et demi de son existence, il est l’ordre de chevalerie le plus prestigieux de la monarchie française.\\nCe n’est cependant pas le plus ancien, puisque l’ordre de Saint-Michel a été fondé 110 ans auparavant. Il n'est plus attribué par l'État depuis 1830, et relève aujourd'hui d'un ordre dynastique.\\nIl est aussi nommé le cordon bleu, la croix de l'Ordre du Saint-Esprit étant habituellement portée par les chevaliers autour de l'épaule droite sur un ruban de couleur bleu."},{"page_url":"https://es.wikipedia.org/wiki/Iglesia_de_San_Pedro_(Sevilla)","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c1/Iglesia_de_San_Pedro%2C_Sevilla_001.jpg","page_title":"Iglesia de San Pedro (Sevilla)","context_page_description":"La Iglesia de San Pedro es un templo católico de estilo gótico-mudéjar construido en el siglo XIV y reformado en los siglos XVI y XVIII. Se localiza en la Plaza de San Pedro de la ciudad de Sevilla y es sede de la Parroquia de San Pedro y San Juan Bautista.​"},{"page_url":"https://el.wikipedia.org/wiki/%CE%9A%CE%B1%CF%84%CE%AC%CE%BB%CE%BF%CE%B3%CE%BF%CF%82_%CE%BF%CF%81%CF%85%CE%BA%CF%84%CF%8E%CE%BD","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/96/Marmur_serpentynowo-_brucytowy.JPG","page_title":"Κατάλογος ορυκτών","context_page_description":"Ο κατάλογος που ακολουθεί περιλαμβάνει τα κυριότερα ορυκτά ταξινομημένα αλφαβητικά και, όπου είναι δυνατόν, κατά ομάδες."},{"page_url":"https://it.wikipedia.org/wiki/%C3%89tablissement_Public_de_T%C3%A9l%C3%A9vision","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a3/ENTV_%26_EPTV_logo.png","page_title":"Établissement Public de Télévision","context_page_description":"Établissement Public de Télévision è un'azienda pubblica algerina che gestisce la telediffusione in Algeria.\\nGestisce 5 canali televisivi: Télévision Algérienne, Canal Algérie, A3, TV Tamazight 4 e Coran TV; gestisce inoltre un canale di prova, EPTV Feed.\\nÈ membro dell'Unione europea di radiodiffusione dal 1970 e dell'Unione di radiodiffusione dei paesi arabi ed è tra gli azionisti della società EuronewsNBC."},{"page_url":"https://nl.wikipedia.org/wiki/Martijn_van_Iterson","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/57/Martijn_van_iterson-1552573026.jpg","page_title":"Martijn van Iterson","context_page_description":"Martijn van Iterson is een Nederlands jazzgitarist, componist en docent.\\nHij studeerde in 1993 cum laude af aan het Hilversums Conservatorium, waar hij onder andere les had van Wim Overgaauw. In 2004 ontving hij op het North Sea Jazz Festival uit handen van Pat Metheny de Bird Award, sinds 2006 de Paul Acket Award geheten. Van Iterson speelde met vele grote namen uit de jazzwereld waaronder Jim Hall, Lee Konitz, Toots Thielemans, Mike Stern, Randy Brecker, Piet Noordijk, Kurt Rosenwinkel en Rita Reys. Hij was lid van groepen als D-Code, Picks Might Fly en All the King's Men. Tevens is hij momenteel vaste gitarist van het Jazz Orchestra of the Concertgebouw. Hij heeft drie albums onder eigen naam uitgebracht. Tegenwoordig geeft van Iterson les op zowel het Koninklijk Conservatorium en het Conservatorium van Amsterdam."},{"page_url":"https://pl.wikipedia.org/wiki/Tward%C3%B3wka_(anatomia)","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/86/Sclera.PNG","page_title":"Twardówka (anatomia)","context_page_description":"Twardówka – gruba, biała warstwa ochronna, nadająca kształt gałce ocznej, otaczająca oko od strony oczodołu, w przedniej części gałki ocznej przechodzi w rogówkę. W części tylnej, w miejscu gdzie twardówka przechodzi w pochewkę nerwu wzrokowego, grubość jej jest największa i wynosi 1,3 mm. W części przedniej jest najcieńsza i jej grubość równa się 0,3 mm. Twardówka jest słabo unaczyniona i mało czuła. U ssaków zbudowana jest z tkanki łącznej włóknistej; u pozostałych kręgowców zawiera również elementy chrząstki i tkanki kostnej.\\nTwardówka zbudowana jest z warstw:\\nistota właściwa twardówki\\nblaszka brunatna twardówki\\nblaszka nadtwardówkowa\\nPonadto w twardówce można wyróżnić następujące struktury: kanał twardówki, blaszkę sitową twardówki, zatokę żylną twardówki."},{"page_url":"https://en.wikipedia.org/wiki/Martin_Kolberg","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/30/Martin_Kolberg_vid_Nordiska_Radets_session_i_Reykjavik._2010-11-03.jpg","page_title":"Martin Kolberg","context_page_description":"Martin Kolberg is a Norwegian politician for the Labour Party. He served as the party secretary from 2002 until 2009. He was elected to the Parliament of Norway in 2009 and since 2013 serves as leader of the Standing Committee on Scrutiny and Constitutional Affairs."},{"page_url":"https://no.wikipedia.org/wiki/Lamba_(Eysturoy)","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/16/Lambi%2C_Faroe_Islands.JPG","page_title":"Lamba (Eysturoy)","context_page_description":"Lamba, før 2011 Lambi, er en bygd på Færøyene. Den ligger i enden av Lambavík på Eysturoys østkyst, og heller ikke langt fra Skálafjørður. Lambi er en del av Runavíkar kommuna. Husene i bygda følger veien gjennom en trang dal, og nede ved fjorden er det en liten fiskerhavn. På havna er det en stor stein som ingen ønsker å fjerne fordi den ifølge gammel folketro er bebodd av huldufólk. Selve bygda er rent historisk en bondebygd, og er første gang nevnt skriftlig i Hundebrevet fra 1300-tallet.\\nNyttårsaften 1707 sank det danske handelsskipet «Norske Löwe» i Lambavík, og skipsklokken finnes i dag i Tórshavn domkirke. Mange dykkere har lett etter skipet gjennom årene, men de har ikke funnet noe av interesse. Det sies at skipet hadde en gullskatt ombord.\\n1. januar 2009 hadde Lamba 130 innbyggere, mot 116 i 1985."},{"page_url":"https://fr.wikipedia.org/wiki/Liste_d%27attaques_terroristes_d%27extr%C3%AAme_droite","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/74/Drapeau_flag_nazi_waffen_ss_conf%C3%A9d%C3%A9r%C3%A9s_confederate_croix_celtique_cetltic_cross_far_right_extreme_droite.png","page_title":"Liste d'attaques terroristes d'extrême droite","context_page_description":"Cet article dresse une liste des attaques terroristes d’extrême droite.\\nDepuis l'après-guerre et la chute des régimes fascistes en Europe, divers organisations ou individus imprégnés d'une idéologie néonazie, nationaliste, suprémacistes blanche ou intégriste ont perpétré des attaques terroristes dans un but politique. Ces protagonistes ont usé de différents modes d'action, notamment des attentats à la bombe, tueries de masse, sabotages, assassinats."},{"page_url":"https://zh.wikipedia.org/zh-cn/%E6%8F%90%E7%9D%A3%E8%A1%97%E5%B8%82","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fe/Gate_of_Red_Market.jpg","page_title":"提督街市","context_page_description":"红街市大楼，或称提督街市，是目前唯一被列入澳门文物名录上的街市建筑，亦是仍运作的澳门街市之一。红街市大楼位于澳门高士德大马路及罅些喇提督大马路交界，建于1936年。"},{"page_url":"https://sv.wikipedia.org/wiki/Picatinnyskena","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3d/Ar10t.jpg","page_title":"Picatinnyskena","context_page_description":"Picatinnyskena är en skena som är fast monterad på många moderna handeldvapen. På picatinnyskenan kan man sedan montera tillbehör som kikarsikte, mörkersikte, vapenlampa, bipod, bajonett och liknande. Den är standardiserad som MIL-STD-1913 och STANAG 2324."},{"page_url":"https://en.wikipedia.org/wiki/List_of_equipment_of_the_Lebanese_Armed_Forces","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1f/SG_540_Manurhin.jpg","page_title":"List of equipment of the Lebanese Armed Forces","context_page_description":"Lebanese Armed forces Equipment still contains significant amounts of old weaponry, but it has embarked on some major improvements recently. The M113, which is commonly found with every regiment and brigade, is considered to be the major element of the ground forces. A collection of Western and Soviet made arms and equipment exists ranging from rifles to tanks. However, the Lebanese army is still trying to rearm and modernize itself through new aids and purchases from different countries such as the United States, Belgium, Russia, and The Netherlands."},{"page_url":"https://fi.wikipedia.org/wiki/Loudi","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d8/Calcite-Stibnite-34749.jpg","page_title":"Loudi","context_page_description":"Loudi on prefektuuritason kaupunki Kiinan Hunanin maakunnan keskellä. Kaupungin keskusta sijaitsee linnuntietä noin 110 kilometriä maakunnan pääkaupunki Changshasta länsilounaaseen. Loudin väkiluku on 3,785 miljoonaa ja pinta-ala 8 107 neliökilometriä.\\nKaupunki rajoittuu pohjoisessa Yichangin ja Changshan, idässä Xiangtanin, Zhuzhoun, etelässä Hengyangin ja Shaoyangin, sekä lännessä Huaihuan prefektuuritason kaupunkiin.\\nPiirikuntatasolla prefektuuritason kaupunki jakautuu seuraavasti:\\nKaupunkipiirit\\nLouxing, 496 744 as.\\nPiirikuntatason kaupunki\\nLengshuijiang, 327 146 as.\\nLianyuan, 995 515 as.\\nPiirikunnat\\nShuangfeng, 854 069 as.\\nXinhua, 1 111 160 as.\\nLoudin on liikenteen solmupiste, kaivospaikkakunta ja metsävaroiltaan runsas teollisuuskaupunki. Kiinan rautateiden rataosuudet Luoyang–Zhanjiang ja Zhuzhou–Guiding kohtaavat paikkakunnalla, samoin kuin valtatiet Shanghai–Ruili ja Taiyuan–Macao sekä kansalliset maantiet 207, 320, ja 1810. Kaivannaisista mainittakoon esimerkiksi antimoni, jonka osalta Loudi on maailman johtava paikkakunta."},{"page_url":"https://pl.wikipedia.org/wiki/Gromada_Turze_(powiat_raciborski)","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/37/Turze_%28wojew%C3%B3dztwo_%C5%9Bl%C4%85skie%29%2C_k%C5%99i%C5%BEovata_II.jpg","page_title":"Gromada Turze (powiat raciborski)","context_page_description":"Gromada Turze – dawna gromada, czyli najmniejsza jednostka podziału terytorialnego Polskiej Rzeczypospolitej Ludowej w latach 1954–1972.\\nGromady, z gromadzkimi radami narodowymi jako organami władzy najniższego stopnia na wsi, funkcjonowały od reformy reorganizującej administrację wiejską przeprowadzonej jesienią 1954 do momentu ich zniesienia z dniem 1 stycznia 1973, tym samym wypierając organizację gminną w latach 1954–1972.\\nGromadę Turze z siedzibą GRN w Turzu utworzono – jako jedną z 8759 gromad na obszarze Polski – w powiecie raciborskim w woj. opolskim, na mocy uchwały nr VII/29/54 WRN w Opolu z dnia 4 października 1954. W skład jednostki weszły obszary dotychczasowych gromad Turze, Ruda, Budziska i Siedliska ze zniesionej gminy Kuźnia Raciborska w tymże powiecie oraz przysiółek Ruda Lasaki z dotychczasowej gromady Dziergowice ze zniesionej gminy Bierawa w powiecie kozielskim w tymże województwie. Dla gromady ustalono 27 członków gromadzkiej rady narodowej.\\nGromada przetrwała do końca 1972 roku, czyli do kolejnej reformy gminnej."},{"page_url":"https://is.wikipedia.org/wiki/M%C3%BAltuber","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/65/Hjortron.png","page_title":"Múltuber","context_page_description":"Múltuber er villt berjategund. Múltuberjajurtin er lágvaxin jurt og vex oftast í rökum jarðvegi. Múltuber er fjölær og ber fimmdeild hvít blóm. Blómgum byrjar í lok maí og stendur fram í júní og standa blómin í 2-3 vikur. Plönturnar eru einkynja, annað hvort karlblóm sem eingöngu hafa fræfla eða kvenblóm sem eingöngu hafa frævur. Stönglar og blöð þroskast og vaxa allt sumarið og á haustin myndast brum neðanjarðar á jarðvegsrenglum. Brumin geta myndað nýja plöntu. Jarðvegsrenglur vaxa aðallega seinni hluta sumars þegar plantan hefur þroskast og myndað blóm og ber. Rætur múltubers ná niður á 1-2 m dýpi. Múltuberjaplanta fjölgar sér bæði með fræi og jarðvegsrenglum. Fuglar éta berin og þannig dreifast fræin. Til að ber og fræ myndist þurfa múltuber skordýra- eða vindfrjóvgun og á norðlægum slóðum eru þar humlur áhrifaríkastar. Þroskun berja getur tekið 25-65 daga en mörg lítil steinaldin mynda berin. Berin eru fyrst dökkrauð en verða ljósappelsínugul. Múltuber vaxa villt á norðurhveli jarðar frá 50 til 70 breiddargráðu. Múltuber hafa ekki vaxið villt á Íslandi. Múltuber vaxa einkum í mýrajarðvegi með lágt sýrustig en geta líka vaxið í grunnum jarðvegi þar sem úrkoma er mikil."},{"page_url":"https://bg.wikipedia.org/wiki/%D0%A0%D0%B5%D0%B7%D0%B8%D0%B4%D0%B5%D0%BD%D1%82%D0%B5%D0%BD_%D0%B3%D1%80%D0%B0%D0%B4","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/88/Burg_AZ3_244a.jpg","page_title":"Резидентен град","context_page_description":"Резидентен град е градски център, който е седалище на монарх или княз. За да пребъде монархическото управление, е било необходимо да се покаже властта над поданиците и легациите. Тази видима показност на силата се отразява в архитектурата, но и в символични актове, като фестивали, паради и придворен церемониал. Един резидентен град е трябвало да легитимира обществения ред и постоянството на съответното владичество."},{"page_url":"https://pt.wikipedia.org/wiki/Montanhas_Medicine_Bow","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3b/Snowy_Range_from_Bellvue%2C_Colorado%2C_ca._1902.jpg","page_title":"Montanhas Medicine Bow","context_page_description":"As Montanhas Medicine Bow são uma cordilheira nas Montanhas Rochosas que se estendem por 160 km a partir do norte do estado do Colorado até o sul do Wyoming. Seu pico mais alto é o pico Clark, com 3 947 metros de altitude, localizado na área de proteção de vida selvagem Rawah."},{"page_url":"https://eu.wikipedia.org/wiki/San_Severino_eliza","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2f/Balmaseda_-_Iglesia_de_San_Severino_03.jpg","page_title":"San Severino eliza","context_page_description":"San Severino eliza Balmasedako plaza nagusian dagoen eliza da, Severino Norikakoaren omenez sagaratua. XV. mendean eraikia, eraikina gotikoa da baina, XVIII. mendean hainbat elementu barroko gehitu zitzaizkion.\\nAltuera ezberdineko hiru nabe dituen oinplanoa dauka elizak, eta aldi berean, nabe horietako bakoitzak lau tarte ditu."},{"page_url":"https://en.wikipedia.org/wiki/Sir_Arthur_Harris,_1st_Baronet","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2e/INF3-77_pt7_Air_Marshal_Sir_Arthur_Harris.jpg","page_title":"Sir Arthur Harris, 1st Baronet","context_page_description":"Marshal of the Royal Air Force Sir Arthur Travers Harris, 1st Baronet GCB OBE AFC, commonly known as \\"Bomber\\" Harris by the press and often within the RAF as \\"Butcher\\" Harris, was Air Officer Commanding-in-Chief RAF Bomber Command during the height of the Anglo-American strategic bombing campaign against Nazi Germany in the Second World War. In 1942, the British Cabinet agreed to the \\"area bombing\\" of German cities. Harris was given the task of implementing Churchill's policy and supported the development of tactics and technology to perform the task more effectively. Harris assisted British Chief of the Air Staff Marshal of the Royal Air Force Charles Portal in carrying out the United Kingdom's most devastating attacks against the German infrastructure and population, including the Bombing of Dresden.\\nHarris emigrated to Southern Rhodesia in 1910, aged 17, but returned to England in 1915 to fight in the European theatre of the First World War."},{"page_url":"https://ro.wikipedia.org/wiki/Copeic%C4%83","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/44/Belarus-1992-Bill-0.5-Obverse.jpg","page_title":"Copeică","context_page_description":"Copeica este subdiviziunea rublei sau a grivnei. O copeică reprezintă 1/100 dintr-o rublă sau dintr-o grivnă. Neoficial, copeica este subîmpărțită în 2 denghi."},{"page_url":"https://en.wikipedia.org/wiki/List_of_Los_Angeles_Kings_players","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c5/Frolov08.jpg","page_title":"List of Los Angeles Kings players","context_page_description":"The Los Angeles Kings are a professional ice hockey team based in Los Angeles, California. They are members of the Pacific Division of the Western Conference of the National Hockey League. This is a list of players who have played at least one game for the Kings."},{"page_url":"https://fr.wikipedia.org/wiki/Chouilly","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8c/100_1000.jpg","page_title":"Chouilly","context_page_description":"Chouilly est une commune française située dans le département de la Marne, en région Grand Est.\\nSes habitants sont appelés les Chouillats et les Chouillates ou encore les Bilots, en référence aux nombreuses oies qui se trouvaient élevées jadis dans le village."},{"page_url":"https://nl.wikipedia.org/wiki/Makybe_Diva","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7e/Statue_of_Makybe_Diva_at_Port_Lincoln_01.jpg","page_title":"Makybe Diva","context_page_description":"Makybe Diva is een Brits-Australisch racepaard.\\nDe merrie, geboren uit Desert King en Tugela, werd aangekocht door de Australische tonijnvisser Tony Šantić, die het vernoemde naar vijf van zijn medewerksters: Maureen, Kylie, Belinda, Diane, en Vanessa. Makybe Diva was het eerste paard dat de Melbourne Cup drie jaar op rij heeft gewonnen, van 2003 tot en met 2005."},{"page_url":"https://es.wikipedia.org/wiki/Arquitectura_tallada_en_la_roca_en_India","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/80/Caves_on_Dhammalingesvarasvami_Hill_03.JPG","page_title":"Arquitectura tallada en la roca en India","context_page_description":"La arquitectura tallada en la roca, también arquitectura rupestre, de la India se refiere a las construcciones excavadas o esculpidas en cuevas, grutas o paredes rocosas por las civilizaciones antiguas de la India, la más variada y que se encuentra en mayor abundancia en ese país que en cualquier otro país del mundo.​ La arquitectura tallada en la roca es la práctica de crear una edificación tallando en la roca natural sólida, retirando la roca que no formeparte de la edificación, hasta que la única roca que quede conforme los elementos arquitectónicos del interior excavado. La arquitectura india tallada en la roca es en su mayoría de naturaleza religiosa.​​\\nHay más de 1500 edificaciones conocidas talladas en la roca en la India, la mayoría adornadas con exquisitas tallas de piedra y muchas de ellas albergan obras de arte de importancia mundial. Estas edificaciones antiguas y medievales representan logros significativos de la ingeniería estructural y de la artesanía.​\\nEn la India, las cuevas han sido consideradas desde antiguo como lugares sagrados, condición que mantenían las cuevas que eran agrandadas o hechas por el hombre, tan sagradas como las cuevas naturales."},{"page_url":"https://simple.wikipedia.org/wiki/Bill_Clinton","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/56/Bill_Clinton_taking_the_oath_of_office%2C_1993.jpg","page_title":"Bill Clinton","context_page_description":"William Jefferson \\"Bill\\" Clinton is an American politician and humanitarian activist who served from 1993 to 2001 as the 42nd President of the United States. He was 46 years old when he was elected and the third youngest president.\\nHe took office at the end of the Cold War. Clinton was the first president from the baby boom generation. Clinton was the second president to be impeached. He was impeached in 1998. Before he was president, Clinton was the Governor of Arkansas from 1979 to 1981 and 1983 to 1992, Attorney General of Arkansas from 1977 to 1979. He is married to Hillary Rodham Clinton, who was the 67th United States Secretary of State from 2009 to 2013, Senator from New York from 2001 to 2009, and the Democratic nominee for president in the 2016 U.S. presidential election."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Naturschutzgebiete_im_Landkreis_Holzminden","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2d/Ahlewiesen.jpg","page_title":"Liste der Naturschutzgebiete im Landkreis Holzminden","context_page_description":"Im Landkreis Holzminden gibt es 30 Naturschutzgebiete."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%92%D0%B0%D1%82_%D0%9F%D1%85%D1%80%D0%B0%D0%BA%D1%8D%D1%83","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4c/Gran_Palacio%2C_Bangkok%2C_Tailandia%2C_2013-08-22%2C_DD_06.jpg","page_title":"Ват Пхракэу","context_page_description":"Ват Пхракэу, или храм «Изумрудного Будды» — буддийский храм в историческом центре Бангкоке, одно из самых священных мест Таиланда.\\nВнутри храма хранится «Изумрудный Будда» — статуя высотой в 66 см, вырезанная из цельного жадеита в XV веке. По одной из легенд, она была покрыта золотыми пластинами, по другой — находилась внутри еще одной статуи, но слепленной из глины. Изображение было найдено в 1431 году в одном из храмов Чианграя, а позднее ей завладел король Рама I. Несколько раз в год служители храма под председательством монарха или принца меняют одеяния статуи.\\nСнаружи храма у его входа находятся два льва из бронзы, которые были привезены из Камбоджи королём Рамой I. Основание постройки украшено позолоченными фигурами мистических полуптиц-полулюдей, окна и двери оформлены узорами. Внутреннее убранство Ват Пхра Кео выделяется благодаря росписям стен, сделанным во времена правления короля Рамы III. Здесь же расположен королевский Пантеон, где воздвигнуты статуи в натуральную величину восьми предыдущих королей династии Чакри."},{"page_url":"https://hy.wikipedia.org/wiki/%D4%BF%D5%B8%D5%BD%D5%B8%D5%BE%D5%AB_%D5%B7%D6%80%D5%BB%D5%A1%D5%B6","image_url":"http://upload.wikimedia.org/wikipedia/commons/2/22/Kosov.png","page_title":"Կոսովի շրջան","context_page_description":"Կոսովի շրջան, շրջան Ուկրաինայի Իվանո-Ֆրանկովսկի մարզում։\\nՍտեղծվել է 1939 թվականին։ Վարչական կենտրոնը՝ Կոսով։"},{"page_url":"https://sv.wikipedia.org/wiki/Sorunda_distrikt","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5b/Distrikt_Nyn%C3%A4shamn.jpg","page_title":"Sorunda distrikt","context_page_description":"Sorunda distrikt är ett distrikt i Nynäshamns kommun och Stockholms län.\\nDistriktet ligger nordväst om Nynäshamn."},{"page_url":"https://lt.wikipedia.org/wiki/Davy_Crockett_(ginklas)","image_url":"http://upload.wikimedia.org/wikipedia/commons/4/43/DavyCrockettBomb.jpg","page_title":"Davy Crockett (ginklas)","context_page_description":"M-388 Davy Crockett – JAV beatošliaužis pabūklas, galėjęs šaudyti sviediniais su branduoliniu užtaisu. Tai buvo mažiausias kada nors pagamintų branduolinių ginklų. JAV kariuomenės ginkluotėje buvo šaltojo karo laikais.\\nSukurtas 1950-ųjų pabaigoje, jis pirmiausia buvo skirtas atremti netikėtą ataką prieš tuometinę Vakarų Vokietiją. Juo buvo apginkluoti JAV armijos Vakarų Vokietijoje pėstininkų bei tankų batalionai. Šį ginklą turinčios grupės turėjo būti išsidėstę pasienyje kas keli kilometrai. Branduoliniai sprogimai turėjo paversti teritoriją nepraeinama maždaug dviem paroms – pakankamai laiko pagrindinėms NATO pajėgoms mobilizuoti. Nedidelė raketa 23 kg sveriančią bombą galėdavo nunešti maždaug du kilometrus.\\nBranduolinis užtaisas prilygo maždaug 10-20 tonų trotilo ekvivalentui. Tokio užtaiso sprogimo bangos efektas nėra didelis; pagrindinis kovinis veiksnys būtų buvusi jonizuojanti radiacija, kurios dozė būtų mirtina maždaug 500 m spinduliu.\\nBuvo pagaminta apie 2100 tokių raketų. Nuimtos nuo ginkluotės 1971 m."},{"page_url":"https://no.wikipedia.org/wiki/Slengbukser","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/71/Redhead_Beach_Bell_Bottoms.jpg","page_title":"Slengbukser","context_page_description":"Slengbukser er bukser der buksebeina vider seg ut fra kneet og ned i mer eller mindre trakt- eller klokkeform. Slengbukser kan brukes av både kvinner og menn. Snittet er særlig kjent fra gamle dagers sjømannsbukser og fra vestlig ungdomsmote på 1970-tallet.\\nDet finnes også side knebukser med sleng, og stoffrike bukseskjørt for kvinner."},{"page_url":"https://nl.wikipedia.org/wiki/Metaltella_simoni","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/89/Metaltella_simoni_%28F_Amphinectidae%29.jpg","page_title":"Metaltella simoni","context_page_description":"Metaltella simoni is een spinnensoort uit de familie Amphinectidae. De soort komt voor in Brazilië, Uruguay en Argentinië. Als invasiegast is hij ook bekend in Californië."},{"page_url":"https://lv.wikipedia.org/wiki/Sandis_Ozoli%C5%86%C5%A1","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/63/Dinamo_Riga_vs_HC_Lev_Praha_2013-12-28_Sandis_Ozolins.jpg","page_title":"Sandis Ozoliņš","context_page_description":"Sandis Ozoliņš ir bijušais latviešu hokejists, pēc karjera beigām — treneris un uzņēmējs. Viņš ir viens no izcilākajiem latviešu hokejistiem, vienīgais, kas izcīnījis Stenlija kausu, spēlēja aizsarga pozīcijā. Pēdējais klubs, ko pārstāvējis līdz 2014. gada pavasarim, bija Kontinentālās hokeja līgas klubs Rīgas \\"Dinamo\\". Pēc hokejista karjeras beigām 2014. gadā īslaicīgi iesaistījās politikā, kļūstot par partijas \\"Latvijas attīstībai\\" biedru. Strādājis par treneri — 2017. gadā S. Ozoliņš bija KHL kluba Rīgas \\"Dinamo\\" galvenais treneris, taču zaudēja amatu pēc zaudējumu sērijas.\\nS. Ozoliņš bija uzbrūkošā stila aizsargs, kas lieliski prata savienot savus pienākumus aizsardzībā ar uzbrukumiem, visas karjeras laikā ir bijis starp rezultatīvākajiem aizsargiem. S. Ozoliņš ir panākumiem bagātākais Latvijas hokejists NHL, spēlējis 6 dažādās komandās. 1996. gadā viņš kopā ar Kolorādo \\"Avalanche\\" kā pirmais un vienīgais latviešu hokejists izcīnīja Stenlija kausu, NHL karjeras laikā 7 reizes piedalījies Visu zvaigžņu spēlē. S. Ozoliņam pieder iemesto ripu, rezultatīvo piespēļu un gūto punktu rekordi starp latviešu spēlētājiem NHL, tāpat viņš ir arī pārstāvēto klubu vairāku rekordu īpašnieks."},{"page_url":"https://et.wikipedia.org/wiki/Rusuvool","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/30/%D0%A2%D1%8B%D1%80%D0%BD%D1%8B%D0%B0%D1%83%D0%B7_2000_02.jpg","page_title":"Rusuvool","context_page_description":"Rusuvool ehk seli ehk selivool on mägedes ja mujal positiivsete pinnavormidega alal esineda võiv pinnasest ja veest moodustunud tugev veevool, mis on kaasa haaranud nii jämedateralist kui ka peenemateralist ainest.\\nRusuvoolu peamisteks tekke-eeldusteks on tugev vihmasadu või kiire kevadine lumesulamine. Üksnes suhteliselt peeneteralisest ainesest koosnevat rusuvoolu nimetatakse mudavooluks."},{"page_url":"https://fi.wikipedia.org/wiki/%C5%A0koda_Karoq","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/dd/%C5%A0koda_Karoq_Sportline%2C_Paris_Motor_Show_2018%2C_IMG_0728.jpg","page_title":"Škoda Karoq","context_page_description":"Škoda Karoq on Škoda Auton vuodesta 2017 lähtien valmistama crossover-tyyppinen automalli, joka korvasi Škoda Yetin. Malli esiteltiin Frankfurtin autonäyttelyssä syksyllä 2017. Se sijoittuu mallistossa pienemmän Kamiqin ja suuremman Kodiaqin väliin.\\nVuoden 2017 Euro NCAP -kolaritestistä Karoq sai tulokseksi täydet viisi tähteä.\\nKaroqin bensiinimoottorit ovat 1,0- ja 1,5-litraiset TSI-moottorit. Dieselvaihtoehtoina ovat 1,6 TDI ja 2,0 TDI. Tehokkaimman dieselmoottorin yhteydessä on aina neliveto ja seitsenportainen DSG-kaksoiskytkinvaihteisto.\\nPariisin autonäyttelyssä syksyllä 2018 esiteltiin Karoqin normaaliversion rinnalle kaksi uutta mallia, urheilullisempi Sportline ja maasturimaisempi Scout."},{"page_url":"https://fi.wikipedia.org/wiki/Meksiko","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f8/Plaza_de_la_Constitucion_Ciudad_de_Mexico_City.jpg","page_title":"Meksiko","context_page_description":"Meksiko, virallisesti Meksikon yhdysvallat, on Pohjois-Amerikan eteläosassa sijaitseva 119,5 miljoonan asukkaan maa, jonka rajanaapureita ovat Yhdysvallat, Belize ja Guatemala. Maan pääkaupunki on México, josta käytetään usein myös englanninkielistä versiota Mexico City. Meksiko on asukasluvultaan maailman suurin espanjankielinen maa. Se on Pohjois-Amerikan maista pinta-alaltaan kolmanneksi ja asukasluvultaan toiseksi suurin."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%9B%D0%B8_%D0%91%D0%BE","image_url":"http://upload.wikimedia.org/wikipedia/commons/8/83/EmeiShanTop.jpg","page_title":"Ли Бо","context_page_description":"Ли Бо или Ли Тай-бо — китайский поэт времён династии Тан. Известный как «бессмертный в поэзии», Ли Бо принадлежит к числу самых почитаемых поэтов в истории китайской литературы и считается одним из крупнейших мировых поэтов, стоящим в одном ряду с именами Данте и Петрарки, Низами и Фирдоуси, Пушкина и Шекспира. Он оставил после себя около 1100 произведений."},{"page_url":"https://sr.wikipedia.org/wiki/%D0%9A%D1%98%D1%83-%D0%BA%D0%BB%D1%83%D0%BA%D1%81-%D0%BA%D0%BB%D0%B0%D0%BD","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/13/KKK-symbol.jpg","page_title":"Кју-клукс-клан","context_page_description":"Кју-клукс-клан, познат и по акрониму ККК или само Клан, три су различита покрета у САД која су се залагала за екстремне реакционарне ставове, као што су бјелачка супериорност, бјелачни национализам, антиимиграционизам и — посебно у касном облику — нордицизам, антикатолицизам и антисемитизам. Клан је кроз историји користио тероризам — физичке нападе и убиства — против група и појединаца који су им се супростављали. Све три покрета су позивала на „прочишћење” америчког друштва и све три се сматрају екстремистичким десничарским организацијама."},{"page_url":"https://da.wikipedia.org/wiki/Son_Doong","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/36/Son_Doong_Cave_2.jpg","page_title":"Son Doong","context_page_description":"Sơn Đoòng er en hule eller grotte i Vietnam, i nationalparken Phong Nha-Ke Bang, i provinsen Quang Binh.\\nSon Doong grotten ligger 450 km syd for Hanoi, 1230 km nord for Ho Chi Minh-byen og 40 km nord for provinshovedstaden Dong Hoi.\\nGrotten blev opdaget af en lokal mand, og blev internationalt annonceret af en britisk gruppe.\\nDe britiske opdagelsesrejsende hævdede, at grotten er den største hule i verden."},{"page_url":"https://de.wikipedia.org/wiki/Marika_R%C3%B6kk","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2a/MarikaR%C3%B6kk.jpg","page_title":"Marika Rökk","context_page_description":"Marie Karoline „Marika“ Rökk war eine deutsch-österreichische Filmschauspielerin, Sängerin und Tänzerin ungarischer Abstammung."},{"page_url":"https://en.wikipedia.org/wiki/Fisher_baronets","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a7/COA_Fisher_of_Packington.svg","page_title":"Fisher baronets","context_page_description":"There have been two baronetcies created for persons with the surname Fisher, both in the Baronetage of England.\\nThe Fisher Baronetcy, of Packington Magna in the County of Warwick, was created in the Baronetage of England on 7 December 1622 for Robert Fisher of Packington Hall, Great Packington, Warwickshire. The second Baronet sat as Member of Parliament for Coventry. The third Baronet died without a male heir and the Packington estates passed to his daughter Mary, wife of the Earl of Aylesford. The fourth Baronet died in 1739, when the baronetcy became dormant. An unsuccessful claim was lodged a few years ago. For more information, follow this link.\\nThe Fisher Baronetcy, of St Giles in the County of Middlesex, was created in the Baronetage of England on 19 July 1627 for Thomas Fisher. The title became extinct on the death of the fourth Baronet in 1707."},{"page_url":"https://pl.wikipedia.org/wiki/G%C3%B6%C3%9Feck","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f2/1997.780.Reiting_vom_Wildfeld_aus_gesehen.0260.jpg","page_title":"Gößeck","context_page_description":"Gößeck - najwyższy szczyt w Alpach Kruszcowych, południowej części Alp Ennstalskich, w Północnych Alp Wapiennych. Leży w Austrii, w kraju związkowym Styria. Szczyt można zdobyć ze schroniska Hesshütte."},{"page_url":"https://fr.wikipedia.org/wiki/Montagne_de_Lure","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/55/Pholidoptera_aptera_female_%287974030148%29.jpg","page_title":"Montagne de Lure","context_page_description":"La montagne de Lure est une montagne des Préalpes de Haute-Provence, située dans le département des Alpes-de-Haute-Provence. Elle appartient à la même formation géologique que le plateau d'Albion, qu'elle jouxte, et le mont Ventoux. Cette chaîne s'allonge sur 42 kilomètres de long, culmine au signal de Lure et présente un relief très contrasté entre l'adret calcaire, coupé de combes et de vallons, et l'ubac marneux, où s'accumulent monts et ravins.\\nL'étude de sa géologie, en 1888, a marqué un moment important dans l'avancée des connaissances des chaînes subalpines méridionales. Ce fut Wilfrid Kilian qui la réalisa dans une thèse novatrice où pour la première fois un géologue put dresser une échelle bio-stratigraphique pour le Jurassique et le Crétacé et qui utilisa le tout premier en France les clichés photographiques à l'appui de ses conclusions.\\nMontagne karstique, crevassée d'avens, aux cours d'eau à écoulement épisodique, où la moindre source est précieuse pour les hommes et les animaux, Lure est couverte majoritairement d'une forêt qui reconquiert, peu à peu, les anciens alpages."},{"page_url":"https://en.wikipedia.org/wiki/CobB","image_url":"http://upload.wikimedia.org/wikipedia/commons/7/7c/CobB_NAD_dependent_deacetylase_1S5P.png","page_title":"CobB","context_page_description":"CobB is a bacterial protein that belongs to the sirtuin family, a broadly conserved family of NAD+-dependent protein deacetylases."},{"page_url":"https://da.wikipedia.org/wiki/Plantefor%C3%A6dling","image_url":"http://upload.wikimedia.org/wikipedia/commons/2/29/Wheat_selection_k10183-1.jpg","page_title":"Planteforædling","context_page_description":"Planteforædling er en proces, hvorved der bevidst udvikles nye genetisk forbedrede planter. Udviklingen sker gennem kunstig selektion ved parring af eksisterende planter med andre individuelle planter, hvorved der fremkommer planter med de ønskede egenskaber.\\nPlanteforædling har været benyttet af mennesket gennem mange tusinde år, men med Gregor Mendels udviking af arvelighedslæren blev planteforædlingen sat i system. Udviklingen af teknik til gensplejsning har givet yderligere muligheder for planteforædling."},{"page_url":"https://es.wikipedia.org/wiki/Crist%C3%A1lida","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/76/Pescado_2_-_Cuadernillo_-_Cris%C3%A1lida_-_1973.jpg","page_title":"Cristálida","context_page_description":"\\"Cristálida\\" o \\"Aguas claras de olimpo\\" es una canción compuesta por el músico argentino Luis Alberto Spinetta e interpretada por la banda Pescado Rabioso, que integra el álbum doble Pescado 2 de 1973, segundo álbum de la banda, ubicado en la posición nº 19 de la lista de los 100 mejores discos del rock argentino por la revista Rolling Stone.​\\nPara grabar este tema, Pescado Rabioso utilizó su formación habitual pero con un agregado orquestal. Spinetta en guitarra, Carlos Cutaia en órgano Hammond y piano, David Lebón en bajo y Black Amaya en batería y percusión. Las voces a cargo de Spinetta y Lebón. El grupo orquestal es una orquesta de cámara integrada por cuerdas, bronces, arpa y percusión, y fue dirigido por Cutaia.​​"},{"page_url":"https://bn.wikipedia.org/wiki/%E0%A7%AA%E0%A7%A6_%E0%A6%93%E0%A6%AF%E0%A6%BC%E0%A6%BE%E0%A6%B2_%E0%A6%B8%E0%A7%8D%E0%A6%9F%E0%A7%8D%E0%A6%B0%E0%A6%BF%E0%A6%9F","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3e/40_Wall_Street.jpg","page_title":"৪০ ওয়াল স্ট্রিট","context_page_description":"৪০ ওয়াল স্ট্রিট নিউ ইয়র্ক শহরের ম্যানহাটানের নাসাউ স্ট্রিট এবং উইলিয়াম স্ট্রিটের মাঝামাঝি ৭১-নয়া গোথিক অবস্থিত একটি আকাশচুম্বী ভবন। এই ভবনটি ট্রাম বিল্ডিং নামেও পরিচিত। ম্যানহাটান কোম্পানির সদর দফতরে এটি নির্মিত হয়েছিল, এই ভবনটি মূলত ব্যাংক অফ ম্যানহাটান ট্রাস্ট বিল্ডিং এবং ম্যানহাটান কোম্পানি বিল্ডিং নামেও পরিচিত ছিল।"},{"page_url":"https://en.wikipedia.org/wiki/Governor-General_of_the_Philippines","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/21/FranciscoFernandezdelaCueva.jpg","page_title":"Governor-General of the Philippines","context_page_description":"The Governor-General of the Philippines was the title of the government executive during the colonial period of the Philippines, governed mainly by Spain and the United States, and briefly by Great Britain and Japan. They were also the representative of the executive of the ruling power.\\nOn November 15, 1935, the Commonwealth of the Philippines was established as a transitional government to prepare the country for independence from American control. The governor-general was replaced by an elected Filipino \\"President of the Philippine Commonwealth\\", as the chief executive of the Philippines, taking over many of the duties of the Governor-General. The former American Governor-General then became known as the High Commissioner to the Philippines."},{"page_url":"https://tr.wikipedia.org/wiki/%C4%B0sve%C3%A7_k%C3%B6ftesi","image_url":"http://upload.wikimedia.org/wikipedia/commons/a/a4/Swedish_meatballs.jpg","page_title":"İsveç köftesi","context_page_description":"İsveç köftesi ya da İsveççedeki özgün adıyla köttbullar, İsveç mutfağının en bilinen ürünlerinden olan ve misket şeklindeki köftelerden oluşan geleneksel yemektir. 18. yüzyılda Kral XII. Karl'ın Osmanlı İmparatorluğu'ndan dönüşüyle kahve ve lahana dolmasıyla birlikte İsveç mutfağına girdi ancak o tarihlerde frikadeller olarak bilinen yassı Danimarka köfteleri, yuvarlak köftelerden daha popülerdi.\\nİsveç köftesi genellikle kekreyemiş reçeli, özel et sosu ve haşlanmış veya kızarmış patatesle birlikte servis edilir. İsveç köftesinin birçok tarifi bulunduğu gibi, içeriğinde genellikle ince kıyılmış et, yumurta, ekmek kırıntısı, soğan, çeşitli baharat ve süt bulunur. Süt yerine krema, ekmek kırıntısı yerine un ya da patates püresi de kullanılmaktadır. Köfteler kızartıldıktan sonra, köftenin üstüne dökülecek özel et sosu da aynı tavada hazırlanabilir.\\nİsveç ulusal kültürünün önemli bir parçası olan bu yemek, İsveç merkezli IKEA şirketi tarafından pek çok ülkedeki mağazalarında tanıtılmakta ve satılmaktadır."},{"page_url":"https://id.wikipedia.org/wiki/The_Ashes","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/87/Ashes_Urn.jpg","page_title":"The Ashes","context_page_description":"The Ashes adalah seri pertandingan kriket tes yang diadakan antara Inggris dan Australia. Pertandingan ini adalah salah satu persaingan kriket internasional terbesar dan sudah ada sejak tahun 1882. The Ashes diadakan setiap dua tahun, secara alternatif di Britania Raya dan Australia. Sejak kriket menjadi olahraga musim panas, penyelenggaraan di belahan Bumi yang berbeda berarti pembagian seri terjadi antara 18 hingga 30 bulan. Satu seri \\"The Ashes\\" terdiri dari lima pertandingan Test, dua inning per pertandingan, di bawah peraturan kriket Test internasional. Jika seri ini dinyatakan seri, maka negara yang telah memenangkan the Ashes berhak menang kembali."},{"page_url":"https://ko.wikipedia.org/wiki/%EC%95%84%EC%9D%B4%ED%8C%A8%EB%93%9C","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c9/Apple_iPad_Event03.jpg","page_title":"아이패드","context_page_description":"아이패드은 미국의 애플사의 태블릿 컴퓨터 브랜드및 시리즈이다. 9.7인치 LED 백라이트 IPS 디스플레이를 탑재하였으며, 아이폰과 같은 iOS를 기반으로 하여 아이폰에서 구동되는 거의 모든 응용 프로그램을 사용할 수 있을뿐 아니라 전자책과, 애플에서 개발한 업무용 프로그램인 아이워크 등 보강된 기능들이 탑재된 것이 특징이다."},{"page_url":"https://zh.wikipedia.org/wiki/%E5%9C%A3%E4%BD%A9%E5%BE%B7%E7%BD%97-%E5%BE%B7%E9%87%8C%E7%93%A6%E6%96%AF","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ee/PanoSantPere.jpg","page_title":"圣佩德罗-德里瓦斯","context_page_description":"圣佩德罗-德里瓦斯，是西班牙加泰罗尼亚巴塞罗那省的一个市镇。总面积41平方公里，总人口23134人，人口密度564人/平方公里。"},{"page_url":"https://zh.wikipedia.org/wiki/%E5%8D%B0%E5%BA%A6%E6%9C%9F","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3d/Proterosuchus_fergusi_skull.png","page_title":"印度期","context_page_description":"印度期是三叠纪的第一个时期，年代大约位于251.902–251.2百万年前。"},{"page_url":"https://sv.wikipedia.org/wiki/Lista_%C3%B6ver_h%C3%A4ndelser_under_trettio%C3%A5riga_kriget","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/01/Fort_Mardijk_-_Fort-Mardyck_and_the_attacks_of_1646_%28Atlas_van_Loon%29.jpg","page_title":"Lista över händelser under trettioåriga kriget","context_page_description":"Detta är en lista över händelser under trettioåriga kriget. Den upptar fältslag, belägringar, övriga viktiga händelser samt fredsfördrag och stillestånd. Det första datumet är enligt den julianska kalendern, det andra inom parentes är enligt den gregorianska kalendern."},{"page_url":"https://es.wikipedia.org/wiki/Masdevallia_glandulosa","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fc/Masdevallia_glandulosa_Orchi_001.jpg","page_title":"Masdevallia glandulosa","context_page_description":"Masdevallia glandulosa es una especie de orquídea epífita originaria del oeste de Sudamérica.​"},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Kulturdenkmale_in_Sillenbuch","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a1/Stuttgart-Sillenbuch-Tuttlinger-72-Wohnhaus-1729.jpg","page_title":"Liste der Kulturdenkmale in Sillenbuch","context_page_description":"In der Liste der Kulturdenkmale in Sillenbuch sind alle unbeweglichen Bau- und Kunstdenkmale in Sillenbuch aufgelistet, die in der Liste der Kulturdenkmale. Unbewegliche Bau- und Kunstdenkmale der Unteren Denkmalschutzbehörde für diesen Stadtbezirk Stuttgarts verzeichnet sind. Stand dieser Liste ist der 25. April 2008.\\nDiese Liste ist nicht rechtsverbindlich. Eine rechtsverbindliche Auskunft ist lediglich auf Anfrage bei der Unteren Denkmalschutzbehörde der Stadt Stuttgart erhältlich."},{"page_url":"https://sk.wikipedia.org/wiki/Saint-Aubin-du-Cormier","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/93/Saint-Aubin-du-Cormier_ruins.JPG","page_title":"Saint-Aubin-du-Cormier","context_page_description":"Saint-Aubin-du-Cormier je francúzska obec, ktorá sa nachádza v departemente Ille-et-Vilaine, v regióne Bretónsko."},{"page_url":"https://be.wikipedia.org/wiki/%D0%86%D0%B2%D1%96%D1%86%D0%B0_%D0%94%D0%B0%D1%87%D1%8B%D1%87","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/91/MSC_2014_Dacic_Mueller_MSC2014.jpg","page_title":"Івіца Дачыч","context_page_description":"І́віца Да́чыч — сербскі палітык, першы віцэ-прэм'ер-міністр і міністр замежных спраў Сербіі з 27 красавіка 2014, старшыня АБСЕ, старшыня Сацыялістычнай партыі Сербіі."},{"page_url":"https://cv.wikipedia.org/wiki/%D0%9B%D0%B0%D1%85%D1%82%D0%B8%D0%BD%D1%81%D0%BA%D0%B8%D0%B9_%D1%80%D0%B0%D0%B7%D0%BB%D0%B8%D0%B2","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/34/%D0%9B%D0%B0%D1%85%D1%82%D0%B8%D0%BD%D1%81%D0%BA%D0%B8%D0%B9_%D1%80%D0%B0%D0%B7%D0%BB%D0%B8%D0%B2.JPG","page_title":"Лахтинский разлив","context_page_description":"Лахтинский разлив — Раççей территоринчи кӳлĕ. Санкт-Петербургнче вырнаçнă. Юнтоловка, Каменка, Глухарка юханшыв юхса кĕрет, Бобылка юхса тухать. Кӳлĕ лаптăкĕ 1,8 км²."},{"page_url":"https://tt.wikipedia.org/wiki/%D0%93%D0%B0%D0%BB%D0%B8%D0%BD%D0%B0_%D0%92%D0%B8%D1%88%D0%BD%D0%B5%D0%B2%D1%81%D0%BA%D0%B0%D1%8F","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/df/People_Artist_of_the_USSR1.jpg","page_title":"Галина Вишневская","context_page_description":"Галина Вишневская, Галина Павел кызы Вишневская — опера җырчысы, театр режиссеры һәм актрисасы. РСФСР, ССРБ халык артисты. Бөек Ватан сугышында катнашкан."},{"page_url":"https://ja.wikipedia.org/wiki/%E5%B1%B1%E5%BD%A2%E7%9C%8C%E7%AB%8B%E7%B1%B3%E6%B2%A2%E5%B7%A5%E6%A5%AD%E9%AB%98%E7%AD%89%E5%AD%A6%E6%A0%A1","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/28/Yamagata_Prefectural_Yonezawa_Technical_High_School_1.JPG","page_title":"山形県立米沢工業高等学校","context_page_description":"山形県立米沢工業高等学校は、山形県米沢市に所在する県立の工業高等学校。略称「米工」。"},{"page_url":"https://fr.wikipedia.org/wiki/Langue_Internationale","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1d/Unua_Libro_fr_001.png","page_title":"Langue Internationale","context_page_description":"Langue Internationale est le nom de l'ouvrage publié à Varsovie en 1887 par Ludwik Lejzer Zamenhof alors âgé de 28 ans, sous le pseudonyme Dr Esperanto, et qui établit les bases de la langue qui sera popularisée sous le nom d'espéranto. Ce livre est fréquemment surnommé Unua libro car c'est le premier livre qui a marqué la naissance de l'espéranto.\\nLe livre a été initialement publié en langue russe le 26 juillet 1887. Il fut suivi la même année de versions en polonais, français, allemand et d'une deuxième version en russe. Les années suivantes, des versions dans d'autres langues ont été publiées, dont l'anglais et l'hébreu.\\nCe livre se compose d'une introduction présentant les motivations de son auteur qui travaillait sur ce projet depuis l’adolescence :\\nQue la langue soit extrêmement facile, de manière qu’on puisse l’apprendre, comme qui dirait, en passant.\\nQue chacun qui apprendra cette langue, puisse aussitôt en profiter pour se faire comprendre des personnes de différentes nations, soit qu’elle trouve l’approbation universelle, soit qu’elle ne la trouve pas, c’est-à-dire, que cette langue puisse servir d’emblée de véritable intermédiaire aux relations internationales."},{"page_url":"https://en.wikipedia.org/wiki/Shopi","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/ac/Ethnographic_map_Ami_Bou%C3%A9%2C_1847.jpg","page_title":"Shopi","context_page_description":"Shopi or Šopi is a regional term, used by a group of people in the Balkans, self-identifying as Bulgarians, Macedonians and Serbs. The areas traditionally inhabited by the Shopi or Šopi is called Shopluk or Šopluk, a mesoregion, roughly where Bulgaria, Serbia and North Macedonia meet. In 2011 census in Serbia they are registered as separate ethnicity and 142 persons declared themselves as belonging to this ethnicity."},{"page_url":"https://it.wikipedia.org/wiki/Thomas_Ziegler_(ciclista)","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/dd/Thomas_Ziegler.jpg","page_title":"Thomas Ziegler (ciclista)","context_page_description":"Thomas Ziegler è un ex ciclista su strada e mountain biker tedesco, professionista dal 2003 al 2007."},{"page_url":"https://ar.wikipedia.org/wiki/%D8%A7%D8%B3%D8%AA%D8%AF%D8%A7%D9%85%D8%A9_%D8%A7%D9%84%D9%85%D8%B1%D8%AD%D9%84%D8%A9_%D8%A7%D9%84%D9%8A%D8%B1%D9%82%D9%8A%D8%A9","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7f/Unnatural_selection%2C_2_heads%2C_one_species.jpg","page_title":"استدامة المرحلة اليرقية","context_page_description":"احتفاظ البالغين بالصفات التي توجد فقط في الأطفال شيء مهم في البيولوجيا التطورية، وبالتالي في التطور. ويحدث ذلك بطريقتين. في استدامة المرحلة اليرقية يتباطأ أو يتأخر التطور الفسيولوجي للكائن الحي. كما تم العثور على استدامة المرحلة اليرقية في البشر المعاصرين.\\nفي المقابل، في التكاثر المبكر، يحدث التطور الجنسي بشكل أسرع. تؤدي كلتا العمليات إلى التشكل العضوي للجنين، كنوع من التفاوت الزمني. بعض الكُتاب تعرّف التشكل العضوي بالإبقاء على الصفات اليرقية، كما نرى في السلمندر."},{"page_url":"https://tr.wikipedia.org/wiki/Boz_ebabil","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/65/Apuspallidus_9043.JPG","page_title":"Boz ebabil","context_page_description":"Boz ebabil, sağangiller familyasından genellikle kırlangıçla karıştırılan bir kuş türü."},{"page_url":"https://nl.m.wikipedia.org/wiki/Lijst_van_personen_overleden_in_1939","image_url":"http://upload.wikimedia.org/wikipedia/commons/7/75/Edward_Sapir.jpg","page_title":"Lijst van personen overleden in 1939","context_page_description":"Dit is een lijst van personen die overleden zijn in 1939.\\nDe inhoud van deze pagina is gebaseerd op gegevens in Wikidata. Als er onvolkomenheden in deze lijst zitten, gelieve dan aldaar de gegevens aan te passen. Achter iedere persoon is hiervoor een link aanwezig met de aanduiding bewerken.\\nWijzigingen in Wikidata worden met enige regelmatigheid geautomatiseerd overgenomen naar deze pagina."},{"page_url":"https://nl.wikipedia.org/wiki/Wimbledon_2005","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/de/Roger_Federer_at_Wimbledon_2005.jpg","page_title":"Wimbledon 2005","context_page_description":"De 119e editie van het Engelse grandslamtoernooi, Wimbledon 2005, werd gehouden tussen 20 juni en 3 juli 2005. Voor de vrouwen was het de 112e editie. Het toernooi werd gespeeld in de All England Lawn Tennis and Croquet Club te Wimbledon."},{"page_url":"https://he.wikipedia.org/wiki/%D7%A7%D7%A9","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/39/COLLECTIE_TROPENMUSEUM_Het_vlechten_van_hoeden_van_bamboe_TMnr_60011604.jpg","page_title":"קש","context_page_description":"קש הוא גבעול יבש של דגן, ממנו נלקחו הגרעינים. קש מהווה בערך חצי מהתוצר הסופי, לאחר הקציר של צמחים כגון חיטה, שעורה ותירס. הוא נחשב תוצר לוואי שימושי בעבר ובהווה.\\nגם כיום וגם בעבר, לקש יש שימושים רבים, והביקוש לקש כחומר בעירה, עבור יצור דלק, הופך לנרחב יותר ויותר. שימוש בקש כמצע לשינה, עדיין נהוג בחלקים רבים בעולם, הן עבור בהמות והן בני אדם.\\nהקש עשוי לשמש כמרכיב המזון הגס במספוא עבור בהמות הצורכות אנרגיה לקיום בלבד. למרות ערכו התזונתי הנמוך הוא נחשב כשימושי, כיוון שהוא נעכל בקלות וגורם להרגשת שובע וכך מספק פתרון זול לחלק גדול מהמנה היומית עבור בעלי חיים אשר אינם נזקקים למנות עשירות באנרגיה ובחלבון.\\nהשימוש בקש לכיסוי גגות, הופך ליותר ויותר פופולרי, בעיקר בשל העובדה שהוא מאוד ידידותי לסביבה. בנוסף, השימוש בקש וחימר כדי להכין חומר בנייה חזק עדיין נהוג במספר מקומות בעולם. קיימת טכניקת בנייה בה קש משמש כמבודד חום, חומר בנייה עיקרי, או שניהם.\\nמאז ומתמיד קש שימש לקליעת אלילות פריון לבני אנוש, לחי ולתוצרת החקלאית. כמו ארגו, קלעו או ליפפו סלים ורהיטים, או אף בניה ירוקה של בתים\\nקש רך אבל אינו נמעך ולכן יעיל כחומר מיגון לחבילות. בעבר נהגו למגן בקבוקי יין בעטיפות קש. כיום עטיפות כאלו נדירות אבל מספר סוחרים עדיין משתמשים בהם.\\nניתן להכין נייר מעיסת קש.\\nקש משמש ליצור מטרות עבור קשתים."},{"page_url":"https://pt.wikipedia.org/wiki/Solo_(gin%C3%A1stica)","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7b/Jade_Barbosa%2C_floor_routine%2C_2007.jpg","page_title":"Solo (ginástica)","context_page_description":"A ginástica de solo possui uma particular peculiaridade no universo gímnico. Ele é um aparelho em quase todas as ginasticas — exceto a ginástica de trampolim, além de ser uma prova. Na ginástica artística, é ambos, nas demais modalidades das quais faz parte, é somente o trabalhado em si.\\nEle pertence a quase todas as disciplinas da ginástica enquanto aparelho de competição. Nele, realizam-se movimentos acrobáticos, coreografados, artísticos e ginásticos. Desde 1900, nos Jogos de Paris, está presente em Olimpíadas — como um dos aparelhos pertencentes a disputa de exercícios combinados — e desde 1932, como um exercício individual."},{"page_url":"https://sr.wikipedia.org/wiki/%D0%A5%D0%B0%D1%80%D0%B8%D1%81%D0%B2%D0%B8%D0%BB_(%D0%9F%D0%B5%D0%BD%D1%81%D0%B8%D0%BB%D0%B2%D0%B0%D0%BD%D0%B8%D1%98%D0%B0)","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/79/Harrisville_Calvary_OPC.jpg","page_title":"Харисвил (Пенсилванија)","context_page_description":"Харисвил град је у америчкој савезној држави Пенсилванија."},{"page_url":"https://en.wikipedia.org/wiki/Olympus_(Lycia)","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/18/Olympos%2C_Lycia%2C_Turkey_%289657172660%29.jpg","page_title":"Olympus (Lycia)","context_page_description":"Olympus or Olympos was a city in ancient Lycia. It was situated in a river valley near the coast. Its ruins are located south of the modern town Çıralı in the Kumluca district of Antalya Province, Turkey. Together with the sites of the ancient cities Phaselis and Idyros it is part of the Olympos Beydaglari National Park. The perpetual gas fires at Yanartaş are found a few kilometers to the northwest of the site."},{"page_url":"https://it.wikipedia.org/wiki/Luca_Ghiotto","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b8/Lucaghiottoitaliangp.jpg","page_title":"Luca Ghiotto","context_page_description":"Luca Ghiotto è un pilota automobilistico italiano che nel 2015 ha gareggiato in GP3 e dal 2016 gareggia in Formula 2."},{"page_url":"https://fr.wikipedia.org/wiki/Ouvrage_du_Hackenberg","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3f/Maginot3ix.jpg","page_title":"Ouvrage du Hackenberg","context_page_description":"L'ouvrage du Hackenberg est une fortification faisant partie de la ligne Maginot, située sur la commune de Veckring, dans le département de la Moselle.\\nC'est un gros ouvrage d'artillerie, composé d'un total de dix-neuf blocs en surface, reliés entre eux par des kilomètres de galeries souterraines. Construit entre 1929 et 1935, il a été épargné par les combats de juin 1940, avant d'être réutilisé par les Allemands et de servir lors des combats de novembre 1944 contre les troupes américaines. Réparé au début de la guerre froide, c'est désormais un musée.\\nC'est un des plus puissants ouvrages de la ligne Maginot : seul l'ouvrage du Hochwald dans le Nord de l'Alsace lui est comparable."},{"page_url":"https://nl.wikipedia.org/wiki/Lijst_van_hoogste_kerktorens","image_url":"http://upload.wikimedia.org/wikipedia/commons/e/ea/StMichaeliskirche%28Michel%29.SW.20050521.jpg","page_title":"Lijst van hoogste kerktorens","context_page_description":"Dit is een lijst van hoogste kerkgebouwen in de wereld. Meestal is de kerktoren het hoogste deel, soms de koepel van de kerk, zoals bij de Sint-Pieterskerk in Rome. Vaak verschillen de opgaven van de hoogte, dat zit vaak in het wel of niet meerekenen van de weerhaan of het kruis. Bij grote kerken kan dat zo'n 5 meter schelen.\\nDeze lijst pretendeert niet volledig te zijn."},{"page_url":"https://cs.wikipedia.org/wiki/Seznam_p%C3%ADsn%C3%AD_Katy_Perry","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/62/Katy_Perry_-_The_Prismatic_12.jpg","page_title":"Seznam písní Katy Perry","context_page_description":"Toto je seznam písní zpěvačky Katy Perry."},{"page_url":"https://fa.wikipedia.org/wiki/%D8%A8%D8%A7%D8%BA_%D8%A7%D9%88%D8%B1%D9%85%D8%A7%D9%86","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/85/Coleus_1_hatem_moushir.JPG","page_title":"باغ اورمان","context_page_description":"باغ اورمان در استان جیزه مصر است. این باغ مقابل باغ‌وحش جیزه قرار دارد و به دلیل مساحت آن یکی از بزرگترین باغهای گیاهی جهان به‌شمار می‌آید. این باغ در سال ۱۸۷۳ تأسیس شده‌است. این باغ مجموعه نادری از گیاهان و درختان نخل را در خود جای داده‌است."},{"page_url":"https://lb.wikipedia.org/wiki/Robert_Lamoureux","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/aa/Robert_Lamoureux_1950.jpg","page_title":"Robert Lamoureux","context_page_description":"De Robert Lamoureux, gebuer de 4. Januar 1920 zu Saint-Mandé a gestuerwen den 29. Oktober 2011 zu Boulogne-Billancourt, war e franséische Schauspiller, Filmregisseur an Dréibuchauteur."},{"page_url":"https://da.wikipedia.org/wiki/Teerasil_Dangda","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fd/Teerasil-Chatree_during_THA-OMA.jpg","page_title":"Teerasil Dangda","context_page_description":"Teerasil Dangda er en fodboldspiller fra Thailand, der spiller for den thailandske klub Muangthong United. Han er i øjeblikket lånt ud til den japanske J. League klub Sanfrecce Hiroshima. Han spiller også for Thailands fodboldlandshold."},{"page_url":"https://be.wikipedia.org/wiki/%D0%A1%D1%96%D0%B3%D0%B5%D1%80%D1%8B%D0%BA","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/43/04-SIGERICO.JPG","page_title":"Сігерык","context_page_description":"Сігерык — кароль вестготаў, кіраваў у 415 годзе.\\nБрат Сара, забітага па загадзе Атаульфа. Алімпіядор гаворыць, што Сігерык прыйшоў да ўлады хутчэй сваімі стараннямі і сілай, чым паводле закона і права пераходу прастола ў спадчыну. Сігерык загадаў забіць, нягледзячы на заступніцтва біскупа Сігесара, шасцярых дзяцей Атаульфа ад першага шлюбу. Імператрыцу ж Галу Плацыдзію Сігерык загадаў, як здзекванне з Атаульфа, прымусіць разам з іншымі палонніцамі ісці перад сваім канём. Зневажэнне Галы Плацыдзіі, удавы Атаульфа, падкрэслівае агульную незадаволенасць палітыкай саюза і дружбы з імперыяй. Тое, што брат Сара наогул стаў каралём, дазваляе зрабіць выснову пра адпаведную падтрымку, якой карыстаўся род Сара сярод готаў.\\nІсідар Севільскі паведамляе, што нягледзячы на гэта Сігерык імкнуўся да дасягнення міру з рымлянамі. Пра тое ж гаворыць і Павел Арозій. Праз тыдзень пасля ўзыходжання на прастол Сігерык таксама быў забіты сваімі людзьмі з «гоцкай» партыі, варожай да рымлян."},{"page_url":"https://de.wikipedia.org/wiki/Gouvernement_Medenine","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/39/Medenine-stegop-17.jpg","page_title":"Gouvernement Medenine","context_page_description":"Das Gouvernement Medenine ist eines der 24 Gouvernements in Tunesien. Es liegt in Höhen von 0 bis 500 m ü. d. M. an der Mittelmeerküste und im anschließenden Hinterland im Südosten des Landes und umfasst auch die Insel Djerba. Es hat eine Fläche von 8588 km² sowie eine Bevölkerungszahl von etwa 480.000. Es ist nach seiner Hauptstadt Medenine benannt und wurde am 21. Juni 1956 eingerichtet."},{"page_url":"https://de.wikipedia.org/wiki/St-%C3%89tienne_(Chambon-sur-Lac)","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/97/F08.Dorfkirche_Chambon-sur-Lac.0660.1.JPG","page_title":"St-Étienne (Chambon-sur-Lac)","context_page_description":"Die Kirche St-Étienne in Chambon-sur-Lac liegt inmitten der Ortsbebauung und ist romanischen Ursprungs des 12. Jahrhunderts.\\nDas Dorf liegt im Talgrund der Couze Chambon, westlich des Stausees Lac-du-Chambon in der Region Auvergne-Rhône-Alpes im Département Puy-de-Dôme und etwa 35 km südwestlich der Großstadt Clermont-Ferrand am östlichen Rand der Monts Dore. Zu den Sehenswürdigkeiten Chambons zählt auch die bei Kennern der auvergnatischen Romanik geschätzte romanische Friedhofskapelle, ein Zentralbau mit Ursprüngen im 10. Jahrhundert. Sie befindet sich auf dem höher gelegenen Friedhof am nordöstlichen Ortsrand, auf dem Hang jenseits der Durchgangsstraße, etwa 200 Meter von der Kirche entfernt."},{"page_url":"https://en.wikipedia.org/wiki/St._Peter_African_Methodist_Church","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/30/St._Peter%27s_AME_Church_01.JPG","page_title":"St. Peter African Methodist Church","context_page_description":"St. Peter African Methodist Church is a historic church at 518 Franklin Street in Clarksville, Tennessee, United States. The Gothic Revival church building was constructed in 1873 and added to the National Register of Historic Places in 1982."},{"page_url":"https://fr.wikipedia.org/wiki/Nyer","image_url":"http://upload.wikimedia.org/wikipedia/commons/0/0a/Nyer_castle6.JPG","page_title":"Nyer","context_page_description":"Nyer est une commune française située dans le département des Pyrénées-Orientales, en région Occitanie.\\nLes habitants de Nyer se nomment les Nyérois."},{"page_url":"https://de.wikipedia.org/wiki/Gemmingen_(Adelsgeschlecht)","image_url":"http://upload.wikimedia.org/wikipedia/commons/b/bc/Gemmingen-Wappen.jpg","page_title":"Gemmingen (Adelsgeschlecht)","context_page_description":"Die Familie von Gemmingen geht auf ein reichsunmittelbares alemannisches Rittergeschlecht zurück, das seinen Stammsitz im Ort Gemmingen im Kraichgau hatte. Die seit dem hohen Mittelalter urkundlich belegte Familie zählt zu den verzweigtesten deutschen Adelsgeschlechtern überhaupt, mit weit verstreutem Besitz im Kraichgau, im Odenwald, in Schwaben und Franken und darüber hinaus. Als Reichsfreiherren übten sie die Gerichtsbarkeit über ihre Territorien aus, die sie teils als Allodialbesitz, teils als Lehen anderer Fürsten besaßen. Die Güter der Familie bildeten jedoch kein geschlossenes Territorium, sondern waren in Streubesitz verteilt und wurden oft als Kondominat oder Ganerbe verwaltet.\\nIm 14. Jahrhundert teilte sich die Familie in zwei heute noch bestehende Stämme, die sich nach ihren am Neckar liegenden Burgen Gemmingen-Guttenberg und Gemmingen-Hornberg nennen. Die Familie stellte im 16. und frühen 17. Jahrhundert die Bischöfe Johann Otto von Augsburg, Johann Konrad von Eichstätt und Uriel von Mainz, letzterer zudem von 1508 bis 1514 Erzkanzler des Deutschen Reiches. Die Brüder Dietrich, Wolf und Philipp waren im 16."},{"page_url":"https://de.wikipedia.org/wiki/Berg_(Schussental)","image_url":"http://upload.wikimedia.org/wikipedia/commons/a/a7/Dickwald-01706.jpg","page_title":"Berg (Schussental)","context_page_description":"Berg ist eine Gemeinde im baden-württembergischen Landkreis Ravensburg in Deutschland."},{"page_url":"https://hu.wikipedia.org/wiki/Vroville","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c7/Vroville%2C_Mairie-%C3%A9cole.jpg","page_title":"Vroville","context_page_description":"Vroville település Franciaországban, Vosges megyében. Lakosainak száma 133 fő. +/- Vroville Ahéville, Avillers, Mattaincourt, Mirecourt, Velotte-et-Tatignécourt és Villers községekkel határos."},{"page_url":"https://zh-min-nan.wikipedia.org/wiki/Tchelopek_(Staro_Nagori%C4%8Dane)","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/83/%D0%92%D0%B8%D0%BA%D0%B8%D0%B5%D0%BA%D1%81%D0%BF%D0%B5%D0%B4%D0%B8%D1%86%D0%B8%D1%98%D0%B0_%D0%9A%D0%BE%D0%B7%D1%98%D0%B0%D1%87%D0%B8%D1%98%D0%B0_073_%28cropped%29.jpg","page_title":"Tchelopek (Staro Nagoričane)","context_page_description":"Tchelopek sī Macedonia Staro Nagoričane chū-tī-thé ê chi̍t ê hiuⁿ-siā.\\nChe sī chi̍t phiⁿ koan-î Macedonia tē-lí ê phí-á-kiáⁿ. Chhiáⁿ tàu khok-chhiong."},{"page_url":"https://en.wikipedia.org/wiki/Kevin_Gilbride","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6c/Kevin_Gilbride_at_2007_training_camp.jpg","page_title":"Kevin Gilbride","context_page_description":"Kevin Bernard Gilbride is an American football head coach for the New York Guardians of the XFL. Gilbride was a coach for twenty years in the NFL, spending seven of them as the offensive coordinator for the New York Giants, with whom he earned two Super Bowl rings. From 1997–1998, Gilbride was the head coach for the San Diego Chargers."},{"page_url":"https://fa.wikipedia.org/wiki/%D9%86%D8%A7%D9%85%D8%A7%D9%86_%DA%A9%D9%87%E2%80%8C%DB%8C%D8%AA%D8%A7","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ee/Naman_Keita.jpg","page_title":"نامان که‌یتا","context_page_description":"نامان که‌یتا دونده اهل فرانسه بود."},{"page_url":"https://en.wikipedia.org/wiki/Marlow,_Buckinghamshire","image_url":"http://upload.wikimedia.org/wikipedia/commons/b/b3/Marlow_026.jpg","page_title":"Marlow, Buckinghamshire","context_page_description":"Marlow is a town and civil parish within the Unitary Authority of Buckinghamshire, England. It is located on the River Thames, 4 miles south south-west of High Wycombe, 5 miles west north-west of Maidenhead and 33 miles west of central London."},{"page_url":"https://fr.wikipedia.org/wiki/Architecture_organique","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f6/FallingwaterWright.jpg","page_title":"Architecture organique","context_page_description":"L'architecture organique est une philosophie architecturale qui s'intéresse à l'harmonie entre l'habitat humain et le monde « naturel » au moyen d'une approche conceptuelle à l'écoute de son site est intégrée à lui, faisant du bâtiment et de son mobilier une composition unifiée et intriquée à son environnement."},{"page_url":"https://sv.wikipedia.org/wiki/Tetraopes_paracomes","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5f/Tetraopes_paracomes_%2818298258701%29.jpg","page_title":"Tetraopes paracomes","context_page_description":"Tetraopes paracomes är en skalbaggsart som beskrevs av Chemsak 1963. Tetraopes paracomes ingår i släktet Tetraopes och familjen långhorningar.\\nArtens utbredningsområde är:\\nCosta Rica.\\nGuatemala.\\nInga underarter finns listade i Catalogue of Life."},{"page_url":"https://et.wikipedia.org/wiki/Siberut","image_url":"http://upload.wikimedia.org/wikipedia/commons/5/5a/Mentawai_Islands_Topography.png","page_title":"Siberut","context_page_description":"Siberut on saar Indoneesias, suurim Mentawai saartest.\\nPindala on 4030 km². Elanikke on Siberutil umbes 35 000. Umbes 10% neist on mentaveid.\\nSaarel on biosfäärireservaat ja Siberuti rahvuspark. Saar on tuntud hulga erinevate primaatide poolest, teiste hulgas on esindatud liigid Hylobates klossii, Simias concolor, Presbytis potenziani, Macaca pagensis.\\nSiberut kuulub Lääne-Sumatra provintsi."},{"page_url":"https://sco.wikipedia.org/wiki/African_wild_dug","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/ba/African_wild_dog_%28Lycaon_pictus_pictus%29.jpg","page_title":"African wild dug","context_page_description":"Lycaon pictus is a canid foond anly in Africae, especially in savannas an lichtly widit auries. It is variously cried the African wild dug, African huntin dug, Cape huntin dug, paintit dug, paintit wolf, paintit huntin dug, spottit dug, or ornate wolf."},{"page_url":"https://pt.wikipedia.org/wiki/Navalmoral","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1d/Vistas1.jpg","page_title":"Navalmoral","context_page_description":"Navalmoral é um município da Espanha na província de Ávila, comunidade autónoma de Castela e Leão, de área 43,35 km² com população de 476 habitantes e densidade populacional de 11,52 hab/km²."},{"page_url":"https://vi.wikipedia.org/wiki/Szczuczyn","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fa/Szczuczyn_church_and_monastery_-_panoramio.jpg","page_title":"Szczuczyn","context_page_description":"Szczuczyn là một thị trấn thuộc huyện Grajewski, tỉnh Podlaskie ở đông-bắc Ba Lan. Thị trấn có diện tích 13 km². Đến ngày 1 tháng 1 năm 2011, dân số của thị trấn là 3496 người và mật độ 264 người/km²."},{"page_url":"https://fr.wikipedia.org/wiki/Famille_Trevisan","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9c/Ponte_Trevisan_%28Venice%29_-_North_west_exposure.jpg","page_title":"Famille Trevisan","context_page_description":"Les Trevisan est une famille patricienne de Venise, dont une partie est originaire de Aquilée et ils habitèrent Venise dès sa fondation.\\nUne autre partie vint, comme le dit son nom, de Trévise et se retrouva incluse dans le Maggior Consiglio à sa clôture en 1297. La première partie étant demeurée exclue du rang de la Noblesse dominante, elle y est rentrée pendant la guerre, en 1689, dans la personne de Pietro Trevisan, dont les ancêtres avaient servi la République dans la Chancellerie, second ordre de la Noblesse.\\nLes Trevisani sont à la base de diverses églises de la cité : San Giovanni Elemosinario, San Giovanni in Olio, San Tommaso à Torcello.\\nLes armes des Trevisan se composent pour certains d'or à un chevron d'azur, d'autres d'or à un chef de gueules chargé d'un lion passant d'or, d'autres encore d'azur à trois bandes d'or sous un chef d'azur, qui sont celles des derniers aggregés, hormis le chef, et d'autres enfin sìx paux d'or et d'azur avec une face de gueules."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%9D%D0%BE%D1%80%D0%B4%D0%B8%D0%BD,_%D0%99%D1%91%D1%80%D0%B4%D0%B8%D1%81","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/40/Hj%C3%B6rdis_Nordin.jpg","page_title":"Нордин, Йёрдис","context_page_description":"Йёрдис Маргарета Нордин — шведская гимнастка, чемпионка мира, чемпионка Олимпийских игр 1952 года."},{"page_url":"https://en.wikipedia.org/wiki/Monte_San_Salvatore","image_url":"http://upload.wikimedia.org/wikipedia/commons/a/ac/Picswiss_TI-16-02.jpg","page_title":"Monte San Salvatore","context_page_description":"The Monte San Salvatore is a mountain in the Lepontine Alps above Lake Lugano and the city of Lugano in Switzerland. The Monte San Salvatore funicular links the city with the summit of the mountain. The village on top of its peaks, Carona, is a popular destination to enjoy views over Lake Lugano and to walk through the exotic plants and flowers of Parco San Grato."},{"page_url":"https://pt.wikipedia.org/wiki/Milovice_u_Ho%C5%99ic","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8a/Milovice_u_Horic_CoA_CZ.jpg","page_title":"Milovice u Hořic","context_page_description":"Milovice u Hořic é uma comuna checa localizada na região de Hradec Králové, distrito de Jičín‎."},{"page_url":"https://vi.wikipedia.org/wiki/Gymnocladus_dioica","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/30/Baden-Baden-Gymnocladus_dioicus-40-Geweihbaum-Trieb-2012-gje.jpg","page_title":"Gymnocladus dioica","context_page_description":"Gymnocladus dioicus là một loài thực vật có hoa trong họ Đậu. Loài này được K.Koch miêu tả khoa học đầu tiên."},{"page_url":"https://it.wikipedia.org/wiki/Cadore","image_url":"http://upload.wikimedia.org/wikipedia/commons/4/4b/Arcidiocanale.jpg","page_title":"Cadore","context_page_description":"Il Cadore è una regione storico-geografica italiana, situata nell'alta provincia di Belluno, in Veneto ed in minima parte nella provincia di Udine, in Friuli-Venezia Giulia, interamente appartenente alla zona montuosa delle Dolomiti Orientali e confinante con l'Austria a nord, il Trentino-Alto Adige ad ovest, la Carnia e la provincia di Pordenone ad est."},{"page_url":"https://fa.wikipedia.org/wiki/%DA%A9%D9%84%DB%8C%D8%B3%D8%A7%DB%8C_%D8%A7%D9%88%D8%AA%D9%88%D8%A8%D9%88%DB%8C%D8%B1%D9%86","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/74/BasilikaOttobeurenHauptschiff02.JPG","page_title":"کلیسای اوتوبویرن","context_page_description":"کلیسای اوتوبویرن یک کلیسا دیر نظام سنت بندیکت در آلمان است که در اوتوبویرن واقع شده‌است. این کلیسا یکی از ۴۰ کلیسای امپراتوری مقدس روم بود و یک دولت مستقل را تشکیل می‌داد. این کلیسا در زمان انحلال در سال ۱۸۰۲ مساحتی به اندازه ۲۶۶ کیلومتر مربع را تحت حاکمیت خود داشت و ده هزار موضوع برای رسیدگی داشت."},{"page_url":"https://eu.wikipedia.org/wiki/Elektrozavodskaia","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/30/Stamp_1947_1147.jpg","page_title":"Elektrozavodskaia","context_page_description":"Elektrozavodskaia Moskuko metroaren Arbatsko-Pokrovskaia lineari dagokion lurpeko geltokia da. Garraio-sistemako geltokirik ezagunenetakoa izateaz gain, ikusgarrienetako bat ere bada. Bigarren Mundu Gerran zehar 1944ko maiatzaren 15ean zabaldu zuten eta oso ezaguna da bere dekorazio arkitektonikoa dela eta, Vladimir Stxuko eta Vladimir Gelfreikh arkitektoek bere ikaslea Igor Rozhinekin egina."},{"page_url":"https://arz.wikipedia.org/wiki/%D9%86%D9%8A%D8%B3%D8%AA%D9%88%D8%B1_%D8%AC%D9%88%D9%86%D8%B3%D8%A7%D9%84%D9%81%D9%8A%D8%B3","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6c/N%C3%A9stor_Goncalves.jpg","page_title":"نيستور جونسالفيس","context_page_description":"نيستور جونسالفيس كان لاعب كورة قدم من اوروجواى."},{"page_url":"https://de.wikipedia.org/wiki/Rudi_Zapf","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/26/Rudi_Zapf_am_Knopfakkordeon.jpg","page_title":"Rudi Zapf","context_page_description":"Rudi Zapf ist ein deutscher Musiker und Kabarettist."},{"page_url":"https://zh.wikipedia.org/zh-cn/%E5%8E%9F%E8%87%BA%E5%8D%97%E9%AB%98%E7%AD%89%E5%B7%A5%E6%A5%AD%E5%AD%B8%E6%A0%A1%E6%A0%A1%E8%88%8D","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6d/1940%E5%8F%B0%E5%8D%97%E9%AB%98%E7%AD%89%E5%B7%A5%E6%A5%AD%E5%AD%B8%E6%A0%A1.JPG","page_title":"原臺南高等工業學校校舍","context_page_description":"原台南高等工业学校校舍位于台南市东区成功大学成功校区，该校创校之初全称为“台湾总督府台南高等工业学校”，为国立成功大学前身，是台湾日治时期直属于台湾总督府的三大专门学校之一。民国八十八年11月19日原日治时期“本馆”、“讲堂”、“理化学实验室”及“图书课”，公告为台南市市定古迹，除此之外成功校区东侧三间系馆亦为日治时期校舍，前半部在二次大战后由一层楼高改建成两层楼高。"},{"page_url":"https://en.wikipedia.org/wiki/Odites_natalensis","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/68/Pl.4-fig.36-Odites_natalensis_Walsingham%2C_1891.jpg","page_title":"Odites natalensis","context_page_description":"Odites natalensis is a moth in the family Depressariidae. It was described by Lord Walsingham in 1891. It is found in the Republic of the Congo, the Democratic Republic of the Congo, Malawi, Mozambique, South Africa, Tanzania and Zimbabwe.\\nThe wingspan is about 17 mm. The forewings are pale straw yellow to beyond the middle, slightly shaded with brown on the extreme costal margin near the base. Beyond the middle is a slightly-waved transverse purplish fuscous line, beyond which the remainder of the wing is entirely shaded with pale brown, or brownish ochreous. The hindwings are very pale greyish ochreous."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%A2%D1%96%D1%84%D0%B0%D0%BD%D1%96_(%D0%B0%D0%BB%D0%BC%D0%B0%D0%B7)","image_url":"http://upload.wikimedia.org/wikipedia/commons/8/82/Tiffany_Diamond.jpg","page_title":"Тіфані (алмаз)","context_page_description":"Тіфані — алмаз 287,42 з Південної Африки, знайдений у 1878 році. З алмазу виготовлено діамант масою 128,51 карати. Ціна — близько 500 тис. доларів."},{"page_url":"https://ur.wikipedia.org/wiki/%D9%88%D8%A7%D8%AF%D8%A6_%DA%A9%D8%A7%D9%B9%DA%BE%D9%85%D9%86%DA%88%D9%88","image_url":"http://upload.wikimedia.org/wikipedia/commons/2/29/Kathmandu_Valley_krish.jpg","page_title":"وادئ کاٹھمنڈو","context_page_description":"وادئ کاٹھمنڈو برصغیر کی قدیم تہذیب کے شاہراہ پر واقع ہے اور براعظم ایشیا کی سرحد ہے۔ وادئ کاٹھمنڈو کو وادئ نیپال بھی کہا جاتا ہے۔ وادئ کاٹھمنڈو میں تقریباً 30 اہم ثقافتی یادگاریں ہیں جن میں متعدد بدھ مت اور ہندو مت کے مذہبی مقامات بھی واقع ہیں۔ اسی وادی میں 7 یونیسکو عالمی ثقافتی ورثہ کے مقامات ہیں۔\\nوادئ کاٹھمنڈو اور آس پاس کے علاقہ کو نیپال منڈل کہا جاتا ہے۔ 15ویں صدی تک بیپال منڈل کا داراالحکومت بھگناپور تھا۔ دیگر دو دارالحکومتوں میں کاٹھمنڈو اور پٹن، نیپال تھے۔\\nوادئ کاٹھمنڈو نیپال سے سب سے زیادہ ترقی یافتہ اور آباد علاقہ ہے۔ ملک کے زیادہ تر دفاتر اور ہیڈ کوارٹر یہیں واقع ہیں۔ اسی وجہ سے یہ نیپال کا معاشی علاقہ کہلاتا ہے۔ یہاں کی قدیم اور مشہور ثقافت، منفرد فن تعمیر اور متعدد تہوار سیاحوں کو دعوت نظارہ دیتے ہیں۔ برطانیہ کے مورخین اسی علاقہ کو اصل نیپال کہتے ہیں۔\\n2015ء میں کاٹھمنڈو گھاٹی میں زلزلہ آیا۔ اس زلزلہ میں کئی لوگوں کی جانیں گئیں اور علاقہ کی بہشتر عمارتیں منہدم ہوگئیں۔ پٹن، نیپال، کرتیپور، مدھیہ پور تھمی اور بھگنا پور جیسے قصبے اور شہر جن کی مجموعی آبادی ایک ملین کے قریب ہے، تباہ ہو گئے جہاں شدید جانی و مالی نقصان کے علاوہ عمارتیں تباہ ہو گئیں۔ کاٹھمنڈو سلسلہ کوہ ہمالیہ کا سب سے زیادہ آباد اور شہری علاقہ بھی ہے۔"},{"page_url":"https://en.wikipedia.org/wiki/Abner_Mares","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/56/Abner_Mares.jpg","page_title":"Abner Mares","context_page_description":"Abner Mares Martínez is a Mexican-American professional boxer. He has held multiple world championships in three weight classes, including the IBF bantamweight title from 2011 to 2012, the WBC super bantamweight title from 2012 to 2013, the WBC featherweight title in 2013, and the WBA featherweight title from 2016 to 2018. As an amateur, Mares won numerous medals at international tournaments while representing Mexico. He grew up in the city of Hawaiian Gardens, California and holds dual citizenship with the United States and Mexico."},{"page_url":"https://en.wikipedia.org/wiki/Sintra-Cascais_Natural_Park","image_url":"http://upload.wikimedia.org/wikipedia/commons/d/d2/PNSC_sign.JPG","page_title":"Sintra-Cascais Natural Park","context_page_description":"The Sintra-Cascais Natural Park is a park on the Portuguese Riviera, one of the 13 Natural Parks of Portugal. While only established in 1994 as a Natural Park by the Portuguese Government, it has been protected since 1981. Its area is approximately 145 km². The park includes the Serra de Sintra Mountain Range but extends all the way to the coast and Cabo da Roca, continental Europe's westernmost point. It contains the Castle of the Moors. Located within 25 km of Lisbon, the Sintra-Cascais Natural Park is a popular tourism area, with many different individual historical and natural sites and attractions. Sintra and Cascais are towns and municipalities in the Lisbon / Estoril Coast."},{"page_url":"https://no.wikipedia.org/wiki/Johan_Moan","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5d/Minnesmerke_Johan_Moan.JPG","page_title":"Johan Moan","context_page_description":"Johan Moan var en norsk motstandsmann og etterretningsagent for XU under andre verdenskrig.\\nMoan var sterkt engasjert i motstandskampen på Fosen i krigsårene. Han hjalp flyktninger med å komme seg til Sverige. På tur til grensen med en rømt russer og en mann fra Trondheim ble Moan arrestert etter å ha vært angitt av dobbeltagenten Karl Adding. Russeren ble henrettet. Gestapo overlot Moan til Rinnanbanden 25. mai 1944. Han satt fanget i det beryktede Bandeklosteret til Rinnanbanden i Trondheim. Moan ble torturert og deretter plassert i kjelleren med hendene bundet. Han fikk løs tauene og kom seg ut gjennom et lite vindu. Han klarte å flykte derfra om morgenen 26. mai 1944, og reiste til Tomset hvor han skjulte seg i en barhytte i seks uker. Moan er den eneste som klarte å rømme fra Bandeklosteret. På grunn av rømningen ble den planlagte Operasjon Oleander fremskyndet og satt ut i livet umiddelbart da Moan visste via avhørene hvor mye tyskerne hadde kjennskap til motstandskampen på Fosen. Moan var den eneste som klarte å flykte fra Bandeklosteret. Broren Jon var også ettersøkt, mens broren Kristoffer Moan satt på Grini."},{"page_url":"https://tr.wikipedia.org/wiki/Jerzy_Kossela","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/08/Jerzy_Kossela_2007.jpg","page_title":"Jerzy Kossela","context_page_description":"Jerzy Kossela, Polonyalı erkek vokal ve gitarist. Częstochowa, Polonya'da 15 Temmuz 1942'de doğmuştur. Kossela müzik Electron bünyesinde vokalist ve gitarist olarak görev yapmıştır. Bu grup dışında Niebiesko-Czarni, Pięciolinie ve Czerwone Gitary ile çalışmıştır.\\nPolonyalı erkek vokal ve gitarist Jerzy Kossela 7 Ocak 2017'de Gdynia kentinde 74 yasında ölmüştür."},{"page_url":"https://ar.wikipedia.org/wiki/%D8%AC%D8%A7%D9%8A%D9%85%D9%8A_%D9%86%D8%A7%D9%81%D8%A7%D8%B1%D9%88","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3f/Jaime_Navarro.jpg","page_title":"جايمي نافارو","context_page_description":"جايمي نافارو ‏ هو لاعب كرة قاعدة أمريكي، ولد في 27 مارس 1967 في بايامون في الولايات المتحدة."},{"page_url":"https://zh.wikipedia.org/wiki/%E5%8F%B8%E9%A9%AC%E7%80%9A","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/49/JOIE-01.JPG","page_title":"司马瀚","context_page_description":"司马瀚，出生于德国亚琛，是德国艺术家、设计师。"},{"page_url":"https://en.wikipedia.org/wiki/2012_Lenox_Industrial_Tools_301","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f2/TSM_-_Kyle_Busch_-_2015_-_Stierch_-_07.jpg","page_title":"2012 Lenox Industrial Tools 301","context_page_description":"The 2012 Lenox Industrial Tools 301 was a NASCAR Sprint Cup Series stock car race held on July 15, 2012 at New Hampshire Motor Speedway in Loudon, New Hampshire, United States. Contested over 301 laps, it was the nineteenth race of the 2012 NASCAR Sprint Cup Series season. Kasey Kahne of Hendrick Motorsports took his second win of the season, while Denny Hamlin finished second and Clint Bowyer finished third."},{"page_url":"https://de.wikipedia.org/wiki/Arktische_Weide","image_url":"http://upload.wikimedia.org/wikipedia/commons/8/83/Ivaarctos1.jpg","page_title":"Arktische Weide","context_page_description":"Die Arktische Weide oder Arktis-Weide ist eine Pflanzenart aus der Gattung der Weiden innerhalb der Familie der Weidengewächse. Mit dem Arktischen Mohn ist diese Art die am weitesten im Norden lebende bedecktsamige Pflanze; beide überleben noch auf 80° nördlicher Breite."},{"page_url":"https://sv.wikipedia.org/wiki/Landsh%C3%B6vdingar_i_%C3%96rebro_l%C3%A4n","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/31/%C3%96rebro_l%C3%A4n_vapen.svg","page_title":"Landshövdingar i Örebro län","context_page_description":"Landshövdingen i Örebro län är chef för Länsstyrelsen i Örebro län."},{"page_url":"https://hu.wikipedia.org/wiki/MV_Viking_Sigyn","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/ce/MV_Viking_Sigyn_2019.JPG","page_title":"MV Viking Sigyn","context_page_description":"Az MV Viking Sigyn 2019-es építésű, svájci folyami szállodahajó, amit a Viking Cruises vállalat üzemeltet. A hajó 2019. május 29-én, Budapesten nekiütközött a Hableány nevű magyar kirándulóhajónak, amely a Very Good Tour dél-koreai utazási iroda megbízásából 33 turistát szállított, és kétfős magyar személyzet teljesített rajta szolgálatot. A Hableány az ütközés után felborult, majd 7 másodperc alatt elsüllyedt. A katasztrófában a július 6-i hivatalos bejelentések szerint legalább 27 ember meghalt, további – a kezdeti 21 eltűntből – 1 főt még keresnek."},{"page_url":"https://no.wikipedia.org/wiki/Blekinge_l%C3%A4n","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/76/Karlshamns_kastell.JPG","page_title":"Blekinge län","context_page_description":"Blekinge län er et län sør i Sverige. Det grenser til Skåne län, Kronobergs län, Kalmar län og til Østersjøen."},{"page_url":"https://it.wikipedia.org/wiki/Chiesa_di_Sant%27Antonio_Abate_(Deruta)","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a7/Nicchia_di_sant%27Antonio_abate%2C_anonimo_robbiano_del_XVI_sec.%2C_statua_di_Sant%27Antonio_abate.jpg","page_title":"Chiesa di Sant'Antonio Abate (Deruta)","context_page_description":"La chiesa di Sant'Antonio abate è un edificio di culto ubicato a Deruta.\\nDa questa chiesa proviene il Gonfalone di Sant'Antonio Abate commissionato dalla confraternita che vi aveva sede. La chiesa conserva un significativo ciclo pittorico. La chiesa è anche adibita come sala per il catechismo o come ambiente espositivo per mostre temporanee. In seguito alla scossa di terremoto del 30 ottobre, ha svolto la funzione della Chiesa di San Francesco fino al 21 maggio 2017, giorno della sua riapertura."},{"page_url":"https://ms.wikipedia.org/wiki/Napoli","image_url":"http://upload.wikimedia.org/wikipedia/commons/e/e7/ViewofNaplesBay.jpg","page_title":"Napoli","context_page_description":"Napoli ialah bandar kedua terbesar di Itali setelah bandar Milan. Napoli juga merupakan ibu kota regione Campania. Bandar ini didirikan pada sekitar abad ke-7 atau 6 Sebelum Masihi dan sekarang penduduknya berjumlah 963,522 orang. Napoli kaya akan tradisi, sejarah, seni dan kebudayaan, dan dikenali sebagai tempat asal penghasilan pizza serta terkenal akan aiskrimnya.\\nSekarang, pusat bersejarah kota ini didaftarkan oleh UNESCO sebagai Tapak Warisan Dunia."},{"page_url":"https://ja.wikipedia.org/wiki/%E7%9F%A2%E5%80%89%E5%B2%B3","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e5/Mt.Kintoki_from_Mt.Yaguradake_02.jpg","page_title":"矢倉岳","context_page_description":"矢倉岳は神奈川県南足柄市にある標高870mの山である。"},{"page_url":"https://ja.wikipedia.org/wiki/%E5%98%89%E7%BE%A9%E5%85%AC%E5%9C%92","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4e/%E5%98%89%E7%BE%A9%E5%B8%82%E5%85%AC%E8%BB%8A66%E8%B7%AF%E7%B7%9A856-FT.jpg","page_title":"嘉義公園","context_page_description":"嘉義公園は、台湾の嘉義市東区王田里にある市立公園。嘉義都会森林公園の一部、嘉義市最大の公園で、旧嘉義神社の所在地である。"},{"page_url":"https://en.wikipedia.org/wiki/Conus_radiatus","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/45/Conus_radiatus_3.jpg","page_title":"Conus radiatus","context_page_description":"Conus radiatus, common name the rayed cone, is a species of sea snail, a marine gastropod mollusk in the family Conidae, the cone snails and their allies.\\nLike all species within the genus Conus, these snails are predatory and venomous. They are capable of \\"stinging\\" humans, therefore live ones should be handled carefully or not at all."},{"page_url":"https://de.wikipedia.org/wiki/Ostkirchhof_Ahrensfelde","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/ca/Ostkirchhof_Wuhle_02.jpg","page_title":"Ostkirchhof Ahrensfelde","context_page_description":"Ostkirchhof Ahrensfelde ist die Bezeichnung für den am 30. Juni 1908 eröffneten Friedhof der evangelischen Kirchengemeinden des Berliner Stadtsynodalverbandes auf dem Gebiet der brandenburgischen Gemeinde Ahrensfelde.\\nDer parkartig angelegte Friedhof liegt nordöstlich von Berlin außerhalb der Stadtgrenzen und weist mit 25 Hektar heute nur noch einen Bruchteil der für ihn ursprünglich geplanten Belegungsfläche auf. Das Areal, auf dem sich eine Jugendstil-Kapelle mit einer Steinmeyer-Orgel befindet, steht seit dem Jahr 2001 unter Denkmalschutz."},{"page_url":"https://en.wikipedia.org/wiki/Vehicle_registration_plates_of_the_United_States_for_1950","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5a/1950_Georgia_license_plate_C-55919.jpg","page_title":"Vehicle registration plates of the United States for 1950","context_page_description":"Each of the 48 states of the United States of America plus several of its territories and the District of Columbia issued individual passenger license plates for 1950."},{"page_url":"https://cs.wikipedia.org/wiki/Tamsalu","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/71/Tamsalu_jaamahoone.jpg","page_title":"Tamsalu","context_page_description":"Tamsalu je město a samosprávná jednotka v Estonsku v kraji Lääne-Virumaa. V roce 2016 zde žilo 2 197 obyvatel. První zmínka o Tamsalu pochází z roku 1512 v souvislosti se stejnojmenným zámkem. Význam města vzrostl roku 1876, kdy zde vznikla železniční stanice."},{"page_url":"https://sl.wikipedia.org/wiki/Hrva%C5%A1ka","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/34/Kr%C4%8Di%C4%87_source.jpg","page_title":"Hrvaška","context_page_description":"Hrvaška, uradno Republika Hrvaška, je suverena država na stičišču Srednje Evrope, Jugovzhodne Evrope in Sredozemskega morja. Glavno mesto je Zagreb, ki tvori posebno administrativno območje, skupaj z dvajsetimi ostalimi upravnimi enotami, županijami. Ozemlje Hrvaške pokriva 56.594 km² in ima sicer raznoliko, vendar večinoma celinsko in sredozemsko podnebje. Razprostira se od skrajnih vzhodnih robov Alp na severozahodu do Panonske nižine in bregov reke Donave na vzhodu, njen osrednji del pokriva Dinarski gorski masiv, južni in zahodni del pa se končujeta na obali Jadranskega morja. Na severu in severozahodu meji na Slovenijo, na severu na Madžarsko, na jugu in vzhodu na Bosno in Hercegovino, na jugu na Črno goro ter na vzhodu na Srbijo. Hrvaška obala Jadranskega morja je dolga 1778 km, ob njej pa leži tudi več kot 1000 otokov. Prebivalstvo države znaša 4,16 milijona, večino od tega so Hrvati, prevladujoča veroizpoved pa je rimskokatoliška. Številčno najpomembnejša manjšina so prebivalci srbske narodnosti.\\nOzemlje Hrvaške je naseljeno že od paleolitika, Hrvati pa so na ozemlje sedanje Hrvaške prispeli v začetku 7. stoletja."},{"page_url":"https://es.wikipedia.org/wiki/Jade_precolombino_de_Costa_Rica","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/59/T%C3%A9cnica_del_jade._Calado.jpg","page_title":"Jade precolombino de Costa Rica","context_page_description":"Entre el 500 y 700 d.C, los indígenas que habitaron el territorio actual de Costa Rica manufacturaron objetos de jadeíta y otras piedras verdes, conocidas en general como jade, usando técnicas y motivos autóctonos, que fueron utilizados como adornos y talismanes.​ Durante este periodo, se dio una fuerte tradición local del trabajo, que fue independiente de influencias externas, aun cuando algunas reflejan rasgos foráneos.\\nEl jade se utilizó principalmente en la región de Guanacaste y en la región Central del país, pero se encuentra también en forma aislada en la región de Díquis.\\nLos artefactos de jade se encuentran frecuentemente como ofrendas funerarias, asociados a individuos con rango social y/o con presencia de elementos mítico-religiosos. También se ha encontrado información de que fueron utilizados con fines curativos. Se usaron como ornamento personal y luego se destinaron como parte del ajuar funerario de los individuos.\\nSolamente se conocen entre 8 y 10 fuentes de jadeíta en el mundo."},{"page_url":"https://fr.wikipedia.org/wiki/Fais_(Micron%C3%A9sie)","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d0/Barringtonia_asiatica_-_twin_flower.JPG","page_title":"Fais (Micronésie)","context_page_description":"Fais est un atoll surélevé situé approximativement à 87 kilomètres à l'est d'Ulithi et 251 km au nord-est de Yap, dans les îles Carolines dans l'océan Pacifique. Il appartient aux îles extérieures de Yap. Du point de vue administratif, c'est une municipalité de l'État de Yap, dans les États fédérés de Micronésie.\\nDe forme oblongue, Fais a une superficie de 2,8 km² et une altitude maximale de 20 m. Le climat y est de type équatorial, chaud, modérément humide et pluvieux tout au long de l'année. Des périodes de sécheresse peuvent toutefois s'étendre sur plusieurs mois. Elle est régulièrement affectée par des cyclones. L'île possède une flore et une faune diversifiées, notamment des insectes et des oiseaux ; les seuls mammifères que sont les rats, les chiens et les cochons, ont été introduits par l'Homme.\\nLes premiers humains abordent Fais au cours des IIᵉ – IVᵉ siècles d'après des sondages archéologiques. Les objets découverts illustrent des échanges avec les îles Yap, lesquelles ont pu servir d'intermédiaires dans la transmission de céramiques et de parures en provenance des Palaos, des îles Salomon et des îles Marshall."},{"page_url":"https://en.wikipedia.org/wiki/USS_Chanticleer_(SP-663)","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/11/USS_Chanticleer_%28SP-663%29.jpg","page_title":"USS Chanticleer (SP-663)","context_page_description":"The first USS Chanticleer (SP-663) was a United States Navy patrol vessel in commission from 1917 to 1918.\\nChanticleer was built as a private motorboat by Wilton C. Crosby. On 21 May 1917, the U.S. Navy acquired her from her owner, H.S. Hutchinson of New Bedford, Massachusetts, for use as a section patrol boat during World War I. She was commissioned on 22 May 1917 as USS Chanticleer (SP-663).\\nAssigned to the 2nd Naval District in southern New England, Chanticleer carried out patrol duties in for the rest of World War I.\\nChanticleer was returned to Hutchinson on 25 November 1918."},{"page_url":"https://hy.wikipedia.org/wiki/%D4%BC%D5%A1_%D5%8A%D5%B8%D6%82%D5%A5%D5%A2%D5%AC%D5%A1_%D5%A4%D5%A5_%D4%B1%D5%AC%D5%B4%D5%B8%D6%80%D5%A1%D5%A4%D5%AB%D5%A5%D5%AC","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/02/Iglesia_de_San_Juan_Bautista%2C_La_Puebla_de_Almoradiel_01.jpg","page_title":"Լա Պուեբլա դե Ալմորադիել","context_page_description":"Լա Պուեբլա դե Ալմորադիել ՝ մունիցիպալիտետ Իսպանիայում։ Գտնվում է Տոլեդո պրովինցիայի Կաստիլիա Լա Մանչա ինքնավար համայնքի կազմում։ Մունիցիպալիտետը գտնվում է Մանչա-Ալդա-դե-Տոլեդո շրջանում։ Տարածքը կազմում է 106 կմ², բնակչությունը\` 6122 մարդ: Պրովինցիայի վարչական կենտրոնից գտնվում է 97 կմ հեռավորության վրա։"},{"page_url":"https://it.wikipedia.org/wiki/Giuseppe_Mangialavori","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/46/Giuseppe_Mangialavori.jpg","page_title":"Giuseppe Mangialavori","context_page_description":"Giuseppe Mangialavori è un politico italiano, senatore della XVIII legislatura."},{"page_url":"https://nds.wikipedia.org/wiki/D%C3%BC%C3%B6rpm","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/91/Alte_Kirche_Dortmund-Huckarde.jpg","page_title":"Düörpm","context_page_description":"Düörpm, düütsch: Dortmund, [ˈdɔʁtmʊnt, ˈdɔɐ̯tmʊnt] is en Grootstadt in de Metropolregion Rhien-Ruhr in Noordrhien-Westfalen. Se is dat Wertschaps- un Hannelszentrum vun Westfalen un mit över 580.000 Inwahner de bevölkerungsriekste Stadt sowohl vun dissen Landsdeel as ok vun dat Ruhrrebeet. Düörpm hörrt to den Regeerensbezirk Arnsbarg un weer 2010 tosommen mit anner Städer vun dat Ruhrrebeet Kulturhööftstadt vun Europa.\\nDe vermootlich up en karolingisch Riekshoffgrünnen torüchgahn, inst wichtige Rieks- un Hansestadt längs den Westfäälsch Hellweg entwickelt sück hüüd vun en Industriemetropole to en bedüüden Deenstleistungs- un Technologiestandoort: Fröher vör allen bekannt dör Stahl, Köhlen un Beer, is Düörpm hüüd nah en langjohrig Strukturwannel en Zentrum vun de Versekerungswertschap un den Eenzelhannel. Mit etwa 50.000 Studeerenden an söss Hoochscholen, dorünner de Technische Universität Düörpm un 19 wiederen wetenschaplich Inrichtungen hörrt Düörpm to de teihn gröttst Hoochschoolstäder in Düütschland un is ok en bedüüden Wetenschaps- un Hoochtechnologie-Standoort."},{"page_url":"https://en.wikipedia.org/wiki/Straw-necked_ibis","image_url":"http://upload.wikimedia.org/wikipedia/commons/7/76/Threskiornis_spinicollis_-_Centenary_Lakes.jpg","page_title":"Straw-necked ibis","context_page_description":"The straw-necked ibis is a bird of the ibis and spoonbill family Threskiornithidae. It can be found throughout Australia, New Guinea, and parts of Indonesia. Adults have distinctive straw-like feathers on their neck."},{"page_url":"https://de.wikipedia.org/wiki/Abschirmung_(Strahlung)","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a5/Radium_worker_using_lead_shield_1929.jpg","page_title":"Abschirmung (Strahlung)","context_page_description":"Abschirmungen gegen ionisierende Strahlung reduzieren die Strahlenintensität und dienen zum Schutz von Personen, anderen Lebewesen, Gegenständen oder Bauteilen gegen Strahlenschaden sowie zur Reduktion des Hintergrunds bei Strahlenmessungen."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%AD%D0%BB%D1%8C%D0%B7%D0%B5_(%D0%BF%D1%80%D0%B8%D1%82%D0%BE%D0%BA_%D0%92%D0%B5%D1%80%D1%80%D0%B5)","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ef/B%C3%BCnde_-_NSG_Elseauen_-_Map.png","page_title":"Эльзе (приток Верре)","context_page_description":"Эльзе — река в Германии, протекает по земле Северный Рейн-Вестфалия и Нижняя Саксония. Приток реки Верре. Появилась в результате бифуркации рек."},{"page_url":"https://hy.wikipedia.org/wiki/%D5%84%D5%A5%D6%84%D6%84%D5%A1","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c0/Mecca_Metro_Route_Map.png","page_title":"Մեքքա","context_page_description":"Մեքքա քաղաք Արաբական թերակղզու Հիջազ շրջանում: Մեքքան նաև Մաքքահ վարչական շրջանի մայրաքաղաքն է: Քաղաքը գտնվում է Ջիդդայից 70 կմ, իսկ Մադինայից 340 կմ հեռավորության վրա և ունի ծովի մակերևույթից շուրջ 277 մետր բարձրություն: 2012 թվականի տվյալներով քաղաքի բնակչությունը շուրջ 2 միլիոն էր, չնայած այցելուները այս թիվը եռապատկում են ամեն տարի հաջի շրջանում, որը տեղի է ունենում մուսուլմանական լուսնային օրացույցի 12-րդ ամսին:"},{"page_url":"https://ru.wikipedia.org/wiki/%D0%A0%D0%BE%D0%B6%D0%B4%D0%B5%D1%81%D1%82%D0%B2%D0%B5%D0%BD%D1%81%D0%BA%D0%B8%D0%B9_%D1%80%D1%8B%D0%BD%D0%BE%D0%BA_(%D0%91%D1%80%D0%B0%D1%83%D0%BD%D1%88%D0%B2%D0%B5%D0%B9%D0%B3)","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/bb/Braunschweig_Weihnachtsmarkt.jpg","page_title":"Рождественский рынок (Брауншвейг)","context_page_description":"Рождественский рынок Брауншвейга традиционно проводится в городе уже более трёх столетий. Он известен как одним из наиболее ярких и «атмосферных» рождественских рынков на территории современной Германии: причиной тому является архитектурный ансамбль места его проведения — так называемый «традиционный остров» образован Брауншвейгским собором, зданиями площади Бургплатц, местным дворцом «Dankwarderode» и памятником «Брауншвейгский лев». Ежегодно рынок привлекает сотни тысяч посетителей: к примеру, в 2008 году рождественский рынок в Брауншвейге посетило около 900 000 человек."},{"page_url":"https://ja.wikipedia.org/wiki/%E3%83%96%E3%83%AB%E3%83%9C%E3%83%B3%E5%AE%AE%E6%AE%BF","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/ab/Panorama_de_l%27h%C3%A9micyle_de_l%27assembl%C3%A9e_nationale.jpg","page_title":"ブルボン宮殿","context_page_description":"ブルボン宮殿は、フランスのパリにある宮殿。7区のセーヌ川河岸に位置し、コンコルド広場とはコンコルド橋を介してつながっている。"},{"page_url":"https://ja.wikipedia.org/wiki/%E3%83%A9%E3%83%B3%E3%83%9C%E3%83%AB%E3%82%AE%E3%83%BC%E3%83%8B%E3%83%BB%E3%82%A6%E3%83%A9%E3%83%83%E3%82%B3","image_url":"http://upload.wikimedia.org/wikipedia/commons/4/4d/Lamborghini_Urraco_P300_%281975%29.jpg","page_title":"ランボルギーニ・ウラッコ","context_page_description":"ウラッコは、1970年代にイタリアの自動車メーカー、ランボルギーニが開発・製造したスポーツカーである。"},{"page_url":"https://id.wikipedia.org/wiki/Kalimantan_Tengah","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0b/Borneo1945.png","page_title":"Kalimantan Tengah","context_page_description":"Kalimantan Tengah adalah salah satu provinsi di Indonesia yang terletak di Pulau Kalimantan. Ibu kotanya adalah Kota Palangkaraya. Kalimantan Tengah memiliki luas 153.564,60 km². Berdasarkan sensus tahun 2010, provinsi ini memiliki populasi 2.202.599 jiwa, yang terdiri atas 1.147.878\\nlaki-laki dan 1.054.721 perempuan. Data BPS Kalimantan Tengah tahun 2019 menunjukkan penduduk provinsi ini tahun 2018 bertambah menjadi 2.660.209. Kalimantan Tengah mempunyai 13 kabupaten dan 1 kota."},{"page_url":"https://pt.wikipedia.org/wiki/Campeonato_Paranaense_de_Futsal_-_Segunda_Divis%C3%A3o","image_url":"http://upload.wikimedia.org/wikipedia/commons/d/d0/Bandeiracorbelia.jpg","page_title":"Campeonato Paranaense de Futsal - Segunda Divisão","context_page_description":"O Campeonato Paranaense de Futsal – Segunda Divisão, cujo nome usual é Chave Prata, equivale ao segundo nível do Futebol de Salão no Paraná, sua organização é de competência da Federação Paranaense de Futsal.\\nA primeira edição foi no ano de 1995, e teve como campeão a Altarquia de União da Vitória. Desde a data de estréia o campeonato vem sendo realizado ininterruptamente, sendo que o maior vencedor é o Pato Futsal, por duas oportunidades: Em 2002, quando ainda se chamava Atlético Patobranquense e 2011.\\nAssim como na Chave Ouro, o interior tem ampla hegemonia sobre a Capital, obtendo todos todos os torneios já realizados, o melhor desempenho de um representante curitibano foi o vice-campeonato do Paraná Clube em 2008\\nO sistema de disputa se assemelha as outras divisões da modalidade, no estado, com a primeira fase em pontos corridos e as finais decididas nos playoffs, já o acesso é destinado ao campeão e vice, sendo a equipe de pior campanha rebaixada a Chave Bronze\\nA Chave Prata junto a Ouro e a Bronze, qualificam o Paranaense como o melhor estadual do Brasil, segundo a Confederação Brasileira de Futsal."},{"page_url":"https://ceb.wikipedia.org/wiki/Ogden_(munisipyo)","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a2/Tomiphobia_Church_Ogden.jpg","page_title":"Ogden (munisipyo)","context_page_description":"Munisipyo ang Ogden sa Kanada. Nahimutang ni sa kondado sa Estrie ug lalawigan sa Québec, sa habagatan-sidlakang bahin sa nasod, 280 km sa sidlakan sa Ottawa ang ulohan sa nasod.\\nAng klima klima sa kontinente. Ang kasarangang giiniton 4 °C. Ang kinainitan nga bulan Hulyo, sa 18 °C, ug ang kinabugnawan Enero, sa -14 °C. Ang kasarangang pag-ulan 1,527 milimetro matag tuig. Ang kinabasaan nga bulan Hulyo, sa 172 milimetro nga ulan, ug ang kinaugahan Pebrero, sa 93 milimetro."},{"page_url":"https://fr.wikipedia.org/wiki/Renkum","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d2/Grafheuvel_nabij_Hazeleger_in_Wolfheze_-02.jpg","page_title":"Renkum","context_page_description":"Renkum est une commune et un village néerlandais, situé en province de Gueldre. Au 1ᵉʳ janvier 2007, sa population est de 31 640 habitants."},{"page_url":"https://lb.wikipedia.org/wiki/Gast_Waltzing","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/27/Gast_Waltzing_2014-02_Jazz_Station_008.jpg","page_title":"Gast Waltzing","context_page_description":"De Gaston Waltzing, gebuer den 13. August 1956 an der Stad Lëtzebuerg, ass e lëtzebuergesche Museksprofesser, Trompettist, Dirigent a Komponist."},{"page_url":"https://fr.wikipedia.org/wiki/Prix_Femina","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3a/Sylvain_Prudhomme_redux.jpg","page_title":"Prix Femina","context_page_description":"Le prix Femina est un prix littéraire français, créé en 1904 par vingt-deux collaboratrices du magazine La Vie heureuse, afin de constituer une contre-proposition au prix Goncourt, jugé misogyne en raison notamment de son attribution, cette année-là, à Léon Frapié, aux dépens de la favorite Myriam Harry. Le prix est attribué chaque année par un jury exclusivement féminin, le premier mercredi de novembre à l'hôtel de Crillon à Paris. Il récompense une œuvre de langue française écrite en prose ou en vers."},{"page_url":"https://en.wikipedia.org/wiki/European_Universities_Judo_Championships","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a4/Podium_Champ_euro_univ_57kg_05373.JPG","page_title":"European Universities Judo Championships","context_page_description":"European Universities Judo Championships were the first organised in 1961. The 2nd edition was planned to be hosted in August 1962 in Huizingen. In 1964 the championships were held in Delft. They were not repeated until 2011, 2013 and 2015. They are reinvented as part of European Universities Games.\\nThe European Universities Judo Championships are currently coordinated by the European University Sports Association along with the 18 other sports on the program of the European universities championships."},{"page_url":"https://fr.wikipedia.org/wiki/Discographie_de_The_Offspring","image_url":"http://upload.wikimedia.org/wikipedia/commons/9/90/Greg_Kriesel.jpg","page_title":"Discographie de The Offspring","context_page_description":"Cette liste recense la discographie de The Offspring, groupe de punk rock américain. En discographie, le groupe a réalisé neuf albums, trois compilations, quatre extended play, trois DVD, 34 singles et 27 clips."},{"page_url":"https://da.wikipedia.org/wiki/Robert_Wagner_(skuespiller)","image_url":"http://upload.wikimedia.org/wikipedia/commons/9/91/Robert_Wagner_It_Takes_a_Thief_1969.JPG","page_title":"Robert Wagner (skuespiller)","context_page_description":"Robert Wagner er en amerikansk skuespiller. Han spillede med i Den lyserøde panter fra 1963"},{"page_url":"https://en.wikipedia.org/wiki/List_of_accidents_and_incidents_involving_military_aircraft_(1960%E2%80%931974)","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3b/North_American_XB-70A_Valkyrie_just_after_collision_061122-F-1234P-037.jpg","page_title":"List of accidents and incidents involving military aircraft (1960–1974)","context_page_description":"The items in this list are grouped by the year in which the accident or incident occurred. Not all of the aircraft were in operation at the time. Combat losses are not included, except for a very few cases denoted by singular circumstances."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%A1%D0%BF%D0%B8%D1%81%D0%BE%D0%BA_%D0%B2%D0%B8%D0%B4%D1%96%D0%B2_%D1%80%D0%BE%D0%B4%D1%83_%D0%BC%D0%BE%D0%BB%D0%BE%D1%87%D0%B0%D0%B9","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f4/Euphorbia_arceuthobioides_ies.jpg","page_title":"Список видів роду молочай","context_page_description":"Список видів роду Молочай:\\nСписок, який містить 2046 визнаних видів роду Молочай, складений на основі даних сайту «The Plant List».\\nУкраїнські назви видів, які містять посилання на авторитетні джерела, є прийнятими українськими назвами."},{"page_url":"https://sv.wikipedia.org/wiki/Poigny-la-For%C3%AAt","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8c/Map_commune_FR_insee_code_78497.png","page_title":"Poigny-la-Forêt","context_page_description":"Poigny-la-Forêt är en kommun i departementet Yvelines i regionen Île-de-France i norra Frankrike. Kommunen ligger i kantonen Rambouillet som tillhör arrondissementet Rambouillet. År 2009 hade Poigny-la-Forêt 1 030 invånare."},{"page_url":"https://fr.wikipedia.org/wiki/D%C3%B4me_du_Rocher","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/45/The_rock_of_the_Dome_of_the_Rock_Corrected.jpg","page_title":"Dôme du Rocher","context_page_description":"Le dôme du Rocher ou la coupole du Rocher, appelé parfois mosquée d'Omar à tort, « premier monument qui se voulut une création esthétique majeure de l'Islam », est un sanctuaire érigé sur ordre du calife Abd al-Malik ibn Marwan à Jérusalem-Est, sur le « Haram al-Charif », le site qui comprend aussi la mosquée al-Aqsa, est le troisième lieu saint musulman après La Mecque et Médine.\\nAchevé en l'an 691 ou dans la seconde partie de l'année 692, son dôme a été reconstruit en 1022 et rénové en 1089, 1318, 1448, 1830, 1874, 1962 puis complétement en 1994, durant laquelle des plaques de cuivres avec une fine couche de nickel et d'or sont posées.\\nLe bâtiment suit le style architectural byzantin avec une influence perse sassanide, et sa construction est supervisée par Raja ibn Haywa, Yazid ibn Sallam, et Sahaba, mais son architecte est inconnu. Les motifs des carreaux actuels, ont quant à eux été installés par Soliman Iᵉʳ en 1545-1552, dont certains contiennent des sourates qui réfutent la trinité chrétienne.\\nLe Dôme du Rocher abrite le Rocher de la Fondation, à l'endroit indentifié par la tradition musulmane contemporaine, comme celui de l'Isra et Miraj, en chevauchant sa monture Bouraq."},{"page_url":"https://cs.wikipedia.org/wiki/Kanton_S%C3%A8vres","image_url":"http://upload.wikimedia.org/wikipedia/commons/b/b3/Map_canton_code_92_37.svg","page_title":"Kanton Sèvres","context_page_description":"Kanton Sèvres je francouzský kanton v departementu Hauts-de-Seine v regionu Île-de-France. Tvoří ho pouze město Sèvres.\\nPortály: Francie"},{"page_url":"https://en.wikipedia.org/wiki/Military_history_of_Canada_during_World_War_I","image_url":"https://upload.wikimedia.org/wikipedia/en/7/79/Vimy_Memorial_%28September_2010%29_cropped.jpg","page_title":"Military history of Canada during World War I","context_page_description":"The military history of Canada during World War I\\nbegan on August 4, 1914, when the United Kingdom entered the First World War by declaring war on Germany. The British declaration of war automatically brought Canada into the war, because of Canada's legal status as a British Dominion which left foreign policy decisions in the hands of the British parliament. However, the Canadian government had the freedom to determine the country's level of involvement in the war. On August 4, 1914, the Governor General declared a war between Canada and Germany. The Militia was not mobilized and instead an independent Canadian Expeditionary Force was raised.\\nCanada's sacrifices and contributions to the Great War changed its history and enabled it to become more independent, while also opening a deep rift between the French and English speaking populations. For the first time in Canadian military history, Canadian forces fought as a distinct unit, first under a British commander but ultimately under a Canadian-born commander."},{"page_url":"https://nl.wikipedia.org/wiki/Klooster_van_de_Zusters_Onder_de_Bogen","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/af/Maastricht%2C_Zusters_Onder_de_Bogen%2C_kloosterkapel_06a.jpg","page_title":"Klooster van de Zusters Onder de Bogen","context_page_description":"Het Klooster van de Liefdezusters van de Heilige Carolus Borromeus, meestal aangeduid als Klooster van de Zusters Onder de Bogen, is een rooms-katholiek klooster in het centrum van de Nederlandse stad Maastricht. Het klooster is het moederhuis van de congregatie van de Liefdezusters van de Heilige Carolus Borromeus. Het klooster is gevestigd in een aantal historische gebouwen tussen de straten Sint Servaasklooster en Kommel. In de kloostertuin bevindt zich een belangrijk deel van de nog resterende eerste, middeleeuwse stadsmuur."},{"page_url":"https://en.wikipedia.org/wiki/S%C3%A9beville","image_url":"http://upload.wikimedia.org/wikipedia/commons/2/25/FranceNormandieSebevilleEglise.jpg","page_title":"Sébeville","context_page_description":"Sébeville is a commune in the Manche department in Normandy in north-western France."},{"page_url":"https://en.wikipedia.org/wiki/2013_CONCACAF_Gold_Cup","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/04/Rio_Tinto_Stadium.jpg","page_title":"2013 CONCACAF Gold Cup","context_page_description":"The 2013 CONCACAF Gold Cup was the 12th CONCACAF Gold Cup competition and the 22nd CONCACAF regional championship overall in CONCACAF's fifty years of existence. The United States was the host nation.\\nThe competition began on 7 July 2013 at the Rose Bowl, and ended with the final on 28 July 2013 at Soldier Field, with the United States defeating Panama 1–0. In this edition of the Gold Cup, Mexico participated with an alternative squad due to the main players competing at the 2013 FIFA Confederations Cup prior to the Gold Cup. Despite not playing with their full squad, they successfully reached the semi-finals where they lost to eventual runners-up Panama with a score of 1–2.\\nUnited States won the tournament, which qualified them for a play-off match against the champions of the 2015 CONCACAF Gold Cup, to decide which team would represent CONCACAF in the 2017 FIFA Confederations Cup in Russia. The playoff was played in a single match held on 10 October 2015, which Mexico won 3–2."},{"page_url":"https://eo.wikipedia.org/wiki/Vaunoise_(Orne)","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/da/02_-_Vaunoise.JPG","page_title":"Vaunoise (Orne)","context_page_description":"Vaunoise estas franca komunumo situanta en departemento Orne, regiono Normandio.\\nĜiaj enloĝantoj nomiĝas Vaunoisiens."},{"page_url":"https://en.wikipedia.org/wiki/Swallow_Sidecar_Company","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/75/1935_Norton_Model_18_Coventry_Transport_Museum.jpg","page_title":"Swallow Sidecar Company","context_page_description":"Swallow Sidecar Company, Swallow Sidecar and Coachbuilding Company, and Swallow Coachbuilding Company were trading names used by Walmsley & Lyons, partners and joint owners of a British manufacturer of motorcycle sidecars and automobile bodies in Blackpool, Lancashire, before incorporating a company in 1930 to own their business, which they named Swallow Coachbuilding Company Limited.\\nUnder co-founder William Lyons, its business continued to prosper as S.S. Cars Limited and grew into Jaguar Cars Limited. The sidecar manufacturing business, by then owned by a different company, Swallow Coachbuilding Company Limited, was sold by Jaguar in January 1946 to an aircraft maintenance firm, Helliwell Group."},{"page_url":"https://fr.wikipedia.org/wiki/Naples","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/cd/Centro_direzionale_di_Napoli.jpg","page_title":"Naples","context_page_description":"Naples est une ville d'Italie, chef-lieu de la région de Campanie. Elle est la troisième ville d'Italie par sa population et la dix-huitième de l'Union européenne ainsi que respectivement la deuxième et la neuvième en incluant sa banlieue. C'est aussi la deuxième plus grande cité méditerranéenne en Europe, après Barcelone.\\nL'histoire de Naples s'étend sur plus de vingt-huit siècles. Sous le nom de Parthénope, elle fut fondée durant l'Antiquité par la cité voisine de Cumes. Elle s'étend ensuite rapidement jusqu'à devenir un des principaux centres commerciaux, culturels, philosophiques et politiques de la Grande-Grèce puis de l'Empire romain. Après avoir été brièvement dépendante de l'Empire byzantin, elle devient autonome au sein du duché de Naples. Dès le XIIIᵉ siècle et pour ensuite plus de 600 ans, elle devient successivement la capitale du royaume de Naples puis du royaume des Deux-Siciles. Elle reste alors un des principaux centres de développement économiques et technologiques d'Europe jusqu'à son annexion au royaume d’Italie en 1860, date à laquelle elle entame un relatif déclin socio-économique."},{"page_url":"https://bg.wikipedia.org/wiki/%D0%94%D0%B0%D0%BB%D0%B0%D0%B9_%D0%9B%D0%B0%D0%BC%D0%B0","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b6/BuddhaTwang.jpg","page_title":"Далай Лама","context_page_description":"Далай Лама е високопоставен лама в будистката школа Гелуг или „Жълтите шапки“ на тибетския будизъм. Името е комбинация от китайско-монголската дума далай, което означава „океан“ и тибетската дума བླ་མ་ бла-ма, което значи „главен първосвещеник“.\\nУчениците на Далай Лама вярват, че той е превъплъщение на дълга линия от тулку, които се считат за проявление на бодхисатвата на състраданието Авалокитешвара. Традиционно се смята, че Далай Лама е най-новото превъплъщение на поредица от духовни водачи, които са избрали да се преродят, за да просветят другите същества. Честа грешка е да се смята, че Далай Лама е официалният водач на будистката школа Гелуг, но тази роля принадлежи на Ганден Трипа. Това е временна позиция със 7-годишен мандат, която се получава след сложен йерархичен напредък и конкурс и утвърдена от Далай Лама, който на практика оказва голямо влияние. Линията на Далай ламите започва като приемственост на духовни учители; петият Далай Лама поема политическата власт над Тибет."},{"page_url":"https://sr.wikipedia.org/wiki/%D0%9F%D0%B0%D1%81%D0%BE%D0%B2_(%D0%9C%D0%B5%D0%BA%D0%BB%D0%B5%D0%BD%D0%B1%D1%83%D1%80%D0%B3)","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/37/2012_Herrenhaus_Passow_Ensemble.JPG","page_title":"Пасов (Мекленбург)","context_page_description":"Пасов општина је у њемачкој савезној држави Мекленбург-Западна Померанија. Једно је од 76 општинских средишта округа Пархим. Према процјени из 2010. у општини је живјело 722 становника. Посједује регионалну шифру 13060057."},{"page_url":"https://nl.wikipedia.org/wiki/Kerkstraat_22-24","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/05/Eemnes_Kerkstraat_22-24.JPG","page_title":"Kerkstraat 22-24","context_page_description":"Kerkstraat 22-24 is een gemeentelijk monument aan de Kerkstraat 22-24 in Eemnes in de provincie Utrecht.\\nOorspronkelijk woonden er drie gezinnen in het pand. Het huis is sinds 1877 eigendom van de Nederlands Hervormde gemeente van Eemnes-Buiten. De voormalige arbeiderswoning wordt bewoond door de koster van de Nicolaaskerk. Na een restauratie in 1977 volgde een verbouwing in 1981. De top van de linker gevel is gepleisterd."},{"page_url":"https://es.wikipedia.org/wiki/In%C3%A9s_de_Su%C3%A1rez_(estaci%C3%B3n)","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/25/Cenefa_Metro_In%C3%A9s_de_Su%C3%A1rez.png","page_title":"Inés de Suárez (estación)","context_page_description":"Inés de Suárez es una estación ferroviaria que forma parte de la red del Metro de Santiago de Chile. Se encuentra subterránea, entre las estaciones Ñuñoa y Los Leones de la Línea 6."},{"page_url":"https://es.wikipedia.org/wiki/Punta_Umbr%C3%ADa","image_url":"http://upload.wikimedia.org/wikipedia/commons/3/38/Punta_Umbria.jpg","page_title":"Punta Umbría","context_page_description":"Punta Umbría es un municipio español de la provincia de Huelva, Andalucía. Según el INE, en el año 2016 contaba con una población de 15.053 habitantes.​ Su extensión superficial es de 38 km² y tiene una densidad de 387,2 hab/km². Se encuentra situada a una altitud de 6 metros y a 20 kilómetros de la capital de provincia, Huelva y a 100 km de Sevilla."},{"page_url":"https://es.wikipedia.org/wiki/Diplopoda","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/bb/Millipede_collage.jpg","page_title":"Diplopoda","context_page_description":"Los diplópodos, son una clase de miriápodos que se caracterizan por tener dos pares de patas articuladas en la mayoría de sus segmentos corporales dobles, o diplosegmentos.\\nSe les conoce comúnmente como milpiés, ​ aunque por lo general tienen entre 34 y 400 patas y la especie con más, Illacme plenipes, tiene 750. Generalmente tienen cuerpos cilíndricos muy largos con más de 20 segmentos, aunque los oniscomorfos son más cortos y pueden enroscarse formando una bola. Existen unas 12 000 especies, clasificadas en 16 órdenes y alrededor de 140 familias, lo que convierten a los diplópodos en la mayor clase de miriápodos, un grupo de artrópodos que también incluye a los quilópodos y otras criaturas con numerosas patas. Se calcula que quedan 80.000 especies por describir.​\\nLa mayoría de los milpiés son detritívoros de movimiento lento que se alimentan de hojas en descomposición y otra materia vegetal muerta. Algunos comen hongos o chupan fluidos vegetales y una pequeña minoría son depredadores."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%9D%D0%B5%D0%B9%D0%BF%D0%BB%D1%81","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ea/Naples_FL_US_41_east01.jpg","page_title":"Нейплс","context_page_description":"Нейплс — город, расположенный в округе Коллиер с населением в 21 653 человека по статистическим данным переписи 2007 года."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%A1%D0%B0%D0%BC%D0%BE%D1%80%D1%81%D1%8C%D0%BA%D0%B0_%D0%B4%D1%96%D0%BE%D1%86%D0%B5%D0%B7%D1%96%D1%8F","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/23/Catedral_de_Zamora_%28fachada_principal%292.JPG","page_title":"Саморська діоцезія","context_page_description":"Само́рська діоце́зія — діоцезія римського обряду Католицької церкви в Іспанії, з центром у місті Самора. Входить до складу Валядолідської церковної провінції. Суфраганна діоцезія Валядолідської архідіоцезії. Заснована 900 року. Голова — єпископ Саморський. Центральний храм — Саморський собор. Площа — 6,984 км². Населення — 167,100 ос.; з них католики — 165,000 ос. Чинний голова — Грегоріо Мартінес Сакрістан, єпископ Саморський."},{"page_url":"https://it.wikipedia.org/wiki/Enrico_I_d%27Inghilterra","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/28/King_Henry_I_from_NPG.jpg","page_title":"Enrico I d'Inghilterra","context_page_description":"Enrico I, chiamato anche Enrico Beauclerk o Enrico Beauclerc per i suoi interessi culturali, regnò sull'Inghilterra dal 5 agosto 1100 al 1º dicembre 1135; governò anche il Ducato di Normandia dopo averlo tolto a suo fratello maggiore, Roberto il Corto, nel 1106 e divenendone duca nel 1134, alla morte del fratello che era rimasto senza eredi.\\nSalì al potere dopo la morte del fratello Guglielmo II il Rosso, approfittando dell'assenza del fratello maggiore, Roberto il Corto, impegnato alle Crociate. Il suo regno è conosciuto per il suo abile opportunismo politico, il miglioramento della macchina del governo, l'integrazione degli Anglo-Sassoni e dei Normanni divisi nel suo regno, la riunificazione dei domini del padre e la sua controversa decisione di nominare sua figlia come erede. Fu anche conosciuto con il soprannome \\"leone della giustizia\\", in riferimento alle modifiche apportate alla rudimentale macchina amministrativa e legislativa del tempo."},{"page_url":"https://hi.wikipedia.org/wiki/%E0%A4%90%E0%A4%9C%E0%A4%BC_%E0%A4%AF%E0%A5%82_%E0%A4%B2%E0%A4%BE%E0%A4%87%E0%A4%95_%E0%A4%87%E0%A4%9F","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5c/Francis_Hayman_002.jpg","page_title":"ऐज़ यू लाइक इट","context_page_description":"ऐज़ यू लाइक इट विलियम शेक्सपियर द्वारा लिखित एक पैस्टोरल कॉमेडी है, जिसे 1599 या 1600 की शुरूआत में लिखा हुआ मानते हैं और यह 1623 के फोलियो में पहली बार प्रकाशित हुआ। यह कृति थॉमस लॉज के गद्य प्रेम-कथा रॉसलिंड पर आधारित थी। हालांकि इस नाटक के पहले प्रदर्शन की जानकारी अनिश्चित है, परन्तु सुझावों के अनुसार, 1603 में विल्टन हाउस में इसके एक प्रदर्शन की संभावना जताई गई है। ऐज़ यू लाइक इट की कहानी नायिका रॉसलिंड के इर्द-गिर्द घूमती है, जो उत्पीड़न के डर से अपनी चचेरी बहन सीलिया और महल के विदूषक टचस्टोन के साथ, अपने चाचा के महल से आर्डेन के जंगल में सुरक्षा और अंततः प्यार पाने के लिए भाग जाती है। ऐतिहासिक रूप से, इस पर आलोचकों की राय भिन्न रही है, कुछ आलोचकों के अनुसार यह कृति शेक्सपियर की अन्य कृतियों की तुलना में कम उत्कृष्ट है जबकि कुछ इस नाटक को बेहद उत्कृष्ट कृति मानते हैं।\\nशेक्सपियर की एक सर्वाधिक प्रसिद्ध और अक्सर-प्रयुक्त उक्ति \\"ऑल दी वर्लड इज़ अ स्टेज\\" इसी नाटक का हिस्सा है, साथ ही यह \\"टू मच ऑफ अ गुड थिंग\\" वाक्यांश का मूल भी है। यह नाटक दर्शकों की पसंदीदा बनी रही और रेडियो, फिल्म और संगीतमय रंगमंच के लिए रूपांतरित की गई।"},{"page_url":"https://be-tarask.wikipedia.org/wiki/%D0%9A%D0%B0%D1%81%D1%8C%D1%86%D1%91%D0%BB_%D0%A1%D1%8C%D0%B2%D1%8F%D1%82%D0%BE%D0%B3%D0%B0_%D0%9C%D1%96%D1%85%D0%B0%D0%BB%D0%B0_%D0%90%D1%80%D1%85%D0%B0%D0%BD%D1%91%D0%BB%D0%B0_%D1%96_%D0%BA%D0%BB%D1%8F%D1%88%D1%82%D0%B0%D1%80_%D0%BF%D1%96%D1%8F%D1%80%D0%B0%D1%9E_(%D0%9B%D1%83%D0%B6%D0%BA%D1%96)","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0c/%C5%81u%C5%BEki%2C_Ka%C5%9Bcielnaja%2C_Pijarski._%D0%9B%D1%83%D0%B6%D0%BA%D1%96%2C_%D0%9A%D0%B0%D1%81%D1%8C%D1%86%D0%B5%D0%BB%D1%8C%D0%BD%D0%B0%D1%8F%2C_%D0%9F%D1%96%D1%8F%D1%80%D1%81%D0%BA%D1%96_%281915%29.jpg","page_title":"Касьцёл Сьвятога Міхала Арханёла і кляштар піяраў (Лужкі)","context_page_description":"Касьцёл Сьвятога Міхала Арханёла і кляштар піяраў — помнік архітэктуры XVIII ст. у Лужках. Знаходзіцца ў паўднёва-ўсходняй частцы гістарычнага мястэчка, на Касьцельнай вуліцы. Касьцёл дзейнічае. Твор архітэктуры віленскага барока. Аб’ект Дзяржаўнага сьпісу гістарычна-культурных каштоўнасьцяў Беларусі.\\nКомплекс складаўся з касьцёла і кляштарнага корпуса. У 1843 годзе расейскія ўлады зруйнавалі кляштар."},{"page_url":"https://ja.wikipedia.org/wiki/%E3%82%B7%E3%83%B4%E3%82%A1%E3%83%BC%E3%82%B8%E3%83%BC","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9c/Death_of_Afzal_Khan.jpg","page_title":"シヴァージー","context_page_description":"シヴァージー・ボーンスレーは、マラーターの指導者にして、マラーター王国の創始者かつ初代君主。君主号チャトラパティを付けて、チャトラパティ・シヴァージーとも呼ばれる。日本語では、シバジと表記されることもある。\\nシヴァージーはビジャープル王国やゴールコンダ王国、さらにはムガル帝国といったイスラーム王朝に対抗しようとして、デカンにヒンドゥー王朝を復興し、その結束を試みた。"},{"page_url":"https://ru.wikipedia.org/wiki/%D0%9A%D1%80%D0%B5%D1%81%D1%82%D0%BE%D0%B2%D0%BE%D0%B7%D0%B4%D0%B2%D0%B8%D0%B6%D0%B5%D0%BD%D1%81%D0%BA%D0%B0%D1%8F_%D1%86%D0%B5%D1%80%D0%BA%D0%BE%D0%B2%D1%8C_(%D0%9F%D1%80%D0%B8%D1%8E%D1%82%D0%BD%D0%BE%D0%B5)","image_url":"http://upload.wikimedia.org/wikipedia/commons/d/d3/Cerprijutnoe.jpg","page_title":"Крестовоздвиженская церковь (Приютное)","context_page_description":"Крестовоздви́женская це́рковь — приходской храм Элистинской епархии Русской православной церкви, находящийся в селе Приютное республики Калмыкия. Церковь находится по адресу: ул. Пионерская, д. 2."},{"page_url":"https://es.wikipedia.org/wiki/Tegnestuen_Vandkunsten","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/98/Vandkunsten_det_bl%C3%A5_hj%C3%B8rne_2007.jpg","page_title":"Tegnestuen Vandkunsten","context_page_description":"Tegnestuen Vandkunsten a/s, o simplemente Vandkunsten, es un estudio de arquitectura danés fundado en 1970. Vandkunsten fue galardonados con la Medalla Alvar Aalto en 2009 por ser un «moderno intérprete y elaborador la herencia ideológica de Alvar Aalto».​ Esta fue la primera vez que la Medalla Alvar Aalto fue otorgado a un equipo de arquitectos en lugar de un individuo. Su pionero e influyente trabajo en la arquitectura residencial y desarrollos de vivienda se caracterizan por su «convertibilidad, comunalidad, participación residencial, densidad en baja altura, y el desarrollo sostenible».​ La oficina se compone por alrededor de 30 diseñadores, se encuentra en Copenhague, pero también han realizado proyectos en Escandinavia y otras partes de Europa.​"},{"page_url":"https://de.wikipedia.org/wiki/Festung_Luxemburg","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f2/Kanone_Bockfelsen.JPG","page_title":"Festung Luxemburg","context_page_description":"Die Festung Luxemburg, im Großherzogtum auch stolz mit dem vereinfachten Zitat Carnots als Gibraltar vum Norde bezeichnet, war bis zu ihrer Schleifung im Jahre 1867 eine Wehranlage der Stadt Luxemburg von strategischer Bedeutung für die Grenzregion zwischen Frankreich, dem Deutschen Bund und der Niederlande bzw. Belgien."},{"page_url":"https://it.wikipedia.org/wiki/Giustiniano_I","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7a/Mosaic_blue_charioteer_Massimo.jpg","page_title":"Giustiniano I","context_page_description":"Flavio Pietro Sabbazio Giustiniano, meglio noto come Giustiniano I il Grande, è stato un imperatore bizantino, dal 1º agosto 527 sino alla sua morte.\\nGiustiniano, ultimo imperatore bizantino educato nel seno di una famiglia di lingua e cultura latine, è considerato uno dei più grandi sovrani di età tardo-antica e altomedievale. Il suo governo coincise con un periodo d'oro per l'Impero romano d'Oriente, dal punto di vista civile, economico e militare. Nell'ambito della Restauratio Imperii, le vittoriose campagne dei generali Belisario e Narsete permisero il ricongiungimento all'Impero di parte dei territori dell'Occidente romano; venne portato a compimento un progetto di edilizia civile che ha lasciato opere architettoniche di eccezionale importanza come la chiesa di Hagia Sophia a Costantinopoli; il patronato imperiale diede inoltre nuova linfa alla cultura, con la fioritura di celebri storici e letterati, fra cui Procopio di Cesarea, Agazia, Giovanni Lido e Paolo Silenziario."},{"page_url":"https://en.wikipedia.org/wiki/Lincoln_Crown_Court","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/ba/Lincoln_Crown_Court_%28geograph_3168057%29.jpg","page_title":"Lincoln Crown Court","context_page_description":"Lincoln Crown Court is a judicial facility in Lincoln, Lincolnshire. It is located on the western side of the grounds of Lincoln Castle and is a Grade II* listed building."},{"page_url":"https://lt.wikipedia.org/wiki/Mata_Hari","image_url":"http://upload.wikimedia.org/wikipedia/commons/1/16/Mata_Hari_6.jpg","page_title":"Mata Hari","context_page_description":"Margareta Gertrūda Zelė, geriau žinoma slapyvardžiu Mata Hari – Nyderlandų šokėja, modelis, kurtizanė, apkaltinta šnipinėjimu ir I pasaulinio karo metais sušaudyta."},{"page_url":"https://es.wikipedia.org/wiki/Monasterio_de_San_Francisco_(Burgos)","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/65/Ruinas_de_la_iglesia_del_monasterio_de_San_Francisco_de_Burgos_%28Hacia_1850%29.JPG","page_title":"Monasterio de San Francisco (Burgos)","context_page_description":"El monasterio de San Francisco de Burgos fue un convento franciscano situado en la ciudad de Burgos, del que actualmente solo se conservan unas pocas ruinas rehabilitadas para evitar desprendimientos y la pérdida de los restos históricos que se mantienen. Según refiere la tradición, fue fundado por san Francisco de Asís​ en 1213, habiendo obtenido previamente la aprobación del rey Alfonso VIII de Castilla, aunque ello ha sido cuestionado por numerosos historiadores.​\\nEl monasterio resultó muy dañado durante la Guerra de la Independencia, y en 1836 fue desamortizado y comenzó a ser demolido. En el solar que ocupaba fue instalado un cuartel, y posteriormente una factoría militar y en las décadas siguientes tuvo otros destinos. Las ruinas consolidadas de la iglesia que aún se conservan se encuentran en la calle San Francisco, cerca de las del desaparecido convento de la Santísima Trinidad de Burgos y cercanas a la iglesia de San Gil."},{"page_url":"https://fr.wikipedia.org/wiki/Anton_Nanut","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/53/Nanut_2011.jpg","page_title":"Anton Nanut","context_page_description":"Anton Nanut est un chef d'orchestre slovène, né le 13 septembre 1932 à Kanal en Slovénie et mort le 13 janvier 2017 à Šempeter pri Gorici, dans la commune de Šempeter-Vrtojba."},{"page_url":"https://zh.wikipedia.org/zh-tw/%E8%8B%B1%E5%9B%BD%E5%90%9B%E4%B8%BB%E9%85%8D%E5%81%B6%E5%88%97%E8%A1%A8","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/78/Mary_of_Teck_4.jpg","page_title":"英国君主配偶列表","context_page_description":"這裡列出的是1707年—1800年大不列顛王國以及1801年起聯合王國的君主配偶。\\n自從大不列顛王國成立以來，它和之後的聯合王國一共有9位王室配偶。1727年至1814年間的英國國王兼任漢諾瓦選帝侯，所以王后同時也是漢諾瓦選帝侯妃。在1814年至1837年間，選帝侯成了漢諾瓦國王，所以王后就兼任了漢諾瓦王后。這個共主邦聯在1837年維多利亞女王即位時結束，根據薩利克繼承法，在有男性繼承者的前提下，漢諾瓦不能由女性繼承。到了1866年的普奧戰爭，漢諾瓦就被普魯士王國併吞了。\\n所有的女性配偶都有權享有王后的頭銜，但1707年以後的2位男性配偶都沒有享有王夫的頭銜：\\n阿爾伯特親王，是維多利亞女王的丈夫，沒有任何的英國貴族頭銜，但被封為親王這一獨特頭銜。在1857年，還從來沒有一位男性君主配偶擁有這一官方頭銜。\\n菲利普親王，是伊麗莎白二世女王的丈夫，在1947年被封為愛丁堡公爵，1957年被封為英國王子稱號。\\n不是所有國王的妻子都能成為王后，有的是因為當她們的丈夫即位時，她們已經去世、離異或者宣布婚姻無效，也有的是在國王退位後才結婚的。這樣的例子有：\\n策勒的索菲亞·多魯西亞，是喬治一世的妻子，1682年11月22日結婚，1694年12月28日離婚，而喬治一世在1714年才即位，索菲亞在1726年11月23日去世。\\n瑪麗亞·安妮·菲茨赫伯特，原是威爾斯親王喬治的情人，兩人在1785年結婚，後來婚姻被宣布無效，喬治更在1795年迎娶表妹卡羅琳為妻。喬治四世在1820年即位，卡羅琳於1821年逝世，瑪麗亞則在1837年去世。\\n華里絲·辛普森，是溫莎公爵的妻子，國王1936年12月11日退位，他們1937年6月3日結婚，1986年4月24日去世。\\n還有一個特別的例子是喬治四世的妻子卡羅琳，在喬治四世即位前，他們就已經分居，儘管是國王的法定配偶，但卡羅琳甚至被禁止參加國王的登基大典。喬治四世即位後，為了解除兩人卡羅琳的婚姻關係，並禠奪卡羅琳的英國王后的身份，要求英國政府向英國國會提交《1820年痛苦和刑罰草案》，最終法案被撤回，而卡羅琳在次年逝世後，喬治四世亦未再婚。\\n自1707年以後，只有喬治一世和愛德華八世在即位的時候尚無配偶。\\n如果現任王儲查爾斯繼承王位，那麼他的妻子卡蜜拉應該擁有王后的頭銜。但實際上，根據法律，卡蜜拉只能享有伴妃的稱號。"},{"page_url":"https://ceb.wikipedia.org/wiki/Ona_(kapuloan)","image_url":"http://upload.wikimedia.org/wikipedia/commons/3/34/Ona1.jpg","page_title":"Ona (kapuloan)","context_page_description":"Kapuloan ang Ona sa Noruwega. Nahimutang ni sa munisipyo sa Sandøy ug lalawigan sa Møre og Romsdal fylke, sa habagatan-kasadpang bahin sa nasod, 400 km sa amihanan-kasadpan sa Oslo ang ulohan sa nasod.\\nAng klima kasarangan. Ang kasarangang giiniton 6 °C. Ang kinainitan nga bulan Agosto, sa 12 °C, ug ang kinabugnawan Disyembre, sa 2 °C."},{"page_url":"https://sk.wikipedia.org/wiki/Magnezitovce","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a7/Koprassky_viadukt_side_view.JPG","page_title":"Magnezitovce","context_page_description":"Magnezitovce sú obec na Slovensku v okrese Revúca."},{"page_url":"https://de.wikipedia.org/wiki/IC_2423","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c3/IC2423_-_SDSS_DR14.jpg","page_title":"IC 2423","context_page_description":"IC 2423 ist eine Balken-Spiralgalaxie vom Hubble-Typ SBc im Sternbild Krebs auf der Ekliptik. Sie ist schätzungsweise 403 Mio. Lichtjahre von der Milchstraße entfernt und hat einen Durchmesser von etwa 120.000 Lj.\\nIm selben Himmelsareal befindet sich u. a. die Galaxie IC 2422.\\nEntdeckt wurde das Objekt am 6. April 1896 von Stéphane Javelle."},{"page_url":"https://ca.wikipedia.org/wiki/Desfilada_de_la_Vict%C3%B2ria_de_Moscou_de_1945","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/89/%D0%9F%D0%B0%D1%80%D0%B0%D0%B4_%D0%9F%D0%BE%D0%B1%D0%B5%D0%B4%D1%8B_%D0%BC%D0%B0%D1%80%D0%BA%D0%B0_%D0%A0%D0%BE%D1%81%D1%81%D0%B8%D0%B8_1995.jpg","page_title":"Desfilada de la Victòria de Moscou de 1945","context_page_description":"La Desfilada de la Victòria de Moscou de 1945 va ser una desfilada de la victòria realitzada després de la desfeta de l'Alemanya Nazi a la Gran Guerra Patriòtica. Tingué lloc a Moscou, capital de la Unió Soviètica, i principalment va ser una desfilada militar per la Plaça Roja. Se celebrà un plujós 24 de juny de 1945, poc més d'un mes després del dia de la rendició alemanya als comandants soviètics.\\nEls Mariscals Gueorgui Júkov i Konstantín Rokossovski cavalcaren sobre un cavall blanc i negre, respectivament. El fet és commemorat per l'estàtua eqüestre de Júkov davant del Museu Històric Estatal, a la plaça Manege. Stalin presidí la cerimònia sobre el Mausoleu de Lenin\\nUn dels moments més famosos va ser al final, quan diversos soldats de l'Exèrcit Roig portaren diversos estendards de l'Alemanya Nazi i els llançaren junt al Mausoleu. Un dels estendards pertanyia a la Leibstandarte Adolf Hitler, el cos d'escorta personal de Hitler que s'elevà fins a la mida d'una divisió."},{"page_url":"https://en.wikipedia.org/wiki/Counter_Logic_Gaming","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2b/Counter_logic_gaming_eu.jpg","page_title":"Counter Logic Gaming","context_page_description":"Counter Logic Gaming is an American esports organization headquartered in Los Angeles, California. It was founded in April 2010 by George \\"HotshotGG\\" Georgallidis and Alexander \\"Vodoo\\" Beutel as a League of Legends team, and has since branched out into other games.\\nCLG fields the oldest League of Legends team still active, having competed in every split of the North American League of Legends Championship Series since it began in Spring 2013. CLG has won two NA LCS splits, the 2015 Summer NA LCS and 2016 Spring NA LCS. The team has also attended the 2012, 2015 and 2016 League of Legends World Championships, and was eliminated in the group stage on each occasion.\\nThe organization also fields Smite, Counter-Strike: Global Offensive, Super Smash Bros., Fortnite and H1Z1 teams, and previously included Dota 2, Overwatch, Hearthstone, Rocket League, Halo, Tom Clancy's Rainbow Six Siege, and Call of Duty teams. The organization was also one of the first in North America to implement a multi-team gaming house, and the current residence is able to house all their major divisions and the management staff on a permanent basis."},{"page_url":"https://fi.wikipedia.org/wiki/Boeing_B-47_Stratojet","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/14/XB47_on_runway.jpg","page_title":"Boeing B-47 Stratojet","context_page_description":"Boeing B-47 Stratojet oli kuusimoottorinen suihkukäyttöinen raskas strateginen pommikone. Siitä kehiteltiin myös tiedustelukonemuunnoksia, jotka palvelivat ennen U-2- ja SR-71-koneita. B-47 Stratojet kykeni ydinpommituksiin kaikkein ensimmäisillä lämpöydinpommeilla. Niiden paino oli tuhansia kilogrammoja, jopa 9 000 kg. Nuo pommit olivat lisäksi varsin kookkaita. B-47 kykeni ottamaan enintään 11 000 kg suuruisen pommilastin. B-47 kykeni alisooniseen huippunopeuteen, joka on nykyään tavanomainen suihkumatkustajakoneille. Omana kehityskautenaan, 1950-luvun alussa koneen nopeutta pidettiin suoritusarvollisesti suhteellisen arvostettavana.\\nKonetta käytettiin myös ensimmäisten risteilyohjusten laukaisualustana. Näihin ohjuksiin kuuluvat esimerkiksi GAM-87 Skybolt ja GAM-63 Rascal. Ydinkärjellä varustettu ilmataisteluohjus AIR-2 Genie kuului oman aikakautensa erikoisiin harvinaisuuksiin ilmapuolustusaseena. Viimeisimpänä mainittu oli kuitenkin pääasiallisesti ilmaherruushävittäjien käyttöön suunnattu. Tuota edellä mainittua massapommitustehtävien suorittamista jatkaa aina niin tarvitessa, edelleen B-52 Stratofortress, mm. olemalla risteilyohjusten ns. \\"lentävänä laukaisualustana\\"."},{"page_url":"https://eu.wikipedia.org/wiki/Jivno","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/69/Flag_of_Jivno.jpg","page_title":"Jivno","context_page_description":"Jivno Txekiar Errepublikako udalerri bat da. 340 biztanle ditu eta 6,28 kilometro koadroko azalera. České Budějoviceko barrutian dago."},{"page_url":"https://pt.wikipedia.org/wiki/Amanita_muscaria","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/bb/Amanita_muscaria_77.jpg","page_title":"Amanita muscaria","context_page_description":"O Amanita muscaria, conhecido como agário-das-moscas ou mata-moscas é um fungo basidiomiceto natural de regiões com clima boreal ou temperado do hemisfério norte. Possui propriedades psicoativas e alucinógenas em humanos. Segundo o psiquiatra Alfredo Cataldo Neto a literatura especializada aponta principalmente a presença de dois componentes ativos, o ácido ibotênico, muscimol. Este autor ainda aponta que os efeitos do uso deste fungo têm início cerca de quinze minutos após sua ingestão, quando o usuário pode apresentar vertigem, confusão mental, náusea, secura na boca e o sentimento de estar crescendo. Este desconforto aos poucos vai dando lugar a um sono leve, no qual a pessoa experimenta visões e imagens oníricas. O pesquisador Robert Gordon Wasson sugeriu que o cogumelo está associado ao Soma, bebida sagrada dos Vedas, nos mais antigos textos religiosos. A bebida é citada nos hinos do Rigveda, que foi escrito por volta de 1700 a.C. – 1100 a.C., durante o período védico em Punjabe - e havia a presença de tais cogumelos, consumidos pelos xamãs da região. Wasson é o primeiro pesquisador a propor que a forma de intoxicação védica era de natureza enteogênica."},{"page_url":"https://fr.wikipedia.org/wiki/Kodin_Terra","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/06/Kodin_Terra.jpg","page_title":"Kodin Terra","context_page_description":"Kodin Terra est une chaîne de quincailleries en Finlande.\\nKodin Terra est une filiale de S-Ryhmä."},{"page_url":"https://fr.wikipedia.org/wiki/Tangara_%C3%A0_ventre_roux","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/59/ThlypopsisSmit.jpg","page_title":"Tangara à ventre roux","context_page_description":"Le Tangara à ventre roux est une espèce de passereaux appartenant à la famille des Thraupidae."},{"page_url":"https://fr.wikipedia.org/wiki/Zoom_climb","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/06/McDonnell_XF4H-1_Phantom_II_being_launched_from_USS_Independence_%28CVA-62%29%2C_circa_in_1959.jpg","page_title":"Zoom climb","context_page_description":"En aéronautique, un « zoom climb » est une manœuvre faisant appel à une technique de pilotage particulière, qui donne à un avion une vitesse ascensionnelle plus importante que la vitesse ascensionnelle maximale théorique prévue par son constructeur. Cette dernière est en effet essentiellement liée à la puissance ou à la poussée produite par les moteurs de l'appareil, et est donc limitée à une certaine valeur continue, qu'il est normalement impossible de dépasser en conditions de vol standard.\\nIl n'existe pas de traduction exacte de ce terme anglophone, sa traduction littérale étant « montée zoom », mais un terme français pouvant s'en rapprocher et décrivant le mieux ce type de manœuvre pourrait être « montée en flèche », ou « montée rapide »."},{"page_url":"https://es.wikipedia.org/wiki/Sector_Botanica","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c9/Botanica_Chisinau.jpg","page_title":"Sector Botanica","context_page_description":"Botanica es uno de los cinco sectores en los que se divide administrativamente Chișinău, la capital de Moldavia. La administración local se rige por un pretor nombrado por la administración de la ciudad. Gobierna sobre una parte de la ciudad de Chișinău, la ciudad de Sîngera y la comuna de Băcioi. La densidad de rusos y ucranianos es un poco más alta que en otros barrios de la capital.\\nBotanica es uno de los sectores más pintorescos de Chișinău, pues alberga un zoológico y un jardín botánico, que da nombre al sector. El sector es de fácil acceso desde el resto de la ciudad y también incluye un centro comercial y el segundo estadio más grande de Moldavia, el estadio Zimbru."},{"page_url":"https://gl.wikipedia.org/wiki/Cangas,_Cangas","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/28/Colexiata_de_Santiago_e_San_Salvador_de_Cangas.jpg","page_title":"Cangas, Cangas","context_page_description":"Santiago e San Salvador de Cangas é unha parroquia que se localiza no sueste do concello de Cangas. Segundo o padrón municipal de 2014 tiña 6936 habitantes, 1027 máis ca en 1999. Están distribuídos nunha entidade de poboación, a vila de Cangas."},{"page_url":"https://en.wikipedia.org/wiki/Piton_des_Neiges_%E2%80%93_Gros_Morne_Important_Bird_Area","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7d/Piton_des_neiges.jpg","page_title":"Piton des Neiges – Gros Morne Important Bird Area","context_page_description":"Piton des Neiges – Gros Morne Important Bird Area is a 2,000-hectare tract of land on the island of Réunion, a French territory in the western Indian Ocean."},{"page_url":"https://war.wikipedia.org/wiki/Gerreidae","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/49/Kurosagi1201.jpg","page_title":"Gerreidae","context_page_description":"An Gerreidae in uska familia han Actinopterygii. An Gerreidae in nahilalakip ha ordo nga Perciformes, classis nga Actinopterygii, phylum nga Chordata, ngan regnum nga Animalia. An familia nga Gerreidae in naglalakip hin 53 ka mga species, sumala ha Catalogue of Life.\\nAn kladograma hini sumala ha Catalogue of Life:"},{"page_url":"https://it.wikipedia.org/wiki/Nezu_(metropolitana_di_Tokyo)","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/36/Nezu_Station_Tokyo_Interior_Platform_One.JPG","page_title":"Nezu (metropolitana di Tokyo)","context_page_description":"Nezu è una stazione della metropolitana di Tokyo, si trova a Bunkyō. La stazione è servita dalla linea Chiyoda della Tokyo Metro."},{"page_url":"https://pt.wikipedia.org/wiki/Hymenochirus","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/09/Karlik-szponiasty02.jpg","page_title":"Hymenochirus","context_page_description":"Hymenochirus é um género de rãs da família Pipidae. Está presente em África desde a Nigéria e Camarões, no Sul até ao Gabão e para Este ao longo da bacia hidrográfica do Rio Congo."},{"page_url":"https://en.wikipedia.org/wiki/Rudice_(Blansko_District)","image_url":"http://upload.wikimedia.org/wikipedia/commons/f/f1/Windmills_in_Rudice.JPG","page_title":"Rudice (Blansko District)","context_page_description":"Rudice is a village and municipality in Blansko District in the South Moravian Region of the Czech Republic.\\nThe municipality covers an area of 4.95 square kilometres, and has a population of 910.\\nRudice lies approximately 7 kilometres south-east of Blansko, 17 km north-east of Brno, and 186 km south-east of Prague."},{"page_url":"https://fr.wikipedia.org/wiki/Hypog%C3%A9es_de_Fontvieille","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/94/Fontvieille_-_Hypog%C3%A9e_du_Castelet_-_int%C3%A9rieur.jpg","page_title":"Hypogées de Fontvieille","context_page_description":"Les hypogées de Fontvieille, plus anciennement qualifiés d'hypogées d'Arles, ou plus communément d'hypogées d'Arles-Fontvieille, sont des tombes collectives situées sur la commune de Fontvieille dans le département des Bouches-du-Rhône, en France.\\nRépondant imparfaitement à la définition commune de l'hypogée, les dénominations « variables, souvent complexes et embarrassées qui ont servi à définir ce type de monuments, traduisent, de façon très révélatrice, les caractères mixtes de leur architecture ».\\nCes tombes collectives, respectivement dénommées Hypogée de Bounias, Hypogée de la Source, Hypogée du Castelet, et Hypogée de Cordes, auxquelles on associe désormais la grotte-dolmen de Coutignargues, ont toutes été découvertes et fouillées au XIXᵉ siècle."},{"page_url":"https://zh.wikipedia.org/zh-tw/%E4%BB%81%E5%B7%9D%E6%B5%B7%E6%88%98","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/51/Battle_of_Chemulpo.jpg","page_title":"仁川海战","context_page_description":"仁川海戰，是1904年2月9日，日俄戰爭的揭幕戰之一。是役大日本帝國海軍投入了壓倒性的兵力，輕鬆擊敗了俄羅斯帝國海軍駐紮在仁川港的艦艇，俄軍損失兩艘軍艦。由於仁川舊稱「濟物浦」，因此本次戰鬥在一些國外著作里也稱為濟物浦灣海戰。\\n仁川海戰本身僅是一場小規模的戰鬥，戰鬥發生前雙方雖然長期對峙，實際戰鬥僅持續了數十分鐘；戰鬥結果也並未對雙方軍事實力和戰爭形勢造成很大的影響。但是因為各種原因，這場戰鬥事後經過渲染，得到了與其實際規模和軍事意義不相稱的重視。"}]`),T={name:"App",components:{PoemCard:P},data(){return{searchQuery:"",visibleCount:4,poemsData:M,isLoading:!1}},computed:{filteredPoems(){const a=this.searchQuery.trim().toLowerCase();return a?this.poemsData.filter(e=>e.page_title&&e.page_title.toLowerCase().includes(a)||e.context_page_description&&e.context_page_description.toLowerCase().includes(a)):this.poemsData},displayedPoems(){return this.searchQuery.trim()?this.filteredPoems:this.filteredPoems.slice(0,this.visibleCount)},hasMorePoems(){return!this.searchQuery.trim()&&this.visibleCount<this.poemsData.length}},methods:{async loadMore(){this.isLoading=!0,await new Promise(a=>setTimeout(a,1e3)),this.visibleCount+=4,this.isLoading=!1}}},L={class:"search-container"},I={class:"card-container"},F={key:0,class:"empty-state"},G=["disabled"],R={key:0},H={key:1};fun